INSERT INTO `informe` (`id`, `informe_cod`, `t_informe`, `numdoc`, `paciente`, `telefono`, `sexo`, `edad`, `entidad`, `eps`, `cups`, `valor`, `medRemitente`, `fec_muestra`, `fec_inf`, `fec_ingreso`, `patologo`, `macro`, `micro`, `diagnostico`, `inmuno`, `observaciones`) VALUES
	(2, 'Q2101-1542', 'Q', '33107794', 'ROSARIO BRIEVA ORTEGA', '010101', 'F', '1968/04/06', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', NULL, NULL, 'Dr. CESAR ORTIZ', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Anto gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con agregados linfoides , actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(3, 'Q2101-1543', 'Q', '7306146', 'CEDRICK CONTRERA GUARDO', '3005274659', 'F', '1984/07/19', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', NULL, NULL, 'Dr.BEATRIZ HELENA LINCE', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan antro gastrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE', '', ''),
	(4, 'Q2101-1544', 'Q', '73105307', 'RICARDO PEREZ ALCALA', '3114285736', 'M', '1963/12/06', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', NULL, NULL, 'Dr. CESAR ORTIZ', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ileon distal" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Ciego" múltiples fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que hacen un volumen de 1 ml. Se toma todo y se rotulan B.\r\n3. "Colon sigmoides" múltiples fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que juntos hacen un volumen de 1 ml. Se toma todo y se rotulan C.\r\n4. "Recto" cuatro fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan D.', 'Los cortes de A revelan ileon sin cambios.\r\nLos cortes de B y C revelan colon cuya lámina propia presenta un infiltrado inflamatorio difuso severo constituido por linfocitos, plasmocitos y PMN neutrófilos. Hay disminución del moco glandular y áreas de ulceración, las glandulas presentan distorsión de la arquitectura y ramificaciones.\r\nLos cortes D muestran estructuras compuestas por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n', ' Biopsia endoscópica de colon:\r\n1.ILEON SIN CAMBIOS\r\n\r\n2.COLITIS CRÓNICA ACTIVA COMPATIBLE CON COLITIS ULCERATIVA\r\n\r\n3.ADENOMAS TUBULARES', '', ''),
	(5, 'Q2101-1545', 'Q', '1047422568', 'LUIS GABRIEL TOVAR CARMONA', '3135189362', 'M', '2008/02/23', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', NULL, NULL, 'Dr. PASTOR THOMAS OLIVARES', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglio cervical derecho" se recibe una formación nodular, de forma ovoide que mide 1 x 0.6 cms. de color blanquecino y consistencia elástica. La superficie es lisa.\r\n\r\n', 'Ganglio linfático cuya arquitectura se encuentra conservada, hay foliculos linfoides de diferentes formas y tamaños rodeados por un manto linfociticos maduros.\r\n\r\n\r\n\r\n', ' Ganglio linfático cervical derecho:\r\n-HIPERPLASIA FOLICULAR REACTIVA\r\n', '', ''),
	(6, 'Q2101-1546', 'Q', '1050719827', 'DANIRYS AURORA DIAZ TORRES', '3116892698', 'F', '2006/05/01', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', NULL, NULL, 'Dr. OSCAR ENRIQUE ROMERO', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotula A.\r\n2. "Estómago-antro" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotula B.\r\n3. "Duodeno #1" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan C.\r\n4. "Duodeno #2" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotulan D. \r\n', 'Los cortes de A y B revelan antro gastrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad severa, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes C y D revelan duodeno cuya morfología se encuentra conservada, hay ligero edema y congestión. No se observa granulomas ni parasitos intestinales.', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD SEVERA\r\n-H.PYLORI PRESENTE, antro\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENO SIN CAMBIOS', '', ''),
	(7, 'Q2101-1547', 'Q', '1142914352', 'RINA MARCELA ALFARO GOMEZ', '3105142432', 'F', '2006/04/28', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', NULL, NULL, 'Dr. PASTOR THOMAS OLIVARES', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Fibroadenoma mama derecha" una masa irregular, multilobulada de tejido de color blanquecino que mide 3 x 2 cms. Al corte una superficie multinodular. Se toman cortes y se rotulan A.\r\n2. "Fibroadenoma mama izquierda" una masa irregular, multilobulada de tejido de color blanquecino que mide 3 x 2.5 x 1.5 cms. Al corte una superficie multinodular. Se toman cortes y se rotulan B.', 'Los cortes de A y B revelan tumores benignos compuestos por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n', '1.Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n2.Resección de masa en mama izquierda:\r\n-FIBROADENOMA', '', ''),
	(8, 'Q2101-1548', 'Q', '22798927', 'LUZ MARY CHIQUILLO CHIQUILLO', '46155555', 'F', '1976/10/06', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', NULL, NULL, 'Dr. GUSTAVO CARBALLO MASS', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Restos ovulares" se recibe fragmento irregular de tejido de aspecto membranoso de color pardo oscuro que mide 5 x 2.5 cms. Se toman cortes.\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-RESTOS OVULARES\r\n\r\n', '', ''),
	(9, 'Q2101-1549', 'Q', '9312624', 'EDILBERTO VILLALBA VIERA', '0000', 'M', '1968/07/10', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Piel en región perianal" se reciben diminutos fragmentos de tejido de forma irregular de color blanquecino que juntos hacen un volumen de 0.4 ml. Se toma todo y se intenta procesar.\r\n\r\n\r\n', 'Fragmentos sueltos de epitelio escamoso con hiperqueratosis.\r\n\r\n\r\n', ' Biopsia de piel región perianal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(10, 'Q2101-1550', 'Q', '9096608', 'ALEXANDER SANCHEZ BARCASNEGRAS', '000', 'M', '1977/10/20', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(11, 'Q2101-1551', 'Q', '1003100312', 'JOSE LUIS JULIO DIAZ', '000', 'M', '2000/08/25', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', NULL, NULL, 'Dr. EDUARDO QUINTERO MARTINEZ', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo oscuro. Al corte salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(12, 'Q2101-1552', 'Q', '45475264', 'OLGA PATRICIA SOTOMAYOR POLO', '000', 'F', '1967/03/03', 'PARTICULAR', 'PARTICULAR', NULL, NULL, 'Dr. OSCAR JESUS FLOREZ', NULL, '2021-02-15', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Lipoma en cuero cabelludo" se recibe una masa de tejido, de forma ovoide que mide 2 x 1.5 x 1 cms. de color pardo grisáceo y consistencia elástica. Al corte una superficie blanquecina, lisa. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan tumor maligno constituido por una proliferación de células grandes, pleomorficas de nucleos vesiculares, citoplasma claro, otras fusiformes hipercromáticas, se observan figuras de mitosis.\r\n\r\n\r\n', ' Resección de masa en cuero cabelludo:\r\n-TUMOR MALIGNO MAL DIFERENCIADO\r\n\r\n\r\n\r\nOBSERVACIONES: Es necesario practicar estudios de inmunihistoquímica para una definición diagnóstica precisa.\r\n', '', 'Se retiran 3 bloques por la señora RUTH TRIANA POLO CC. 35.196.466 (15 de febr/2021)'),
	(13, 'Q2101-1553', 'Q', '1010110750', 'EDWIN DE JESUS NAVARRO MORELOS', '000', 'M', '2000/06/16', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-15', '2021-01-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori en escasa cantidad. No se observa atrófia, metaplasia ni displasia.\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(14, 'Q2101-1554', 'Q', '45429962', 'JULIA BARRIOS DE FERNANDEZ', '000', 'F', '1956/07/31', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-15', '2021-01-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(15, 'Q2101-1555', 'Q', '1005964517', 'CARLOS BERMUDEZ MORALES', '000', 'M', '2000/09/04', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. EDUARDO QUINTERO MARTINEZ', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Mamoplastia reducción mama derecha" se recibe, masa de tejido que pesa 83 gms. y mide 10 x 4 x 3 cms. de color amarillo y consistencia elástica. Al corte una superficie blanquecina. \r\n\r\n', 'Los cortes revelan mama que muestra canaliculos con discreta hiperplasia epitelial, el estroma colagenizado.\r\n\r\n\r\n', ' Mamoplastia por reducción de mama derecha:\r\n-GINECOMASTIA\r\n\r\n', '', ''),
	(16, 'Q2101-1556', 'Q', '73153420', 'EFREN RODRIGUEZ MARTELO', '00', 'M', '1972/06/11', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. EDUARDO QUINTERO MARTINEZ', NULL, '2021-01-14', '2021-01-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados se reciben:\r\n1. "Mama derecha" masa irregular que mide 7 x 5 x 3 cms. de color amarillo y aspecto adiposo que pesa 52 gms. Al corte superficie multinodular de aspecto adiposo. Se toman cortes y se rotulan A.\r\n2. "Mama izquierda" masa irregular que mide 8x 6 x 3 cms. de color amarillo y aspecto adiposo que pesa 60 gms. Al corte superficie multinodular de aspecto adiposo. Se toman cortes y se rotulan B.\r\n', 'Los cortes de A y B revelan mama constituidas en su mayoría por tejido adiposo con escasos canaliculos.\r\n\r\n\r\n', '-GINECOMASTIA MAMA DERECHA E IZQUIERDA\r\n\r\n', '', ''),
	(17, 'Q2101-1557', 'Q', '64521354', 'APOLONIA DIAZ BERRIO', '00', 'F', '1972/10/06', 'LIGA CONTRA EL CANCER', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Dra. LILY VILLARREAL', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe una masa de tejido parcialmente cubierta por piel que mide 3.2 x 1.8 x 1.8 cms. en la piel se observa en su parte central una zona de aspecto ulcerado, redondeado de 0.8 cms. de diámetro por debajo de esta se encuentra un tejido de aspecto graso. Al corte por debajo de la zona descrita se encuentra un área de color negro, de 1 cm. de diámetro. El contenido de color negro se desprende dejando una cavidad. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran piel por debajo de la cual se encuentra una cavidad quística tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n', ' Resección de lesión en pierna izquierda:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(18, 'Q2101-1558', 'Q', '45693949', 'ODELIN PEREZ VILLALOBOS', '00', 'F', '1978/10/02', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro gástrico" se recibe un fragmento de tejido de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(19, 'Q2101-1559', 'Q', '9176321', 'RAFAEL GONZALEZ OVIEDO', '00', 'M', '1974/12/13', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', NULL, NULL, 'Dr. HERNAN CALDERON', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apendicectomía" se recibe un apéndice cecal que mide 7 x 2 cms. en sus mayores dimensiones, la superficie externa es irregular, de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene material fecal, hacia la base se encuentra un fecalito que obstruye completamente la luz. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(20, 'Q2101-1560', 'Q', '33159533', 'CARMEN MONTES LAGARES', '000', 'F', '1956/05/26', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(21, 'Q2101-1561', 'Q', '33198831', 'YANETH JIMENEZ LOZANO', '00', 'F', '1964/05/01', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, '', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro gástrico" se recibe un fragmento de tejido de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(22, 'Q2101-1562', 'Q', '73227143', 'PEDRO HERNANDEZ BARRIOS', '00', 'M', '1972/02/03', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(23, 'Q2101-1563', 'Q', '33134096', 'MARIA ZARATE ARNEDO', '000', 'F', '1944/09/18', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. PEDRO IMBETH ACOSTA', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(24, 'Q2101-1564', 'Q', '54258683', 'BETTINA GONZALEZ BUENAÑOS', '000', 'F', '1972/03/03', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Dr. SAMUEL CANTILLO VILLAR', NULL, '2021-01-15', '2021-01-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Histerectomía abdominal subtotal-Utero, ovario derecho + trompa derecha y izquierda" en un mismo recipiente, se recibe un cuerpo uterino que pesa 203 gms., un ovario y dos fragmentos irregulares de tejido. El cuerpo está aumentado de tamaño cubierto por una serosa despulida y mide 7 x 8 x 6 cms. en sus mayores dimensiones. Al corte la cavidad endometrial esta tapizada por una mucosa irregular de color rosado. En el miometrio se encuentran nódulos blanquecinos cuyos diámetros oscilan entre pocos milimetros y 1.5 cms. Se toman cortes.\r\nEl ovario mide 3 x 2 x 1 cms. con una superficie externa irregular y una superficie de color homogeneo, se recibe además dos fragmentos de tejido de forma irregular, uno de ellos con una estructura quística que contiene un material de aspecto gelatinoso. Se toman cortes.\r\n\r\n', 'El endometrio está autólisado. Las masas miometriales estan compuestas por fibras musculares lisas dispuestas irregularmente en haces entrecruzadas y ovillos. Las trompas y el ovario son normales.\r\n\r\n\r\n', ' Cuerpo uterino, trompas y ovario derecho:\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS INTRAMURALES\r\n-TROMPAS DE FALOPIO\r\n-OVARIO DERECHO', '', ''),
	(25, 'Q2101-1565', 'Q', '1237440569', 'MARIELA LLAMAS PATRON', '00000', 'F', '2003/01/15', 'PARTICULAR', 'PARTICULAR', NULL, NULL, '', NULL, '2021-01-15', '2021-01-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de cervix" se recibe un fragmento de tejido de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Cervix tapizado por epitelio escamoso que muestra hiperplasia del epitelio y cambios coilociticos asociados, el estroma infiltrado por linfocitos, plasmocitos y neutrófilos.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE BAJO GRADO (CONDILOMA)\r\n\r\n', '', ''),
	(26, 'Q2101-1566', 'Q', '22808886', 'ISMENIA SALGADO CARIAGA', '000', 'F', '1980/07/13', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, '', NULL, '2021-01-15', '2021-01-15', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa izquierda" se recibe un fragmento de trompa que mide 1 cms. Al corte se observa la estructura usual. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" se recibe un fragmento de trompa que mide 1.3 cms. Al corte se observa la estructura usual. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA IZQUIERDA. SEGMENTO\r\n2.TROMPA UTERINA DERECHA. SEGMENTO\r\n', '', ''),
	(27, 'Q2101-1567', 'Q', '45502280', 'MONICA DEL CARMEN ALCALA JARAMILLO', '3008057455', 'F', '1972/06/25', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, '', NULL, '2021-01-15', '2021-01-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(28, 'Q2101-1568', 'Q', '64549208', 'MABEL MONTES PARDO', '000', 'F', '1960/03/06', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, '', NULL, '2021-01-15', '2021-01-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Antro gástrico con focos de ulceración cuya lámina propia esta infiltrada por linfocitos, plasmocitos y neutrófilos en cantidad moderada en la luz de algunas glandulas, se observa H.pylori en poca cantidad. En la muestra no se observa metaplasia ni cambios displasicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA ULCERADA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(29, 'Q2101-1569', 'Q', '1005220751', 'MARIA JOSE RIOS AVILA', '000', 'F', '2001/05/10', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, '', NULL, '2021-01-15', '2021-01-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(30, 'Q2101-1570', 'Q', '8726447', 'IGNACIO JIMENEZ PRADA', '00000', 'M', '1962/12/09', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, 'Doctor: CESAR ORTIZ', NULL, '2021-01-15', '2021-01-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA PO RH.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(31, 'Q2101-1571', 'Q', '30761404', 'ALMA ROSA OROZCO BELTRAN', '000', 'F', '1961/03/03', 'ORG. CLINICA GENERAL DEL NORTE', '0', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-01-15', '2021-01-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de color blanquecino y consistencia elástica que juntos hacen 0.1 cm. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan cervix atrófico que muestra cambios de una lesión intraepitelial escamosa de bajo grado.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE BAJO GRADO ', '', ''),
	(32, 'Q2101-1572', 'Q', '1044931274', 'JORWING SANCHEZ MESTRE', '000', 'M', '2013/12/03', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor RAFAEL VIVERO CONEO', NULL, '2021-02-18', '2021-01-15', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Quíste dentigeno" se recibe una masa quistica previamente evacuada que mide 4 x 3 x 2 cms. La pared externa es lisa y blanquecina. La pared interna es lisa cubierta por un material amarillento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran una pared fibrosa tapizada por un tejido que contiene macrófagos, algunos multinucleados y otros con contenido de hemosiderina. No se encuentra revestimiento epitelial.\r\n\r\n\r\n', ' Resección de lesión quística en seno maxilar derecho:\r\n-QUÍSTE OSEO SIMPLE\r\n\r\n', '', ''),
	(33, 'Q2101-1573', 'Q', '36505519', 'MARIA HERNANDEZ NUÑEZ', '0000', 'F', '1978/03/03', 'ORG. CLINICA GENERAL DEL NORTE', '0', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-01-15', '2021-01-15', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de color blanquecino y consistencia elástica que mide 0.6 cms. Se toma todo.\r\n\r\n\r\n', 'Cuello uterino con infiltración mononuclear del estroma. No hay cambios de LIE en la muestra enviada. \r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA\r\n\r\n', '', ''),
	(34, 'Q2101-1574', 'Q', '1049535132', 'MATIAS PEREZ RODRIGUEZ', '000', 'M', '2009/04/04', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-01-15', '2021-01-15', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1.5 cms. La pared esta recubierta por material seropurulento. Al corte la pared esta engrosada y el lumen contiene material fecal solidificada. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(35, 'Q2101-1575', 'Q', '1043305714', 'ADONAI HERRERA MEZA', '000', 'M', '2006/10/06', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctora NELLYS RODRIGUEZ ZULETA', NULL, '2021-01-15', '2021-01-15', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Masa en fosa nasal izquierda" se recibe una masa de tejido de color blanquecino, negruzca y pardo claro que mide 2 x 1.5 x 1 cms. Al corte tres formaciones quisticas que contienen un material negruzco, la mayor mide 1 cm. y l amenor de 0.4 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran lesión compuesta vasos capilares dispuestos en un patrón lobulado sobre un estroma de tejido conectivo laxo.\r\n\r\n\r\n', ' Resección de masa en fosa nasal izquierda:\r\n-HEMANGIOMA CAPILAR LOBULADO (GRANULOMA PIOGENO)\r\n\r\n', '', ''),
	(36, 'Q2101-1576', 'Q', '45361226', 'ROSA CABARCAS GUTIERREZ', '0000', 'F', '1984/05/13', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-01-20', '2021-01-22', 'VIRNA CARABALLO OSORIO', 'Sin material de fijación, rotulado "Apéndice" se recibe un apéndice vermiforme que mide 5.5 x 1 cms. em sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo oscuro. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(37, 'Q2101-1577', 'Q', '63299917', 'ROCIO ACEVEDO DE AGUILAR', '0000', 'F', '1962/02/25', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', NULL, NULL, 'Doctor ELKIN ROMERO CAMARGO', NULL, '2021-01-20', '2021-01-22', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa antrocorporal cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n', '', ''),
	(38, 'Q2101-1578', 'Q', '1007210773', 'DENISARA HERRERA HOYOS', '000', 'F', '2001/02/04', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-01-20', '2021-01-22', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 0.5 cms. en sus mayores dimensiones. La superficie externa esta cubierta por una serosa lisa y brillante de color rosado. Al corte se encuentra una luz ligeramente dilatada que contiene un material fecal. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya morfología está preservada. No se encuentra actividad inflamatoria.\r\n\r\n\r\n', ' Apendicectomía:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(39, 'Q2101-1579', 'Q', '45780761', 'ARIANA ZABALETA TAMARA', '3103698813', 'F', '1978/01/01', 'ORG. CLINICA GENERAL DEL NORTE', '0', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-01-21', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de color blanquecino que juntos miden 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Cervix que muestra una lesión intraepitelial escamosa de bajo grado.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE BAJO GRADO\r\n\r\n\r\n', '', ''),
	(40, 'Q2101-1580', 'Q', '1052987206', 'SILFREDO CARPIO CASTRO', '0000', 'M', '2012/01/01', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor JESSICA TIPON GALVIS', NULL, '2021-01-15', '2021-01-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa labial inferior" se recibe un fragmento de tejido que mide 1 x 0.6 cms. de color blanquecino y consistencia elástica que presneta una lesión sobreelevada de 0.8 cms. Al corte una formación nodular que mide 0.8 cms. de aspecto mucoide. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan lesión quistica tapizada por tejido de granulación.\r\n\r\n\r\n', ' Resección de lesión en labio inferior:\r\n-MUCOCELE\r\n\r\n', '', ''),
	(41, 'Q2101-1581', 'Q', '1048442302', 'BREINER RODRIGUEZ MARTINEZ', '000', 'M', '', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctora JESSICA TIPON GALVIS', NULL, '2021-01-21', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Lesión lateral de lengua izquierda" se recibe una formación nodular de 0.5 cms. de color blanquecino  y consistencia elástica. Al corte una superficie lisa, blanquecino. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan lesión constituida por una proliferación de fibroblastos uniformes, con escaso colageno, tapizada por epitelio escamoso maduro.\r\nNo se identifican figuras de mitosis.\r\n\r\n\r\n\r\n', ' Resección de lesión en lengua:\r\n-FIBROMA\r\n\r\n', '', ''),
	(42, 'Q2101-1582', 'Q', '1044004502', 'MARIA FERNANDEZ RIOS', '0000', 'F', '2016/12/22', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-01-21', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Masa región abdominal" se recibe una masa irregular de tejido de color blanco amarillento que mide 2  x 1 x 0.5 cms. Al corte una superficie amarillenta de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo sin cambios.\r\n\r\n\r\n\r\n', '-FRAGMENTOS DE TEJIDO FIBROADIPOSO, región abdominal\r\n\r\n', '', ''),
	(43, 'Q2101-1583', 'Q', '1238343460', 'MARIANYS BUSTAMANTE ORTEGA', '0000', 'F', '2019/05/30', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-01-21', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste" se recibe fragmento irregular de tejido que mide 1 cm. de color blanco amarillento. Al corte formación quistica de 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan lesión quistica tapizada por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n', '-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE, cuello\r\n\r\n\r\n', '', ''),
	(44, 'Q2101-1584', 'Q', '1043643506', 'OSCAR FLOREZ PINTO', '000', 'M', '2005/07/28', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctora JESSICA TIPON GALVIS', NULL, '2021-01-27', '2021-01-15', 'OLIVA MARRUGO GRICE', 'ulado "Lesión en mucosa yugal izquierda" se recibe una fromación nodular de color blanquecino y consistencia elástica que mide 1 x 0.5 cms. Al corte una superficie blanca , lisa. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan lesión tapizada por epitelio escamoso que descansa en un estroma fibroso con colageno interpuesto.\r\n\r\n\r\n\r\n', '-FIBROMA, mucosa yugal izquierda\r\n\r\n', '', ''),
	(45, 'Q2101-1585', 'Q', '1048465032', 'BELLA PEREZ OLIVARES', '0000', 'F', '2019/05/22', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor SUANNY GONZALEZ COQUEL', NULL, '2021-01-21', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Cuerpo extraño orofaringe" se recibe fragmento irregular de tejido que mide 3 x 2 cms. de color blanco amarillento y consistencia friable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tejido que muestra cambios severos de autólisis.\r\n\r\n\r\n', ' Cuerpo extraño orofaringe:\r\n-MATERIAL AUTÓLISADO\r\n\r\n\r\n', '', ''),
	(46, 'Q2101-1586', 'Q', '1051884848', 'KATY LUZ MUÑOZ SOLANO', '000', 'F', '2004/08/29', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-01-21', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Fibroadenoma - mama izquierda" se recieb una masa ovoide que mi 4 x 3 x 2 cms. de color blanquecino y consistencia elástica. Al corte una superficie multinodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(47, 'Q2101-1587', 'Q', '1201258314', 'ZARECK ORTIZ DIAZ', '000', 'F', '2016/10/04', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-01-27', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Nevo melanocitico" se recibe una elipse de piel que mide 0.5 cms. de color pardo claro y consistencia elástica. Se toma todo.\r\n\r\n\r\n', 'los cortes revelan piel en cuyo dermis se observa un infiltrado denso de células poligonales de bordes citoplasmaticos poco definido, se observa además linfocitos dispersos.\r\n\r\n\r\n', ' Biopsia de piel de parpado inferior derecho:\r\n-XANTOGRANULOMA JUVENIL\r\n\r\nNOTA: Caso estudiado en conjunto con los doctores José Caraballo y Ana Magola Manga.', '', ''),
	(48, 'Q2101-1588', 'Q', '45691883', 'MAYERLIN LEMUS LUNA', '0000', 'F', '1978/11/15', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor LUIS ALCAZAR GONZALEZ', NULL, '2021-01-21', '2021-01-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo grisáceo. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(49, 'Q2101-1589', 'Q', '1043296355', 'KELLY PAUTT GUZMAN', '0000', 'F', '2003/11/30', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', NULL, NULL, 'Doctor JOSÉ LUIS ACEVEDO', NULL, '2021-01-25', '2021-01-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Placenta" se recibe una placenta con sus membranas que pesa 460 gms. y mide 16 x 14 x 3 cms. en sus mayores dimensiones, en la cara fetal se encuentra un segmento de cordon umbilical de implantación central que mide 11 cms. de longitud. En la misma cara se observa una protuberancia redondeada, de color violáceo que mide 8 x 6 cms. La cara materna muestra los cotiledones completos, las membranas conservan su aspecto habitual. Al corte del área descrita como protuberancia se encuentran grandes vasos que contienen coágulos sanguineos. Estos vasos se extienden hasta los límites de la placenta y sus membranas. El resto del tejido placentario conserva su forma habitual. Se toman cortes.\r\n\r\n', 'Los cortes muestran placenta del tercer trimestre en la que se observa un foco de proliferación de vasos capilares que alternan con grandes espacios vasculares con contenido de sangre. En la periferia de esta zona se observan focos de microcalcificaciones distróficas. El resto del tejido placentario es morfológicamente normal. El cordon tiene dos vasos arteriales y uno venoso.\r\n\r\n\r\n', ' Placenta del tercer trimestre (460 gms.):\r\n-HEMANGIOMA PLACENTARIO (CORANGIOMA)\r\n\r\n', '', ''),
	(50, 'Q2101-1590', 'Q', '9113787', 'EDGAR VARGAS  ANILLO', '00000', 'M', '1959/08/24', 'ORG. CLINICA GENERAL DEL NORTE', '0', NULL, NULL, '', NULL, '2021-01-22', '2021-01-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Colecistectomía" se recibe una vesícula biliar que mide 6 x 1.5 cms. en sus mayores dimensiones, la superficie externa es irregular parcialmente cubierta por una serosa despulida. Al corte las paredes son gruesas, aspecto fibroso y en la luz se encuentra un calculo ovoide de color verde oscuro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar cuya mucosa muestra abundantes histiocitos cargados de lípidos en las puntas de las vellosidades. Hay infiltrado mononuclear de la lámina propia y cambios hipertróficos del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n-COLESTEROLOSIS\r\n\r\n', '', ''),
	(51, 'Q2101-1591', 'Q', '1043967486', 'DONIS HERAZO GARCIA', '00000', 'F', '2005/04/28', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Dcotor LUIS MORENO', NULL, '2021-01-22', '2021-01-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apendice" se recibe un apéndice cecal que mide 8 x 1.5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo claro con áreas violáceas. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(52, 'Q2101-1592', 'Q', '1143364483', 'SERGIO ANDRES TORRES VIVES', '000', 'M', '1993/04/05', 'CLIN. SAN JOSE DE TORICES SAS', 'Coosalud', NULL, NULL, 'Doctor EDUARDO QUINTERO', NULL, '2021-01-22', '2021-01-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se reciben dos fragmentos de tejido, uno de ellos de forma irregular y el otro de forma tubular. el fragmento de forma irregular mide 5 x 1.3 x 1 cms. y presenta al corte un aspecto de tejido grado, el fragmento tubular mide 5 x 1.3 cms. y muestra una luz ligeramente dilatada sin contenido aparente. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(53, 'Q2101-1593', 'Q', '1032443267', 'MARIA BELTRAN DIAZ', '0000', 'F', '1992/03/03', 'SEGUROS BOLIVAR S.A', '0', NULL, NULL, 'Doctor ORLANDO BUSTILLO', NULL, '2021-01-27', '2021-01-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de cervical" se reciben cuatro fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan cervix tapizado por epitelio escamoso con focos de una lesión intraepitelial escamosa de alto grado, hay cambios coilociticos asociados, el estroma infiltrado por linfocitos y plasmocitos.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE ALTO GRADO (NIC II)\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(54, 'Q2101-1594', 'Q', '1047382072', 'MIRYAM MELENDEZ SANCHEZ', '00000', 'F', '1986/03/05', 'GASTROPACK SAS', 'PARTICULAR', NULL, NULL, 'Doctor: CESAR ORTIZ', NULL, '2021-01-27', '2021-01-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de polipo cuerpo gastrico" se reciben diminutos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-PÓLIPO DE GLÁNDULAS FÚNDICAS\r\n\r\n', '', ''),
	(55, 'Q2101-1595', 'Q', '1237439985', 'YOBANNA ISABEL BERRIO ALVARADO', '000', 'F', '2007/11/08', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Dcotora CLAUDIA YAMAL MATTOS', NULL, '2021-01-27', '2021-01-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben cuatro fragmentos de tejido de froma irregular de color blanquecino y consistencia blanda el mayor mide 1.5 x 1 cms. y el menor de 0.3 cms. Se toma muestra.\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n\r\n', '', ''),
	(56, 'Q2101-1596', 'Q', '1142930508', 'MOISES HERRERA DELGADO', '0000', 'M', '2011/01/02', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-01-27', '2021-01-22', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" una masa de tejido de forma ovoide, que mide 2  x 1 x 0.5 cms. Al corte una superficie multinodular de color rosado. Se toman cortes y se rotulan A.\r\n2. "Amigada izquierda" una masa de tejido de forma ovoide, que mide 1.8  x 1.7 x 0.5 cms. Al corte una superficie multinodular de color rosado. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(57, 'Q2101-1597', 'Q', '1043963645', 'NATALIA MORALES VALDES', '0000', 'F', '2004/09/16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-01-27', '2021-01-22', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama supernumeraria izquierda" masa de tejido de forma ovoide de aspecto fibroadiposo, consistencia elástica que mide 4 x 2.2 x 2 cms. Al corte una superficie de color amarillento y aspecto adiposo. Se toman cortes y se rotulan A.\r\n2.  "Mama supernumeraria derecha" masa de tejido de forma ovoide de aspecto fibroadiposo, consistencia elástica que mide 6 x 4 x 2 cms. Al corte una superficie de color amarillento y aspecto fibroadiposo. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan tejido fibroadiposo que contiene lobulillos y canaliculos mamarios.\r\n\r\n\r\n', '1.MAMA SUPERNUMERARIA IZQUIERDA\r\n2.MAMA SUPERNUMERARIA DERECHA\r\n\r\n', '', ''),
	(58, 'Q2101-1598', 'Q', '1051885670', 'KAREN HENRIQUEZ JIMENEZ', '000', 'F', '1987/08/31', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Dcotor ANGEL VASQUEZ PAJARO', NULL, '2021-02-01', '2021-01-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Placenta" se recibe una placenta que pesa 95 gms. y mide 9 x 7 cms. Trae adhereido un segmento de cordon umbilical de 30 cms. La cara fetal es de aspecto membranoso, blanquecina, la cara materna presneta múltiples cotiledones de color gris, el cordon umbilical al corte esta constituido po rtres vasos. S etoman cortes.\r\n\r\n\r\n', 'Los cortes muestran placenta del segundo trimestre en la que se aprecia marcado cambio hidrópico de las vellosidades. Estas contienen vasos y están tapizadas por cito y sinciciotrofoblasto sin alteraciones. El cordón tiene 2 vasos arteriales y uno venoso.\r\n\r\n\r\n', ' Placenta del segundo trimestre (95 gms.):\r\n-CAMBIO HIDRÓPICO DE LAS VELLOSIDADES\r\n\r\n\r\n', '', 'Los hallazgos descritos son característicos de muerte fetal in-utero.\r\n'),
	(59, 'Q2101-1599', 'Q', '45494801', 'MEDLINA POMARE PEDROZA', '0000', 'F', '1971/03/03', 'LIGA CONTRA EL CANCER', 'PARTICULAR', NULL, NULL, 'Doctora SONIA LONDOÑO ', NULL, '2021-01-27', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Biopsia de cervix" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que juntos hacen 1.5 x 0.5 cms. Se toma todo\r\n\r\n\r\n', 'Cuello uterino con infiltración mononuclear del estroma. No hay cambios de LIE en la muestra enviada. \r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA\r\n\r\n', '', ''),
	(60, 'Q2101-1600', 'Q', '73070213', 'ARQUIMEDES JARABA GARAY', '3205674573', 'M', '1956/07/04', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-01-27', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.8 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(61, 'Q2101-1601', 'Q', '8638331', 'ALVARO RUBEN VILLAVECES REALES', '3008156245', 'M', '1959/08/16', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-01', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'En recipientes separados y rotualdos, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo y se rotula A.\r\n2. "Antro" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que juntos miden 0.8 cms. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran mucosa esofágica con discreto edema e infiltración mononuclear de la lámina propia.\r\nLos cortes rotulados B muestran mucosa gástrica antral con leve congestión de la lámina propia.\r\n\r\n\r\n', '1.Biopsia endoscópica de esofago:\r\n-ESOFAGITIS CRÓNICA LEVE\r\n2.Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GASTRICA ANTRAL\r\n\r\n', '', ''),
	(62, 'Q2101-1602', 'Q', '1193371842', 'YENIFER SANDOVAL LOPEZ', '000', 'F', '1992/03/13', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', NULL, NULL, 'Doctor EDUARDO QUINTERO', NULL, '2021-01-27', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.6 cms. Los vasos sanguineos se encuentran ingurgitados. Al corte la pared esta engrosada y el lumen contiene material fecal solidificada. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(63, 'Q2101-1603', 'Q', '1048438520', 'NATALIA PUELLO AYCARDI', '000', 'F', '2005/11/17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-01-27', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Vesícula" se recibe una vesícula bilair que mide 6.5 x 1.5 cms. esta cubierta por una serosa despulida, viene previamente evacuada, la pared esta engrosada y la mucosa ha sido reemplazada parcialmente por tejido fibroso y se observan calculos de diferentes tamaños, elmayor mide 1 cm. y el mneor de 0.5 cms. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(64, 'Q2101-1604', 'Q', '1235039943', 'YEIKOL RODRIGUEZ MEZA', '3044362670', 'M', '2012/06/08', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor JOSE PRETELT MENDOZA', NULL, '2021-01-27', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Granuloma" se reciben dos fragmentos de tejido el mayor redondeado mide 1.5 x 1.2 cms. y el menor aplanado mide 1.5 cms. de color grisáceo y negruzco. Al corte del mayor trae una formación quistica llena de un material gelatinoso, grisáceo, blanquecino, el menor tejido aplanadao negruzco, blanquecino. Se toman cortes .\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso, debajo de este se observa una proliferación de capilares rodeado por células inflamatorias tipo linfocitica, plasmaticas y neutrófilos.\r\n\r\n\r\n', ' Extirpación de lesión en cuero cabelludo:\r\n-HEMANGIOMA CAPILAR\r\n\r\n\r\n\r\n', '', ''),
	(65, 'Q2101-1605', 'Q', '1049829737', 'ELY CAROLINA JIMENEZ MEJIA', '3043900773', 'F', '2012/12/10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctora NELLYS RODRIGUEZ ZULETA', NULL, '2021-02-08', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Mucocele" se recibe un fragmento de tejido de color blanquecino con pequeñas formaciones quisticas llenas de un material amarillento que mide 1  x 0.7 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso por debajo del cual se encuentra un material mucoide que contiene pequeñas estructuras glandulares y rechaza perifericamente las glandulas salivares menores.\r\n\r\n\r\n\r\n', ' Resección de lesión en piso de la boca:\r\n-MUCOCELE\r\n\r\n', '', ''),
	(66, 'Q2101-1606', 'Q', '1043656984', 'DANA LUCIA DORIA SIERRA', '3205232840', 'F', '2008/03/21', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-01-27', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" una amigdala palatina de forma irregular con múltiples formaciones cripticas de color blanco grisáceo que mide 4 x 3 x 2.5 cms. Al corte tejido blanquecino, homogeneo con formaciones cripticas. Se toman cortes y se rotulan A.\r\n2. "Amigdala izquierda" una amigdala palatina de forma irregular con múltiples formaciones cripticas de color blanco grisáceo que mide 4 x 3.5 x 2.5 cms. Al corte tejido blanquecino, homogeneo con formaciones cripticas. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(67, 'Q2101-1607', 'Q', '1002423067', 'JESUS RANGEL TOLOZA', '3225135774', 'M', '1992/02/08', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor LUIS HERRERA ZABALETA', NULL, '2021-01-27', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.5 x 1 cms. Los vasos sanguíneos estan ingurgitados. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado de color blanquecino. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(68, 'Q2101-1608', 'Q', '1007367992', 'ROSA LIÑAN BENITEZ', '0000', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '0', '', '', 'Doctor LAURISELL GUTIERREZ BLANCHAR', NULL, '2021-09-01', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 12.5 x 3 cms. cubierta por una serosa despulida. Viene evacuada. Al corte la apred esta engrosada, la mucosa ha sido reemplazada parcialmente por tejido fibroso, se observan calculos de diferentes tamaños de color amarillento el mayor mide 1 cm. y el menor de 0.3 cms. Se toman cores.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(69, 'Q2101-1609', 'Q', '21187881', 'DIOHANA AVILA DORANTE', '3116647551', 'F', '1994/04/10', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-02-01', '2021-01-27', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Utero + trompas" se recibe un cuerpo uterino que mide 15  x12 x 8 cms. y pesa 813 gms. Al corte la pared uterina mide 4 cms. la cavidad endometrial esta recubierta por coágulos sanguineos y la pared del miometrio mide 1 cm. \r\n\r\nNo se observan las trompas.\r\n\r\n', 'La cavidad endometrial esta parcialmente tapizada por tejido decidual y coágulos sanguineos. En el miometrio se observan focos aislados de glandulas y estroma endometrial.\r\n\r\n\r\n', ' Histerectomía subtotal post-cesarea:\r\n-ENDOMETRIO CON TRANSFORMACIÓN DECIDUAL\r\n-ADENOMIOSIS\r\n\r\n', '', ''),
	(70, 'Q2101-1610', 'Q', '30894137', 'ANA ROMERO CERVANTES', '000', 'F', '1980/03/03', 'ORG. CLINICA GENERAL DEL NORTE', '0', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-01-29', '2021-01-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Polipo endocervical" se reciben dos fragmentos de tejido de forma irregular  decolor pardo claro y consistencia blanda que en conjunto hacen un volumen de 1 ml. y mide 2.2 x 0.6 y 1.5 x 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de una estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL (FRAGMENTOS)\r\n\r\n\r\n', '', ''),
	(71, 'Q2101-1611', 'Q', '1052969880', 'JOSSIET LASTRE TELLEZ', '3059422401', 'M', '1990/07/08', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', NULL, NULL, 'Doctor ELKIN ROMERO CAMARGO', NULL, '2021-01-29', '2021-01-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(72, 'Q2101-1612', 'Q', '1047466973', 'CATERINE WILCOX DIAZ', '0000', 'F', '1994/03/17', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', NULL, NULL, 'Doctor HERNAN CALDERON', NULL, '2021-01-29', '2021-01-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.6 x 0.7 cms. La superficie externa esta cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(73, 'Q2101-1613', 'Q', '52245982', 'MORAIMA TORRES VASQUEZ', '000', 'F', '1976/01/05', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-01-29', '2021-01-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.6 y 0.3 cms. en su mayor dimesnión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructuta compuesta por epitelio escamoso que rodea un tallo fibrovascular.\r\nOtros cortes muestran un tumor benigno derivado de las glandulas sudoriparas apocrinas compuestas por células epiteliales y mioepiteliales que tapizan un tallo fibrovascular ramificado.\r\n\r\n\r\n', ' Biopsia de vulva:\r\n1.PAPILOMA ESCAMOSO\r\n2.HIDRADENOMA PAPILAR\r\n', '', ''),
	(74, 'Q2101-1614', 'Q', '26162681', 'MARGENIA BURGOS PEREZ', '000', 'F', '1977/12/30', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', NULL, NULL, 'Doctor GUSTAVO CARBALLO', NULL, '2021-01-29', '2021-01-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Restos ovulares" se reciben fragmentos de tejido de aspecto membranoso de color pardo oscuro y consistencia friable que juntos hacen un volumen de 6 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n', ' Legrado uterino.\r\n-RESTOS OVULARES\r\n\r\n', '', ''),
	(75, 'Q2101-1615', 'Q', '412', 'YOHANMARIS VELASQUEZ GARCIA', '3124333739', 'F', '2009/08/25', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-02-01', '2021-01-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor cervical" se recibe una masa de tejido que mide 5 x 5 x 2.5 cms. de color blanquecino y consistencia firme. Al corte una superficie blanquecina. lisa. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan tumor benigno constituido por células epiteliales que se disponen en cordones y ductos pequeños, descansan en un estroma condromixoide. El tumor está rodeado por una capsula fibrosa por fuera de la cual se observan fragmentos de glandula submaxilar.\r\n\r\n\r\n', ' Sialoadenectomía de glandula submaxilar derecha:\r\n-ADENOMA PLEOMORFO (TUMOR MIXTO BENIGNO)\r\n\r\n\r\n', '', 'Caso estudiado por los doctores José Caraballo y Olivia Marrugo.'),
	(76, 'Q2101-1616', 'Q', '1042610839', 'JHERONIMO GOMEZ SOLANO', '000', 'M', '2017/12/17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor IVAN JIMENEZ SANCHEZ', NULL, '2021-01-29', '2021-01-28', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Yeyuno proximal" segmento de intestino sin marcación de bordes que mide 6 x 1.5 cms. tapizado por una serosa opaca bien vascularizada de color pardo oscuro, a 1 cm. de uno de los bordes se observa un punto de sutura. Se toman cortes A bordes de resección. Al corte mucosa edematosa y cerca de uno de los bordes hiperhemico. Se toman cortes y se rotulan B.\r\n2. "Borde distal" segmento de intestino mide 3 x 2 cms. tapizado por una serosa opaca bien vascularizada de color pardo oscuro, trae adherido material fibrinopurulento. Se toman cortes asi: C bordes, D área que presenta el exudado purulento.\r\n\r\n', 'Los cortes rotulados yeyuno proximal muestra intestino delgado con inflamación aguda que se extiende hasta la serosa, edema, congestión y áreas de necrosis hemorrágica. Uno de los bordes esta comprometido.\r\nLos cortes rotulados distal muestra intestino delgado con inflamación aguda y focos de necrosis hemorrágica. Uno de los bordes comprometidos.\r\n\r\n', '1.Resección de yeyuno proximal (6 cms.):\r\n-INTESTINO DELGADO CON INFLAMACIÓN AGUDA, NECROSIS HEMORRÁGICA\r\n-UNO DE LOS BORDES COMPROMETIDOS\r\n2.Resección yeyuno distal (3 cms.):\r\n-INFLAMACIÓN AGUDA Y ÁREAS DE NECROSIS HEMORRÁGICA\r\n-UNO DE LOS BORDES COMPROMETIDOS\r\n', '', ''),
	(77, 'Q2101-1617', 'Q', '9087312', 'RAFAEL CABARCAS CABARCAS', '3008318500', 'M', '1953/12/16', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, 'Doctor ISMAEL YEPES', NULL, '2021-02-01', '2021-01-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(78, 'Q2101-1618', 'Q', '22810564', 'HELLEN VASQUEZ AGUILAR', '3147827760', 'F', '1981/01/07', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', NULL, NULL, 'Doctor ISMAEL YEPES', NULL, '2021-02-01', '2021-01-30', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotula A.\r\n2. "Polipo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran lesiones compuestas por glandulas fúndicas dilatadas, algunas microquísticas que se disponen sobre una lámina propia edematosa con leve infiltración mononuclear.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Resección de estructuras polipoides en unión antro-corporal:\r\n-PÓLIPOS DE GLANDULAS FÚNDICAS\r\n', '', ''),
	(79, 'Q2101-1619', 'Q', '7919696', 'JHON RAIGOSA OSPINA', '3002084224', 'M', '1978/05/13', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', NULL, NULL, 'Doctor ISMAEL YEPES', NULL, '2021-02-11', '2021-01-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Polipo de recto" recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 1 cms. en su mayor dimensión. Se toma todo en dos cortes\r\n\r\n\r\n', 'El especímen está compuesto por mucosa colónica con mínimas alteraciones que reposa en un nucleo que contiene una neoplasia compuesta por células pequeñas de núcleos redondeados y citoplasma anfofílico que se disponen en un patrón predominantemente sólido. En algunas áreas las células se disponen en estructuras de dos o más células conformando cintas de una o dos capas.\r\n\r\n\r\n', ' Biopsia incisional de lesión polipoide en recto:\r\n-COMPATIBLE CON TUMOR CARCINOIDE\r\n\r\n', '', 'Es imperativo practicar estudios de inmunohistoquímica para definir diagnóstico.\r\n\r\n\r\n\r\nNOTA:_ Se retiran 2 bloques por el señor JHON RAIGOSA OSPINA CC. 7919696 (11 feb/21)'),
	(80, 'Q2101-1620', 'Q', '1201251278', 'BRITANY BOLIVAR CONTRERAS', '3217657173', 'F', '2015/12/03', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-02-01', '2021-01-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Verruga en rodilla derecha" se recibe recibe un fragmento de tejido, aplanado de color pardo claro y consistencia firme que miden 0.7 cms. en su mayor diámetro. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por epitelio escamoso dispuesto en un patrón papilomatoso y acantótico con marcada hiperqueratosis e hipergranulosis.\r\n\r\n\r\n', ' Resección de lesión en piel de rodilla derecha:\r\n-VERRUGA VULGAR\r\n\r\n', '', ''),
	(81, 'Q2101-1621', 'Q', '1201222704', 'JHORLAN MORALES REYES', '3216130927', 'M', '2010/08/31', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-02-01', '2021-01-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quíste epidermico en espalda" se reciben dos fragmentos de tejido de forma irregular de color amarillento y aspecto graso, uno de ellos cubierto parcialmente por una elipse de piel mide 0.6 cms. en su mayor diámetro miden respectivamente 1.8 y 1.5 cms. Uno de ellos contiene un nódulo. Se corta el nódulo descrito encontrandose una superficie irregular de aspecto calcificado. S etoman cortes.\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno derivado de los anexos cutáneos, compuestos por células basaloides que alternan con otras de nucleos vacuolados y citoplasma de limites imprecisos que se disponen en un patrón irregular sobre un estroma parcialmente calcificado.\r\n\r\n\r\n', ' Resección de lesión en espalda:\r\n-PILOMATRICOMA\r\n\r\n', '', ''),
	(82, 'Q2101-1622', 'Q', '33146646', 'JUDITH DEL RIO DE BORRE', '3044562512', 'F', '1953/01/07', 'PARTICULAR', 'C.', NULL, NULL, 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-02-01', '2021-01-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica el mayor mide  0.3 cms. y el menor de 0.1 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(83, 'Q2101-1623', 'Q', '45456699', 'ESTER VILLANUEVA ROJAS', '3046260097', 'F', '1962/01/07', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-02-02', '2021-01-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Exocervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica el mayor mide 1.2 cms. y el menor de 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Lesión tumoral epitelial maligna constituida por nidos de células de nucleos hipercromáticos, pleomórficos abundante citoplasma que infiltra el estroma, hay focos de necrosis .\r\n\r\n', ' Biopsia de cervix:\r\n-CARCINOMA ESCAMOCELULAR POBREMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(84, 'Q2101-1624', 'Q', '45469657', 'CARMEN ALVAREZ CHICO', '3023208970', 'F', '1962/01/07', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-02-02', '2021-01-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Polipo" se reciben dos fragmentos de tejido de aspecto polipoide de color blanquecino y consistencia elástica el mayor mide 1 cms. y el menor 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL\r\n\r\n\r\n', '', ''),
	(85, 'Q2101-1625', 'Q', '73569827', 'ANA CARDENAS DE BALCEIRO', '3103670912', 'F', '1955/01/07', 'PARTICULAR', 'PARTICULAR', NULL, NULL, 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-02-02', '2021-01-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos y PMN neutrófilos en moderada cantidad, que penetran el epitelio glandular. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(86, 'Q2101-1626', 'Q', '45480372', 'SANDRA VERBEL MARTINEZ', '3043775976', 'F', '1968/01/07', 'PARTICULAR', 'PARTICULAR', NULL, NULL, 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-02-02', '2021-01-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(87, 'Q2101-1627', 'Q', '33129451', 'MARIA CONTRERAS MORENO', '3106154879', 'F', '1951/01/07', 'PARTICULAR', 'PARTICULAR', NULL, NULL, 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-02-05', '2021-01-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(88, 'Q2101-1628', 'Q', '73100117', 'MARCO MARZAN MANZUR', '3162951186', 'M', '1962/05/15', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', NULL, NULL, 'Doctor ISMAEL YEPES', NULL, '2021-02-02', '2021-01-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se recibe fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Mucosa gastrica corporal cuya lámina propia es levemente edematosa y esta infiltrada po rlinfocitos, y plasmocitos en escasa cantidad. En la muestra enviada no se observó H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(89, 'Q2101-1629', 'Q', '1127655792', 'EDUARDO ARIAS RANGEL', '3059368966', 'M', '2003/09/11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-02-02', '2021-01-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 cms. La serosa es opaca y despulida y esta cubierta por material amarillento. Al corte la luz ocupada pro material oscuro. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(90, 'Q2102-1630', 'Q', '73156946', 'ROBERTO MEJIA FLOREZ', '0000', 'M', '1973/02/03', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor ISMAEL YEPES', NULL, '2021-02-03', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro gástrico" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que juntos miden 1 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endiscopica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(91, 'Q2102-1631', 'Q', '33247915', 'NELLY TORRES GOMEZ', '3135851298', 'F', '1972/02/03', 'ORG. CLINICA GENERAL DEL NORTE', '0', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-02-04', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Biopsia de vagina" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 1 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran tejido de granulación con densa infiltración de linfocitos, neutrófilos y células plasmaticas.\r\n\r\n\r\n', ' Biopsia de lesión en cupula vaginal:\r\n-TEJIDO DE GRANULACIÓN E INFLAMACIÓN AGUDA Y CRÓNICA (GRANULOMA DE LA CUPULA)\r\n\r\n\r\n', '', ''),
	(92, 'Q2102-1632', 'Q', '1140876426', 'JUAN TORRES MADARIAGA', '3043815408', 'M', '1996/02/03', 'GASTROPACK SAS', 'MAPFRE', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-04', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro gástrico" se reciben cuatro fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 1 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(93, 'Q2102-1633', 'Q', '1047380275', 'ANGELA VERGARA GONZALEZ', '3013658999', 'F', '1986/11/02', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-04', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro gástrico" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 1.2 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
