	(95, 'Q2102-1635', 'Q', '45757350', 'MARINELLA BALDOVINO FRANCO', '3014137423', 'F', '1975/09/25', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-03', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro gástrico" se reciben cuatro fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(96, 'Q2102-1636', 'Q', '1067638104', 'MATHIUS ROQUE PEREZ', '3186769150', 'M', '2018/09/03', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-02-04', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Ganglio mesenterico" se recibe un fragmento de tejido de forma trilobulado quemide 1.5 x 1 cms. de color blanco amarillento. Al corte tejido homogeneo de color blanco amarillento. Se toma todo.\r\n\r\n\r\n', 'Ganglio linfático con cambios hiperplasicos que comprometen los foliculos, el espacio interfolicular.\r\n\r\n\r\n', ' Resección de ganglio mesenterico:\r\n-HIPERPLASIA REACTIVA DE TIPO MIXTO', '', ''),
	(97, 'Q2102-1637', 'Q', '1201214450', 'WILLIAN OSUNA BERRIO', '3114042178', 'M', '2009/05/18', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor RODRIGO DE VIVERO', NULL, '2021-02-04', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.7 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(98, 'Q2102-1638', 'Q', '1050008198', 'RUBEN REEQUENA JARAMILLO', '3012467741', 'M', '2018/02/01', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Dcotor FLAVIO RICAURTE ARMESTO', NULL, '2021-02-04', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Cresta Iliaca izquierda" se reciben tres fragmentos oseos de color blanquecino y pardo claro de consistencia petrea que juntos hacen 1.7 cms. Al corte tejido homogeneo, blanquecino. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n', 'Los cortes muestran espiculas oseas inviables que reposan en una matriz fibrosa infiltrada por linfocitos y neutrófilos.\r\n\r\n\r\n', ' Biopsia de cresta iliaca izquierda:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(99, 'Q2102-1639', 'Q', '1043638067', 'SARA NARANJO VERGARA', '000', 'F', '2004/03/06', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Dcotor LUIS MORENO', NULL, '2021-02-08', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Quíste gluteo derecho" se recibe una masa de tejido de forma irregular de color grisáceo y blanquecino cubierta por un tejido de aspecto fibroso, grisáceo que mide 1.5 x 1 cms. Al corte formación quistica llena de un material mucoide de color blanco grisáceo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran una estructura quistica tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n', ' Resección de quíste en región glutea derecha:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(100, 'Q2102-1640', 'Q', '45551859', 'ISIDORA ESCALANTE MELENDEZ', '000', 'F', '1983/09/02', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', NULL, NULL, 'Dcotor HERNAN CALDERON', NULL, '2021-02-04', '2021-02-02', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se ercibe un apéndice ecal que mide 6.5 x 0.6 cms. de color blanquecino. Al corte la pared esta algo engrosada y el lumen contiene material de color blanqueicno. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(101, 'Q2102-1641', 'Q', '45372608', 'ILDA SANTANA ALTAMAR', '0000', 'F', '1973/02/05', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de polipo" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 1.5 ml. Entre los fragmentos antes descritos se observan dos fragmentos de tejido de color pardo claro y consistencia blanda que promedian 0.3 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n', 'Los cortes muestran fragmentos de una estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular que alternan con fragmentos de endocervix.\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL (FRAGMENTOS)\r\n\r\n\r\n', '', ''),
	(102, 'Q2102-1642', 'Q', '22403984', 'DIONISIA SANCHEZ SILGADO', '0000', 'F', '1957/02/05', 'PARTICULAR', 'PARTICULAR', NULL, NULL, 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(103, 'Q2102-1643', 'Q', '1010133708', 'DANIELA MEDINA RAMIREZ', '0000', 'F', '2001/02/05', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', NULL, NULL, 'Doctor BETTY MORALES', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro gástrico" dos diminutos de tejido de forma irregular de colorpardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo gástrico" dos diminutos de tejido de forma irregular de colorpardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica con edema, congestión e infiltración mononuclear de la lámina propia. No se observan H.pylori, atrófia, cambios metaplasicos ni displásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(104, 'Q2102-1644', 'Q', '1063187240', 'JORDAN HENAO ORTEGA', '0000', 'M', '2021/01/12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Dcotor LUIS MORENO BALLESTEROS', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4.8  x0.4 cms. en sus mayores dimesniones, la superficie externa esta cubierta por una serosa lisa y brillante y al corte la pared enrgosada y la luz es puntiforme. Se tman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal que conserva la morfología habitual.\r\n\r\n\r\n', '-APENDICE CECAL\r\n\r\n', '', ''),
	(105, 'Q2102-1645', 'Q', '1201215179', 'KAROL LOPEZ RODRIGUEZ', '0000', 'F', '2009/05/21', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor RODRIGO DE VIVERO', NULL, '2021-02-08', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres diminutos de tejido de forma irregular de colorpardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Estómago" tres diminutos de tejido de forma irregular de colorpardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran epitelio escamoso con focos de acantosis leve y balonamiento de las células en la zona media. Hay presencia de fragmentos de lámina propia con densa infiltración mononuclear.\r\nLos cortes rotulados B muestran fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1.Biopsioa endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA COMPATIBLE CON CAMBIOS POR REFLUJO GASTROESOFÁGICO\r\n\r\n2.Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(106, 'Q2102-1646', 'Q', '1050966339', 'FRANK DAVID BOSSIO ELLES', '000', 'M', '2013/03/16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.2  x0.9 cms. La superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(107, 'Q2102-1647', 'Q', '1143390697', 'SHERWIL MENDOZA RDORIGUEZ', '000', 'M', '2014/01/03', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigadala derecha" una amigdala palatina que mide 2.3 x 2 x 1.5 cms. La superficie externa es irregular y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amigadala izquierda" una amigdala palatina que mide 2.7 x 1.5 x 1.5 cms. en sus mayores dimensiones. La superficie externa es irregular y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.7 x 1.5 x 1.2 cms. La superficie externa es irregular y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación aguda y crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', '1.AMIGDALITIS AGUDA Y CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n', '', ''),
	(108, 'Q2102-1648', 'Q', '45501175', 'JANNY CARDENAS BALDOVINO', '000', 'F', '1961/02/05', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Dcotor SAMUEL HERNANDEZ ALVAREZ', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Omento + saco" un fragmento de tejido de aspecto membranoso de color rosado y consistencia elástica que mide 30 x 7.5 cms. en sus mayores dimensiones, la superfiice externa del mismo se observa fragmento de tejido adiposo. En el mismo recipiente, se recibe además dos fragmentos de omento que juntos miden 25 x 9.5 cms. Al corte se observa una superficie untuosa de color paro amarillento. Se toman cortes y se rotualn A.\r\n2. "Apéndice" un apéndice cecal que mide 6.7 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta pro una serosa lisa y brillante. Al corte la pared esta enrgosada y la luz dilatada y contiene abundante material fecaloideo. Se toman cortes ys e rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de tejido fibroadiposo bien vascularizado, congestivo. Otros cortes muestran omento con vasos sanguineos dilatados, congestivos.\r\nLos cortes rotulados B muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared.\r\n\r\n\r\n', '1.SACO HERNIARIO, región epigástrica\r\n2.FRAGMENTO DE OMENTO\r\n3.APÉNDICITIS AGUDA\r\n', '', ''),
	(109, 'Q2102-1649', 'Q', '3976335', 'JAIME VITOLA MARIN', '000', 'M', '1956/02/05', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', NULL, NULL, 'Doctor HERNAN CALDERON', NULL, '2021-02-08', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Ulcera peptica" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 1.1 y 1 cms. en ssu mayores dimensiones. Al corte una superficie externa de color parod claro. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de pared de la unión gastroduodenal con zona de necrosis extensa y tejido de granulación. No se encuentran cambios neoplásicos.\r\n\r\n\r\n', ' Resección de bordes de ulcera en antro pilórico:\r\n-CAMBIOS COMPATIBLES CON ÚLCERA PÉPTICA\r\n\r\n', '', ''),
	(110, 'Q2102-1650', 'Q', '45564479', 'YENIS SALAZAR MALDONADO', '000', 'F', '1984/02/05', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-02-05', '2021-02-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.6 x 1.1 cms. La superficie externa esta cubierta por una serosa despulida de colro violáceo. Al corte la pared esta adelgazada y la luz dialtada y hay salida de un material hemorrágico. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(111, 'Q2102-1651', 'Q', '73166622', 'RUMALDO SALGADO HERAZO', '000', 'M', '1974/09/30', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBET', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(112, 'Q2102-1652', 'Q', '9075557', 'SILFREDO PUERTA GAVIRIA', '00', 'M', '1952/02/05', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE \r\n-H.PYLORI PRESENTE', '', ''),
	(113, 'Q2102-1653', 'Q', '45528781', 'JOHANA CARPINTERO BARON', '00', 'M', '1981/02/05', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo con formación de agregados linfoides, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(114, 'Q2102-1654', 'Q', '23144063', 'CONCEPCION PEREZ DE VILLAR', '000', 'F', '1948/02/05', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-09', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia es congestiva e infiltrado mononuclear leve. No se observa actividad, H.pylori, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(115, 'Q2102-1655', 'Q', '33140600', 'ELVIRA MENDOZA DE OVIEDO', '000', 'F', '1953/02/05', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben diminutos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan un tumor maligno constituido por espacios glandulares, irregulares tapizados por células grandes de nucleos hipercromáticos, citoplasma amplio que infiltran el estroma.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-ADENOCARCINOMA BIEN DIFERENCIADO, INFILTRANTE (TIPO INTESTINAL)\r\n\r\n', '', ''),
	(116, 'Q2102-1656', 'Q', '45475436', 'MARTA LUZ CORRALES VILORIA', '000', 'F', '1968/02/05', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-09', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(117, 'Q2102-1657', 'Q', '33148676', 'YOLANDA DE AVILA NARAINA', '00', 'F', '1953/02/05', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-09', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben cinco fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, metaplasia intestinal incompleta. No se observa actividad, H.pylori ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON FOCOS DE METAPLASIA INTESTINAL INCOMPLETA\r\n\r\n', '', ''),
	(118, 'Q2102-1658', 'Q', '1047499606', 'JOSE GONZALEZ MERCADO', '000', 'M', '2011/04/25', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-02-12', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste epidermico" se recieb una formación nodular que mide 1 x 0.5 cms. cubierta por una elipse de piel que mide 0.5 cms. Al corte una superficie lisa y blanquecina.  Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan piel tapizada por epitelio escamoso, el dermis muesrta lesión tumoral constituida por una proliferación de células de nucleo central y citoplasma granular mezclados con algunas células xantomatosas dichos grupos celulares estan separados por haces de tejido fibroso.\r\n\r\n\r\n', ' Extirpación de lesión en piel de tronco:\r\n-DERMATOFIBROMA DE CÉLULAS GRANULARES\r\n\r\n', '', ''),
	(119, 'Q2102-1659', 'Q', '1047373383', 'LETTYS MARQUEZ JULIO', '000', 'F', '2003/10/10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Dcotor CARLOS VELEZ DUCAN', NULL, '2021-02-12', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa de oido medio derecho" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian un diametro mayor de 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan timpano con inflamación crónica, fibrosis e esclerosis.\r\n\r\n\r\n', ' Mucosa de oido medio derecho:\r\n-MIRINGUITIS CRÓNICA\r\n-MIRINGOESCLEROSIS\r\n\r\n', '', ''),
	(120, 'Q2102-1660', 'Q', '1002246691', 'LAURA GONZALEZ ALARCON', '00', 'F', '2003/10/03', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor IVAN JIMENEZ SANCHEZ', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa de color pardo claro, opaca bien vascularizada. Al corte la luz se observa dilatada y se observa un contenido fecaloide. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(121, 'Q2102-1661', 'Q', '1042577102', 'FRANK MANUEL VILLA GUERRERO', '000', 'M', '2003/10/27', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor IVAN JIMENEZ SANCHEZ', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice + omento" un apéndice cecal que mide 6 x 1 cms. tapizada por una serosa de color pardo oscuro que trae adherido material purulento y un área de perforación de 2.5 cms. Acompañado a esto un segmento de omento que mide 18 cms. de color amarillento y aspecto adiposo, trae material fibrinopurulento. Se toman cortes así: A apéndice, B omento.\r\n2. "Ganglio apendicular" formación nodular que mide 1.5 x 1 cms. de color pardo claro y conssitencia elástica, la superficie amarillento y aspecto adiposo. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes A revelan apéndice cecal cuya mucosa se encuentra ulcerada, la pared infiltrada por gran cantidad de PMN neutrófilos que infiltran hasta la serosa, hay áreas de necrosis y perforación.\r\nLos cortes B revelan tejido adiposo con una reacción inflamatoria aguda.\r\nLos cortes C revelan tejido adiposo con inflamación aguda.\r\n\r\n', '  Apendicectomía:\r\n1.APENDICITIS AGUDA NECROTIZANTE, PERFORADA\r\n2.TEJIDO ADIPOSO CON INFLAMACIÓN AGUDA, omento\r\n\r\n', '', ''),
	(122, 'Q2102-1662', 'Q', '45744970', 'LILIANA MERCADO CABRERA', '000', 'F', '1982/02/05', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor EDWARD RICARDO', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una formación nodular que mide 0.5 x 0.5 cms. ovoide de color blanquecino, y consistenica elástica. S etoma todo.\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n', ' Miomectomía:\r\n-LEIOMIOMA\r\n\r\n', '', ''),
	(123, 'Q2102-1663', 'Q', '1002196773', 'HEIKER AMADOR MEZA', '000', 'M', '1997/02/05', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor LUIS ALCAZAR GONZALEZ', NULL, '2021-02-05', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa, opaca bien vascularizada, trae adherido material fibrinopurulento. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(124, 'Q2102-1664', 'Q', '12485755', 'FELIPE YEPES ARENILLA', '000', 'M', '1934/02/05', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor YASMIN DE AVILA MEDRANO', NULL, '2021-02-09', '2021-02-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia percutanea de higado" se reciben cinco cilíndros de tejido de color blanquecino que miden dos de ellos 1 cm. y los otros 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno constituido en su mayoría por ductos pequeños, tapizados por células pleomórficas, hipercromáticas algunas con nucleolos y abundante citoplasma. Todos los cilíndros estan comprometidos.\r\n\r\n\r\n', ' Biopsia percutanea de higado:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO\r\n\r\n\r\n', '', 'Se sugiere practicar estudios de inmunohistoquímica para establecer un sitio primario.\r\n\r\n'),
	(125, 'Q2102-1665', 'Q', '45472750', 'GLORIA MARTINEZ GOMEZ', '3135365701', 'F', '1967/08/04', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, 'Doctor ISMAEL YEPES', NULL, '2021-02-08', '2021-02-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n ', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(126, 'Q2102-1666', 'Q', '1051445606', 'YOLANDA VEGA MARTINEZ', '3232037047', 'F', '1990/02/07', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-02-08', '2021-02-06', 'GUILLERMO ROVIRA ROSALES', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso maduro que reposa en un corion con leve infiltración mononuclear. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-COLPITIS CRÓNICA\r\n\r\n', '', ''),
	(127, 'Q2102-1667', 'Q', '23084723', 'GLORIA TAPIA MARTINEZ', '3015038107', 'F', '1955/02/07', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-02-08', '2021-02-06', 'GUILLERMO ROVIRA ROSALES', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis muestra hiperqueratosis y discreta acantosis irregular. Reposa en un dermis con fibrosis e infiltración mononuclear.\r\n\r\n\r\n', ' Biopsia de región en vulva:\r\n-LIQUEN SIMPLE CRÓNICO\r\n\r\n', '', ''),
	(128, 'Q2102-1668', 'Q', '45592893', 'YANITZA REYES VILLADIEGO', '000', 'F', '1978/02/07', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-02-08', '2021-02-06', 'GUILLERMO ROVIRA ROSALES', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso dispuesto en un patrón papilomatoso y acantosis con múltiples células coilociticas.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vulva:\r\n-CONDILOMA ACUMINADO\r\n\r\n', '', ''),
	(129, 'Q2102-1669', 'Q', '1043326172', 'MARIA UTRIA MARTINEZ', '000', 'F', '2017/06/30', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-02-08', '2021-02-06', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice preauricular derecha" se se reicbe un fragmento de tejido alargado de color amarillento y blanquecino que mide 1.4 x 0.2 cms. Al corte tejido homogeneo. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel que rodea un nucleo de cartilago hialino.\r\n\r\n\r\n\r\n', ' Resección de lesión en preauricular derecha:\r\n-TRAGO ACCESORIO\r\n\r\n', '', ''),
	(130, 'Q2102-1670', 'Q', '1041992566', 'BRIANNA SOFIA CAFIEL DORIA', '00', 'F', '2014/09/09', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-02-09', '2021-02-06', 'GUILLERMO ROVIRA ROSALES', 'Rotuladao "Quíste dermoide de ceja derecha" se recibe una masa de tejido redondeada de color blanquecino y consistencia renitente que mide 1.5 cms. Al corte formación quistica llena de un material gelatinoso. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran una lesión quistica tapizada por epitelio escamoso que reposa en un corion que contiene anexos cutáneos.\r\n\r\n\r\n', ' Resección de lesión en ceja derecha:\r\n-QUÍSTE DERMOIDE\r\n\r\n', '', ''),
	(131, 'Q2102-1671', 'Q', '73350639', 'CARLOS MARRUGO GONZALEZ', '000', 'M', '1961/02/07', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', NULL, NULL, 'Doctor RODOLFO VALENCIA', NULL, '2021-02-17', '2021-02-06', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 1 cms. de color negruzco de aspecto hemorrágico. Al corte la pared esta engrosada y el lumen contiene material de aspecto negruzco. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(132, 'Q2102-1672', 'Q', '1047427248', 'STEFANY PINZON BARRIOS', '000', 'F', '1991/02/07', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor SAMUEL CANTILLO', NULL, '2021-02-08', '2021-02-06', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Trompas de Falopio" se reicben dos segmentos de trompas uterinas que miden 1.6 x 0.6 y 1 x 0.6 cms. Al corte tejido homogeneo de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Segmentos de trompa uterina que muestra la estructura usual.\r\n\r\n\r\n', '-TROMPAS UTERINAS. SEGMENTOS (2) \r\n\r\n\r\n', '', ''),
	(133, 'Q2102-1673', 'Q', '1045677632', 'JOSE CASTRO OLIVERA', '3216093708', 'M', '1988/08/07', 'GASTROPACK SAS', 'PARTICULAR', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(134, 'Q2102-1674', 'Q', '16075084', 'JOHN ALBEIRO CANO SALAZAR', '3043925505', 'M', '1983/01/14', 'GASTROPACK SAS', 'PARTICULAR', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica con edema, congestión e infiltración mononuclear de la lámina propia. No se observa actividad inflamatoria, H.pylori, atrófia ni cambios metaplasicos.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(135, 'Q2102-1675', 'Q', '33116231', 'TULIA MARTELO CANDELARIA MARTINEZ DE BARRIOS', '3174409446', 'F', '1944/04/30', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', NULL, NULL, 'Doctor ISMAEL YEPES', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(136, 'Q2102-1676', 'Q', '72200218', 'DONALDO JOSE CASTRO DIAZ', '3017829784', 'M', '1974/01/26', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotualdos, se reciben:\r\n1. "Antro gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica con edema, congestión e infiltración mononuclear de la lámina propia. No se observan H.pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(137, 'Q2102-1677', 'Q', '45457018', 'MARGARITA ZABALETA VELAZCO', '020', 'F', '1964/02/18', 'GASTROPACK SAS', 'ECOPETROL S.A', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo gastrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia está edematosa, congestiva e infiltrada pro linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). Hay focos de metaplasia intestinal completa. No se observa atrófia ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica con edema, congestión e infiltración mononuclear de la lámina propia. No se observan H.pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA Y FOCO DE METAPLASIA INTESTINAL COMPLETA\r\n2.Biopsia endoscópica de estómago (cuero):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(138, 'Q2102-1678', 'Q', '1041327325', 'ORLANDO DE JESUS LOPEZ MARIN', '3208529828', 'M', '1992/10/15', 'GASTROPACK SAS', 'PARTICULAR', NULL, NULL, 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(139, 'Q2102-1679', 'Q', '1007983785', 'LAURA CAROLINA ARNEDO ORTIZ', '3184907589', 'F', '2003/08/26', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', NULL, NULL, 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n\r\n2. "Cuerpo gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan C.\r\n\r\n4. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotula D.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\nLos cortes rotulados B muestran mucosa oxíntica con edema, congestión e infiltración mononuclear de la lámina propia. No se observan H.pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\n\r\nLos cortes rotulados C y D muestran mucosa duodenal cuya morfología está preservada. Hay edema, congestión e infiltración mononuclear de la lámina propia. No se observan parasitos, granulomas, actividad inflamatoria ni cambios displasicos.\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n3.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n\r\n4.Biopsia endoscópica de segunda porción de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(140, 'Q2102-1680', 'Q', '1142917406', 'NICOLL ANDREA VASQUEZ VILLERO', '3006513801', 'F', '2007/03/07', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', NULL, NULL, 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fibroadenoma mama izquierda" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.8 x 1.5 x 1.2 cms. La superficie externa es de aspecto multilobular. Al corte se observa una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(141, 'Q2102-1681', 'Q', '1041974154', 'ANGIE CAROLINA PEREIRA PAJARO', '3022023762', 'F', '2004/12/01', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor RODRIGO DE VIVERO', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promeidan 0.3 cms. Se toma todo y se rotulan A.\r\n\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran mucosa esófagica cuya lámina propia está ligeramente edematosa, congestiva e infiltrada por linfocitos. El epilio escamoso se encuentra hiperplasico y presenta cambios de balonamiento en la zona media del epitelio.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA COMPATIBLE CON ESOFAGITIS POR REFLUJO\r\n\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', 'En la muestra no se observan H.pylori ni los cambios histológicos asociados.\r\n'),
	(142, 'Q2102-1682', 'Q', '1201249220', 'SARA SOFIA CASTILLO CHAVEZ', '3052116335', 'F', '2015/10/15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor RODRIGO DE VIVERO', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(143, 'Q2102-1683', 'Q', '1047512397', 'ADRIAN CAMILO JULIO ROIS', '3043733748', 'M', '2017/12/25', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctora NELLYS RODRIGUEZ ZULETA', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amigdala palatina de forma irregular de color pardo rosado y consistencia elástica que mide 2 x 1.3 x 1 cms. La superficie externa es irregular y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan A.\r\n\r\n2. "Amigadala izquierda" una amigdala palatina de forma irregular de color pardo rosado y consistencia elástica que mide 1.8 x 1.4 x 0.9 cms. La superficie externa es irregular y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n3. "Adenoides" múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que juntos miden 2 x 1.5 x 0.8 cms. Al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\nLos cortes rotulados C muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n\r\n2.HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n', '', ''),
	(144, 'Q2102-1684', 'Q', '1047464357', 'LEONOR ECHEVERRI MUÑOZ', '3218339635', 'F', '1994/02/03', 'PARTICULAR', 'LIGA CONTRA EL CANCER', NULL, NULL, 'Doctora SONIA LONDOÑO', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión benigna constituida por un núcleo de tejido fibroso laxo rodeado por piel. No se observan cambios sugestivos de molusco contagioso.\r\n\r\n\r\n', ' Resección de lesión en vulva:\r\n-POLIPO FIBROEPITELIAL\r\n\r\n', '', ''),
	(145, 'Q2102-1685', 'Q', '1128045569', 'NICOLE SOFIA MATTOS SILVA', '3006033599', 'F', '2003/11/13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '0', NULL, NULL, 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Masa en mama derecha" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 4 x 3.5 x 3 cms. en sus mayores dimensiones, la superficie externa es multilobulada y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(146, 'Q2102-1686', 'Q', '45464445', 'MARIA VILLARREAL LORDUY', '000', 'F', '1965/06/10', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(147, 'Q2102-1687', 'Q', '1051893296', 'ISAMARIS MARIA MARTINEZ VARGAS', '3024686326', 'F', '1987/07/16', 'CLINICA GENERAL DEL CARIBE SA.', '0', NULL, NULL, 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Trompa izquierda + ectopico" se recibe una trompa de Falopio que mide 7 x 2 cms. en sus mayores dimensiones, la superficie externa esta cubierta po runa serosa despulida con áreas de color pardo oscuro y parcialmente cubierta por coágulos de color viola´ceo. Al corte la pared se encuentra adelgazada y la luz esta ocupada por un material de color violáceo. En el mismo recipiente, se recibe además, un fragmento de tejido de forma irregular de color pardo claro con áreas violáceas y un aspecto esponjoso mide 4 x 3 x 1.5 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran trompa de Falopio con áreas de necrosis y hemorrágia que contiene numerosas vellosidades coriales sin cambios.\r\n\r\n\r\n\r\n', ' Salpingectomía izquierda.\r\n-EMBARAZO TUBARICO\r\n\r\n', '', ''),
	(148, 'Q2102-1688', 'Q', '33211245', 'LEDIS DEL CARMEN PATIÑO DE QUIROZ', '3114033752', 'F', '1951/05/09', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de foliculos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n', '', ''),
	(149, 'Q2102-1689', 'Q', '33144183', 'ANA JULIA CABRALES DE AYOLA', '6560359', 'F', '1952/03/15', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(150, 'Q2102-1690', 'Q', '23190567', 'GLADIS ESTHER REBOLLEDO SARMIENTO', '3145185103', 'F', '1959/12/22', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(151, 'Q2102-1691', 'Q', '7930309', 'FERNANDO ENRIQUE SANCHEZ MONT', '3102635165', 'M', '1963/02/03', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n\r\n', '', ''),
	(152, 'Q2102-1692', 'Q', '45437981', 'ELIA ROSA CALLE DE DIAZ', '3012151253', 'F', '1958/09/23', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', NULL, NULL, 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-02-10', '2021-02-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
