	(382, 'Q2103-1917', 'Q', '1142914618', 'DANIELA ANDRA GOMEZ OSORIO', '3002499608', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-03-23', '2021-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.4 x 0.8 cms. La superficie externa esta cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz dilatada. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
