	(388, 'Q2103-1923', 'Q', '33101608', 'MARIA DEL TRANSITO PEREZ PADILLA', '3107178952', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-03-23', '2021-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(389, 'Q2103-1924', 'Q', '73081072', 'JAVIER LLAMAS CANO', '000', 'M', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-03-23', '2021-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(390, 'Q2103-1925', 'Q', '30762309', 'CECILIA DEL CARMEN SIMANCAS MARTINEZ', '3135199889', 'F', '55', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '33200', 'Doctor GUSTAVO CARBALLO', NULL, '2021-03-23', '2021-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste de ovario derecho" se recibe una estructura de aspecto quistico de color pardo oscuro y consistencia renitente que mide 10 x 8.5 x 7.5 cms. La superficie externa esta cubierta por una serosa lisa y brillante de color pardo oscuro en uno de los extremos se observa una estructura que parece corresponder a una trompa de Falopio mide 3.5 x 0.8 cms. Al corte hay salida de un líquido claro uno de los extremos se observa un área de aspecto sólido mide 5  x2 x 2.5 cms. Al corte se observa una superficie de color violáceo finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura de aspecto quístico con áreas extensas de necrosis y hemorrágia. No es posible identificar tejido ovarico ni el epitelio de revestimiento del quíste por la necrosis hemorrágica extensa.\r\n\r\n\r\n\r\n', ' Resección de quíste de ovario derecho:\r\n-NECROSIS HEMORRÁGICA SECUNDARIA A TORCIÓN\r\n\r\n\r\n', '', ''),
	(391, 'Q2103-1926', 'Q', '1047496467', 'SINDY VARELA SALCEDO', '3234878270', 'F', '24', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '20201', '', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-07', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un punch de piel que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso hiperplasico con hiperqueratosis, hipergranulosis, atípias coilociticas, el estroma muestra infiltrado mononuclear leve.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA ', '', ''),
	(392, 'Q2103-1927', 'Q', '30838356', 'YESENIA CARREAZO YEPEZ', '3116312926', 'F', '40', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '20201', '59100', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n\r\n', '', ''),
	(393, 'Q2103-1928', 'Q', '30769944', 'ADELA CARLINA GUETE SAAVEDRA', '3003910788', 'F', '61', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '20205', '93200', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD INFLAMATORIA LEVE \r\n-H.PYLORI PRESENTE\r\n\r\n\r\n', '', ''),
