	(395, 'Q2103-1930', 'Q', '1047480317', 'MARIA JOSE PATERNINA CARBALLO', '3017342252', 'F', '25', 'GASTROPACK SAS', 'PARTICULAR', '20201', '59100', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(396, 'Q2103-1931', 'Q', '79640148', 'WILLIAM OÑATE', '000', 'M', '47', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '20201', '59100', 'Doctor BETTY MORALES', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n\r\n', '', ''),
	(397, 'Q2103-1932', 'Q', '1048442740', 'SALOME ISABELA PERFETI GALVIS', '3126414297', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. tapizada por una serosa de color pardo oscuro, opaca que trae adherido material fibrinopuruelnto. Al corte conteniendo material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apendice cecal cuya mucosa se encuentra ulcerada, la pared infiltrada por PMN neutrófilos que se extienden hasta la grasa periapendicular, además hay áreas de necrosis.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n\r\n\r\n\r\n', '', ''),
	(398, 'Q2103-1933', 'Q', '1050945444', 'LAURA VANESA ACUÑA TORRES', '3135737745', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Queloide pabellon auricular izquierda" se recibe una masa de tejido, ovoide que mide 5 x 2 x 1 cms. de consistencia firme, de color pardo claro. Al corte una superficie blanquecina, lisa. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel en cuyo dermis se observa formación nodular de colageno hialinizado.\r\n\r\n\r\n\r\n', '-QUELOIDE, pabellon auricular izquierda\r\n\r\n\r\n\r\n', '', ''),
	(399, 'Q2103-1934', 'Q', '1201241962', 'LUIS MARIO GALARCIO BOLOCO', '3216148472', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa de color pardo claro que trae adherido material fibrinopurulento. Al corte hay salida de material necrótico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(400, 'Q2103-1935', 'Q', '1142917345', 'MIGUEL ANGEL ISAZA MONTALVO', '3116610710', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apendice cecal que mide 8 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(401, 'Q2103-1936', 'Q', '1051449089', 'LEDIS JOHANA LLERENA HERRERA', '3222091843', 'F', '25', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '33200', 'Doctor MAURICIO ORTIZ BANQUEZ', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Restos ovulares" se reciben varios fragmentos de tejido de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan coágulos sanguineos y endometrio con reacción de áreas Stella.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-ENDOMETRIO CON REACCIÓN DE ÁREAS STELLA\r\n\r\n\r\n', '', ''),
	(402, 'Q2103-1937', 'Q', '22728256', 'MARIA CECILIA SARMIENTO GARCIA', '3106628186', 'F', '61', 'LIGA CONTRA EL CANCER', '', '20201', '59100', 'Doctor CARLOS OSORIO', NULL, '2021-03-29', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de mama" se recibe una masa irregular de tejido que mide 5 x 4 x 2.5 cms. marcada con arpon, de color blanco amarillento y consistencia firme. Al corte se observa un área irregular de color blanquecino de consistencia firme que mide 3.5 x 1 cms. La masa se recibe sin orientación, se marcan los margens con tinta china. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran mama con un tumor epitelial maligno constituido por lobululillos distendidos por células de nucleos redondos, uniformes poco cohesivos, que infiltra el estroma en fila india.\r\nEn otras áreas las células son mas grandes y pleomórficas.\r\nNo se observa infiltración linfovascular.\r\nEl tumor no sobrepasa los margenes marcados con tinta.\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-CARCINOMA INFILTRANTE DE PROBABLE ORIGEN LOBULILLAR\r\n-VOLUMEN TUMORAL: 3.5 x 1 cms.\r\n-NO SE IDENTIFICA INFILTRACIÓN LINFOVASCULAR\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(403, 'Q2103-1938', 'Q', '1007901884', 'KELLY JOHANA MENA MERCADO', '3126040766', 'F', '22', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '33200', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 0.5 cms. tapizada por una mucosa de color pardo claro opaca bien vascularizada. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal que muestra folículos linfoides hiperplasicos en la submucosa, además se observa un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(404, 'Q2103-1939', 'Q', '23139793', 'AMADA JIMENEZ DIAZ', '3205840177', 'F', '49', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '33200', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Utero + trompas" se recibe un cuerpo uterino y trompas de Falopio, pesa 280 gms. El cuerpo mide 12 x 11 x 7 cms. tapizado por una serosa de color pardo claro y deformado por múltiples masas. Al corte la cavidad endometrial esta rechazada y ocupada por una masa que mide 2 x 1.5 cms. En el miometrio se encuentra una masa ovoide, blanquecina que mide 5 x 5 x 4 cms. y otra masa que mide 3 x 3 x 2 cms. de color blanqueicno, aspecto arremolinado. Las trompas miden cada una 5 cms. y son de aspecto normal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cuerpo uterino cuyo endometrio se encuentra autólisado, las masas descritas en la cavidad endometrial y en el miometrio corresponden a leiomiomas. Las trompas de Falopio muestran su estructura usual.\r\n\r\n\r\n\r\n', ' Cuerpo uterino (280 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS\r\n-TROMPAS DE FALOPIO', '', ''),
	(405, 'Q2103-1940', 'Q', '23191799', 'ALICIA MERCEDES MERLANO ORTIZ', '3014885424', 'F', '47', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '33200', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-03-26', '2021-03-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Utero" se recibe un cuerpo uterino que pesa 113 gms. y mide 6 x 7 x 5 cms. tapizada por una serosa de color pardo claro aumentado de tamaño a nivel subseroso se observa una masa, ovoide que mide 1 x 0.5 cms. de color blanquecino de aspecto arremolinado, la cavidad endometrial esta tapizada por una mucosa de color pardo rojizo. El miometrio de aspecto fibrilar. Por separado rotulado "Trompa derecha" se recibe un segmento de trompa de Falopio incluida su fimbria que mide 4 cms. de color pardo grisáceo y aspecto habitual. Se toman cortes y se rotulan A.\r\nRotulado "Trompa izquierda" segmento de trompa de Falopio que mide 4 x 1.5 cms. presenta una hidatide de morgagni, en uno de sus extremos mide 1.5 x 1 cms. Al corte la trompa se observa dilatada y contiene un material hemorrágico. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino cuyo endometrio se encuentra autólisado, el miometrio presenta focos de adenomiosis, la masa descrita a nivel subseroso corresponde a un leiomioma. La trompa derecha no muestra cambios. La trompa izquierda presenta un hematosalpinx y una hidatide de morgagni.\r\n\r\n\r\n', ' Cuerpo uterino (113 gms.):\r\n1.ENDOMETRIO AUTÓLISADO\r\n2.LEIOMIOMA SUBSEROSO\r\n3.ADENOMIOSIS\r\n4.Trompa de Falopio izquierda:\r\n-HEMATOSALPINX\r\n-HIDATIDE DE MORGAGNI\r\n5.TROMPA DE FALOPIO DERECHA', '', ''),
	(406, 'L2103-76', 'L', '9056414', 'CORNELIO VALDELAMAR ESPINOSA', '0000', 'M', '77', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '', '', 'Doctor JHOANNY CONTRERAS CADENA - JOSE RODRIGUEZ BLANCO', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Liquido pleural" se reciben dos placas con su extendido.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos son hemorrágicos y contienen células de nucleos grandes, irregulares, citoplasma vacuolado, que se disponen individualmente y en pequeños grupos.\r\n\r\n\r\n\r\n', ' Extendidos de líquido pleural izquierdo:\r\n-CITOLOGÍA POSITIVA PARA CÉLULAS MALIGNAS, COMPATIBLE CON ADENOCARCINOMA\r\n\r\n\r\n', '', ''),
	(407, 'Q2103-1941', 'Q', '1047379878', 'CHARLIN ROMERO JIMENEZ', '3145965145', 'F', '34', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '20205', '', 'Doctora MANUELA BERROCAL REVUELTAS', NULL, '2021-04-05', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotualdos, se reciben:\r\n1. "Citología de seroma mama derecha" se reciben 3 ml. de un líquido espeso, de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n2. "Capsula de mama derecha" una estructura en forma de bolsa, de paredes gruesas, fibrosas, color pardo claro con áreas violáceas. Externamente mide 8 x 7 cms. en sus mayores dimensiones. En uno de sus lados presenta una abertura de 6.7 cms. de diámetro, la superficie es lisa y brillante, el espesor de la capsula es de pocos milimetros y la superficie de la capsula es rrugosa. Se toman múltiples cortes y se rotualn A.\r\n3. "Capsula mamaria izquierda" un fragmento de tejido membranoso que mide 11 x 10 cms. esta parcialmente cubierta por tejido adiposo. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los extendidos corresponden a un exudado compuesto por neutrófilos y macrófagos en su mayoría y escasas células con aspecto de mesoteliales. No se encuentran cambios neoplásicos.\r\nLos múltiples cortes rotulados A muestran una pared fibrosa tapizada en una de sus caras por un tejido de aspecto sinovial, edematoso, con células de nucleos redondos y citoplásma acidofílico que alternan con linfocitos. No se encuentra actividad mitótica ni cambios neoplásicos.\r\nLos cortes rotulados B muestran una pared fibrosa tapizada en una de sus caras por un tejido de aspecto sinovial y en la otra por elementos propios del tejido mamario. No hay cambios neoplásicos.\r\n\r\n', '1.Capsula periprotésica de mama derecha:\r\n-METAPLASIA SINOVIAL CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n2.Capsula periprotésica de mama izquierda:\r\n-METAPLASIA SINOVIAL\r\n3.Extendido de aspiración de seroma en mama derecha:\r\n-EXTENDIDO INFLAMATORIO (EXUDADO) NEGATIVO PARA MALIGNIDAD\r\n\r\n', '', 'Caso estudiado en conjunto con la doctora Ana Magola Manga.\r\n\r\n'),
	(408, 'Q2103-1942', 'Q', '1201267954', 'HERNAN DARIO GUERRERO FERNANDEZ', '3108493972', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quíste lipomatoso en torax" se reciben varios fragmentos de tejido de forma irregular, de color pardo claro con áreas amarillentas. En conjunto hacen un  volumen de 5 ml. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una cavidad parcialmente tapizada por un tejido de granulación con una reacción inflamatoria crónica con células gigantes a cuerpo extraño que fagocítan queratina.\r\n\r\n\r\n\r\n', ' Resección de lesión en región cervical:\r\n-QUÍSTE QUERATINOSO CON REACCIÓN GRANULOMATOSA A CUERPO EXTRAÑO\r\n\r\n\r\n', '', ''),
	(409, 'Q2103-1943', 'Q', '1201237289', 'ORIANIS MATTOS OROZCO', '3206394140', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor FERNANDO ENRIQUE CABRERA CARDOZO', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tibia derecha" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia firme que en conjunto hacen un volumen de 2 ml. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta de tejido conectivo muy celular dispuesto en borlas, en el que se observan células gigantes multinucleadas e hístiocitos espumosos.\r\n\r\n\r\n\r\n', ' Curetaje de lesión en tibia derecha:\r\n-FIBROMA NO OSIFICANTE\r\n\r\n\r\n', '', ''),
	(410, 'Q2103-1944', 'Q', '1201240696', 'LUIS SANTIAGO HOYOS VILLAR', '3135926289', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-04-06', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Dermatitis crónica" se recibe un fragmento elíptico de piel que mide 0.5 x 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis es normal. En el dermis reticular se encuentra un infiltrado perivascular e intersticial mediado por linfocitos y eosinófilos. No hay granulomas ni formación de abscesos.\r\n\r\n\r\n\r\nCOMENTARIO: El cuadro histológico es inespecífico y puede observarse en una URTICARIA PAPULAR, un PRURIGO SIMPLE, una reacción por pícadura de insecto, entre otros.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión en piel del abdomen:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n\r\n\r\n', '', ''),
	(411, 'Q2103-1945', 'Q', '1044927394', 'DARLIN VALENCIA HURTADO', '3126860850', 'F', '8', 'PARTICULAR', '', '20201', '59100', 'Doctor COGOLLO', NULL, '2021-03-30', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe una elipse de piel que mide 1.5 x 1 cms. en sus mayores dimensiones, en la superficie externa se observa una lesión pigmentada de aspecto verrugoso que mide 0.8 cms. en su mayor diámetro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se observa un proceso inflamatorio que compromete los folículos. En algunos hay reemplazo del folículo por un absceso.\r\nNo hay tumor en la muestra enviada.\r\n\r\n\r\n\r\n', ' Biopsia de piel de región glutea:\r\n-FOLICULITIS AGUDA Y CRÓNICA CON FORMACIÓN DE ABSESO', '', ''),
	(412, 'Q2103-1946', 'Q', 'VEN30903866', 'HECTOR JOSE SEINOCE BLANCO', '3167669125', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor HENRY ALONSO TORRES MONTES', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Curetaje oseo de tibia izquierda" se reciben varios fragmentos de tejido de forma irregular, aspecto oseo que en conjunto hacen un volumen de 4 ml. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran espículas oseas desvitalizadas rodeadas de tejido conectivo infiltrado po rlinfocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en tibia izquierda:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(413, 'Q2103-1947', 'Q', '30762832', 'MARIA DEL ROSARIO CASTELLAR DE AVILA', '000', 'F', '59', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '33200', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vrsícula" se recibe una vesícula biliar que mide 7 x 3.5 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por una serosa despulida color verde amarillento. Al corte las paredes son gruesas, de aspecto fibroso, la mucosa de color verde oscuro es aterciopelada y la luz se encuentran calculos en forma de grumos de color negruzco. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(414, 'Q2103-1948', 'Q', '33341895', 'NAYIBIS DEL SOCORRO GONZALEZ CASTELLAR', '3114212535', 'F', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '33200', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar piriforme que mide 7 x 2 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por una serosa despulida, color verde oscuro. Al corte las paredes son delgadas, la mucosa es aterciopelada de color verde oscuro y la luz contiene abundante bilis de color verde oscuro. No se encuentran calculos. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar cuya morfología está preservada. Hay discreta infiltración linfocítico de la lámina propia.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(415, 'Q2103-1949', 'Q', '33145463', 'NELLY DEL CARMEN ZAMMANTA DE OROZCO', '3008007276', 'F', '68', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 8 x 2 cms. La superficie externa esta parcialmente cubierta por una serosa despulida de colro verde grisáceo. Al corte las apredes son gruesas de aspecto fibroso, la mucosa esta aplanada de color oscuro y en la luz se encuentra múltiples calculos irregulares de color negruzco, con un diámetro promedio de 3 milimetros. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(416, 'Q2103-1950', 'Q', '45560188', 'EVELING TATIANA MENDOZA CASTRO', '3116468601', 'F', '36', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7 x 2 cms. La superficie externa esta parcialmente cubierta por una serosa despulida de color verde grisáceo. Al corte las paredes son gruesas, fibrosas, la mucosa esta aplanada de color oscuro y en la luz se encuentran pequeños calculos de color amarillento, con un diámetro promedio de 3 milimetros. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(417, 'Q2103-1951', 'Q', '33104783', 'YENYFER SANCHEZ MARTINEZ', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 3 cms. La superficie externa esta parcialmente cubierta por una serosa despulida de color pardo claro con áreas violáceas. Al corte las paredes son gruesas, fibrosas, la mucosa esta aplanada y en la luz se encuentra múltiples calculos pequeños y un calculo irregular de un diámetro mayor de 4 milimetros, combinado de 2.5 cms. de diámetro de color amarillento y consistencia friable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(418, 'Q2103-1952', 'Q', '33310837', 'ALEXANDRA PEREZ CARRILLO', '000', 'F', '38', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-03-29', '2021-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 5.5 x 1.8 cms. La superficie externa esta parcialmente cubierta por una serosa despulida de color pardo grisáceo. Al corte las paredes son gruesas de aspecto fibroso, y en la luz se encuentran múltiples calculos combinados, de forma irregular el mayor de los cuales mide 1 cm. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n\r\n', '', ''),
	(419, 'Q2103-1953', 'Q', '52740797', 'SANDRA MILENA RAMIREZ ZABALA', '3016714948', 'F', '39', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '33200', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-03-30', '2021-03-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(420, 'Q2103-1954', 'Q', '1143324639', 'PEDRO DE JESUS APONTE GARCIA', '3008586512', 'M', '32', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '33200', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-03-30', '2021-03-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos,  plasmocitos en abundnate cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(421, 'Q2103-1955', 'Q', '45425546', 'CLAUDIA BORDA', '0000', 'F', '62', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '20205', '93200', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-03-30', '2021-03-26', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotuladdos, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Polipo a 90 cms. de colon" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Polipo de colon a 60 cms." dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 y 0.2 cms. Se toma todo y se rotulan C.\r\n4. "Mucosa de todos los segmentos de colon" varios fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.7 cms. Se toma todo y se rotulan D.\r\n', 'Los cortes de A revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes de B revelan una estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\nLos cortes de C revelen fragmentos de mucosa colonica cuya lámina propia es levemente edematosa y esta infiltrada por linfocitos, plasmocitos. No se parasitos intestinales, granulomas ni cambios displasicos.\r\nLos cortes D revelan estructuras compuestas por glándulas colónicas alargadas con aspecto aserrado de los bordes luminales, que reposan en una lámina propia con leve infiltración mononuclear.\r\n\r\n', '1.Biopsia endoscópica de antro:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica a 90 cms. del colon:\r\n-ADENOMA TUBULAR\r\n3.Biopsia endoscópica a 60 cms. del colon:\r\n-FRAGMENTOS DE MUCOSA DE COLON\r\n4.Biopsia endoscópica se segmentos del colon:\r\n-PÓLIPOS HIPERPLÁSICOS ', '', ''),
	(422, 'Q2103-1956', 'Q', '1049831447', 'VALENTINA VEGA BARRIOS', '3137053153', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-03-29', '2021-03-26', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglio cervical derecho" se recibe un fragmento de tejido de color blanquecino de consistencia elástica que mide 1 x 0.8 cms. Al corte una superficie lisa y blanqueicna. Se toman cortes.\r\n\r\n\r\n\r\n', 'Ganglio linfático cuya morfología esta completamente alterada por una proliferación difusa de linfocitos grandes de aspecto inmaduro con presencia de mitosis.\r\n\r\n\r\n', ' Biopsia de ganglio cervical:\r\n-LESIÓN LINFOPROLIFERATIVA COMPATIBLE CON LINFOMA NO HODGKIN\r\n\r\n\r\n\r\n', '', 'Se sugiere estudios de inmunohistoquímica para una definición diagnóstica precisa.\r\n\r\nCaso visto en conjunto con el doctor José Caraballo.'),
	(423, 'Q2103-1957', 'Q', '1049532947', 'CARLOS DANIEL PEREZ PEREZ', '3215187104', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor CARLOS ALBERTO BALLESTAS ALMARIO', NULL, '2021-03-30', '2021-03-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Prepucio" se recibe fragmento de piel, alargado de color oscuro que mide 4 ml. Al corte una superficie de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso con hiperqueratosis leve, el estroma vascularizado e infiltrado por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de prepucio:\r\n-POSTITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(424, 'Q2103-1958', 'Q', '33140769', 'YOLANDA HERNANDEZ DE HERRERA', '0000', 'F', '70', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-03-30', '2021-03-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mucosa de colon" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa colónica con un infiltrado inflamatorio leve mediado por linfocitos y plasmocitos.\r\nEn la muestra enviada no se observan granulomas, parasitos intestinales ni cambios displasicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-FRAGMENTOS DE MUCOSA COLÓNICA CON INFLAMACIÓN CRÓNICA INESPECIFICA\r\n\r\n', '', ''),
	(425, 'Q2103-1959', 'Q', '1047439265', 'JESUS MARTIN BARROSO MUÑOZ', '3106830172', 'M', '29', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '33200', 'Doctor HERNAN CALDERON', NULL, '2021-03-30', '2021-03-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 x 1 cms. La serosa es opaca de color pardo oscuro. Al corte la luz ocupada por un material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal que muestra a nivel submucoso foliculos linfoides hiperplasicos. En la serosa se observa un infiltrado inflamatorio agudo y congestión vascular.\r\n\r\n\r\n\r\n ', '-PERIAPENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(426, 'Q2103-1960', 'Q', '45455832', 'MONICA DEL ROSARIO PARDO LLAMAS', '3106940677', 'F', '56', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '20201', '59100', 'Doctor ISMAEL YEPES', NULL, '2021-03-29', '2021-03-26', 'OLIVA MARRUGO GRICE', 'Rotulado "Polipo de colon" se recibe lesión polipoide de tejido de color blanquecino y consistencia elástica que mide 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-ADENOMA TUBULAR \r\n\r\n\r\n\r\n', '', ''),
	(427, 'Q2103-1961', 'Q', '45517802', 'ELISABETH TORRES FLOREZ', '3215376805', 'F', '46', 'GASTROPACK SAS', 'PARTICULAR', '20201', '59100', 'Doctor ISMAEL YEPES', NULL, '2021-03-29', '2021-03-26', 'OLIVA MARRUGO GRICE', 'Rotulado "Polipo gastrico" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan antro gatsrico a nivel de la submucosa se observa una infiltración difusa de células pqueñas uniformes que parecen corresponder a linfocitos, sin centros germinales.\r\n\r\n\r\n\r\nOBSERVACIONES: Los hallazgos descritos hacen necesario una evaluación inmunohistoquímica para descartar proceso neoplasico.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y OBSERVACIONES\r\n\r\n\r\n', '', ''),
	(428, 'Q2103-1962', 'Q', '1142922712', 'EDGAR EDUARDO MORALES ORTIZ', '3023478685', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '59100', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-03-29', '2021-03-26', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se ercieb un apéndice cecal que mide 10 x 1 cms. tapizada por una serosa de color pardo claro bien vascularizada. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(429, 'Q2103-1963', 'Q', '45545464', 'ADRIANA PATRICIA TINOCO VALENCIA', '3156355053', 'F', '38', 'LIGA CONTRA EL CANCER', '', '898201', '33200', 'Doctor CARLOS OSORIO', NULL, '2021-03-29', '2021-03-26', 'OLIVA MARRUGO GRICE', 'Rotulado "Trucut de mama derecha" se reciben tres fragmentos cilíndricos de tejido de color blanquecino que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido mamario que muestra algunos canaliculos con cambios secretorios, en otras áreas el estroma esta infiltrado por linfocitos, plasmocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Biopsia por trucut de mama derecha:\r\n-MASTITIS AGUDA Y CRÓNICA\r\n\r\n\r\n\r\n', '', 'En el material enviado no se observan cambios neoplasicos.\r\n\r\n\r\n'),
	(430, 'L2103-77', 'L', '1102881834', 'OSNEIDI ELIZABETH FLOREZ ALVAREZ', '3143870571', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '33200', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-03-29', '2021-03-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Liquido cefalorraquideo" se reciben 3 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquideo:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(431, 'L2103-78', 'L', '45545464', 'ADRIANA PATRICIA TINOCO VALENCIA', '3156355053', 'F', '38', 'LIGA CONTRA EL CANCER', '', '898201', '33200', 'Doctor CARLOS OSORIO', NULL, '2021-03-29', '2021-03-29', 'OLIVA MARRUGO GRICE', 'Rotulado "BACAF de seno derecho" se reciben 6 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos están constituidos por linfocitos, plasmocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' ACAF de mama derecha:\r\n-NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n', '', ''),
	(432, 'L2103-79', 'L', '70900591', 'PEDRO CLAVER GONZALEZ PINEDA', '000', 'M', '60', 'PARTICULAR', 'PARTICULAR', '20205', '', 'Doctor YAMITH ENRIQUE URUETA CHAVEZ ', NULL, '2021-04-05', '2021-03-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "BACAF de parotida izquierda" se reciben cuatro placas con su extendido.\r\n\r\n\r\n\r\n', 'Los extendidos son muy celulares y están compuestos por células fusiformes (mioepiteliales), epitelioides y otras de nucleos grandes, irregulares que se disponen en pequeños grupos. No se encuentra matriz mixoide.\r\n\r\n\r\n\r\nCOMENTARIO: Los hallazgos citológicos son sugestivos de un ADENOMA PLEOMÓRFICO CON CAMBIOS CITOLÓGICOS ATIPICOS. Se sugiere la extirpación de la lesión para su estudio histopatológico.\r\n\r\n\r\n', ' ACAF de masa en parotida izquierda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n\r\n\r\n', '', ''),
	(433, 'Q2103-1964', 'Q', 'VEN2391388', 'DANIELA ALEJANDRA MENDEZ ARANBULET', '3044130013', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '20201', '', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-04-05', '2021-03-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice + epiplon" se recibe un apendice cecal que mide 8 x 1.3 cms. La superficie externa esta cubierta por una serosa irregular de color pardo claro y en la parte media se observa una solución de continuidad que se comunica la luz. Al corte se encuentra una luz dilatada que contiene un material grumoso de color verdoso. Se toman cortes, Además, tres fragmentos de epiplon de forma irregular. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nOtros cortes muestran epiplón con inflamación aguda.\r\n\r\n\r\n\r\n\r\n', '1.APENDICITIS AGUDA\r\n2.FRAGMENTO DE EPIPLON CON INFLAMACIÓN AGUDA\r\n\r\n\r\n', '', ''),
	(434, 'Q2103-1965', 'Q', '1041973408', 'GLORIANIS VALETA JULIO', '3205034793', 'F', '16', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-04-05', '2021-03-30', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian un diámetro mayor de 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden respectivamente 0.1 y 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción del duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan E.\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\nLos cortes rotulados C muestran mucosa gástrica oxíntica sin alteraciones.\r\nLos cortes rotulados D y E muestran mucosa duodenal con leve edema, congestión e infiltración linfoplasmocitaria de la lámina propia.\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON LEVE ACTIVIDAD INFLAMATORIA\r\n3.Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA OXÍNTICA\r\n4.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n5.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(435, 'Q2103-1966', 'Q', '17093474', 'VICTOR JULIO RAMIREZ LEON', '0000', 'M', '79', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-04-07', '2021-03-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Lesión ulcerada en recto y tercio medio distal" se reciben dos fragmentos de tejido de forma irregular de color pardo oscuro y consistencia blanda que promedian un diámetro mayor de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran un tejido de granulación muy vascularizado y densamente infiltrado por linfocitos, células plasmáticas y neutrófilos. No se encuentra mucosa rectal en la muestra ni cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión ulcerada en recto:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n', '', 'Si a criterio clínico se piensa en una lesión neoplásica se recomienda tomar nueva biopsia más profunda.\r\n\r\n'),
	(436, 'Q2104-1967', 'Q', '45522663', 'EMA GONZALEZ CORTEZ', '0000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-04-07', '2021-04-06', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 x 1 cms. La serosa opaca y cubierta por un material fibrinopurulento. Al corte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(437, 'Q2104-1968', 'Q', '9085265', 'YAMIL DE JESUS BAJAIRE MORAD', '3114186488', 'M', '68', 'PARTICULAR', 'C.', '898201', '30215', 'FRANCISCO JAVIER CRUZ FARFUD', NULL, '2021-04-07', '2021-04-06', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Polipo cuerda vocal izquierda" dos fragmentos de tejido de aspecto pilopoide el mayor mide 0.5 cms. y el menor de 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Polipo cuerda vocal derecha" un fragmento de tejido redondeado mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran epitelio escamoso con vacuolización superficial que rodea un nucleo de tejido conectivo laxo muy vascularizado y edematoso, que además contiene, en algunas áreas, un material hialino amorfo, acidofílico. No hay cambios neoplásicos.\r\nLos cortes rotulados B muestran una lesión similar a la anterior en la que predomina el depósito del material hialino descrito. No hay cambios neoplásicos.\r\n\r\n\r\n', '1.Resección de lesión en cuerda vocal izquierda:\r\n-PÓLIPO LARÍNGEO\r\n2.Resección de lesión en cuerda vocal derecha:\r\n-PÓLIPO LARÍNGEO\r\n\r\n\r\n', '', ''),
	(438, 'Q2104-1969', 'Q', '22783919', 'ILBA GOMEZ DE PRENS', '3106574619', 'F', '81', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-07', '2021-04-06', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n\r\n', '', ''),
	(439, 'Q2104-1970', 'Q', '91497734', 'ROGER ALEXANDER MARTINEZ CACERES', '3183977009', 'M', '45', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-07', '2021-04-06', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en moderada cantidad con formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(440, 'Q2104-1971', 'Q', '1001974165', 'YERLYS DAYANA BATISTA SANCHEZ', '000', 'F', '19', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor JOSE RODRIGUEZ - CARLOS REMOLINA', NULL, '2021-04-09', '2021-04-06', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Segmento de bulas pulmonar" se reciben dos segmentos pulmonares de tejido de color grisáceo de consistencia elástica el mayor de ellos mide 7 x 2 cms. y el menor de 4 x 4 cms. suturado por una de sus caras. Al corte del mayor se observan cavidades de aspecto quístico. Se toman cortes y se rotulan A, el menor de iguales caracteristicas, se rotulan B .\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran parenquima pulmonar constituido por acinos pulmonares dilatados tapizados por epitelio plano asociados a fragmentos de paredes alveolares rotas en los espacios aereos. Algunos septos muestran marcada fibrosis, se observa además áreas con patrón descamativo y antracosis.\r\n\r\n\r\n\r\n', ' Segmentos de pulmon izquierdo lóbulo inferior (2):\r\n-ENFISEMA ACINAR CON BULAS ENFISEMATOSAS\r\n-PARENQUIMA PULMONAR CON NEUMOPATIA DESCAMATIVA Y ANTRACOSIS', '', ''),
	(441, 'Q2104-1972', 'Q', '830637331101986', 'MARIA GABRIELA BUSTAMANTE DE DIAZ', '3148442447', 'F', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR GONZALEZ', NULL, '2021-04-07', '2021-04-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesicula biliar, previamente evacuada de forma piriforme que mide 8 x 3 cms. la serosa es de color pardo rosado. Al corte las paredes engrosadas, la mucosa ha perdido parcialmente el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya pared esta densamente infiltrada por linfocitos, plasmocitos y neutrófilos en abundante cantidad, hay hipertrofia de la muscular y congestión de la serosa.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS AGUDA Y CRÓNICA', '', ''),
	(442, 'Q2104-1973', 'Q', '9056414', 'CORNELIO VALDELAMAR ESPINOSA', '000', 'M', '77', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor JOSE RODRIGUEZ - CARLOS REMOLINA', NULL, '2021-05-13', '2021-04-07', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separads y rotulados, se reciben:\r\n1. "Biopsia de pulmon" nueve fragmentos de tejido de forma filiformes el mayor de 2 cms. y el menor de 0.7 cms. Se toma todo y se rotulan A.\r\n2. "Pleura parietal" un fragmento de tejido de color pardo claro que alternan con áreas oscuras que mide 3 x 1 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A revelan pulmón con una lesión tumoral epitelial maligna constituida por formaciones glanduliformes irregulares tapizadas por células que muestran pleomórfismo nuclear, hipercromátismo y abundante citoplasma, algunas formaciones glandulares muestran estructuras micropapilares y nidos sólidos. No se observó invasión linfovascular en las muestras enviadas de los 9 cilíndros 8 de ellos estan comprometidos por la lesión en un porcentaje de un 60%.\r\nLos cortes rotulaso B muestran pleura infiltrada por el tumor descrito.\r\n\r\n', '1.Biopsia de pulmón izquierdo lóbulo inferior:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n-NO SE OBSERVÓ INVASIÓN LINFOVASCULAR\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE PRESENTE EN 8 CILÍNDROS EN UN 60%\r\n2.Biopsia de pleura pulmonar izquierda:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n\r\nNOTA: Caso visto en conjunto con los doctores José Caraballo y Olivia Marrugo.', '', 'Se retiran 14 bloques por el señor EMETERIO VALDELAMAR MONDOL CC. 78.697.059 (13 de mayo de 2021)'),
	(443, 'Q2104-1974', 'Q', '1051891215', 'CALEB DAVID BATISTA RAMIREZ', '3017772704', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-04-07', '2021-04-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Producto de esplenectomía parcial-bazo" se recibe el producto de una esplenectomia parcial pesa 91 gms. y mide 10 x 6 x 2 cms. La superficie externa es de color gris oscuro y en uno de sus extremos muestra un área cruenta. Al corte la pulpa es de color oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan bazo en el que se observa perdida de la relación entre pulpa blanca y pulpa roja por marcada congestión de esta ultima, no se observan cambios tromboticos ni focos de necrosis.\r\n\r\n\r\n\r\n', ' Esplenectomía parcial:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(444, 'Q2104-1975', 'Q', '22579331', 'YENNYS ERLINDA VILORIA MAURY', '3008439837', 'F', '48', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-04-07', '2021-04-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(445, 'Q2104-1976', 'Q', '1043651978', 'FRANCISCO ALEJANDRO MARRUGO GONZALEZ', '3205827460', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-04-07', '2021-04-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.6 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa irregular de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(446, 'Q2104-1977', 'Q', '1137531610', 'LAUREN LORENO CIRO CASTRO', '3042120237', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-04-07', '2021-04-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo claro con vasos prominentes. Al corte se encuentra una luz dilatada que contiene un material grumoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(447, 'Q2104-1978', 'Q', '1047454262', 'SHAREL LUCIA SALCEDO MARQUEZ', '3044093529', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-07', '2021-04-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian un diámetro de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica antral. En la luz de algunas glándulas se encuentran H.pylori en pequeña cantidad. Hay edema, congestión e infiltración linfoplasmocitaria y neutrófílica de la lámina propia. No hay cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n\r\n', '', ''),
	(448, 'Q2104-1979', 'Q', '1042578347', 'ESTEFANI PAOLA CASTILLO MERCADO', '3043598720', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-04-07', '2021-04-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 0.8 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo claro con vasos prominentes. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendice cecal:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(449, 'Q2104-1980', 'Q', '1047386044', 'JIMENA PATERNINA BARRAZA', '3002480862', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-07', '2021-04-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" varios fragmentos de tejido de aspecto membranoso, de color pardo grisáceo y consistencia blanda que promedian un diámetro de 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y cosnsietncia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso con engrosamiento del estrato basal, vacuolización citológica focal y elongación de las papilas. No hay componente de la lámina propia en la muestra.\r\nLos cortes rotulados B muestran mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-CAMBIOS COMPATIBLES CON REFLUJO GASTRO-ESOFÁGICO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n', '', ''),
	(450, 'Q2104-1981', 'Q', '1201217782', 'GENESIS ATAMAR BATISTA MORELO', '3003962611', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN JIMENEZ SANCHEZ', NULL, '2021-04-07', '2021-04-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa irregular de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene un material grumoso de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(451, 'L2104-80', 'L', 'VEN25973946', 'RAYMUNDO DE JESUS MARTINEZ MORRIS', '000', 'M', '55', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ - JAVIER MARTINEZ MARRIAGA', NULL, '2021-04-09', '2021-04-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Muestra de tiroides lobulo derecho" se reciben seis placas con su extendido.\r\n\r\n\r\n\r\n', 'Los extendidos estan compuestos por numerosas células foliculares con núcleos ligeramente pleomórficos con diferentes formas y tamaños, algunos con seudoinclusiones intranucleares que se disponen individualmente y en pequeños grupos y reposan en un trasfondo hemorrágico.\r\n\r\n\r\n\r\n', ' BACAF de lóbulo derecho de tiroide:\r\n-CITOLOGÍA ANORMAL COMPATIBLE CON CARCINOMA PAPILAR. (CATEGORIA DIAGNÓSTICA V DEL SISTEMA BETHESDA)\r\n\r\n\r\n\r\n', '', ''),
	(452, 'Q2104-1982', 'Q', 'VEN25862020', 'NATHALIZ MAYERLYN DIAZ LAMUÑO', '3205275064', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-04-09', '2021-04-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mioma" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.7 x 1.1 cms. en sus mayores dimensiones. Al corte se observa una superficie de color pardo claro y aspecto de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n', '-LEIOMIOMA UTERINO (miomectomía)\r\n\r\n\r\n\r\n', '', ''),
	(453, 'Q2104-1983', 'Q', 'VEN21130137', 'MONICA ELENA DIAZ GENES', '3043690196', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-04-09', '2021-04-08', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa parcial derecha" un segmento de trompa de Falopio que mide 2 x 0.7 mcs. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte conserva la morfología habitual. Se toman cortes y se rotulan A.\r\n2. "Embarazo ectopico trompa parcial izquierda" una trompa de Falopio que mide 5.5 x 2 cms. en sus mayores dimensiones, color pardo oscuro con áreas de aspecto necrótico. Al corte se observa una cavidad previamente evacuada que contiene algunos coágulos sanguineos. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran trompa de Falopio que conserva la estructura usual.\r\nLos cortes rotulados B muestran trompa de Falopio con áreas extensas de necrosis y hemorrágia. Hay presencia de trofoblasto intermedio que infiltra la pared tubática.\r\n\r\n\r\n\r\n', '1.Salpingectomía parcial derecha:\r\n-TROMPA DE FALOPIO (segmento)\r\n2.Salpingectomía total izquierda:\r\n-EMBARAZO TUBARICO ROTO', '', ''),
	(454, 'Q2104-1984', 'Q', '1201249160', 'HARLIANYS SOFIA SILVA OTERO', '3104574713', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-09', '2021-04-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Colon" se reciben dos fragmentos filiformes de tejido de color pardo claro y consistencia blanda que promedian 0.8 x 0.2 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa colónica que conserva la morfología habitual. La lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas con formación ocasional de acúmulos linfoides. No se observan parasitos, granulomas ni cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-COLITIS CRÓNICA INESPECIFICA\r\n\r\n\r\n', '', ''),
	(455, 'Q2104-1985', 'Q', '1047502033', 'ROSA ICELA MARTINEZ BOLAÑOS', '3233351016', 'F', '22', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-04-09', '2021-04-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Placenta" se recibe una placenta que pesa 118 gms. y mide 10 x 8.5 x 2.5 cms. La cara fetal esta cubierta por unas membranas lisas y brillantes, y un segmento de cordon umbilical que mide 4.5 cms. de implantación central. La cara materna es irregular de color pardo claro y aspecto mamelonado. Al corte el cordon umbilical se identifican tres vasos sanguíneos. Otros cortes muestran una superficie finamente granular, esponjosa. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vellosidades coriales con edema del mesenquima y vascularidad normal. No hay cambios inflamatorios degenerativos ni neoplásicos.\r\n\r\n\r\n\r\n', ' Placenta del segundo trimestre (118 gms.):\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n', '', ''),
	(456, 'Q2104-1986', 'Q', 'VEN26911788', 'YOHANA YAQUELINE ALVAREZ CABARCAS', '3004036541', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-04-09', '2021-04-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Placenta" se recibe una placenta con sus membranas y un cordon umbilical pesa 215 gms. y mide 13 x 10 x 2.5 cms. la cara fetal esta cubierta por las membranas lisas y brillantes y un segmento de cordon umbilical que mide 31 cms. de implantación excentrica a 1 cms. de uno de los bordes. La cara materna es irregular y en la parte central hay un área cruenta, en el cordon umbilical se observan tres vasos. Al corte se observa una superfiice de color pardo claro finamente granular. En uno de los extremos se observa un hematoma retoplacentario mide 4 x 3.5 x 1 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vellosidades coriales terciarias tapizadas por cito y sinciotrofoblasto. Hay buen desarrollo de los vasos del mesenquima que se observan con marcada congestión. Otros cortes muestran un gran coágulo sanguíneo.\r\n\r\n\r\n\r\n', ' Placenta del tercer trimestre (215 gms.):\r\n-HEMATOMA RETROPLACENTARIO\r\n\r\n\r\n', '', ''),
	(457, 'Q2104-1987', 'Q', '1049828272', 'YERALDIN PAOLA AYOLA TORREGLOSA', '3136053204', 'F', '14', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-04-14', '2021-04-08', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Líquido pleural" se reciben 5 ml. de un líquido de color rojizo. Se centrifuga y se hace extendido del sedimento.\r\n2. "Trompa y ovario izquierdo" una masa de tejido de forma irregular de color pardo grisáceo y cosnsistencia elástica que pesa 491 gms. y mide 12 x 13 x 6 cms. En uno de los extremos se identifica una trompa de Falopio que mide 7.2 x 0.8 cms. La superficie externa es irregular. En ella se observan estructuras de aspecto quístico y trae adherido fragmentos de epiplon. Al corte se observa una superficie de color violáceo finamente granular que rodea una cavidad virtual. Al corte de la trompa conserva la morfología habitual. Se toman cortes.\r\n\r\n\r\n', 'El espécimen está compuesto en su mayoría por áreas extensas de necrosis hemorrágica. En las áreas viables se encuentra un tumor maligno compuesto por células grandes de núcleos hipercromáticos, irregulares, algunos monstruosos, con nucléolo prominente y citoplasma acidofilico que en algunas áreas forman estructuras sincitiales. En otras áreas se encuentran células de menor tamaño, con núcleo redondo hipercromático y citoplasma claro que se disponen formando nidos sólidos. No se encuentran cambios de carcinoma embrionario ni de tumor del saco vitelino. El tumor está limitado al ovario sin sobrepasar sus límites. La trompa de Falopio muestra áreas extensas de necrosis hemorrágica.\r\nLos extendidos de líquido peritoneal son hemorrágicos. No se observan células tumorales.\r\n\r\n', ' Salpingooforectomía izquierda:\r\n-OVARIO CON NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN DEL PEDICULO\r\n-TUMOR GERMINAL MIXTO CON COMPONENTE DE CORIOCARCINOMA Y DISGERMINOMA\r\n-TROMPA DE FALOPIO CON NECROSIS HEMORRÁGICA\r\n Citología de líquido peritoneal:\r\n-NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n', '', 'Es necesario practicar estudios de inmunohistoquímica para confirmar el diagnóstico.\r\n\r\nCaso visto en junta de patologos.\r\n'),
	(458, 'Q2104-1988', 'Q', '73138737', 'ROBER ENRIQUE HERNANDEZ BARRERA', '3107108252', 'M', '52', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-04-09', '2021-04-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n\r\n', '', ''),
	(459, 'Q2104-1989', 'Q', '1047480455', 'MILAGRO MARTINEZ BERTEL', '3004148736', 'F', '25', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-09', '2021-04-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n\r\n', '', ''),
	(460, 'Q2104-1990', 'Q', '1142931266', 'YUSETH DAVID DE LA HOZ ORTEGA', '3016104540', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-04-09', '2021-04-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. tapizada por una serosa opaca bien vasdularizada de color pardo claro, la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(461, 'Q2104-1991', 'Q', '1047400963', 'ANIEL RUBEN MONTALVO DIAZ', '3136423664', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2021-04-10', '2021-04-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste epididimo derecho" se recibe una formación nodular que mide 0.5 cms. Al corte formación quistica de 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Lesión quística constituida por una pared de tejido conectivo tapizado por epitelio cilindrico.\r\n\r\n\r\n\r\n', '-QUÍSTE SIMPLE, epididimo derecho', '', ''),
	(462, 'Q2104-1992', 'Q', '1142920752', 'SEBASTIAN ANDRES GUTIÉRREZ TORRES', '3114101826', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-04-09', '2021-04-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(463, 'Q2104-1993', 'Q', '37804851', 'SONIA CARMELITA PORTILLA DE LIZARAZO', '000', 'F', '70', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-04-09', '2021-04-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 5 x 2 cms. previamente abierta. Al corte salida de material biliar, la pared se observa discretamente engrosada, la mcuosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular e histiocitos espumosos subepiteliales.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLESTEROLOSIS\r\n\r\n\r\n', '', ''),
	(464, 'Q2104-1994', 'Q', '33157834', 'RUTH ROMERO PAJARO', '000', 'F', '71', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-04-09', '2021-04-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 5 x 2 cms. previamente abierta. Al corte salida de material biliar y la presencia de calculos de color negro, la pared se observa engrosada, la mcuosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS', '', ''),
	(465, 'Q2104-1995', 'Q', '1101442930', 'JAVIER EDUARDO CAMPOS BARRERA', '000', 'M', '36', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-04-12', '2021-04-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.5 x 0.8 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo grisáceo. Al corte se encuentra una luz dilatada que contiene un material pastoso de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(466, 'Q2104-1996', 'Q', '45576309', 'NAYIBE JUDITH DIAZ HOYOS', '3187690844', 'F', '52', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-12', '2021-04-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de endocervix" se recibe un material grumoso de aspecto mucoide en el que se observa un pequeño fragmento de un material friable de color blanquecino que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'El especímen está compuesto por un material mucoide y fragmentos sueltos de glándulas endocervicales.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de endocervix:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(467, 'Q2104-1997', 'Q', '30772694', 'ROSALBA MACIAS DE LEON', '3122429612', 'F', '54', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-04-12', '2021-04-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden respectivamente 0.1 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral dentro de los límites de la normalidad. No se identifica H.pylori.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA ANTRAL\r\n\r\n\r\n\r\n', '', ''),
	(468, 'Q2104-1998', 'Q', '45554632', 'VIVIANA SOFIA VILLAR PADILLA', '000', 'F', '37', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-04-12', '2021-04-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa derecha" un segmento tubular de tejido que mide 2 x 0.5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa lisa y brillante de color pardo oscuro. Se toman cortes y se rotulan A.\r\n2. "Trompa izquierda" un segmento tubular similar al descrito que mide 1.7  x0.5 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA DERECHA. SEGMENTO	\r\n2.TROMPA UTERINA IZQUIERDA. SEGMENTO\r\n\r\n\r\n', '', ''),
	(469, 'Q2104-1999', 'Q', '1031856731', 'EIDER DAVID ALVAREZ QUINTERO', '3043736132', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-04-12', '2021-04-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 0.5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa lisa y brillante de color pardo claro. Al corte se encuentra una luz puntiforme que contiene un líquido de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(470, 'Q2104-2000', 'Q', '1048464002', 'EDWING RAUL RAMIREZ TERAN', '3147625893', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-04-12', '2021-04-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice" un apéndice cecal dividida en dos segmentos de 5 cms. de longitud, cada uno, la superficie externa es irregular, con presencia de membranas de color verde amarillento y aspecto purulento. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. S etoman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Ganglio apendicular" contiene una estrcutura de forma ovoide de color blanquecino y consistencia elástica que mide 1 cm. en sus mayores dimensiones. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nLos cortes rotulados B muestran ganglio linfático con cambios de hiperplasia reactiva de tipo mixto.\r\n\r\n\r\n\r\n', '1.APENDICITIS AGUDA\r\n2.Ganglio linático:\r\n-HIPERPLASIA REACTIVA DE TIPO MIXTO\r\n\r\n\r\n\r\n', '', ''),
	(471, 'Q2104-2001', 'Q', '1049930959', 'ALAIS BELLO MALDONADO', '3216564509', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-12', '2021-04-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran en uno de los fragmentos mucosa gástrica antral con focos de erosión superficial y sangrado. Hay densa infiltrado linfoplasmocitaria de la lámina propia con formación de folículos linfoídes. No se identifica actividad inflamatoria ni presencia de H.pylori.\r\nEl otro fragmento corresponde a bulbo duodenal con infiltración mononuclear de la lámina propia y formación de folículos linfoides.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA CON EROSIÓN SUPERFICIAL\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.Biopsia endoscópica de bulbo duodenal.\r\n-DUODENITIS CRÓNICA', '', ''),
	(472, 'Q2104-2002', 'Q', '63497306', 'AMANDA ORTIZ PEÑUELA', '3102409693', 'F', '46', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-04-14', '2021-04-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.1 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n\r\n', '', ''),
	(473, 'Q2104-2003', 'Q', '1082839048', 'VERA TATIANA MARTINEZ BAÑOS', '3004445471', 'F', '35', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-04-14', '2021-04-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(474, 'Q2104-2004', 'Q', '40984154', 'ILCE CARABALLO MEÑACA', '3207343005', 'F', '66', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-04-15', '2021-04-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia esta infiltrada por linfocitos y plasmocitos en cantidad moderada, hay presencia de neutrófilos en abundante cantidad algunos penetran el epitelio glandular, se observa además acumulos de linfocitos en la lámina propia H.pylori en abundante cantidad y foocs de metaplasia intestinal incompleta.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de antro:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA Y FOCOS DE METAPLASIA INTESTINAL INCOMPLETA\r\n\r\n\r\n', '', ''),
	(475, 'Q2104-2005', 'Q', '23151757', 'TAIS PATRICIA IGLESIAS MIER', '0000', 'F', '39', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', '', NULL, '2021-04-20', '2021-04-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de endometrio" se reciben fragemntos de tejido de color oscuro que juntos promedian 2 ml. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Endometrio constituido por glandulas con atipias estructurales tapizadas por células cilíndricas con estratificación nucleos vesiculosos con nucleolos, el estroma abundante fusocelular.\r\n\r\n\r\n\r\n', ' Legrado uterino.\r\n-HIPERPLASIA SIMPLE ATIPICA\r\n\r\n\r\n', '', ''),
	(476, 'L2104-81', 'L', '63466510', 'ELIZABETH ALFONSO RODRIGUEZ', '000', 'F', '45', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2021-04-16', '2021-04-12', 'ANA MAGOLA MANGA CEDEÑO', 'En consulta, se recibe dos placas rotuladas "T439-21" con su extendido.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos muestran una población celular polimorfa, compuesta en su mayoría por linfocitos pequeños, redondos, que alternan con inmunoblastos, linfocitos plasmocitoides y escasos PMN neutrófilos, todo sobre un fondo hemorrágico. No se identifican células epiteliales.\r\n\r\n\r\n\r\n', ' BACAF de ganglio cervivcal derecho:\r\n-CAMBIOS COMPATIBLES CON HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', 'Caso visto en conjunto con el doctor José Caraballo.'),
	(477, 'L2104-82', 'L', '22804617', 'OLGA LUCIA MARQUEZ PEREDES', '000', 'F', '42', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-04-12', '2021-04-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "ACAF de mama izquierda" se reciben 8 ml. de un líquido de color pardo oscuro. Se centrifuga y se hace extendido del extendido.\r\n\r\n\r\n\r\n', 'Los extendidos muestran muy escasas células escamosas maduras con nucleos uniformes. No se observan elementos propios del tejido mamario.\r\n\r\n\r\n\r\n\r\n', ' ACAF de mama izquierda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n', '', ''),
	(478, 'Q2104-2006', 'Q', '45440153', 'MARITZA MARIN SANDOVAL', '3182135662', 'F', '60', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(479, 'Q2104-2007', 'Q', '1047413241', 'SHIRLEY DEL CARMEN FABRA BLANQUICETH', '3014255381', 'F', '31', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se erciben:\r\n1.  "Antro gástrico" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo gástrico" cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A musetran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B musetran mucosa oxíntica que conserva la morfología habitual. La lámina propia está ligeramente edematosa e infiltrada por células mononucleares. No se observan H.pylori, actividad inflamatoria ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(480, 'Q2104-2008', 'Q', '1043298866', 'FREDY ALEJANDRO CEDEÑO VALCERDE', '3168691853', 'M', '14', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo gástrico" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica cuya lámina propia esta edematosa, congestiva e infiltrada por linfocitos. No se observan H.pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\nLos cortes rotulados C y D muestran mucosa duodenal cuya morfología está preservada. La lámina propia esta edematosa, congestiva y densamente infiltrada por linfocitos y células plasmáticas. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA INESPECÍFICA\r\n4.Biopsia endoscópica de duodeno (segunda porción):\r\n-DUODENITIS CRÓNICA INESPECÍFICA', '', ''),
	(481, 'Q2104-2009', 'Q', '1043316087', 'ROIBER GARCIA CORDOBA', '3215530873', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.3 x 0.8 cms. La superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(482, 'Q2104-2010', 'Q', '1048443596', 'ILWIN MIGUEL ARROYO RECUERO', '3017886037', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma alargada de color pardo claro y consistencia blanda que promedian 0.6 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotualso A muestran fragmentos de epitelio escamoso maduro sin componente de lámina propia. No se observan cambios inflamatorios.\r\nLos cortes rotulados B muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(483, 'Q2104-2011', 'Q', '1044011036', 'LORAINE FORTICH VANEGAS', '6622825', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rourlado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que en conjunto hacen un volumen de 1.5 ml. Al corte se observa una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n\r\n', '', ''),
	(484, 'Q2104-2012', 'Q', '1043637094', 'CLAUDIA MARCELA GRAU CASTILLO', '301724619', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(485, 'Q2104-2013', 'Q', 'VEN30832973', 'CRISTIAN ALEXANDER PUCHE ESTRADA', '3042011910', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.2 x 0.8 cms. La superficie externa esta cubierta por una serosa despulida. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(486, 'Q2104-2014', 'Q', '1201221342', 'LUZ DANIEL HERRERA DIAZ', '3226901243', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'OSCAR ENRIQUE ROMERO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n\r\n\r\n', '', ''),
	(487, 'Q2104-2015', 'Q', '1043657809', 'LUIS DARIO CARDALES MEDRANO', '3008706489', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Testiculo derecho" se recibe un testiculo con sus elementos del cordon que juntos miden 5.5 x 5 x 3.2 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte se observa una superficie de color violáceo finamente granular. El testiculo mide 4.8 x 3 x 2.5 cms. El cordon espermático tambien se encuentra de color violáceo, aspecto edematoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los múltiples cortes muestran testiculo con áreas extensas de necrosis y hemorrágica.\r\n\r\n\r\n\r\n', '-TESTICULO CON NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n\r\n', '', ''),
	(488, 'Q2104-2016', 'Q', '1049532423', 'ESFEFANY PAOLA BELTRAN SABALZA', '3217216734', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 14 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulisa y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(489, 'Q2104-2017', 'Q', '1002186284', 'WENDY GONZALEZ GUERRERO', '0000', 'F', '21', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor MAURICIO ORTIZ BANQUEZ', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Restos ovulares" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 7 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por fragmentos de decidua con áreas extensas de necrosis que alternan con coágulos sanguineos. No se observan elementos trofoblasticos.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n', '', ''),
	(490, 'Q2104-2018', 'Q', '25342082', 'DARIAGNY KAROLA FERRER RODRIGUEZ', '3008120841', 'F', '25', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de mama izquierda" una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 5.5 x 5.5 x 3.8 cms. La superficie externa es multilobulada y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Biopsia de mama derecha" tres masas de tejido de forma irregular de color pardo claro y consistencia elástica que miden 3.5 x 2.5 x 2, 2.5 x 1.5 x 1.5 y 1.5 x 1 x 1 cms. Al corte se observa una superficie homogena de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tumores benignos compuestos por la proliferación combinada de elementos glandulares y estromales.\r\n\r\n\r\n\r\n', '1.Resección de masa en mama izquierda:\r\n-FIBROADNEOMA\r\n2.Resección de masas en mama derecha:\r\n-FIBROADENOMAS (3)\r\n\r\n\r\n', '', ''),
	(491, 'Q2104-2019', 'Q', '30878639', 'ERIS JUDIT SALAS MARTINEZ', '0000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'EPS SANITAS', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Restos ovulares" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro con áreas de color pardo oscuro y consistencia friablea que en conjunto hacen un volumen de 2 ml. Se toma parte.\r\n\r\n\r\n\r\n\r\n', 'El especímen está constituido por escasas vellosidades coriales sin cambios que alternan con fragmentos de decidua y coágulos sanguíneos.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-RESTOS OVULARES\r\n\r\n\r\n\r\n', '', ''),
	(492, 'Q2104-2020', 'Q', '1143398354', 'MARTHA LILIANA JEREZ CARRILLO', '0000', 'F', '42', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Cuadrante de mama derecha" se recibe un fragmento de tejido de forma irregular de color pardo amarillento que mide 6.5 x 4 x 3.5 cms. Trae adherida una seda marcado el margen median, dos sedas margen profundo, tres sedas margen superior. Al corte se observa una superficie de color parod grisáceo y aspecto estrellado que alternan con un área de color pardo amarillento. El área de aspecto sólido, aspecto estrallado mide 2.5 x 1.7 x 1.5 cms. en sus mayores dimensiones, en estrecha relación con el margen de resección. Se toman cortes y se rotulan D. Se toman cortes y se rotulan así: A margen de resección medial, B margen de resección profundo, C margen de resección superior.\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células con nucleos pleomórficos, hipercromáticos, algunos con nucleolos prominentes (grado 3), moderado número de mitosis (grado 2), que se disponen en nidos sólidos, cordones y formando escasas estructuras glanduliformes (grado 3) que infiltra el estroma. Hay un componente intracanalicular tipo comedo. El tumor compromete focalmente el margen de resección.\r\nLos margenes de resección rotulados A, B, y C están libres de tumor.\r\n\r\n\r\n', ' Cuadrantectomía* mama derecha (6.5 x 4 x 3.5 cms. ):\r\n-CARCINOMA DUCTAL, TIPO NO ESPECIAL, POBREMENTE DIFERENCIADO, INFILTRANTE\r\n-COMPROMISO FOCAL DE MARGEN DE RESECCIÓN\r\n-VOLUMEN TUMORAL: 2.5 x 1.7 x 1.5 cms.\r\n-INFILTRACIÓN ANGIOVASCULAR: NO IDENTIFICADA\r\n\r\n\r\n\r\n*Cuadrante no especificado.', '', ''),
	(493, 'Q2104-2021', 'Q', '1010149591', 'LISBETH SANTOS MACHACON', '000', 'F', '21', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis muestra acantosis irregular reposa en un dermis fibroso con infiltración mononuclear. No se observan cambios de molusco.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-COMPATIBLE CON LIQUEN SIMPLE CRÓNICO\r\n\r\n\r\n\r\n', '', 'Se recomienda correlacionar clínico-patológica.\r\n\r\n\r\n'),
	(494, 'Q2104-2022', 'Q', '45424927', 'MARTA DE LA CONCEPCION GUERRERO BARCASNEGRAS', '0000', 'F', '68', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctora AMALIA CASTILLO', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Hueso alveolar" se reciben cinco diminutos fragmentos de tejido de forma irregular de consistencia firme que promedian 0.2 cms. S etoma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de tejido oseo esponjoso que contiene espículas necróticas rodeadas por un tejido fibroso que contiene PMN neutrófilos y linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de hueso alveolar mandibular:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(495, 'Q2104-2023', 'Q', '32850790', 'LUZ MARINA CABARCAS CASTRO', '0000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2021-04-14', '2021-04-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Utero + trompas derecha e izquierda" se recibe un cuerpo uterino que pesa 102 gms. y mide 8.3 x 7 x 6.5 cms. La superficie externa esta parcialmente cubierta por una serosa lisa y brillante. Al corte la cavidad endometrial esta tapizada pro una mucosa delgada y comprimida por una masa de tejido de color pardo claro y aspecto arremolinaddo que mide 2.4 cms. en su mayor dimensión. El miometro esta ocupado por otras masas similares a las anteriormente descritas cuyos diámetros oscilan entre 2 cms. y pocos milimetros de localización submucosa, intramural y subserosa. En el mismo recipiente, se recibe además, dos trompas de Falopio que incluyen las fimbrias que miden 4.3 y 4.6 cms. en sus mayores dimensiones, la superficie externa de las mismas estan cubeirtas por una serosa lisa y brillante. Al corte conserva la mrofología habitual. Se toman cortes.\r\n\r\n\r\n', 'El endometrio está autólisado. Las masas miometriales descritas estan compuestas por fibras musculares lisas dispuestas irregularmente. Las trompas de Falopio conservan la morfologia habitual.\r\n\r\n\r\n\r\n', ' Histerectomía subtotal con salpingectomía bilateral:\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS SUBMUCOSO, INTRAMURAL Y SUBSEROSO\r\n-TROMPAS DE FALOPIO\r\n\r\n\r\n', '', ''),
	(496, 'Q2104-2024', 'Q', '1047408109', 'KARINA ALVAREZ PADILLA', '3173892596', 'F', '32', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se recibe material mucoide el cual se aislan dos fragmentos de tejido de color pardo oscuro que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmento de cérvix con inflamación crónica y LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE BAJO GRADO \r\n\r\n\r\n', '', ''),
	(497, 'Q2104-2025', 'Q', '1002202759', 'MARIA FERNANDA HERRERA RICARDO', '3128547317', 'F', '21', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se reciben dos diminutos fragmentos de tejido de color blanquecino que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel, cuya epidermis se observa la formación de numerosos cuerpos de inclusión intracitoplasmatico.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-MOLUSCO CONTAGIOSO\r\n\r\n\r\n', '', ''),
	(498, 'Q2104-2026', 'Q', '45472051', 'SANDRA ELENA JUAN GALINDO', '3013434009', 'F', '55', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '898201', '30215', 'Doctor ANTONIO MARTINEZ', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Sigmoide" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon sigmoide:\r\n-ADENOMA TUBULAR \r\n\r\n\r\n', '', ''),
	(499, 'Q2104-2027', 'Q', '1042586466', 'MIGUEL ANGEL ROMERO ORTIZ', '3232317484', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora NELLYS RODRIGUEZ ZULETA', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" una amigdala palatina que mide 2.5 x 2 x 1 cms. de color blanquecino y consistencia elástica. Al corte una superfcie multinodular. Se toman cortes y se rotulan A.\r\n2. "Amigdala izquierda" una amigdala palatina que mide 2.5 x 1.5 x 1 cms. de color blanquecino y consistencia elástica. Al corte una superfcie multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n\r\n\r\n', '', ''),
	(500, 'Q2104-2028', 'Q', '1051680068', 'JESUS MATHIAS LUNA ACUÑA', '3107035683', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor CARLOS EDUARDO ROMAN HERAZO', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Hemangioma rodilla izquierda" se recibe fragmento de tejido que mide 3 x 1.5 x 1 cms. de color blanco amarillento y aspecto adiposo. Al corte una superficie lisa y blanco amarillento. Se toman cortes\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan tumor mesenquimal benigno constituido por lobulos de tejido adiposo maduro separado por septos de tejido fibroso que contienen abundantes vasos sanguineos de paredes delgadas.\r\n\r\n\r\n\r\n', '-ANGIOLIPOMA, tejidos blandos de rodilla izquierda\r\n\r\n\r\n', '', ''),
	(501, 'Q2104-2029', 'Q', '1128045933', 'MANUEL STIVEN VARGAS DIAZ', '3103737914', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. tapizada por una serosa opaca bien vascularizada que traee adherido material fibrinopurulento. Al corte salida de un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apendice cecal cuya mucosa se observa ulcerada, la pared infiltrada pro abundantes PMN neutrófilos que se extienden al tejido adiposo periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECRÓTIZANTE\r\n\r\n\r\n', '', ''),
	(502, 'Q2104-2029', 'Q', '1128045933', 'MANUEL STIVEN VARGAS DIAZ', '3103737914', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. tapizada por una serosa opaca bien vascularizada que traee adherido material fibrinopurulento. Al corte salida de un material hemorrágico. Se toman cortes', '', '', '', ''),
	(503, 'Q2104-2030', 'Q', '1099961411', 'MAICOL ENRIQUE JIMENEZ HERAZO', '3219341294', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. tapizada por una serosa opaca bien vascularizada que trae adherido material fibrinopurulento. Al corte salida de un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APÉNDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(504, 'Q2104-2031', 'Q', '1047496589', 'WILDER ANTONIO DE AVILA PEREZ', '000', 'M', '23', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-04-15', '2021-04-15', 'OLIVA MARRUGO GRICE', 'Rotulado "Segmento de intestino delgado " se recibe un segmento de intestino delgado que mide 15 x 3 cms. a 6 cms. de uno de los bordes de resección se observa un área de perforación que mide 2 cms. y a 4 cms. de esta se observa una perforación de 2 cms. Al corte una mucosa edematosa hiperémica. Se toman cortes y se rotulan A. \r\nAcompañado a esto otro segmento que mide 7 x 3 cms. y a 3 cms. de los bordes presenta ára perforada. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes muestran intestino delgado con áreas de necrosis hemorrágica e inflamación aguda. Bordes de resección viables.\r\n\r\n\r\n\r\n', ' Resección segmentos de intestino delgado, herida por arma de fuego:\r\n-INTESTINO DELGADO CON NECROSIS HEMORRÁGICA, INFLAMACIÓN AGUDA Y PERFORACIÓN (3)\r\n\r\n\r\n\r\n', '', ''),
	(505, 'Q2104-2032', 'Q', '73166482', 'EXCAINER PEREZ AVILA', '000', 'M', '46', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-04-16', '2021-04-15', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotualdos, se reciben:\r\n1. "Masa región cervical" tres fragmentos de tejido que miden respectivamnete 4.5, 3 y 2 cms. en sus mayores dimensiones son de color amarillo, aspecto graso y consistencia afriable. Al corte muestra una superficie untuosa de color amarillo. Se toman sendos cortes y se rotulan A.\r\n2. Un segundo recipiente rotulado "Masa en brazo derecho" contiene una pequeña masa de forma esférica que mide 1.5 cms. en sus mayores dimensiones de color amarillo y consistencia elástica. Al corte muestra una superficie untuosa de color amarillo. Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente, rotulado "Región glutea derecha" una masa similar a la anteriormente descrita. S etoman crotes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A, B y C muestran tumores mesenquimales benignos, compuestos por células adiposas maduras dispuestas en lóbulos.\r\n\r\n\r\n\r\n\r\n', '1.Resección de masas en región cervical:\r\n-LIPOMAS (3)\r\n2.Resección de masa en brazo derecho:\r\n-LIPOMA\r\n3.Resección de masa en región glutea derecha:\r\n-LIPOMA ', '', ''),
	(506, 'Q2104-2033', 'Q', '22973591', 'BIENVENIDA PAJARO AMEL', '000', 'F', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-04-16', '2021-04-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Resección de tumor en región glutea derecha" se recibe un fragmento de tejido de forma irregular de color amarillo y consistencia blanda que mide 3 x 1.5 x 1.5 cms. La superficie externa es irregular y al corte se encuentra una superficie untuosa de color amarillo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en región glutea derecha:\r\n-LIPOMA\r\n\r\n\r\n', '', ''),
	(507, 'Q2104-2034', 'Q', '45553227', 'YOLEIDIS MARTINEZ CARDOSSI', '0000', 'F', '37', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-04-16', '2021-04-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Resección de tumor en región lumbar" se recibe una masa de tejido de forma irregular que mide 1 x 1 x 0.8 cms. en sus mayores dimensiones. Al corte se encuentra un nucleo de color pardo grisáceo rodeado por piel de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se encuentra una proliferación de melanocitos dispuestos en grupos. No hay actividad de unión.\r\n\r\n\r\n\r\n', ' Resección de lesión en región lumbar*:\r\n-NEVO MELANOCÍTICO INTRADERMICO\r\n\r\n\r\n\r\n*Lado no especificado.\r\n', '', ''),
	(508, 'Q2104-2035', 'Q', '33141698', 'OLGA ESTER OLMOS DE HOLGUIN', '000', 'F', '68', 'GASTROPACK SAS', 'PARTICULAR', '', '', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-04-16', '2021-04-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endsoccópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(509, 'L2104-83', 'L', '414768', 'DUANE CURTIS WILDER', '000', 'M', '64', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-04-16', '2021-04-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se reciben 24 ml. de un líquido de color amarillo. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos están compuestos por un material proteináceo que contiene muy escasas células mononucleares.\r\nEl material es inadecuado para valoración diagnóstica.\r\n\r\n\r\n\r\n', ' Extendidos de líquido peritoneal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(510, 'Q2104-2037', 'Q', '45548777', 'LILIANA RODRIGUEZ HURTADO', '3157791633', 'F', '37', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-04-19', '2021-04-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Neo de recto" se reciben cuatro fragmentos de tejido de aspecto mucoide que miden 0.2 y  0.1 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno, epitelial, compuesto por células pleomórficas de núcleos irregulares, hipercromáticos con abundante mitosis, que se disponen formando estructuras glanduliformes que infiltran el estroma.\r\n\r\n', ' Biopsia de lesión en recto:\r\n-ADENOCARCINOMA BIEN DIFERENCIADO, INFILTRANTE.\r\n\r\n', '', 'Caso visto en conjunto con la doctora Virna Caraballo.\r\n\r\n\r\n\r\n'),
	(511, 'Q2104-2038', 'Q', '1201284950', 'JESUS MIGUEL RAMOS OROZCO', '3005113742', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS ALBERTO BALLESTAS ALMARIO', NULL, '2021-04-20', '2021-04-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Unión pielouretral" se recibe un fragmento de tejido de aspecto cilíndrico que mide 2 cms. en uno de sus extremos se encuentra disminuido de grosor, adherido trae fragmento de tejido circular de color blanquecino. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran unión pieloureteral en la que se observa zona estenotica severa.\r\n\r\n\r\n\r\n', ' Resección de unión pieloureteral con: \r\n-ESTENOSIS\r\n\r\n\r\n', '', ''),
	(512, 'Q2104-2039', 'Q', '1043646277', 'MARGELIS JUDITH NAVARRO MEJIA', '6625312', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-04-20', '2021-04-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se erecibe una apéndice cecal que mide 9 cms. la serosa es opaca despulida y cubierta por material fibrinopurulento. Al corte salida de material amarillento de aspecto fibrinopurulento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(513, 'Q2104-2036', 'Q', 'VEN10005', 'IVANA CAROLINA RIVERA BULLONES', '3148617259', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-04-26', '2021-04-16', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Placenta" s erecibe una placenta con sus membranas y un segmento de cordon umbilical pesa 417 gms. y mide 16  x 13 x 3.5 cms. La cara fetal esta cubierta por una serosa lisa y brillante y trae un segmento de cordon umbilical mide 23 cms. de implantación centran, en el que se identifican tres vasos sanguineos, la cara materna muestra una superficie cruenta, irregular de color pardo claro y aspecto mamelonado. Al corte se observa una superficie de color rosado finamente granular, a los múltiples cortes muestran áreas palidas que aletrnan con áreas de color rosado. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran placenta compuesta por vellosidades terciarias que en áreas extensas se observan fibrosas, avasculares, con hialinización. Hay zonas amplias de infartos anémicos. El cordon conserva su morfología habitual.\r\n\r\n\r\n\r\nCOMENTARIO: Ls hallazgos macro y microscópica son compatibles con una OBSTRUCCIÓN VASCULAR FETAL.\r\n\r\n\r\n', ' Placenta del tercer trimestre (417 gms.):\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n\r\n', '', ''),
	(514, 'Q2104-2040', 'Q', '52267953', 'JIOVANNA CANTILLO CANTILLO', '3135485867', 'F', '47', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de endocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y aspecto membranoso que mide 0.8 x 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos sueltos de epitelio escamoso con cambios citopáticos por VPH.\r\n\r\n\r\n', ' Biopsia de endocervix:\r\n-LESION INTRAEPITELIAL ESCAMOSA DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(515, 'Q2104-2041', 'Q', '1066732523', 'YOLAIMA CABALLERO ALVAREZ', '0000', 'F', '32', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica, focos de metaplasia escamosa y cambios citopáticos por VPH.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH).\r\n\r\n\r\n\r\n', '', ''),
	(516, 'Q2104-2042', 'Q', '33357614', 'TERESA DEL CARMEN VILLA PINO', '3234584042', 'F', '38', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA.\r\n\r\n\r\n\r\n ', '', ''),
	(517, 'Q2104-2043', 'Q', '1050966815', 'JESUS DAVID MARIMON BELTRAN', '000', 'M', '25', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor RODOLFO VALENCIA', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apénidce" se recibe un apéndice cecal que mide 8  x 0.9 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA.\r\n\r\n\r\n\r\n', '', ''),
	(518, 'Q2104-2044', 'Q', '34053499', 'MARTHA LUCIA VILLEGAS GOMEZ', '000', 'F', '62', 'CLIN. SAN JOSE DE TORICES SAS', 'PARTICULAR', '898201', '30215', 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa antrocorporal cuya lámina propia está edematosa congestiva e infiltrada por linfocitos y células plasmáticas. Hay focos de metaplasia intestinal completa. No se observa H.Pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA CON FOCOS DE METAPLASIA INTESTINAL COMPLETA.\r\n\r\n\r\n\r\n', '', ''),
	(519, 'Q2104-2045', 'Q', '1127579078', 'NAHOMI KATHERINE GOMEZ MARTINEZ', '3002040580', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Tumor del lóbulo de oreja derecha" dos masas de tejido de forma irregular de color pardo grisáceo y consistencia elástica que miden 1.5 x 1.2 x 1 y 1.1 x 0.7 x 0.5 cms. La superficie externa esta cubierta por piel casi en su totalidad y al corte se observa una superficie de color pardo claro y aspecto arremolinado. Se toman sendos cortes y se rotulan A.\r\n2. "Tumor mama derecha" masa de tejido forma irregular de color pardo rosado y consistencia elástica que mide 10 x 6.5 x 6 cms. en sus mayores dimensiones, la superficie externa es multilobulada. Al corte se observa una superficie de color pardo claro y aspecto multinodualr. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran piel en cuya dermis se destacan bandas gruesas de colágeno dispuestas irregularmente.\r\nLos cortes rotulados B muestran un tumor benigno compuesto por la proliferación combinada de elementos glandulares y estromales.\r\n\r\n', '1-Resección de masas en lobulo de oreja derecha:\r\n-QUELOIDES (2)\r\n2-Resección de masa en mama derecha:\r\n-FIBROADENOMA JUVENIL.\r\n\r\n\r\n', '', ''),
	(520, 'Q2104-2046', 'Q', '104851309', 'RAFAEL DE JESUS JURADO CUETO', '000', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARIA CLAUDIA BURGOS', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que en conjunto hacen un volumen de 2 ml.  Al corte se observa una superficie homogenea de color pardo claro. Se toma parte.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA).\r\n\r\n\r\n\r\n\r\n', '', ''),
	(521, 'Q2104-2047', 'Q', '1093302499', 'JUAN TOMAS VARGAS RUIZ', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.7 x 0.8 cms. La superfiice externa esta cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n', '', ''),
	(522, 'Q2104-2048', 'Q', '1047472005', 'ANTHONY PEREZ TORO', '0000', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE PRETELT MENDOZA', NULL, '2021-04-23', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de piel pabellon auricular izquierdo" se reciben dos fragmentos de tejido de forma irregular de color pardo grisáceo y consistencia elástica que miden 0.5 y 0.2 cms. en sus mayores dimensiones, la superficie es irregular de aspecto micropapilar. Se toma todo.\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis.\r\n\r\n\r\n', ' Resección de lesión en pabellon auricular izquierdo:\r\n-COMPATIBLE CON NEVUS EPIDERMICO.\r\n\r\n', '', 'Se recomienda correlación clinico-patológica.\r\n\r\nSe modifica los apellidos del paciente y la localización de la lesión por corrección enviada desde el HOSPITAL INFANTIL NAPOLEON FRANCO PAREJA.\r\n\r\n'),
	(523, 'Q2104-2049', 'Q', '1031142801', 'NARCILA CASTRO BELLO', '000', 'F', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora ADRIANA LOPEZ CELEDON', NULL, '2021-04-19', '2021-04-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Ganglio inguinal derecho" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.4 x 0.8 x 0.8 cms. Al corte se observa una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático con cambios hiperplásicos difusos. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Resección de ganglio inguinal derecho:\r\n-HIPERPLASIA REACTIVA DIFUSA.', '', ''),
	(524, 'Q2104-2050', 'Q', '1047394074', 'DEYMER PEÑA BASTIDAS', '3006751426', 'M', '34', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', '', NULL, '2021-04-26', '2021-04-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan esófago constituido por epitelio escamoso hiperplasico que muestra hipercelularidad, perdida de la polaridad e infiltración por eosinófilos en número de 15 por campo de gran poder.\r\nLos cortes B revelan antro gástrico que muestra lámina propia, edematosa, congestiva e infiltración mononuclear leve, eosinófilos 7 por campo de gran poder. No se observa H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.ESOFAGITIS CRÓNICA CON DISPLASIA LEVE DEL EPITELIO ESCAMOSO E INFILTRACIÓN POR EOSINÓFILOS\r\n2.GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n\r\nNOTA: Los hallazgos el epitelio esofagico amerita una reevaluación del cuadro clinico.\r\n', '', ''),
	(525, 'Q2104-2051', 'Q', '45453311', 'MONICA ELENA VISBAL DEL REAL', '3012163312', 'F', '58', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(526, 'Q2104-2052', 'Q', '1082957145', 'ARMANDO DAVID FAJARDO NAVARRO', '3122141494', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de foliculo linfoide, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(527, 'Q2104-2053', 'Q', '1052982535', 'LAIRA DEL VALLE MACHADO GONZALEZ', '3135539776', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-26', '2021-04-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A muestran mucosa de antro y cuerpo gastrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B revelan duodeno que muestra lámina propia edematosa, congestiva infiltrado mononuclear leve con formación de un foliculo linfoide y algunos eosinófilos.\r\n\r\n\r\n\r\n\r\n\r\n', '1.Bipsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n2.Bipsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA\r\n', '', ''),
	(528, 'Q2104-2054', 'Q', '1143391228', 'CAMILO JOSE RIVERA NAVARRO', '300563362', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Adenoides" varios fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro de 2 cms. Se toma todo y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 3 x 1.5 x 0.5 cms. de forma ovoide de color amarillento. Al corte una superficie multinodular. Se toman cortes y se rotula B.\r\n3. "Amígdala izquierda" una amígdala palatina que mide 3 x 1.5 x 0.5 cms. de forma ovoide de color amarillento. Al corte una superficie multinodular. Se toman cortes y se rotula C.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A revelan Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide\r\nLos cortes de B y C revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.HIPERPLASIA ADENOIDEA\r\n2.AMIGDALITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(529, 'Q2104-2055', 'Q', '1047411932', 'JEIBER JOSE DE AVILA DE AVILA', '3115836219', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa, opaca de color pardo grisáceo que trae adherido material fibrinopurulento. Al corte la luz esta dilatada y hay salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal cuya mucosa se encuentra ulcerada, la pared infiltrada por gran cantidad de PMN neutrófilos.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(530, 'Q2104-2056', 'Q', '1235047631', 'EIMY DANIELA BARRIOS HERRERA', '3104603430', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-04-26', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Verruga filiforme - parpado superior izquierdo" se recibe un fragmento de tejido de forma irregular de color grisáceo que mide 0.5 cms. su superficie es cupuliforme de consistencia elástica de color pardo grisáceo. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel con marcada hiperqueratosis, paraqueratosis y papilomatosis. No se observa dermis.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en parpado superior izquierdo:\r\n-PAPILOMA ESCAMOSO\r\n\r\n\r\n', '', ''),
	(531, 'Q2104-2057', 'Q', '1128049860', 'MELANIE ANDREA FLOREZ SALGADO', '3015774011', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-04-26', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Nevo displasico" se recibe un punch de piel que mide 0.5 cms. de color pardo grisáceo y consistencia elástica. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel con hiperqueratosis, acantosis irregular con elongación de clavos interpapilares, se observa además, en el dermis papilar vasos marcadamente dilatados cuya pared esta parcialmente constituido por epitelio escamoso.\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesión en piel de cara intrena del muslo izquierdo:\r\n-ANGIOQUERATOMA CIRCUNSCRITO\r\n\r\n\r\n', '', ''),
	(532, 'Q2104-2058', 'Q', '1143367964', 'BAYRON JOSE PANTOJA RODRIGUEZ', '3105262130', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.5 cms. tapizada por una serosa opaca despulida de color pardo oscuro bien vascularizada. Al corte salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apendice cecal:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(533, 'Q2104-2059', 'Q', '33333169', 'MARIA EUGENIA ALCAZAR PALACIOS', '3203125133', 'F', '43', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-26', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Cuello uterino con infiltración mononuclear del estroma. No hay cambios de LIE en la muestra enviada. \r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA\r\n\r\n', '', ''),
	(534, 'Q2104-2060', 'Q', '23106523', 'BISMARY URRUTIA LEON', '3206767733', 'F', '50', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-04-26', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor en nuca" se recibe una masa irregular de tejido que mide 5 x 3 cms. de color blanco amarillento de consistencia elástica, tapizada parcialmente por una elipse de piel que mide 4 cms. Al corte se ve una formación nodular de color amarillento que mide 3 x 2 x 1.5 cms. Se toman cortes así: A formación nodular, B bordes profundos, C margen derecho, D margen superior.\r\n\r\n\r\n\r\n', 'Lesión tumoral benigna constituida por haces gruesas de colágeno que alternan con focos de tejido adiposo maduro, se observa además, acumulos de tejido linfoide con centros germinales.\r\n\r\n\r\n\r\n', ' Resección de lesión en nuca:\r\n-COMPATIBLE CON FIBROMA DE TIPO NUCAL\r\n\r\n\r\n', '', ''),
	(535, 'Q2104-2061', 'Q', '23002779', 'AYDA PATRICIA QUINTANA PEREZ', '000', 'F', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor RAFAEL DIAZ', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Trompa de Falopio izquierda" se reciben múltiples fragmentos de tejido de color pardo oscuro consistencia friable el mayor de los cuales mide 7 x 0.5 cms. de forma tubular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan abundantes coágulos sanguineos y vellosidades coriales. En otros cortes se observa fragmentos de trompa de Falopio edematosa y congestión.\r\n\r\n\r\n\r\n', '-EMBARAZO ECTOPICO, trompa izquierda (fragmentos)\r\n\r\n\r\n\r\n', '', ''),
	(536, 'Q2104-2062', 'Q', '45497433', 'EDELMIRA PACHECO CARDENAS', '3136174590', 'F', '50', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de cervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica el mayor de los cuales mide 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan cervix tapizado por epitelio escamoso en el que se observa una lesión intraepitelial escamosa de bajo grado.\r\n\r\n\r\n\r\n', ' Biopsia de cervix.\r\n-LIE DE BAJO GRADO (NIC I)\r\n\r\n\r\n\r\n', '', ''),
	(537, 'Q2104-2063', 'Q', '006435', 'PATRICIA RAMIREZ', '3153002648', 'F', '50', 'PARTICULAR', '', '898201', '30215', 'Doctor ORLANDO BORRE ARRIETA', NULL, '2021-04-21', '2021-04-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe una lesión polipoide que mide 0.6 x 0.5 cms. de color pardo claro y consistencia elástica. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por  epitelio escamoso maduro que rodea un núcleo de tejido fibroconectivo moderadamente vascularizado.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-PÓLIPO FIBROEPITELIAL\r\n\r\n\r\n\r\n', '', ''),
	(538, 'Q2104-2064', 'Q', '22492193', 'YELIXSA DEL CARMEN TOLOZA DIAZ', '3006881602', 'F', '42', 'ORG. CLINICA GENERAL DEL NORTE', '', '', '', 'Doctor HAROLD LEDESMA CANO', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero + ovarios + trompas" se recibe un utero con sus anexos que pesa 157 gms. y mide 9 x 5.5 x 4 cms. en sus mayores dimensiones. El cervix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta cubierto por una serosa marcadamente irregular, con adherencias fibrosas y presencia de masas subserosas. Las trompas son irregulares. El ovario derecho mide 2.5 cms. y en el lugar del izquierdo se encuentra una estructura fibrosa irregular. Al corte el canal endocervical es permeable, la cavidad endometrial contiene una estructura polipoide que se implanta en el fondo que mide 3 x 1 x 1 cms. en sus mayores dimensiones. En el miometrio se encuentran múltiples nodulos de localización principalmente subserosa promedian un diámetro de 2 cms. El ovario derecho presenta varias cavidades quisticas que contienen un material de aspecto mucoso y un diámetro de 1 cm. Del lado izquierdo no se identifica ovario si no un tejido de aspecto membranoso. Se toman cortes.\r\n\r\n', 'El cervix presenta una reacción inflamatoria crónica y múltiples glandulas endocervicales quísticas. El endoemtrio es secretor. La masa polipoide está compuesta por glándulas endometriales irregulares en forma y tamaño, tapizadas por epitelio cilíndrico seudoestratificado, que reposan en un estroma fibroso. Las masas miometriales estan compeustas por fibras musculares lisas dispuestas irregularmente. La trompa derecha es normal. el ovario muestra folículos quisticos.\r\n\r\n\r\n', ' Utero y anexo derecho (157 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO SECRETOR\r\n-POLIPO ENDOMETRIAL HIPERPLÁSICO\r\n-LEIOMIOMAS INTRAMURALES Y SUBSEROSOS\r\n-TROMPA DE FALOPIO DERECHA\r\n-OVARIO DERECHO CON FOLÍCULOS QUÍSTICOS', '', ''),
	(539, 'Q2104-2065', 'Q', '52403227', 'HERICA DEL CARMEN CERDA BERRIO', '000', 'F', '47', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Polipo" se recibe un fragmento de tejido de aspecto polipoide de color pardo claro y consistencia elástica ue mide 1 x 0.7 x 0.3 cms. Al corte se encuentra una superficie de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular. El epitelio superficial ha sido reemplazado por epitelio escamoso metaplásico.\r\n\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL\r\n\r\n\r\n\r\n', '', ''),
	(540, 'Q2104-2066', 'Q', '1143393077', 'JANY CUELLO NAVARRO', '3013208323', 'F', '24', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de tejido de color pardo claro y consistenica elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran cuello uterino con infiltración mononuclear del estroma y focos de metaplasia escamosa.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA\r\n\r\n\r\n\r\n', '', ''),
	(541, 'Q2104-2067', 'Q', '1064984372', 'MARIANA DEL CARMEN DIAZ NUÑO', '3226100459', 'F', '35', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color grisáceo y consistencia elástica que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso maduro que rodea un núcleo de tejido fibroconectivo.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en vulva:\r\n-PÓLIPO FIBROEPITELIAL (ACROCORDON)\r\n\r\n\r\n\r\n', '', ''),
	(542, 'Q2104-2068', 'Q', '1043325631', 'JOEL JOSE HERRERA RUIZ', '3117863180', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-04-26', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estenosis subglotica" se reciben varios fragmentos de tejido de forma irregular, color blanquecino y consistencia firme cuyos diámetros oscilan entre 0.5 y 1.5 cms. La superficie externa es irregular y al corte presentan un aspecto cartilaginoso en algunas áreas los fragmentos tienen un fragmento oseo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los fragmentos descritos estan compuestos por cartílago hialino parcialmente osificado, rodeado de tejido fibroso que contiene múltiples glandulas mucosas. No hay cambios inflamatorios ni neoplásicos.\r\n\r\n\r\n\r\n', ' Fragmentos de zona estenótica subglótica:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(543, 'Q2104-2069', 'Q', '1016955408', 'NICOLAS ALEXANDER FLOREZ GUTIÉRREZ', '38363380508', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1.5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo grisáceo. Al corte se encuentra una luz dilatada que contiene un material fecal endurecido (fecalito). Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(544, 'Q2104-2070', 'Q', '73080958', 'AMADO CASTRO SIERRA', '000', 'M', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor JOSE RODRIGUEZ ', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor de pared toracica" se reciben dos fragmentos de tejido de forma irregular de color pardo amarillento y consistencia elástica que miden respectivamente 1.6 y 1.4 cms. Al corte se encuentra una superficie irregular de color pardo claro con áreas de color pardo oscuro.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno epitelial, compuesto por células grandes, pleomórficas de nucleos grandes, vacuolados, con nucleolo prominente y mitosis anormales tienen citoplasma acidofílico y se disponen en un patrón sólido.\r\n\r\n\r\n\r\n', ' Biopsia de tumor en pared torácica:\r\n-CARCINOMA INDIFERENCIADO\r\n\r\n\r\n\r\n', '', 'Los hallazgos son compatibles con un primario en pulmón.\r\n\r\n'),
	(545, 'Q2104-2071', 'Q', '45368126', 'EGLETH MARTINEZ BARRIOS', '3002078833', 'F', '49', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cono cervical" un cono cervical que mide 3 x 3.5 x 1.5 cms. Trae un reparo que identifica el labio anterior, se lámina el labio anterior y se rotula A, se lamina el labio posterior y se rotulan B.\r\n2. Un segundo recipiente, rotulado "Legrado cervical" contiene munúsculos fragmentos de un material de aspecto mucoide que hacen un volumen aproximado de 0.3 ml. Se toma todo y se rotulan C.\r\n3. Un tercer recipiente, rotulado "Pólipo de vulva" una estructura de aspecto polipoide que mide 4 x 2.5 x 0.8 cms. esta cubierta por un nucleo de color rojizo rodeado por piel. Se toman cortes y se rotulan D.\r\n\r\n\r\n', 'En 5 cortes de los múltiples cortes de labio anterior (A) se encuentra en la unión escamocolumnar una LIE de alto grado (NIC 3) que se extiende hasta las glandulas endocervicales. No se identifica infiltración. La línea de resección exocervical y endocervical están libres de lesión.\r\nEn 3 de los cortes rotulados B se encuentra una lesión similar. No hay compromiso de los márgenes de resección exocervical y endocervical.\r\nLos cortes C muestran un material mucoide.\r\nLos cortes rotulados D muestran una lesión recubierta por piel que rodea un nucleo de tejido fibrovascular.\r\n', '1.Conización cervical:\r\n-LIE DE ALTO GRADO (NIC 3) CON EXTENSIÓN GLANDULAR, labio anterior\r\n-LIE DE ALTO GRADO (NIC 3) CON EXTENSIÓN GLANDULAR, labio posterior\r\n-LÍNEAS DE RESECCIÓN EXOCERVICAL Y ENDOCERVICAL LIBRES DE LESIÓN\r\n2.Legrado endocervical:\r\n-MATERIAL MUCOIDE\r\n3.Resección de lesión en vulva:\r\n-PÓLIPO FIBROEPITELIAL (ACROCORDON)', '', ''),
	(546, 'Q2104-2072', 'Q', '26189594', 'NERYS DEL SOCORRO LAGARES AYALA', '000', 'F', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor CRISTOBAL MASSA ACOSTA', NULL, '2021-04-26', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Hueso de femur izquierdo" se recibe un fragmento de hueso ligeramente aplanbado que mide 2 x 1 x 0.2 cms. en sus mayores dimensiones. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'El espécimen esta constituido casi en su totalidad por hueso compacto. No hay cambios inflamatorios ni neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de femur en región de fractura diafisiaria:\r\n-FRAGMENTO DE HUESO COMPACTO\r\n\r\n', '', ''),
	(547, 'Q2104-2073', 'Q', '45496202', 'YENIS DEL CARMEN ESCOBAR MARTELO', '000', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa de región dorsal" se recibe un fragmento de tejido de forma irregular que mide 0.8 cms. en sus mayores dimensiones es de color pardo oscuro y consistencia friable. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'El especimen está constituido por fragmentos de epitelio escamoso y de queratina laminar.\r\nLos hallazgos son compatibles con un QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE fragmentado.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región dorsal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(548, 'Q2104-2074', 'Q', '1048436777', 'ELIAN RAMON SANDON ARDILA', '000', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FERNANDO ENRIQUE CABRERA CARDOZO', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor de tejidos blandos en pie derecho" se recibe una masa de tejido de forma irregular de color amarillo y consistencia blanda que mide 2.5 x 2 x 1.5 cms. La superficie externa es irregular y al corte se encuentra una superficie de color amarillo, multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión benigna compuesta por extensiones de células mononucleares que alternan con células xantomatosas y numerosas células gigantes multinucleadas. Contiene, además, haces de tejido fibroso colagenizado.\r\n\r\n\r\n\r\n', ' Resección de tumor en tercer artejo derecho:\r\n-TUMOR DE CÉLULAS GIGANTES DE LAS VAINAS TENDINOSAS\r\n\r\n\r\n', '', ''),
	(549, 'Q2104-2075', 'Q', '1201225275', 'LUIS SANTIAGO ANAYA ALVAREZ', '3004176225', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-04-23', '2021-04-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben cuatro fragmentos de tejido de color pardo claro y consistencia blanda que promedian un diámetro mayor de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n\r\n', '', ''),
	(550, 'Q2104-2076', 'Q', '1142916217', 'MARIA CAMILA BARRIOS VASQUEZ', '3004101723', 'F', '14', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-04-26', '2021-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo y se rotualn A.\r\n2. "Cuerpo" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Duodeno" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.2 cms. Se toma todo y se rotulan D.\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan mucosa oxíntica sin cambios.\r\nLos cortes C revelan mucosa duodenal que muestra la estructura usual.\r\nLos cortes D revelan mucosa duodenal cuya lámina propia es ligeramente edematosa y esta infiltrada por linfocitos, plasmocitos en moderada cantidad. No se observó parasitos, granulomas ni cambios epiteliales en la muestra.\r\n\r\n\r\n', '1.Biopsia endoscópica de antro:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de cuerpo:\r\n-MUCOSA OXÍNTICA SIN CAMBIOS\r\n3.Biopsia endoscópica de duodenal (bulbo):\r\n-MUCOSA DUODENAL (BULBO) SIN ALTERACIONES\r\n4.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA MODERADA', '', ''),
	(551, 'Q2104-2077', 'Q', '1104270760', 'MATHIAS DAVID PEREZ CAMARGO', '3205759310', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-04-26', '2021-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es opaca. Al corte la luz ocupada por material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal que muestra una mucosa intacta, los foliculos linfoides son hiperplasicos. No hay infiltrado inflamatorio en la muscular, la serosa edematosa y congestiva con un infiltrado leve mononuclear.\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA FOLICULAR\r\n\r\n\r\n\r\n', '', ''),
	(552, 'Q2104-2078', 'Q', '1049945773', 'LUIS BAYRON BLANCO DIAZ', '3218512201', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-05-05', '2021-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Segmento ganglionar de colon donde la sutura violeta marca el extremo proximal" un segmento de colon que mide 1 cm. en uno de sus extremos esta marcado con una seda violeta, la serosa es blanquecina. Se toman cortes del extremo marcado con seda (extremo proximal cefalico), se rotula A, extremo distal se rotula B, segmento de colon se rotula C.\r\n2. "Boca de colostomía" un fragmento de tejido de color blanquecino que mide 2 cms. de forma alargada. Se toman cortes y se rotulan D.\r\n\r\n\r\n', 'Los múltiples cortes rotulados A (extremo proximal) muestra pared de intestino grueso en la que no se identifican células ganglionares en relación con los plexos nerviosos.\r\nEn los cortes B hay presencia de escasas células ganglionares morfologicamente anormales en el plejo mienterico, hay hipertrofia de filetes nerviosos.\r\nLos cortes C muestran escasas células ganglionares morfologicamente anormales, se observa además, hipertrofia de filetes nerviosos con un componente inflamatorio crónico mediado por linfocitos alrededor de dichos filetes nerviosos.\r\n\r\n', '1.Segmento de colon 1 cms.:\r\n-COMPATIBLE CON AGANGLIONOSIS (ENFERMEDAD DE HIRSCHSPRUNG)\r\n2.BOCA DE COLOSTOMÍA', '', ''),
	(553, 'Q2104-2079', 'Q', '1001978561', 'MANUEL ANTONIO BARRAZA AHUMADA', '3008358640', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS ALBERTO BALLESTAS ALMARIO', NULL, '2021-04-26', '2021-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Varicocele" se reciben tres fragmentos de tejido, de forma cilíndrica el mayor mide 1.3 cms. Al corte se observa la presencia de pequeños vasos. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan vasos venosos dilatados, tortuosos y congestivos.\r\n\r\n\r\n\r\n', '-VARICOCELE, izquierdo\r\n\r\n\r\n', '', ''),
	(554, 'Q2104-2080', 'Q', '1002391810', 'SANDRA MILENA BARRIOS VEGA', '000', 'F', '33', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-04-26', '2021-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 cms. la serosa es de color oscuro opaca y despulida. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(555, 'Q2104-2081', 'Q', '1044941397', 'ALAN SMIT ROCHA MENDOZA', '000', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-03', '2021-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Ileon y colon perforado" se recibe el producto de una resección de ileo colica, el segmento de ileo mide 6 cms. la serosa es de color violáceo y en una de sus caras presenta un área de perforación de 1 cm. El apéndice cecal mide 7 cms. la serosa es de color oscuro. El segmento de colon mide 11 cms. por separado segmento de intestino de 2 cms. Al corte del ileon se observa un área de perforación compromete el espesor de la pared. Se toman cortes y se rotulan A.\r\nEl ciego de color oscuro y aspecto hemorrágico, la mucosa es oscura, la valvula ileocecal es permeable, se toman cortes y se rotulan B. El segmento de colon la mucosa es de aspecto edematoso y los pliegues de distribución usual. Se toman cortes y se rotulan C, D apéndice cecal. Se toman cortes del segemnto de colon, recibido por separado, la pared es edematosa y se rotulan E.\r\n\r\n', 'Los cortes A revelan pared de ileon con áreas de necrosis, edema inflamación aguda y congestión vascular. Los cortes de colon y ciego muestran pared colónica con edema, congestión vascular e inflamación aguda. El segmento de colon recibido por separado muestra edema y congestión vascular. El apéndice cecal muestra periapendicitis aguda, los bordes de resección son viables.\r\n\r\n\r\n', '1. Segmento de ileon con:\r\n-INFLAMACIÓN AGUDA, NECROSIS Y PERFORACIÓN\r\n2.Segmento de colon derecho con:\r\n-INFLAMACIÓN AGUDA Y EDEMA\r\n3.Apéndice cecal con:\r\n-PERIAPENDICITIS AGUDA\r\n4.Segmento de colon recibido por separado, con:\r\n-EDEMA Y CONGESTIÓN VASCULAR\r\n5.BORDES DE RESECCIÓN VIABLES\r\n', '', ''),
	(556, 'Q2104-2082', 'Q', '1143331048', 'SERGIO DE JESUS LEOTTAU SANMIGUEL', '3145443002', 'M', '32', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-28', '2021-04-27', 'VIRNA CARABALLO OSORIO', 'Rotulao "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n\r\n', '', ''),
	(557, 'Q2104-2083', 'Q', '1047485747', 'DANIEL AUGUSTO MONTARIENN RINCON VELEZ', '3137434265', 'M', '22', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-04-28', '2021-04-27', 'VIRNA CARABALLO OSORIO', 'Rotulao "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n', '', ''),
	(558, 'Q2104-2084', 'Q', '106786691', 'NATALIA ANDREA GARCIA CUETO', '3244710631', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-04-28', '2021-04-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(559, 'Q2104-2085', 'Q', '1148449271', 'YEISLER ALEJANDRO CAMPO DIAZ', '3216137264', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-04-28', '2021-04-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apendice preauricular derecho" se recibe una estructura polipoide de color pardo claro y consistencia elástica que mide 2.2 x 0.7 cms. La superficie externa esta cubierta por piel casi en su totalidad y al corte se observa una superficie amarillento que rodea un área de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por piel que rodea un núcleo de tejido adiposo y cartilaginoso.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en región preauricular derecha:\r\n-APENDICE PREAURICULAR\r\n\r\n\r\n', '', ''),
	(560, 'Q2104-2086', 'Q', '1007975496', 'JENNIFER PAOLA GARCIA DIAZ', '3135390469', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE PRETELT MENDOZA', NULL, '2021-04-30', '2021-04-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de piel" se recibe un fragmento de piel de forma irregular, color pardo claro y consistencia elástica que mide 1.2 x 0.7 cms. en la superficie externa se observa una lesión sobreelevada de aspecto verrucoso que mide 1 x 0.7 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis está engrosada a expensas de una proliferación de celulas pequeñas, basaloides, que reodean espacios seudoquísticos que contienen queratina laminar.\r\n\r\n\r\n', ' Biopsia de lesión en piel de la espalda:\r\n-QUERATOSIS SEBORREICA.\r\n\r\n\r\n', '', ''),
	(561, 'Q2104-2087', 'Q', '45747973', 'IVONIS DEL CARMEN GAMARRA HUETO', '000', 'F', '38', 'CLIN. SAN JOSE DE TORICES SAS', 'FAMISANAR', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-04-28', '2021-04-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se ercibe una vesícula biliar que mide 6.2 x 2.5 cms. La superficie externa esta parcialmente cubierta por una serosa despulida. Al corte la pared esta engrosada, la mucosa ha perdido su aspecto aterciopelado y hay salida de un material de color pardo amarillento grumoso (barro biliar). Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n\r\n', '', ''),
	(562, 'Q2104-2088', 'Q', '33104144', 'NAZLY ESTHER ALVEAR PEREA', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO', NULL, '2021-04-28', '2021-04-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Histerectomía ubtotal - utero + trompa" se recibe un cuerpo uterino que pesa 1235 gms. y mide 17.7 x 13.2 x 10.5 cms. La superficie externa esta paricalmente cubierta por una serosa lisa y brillante. El cuerpo uterino se encuentra marcadamente aumentado de tamaño. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa gruesa de color rosado, el miometrio esta ocupado por múltiples masas de color pardo claro de aspecto arremolinado, la mayor mide 8.5 cms. de diámetro y la menor de unos pocos milimetros de localización submucosa, intramural y subserosa. Una de las masas es de color pardo amarillento y consistencia petrea y al corte tiene áreas de licuefacción mide 5.5 cms. de diámetro. En uno de los extremos se identifica una trompa de Falopio que mice 5.5 cms. La superficie externa esta cubierta por una serosa lisa y brillante y al corte conserva la morfología habitual. Se toman cortes.\r\n\r\n\r\n\r\n', 'El endometrio está autólisado. Las masas miometrailes descritas estan compuestas por fibras musculares lisas distribuidas irregularmente. La trompa de Falopio conserva la morfología habitual.\r\n\r\n\r\n\r\n', ' Histerectomía abdominal subtotal con salpingectomía derecha:\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-TROMPA DE FALOPIO', '', ''),
	(563, 'Q2104-2089', 'Q', '45469967', 'NELSY BATISTA MARTINEZ', '3128461774', 'F', '57', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia es congestiva e infiltrado mononuclear moderado con agregados linfoides, actividad moderada. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE', '', ''),
	(564, 'Q2104-2090', 'Q', '45440047', 'LUZ MARINA RAMIREZ ACOSTA', '3137052215', 'F', '60', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un punch de piel de color pardo claro que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Vulva que muestra hiperqueratosis, papilomatosis, atipias coilociticas, el estroma infiltrado por linfocitos y células plasmaticas.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA ACUMINADO\r\n\r\n', '', ''),
	(565, 'Q2104-2091', 'Q', '1201259409', 'GABRIEL JOSUE VEGA HERMOCILLA', '3207990106', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" una amigdala palatina que mide 3 x 1.5 x 1 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan A.\r\n2. "Amigdala izquierda" una amigdala palatina que mide 3.5 x 2 x 1 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan B.\r\n3. "Adenoides" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 2 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(567, 'Q2104-2092', 'Q', '72233962', 'NELSON ENRIQUE PAREJO RUIZ', '30531111324', 'M', '51', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 3 x 2 cms. tapizada parcialmente por una serosa de color pardo claro. Al corte hay salida de abundante material biliar y la presencia de un calculo translúcido de 1 cm. La pared es delgada y la mucosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS\r\n\r\n\r\n', '', ''),
	(568, 'Q2104-2093', 'Q', '1143345746', 'VICTOR ALFONSO CANALES ZAMBRANO', '3007007435', 'M', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. tapizada por una serosa de color pardo grisáceo y opaca. Al corte salida de un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA', '', ''),
	(569, 'Q2104-2094', 'Q', '45578297', 'LUDYS VILLEGAS TORRES', '000', 'F', '54', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor SABAS GUZMAN', NULL, '2021-05-10', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se reciben varios fragmentos de tejido de color blanquecino y consistencia dura que juntos hacen un volumen de 1 ml. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido oseo en el que se observa una proliferación de tejido fibroso intertrabecular, en algunas áreas este tejido fibroso muestra un discreto infiltrado de linfocitos. Las espículas oseas son viables sin actividad osteoblastica.\r\nNo se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en alveolo dental:\r\n-FIBROSIS INTERTRABECULAR\r\n (VER DESCRIPCIÓN MICROSCÓPICA)\r\n\r\n\r\n\r\nNOTA: Se discutio en junta de patologos con participación de los doctor José Caraballo y Ana Magola Manga.', '', ''),
	(570, 'Q2104-2095', 'Q', '45446183', 'ALBA LUZ GOMEZ PEÑARANDA', '000', 'F', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesicula biliar que mide 6 x 3 cms. previamente abierta de color pardo grisáceo, la pared se encuentra engrosada. Al corte hay salida de calculos pequeños de color negruzco, la pared esta engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS', '', ''),
	(571, 'Q2104-2096', 'Q', '1201245668', 'CARLOS ELIAS RAMOS ARENAS', '000', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotualdo "Apéndice" se recibe un apéndice cecal tapizada por una serosa de color grisáceo, opaca la punta se encuentra dilatada y mide 5 x 2.5 cms. Al corte hay salisa de un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apendice cecal cuya mucosa se encuentra ulcerada, la pared congestiva, edematosa e infiltrada por gran cantidad de PMN neutrófilos que se extienden hasta la serosa.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITISA AGUDA NECRÓTIZANTE\r\n\r\n\r\n', '', ''),
	(572, 'Q2104-2097', 'Q', '1043651110', 'KEILA MARIA TERAN CORDOBA', '3115247449', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice + plastron apendicular" se recibe un apéndice cecal que mide 10 x 1 cms. tapizada por una serosa opaca, de color pardo oscuro que tiene adherido material fibrinopurulento. Al corte salida de un material fecaloide. Acompañado a esto, se recibe un segmento de meso que mide 24 cms. de color amarillento y aspecto adiposo. S etoman cortes.\r\n\r\n\r\n\r\n', 'Los cortes de A revelan apendice cecal cuya mucosa se encuentra ulcerada, la pared congestiva, edematosa e infiltrada por gran cantidad de PMN neutrófilos que se extiende hasta la grasa periapendicular.\r\nLos cortes de B revelan meso que muestrta congestión e inflamción aguda.\r\n\r\n\r\n', ' Apendicectomía:\r\n1.APÉNDICITIS AGUDA\r\n2.SEGMENTO DE MESO CON INFLAMACIÓN AGUDA\r\n\r\n\r\n', '', ''),
	(573, 'Q2104-2098', 'Q', '1142920611', 'ANGELICA BERRIPO GARCIA', '3002560548', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1c ms. tapizada por una serosa opaca de color pardo claro bien vascularizada. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(574, 'Q2104-2099', 'Q', '1001904664', 'MARIANA MEJIA BARRIOS', '000', 'F', '19', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 8 x 2.5 x 2 cms. tapizada paricalmente por una serosa de color aprdo grisáceo. Al corte hay salida de un material biliar, la pared se encuentra discretamente engrosada y la mucosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía.\r\n-COLECISTITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(575, 'Q2104-2100', 'Q', '73168018', 'ALFONSO DE AGUAS YANCES', '000', 'M', '46', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor RODOLFO VALENCIA ARTEAGA', NULL, '2021-05-10', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Intestino delgado" se recibe sin reparo, dos segmentos de intestino el primero mide 20 cms. tapizado por una serosa opaca de color pardo claro presenta a 2 cms. de uno de los bordes de resección una solución de continuidad de 3 cms. y a 6 cms. de la misma presneta otra solución de continuidad que mide 2 cms. y a 2 cms. del otro borde presenta otra solución de continuidad de 1 cm. Al corte la mucosa es edematosa. Se toman cortes de los bordes proximos a la solución de continuidad y se rotulan A, B solución de continuidad.\r\nEl segundo mide 15 cms. y en uno de sus bordes presenta un tejido necrótico de color pardo oscuro que mide 4 x 3 cms. Se toman cortes y se rotulan C, a 7 cms. del borde de resección se observa otra perforación de 2 cms. Se toman cortes y se rotulan D.\r\n\r\n\r\n', 'Los cortes revelan intestino delgado que muestra necrosis hemorrágica de la pared e inflamación aguda. Los bordes del primer segmento congestivo, edematoso.\r\nEl segundo segmento presenta áreas de necrosis hemorrágica e inflamación aguda. Bordes congestivos.\r\n\r\n\r\n', '1.Segmento de intestino delgado con:\r\n-NECROSIS HEMORRÁGICA E INFLAMACIÓN AGUDA Y PERFORACIONES MULTIPLES (5)\r\n2.BORDES CON EDEMA Y CONGESTIÓN\r\n\r\n', '', ''),
	(576, 'Q2104-2101', 'Q', '9266174', 'RAMON PEDROZA VILLAFAÑE', '000', 'M', '55', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula biliar" se recibe una vesícula biliar fragmentada el fragmento mayor mide 5 x 2 cms. y el menor (cuello) mide 2.5 x 1.5 cms. Al corte hay salida de unos calculos de color amairllento, la aperd esta engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA \r\n-COLELITIASIS', '', ''),
	(577, 'Q2104-2102', 'Q', '1047367493', 'YULIBETH CORREA JULIO', '3013332864', 'F', '35', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Embarazo ectopico" se recibe una trompa de Falopio dilatada y agrandada que mide 10 x 6 x 5 cms. tapizada por una serosa de color pardo claro bien vascularizada. Al corte hay salida de abundante liquido y l apresencia de un feto que mide 8 cms. La pared esta bien vascularizada y presenta un material de aspecto esponjoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Trompa de Falopio cuya luz se encuentra dilatada y ocupada por un embrion, la pared infiltrada por vellosidades coriales.\r\n\r\n\r\n\r\n', '-EMBARAZO TUBARICO IZQUIERDO\r\n\r\n\r\n', '', ''),
	(578, 'Q2104-2103', 'Q', 'VEN32840587', 'ANDREA MARIA HERNANDEZ MARCHAN', '000', 'F', '12', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. a 2 cms. de la punta presenta una formación de 1 cm. tapizada por una serosa opaca, de color pardo grisáceo tra ahderido material fibrinopurulento. Acompañado a esto, se reciben dos fragmentos de tejido de meso que miden 15 y 10 cms. respectivamente de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan apendice cecal cuya mucosa se encuentra ulcerada, la pared infiltrada por gran cantidad de PMN enutrófilos que se encuentran hasta la grasa periapendicular, además, se observan áreas de perforación. \r\nAcompañado a esto meso con necrosis e inflamación aguda.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n1.APENDICITIS AGUDA PERFORADA\r\n2.MESO CON NECROSIS E INFLAMACIÓN AGUDA\r\n\r\n\r\n', '', ''),
	(579, 'L2104-84', 'L', '1050840869', 'JORGE LUIS MORENO BELEÑO', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-04-29', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "L.C.R" se reciben 0.3 ml. de un líquido de color transparente. Se centrifuga y se hace extendido del sedimento.', '', '', '', ''),
	(580, 'L2104-84', 'L', '1050840869', 'JORGE LUIS MORENO BELEÑO', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "L.C.R" se reciben 0.3 ml. de un líquido de color transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquideo.\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n\r\n', '', ''),
	(581, 'L2104-85', 'L', '1044015747', 'DYLAN ALEXANDER FERRER MARTINEZ', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-05-03', '2021-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "L.C.R" se reciben 0.4 ml. de un líquido de color transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquideo:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(582, 'Q2105-2104', 'Q', '32740521', 'OLGA CECILIA REBOLLEDO SUAREZ', '0000', 'F', '50', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora ADRIANA LOPEZ CELEDON', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero + trompas" se recibe un utero con sus anexos que pesa 235 gms. y mide 12 x 5 x 6.5 cms. El cervix esta tapizado por una mucosa de color pardo claro con áreas de color pardo oscuro, sin lesiones aparentes. El cuerpo esta aumentado de tamaño conservando su forma habitual, las trompas miden respectivamente 7 cms. la derecha y la izquierda 6 cms. Los ovarios conservan su forma habitual y miden 2.5 y 3 cms. el derecho e izquierdo. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa de color rosado de 3 milimetros de espesor, el miometrio esta engrosado y mide 2.8 cms. en la cara anterior y 3 cms. en la cara posterior es de aspecto fibrilar con un punteado de color pardo oscuro. Las trompas y los ovarios no muestran alteraciones macroscópicas. Se toman cortes.\r\n\r\n\r\n', 'El cervix presenta una reacción inflamatoria aguda y crónica. El endometrio es proliferativo con cambios de autólisis. El miometrio muestra áreas de fibrosis. Las trompas son normales y los ovarios contienen pequeñas cavidades tapizada por elementos foliculares.\r\n\r\n\r\n\r\n', ' Utero y anexos (235 gms.):\r\n-CERVICITIS AGUDA Y CRÓNICA\r\n-ENDOMETRIO PROLIFERATIVO\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS CON FOLÍCULOS QUÍSTICOS\r\n\r\n', '', 'Ver descripción macro y microscópica.\r\n'),
	(583, 'Q2105-2105', 'Q', '9048354', 'ROBERTO CASTRO ZAPERZUZA', '0000', 'M', '80', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898241', '69000', 'Doctor HERNAN CALDERON', NULL, '2021-05-10', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Fragmento de intestino delgado de ileon distal" se recibe un segmento de intestino delgado que mide 8 x 3 cms. en sus mayores dimensiones. La superficie externa esta cubierta por una serosa lisa y brillante de color pardo claro. Al corte la luz esta ocupada por una masa polipoide que mide 3.5 x 2.5 x 2.8 cms. Al corte está masa se proyecta directamente desde la pared, es de color blanquecino y consistencia firme y esta separada de los margenes de resección en un lado por 1 cm. y en el otro por 3.5 cms. Se toman cortes que se rotulan así: A masa, B línea de resección mas cercana al tumor y C mas lejana al tumor.', 'Los cortes rotulados A muestran un tumor mesenquimal compuesto por células fusiformes de núcleos redondos, vacuolados, con nucleolo prominente, que reposan en un trasfondo edematoso. No se identifican mitosis. Esta parcialmente cubierto por la mucosa que en su mayoría esta ulcerada y reemplazada por tejido de granulación. Los margenes de resección estan libres de tumor.\r\n\r\n\r\n\r\n', ' Segmento de intestino delgado (8 cms.):\r\n-COMPATIBLE CON TUMOR ESTROMAL GASTROINTESTINAL (GIST) CON PATRÓN DE CÉLULAS FUSIFORMES\r\n-MARGENES DE RESECCIÓN LIBRES DE TUMOR\r\n\r\n\r\n\r\n', '', 'Por su tamaño y ausencia de mitosis este tumor se considera de bajo riesgo de malignidad.\r\nEs necesario practicar estudios de inmunohistoquímica para una confirmación diagnóstica.\r\n\r\nEste caso fue revisado en junta de patologos de nuestra institución.\r\n'),
	(584, 'Q2105-2106', 'Q', '9290855', 'JORGE LUIS WOODBINE CANTILLO', '000', 'M', '48', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898241', '69000', 'Doctor HERNAN CALDERON', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Hemorroides" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia firme que mide 2.2 x 1.8 x 1.5 cms. en sus mayores dimensiones, la superficie externa es irregular y alc orte se encuentra una superficie de color grisáceo con áreas de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso maduro que reposa en un corion que contiene grandes cavidades vasculares con abundante contenido de sangre.\r\n\r\n\r\n\r\n', '-HEMORROIDES\r\n\r\n\r\n', '', ''),
	(585, 'Q2105-2107', 'Q', '30771349', 'BELARMINA PINTO VIVANCO', '0000', 'F', '62', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctores JOSE RODRIGUEZ - CARLOS REMOLINA', NULL, '2021-05-07', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mediastino posterior" tres fragmentos de tejido de forma irregular de color pardo oscuro con áreas de color pardo claro y consistencia firme que miden respectivamente 1.5, 1.2 y 0.8 cms. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Pleura parietal" contiene un fragmento de tejido de forma alargado de color pardo claro y consistencia elástica que mide 1.2 x 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran un tumor maligno compuesto por células pequeñas y medianas, algunas plasmocitoides, con nucleos vaciolados de diferentes tamaños y nucleolo prominente, que se disponen en un patrón sólido con escasas mitosis.\r\nLos cortes rotulados B muestran fragmento de pleura libre de tumor.\r\n\r\n\r\n', '1.Biopsia de masa en mediastino:\r\n-TUMOR MALIGNO DE PROBABLE ORIGEN LINFOIDE\r\n2.FRAGMENTO DE PLEURA LIBRE DE TUMOR\r\n\r\n\r\n\r\n', '', 'Es imperativo practicar estudios de inmunohistoquímica para una definición diagnóstica precisa.\r\n'),
	(586, 'Q2105-2108', 'Q', '1201235055', 'JEAN CARLOS BERRIO POLO', '3222449462', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.5 x 1.5 cms. La superficie externa esta cubierta por una serosa despulida de color pardo claro con áreas de color pardo oscuro, con membranas de aspecto purulento. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA', '', ''),
	(587, 'Q2105-2109', 'Q', '22776197', 'UBALDINA MEDRANO MEDRANO', '6471413', 'F', '85', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vagina" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso con hiperqueratosis e hipregranulosis. No hay elementos estromales en la muestra. No hay cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cúpula vaginal prolapsada:\r\n-HIPERQUERATOSIS\r\n\r\n\r\n', '', ''),
	(588, 'Q2105-2110', 'Q', '1137537345', 'LUCAS JOSE MALDONADO VARGAS', '3002182175', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. en ssu mayores dimensiones, la superficie externa esta cubierta por una serosa irregular de color pardo claro con vasos prominentes. Al corte en el extremo distal se encuentra la luz ocupada por material fecal endurecida (fecalito). Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(589, 'Q2105-2111', 'Q', '45693091', 'ALCIRA JUDITH TORRES ACOSTA', '3163167798', 'F', '42', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian un diaémtro de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral dentro de los límites de la normalidad.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA ANTRAL\r\n\r\n\r\n', '', ''),
	(590, 'Q2105-2112', 'Q', '45645409', 'KAREN MARGARITA BUELVAS BARRIOS', '3016048021', 'F', '39', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(591, 'Q2105-2113', 'Q', '1047495747', 'DANIEL AUGUSTO MONTARIENN RINCON VELEZ', '3137434265', 'M', '22', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Esófago" se reciben pequeños fragmentos de tejido de aspecto membranoso color pardo grisáceo y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran esófago en cuya submucosa se observan islotes de mucosa gastrica antral.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de esófago:\r\n-CAMBIOS COMPATIBLES CON HETEROTOPIA GÁSTRICA\r\n\r\n\r\n\r\n', '', ''),
	(592, 'Q2105-2114', 'Q', '26931501', 'MIRIAN ESTHER RIVERA TORRIJO', '000', 'F', '69', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-05-27', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Nodulo #1 - hora 12" varios fragmentos de tejido de forma irregular de color blanco amarillento y consistencia friable que promedian un diámetro mayor de 0.2 cms. Se toma todo y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Nodulo #2 - hora 9" contiene varios fragmentos de tejido de forma irregular de color blanquecino y consistencia friable cuyops diámetro oscilan entre 0.1 y 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran minúsculos fragmentos de tejido mamario. No se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n', '1.Biopsia con aguja de corte de masa en hora 12 de mama derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.Biopsia con aguja de corte de masa en hora 9 de mama derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(593, 'Q2105-2115', 'Q', '9283757', 'JOSE DE LA CRUZ QUINTANA SIMANCAS', '000', 'M', '60', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor RODOLFO VALENCIA', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 3.5 cms. La superficie externa es irregular y esta cubierta por una serosa despulida de color pardo claro con áreas de color pardo oscuro. Al corte las paredes son muy gruesas, alcanzando en algunas partes 1 cm. de espesor, la mucosa parece ulcerada y hacia el fondo se encuentra una estructura irregular que se proyecta hacia la luz y que mide 1 cm. en su mayor dimensión. Se toman cortes así: A pared, B estructura descrita.\r\nNo se encuentran cálculos. \r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran pared de vesícula biliar cuya mucosa está parcialmente ulcerada. Hay un denso infiltrado inflamatorio mediado por linfocitos y células plasmáticas y marcada fibrosis de la pared.\r\nLos cortes rotulados B muestran tejido de granulación densamente infiltrado por linfocitos y células plasmáticas.\r\nNo se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(594, 'Q2105-2116', 'Q', '1043302533', 'ELIAN ANDRES TABARES MATOS', '3207167292', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FELIX ALBERTO CABRERA CORREA', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia callo femur derecho" se recibe un fragmento de tejido de forma alargada que mide 7 x 1 cms. en sus mayores dimensiones de color pardo claro y consistencia elástica. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'El especimen está constitudo por tejido fibroso muy vascularizado e infiltrado por linfocitos y células plasmáticas. No se encuentran elementos oseos en la muestra.\r\n\r\n\r\n\r\n', ' Biopsia de callo de fractura de femur derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n', '', ''),
	(595, 'Q2105-2117', 'Q', '1142933024', 'ISABEL SOFIA CASTILLA FANDIÑO', '3042052955', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARIA CLAUDIA BURGOS', NULL, '2021-05-07', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados se reciben:\r\n1. "Tumor orofaringe derecha" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 1 x 0.8 x 0.5 cms. Al corte se encuentra una superficie homogenea de color grisáceo. Se lámina en su totalidad y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Amigdala derecha" contiene un amigdala palatina que mide 3 x 1.8 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro y al corte se encuentra una superficie de color pardo claro y aspecto ligeramente lobulado. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran tejido linfoide hiperplásico que rodea varias hendiduras tapizadas por epitelio escamoso. No se encuentran cambios neoplásicos ni elementos odontogénicos. Los hallazgos histológicos son similares a los encontrados en una amígdala.\r\nLos cortes rotulados B muestran amígdala palatina con inflamación crónica y cambios hiperplásicos del tejido linfoide.\r\n\r\n\r\n', '1.Biopsia de región del trigono retromolar derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(596, 'Q2105-2118', 'Q', '1104269634', 'ANDRES FELIPE OVIEDO LOPEZ', '3045319223', 'M', '2', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados se reciben:\r\n1. "Esófago" varios fragmentos membranosos de tejido de color pardo claro y consistencia blanda que promedian un diámetro de 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido de forma alargada de color pardo claro y consistencia blanda que mide 1 cms. Se toma todo y se rotulan E.\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa esofágica con discreto edema e infiltración mononuclear de la submucosa.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran fragmentos de mucosa gástrica oxíntica sin alteraciones.\r\nLos cortes rotulados D y E  muestran mucosa duodenal con edema e infiltración linfoplasmocitaria de la lámina propia.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de antro gastrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTOS DE MUCOSA GASTRICA OXÍNTICA\r\n4.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n5.Biopsia endoscópica de 2da. porción del duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(597, 'Q2105-2119', 'Q', '38872639', 'YAMILEDH DARAVIÑA', '3148661553', 'M', '50', 'GASTROPACK SAS', 'PARTICULAR', '', '', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA SEVERA\r\n\r\n\r\n', '', ''),
	(598, 'Q2105-2120', 'Q', '15244924', 'FAUSTO OLIVER HOWARD CAMPBELL', '3004263981', 'M', '55', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-05', '2021-05-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden respectivamente 0.2 y 0.5 cms. en uss mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(599, 'Q2105-2121', 'Q', '1041986969', 'TAILI SOFIA MANRIQUE VILLANUEVA', '000', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-05-07', '2021-05-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Amigdala izquierda" masa de tejido de forma ovoidea de color blanquecino y consistencia elástica que mide 2 x 1.5 cms. Al corte una superficia multinodular de color amarillento. Se toman cortes y se rotulan A. \r\n2.  "Amigdala derecha" masa de tejido de forma ovoidea de color blanquecino y consistencia elástica que mide 2 x 1.3 cms. Al corte una superficia multinodular de color amarillento. Se toman cortes y se rotulan B. \r\n\r\n\r\n', 'Los cortes A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(600, 'Q2105-2122', 'Q', '1143341731', 'NICOLLE ANDREA CARDENAS GONZALEZ', '3012316074', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-05-07', '2021-05-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" masa de tejido de forma ovoidea de color blanquecino y consistencia elástica que mide 3.3 x 2.5 cms. Al corte una superficia multinodular de color pardo claro. Se toman cortes y se rotulan A. \r\n2.  "Amigdala izquierda" masa de tejido de forma ovoidea de color blanquecino y consistencia elástica que mide 3 x 2.2 cms. Al corte una superficia multinodular de color amarillento. Se toman cortes y se rotulan B. \r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(601, 'Q2105-2123', 'Q', '52143353', 'IDALIDES ISABEL PEREZ SIERRA', '00', 'F', '54', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-05-10', '2021-05-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Utero + trompa + ovarios - quíste paratubarico" se recibe un cuerpo uterino que mide 6 x 6 x 3 cms. cubierto por una serosa de color pardo claro. Por separado cuello uterino mide 4 x 3 x 4 cms. cubierto por una mucosa blanquecina con un orificio tranversal. Al corte el canal endocervical es permeable, la cavidad endometrial es permeable, el endometrio es plano de color rojizo, el espesor del miometrio es de 1.5 cms. sin alteraciones evidentes, el ovario derecho mide 5 x 2 cms. y muestra al corte dos formaciones quisticas la mayor de 1.5 cms. y la menor de 0.5 cms. Se toman cortes y se rotulan A.\r\nPor separado, se recibe anexo izquierdo esta representado por ovario que mide 8 x 4 cms. a nivel de la trompa de Falopio se observan dos formaciones quisticas de 1 cm. Al corte del ovario se observa la pared de un quíste, deja ver una cavidad unilocular que mide 4 x 4 cms. de la cual se toman cortes y se rotulan B, haciendo cuerpo con la lesión quistica descrita se observan dos cavidades quisticas de iguales caracteristicas de 1 cm. Se toman cortes.\r\n', 'Los cortes revelan cervix tapizado por epitelio escamoso, el estroma infiltrado por escasos linfocitos, el endometrio muestra cambios de autólisis. El ovario derecho muestra folículos quisticos, las lesiones quisticas descritas correponden a quístes simples paraovaricos. El ovario izquierdo muestra un cistadenoma seroso, las lesiones quisticas descritas correspnden a hidatides de morgagni.\r\n\r\n\r\n', ' Utero con: \r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTOLISADO\r\n-OVARIO DERECHO\r\n-QUÍSTES SIMPLIES PARAOVARICO DERECHO (2)\r\n-CISTADENOMA SEROSO, ovario izquierdo\r\n-QUÍSTE SIMPLES PARAOVARICOS IZQUIERDO\r\n-TROMPA DE FALOPIO IZQUIERDA CON HIDATIDE DE MORGAGNI', '', ''),
	(602, 'Q2105-2124', 'Q', '45592086', 'CLAUDIA ARROYO BAENA', '000', 'F', '44', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Dcotor MARLON DEL TORO', NULL, '2021-05-10', '2021-05-05', 'ANA MAGOLA MANGA CEDEÑO', 'Se recibe, rotulado "Utero, trompa derecha y ovario derecho" un cuerpo uterino que pesa 566 gms. y mide 14 x 9 x 9 cms. El cuerdpo deformado y aumentado globalmente de tamaño, tapizado por una serosa de color pardo oscuro, la entrada a la cavidad endometrial viene señalada con un DIU. Al corte la cavidad endometrial es permeable, el endometrio es plano y rosado, el espesor del miometrio es de 7 cms. en su mayor dimensión y esta representado por múltiples masas blanquecinas arremolinadas situadas a nivel submucoso, intramural y subseroso de la cual Se toman cortes.\r\nEl ovario derecho mide 5 x 3 cms. y al corte es de color blanquecino y alterna con áreas masa oscuras. La trompa es tortuosa mide 7 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan endometrio con cambios por autólisis, las formaciones nodulares descritas corresponden a leiomiomas, las trompas de Falopio derecha se encuentra dilatada y muestra congestión vascular e infiltración por escasos plasmocitos y abundantes neutrófilos, el ovario no muestra cambios.\r\n\r\n\r\n\r\n', ' Cuerpo uterino con (566 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-SALPINGITIS AGUDA, trompa derecha\r\n-OVARIO DERECHO', '', ''),
	(603, 'Q2105-2125', 'Q', '1143369957', 'ANDREA ISABEL VECINO OSORIO', '3175552921', 'F', '28', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-01', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo\r\n\r\n\r\n\r\n\r\n', 'Los corte muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(604, 'Q2105-2126', 'Q', '9070880', 'CLARO RAFAEL GONZALEZ GRAU', '000', 'M', '72', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.7 x 2.3 x 1.2 cms. La superficie externa esta cubierta por piel casi en su totalidad y al corte se observa una superficie homogena de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por epitelio escamoso que recubre un nucleo de tejido fibroadiposo.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región glutea izquierda:\r\n-PÓLIPO FIBROEPITELIAL (ACROCORDON)\r\n\r\n\r\n', '', ''),
	(605, 'Q2105-2127', 'Q', '1007620993', 'MICHEL ANDREA TAPIA ARRIETA', '000', 'F', '21', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora VICTORIA GONZALEZ', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fibroadenoma mamario derecho hora 12" se reciben dos masas de tejido de forma irregular de color pardo claro y consistencia elástica que miden 2.5 x 2 x 1.5 y 2.3 x 2 x 1 cms. en sus mayores dimensiones, la superficie externa es multinodular. Al corte se observa una superficie homogenea de color pardo claro. Se toman sendos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n\r\n\r\n', '', ''),
	(606, 'Q2105-2128', 'Q', '1043640608', 'LEIDY JARAMILLO PEREZ', '0000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.5 x 0.9 cms., la superficie externa está cubierta por una serosa despulida y parcialmente con aumento de la trama vascular. Al corte la pared esta engrosada y la luz dilatada. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA', '', ''),
	(607, 'Q2105-2129', 'Q', '1043301614', 'LUIS FELIPE MONTENEGRO MONTERROSA', '000', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JORGE ALBERTO LAMBIS RICARDO', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Testiculo izquierdo" se recibe un testiculo con sus elementos del cordon que mide 6.3 x 5 x 4 cms., la superficie externa está cubierta por una serosa lisa y brillante. Al corte se observa una superficie de color violáceo finamente granular (testiculo) esta rodeada por un área de color violáceo, lisa y brillante que mide 3.5 x 2.5 cms. rodeada de un área de color oscuro y aspecto gelatinoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran testículo cuyo parénquima muestra áreas extensas de necrosis hemorrágica.\r\n\r\n\r\n\r\n', ' Orquiectomía izquierda.\r\n-NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n\r\n', '', ''),
	(608, 'Q2105-2130', 'Q', '1201258027', 'ELIUD ALEXANDER SALAZAR ARNEDO', '00000', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste de mama derecha" se recibe un fragmento de tejido de forma irregular de color pardo grisaceo y consistencia renitente que mide 1.4 x 1 x 0.7 cms.  Al corte hay salida de un material aspecto achocolatado dejando una cavidad unilocular de paredes delgadas que mide 1 cm. de diámetro en su mayor dimesnión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión quística multilocular tapizada por epitelio aplanado en su mayoría. En las caviades más pequeñas el epitelio es cúbico. Las cavidades contienen un material grumoso eosinofílico. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección de lesión en mama derecha:\r\n-QUÍSTE SIMPLE', '', ''),
	(609, 'Q2105-2131', 'Q', '1047368564', 'MARIA TERESA OÑATE VALDELAMAR', '000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 8.5 x 2.5 cms. La superficie externa está parcialmente cubierta por una serosa lisa y brillante. Al corte hay salida de material biliar y un pequeño calculo de color pardo amarillento, la pared esta engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar cuya mucosa y pared conservan su morfología habitual.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLELITIASIS\r\n\r\n\r\n', '', ''),
	(610, 'Q2105-2132', 'Q', '1237441799', 'ARIANY DEL CARMEN CANTILLO LATINEZ', '000', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.5 x 0.7 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya mucsoa conserva su morfología habitual. Hay edema e infiltración de la serosa y subserosa por leucocitos PMN neutrófilos.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-PERIAPENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(611, 'Q2105-2133', 'Q', '1137526501', 'KEYLIN YANETH SAYAS PADILLA', '000', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Verrugas viricas genitales" se reciben seis diminutos fragmentos de tejido de forma irregular de color pardo grisáceo y consistencia elástica que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso con papilomatosis, hiperqueratosis con paraqueratosis y acantosis irregular que reposa en un corion con densa infiltración por linfocitos, células plasmáticas y macrófagos. No se encuentran cambios coilocíticos.\r\n\r\n\r\n\r\n', ' Resección de lesiones verrucosas en área genital:\r\n-PAPILOMAS ESCAMOSOS\r\n\r\n\r\n\r\n', '', 'Los hallazgos son sugestivos pero no concluyentes de lesines condilomatosas.\r\n\r\n'),
	(612, 'Q2105-2134', 'Q', '9154374', 'CARLOS EDUARDO ROBLES EYES', '0000', 'M', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor CARLOS REMOLINA', NULL, '2021-05-07', '2021-05-07', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1. "Segmento pulmonar" un segmento cuneiforme de tejido que mide 3.8 x 1  x 0.5 cms. de color pardo oscuro y consistencia elástica. Al corte se observa una superficie de color pardo oscuro que alterna con un área finamente granular de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Pleura parietal" cuatro fragmentos de tejido de forma irregular de color pardo grisáceo y aspecto membranoso el mayor mide 2.3 x 1.3 cms. y los otros promedian 0.7 x 0.5 cms.  Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran parénquima pulmonar con discreta dilatación alveolar. No se encuentran granulomas ni cambios neoplásicos.\r\nLos cortes rotulados B muestran fragmentos de tejido fibroso marcadamente vascularizado que en algunas áreas rodea un material proteinaceo, acidofílico, que recuerda fibrina. No se encuentran granulomas ni cambios neoplásicos.\r\n\r\n\r\n', '1.Biopsia de segmento pulmonar derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.Biopsia de pleura parietal derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(613, 'L2105-86', 'L', '33139608', 'MARITZA BONOLIS JULIO', '000', 'F', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-05-13', '2021-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado "Líquido pleural" se reciben 15 ml. de un líquid rojizo. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'En un fondo hemorrágico se observan células de nucleos irregulares, hipercromáticos, citoplasma eosinófilico y algunas células inflamatorias.\r\n\r\n\r\n\r\n', ' Citología de líquido pleural:\r\n-POSITIVA PARA CÉLULAS MALIGNAS\r\n\r\n', '', ''),
	(614, 'Q2105-2135', 'Q', '1047365275', 'AURISTELLA HURTADO MALDONADO', '3004372192', 'F', '35', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-13', '2021-05-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia elástica que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan piel con hiperqueratosis, hipergranulosis, acantosis irregular, atípias coilociticas, el estroma infiltrado por linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA ', '', ''),
	(615, 'Q2105-2136', 'Q', '73198309', 'TELLIS SABIER REYES RODRIGUEZ', '3188360361', 'M', '38', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-13', '2021-05-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que miden respectivamente 0.5 y 0.3 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(616, 'Q2105-2137', 'Q', '1143349726', 'JHOVANI ANDRES GAVIRIA RAMIREZ', '3214129929', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-05-12', '2021-05-11', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1.5 cms., la superficie externa está cubierta por una serosa despulida de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(617, 'Q2105-2138', 'Q', '1063720140', 'NATALIA HERNANDEZ YEPES', '3148480826', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-05-12', '2021-05-11', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.8 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa lisa y brillante de color pardo claro. Al corte la pared se encuentra una luz ligeramente dilatada. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(618, 'Q2105-2139', 'Q', '1143376363', 'YIRETH SOFIA VELASQUEZ GONZALEZ', '000', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor OSCAR ENRIQUE ROMERO', NULL, '2021-05-12', '2021-05-11', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.8 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa de color pardo oscuro. Al corte la pared se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(619, 'Q2105-2140', 'Q', '45457718', 'CARMEN CECILIA PEREZ SANCHEZ', 'C000', 'F', '58', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor JOSE RODRIGUEZ - CARLOS REMOLINA', NULL, '2021-05-24', '2021-05-11', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Segmento de pulmon izquierdo" un fragmento de tejido pulmonar de forma irregular, que mide 2.5 x 1.8 x 1 cms. en sus mayores dimensiones. Al corte se encuentra un nódulo de color blanquecino que mide 1.2 cms. en su mayor dimensión. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Muestra pleura parietal izquierda" contiene tres fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica cuyos diámetros promedian 1.3 cms. son de color pardo claro, consistencia elástica. Se toma todo y se rotulan B.\r\n3. "Citología de líquido pleural pulmon izquierdo" tres placas con su extendido.\r\n\r\n', 'Los cortes rotulados A muestran un tumor maligno epitelial compuesto por células pequeñas de nucleos irregulares y escaso citoplasma, con abundantes mitosis, que se disponen en un patrón sólido que infiltra el parénquima pulmonar.\r\nLos cortes rotulados B muestran tejido fibroso infiltrado por un tumor con las características descritas.\r\nlos extendidos contienen células neoplásicas.\r\n\r\n', '1.Resección de fragmento de pulmón izquierdo:\r\n-CARCINOMA DE CÉLULAS PEQUEÑAS, INFILTRANTE\r\n2.Biopsia de pleura parietal izquierda:\r\n-CARCINOMA DE CÉLULAS PEQUEÑAS, INFILTRANTE\r\n3.Extendido de líquido pleural:\r\n-CITOLOGÍA POSITIVA DE CÉLULAS MALIGNAS\r\n', '', 'Es imprescindible hacer estudios de inmunohistoquímica para una confirmación diagnóstica precisa.\r\n\r\nSe retiran 8 bloques por el señor PEDRO ALCAZAR CC. 11253685 (24/myo/2021)'),
	(620, 'Q2105-2141', 'Q', '33113937', 'LILY MARGOTH ACOSTA CERVANTES', '000', 'F', '78', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JOSE LUIS ACEVEDO MONRROY', NULL, '2021-05-12', '2021-05-11', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quíste de glandula de bartholino" se recibe una masa de tejido de forma irregular de color pardo oscuro y consistencia renitente que mide 2.5 x 2 x 1.4 cms. La superficie externa es irregular y al corte se encuentra una superficie con múltiples cavidades que contienen un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'El espécimen está compuesto por múltiples cavidades de forma y tamaño irregular, que contienen abundante sangre. Están separadas por septos de tejido fibroso que en algunas áreas contienen abundantes células xantomatosas. No se identifican elementos glanduliformes en la muestra.\r\n\r\n\r\n\r\n', '', '', ' Resección de masa en vulva.\r\n-HEMANGIOMA CAVERNOSO\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n'),
	(621, 'Q2105-2142', 'Q', '33129593', 'IGNACIA PICHOTT DE NAVARRO', '000', 'F', '73', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-05-12', '2021-05-11', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice por laparoscopia" se recibe un apéndice cecal que mide 7 x 0.6 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa lisa y brillante. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya mucosa y estratos musculares conservan su integridad sin cambios inflamatorios. La subserosa esta engrosada con un infiltrado inflamatorio mixto compuesto por linfocitos, neutrófilos y macrófagos.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-PERIAPENDICITIS \r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(622, 'Q2105-2143', 'Q', '33108462', 'ANA ISABEL PEREZ MUNARRI', '0000', 'F', '47', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-05-13', '2021-05-11', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia por trucut seno izquierdo" se reciben seis cilíndros filiformes de tejido que proemdian una longitud de 1.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno epitelial compuesto por células pequeñas de nucleos irregulares, hipercromáticas y escaso citoplasma, que infiltra el estroma en hileras (filas indias) y formando estructuras concentricas.\r\nNo se identifica componente intralobulillar ni infiltración linfovascular o perineural.\r\n\r\n\r\n\r\n', ' Biopsia con aguja de corte de masa en mama izquierda:\r\n-TUMOR MALIGNO EPITELIAL COMPATIBLE CON CARCINOMA LOBULILLAR INFILTRANTE\r\n\r\n\r\n', '', 'Es conveniente practicar estudios de inmunohistoquímica para una definición diagnóstica precisa.\r\n\r\n'),
	(623, 'Q2105-2144', 'Q', '45515700', 'DUNIA GONZALEZ LANZ', '000', 'F', '49', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-19', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un punch de piel de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso hiperplasico con hiperqueratosis que descansa en un estroma fibroso.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-PAPILOMAS ESCAMOSOS', '', ''),
	(624, 'Q2105-2145', 'Q', '23136601', 'ALEIDA ROSA CAMACHO BARRIO', '3107316050', 'F', '57', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Lesión polipoide endocervical" se recibe un fragmento de tejido de aspecto mucoide de consistencia blanda que mide 1 x 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n\r\n', '-POLIPO ENDOCERVICAL\r\n\r\n\r\n', '', ''),
	(625, 'Q2105-2146', 'Q', '45445040', 'SUSANA CONSUELO BARRERA FAJARDO', '3046471460', 'F', '58', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-26', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben cinco fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa gastrica antral en cuya lámina propia se observa denso infiltrado inflamatorio de predominio linfocitico que se extiende hasta la muscular de la mucosa, se observa además, H.pylori en la luz de algunas glandulas. No se observa metaplasia intestinal.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', 'Seria conveniente practicar estudios de inmunohistoquímica para investigar probable proceso neoplasico de tipo MALT.\r\n\r\n\r\nSe retira 1 bloque por la señora SUSANA CUADRADO BARRERA CC. 1047.461.246 (26/myo/2021)'),
	(626, 'Q2105-2147', 'Q', '8426819', 'WILLIAN ANTONIO VELEZ URIBE', '3233737653', 'M', '65', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(627, 'Q2105-2148', 'Q', '45462960', 'MERCEDES DEL CARMEN CAPARROSO PEREZ', '3126690826', 'F', '55', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(628, 'Q2105-2149', 'Q', '64551325', 'CARMEN MARIA ROMERO CAMPO', '3136074979', 'F', '57', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-24', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan antro gastrico en cuya lámina propia se observa un infiltrado inflamatorio mixto mediado por linfocitos, plasmocitos y neutrófilos, se observa además área de ulceración que contiene coágulos de fibrina y glándulas con atipias estructurales y citológicas de probable origen reactivo. No se observa metaplasia intestinal ni H.pylori en la muestra.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA ULCERADA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(629, 'Q2105-2150', 'Q', '1042580308', 'JAILER DANIEL VASQUEZ HERNANDEZ', '3167131918', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME EDUARDO VALIENTE DIAZ', NULL, '2021-06-04', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Quíste oseo de femur derecho" varios fragemntos de tejido de forma irregular, el mayor de 1 x 1 cms. y el menor de 0.3 cms. de aspecto fibroadiposo. Se toman cortes y se rotulan A.\r\nAcompañando a esto, un fragmento oseo de 1 cm. Se pone a descalcificar.\r\n2. "Quíste oseo de femur" varios fragmentos de tejido que promedian 1.5 cms. de color pardo oscuro. Se toma parte y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B revelan lesión constituida por espículas oseas irregulares, sin actividad osteoblastica que reposa en un estroma fibroso denso. No se encuentran cambios neoplasicos en la muestra.\r\n\r\n\r\n\r\n', ' Biopsia de lesión femur derecho:\r\n-DISPLASIA FIBROSA\r\n\r\n', '', ''),
	(630, 'Q2105-2151', 'Q', '22855180', 'NUBIA EL CARMEN MORANTE ALVAREZ', '3126606337', 'F', '46', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', '', NULL, '2021-05-19', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de endometrio" se reciben fragmentos de tejido de forma irregular de color pardo oscuro y consistencia blanda que promedian 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan en su mayoría coágulos sanguineos, diminuto fragmentos de epitelio escamoso y diminuto fragmento de estroma endometrial.\r\n\r\n\r\n\r\n', '  Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(631, 'Q2105-2152', 'Q', '1043647942', 'ANGEL ALFONSO GAZABON ORTIZ', '3215190189', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice"  se recibe un apéndice cecal que mide 4 cms. la serosa es blanquecina. Al corte la luz ocupada pro material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(632, 'Q2105-2153', 'Q', '1043321161', 'LUCIANA AGUAS GOMEZ', '3133965161', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar de forma piriforme que mide 5 x 3 cms. salida de líquido biliar dejando ver la presencia de un calculo de 1 cm. la mucosa conserva el aspecto habitual. Se toman cortes .\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(633, 'Q2105-2154', 'Q', '50849783', 'PATRICIA VELASQUEZ VERGARA', '000', 'F', '54', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '', '', 'Doctor HERNAN CALDERON', NULL, '2021-05-19', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 3 cms. la serosa es congestiva y opaca. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal que muestra la estructura usual, en la submucosa se observan folículos linfoides hiperplasicos, la serosa edematosa en la que se observa infiltración por abundante neutrófilos.\r\n\r\n\r\n\r\n', '-PERIAPENDICITIS', '', ''),
	(634, 'Q2105-2155', 'Q', '33133912', 'MIRYAM ESTER BUSTAMANTE RAMOS', 'C000', 'F', '70', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA', NULL, '2021-05-19', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(635, 'Q2105-2156', 'Q', '1047430436', 'YEITSI TATIANA GUZMAN MONTERO', 'C000', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR GONZALEZ', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apendicitis" se recibe un apéndice cecal qoue mide 7 cms. la serosa es opaca, despulida y tapizada por material fibrinoso. Al corte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(636, 'Q2105-2157', 'Q', '45523171', 'LEDIS RUTH CALVO CASANOVA', '00', 'F', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 2 cms. la serosa es verdoso. Al corte las paredes estan engrosada y en su interior múltiples fragmentos de calculos de color amarillento de forma irregular promedian 1 cm. la mucosa conserva su aspecto habitual. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(637, 'Q2105-2158', 'Q', '33220861', 'KATTY ARMESTO BAZZA', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-05-18', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 3 cms. la serosa es verdoso. Al corte las paredes estan engrosada y en su interior se observan dos calculos de forma piramidal que promedian 1.5 cm. la mucosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(638, 'Q2105-2159', 'Q', '5132631', 'VICTOR BELTRAN PEREZ', '00', 'M', '79', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctores JOSE RODRIGUEZ - CARLOS REMOLINA', NULL, '2021-05-24', '2021-05-14', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Pleura parietal" dos fragmentos de tejido el mayor de forma alargada que mide 1.5 cms. y el menor de 0.3 cms. de consistencia elástica y pardo socuro. Se toma todo y se rotula A.\r\n2. "Pulmon derecho - segmento pulmonar" varios fragmentos de tejido de forma irregular de color pardo oscuro que promedian 1 cm. Al corte una superficie blanquecina. Se toma parte y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan pleura parietal sin alteraciones.\r\nLos cortes B muestran un tumor maligno epitelial constituido por células escamosas pleomorficas de nucleos grandes, vesiculosos y nucleolo prominente que rodean acumulos de queratina laminar.\r\n\r\n\r\n\r\n', '1.FRAGMENTO DE PLEURA PARIETAL\r\n2.Biopsia de lesión en segmento pulmonar derecho:\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO, INFILTRANTE', '', ''),
	(639, 'Q2105-2160', 'Q', '1047402828', 'CINDY POLO MONTALVO', '3217687156', 'F', '32', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se reciben dos fragmentos de piel de forma irregular de color pardo grisáceo y consistencia elástica que miden 0.7 x 0.4 y 0.3 x 0.2 cms. La superficie externa de la mayor se observa una lesión ulcerada sobreelevada mide 0.3 x 0.2 cms. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', '  Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(640, 'Q2105-2161', 'Q', '11811538', 'YEISSON RENGIFO MORENO', 'C000', 'M', '40', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(641, 'Q2105-2162', 'Q', '1043964601', 'HAROLDO GONZALEZ SIERRA', '000', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.7 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(642, 'Q2105-2163', 'Q', '26693846', 'MYRIAM DEL CARMEN BORJA ABELLO', '000', 'F', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor EDGARDO DURAN', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste anexial derecho" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia renitente que mide 9 x 8.5 x 3.5 cms. La superficie externa es multilobulada y al corte hay salida de un líquido claro dejando una cavidad multilocular de paredes delgadas. Se toman cortes.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por un epitelio seroso.\r\n\r\n\r\n\r\n\r\n', ' Cistectomía de ovario derecho:\r\n-CISTADENOMA SEROSO', '', ''),
	(643, 'Q2105-2164', 'Q', '45456019', 'KATIA ESTHELA LARIOS NAVARRO', '00', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor SAMUEL CANTILLO', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado "Histerectomía abdominal total - trompa derecha" se recibe un cuerpo uterino que pesa 113 gms. y mide 4  x7.5 x 6 cms. La superficie externa esta parcialmente cubierta por una serosa lisa y brillante. Al corte la cavidad endometrial esta ocupada por una masa de color pardo claro y consistencia elástica que mide 2 x 4.5 cms. El miometrio esta ocupado por múltiples masas de color blanquecino y aspecto arremolinado la mayor mide 1.5 cms. y la menor unos pocos milimetros de localización intramural y subserosa. En el mismo recipiente, se recibe, además, una trompa de Falopio que mide 5.5 x 0.7 cms. La superficie externa esta cubierta por una superficia lisa y brillante. Al corte conserva la morfología habitual. Se toman cortes.\r\n\r\n\r\n', 'El endometrio muestra cambios de predecidualización de probable origen farmacologico con tratamiento con progestagenos. La masa endometrial esta compuesta por glandulas quisticamente dilatadas tapizadas por un epitelio aplanado que reposan en un estroma predecidualizado. Las masas miometriales descritas estan compuestas por fibras musculares lisas distribuidas irregularmente.\r\nLa trompa de Falopio conserva la estructura usual.\r\n\r\n', ' Histerectomía abdominal subtotal con salpingectomía derecha:\r\n-ENDOMETRIO CON CAMBIOS DE PREDECIDUALIZACIÓN DE PROBABLE ORIGEN FARMACOLÓGICO\r\n-PÓLIPO ENDOMETRIAL ATRÓFICO\r\n-LEIOMIOMAS INTRAMURALES Y SUBSEROSOS\r\n-TROMPA DE FALOPIO', '', ''),
	(644, 'Q2105-2165', 'Q', '45550225', 'KAREN GUERRERO ZAMORA', '000', 'F', '38', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva " se recibe un diminuto fragmento de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos pro VPH.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(645, 'Q2105-2166', 'Q', '45468808', 'ELIZABETH CUENTAS CORREA', '000', 'F', '57', 'LIGA CONTRA EL CANCER', '', '898201', '30215', '', NULL, '2021-05-20', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe el producto de una cuadrantectomía que mide 8 x 4 x 3.5 cms. La superficie externa es irregular y se encuentra marcada con sedas 1 seda color rojo, 2 sedas color azúl, 3 sedas color verde. Al corte se observa una superficie amarillento y aspecto adiposo. Se toman cortes relacionadas con las líneas de resección. A1 rojo, A2 azúl, A3 verde, A4.\r\n\r\n\r\n\r\n', 'Los múltiples cortes muestran tejido mamario cuya morfología está alterada por la presencia de quístes de pequeño y mediano calibre que reposan en un estroma fibroso colagenizado. Hay focos de adenosis esclerosante y de microcalcificaciones. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Cuadrante de mama izquierda (resección):\r\n-CONDICIÓN FIBROQUISTICA CON FOCO DE ADENOSIS ESCLEROSANTE\r\n-VER DESCRIPCIÓN MIROSCÓPICA', '', ''),
	(646, 'Q2105-2167', 'Q', '1142942199', 'DAVID ARMANDO MARTINEZ MORENO', '000', 'M', '6', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción del duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan D.\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestrran mucosa oxíntica cuya lámina propia está edematosa e infiltrada por células mononucleares. No se observan H.pylori, actividad inflamatoria, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados C y D muestrran mucosa duodenal con edema, congestión y presencia de PMN neutrófilos y linfocitos en la lámina propia. No se observan parasitos, granulomas ni cambios displásicos.\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n3.Biopsia endoscópica de estómago (bulbo):\r\n-DUODENITIS AGUDA Y CRÓNICA LEVE\r\n4.Biopsia endoscópica de estómago (2da. porción):\r\n-DUODENITIS AGUDA Y CRÓNICA LEVE', '', ''),
	(647, 'Q2105-2168', 'Q', 'VEN2622486', 'JHOIVER FUENTES AMARO', '0000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.3 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz dilatada contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(648, 'Q2105-2169', 'Q', '1043317093', 'ALEJANDRO YANES CANO', '3126293358', 'M', '7', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-05-18', '2021-05-14', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedia 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedia 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción del duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan E.\r\n', 'Los cortes rotulados A muestran mucosa esófagica parcialmente tapizada por epitelio escamoso con hiperplasia del estrato basal y cambios por balonamiento que reposan en una lámina propia edematosa e infiltrada por linfocitos.\r\nLos cortes rotulados B muestran antrogastrico cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa oxíntica cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos. No se observan H.pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\nLos cortes rotulados D y E muestran mucosa duodenal con edema, congestión e infiltración mononuclear de la lámina propia. No se observan parasitos, granulomas ni cambios displásicos.\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA COMPATIBLE CON ESOFAGITIS POR REFLUJO GASTROESOFAGICO\r\n2.Biopsia endoscópica de estomago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de estomago (cuerp):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n4.Biopsia endoscópica de duodeno (bulbo):\r\n-DUODENITIS CRÓNICA\r\n5.Biopsia endoscópica de duodeno (2da. porción):\r\n-DUODENITIS CRÓNICA', '', ''),
	(649, 'Q2105-2170', 'Q', 'VEN12203533', 'FLOR DE MARIA CUADRO NIÑO', '3006515645', 'F', '48', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero + trompa y ovario" se recibe un cuerpo uterino con sus trompas y ovario que pesa 2600 gms. y mide 16 x 20 x 10 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa lisa y brillante, la trompa derecha mide 6 cms. de longitud y el ovario 5 x 1.5 x 2.5 cms. La trompa izquierda mide 3.5 cms. de longitud y el ovario mide 4 x 2 x 0.6 cms. Al corte la cavidad endometrial esta ocupada por un gran coágulo sanguineo y esta tapizado por una mucosa delgada de color rosado. En el miometrio se identifican dos grandes masas que miden respectivamente 15 cms. en su mayor diámetro la mayor, y 11 cms. la menor. Se toman cortes del endometrio y múltiples cortes de las masas descritas. El ovario derecho contiene una cavidad de 2.5 cms. de diámetro, con contenido seroso. El ovario izquierdo es sólido.\r\n\r\n\r\n', 'El endometrio muestra cambios avanzados de autólisis. Las masas descritas están compuestas por fibras musculares lisas dispuestas irregularmente en haces entrecruzadas y ovillos. Hay áreas de mayor celularidad con atípias moderadas y focos de degeneración hialina. No se identifican mitosis ni focos de necrosis. Las trompas son normales y el ovario derecho tiene una cavidad tapizada por elementos foliculares. El ovario izquierdo es normal.\r\n\r\n', ' Cuerpo uterino, trompas y ovarios (2600 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n-QUÍSTE FOLICULAR, ovario derecho\r\n-OVARIO IZQUIERDO', '', ''),
	(650, 'Q2105-2171', 'Q', '33358318', 'CARMEN ELENA CABARCAS YEPES', '3143884489', 'F', '36', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vagina" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.5 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido de granulación densamente infiltrado por leucocitos PMN neutrófilos, macrófagos y linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n\r\n\r\n', '', ''),
	(651, 'Q2105-2172', 'Q', '73352204', 'FERNANDO DE JESUS BARRAGAN SUAREZ', '3126314505', 'M', '44', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular, aspecto necrótico. Al corte se encuentra una luz irregular que contiene un material grumoso de color grisáceo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA', '', ''),
	(652, 'Q2105-2173', 'Q', 'VEN29809113', 'SCARLET MICHEL ARAPE NAVA', '3192597225', 'F', '20', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Teratoma" se recibe un fragmento de tejido de forma irregular de color pardo rosado y consistencia elástica que mide 3.5 x 3 x 2 cms. en sus mayores dimensiones, la superficie extrena es irregular y en ella se observan algunos pelos. Al corte se encuentran varias cavidades, algunas con contenido de aspecto sebáceo con múltiples pelos en la pared. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno compuesto por elementos tisulares derivados de diferentes capas germinales con predominio de piel y faneras.\r\n\r\n\r\n\r\n', '-TERATOMA QUÍSTICO MADURO (QUÍSTE DERMOIDE), ovario derecho', '', ''),
	(653, 'Q2105-2174', 'Q', '1048938681', 'JULIO CESAR UTRIA PAJARO', '000', 'M', '28', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 2.5 cms., la superficie externa es irregular cubierta por una serosa de color pardo grisáceo y al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(654, 'Q2105-2175', 'Q', '33139608', 'MARITZA BONOLIS JULIO', '3016471574', 'F', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor CARLOS REMOLINA', NULL, '2021-06-25', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Fragmento de pulmon" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.5 x 1.5 x 1 cms. en sus mayores dimensiones. Al corte se encuentra una superficie irregular con áreas muy friables. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Lesiones diafragmáticas" contiene un fragmento de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 1.8 x 1.2 x 0.8 cms. Al corte se encuentra una superficie blanquecina, homogenea. Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente, rotulado "Pleura parietal" contiene varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda, elástica cuyos diámetros oscilan entre 1 y 1.8 cms. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A, B y C muestran un tumor maligno compuesto por células escamosas pleomórficas con nucleos irregulares, hipercromáticos, con abundantes figuras de mitosis, que se disponen en un patrón sólido con abundantes figuras de mitosis.\r\n\r\n\r\n\r\n', '1.Biopsia de lesión en pulmón derecho:\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO\r\n2.Biopsia de lesiones diafragmáticas:\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO\r\n3.Biopsia de pleura parietal:\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO\r\n\r\n\r\nNOTA: Se retiran 7 bloques por el señor JAIRO ALFONSO LOPEZ BONOLIS CC. 9.099.043 (25 de junio/2021)', '', ''),
	(655, 'Q2105-2176', 'Q', '1143402050', 'JULIETH PAOLA DOMINGUEZ MEZA', '000', 'F', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.3 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida, de color pardo oscuro con membranas de aspecto purulento.  Al corte se encuentra una  luz dilatada que contiene un material grumoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(656, 'Q2105-2177', 'Q', 'VEN14896413', 'ESMERALDA COROMOTO GONZALEZ', '3003741893', 'F', '40', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesicula biliar fragmentada que mide 8.5 x 2.5 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por una serosa despulida de color grisáceo. Al corte la mucosa esta ligeramente aplanada de color pardo claro. Las paredes son gruesas de aspecto fibroso. En el mismo recipiente, se reciben múltiples calculos fascetados de color pardo oscuro con un nucleo de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(657, 'Q2105-2178', 'Q', '45515614', 'CLAUDIA PATRICIA CUESTA GARCES', '3174563079', 'F', '51', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-05-20', '2021-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesicula biliar fragmentada que mide 9 x 2.5 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por una serosa lisa y brillante. Al corte las paredes son gruesas, de aspecto fibroso, la mucosa  de color verde aterciopelado y en la luz se encuentran múltiples cálculos irregulares de color amarillentos con un diámetro promedio de 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(658, 'Q2105-2179', 'Q', '45428166', 'HERMELINDA JIMENEZ BAÑO', '3188713487', 'F', '62', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de lesión polipoide" se recibe un fragmento de tejido de forma irregular de color blanquecino y aspecto mucoide que promedian 1 cm. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n\r\n', '-POLIPO ENDOCERVICAL', '', ''),
	(659, 'Q2105-2180', 'Q', '22791636', 'RITA RAMOS BARBOSA', '3148107369', 'F', '87', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-27', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Tejido fibroso infiltrado por un tumor epitelial maligno constituidi por células de nucleos hipercromáticos, pleomórficos, algunos cin nucleolos prominentes dispuestos en nidos y cordones, hay figuras de mitosis atipicas.\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CARCINOMA ESCAMOCELULAR MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(660, 'Q2105-2181', 'Q', '1043646541', 'YOSELIN EVA CORREA SANTIAGO', '3006002750', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-05-26', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos en moderada cantidad, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(661, 'Q2105-2182', 'Q', '33121269', 'CARMEN SOFIA FONSECA CASTILLO', '3015511834', 'F', '74', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '2020205', '74106', 'Doctora BLANCA PEÑA ZAPATA', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un punch de piel que mide 0.2 cms. de color blanquecino. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso con hiperqueratosis, paraqueratosis, acantosis leve atipias de epitelio escamoso que descansa en un dermis infiltrado por linfocitos.\r\n\r\n\r\n\r\n\r\n', '-QUERATOSIS SOLAR TIPO HIPERTROFICO, piel de región frontal\r\n\r\n', '', ''),
	(662, 'Q2105-2183', 'Q', '73094516', 'JAFET GOMEZ IZQUIERDO', '3008535688', 'M', '60', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa gastrica antro corporal cuya lámina propia esta infiltrada por abundantes linfocitos y plasmocitos, se observa además, neutrófilos en moderada cantidad, algunos penetran el epitelio glanudlar, hay H.pylori en poca cantidad en la luz de algunas glandulas. En la muestra no se observa atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(663, 'Q2105-2184', 'Q', '45517449', 'ILSA ESTTID CASTRO BOHORQUEZ', '00', 'F', '46', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6  x 1 cms. La sereosa es opaca y despulida. Al corte la luz ocupada por un material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(664, 'Q2105-2185', 'Q', '45462601', 'VICTORIA ELENA BARRERA CORCHO', '3167320558', 'F', '56', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos en abundante cantidad, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(665, 'Q2105-2186', 'Q', '51827470', 'NOHORA ESPERANZA VILLAMIL PAEZ', '3004563452', 'F', '55', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(666, 'Q2105-2187', 'Q', '1140822289', 'SANTIAGO FADUL LAFAURIE', '3218136672', 'M', '32', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe uns fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide  0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa gástrica que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTO DE MUCOSA GASTRICA ANTRAL SIN CAMBIOS\r\n\r\n', '', ''),
	(667, 'Q2105-2188', 'Q', '23236192', 'NEYLA ROSA ARIZA CERA', '3014733760', 'F', '87', 'GASTROPACK SAS', 'PARTICULAR', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-26', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.1 cms. Se toma todo y se rotula B.\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan mucosa gastrica corporal con inflamación crónica leve.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA GASTRICA CORPORAL CON INFLAMACIÓN CRÓNICA LEVE\r\n\r\n', '', ''),
	(668, 'Q2105-2189', 'Q', '33123082', 'LUCIME SALGADO DE RODRIGUEZ', '3135851501', 'F', '75', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-31', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpro" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 y 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa gastrica oxintica en cuya lámina propia se observa un infiltrado inflamatorio crónico leve.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA GASTRICA OXÍNTICA CON INFLAMACIÓN CRÓNICA LEVE\r\n\r\n', '', ''),
	(669, 'Q2105-2190', 'Q', '45511531', 'DARSIS GOMEZ MEJIA', '000', 'F', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Dr. EDUARDO QUINTERO MARTINEZ', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa en región dorsal" se reciben varios fragmentos de tejido de color amarillento y aspecto fibroadiposo que mide el mayor 2.5 cms. y el menor de 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tumor benigno mesenquimal constituido por tejido adiposo maduro, que allterna con bandas de tejido fibroso.\r\n\r\n\r\n\r\n\r\n', '-FIBROLIPOMA, región dorsal izquierda', '', ''),
	(670, 'Q2105-2191', 'Q', '1238340755', 'LAURY VICTORIA QUINTERO MARTINEZ', 'C000', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-05-26', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.2 cms. Se toma todo y se rotula A.\r\n2 "Estómago" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 y 0.1 cms. Se toma todo y se rotula B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo y se rotula C.', 'Los cortes A revelan fragmento de mucosa esófagica sin cambios.\r\nLos cortes B revelan mucosa gastrica antro corporal en cuya lámina propia se observa un infiltrado inflamatorio crónico en moderada cantidad, se observa además PMN neutrófilos en poca cantidad, al igual la presencia de H.pylori en la luz de algunas glandulas.\r\nLos cortes C revelan duodeno que muestra la estructura usual.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE MUCOSA ESOFAGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n3.Biopsia endoscópica de duodeno:\r\n-FRAGMENTOS DE MUCSOA DUODENAL', '', ''),
	(671, 'Q2105-2192', 'Q', '8835059', 'BENITO ANASTACIO MEDINA VILLARREAL', 'C000', 'M', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctores JOSE RODRIGUEZ - CARLOS REMOLINA', NULL, '2021-06-04', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lóbulo inferior derecho" un segmento de lóbulo pulmonar, suturado en uno de sus extremos mide 4 x 1 cms. de color gris y consistencia elástica, la superficie externa muestra áreas sobreelevadas. Al corte muestra cavidades quisticas de diferentes tamaños. Se toman cortes y se rotulan A.\r\n2. "Lóbulo superior de pulmon derecho" un segmento de pulmon que mide 5  x 0.7 cms. de iguales características al anteriormente descrito. Al corte muestra una superficie de color oscuro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A y B revelan parenquima pulmonar con estructuras alveolares dilatadas con fragmentación de la pared. En otros cortes se observan cavidades de pequeño calibre tapizadas por epitelio respiratorio sin los componentes de la pared propia del bronquio. No se observa fibrosis intersticial ni cambios neoplásicos en la muestra.\r\n\r\n\r\n', ' Biopsia segmentaria de lóbulo inferior y superior del pulmon superior derecho.\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', 'Si se suministra información clinica y radiologica completa se hara revisión del caso.'),
	(672, 'Q2105-2193', 'Q', '1043648560', 'KEILER DUVAN MEJIA GONZALEZ', '3104372350', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mastectomía subcutanea izquierda" una masa redondeada de tejido que mide 2  x1.5 cms. de consistencia elástica. Al corte una superficie blanquecina con áreas de aspecto adiposo. Se toman cortes y se rotulan A.\r\n2. "Mastectomía subcutanea derecha" una masa de tejido redondeada que mide 1.3 x 1 cms. de iguales caracteristicas a la anteriormente descrita. Al corte una superficie lisa y blanqueicna. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A y B revelan tejido fibroadiposo que contiene canaliculos mamarios.\r\n\r\n', '1-GINECOMASTIA IZQUIERDA\r\n2-GINECOMASTIA DERECHA\r\n\r\n\r\n', '', ''),
	(673, 'Q2105-2194', 'Q', '1043636954', 'JONNY ARMANDO RUIZ MUÑOZ', '000', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE PRETELT MENDOZA', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nevo en cuero cabelludo" se recibe una elipse de piel de forma ovoide que mide 0.7 x 0.6 cms. de color blanquecino que trae en su superficie unos pelos.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral constituida por islotes celulares de tipo basofilicos y sombreados, rodeados de un estroma fibroso donde se observan células gigantes multinucleadas.\r\n\r\n\r\n\r\n', '-PILOMATRIXOMA, cuero cabelludo\r\n\r\n\r\n', '', ''),
	(674, 'Q2105-2195', 'Q', '1012332946', 'DILAN FELIPE MORENO SUAREZ', '00', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE ALBERTO LAMBIS RICARDO', NULL, '2021-05-24', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Testiculo derecho" se recibe un testiculo y elementos del cordon. El testiculo mide 3.3 x 2.5 x 1.9 cms. de color azúl oscuro y consistencia elástica. Al corte es de aspecto hemorrágico y apariencia granular. Se toman cortes.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan testiculo con áreas extensas de necrosis hemorrágica, la lesión compromete el epididimo.\r\n\r\n\r\n\r\n', '-TESTICULO DERECHO CON ÁREAS EXTENSAS DE NECROSIS HEMORRAGICA POR TORSIÓN', '', ''),
	(675, 'Q2105-2196', 'Q', '1007985736', 'MARIA JOSE PEREZ JULIO', '000', 'F', '22', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2021-05-26', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben varios fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que promedian 4 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido decidual con focos de necrosis, coágulos sanguineos y fragmentos de endometrio secretor.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE TEJIDO DECIDUAL CON FOCOS DE NECROSIS\r\n\r\n\r\n', '', ''),
	(676, 'Q2105-2197', 'Q', '1137525498', 'KELLY JHOANA LLERENA PACHECO', '000', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-05-26', '2021-05-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Fibroadenoma de mama izquierda" se recibe una masa de tejido de forma ovidea de color amarillento y consistencia elástica, nodular que mide 9 x 7.5 x 5 cms. Al corte una superficie multinodular de color pardo rosado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan una lesión tumoral benigna constituida por una proliferación de elementos glandulares y estromales.\r\n\r\n\r\n\r\n', '-FIBROADENOMA, mama izquierda\r\n\r\n', '', ''),
	(677, 'Q2105-2198', 'Q', '30764797', 'ANA LUCIA GUTIÉRREZ NUÑEZ', '00', 'F', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor SAMUEL CANTILLO', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero, trompas y ovarios" se recibe un utero con sus anexos que pesa 665 gms. El cervix se recibe por separado mide 2.2 x 4 cms. en sus mayores dimensiones y esta tapizado por una mucosa de color pardo claro que rodea un orificio externo puntiforme. El cuerpo esta marcadamente deformado por la presencia de masas subserosas, las trompas miden 8 y 7 cms. de longitud y ambas muestran en su meso estructuras quisticas, la derecha mide 7 cms. de diámetro y la izquierda de 3.5 cms. Los ovarios son externamente normales y miden ambos 2.5 cms. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa de color pardo claro que se desprende con facilidad. En el miometrio se encuentran múltiples masas esféricas de color blanquecino y aspecto fasciculado cuyos diámetros oscilan entre pocos milimetros y 5.5 cms. son de localización submucosa, intramural y subserosa. Se toman cortes del cuello y cuerpo y se rotulan A.\r\nEl anexo izquierdo contiene una masa quística de paredes delgadas de 3 cms. de diámetro mayor y contiene un material de aspecto gelatinoso. El ovario es sólido. Se toman cortes y se rotulan B.\r\nLa masa quistica de anexo derecho tiene paredes muy delgadas y un contenido seroso, el ovario es sólido.\r\n\r\n\r\n', 'El cervix presenta una reacción inflamatoria aguda y crónica. El endometrio está autólisado, las masas miometriales estan compuestas por fibras musclares lisas dispuestas irregularmente. Las trompas son normales. Las estructuras quísticas descritas están tapizadas por epitelio de tipo seroso, en algunas áreas aplanado. Los ovarios son normales.\r\n\r\n\r\n', ' Utero, trompas y ovarios (665 gms.).\r\n-CERVICITIS AGUDA Y CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n-CISTADENOMA SEROSO PARAOVÁRICO IZQUIERDO\r\n-CISTADENOMA SEROSO PARAOVÁRICO DERECHO\r\n-OVARIOS', '', ''),
	(678, 'Q2105-2199', 'Q', '19341970', 'JAHIR CASTRO VILLA', '3148006258', 'M', '31', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(679, 'Q2105-2200', 'Q', '1065632555', 'JANEIDIS JOHANA PALOMINO SAN MARTIN', '000', 'F', '29', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JOSE LUIS ACEVEDO MONRROY', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa derecha" un fragmento cilíndrico de tejido que mide 0.7 cms. de longitud. Se toman cortes y se rotulan A.\r\n2. "Trompa izquierda" un fragmento cilíndrico de tejido que mide 0.8 cms. de longitud. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA DERECHA. SEGMENTO\r\n2.TROMPA UTERINA IZQUIERDA. SEGMENTO', '', ''),
	(680, 'Q2105-2201', 'Q', '1137524674', 'ANDREA CAROLINA JHONNYS MALDONADO', '00', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(681, 'Q2105-2202', 'Q', '1043651084', 'LAURI ESTHER CARRILLO BATISTA', '3116538621', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida, irregular de color pardo claro con membranas de aspecto purulento. Al corte una luz ligeramente dilatada que contiene un material grumoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(682, 'Q2105-2203', 'Q', '1137541732', 'BRIANIS SOFIA JULIO SUAREZ', '3017627322', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" una amigdala palatina que mide 2.8 x 1.7 cms. La superficie externa de color pardo claro es irregular y al corte se encuentra una superficie de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amigdala izquierda" una amigdala palatina que mide 2.8 x 1.7 cms. La superficie externa de color pardo claro es irregular y al corte se encuentra una superficie de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de froma irregular de color pardo claro y consistencia elástica que mide 2.5 cms. en sus mayores dimensiones. Al corte se encuentra una superficie multilobulada de color pardo claro. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(683, 'Q2105-2204', 'Q', '1235041288', 'ZUMBI MIRANDA HERNANDEZ', '31725988885', 'M', '23', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(684, 'Q2105-2205', 'Q', '1043644183', 'KEVIN DE LA ROSA PALOMINO', '3136729467', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-05-28', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de piel hombro derecho" se recibe un punch de piel que mide 0.4 cms. de diamétro. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis muestra papilomatosis con hiperqueratosis y leve acantosis en los valles interpapilares que muestran, además, tapones de queratina.\r\n\r\n\r\n', ' Biopsia de piel del hombro izquierdo:\r\n-ACANTOSIS NIGRICANS', '', ''),
	(685, 'Q2105-2206', 'Q', '1042580164', 'LUISA FERNANDA GOMEZ COLON', '3226508204', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa de color pardo claro con vasos muy promientes. Al corte se encuentra una luz ligeramente dilatada que contiene un material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA', '', ''),
	(686, 'Q2105-2207', 'Q', '7921528', 'FREDY ULISES RODRIGUEZ LOPERA', '000', 'M', '42', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA SCHULTZ', NULL, '2021-07-01', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento alargado de tejido que mide 2 x 0.4 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n', 'Los cortes muestran conjuntiva en la que se observa una proliferación densa y difusa de células pequeñas, redondas, con escaso citoplasma. Hay presencia ocasional de macrófagos que fagocitan de tritus celulares.\r\n\r\nCOMENTARIOS : Los hallazgos descritos son altamente sugestivos pero no concluyentes de una NEOPLASIA LINFORETICULAR.\r\nEs necesario practicar estudios de inmunohistoquímica para una definición diagnóstica precisa.\r\n\r\n', ' Biopsia de lesión en conjuntiva de ojo izquierdo:\r\n-VEASE DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n\r\nNOTA: Se retiran 2 bloques por la señora MIRLEY PEREZ MEZA CC. 33.103.729 (1/jul/2021)', '', ''),
	(687, 'Q2105-2208', 'Q', '1137537466', 'YERLIS ALEJANDRA PEÑA CARABALLO', '000', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido, aplanado de color pardo claro y consistencia blanda que mide 0.2 cms. de diámetro. Se toma todo y se rotulan A.\r\n2. "Etomágo" dos fragmento de tejido, de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. de diámetro. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido, de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. de diámetro. Se toma todo y se rotulan C.', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya lámina propia está densamente infiltrada por linfocitos, con formación ocasional de folículos linfoides.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2. Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(688, 'Q2105-2209', 'Q', '11303970', 'LEONARDO GARAVITO GARCIA', '3157264954', 'M', '61', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido, de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. de diámetro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(689, 'Q2105-2210', 'Q', '17029360', 'JULIO MANUEL MORALES TORRES', '3157582674', 'M', '80', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido, de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. de diámetro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(690, 'Q2105-2211', 'Q', '1043318328', 'DANIEL FELIPE CEBALLOS MARRUGO', '000', 'M', '6', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido, de forma irregular de color pardo claro y consistencia blanda que promedian un diámetro de 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Antro"  dos fragmentos de tejido, de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. de diámetro. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido, de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. de diámetro. Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido, de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. de diámetro. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido, de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. de diámetro. Se toma todo y se rotulan E.', 'Los cortes rotulados A muestran  fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran mucosa gástrica antral dentro de los límites de la normalidad.\r\nLos cortes rotulados C muestran fragmentos de mucosa gastrica oxíntica.\r\nLos cortes rotulados D y E muestran mucosa duondenal cuya lámina propia se encuentra edematosa, congestiva y con densa infiltración linfoplasmocitaria. No se encuentran parasitos.\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de antro gastrico:\r\n-MUCOSA GÁSRICA ANTRAL\r\n3.Biopsia endoscópica de cuerpo gástrico:\r\n-MUCOSA GASTRICA OXÍNTICA\r\n4.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n5.Biopsia endoscópica de 2da. porción del duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(691, 'Q2105-2212', 'Q', '7927204', 'RAMIRO RAFAEL POTTE BARRETO', '000', 'M', '71', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA SCHULTZ', NULL, '2021-06-23', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento aplanado de tejido de color pardo claro con área central negruzca que mide 0.4 x 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran conjuntiva cuyo epitelio escamoso conserva su estructura usual. Reposa en un corion en el que se observa una proliferación de vasos capilares dispuestos irregularmente.\r\n\r\n', ' Resección de lesión en conjuntiva de ojo derecho:\r\n-HEMANGIOMA CAPILAR\r\n\r\n\r\n\r\nNOTA: Por solicitud de la cirujana, se revisa el caso y se reafirma el diagnóstico. No hay compromiso de los márgenes de resección.\r\n\r\n\r\n', '', ''),
	(692, 'L2105-87', 'L', '2789587', 'ALFONSO ENRIQUE FRANCO CAUSIL', '000', 'M', '81', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-05-26', '2021-05-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Líquido ascitico" se reciben dos placas con su extendido .\r\n\r\n\r\n\r\n', 'Los extendidos son gruesos y presentan defectos de fijación. En algunos campos se logra identificar un componente inflamatorio mediado por linfocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Extendido de líquido ascítico:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(693, 'L2105-88', 'L', '150690494', 'DYLAN ALEXANDER FERRER MARTINEZ', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-05-28', '2021-05-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "L.C.R." se recibe 3 ml de un líquido transparente. Se centrifuga y se hace un etendido del sedimento.\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n', ' Citología de líquido cefalorraquideo\r\n-EXTENDIDO ACELULAR', '', ''),
	(694, 'Q2105-2213', 'Q', '22801293', 'AMERICA CESAR BLANCO', '000', 'F', '53', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-31', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. Hay formación ocasional de acúmulos linfoides. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n\r\n', '', ''),
	(695, 'Q2105-2214', 'Q', '1050956481', 'PRISIS MARIA DEL VALLE DE LA BARRERA', '30005438511', 'F', '30', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-05-31', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un punch de piel que mide 0.4 cms. de color pardo grisáceo y presenta una lesión papilar Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel de la vulva que muestra hiperqueratosis, hipergranulosis, atipias coilociticas, el estroma con un infiltrado inflamatorio crónico leve.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n\r\n', '', ''),
	(696, 'Q2105-2215', 'Q', '1048609186', 'RAFAEL ANDRES CAMPILLO AICARDI', '3052943503', 'M', '24', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA SCHULTZ', NULL, '2021-06-03', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de forma irregular, uno de ellos de forma nodular de color grisáceo que mide 0.5 x 0.5 cms. Al corte una superficie lisa de color pardo oscuro. El otro fragmento mide 0.5 x 0.3 cms. de color pardo claro consistencia elástica. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido de granulación constituido por vasos pequeños de paredes delgadas congestivos que descnsan en un estroma edematoso e infiltrado pr linfocitos, plasmocitos y abundnates neutróiflos.\r\n\r\n\r\n\r\n', ' Resección de lesión en conjuntiva tarsal:\r\n-GRANULOMA PIOGENO\r\n\r\n\r\n', '', ''),
	(697, 'Q2105-2216', 'Q', '1143403994', 'LAURY PATRICIA COLLOGO MAURY', '6900434', 'F', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-05-31', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apendice cecal que mide 6 x 0.5 cms. tapizada por una serosa, opaca bien vascularizada de color pardo claro. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendice cecal:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(698, 'Q2105-2217', 'Q', '1066511376', 'JUAN CAMILO LUNA MARTINEZ', '3168135732', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JORGE ALBERTO LAMBIS RICARDO', NULL, '2021-05-31', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Testiculo izquierdo" se recibe un testiculo marcado con una serda larga, polo superior y una corte borde lateral que mide 5 x 5 x 3 cms. de color pardo grisáceo. Al corte hay salida de abundante material hemorrágico dejando ver una superficie de color pardo oscuro. Se toman cortes y se rotulan A polo superior, en el polo superior se observa un coágulo que mide 2.5 cms. Se toman cortes y se rotulan así: B polo inferior, C borde laterial, D conducto deferente.\r\n\r\n\r\n\r\n', 'Los cortes revelan testiculo que muestra necrosis hemorrágica que compromete todo el testiculo.\r\n\r\n\r\n\r\n\r\n', ' Orquidectomía izquierda:\r\n-NECROSIS HEMORRÁGICA POR TORSIÓN\r\n\r\n\r\n', '', ''),
	(699, 'Q2105-2218', 'Q', '1043986862', 'SIRLY JHOANA JULIO ACOSTA', '3113685252', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor HENRY ALONSO TORRES MONTES', NULL, '2021-06-21', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Curetaje femur derecho" se reciben múltiples espículas oseas, la mayor de las cuales miden 3 cms. Se toman cortes y se ponen a descalcificar.\r\n\r\n', 'Los cortes muestran espículas oseas irregulares, sin actividad osteoblástica que descansan en un estroma fibroso.\r\n\r\n\r\n', ' Curetaje de femur derecho:\r\n-COMPATIBLE CON DISPLASIA FIBROSA \r\n\r\n\r\n', '', 'Hacer correlación clínico-patológica'),
	(700, 'Q2105-2219', 'Q', '22948323', 'NANCY OLASCUAGA DE GUERRA', '000', 'F', '74', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctores JOSE RODRIGUEZ - CARLOS REMOLINA', NULL, '2021-07-09', '2021-05-31', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados se reciben:\r\n1. "Segmento pulmonar" dos fragmentos sin ninguna marcación, el mayor mide 2.5 x 2 cms. de color pardo oscuro. Al corte hay una formación nodular, blanquecina que mide 1 cm. el fragmento menor mide 0.8 x 0.8 cms. Se toman cortes y se rotulan A.\r\n2. "Pleura parietal" fragmento de tejido de forma irregular de color pardo grisáceo que mide 2 x 1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n\r\n', 'Los cortes A revelan pulmon comprometido por un tumor epitelial maligno constituido por estructuras acinares de células con nucleos vesiculares y abundante citoplasma. El tumor toca los bordes de resección.\r\nLos cortes B revelan pleura infiltrada por el tumor antes descrito.\r\n\r\n\r\n\r\n', '1.Segmento pulmonar de lobulo superior izquierdo:\r\n-ADENOCARCINOMA BIEN DIFERENCIADO, INFILTRANTE TIPO ACINAR\r\n-VOLUMEN TUMORAL 1 x 0.5 cms.\r\n-BORDES DE RESECCIÓN COMPROMETIDOS \r\n2.PLEURA PARIETAL COMPROMETIDA POR EL TUMOR\r\n\r\n\r\nNOTA: Se retiran 3 bloques por el señor VICTOR GUERRA OLASCUAGA CC. 8.850.104 (9 julio/2021)', '', ''),
	(701, 'Q2105-2220', 'Q', '1143351599', 'ELOISA TORRES BUSTAMANTE', '000', 'F', '30', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-05-31', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesicula bilair que mide 7 x 3 x 2 cms. tapizada paricualmete por una lesión de color pardo grisáceo. Al corte hay salida de material biliar y múltiples calculos de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS\r\n\r\n', '', ''),
	(702, 'Q2105-2221', 'Q', '73194073', 'RAFAEL ANTONIO TEHERAN SAAVEDRA', '3114080228', 'M', '38', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-06-10', '2021-05-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de higado" se recibe un fragmento de tejido que mide 1  x 0.5 cms. de color pardo amarillento. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmento de parenquima hepatico en el que se evaluan 10 espacios porta con un infiltrado inflamatorio mixto leve, actividad en la placa limitante fibrosis leves, los hepatocitos presenta estasis biliar leve. No se observa esteatosis, granulomas ni malignidad.\r\n\r\n\r\n\r\n', ' Biopsia hepatica:\r\n-HEPATITIS CRÓNICA ACTIVA (GRADO 1) Y FIBROSIS LEVE (ESTADO 1) (BATTS - LUDWIG)\r\n', '', ''),
	(703, 'Q2105-2222', 'Q', '1104871794', 'DAYANNA BARBOZA BELLIDO', '3206100337', 'F', '23', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-06-02', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Polipo gástrico" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa antrocorporal cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. No se observa H.pylori, actividad inflamatoria, cambios metaplasicos ni displásicos. No se encuentran cambios de pólipo.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(704, 'Q2105-2223', 'Q', '86048421', 'CARLOS ENRIQUE CRUZ MARROQUIN', '3106222315', 'M', '45', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-05-31', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(705, 'Q2105-2224', 'Q', '92532814', 'JAVIER FRANCISCO GRACIA MONTES', '3002772983', 'M', '42', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-05-31', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(706, 'Q2105-2225', 'Q', '73196179', 'ALEJANDRO RAFAEL PUELLO GONZALEZ', '3106135761', 'M', '38', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-05-31', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(707, 'Q2105-2226', 'Q', '63557906', 'IVONNE NATALIA ORDOÑEZ PUENTES', '3106507713', 'F', '36', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-05-31', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en sus mayores dimensiones. Se toma todo\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(708, 'Q2105-2227', 'Q', '1047470755', 'MARYISELA VALDES MIRANDA', '000', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora JENNIFER TORRES GOMEZ', NULL, '2021-06-16', '2021-05-31', 'VIRNA CARABALLO OSORIO', '\r\nRotulado "Placenta" se recibe una placenta con un segmento de cordon que pesa 158 gms. y mide 13 x 11.5 x 1.5 cms. La cara fetal está cubierta por una serosa lisa y brillante y trae adherido un segmento de cordón umbilical de implantación central en el que se identifican tres vasos sanguíneos, la cara materna tiene aspecto mamelonado, es de color pardo rosado. Al corte se observa una superficie de color pardo claro finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta compuesta por vellosidades coriales tapizadas por cito y sinciotrofoblasto sin alteraciones. No se observan cambios inflamatorios ni neoplásicos.\r\n\r\n', '-PLACENTA DE SEGUNDO TRIMESTRE ( 158 GMS.).\r\n\r\n\r\n\r\n', '', ''),
	(709, 'Q2105-2228', 'Q', '1047506376', 'TALIANIS MARSIGLIA JIMENEZ', '3005635962', 'F', '22', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-06-21', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Placenta" se recibe una placenta con sus membranas y un segmento de cordon umbilical que pesa 377 gms. y mide 13 x 12 x 3.5 cms. La cara fetal esta cubierta por una serosa lida y brillante, trae un segmento de cordon umbilical que mide 26 cms. en que solo se identifican dos vasos sanguineos dilatados y congestivos. La cara materna esta recubierta por ls membranas de aspecto irregular de color violáceo. Al corte una superfiice de color violáceo finamente granular. Se toman cortes.\r\n', 'los cortes muestran placenta compuesta por vellosidades tapizadas por cito y sinciotrofoblasto sin alteraciones. Hay marcada congestión y dilatación de los vasos del mesenquima. Se observan múltiples infartos focales. No se observan cambios inflamatorios ni neoplásicos.\r\n\r\n\r\n', '-PLACENTA DEL TERCER TRIMESTRE (377 GRAMOS).\r\n\r\n\r\n\r\n', '', ''),
	(710, 'Q2105-2229', 'Q', '23228482', 'ROSA ARNEDO LARA', '3114240257', 'F', '88', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HENRY ALONSO TORRES MONTES', NULL, '2021-06-02', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Colon sigmoides" se recibe un segmento de colon que mide 57 x 7.0 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa lida y brillante y por apendices epiploicos. El segmento de colon se encuentra fusionado por un área de fibrosis cercano a las líneas de resección. El tumor separa un segmento marcadamente dilatado de un segmento de 10 cms. y aspecto tubular. Al corte hay salida de abundante material fecal a 7 cms. de una línea de resección la mucosa muestra un área sobreelevada, de aspecto sesil que mide 1.2 x 1 cms. en sus mayores dimensiones y se encuentra en el área de fusión. El resto de la mucosa conserva el aspecto habitual hasta el segmento fusionado donde se encuentra una masa de aspecto tumoral, de color pardo rosado y consistencia blanda que mide 5.5 x 3.5 x 4 cms. La masa obstruye la luz completamente y se encuentra relacionado con el área de fibrosis descrita y se localiza a 6 cms. del margen de resección. Se diseca la grasa pericolica y no se obtienen ganglios. Se toman cortes y se rotulan así: A masa tumoral, B lesión mucosa relacionada al área de fibrosis, C líneas de resección.\r\n', 'Los cortes rotulados A muestran un tumor epitelial maligno compuesto por células pleomórficas con núcleos hipercromáticos que se disponen formando estructuras glanduliformes y nidos sólidos que infiltran la pared colónica sobrepasando la serosa e infiltrando la pared de otro segmento de colon ocasionando una fusión de los mismos.\r\nLos cortes rotulados B muestran pared colónica infiltrada por el tumor antes mencionado.\r\nLos cortes rotulados C muestran muestran las líneas de resección, libres de tumor.\r\n\r\n', ' Hemicolectomía izquierda:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE CON COMPROMISO DE TODO EL ESPESOR DE LA PARED SOBREPASANDO LA SEROSA\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(711, 'Q2105-2230', 'Q', '1048467126', 'EMMA VARGAS BARRIOS', '3003142789', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-05-31', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se recibe fragmento de tejido de forma irregular de color pardo rosado y consistencia elástica que mide 2.3 x 1.5 x 0.8 cms. La superficie externa es irregular y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n', '', ''),
	(712, 'Q2105-2231', 'Q', '1047456357', 'EDUARDO DE JESUS MORELOS PINEDO', '3135804021', 'M', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF VEGA', NULL, '2021-05-31', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(713, 'Q2105-2232', 'Q', '1043309974', 'JEREMY MARTINEZ DE ALBA', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-05-31', '2021-05-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(714, 'L2105-89', 'L', '888013', 'JUVENAL ROMERO MENDOZA', '3004092773', 'M', '85', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JOSE RODRIGUEZ', NULL, '2021-06-01', '2021-05-31', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se reciben 6 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido esta representado por muy esasas células inflamatorias, en su mayoría linfocitos. No se observan células neoplasicas en la muestra.\r\n\r\n\r\n\r\n', ' Citología de líquido pleural:\r\n-EXTENDIDO INFLAMATORIO\r\n-VER DESCRIPCIÓN MICROSCÓPICA ', '', ''),
	(715, 'Q2106-2233', 'Q', '45442564', 'MAGALY VALDELAMAR AGAMEZ', '3046811994', 'F', '64', 'PARTICULAR', '', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(716, 'Q2106-2234', 'Q', '3797653', 'ARMANDO AGUILAR FRANCO', '3024171749', 'M', '81', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA SCHULTZ', NULL, '2021-06-21', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un fragmento de tejido redondeado de 0.4 x 0.4 cms. Se demarcan los bordes con tinta. Se toma todo.\r\n\r\n', 'Los cortes muestran conjuntiva cuyo epitelio escamoso se encuentra ligeramente aplanado y reposa en un corión que contiene acúmulos de  histiocitos y linfocitos que conforman estructuras granulomatosas rodeadas por numerosos vasos capilares congestionados. Se observa además la pared de estructura de aspecto quistíco tapizado por epitelio aplanado. \r\n\r\nOBSERVACIONES:En la muestra no se observa cambios neoplásicos.\r\n', ' Biopsia de lesión conjuntiva ojo derecho:\r\n-VEASE DESCRIPCION MICROSCÓPICA\r\n-VER OBSERVACIONES.\r\n\r\n\r\n', '', 'Este caso fue visto en junta de patólogos con los doctores José Caraballo y Olivia Marrugo y hubo consenso.\r\n\r\n\r\n\r\n\r\n'),
	(717, 'Q2106-2235', 'Q', '52978723', 'VIVIANA PACHON CORDOBA', '3102069604', 'F', '37', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(718, 'Q2106-2236', 'Q', '73138737', 'ROBER ENRRIQUE HERNANDEZ BARRERA', '3107108252', 'M', '52', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Cuerpo" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 x 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). \r\nLos cortes B revelan mucosa oxíntica con actividad inflamatoria leve.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n2.Biopsia endsocópica de estóamgo (cuerpo):\r\n-MUCOSA GASTRICA OXÍNTICA CON ACTIVIDAD INFLAMATORIA CRÓNICA LEVE\r\n', '', ''),
	(719, 'Q2106-2237', 'Q', '9237326', 'WILIAN CARLOS MIRANDA JIMENEZ', '3002954077', 'M', '41', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que  0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos y plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(720, 'Q2106-2238', 'Q', '45434473', 'ANA RAQUEL CASTELLON ALMEIDA', '3103535201', 'F', '60', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben cinco fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos. \r\nOtros cortes muestran fragmentos de mucosa gastrica corporal que conserva la estructura usual.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-PÓLIPO DE GLÁNDULAS FÚNDICAS\r\n2.Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GASTRICA CORPORAL SIN CAMBIOS', '', ''),
	(721, 'Q2106-2239', 'Q', '1047457832', 'ESTIBENSON BARRAZA ARENAS', '3145529524', 'M', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA', NULL, '2021-06-03', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Polipo de colon" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas de tipo colónico  con atipias citológicas moderadas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-ADENOMA TUBULAR CON DISPLASIA MODERADA, fragmentos', '', ''),
	(722, 'Q2106-2240', 'Q', '1047466973', 'CATERINE WILXCOX DIAZ', '000', 'F', '27', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Dcotor CARBALLO - EMILIO CHAVEZ', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben varios fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que juntos promedian 3 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-RESTOS OVULARES\r\n\r\n', '', ''),
	(723, 'Q2106-2241', 'Q', '1043969277', 'HELLEN CASANOVA PITALUA', '3024066586', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-08', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 12 cms. la serosa es de color pardo claro y congestiva. Al corte la luz ocupada por material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal que muestra foliculos hiperplasicos en la submucosa, la capa muscular no muestra infiltrado inflamatorio a nivel de la serosa, se observa edema, congestión vascular e infiltración por neutrófilos.\r\n\r\n\r\n\r\n', '-PERIAPENDICITIS AGUDA\r\n\r\n', '', ''),
	(724, 'Q2106-2242', 'Q', '1050742015', 'JESUS DANIEL BELLO ZAMBRANO', '3002328873', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda el mayor mide 1 cm. Al corte una superficie de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(725, 'Q2106-2243', 'Q', '1105394217', 'JANDY RAFAEL GARAY LUNA', '3164434993', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es opaca y despulida. Al corte la luz ocupada por un matereial blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(726, 'Q2106-2244', 'Q', '1142940587', 'MARY PAZ MONTENEGRO CASTELLON', '3043925100', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que 1.5 x 1 cms. Al corte una superficie multinodular, blanquecina. Se toma todo.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(727, 'Q2106-2245', 'Q', '1137527683', 'CANDY LUCIA RICARDO CAMPO', '3016319982', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-04', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tejido blando hombro derecho" se recibe un fragmento de tejido de forma alargada de color pardo claro y consistencia elástica que mide 2 x 0.5 cms. Al corte salida de un material amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cavidad que contiene material necrótico rodeado por una reacción inflamatoria crónica que contiene macrófagos cargados de grasa. No se observan cambios neoplasicos, se recomienda correlación clinico-patologica.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en tejido blando, hombro derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(728, 'Q2106-2246', 'Q', '1043323164', 'JESUS MANUEL CAICEDO VERA', '3205647365', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" masa de tejido de forma ovoidea, de cosistencia elástica que mide 3 x 2 cms. Al corte una superficie blanquecina, nodular. Se toman cortes y se rotulan A.\r\n2. "Amigdala izquierda" masa de tejido de forma ovoidea, de cosistencia elástica que mide 3 x 2.2 cms. Al corte una superficie blanquecina, nodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(729, 'Q2106-2247', 'Q', '1007517718', 'CAROLAI PAOLA MOLINA GIL', '3136177902', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-06-03', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Asa de intestino delgado" se recibe fragmento de tejido adiposo de color amarillento que mide 2 x 1 cms. y muestra lesiones puntiformes de color blanquecino. Al corte una superficie de aspecto adiposo de color amarillento.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido adiposo maduro con focos de necrosis e inflamación aguda.\r\n\r\n\r\n\r\n', '-TEJIDO ADIPOSO CON FOCOS DE NECROSIS E INFLAMACIÓN AGUDA', '', ''),
	(730, 'Q2106-2248', 'Q', '1143394653', 'SANDY PATRICIA YEPES HERNANDEZ', '3014428031', 'F', '24', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Trompa de Falopio izquierda + embarazo ectopico" se recibe un segmento de trompa de Falopio que mide 4 x 1.5 cms. de color pardo oscuro. Al corte su luz esta dilatada y muestra un contenido de aspecto membranoso, blanquecino.\r\nAcompañando a esto, se reciben tres fragmentos de tejido de color oscuro, aspecto sanguinolento que promedian 2 y 1 cms. Se toman cortes.\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n\r\n', '-EMBARAZO TUBARICO IZQUIERDO\r\n\r\n\r\n', '', ''),
	(731, 'Q2106-2249', 'Q', '1235040596', 'JOSSEPH ANDRES CABEZA LOPEZ', '000', 'M', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF VEGA', NULL, '2021-06-02', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es opaca, despulida y tapizada por material fibrinopuruelnto. Al corte la luz esta permeable y contiene escaso material amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA', '', ''),
	(732, 'Q2106-2250', 'Q', 'VEN18422944', 'YULVIC CAROLINA ROJAS RODRIGUEZ', '3002344360', 'F', '33', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-06-03', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste de ovario izquierdo" se recibe una masa de tejido de aspecto quistico que mide 13 x 10 x 3 cms. de color blanco azulado ricamente vascularizado. Al corte hay salida de un líquido de aspecto mucoide dejando ver una cavidad quistica vilocular de paredes delgadas, lisas de color rosado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan pared de un quíste tapizado por epitelio mucoproductor.\r\n\r\n\r\n\r\n', '-CISTADENOMA MUCINOSO, ovario izquierdo', '', ''),
	(733, 'Q2106-2251', 'Q', '1063965127', 'DELIA MARIA GARCIA LOPEZ', '3168094915', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-06-04', '2021-06-01', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Utero + trompas" se recibe utero sin anexos que pesa 610 gms. y mide 12.5 x 13 x 8 cms. aumentado globalmente de tamaño, la serosa es de color pardo orsado. No se visualizan las trompas de Falopio, la consistencia es blanda. Al corte la cavidad endometrial se encuentra dilatada y aspecto hemorrágico se observan algunos coágulos sanguineos, el espesor del miometrio es de 4 cm. en su mayor dimensión. Se toman cortes.\r\n\r\n\r\n', 'La cavidad endometrial esta tapizada por tejido decidual y coágulos sanguineos. El miometrio es de caracteristicas gestacionales sin infiltración sanguinea.\r\n\r\n\r\n', ' Cuerpo uterino:\r\n-ESTADO POST-CESAREA\r\n-TEJIDO DECIDUAL CON ABUNDANTES COÁGULOS SANGUINEOS\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(734, 'L2106-90', 'L', '1051887189', 'GUSTAVO ADONFO RODRIGUEZ HERRERA', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-06-02', '2021-06-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "L.C.R" se reciben 4 ml. de un líquido transparente. Se centifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquideo:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(735, 'Q2106-2252', 'Q', '45688888', 'GLADYS ARROYO RIVERA', '3145611858', 'F', '42', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 0.4 y 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con acantosis irregular, papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(736, 'Q2106-2253', 'Q', '1050038184', 'VANESSA JOSE TORRES ORTEGA', '3022736178', 'F', '28', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica, focos de metaplasia escamosa y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITS CRÓNICA CON METAPLASIA ESCAMOSA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n\r\n\r\n', '', ''),
	(737, 'Q2106-2254', 'Q', '41243548', 'ANA LUCIA RAMIREZ MOYA', '000', 'F', '36', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', '', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gastrico" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(738, 'Q2106-2255', 'Q', '34986809', 'ANA ELVIRA GOMEZ HERNANDEZ', '3023791350', 'F', '56', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor BETTY MORALES', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo yse rotulan A.\r\n2. "Bulbo" cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Segunda porción del duodeno" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimesnión. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal cuya morfología está preservada. La lámina propia esta ligeramente edematosa, congestiva e infiltrada por linfocitos. No se observa acortamiento de las vellosidades, hiperplasia de las criptas, parasitos, granulomas ni cambios displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal que conserva la morfología habitual. No se observan parasitos, granulomas ni cambios displásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de duodeno (bulbo):\r\n-DUODENITIS CRÓNICA\r\n3.Biopsia endoscópica de duodeno (2da. porción del duodeno):\r\n-MUCOSA DUODENAL NORMAL', '', ''),
	(739, 'Q2106-2256', 'Q', '164701310', 'HIJO DE ALEXANDRA SAMPAYO VILLERO', '3045552481', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mucosa aritenoide derecha" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Mucosa aritenoide izquierda" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran epitelio escamoso que reposa en un corion edematoso, moderadamente vascularizado e infiltrado por linfocitos.\r\n\r\n\r\n', '1.Resección de mucosa aritenoide derecha:\r\n-INFLAMACIÓN CRÓNICA\r\n2.Resección de mucosa aritenoide izquierda:\r\n-INFLAMACIÓN CRÓNICA', '', ''),
	(740, 'Q2106-2257', 'Q', '1201241940', 'SHAYRA MILENA LEUNG LEON', '3017323352', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora JESSICA TIPON GALVIS', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mucosa en labio inferior" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.9 x 0.4 cms. en sus mayores dimensiones. Al corte se observa una superficie de color pardo oscuro que alternan con áreas de color pardo claro. Se toma todo en dos cortes.\r\n\r\n\r\n', 'Los cortes muestran una estructura cavitada sin epitelio de revestimiento rodeado por una reacción inflamatoria crónica.\r\n\r\n\r\n\r\n', ' Resección de lesión en labio inferior:\r\n-MUCOCELE\r\n\r\n', '', ''),
	(741, 'Q2106-2258', 'Q', '1201283015', 'ANGEL GABRIEL LOBO MORENO', '3044670062', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-16', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fistula branquial" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.1  x 0.7 cms. en sus mayores dimensiones. Al corte se observa una superficie de color pardo claro de aspecto homogéneo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran un tejido fibroadiposo con islas de cartílago hielino y un trayecto fistuloso sin epitelio de revestimiento.\r\n\r\n\r\n', ' Resección de lesión en región cervical izquierda:\r\n-COMPATIBLE CON FÍSTULA BRANQUIAL.\r\n\r\n\r\n', '', 'Se recomienda realizar correlación clinico-patológica.\r\n\r\n\r\n\r\n'),
	(742, 'Q2106-2259', 'Q', '1080650908', 'VALERIA ISABEL RIVAS ORTEGA', '3127294134', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO - ROSSANA FORTICH GONZALEZ', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa antrocorporal que conserva la morfología habitual. La lámina propia está edematosa, congestiva e infiltrada por linfocitos. No se observan H.pylori, actividad inflamatoria, cambios metaplasicos ni displasicos.\r\nLos cortes rotulados B muestran mucosa duodenal que conserva la morfología usual. No se observan parasitos, granulomas ni cambios displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL NORMAL\r\n\r\n', '', ''),
	(743, 'Q2106-2260', 'Q', 'VEN3471893', 'SAMUEL ALEJANDRO TOVAR PINILLO', '3105243785', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JORGE ALBERTO LAMBIS RICARDO', NULL, '2021-06-04', '2021-06-04', 'VIRNA CARABALLO OSORIO', 'Rotulado "Testiculo derecho" se recibe un testiculo con sus elementos del cordon que miden 4.3 x 3.3 x 2.8 cms. de color pardo oscuro con áreas violáceas y consistencia renitente, la superficie externa esta cubierta por una serosa lisa y brillante. Al corte se observa una superficie de color violáceo finamente granular que compromete el testiculo y se extiende hasta el epididimo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los múltiples cortes muestran testiculo con áreas extensas de necrosis y hemorrágia.\r\n\r\n\r\n\r\n', ' Orquiectomía derecha:\r\n-TESTICULO CON NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN', '', ''),
	(744, 'Q2106-2261', 'Q', '1047415955', 'CRISTIAN MAURICIO RICO MERCADO', '3114264183', 'M', '31', 'GASTROPACK SAS', 'PARTICULAR', '2020304', '23495', 'Doctor ISMAEL YEPES', NULL, '2021-06-09', '2021-06-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Neo de colon" se reciben cuatro fragmentos de tejido de forma irregular de color pardo oscuro y consistencia blanda que mide el mayor 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan áreas extensas de necrosis, acompañado de células inflamatorias y células sueltas de núcleos irregulares, pleomórficas sugestivas de un proceso neoplásico.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(745, 'Q2106-2262', 'Q', '45692140', 'MARIA JOSE PASSOS CARRILLO', '3145681657', 'F', '44', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-06-08', '2021-06-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos en abundante cantidad, plasmocitos en abundante y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(746, 'Q2106-2263', 'Q', '930950', 'OSCAR ALBERTO PARDO MARTINEZ', '3135072771', 'M', '82', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-06-08', '2021-06-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Esófago superior" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan un tumor maligno epitelial constituido por células de nucleos grandes hipercromáticos, algunos con nucleolos prominentes que se disponen en nidos sólidos e infiltran el estroma, hay focos de necrosis.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de esófago superior:\r\n-CARCINOMA ESCAMOCELULAR MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(747, 'Q2106-2264', 'Q', '22522733', 'JULIA ESTHER IBAÑEZ CHARRIS', '000', 'F', '42', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctor ELKIN ROMERO CAMARGO', NULL, '2021-06-08', '2021-06-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Polipo de fondo gastrico" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-POLIPO DE GLANDULAS FÚNDICAS\r\n\r\n\r\n', '', ''),
	(748, 'Q2106-2265', 'Q', '30772659', 'ELSA LOPEZ LLORENTE', '3004623312', 'F', '55', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-06-08', '2021-06-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(749, 'Q2106-2266', 'Q', '45431775', 'ZAIDA GUZMAN MONDOL', '3012014858', 'F', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-08', '2021-06-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(750, 'Q2106-2267', 'Q', '73110850', 'TAYRONE LUIS RODRIGUEZ ORTEGA', '3167555587', 'M', '56', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-08', '2021-06-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos en abundante cantidad, plasmocitos en abundante cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(751, 'Q2106-2268', 'Q', '52041273', 'ANA FORTICH DE SIERRA', '3178456399', 'F', '56', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-21', '2021-06-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color blanco grisáceo y consistencia blanda que mide 0.1 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis presenta foco de acantosis constotuida por elongación de múltiples clavos interpapilares con marcada pigmentación del estrato basal. En la dermis hay folículos dilatados, fibrosis y un infiltrado mononuclear perivascular.\r\n\r\nCOMENTARIO: Los hallazgos son sugestivos de una pigmentación post-inflamatoria.\r\n\r\n', ' Biopsia de vulva:\r\n-VER DESCRIPCION MICROSCOPICA Y COMENTARIO.\r\n\r\n\r\n\r\n', '', ''),
	(752, 'Q2106-2269', 'Q', '22793288', 'MAIDA HERNANDEZ VILLERO', '6672621', 'F', '62', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que juntos miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(753, 'Q2106-2270', 'Q', '1016079088', 'JESUS DARIO GARCIA NIEVES', '3117013502', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 1.5 cms. esta recubierta por material seropurulento, hacia la punta se observa material necrótico. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
