	(755, 'Q2106-2272', 'Q', 'VEN290847', 'MARIA ALEJANDRA DIAZ RENGEL', '3242068807', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-12', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. esta recubierta por material seropurulento. Al corte la pared esta engrosada y el lumen contiene material de aspecto blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(756, 'Q2106-2273', 'Q', '45516660', 'CLAUDIA PATRICIA BARON PEREZ', '3106116330', 'F', '46', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que juntos miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(757, 'Q2106-2274', 'Q', '1043649349', 'DAILIN PAOLA DELANOIS SEÑA', '3126964642', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-21', '2021-06-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fibroadenoma, mama izquierda" se recibe fragmento de tejido de forma irregular de color blanquecino y amarillento de consistencia elástica que mide 1.5 x 0.6 cms. Al corte tejido homogeneo de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de tejido fibroescleroso que contiene escasos elementos de tejido mamario. \r\n\r\n', ' Rección de lesión en mama izquierda:\r\n-ESCLEROSIS MAMARIA\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n', '', ''),
	(758, 'Q2106-2275', 'Q', '1142929592', 'ESTEBAN ALFONSO MORALES MORALES', '3145211206', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. de color blanquecino. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado. Acompañado a esto un fragmento de tejido compuesto por tejido graso y tejido fibroso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(759, 'Q2106-2276', 'Q', '166529560', 'HIJA DE IRINA DEL ROSARIO ESCUDERO SABOGAL', '3022881599', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 3.5 x 0.4 cms. de color grisáceo y consistencia elástica. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA', '', ''),
	(760, 'Q2106-2277', 'Q', '1043322316', 'JUAN PABLO BEDOYA PINEDA', '3103536371', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PERLA VILLAMOR ROJAS', NULL, '2021-06-24', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Granuloma supraestomal" se recibe un fragmento de tejido de color grisáceo y consistencia elástica que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido de granulación densamente infiltrado por linfocitos, células plasmáticas y neutrófilos. No se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión supraestomal:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n\r\n\r\n\r\n', '', ''),
	(761, 'Q2106-2278', 'Q', '1043634178', 'MARIA JOSE SANCHEZ SAMPAYO', '3158037796', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.7 cms. Los vasos sanguíneos estan ingurgitados. Al corte la pared esta algo engrosada y el lumen contiene material fecal solidificado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(762, 'Q2106-2279', 'Q', '166235886', 'HIJA DE ENILEY DIAZ MARTINEZ', '3104220304', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-24', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'En recipientes separados y rotulados, se reciben:\r\n1. "Intestino delgado" tres fragmentos de tejido el mayor de los cuales mide 22 x 1 cms. Los otros fragmentos miden 6 x 1 y 5 x 1 cms. Al corte la pared esta engrosada y el lumen contiene un material de color grisáceo y en las paredes se observa un material de aspecto purulento. Se toman cortes y se rotulan A.\r\n2. "Ileon proximal con sututa" un segmento de intestino que mide 6 x 2 cms. de color grisáceo, se observa una solución de continuidad que mide 2 x 1 cms. cerca del segmento que viene marcado con seda. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran pared de intestino delgado cuya mucosa esta preservagda, hay una zona de inflamación aguda y crónica que compromete de la submucosa hasta el estrato muscular.\r\nLos cortes rotulados B muestran pared de intestino delgado con zona de perdida de la continuidad reemplazada por zona de aspecto necrótico con inflaación aguda.\r\n\r\n\r\n', '1.SEGMENTO DE INTETSINO DELGADO CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n2.SEGMENTO DE INTESTINO DELGADO CON INFLAMACIÓN AGUDA Y ZONA DE PERFORACIÓN', '', ''),
	(763, 'Q2106-2280', 'Q', '1051890161', 'ANDRES FELIPE CARABALLO FRANCO', '3045646257', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. los vasos sanguíneos se encuentran ingurgitados y hacia la punta de color negruzco. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(764, 'Q2106-2281', 'Q', 'VEN33160921', 'OCTAVIO GABRIEL LOPEZ MORALES', '3206432879', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. Los vasos sanguineos estan ingurgitados. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(765, 'Q2106-2282', 'Q', '1043654225', 'JOSE LUIS GONZALEZ FERREIRA', '3007037962', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor WILLIAN URIBE LUNA', NULL, '2021-06-24', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Femur izquierdo" se recibe  cinco fragmentos oseos de color amarillento y algunos con coágulos sanguineos que juntos hacen 3 x 2 x 1 cms. Se toman cortes y se ponen a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de espículas oseas desvitalizadas que reposan en un estroma reticular que contiene leucocitos polimorfo nucleares neutrófilos. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de lesión en femur izquierdo:\r\n-OSTEOMIELITIS CRÓNICA', '', ''),
	(766, 'Q2106-2283', 'Q', '1043636063', 'LILIA ANDREA GARCIA MORELO', '3243370449', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. Los vasos sanguineos estan ingurgitados. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(767, 'Q2106-2284', 'Q', '1048438485', 'ANDRES CUADRO ZAMBRANO', '3135675759', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-24', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1.5 cms. esta recubierta por material seropurulento y en algunos sitios es de color negruzco, hemorrágico. Al corte la pared esta engrosada y el lumen contiene material fecal solidificado. Acompañado por un material compuesto por grasa y tejido fibroso que mide 12 x 4.5 cms. Al corte se observa un trayecto que continua un material amarillento de aspecto purulento. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared, se observa además, un fragmento de tejido fibroadiposo con inflamación aguda.\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n-FRAGMENTO DE EPIPLON CON INFLAMACIÓN AGUDA', '', ''),
	(768, 'Q2106-2285', 'Q', '1051443281', 'IVAN ANDRES CORDOBA SALAS', '322523630', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se reciben dos fragmentos de tejido de forma tubular que juntos miden 8 x 1.5 cms. y en algunos sitios esta recubierta por material seropurulento. Al corte la pared esta engrosada y el lumen contiene un material solidificado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(769, 'Q2106-2286', 'Q', 'VEN998', 'ASHLEY VALENTINA HERNANDEZ RAMIREZ', '3014640288', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 0.8 cms. Los vasos sanguíneos estan ingurgitados. Al corte la pared esta engrosada y se observa un material de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(770, 'Q2106-2287', 'Q', '1049825416', 'SHIRLEY MATOS BALLESTAS', '31271655641', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-11', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.8 cms. Los vasos sanguineos estan ingurgitados. Al corte la pared esta engrosada y el lumen contiene material de color amarillo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(771, 'Q2106-2288', 'Q', '1042582292', 'JONATHAN ANDRES JIMENEZ ESPITIA', '3116229016', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-06-24', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice + Epiplon" se recibe un apéndice cecal que mide 6 x 1.3 cms. presenta dos soluciones de continuidad que miden 1 x 1 y 0.5 x 0.5 cms. esta parcialmente recubierta por material de aspecto hemorrágico. Al corte la pared esta recubierta por material seropurulento y se observa en algunos sitios recubierta por un material amarillo y aspecto purulento. \r\nAcompañado a esto un fragmento de epiplon de color amarillento, grisáceo hay una solución de continuidad que mide 4 x 2 cms. y en algunos sitios contiene material purulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nOtros cortes muestran fragmentos de epiplon con inflamación aguda.\r\n\r\n\r\n\r\n', '1.APENDICITIS AGUDA PERFORADA\r\n2.FRAGMENTOS DE EPIPLON CON INFLAMACIÓN AGUDA', '', ''),
	(772, 'Q2106-2289', 'Q', '45748401', 'NILA JOSEFA TORRES VERGARA', '3106832015', 'F', '50', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-16', '2021-06-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de color blanquecino y grisáceo que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran piel cuyo epitelio escamoso está engrosado a expensas de una acantosis irregular. En la superficie hay focos de hipergranulosis. No se encunetran coilocitos.\r\n\r\n', ' Resección de lesión en vúlva:\r\n-PAPILOMA ESCAMOSO\r\n\r\n\r\n', '', ''),
	(773, 'Q2106-2290', 'Q', '1007126610', 'MARIA JOSE PADILLA VASQUEZ', '3024050848', 'F', '20', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-06-24', '2021-06-10', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Placenta" se recibe una placenta que pesa 120 gms. y mide 14 x 6 x 3.5 cms. en sus mayores dimensiones. La cara fetal está cubierta por una membrana lisa y brillante. Trae un segmento de cordón de 1 cm. de longitud en el que se identifican dos vasos. La cara materna contiene múltiples cotiledones. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta del 2do. trimestre cuyas vellosidades están tapizadas por cito y sinciciotrofoblasto sin alteraciones. Hay discreto edema y congestión del mesenquima. El espacio intervelloso está completamente exangüe.\r\n\r\n\r\n\r\n ', ' Placenta del 2do. trimestre (120 gms.):\r\n-CAMBIOS COMPATIBLES CON DEFECTO DE PERFUSIÓN MATERNOFETAL\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(774, 'Q2106-2291', 'Q', '1042579427', 'ISAAC DANIEL GARCIA SARMIENTO', '3137946752', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', '', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Testiculo  izquierdo" se recibe el producto de una orquiectomía que mide 4 x 2.5 x 3 cms. del testiculo y 4 x 1 x 1 cms. el epididimo, trae un segmento de cordon espermatico de 5 cms. de longitud. El testiculo de color violáceo con una superficie lisa y brillante, consistencia firme. Al corte se encuentra una de aspecto hemorrágico de color rojo oscuro. Al ocrte del epididimo se encuentran cambios similares. Se toman cortes que incluyen cortes del cordon que tambien presnetan un asétco hemorrágico.\r\n\r\n', 'Los cortes muestran testículo con áreas extensas de necrósis hemorrágica secundaria a obstrucción venosa. El cordón contiene los elementos tisulares normales.\r\n\r\n\r\n', ' Orquidectomía izquierda:\r\n-NECRÓSIS HEMORRÁGICA SECUNDARIA A TORSIÓN.\r\n\r\n\r\n', '', ''),
	(775, 'Q2106-2292', 'Q', 'VEN24725644', 'MARIA MERCEDES VILLASMIN PARRA', '3002565211', 'F', '25', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Mioma submucoso" se recibe una masa de tejido de forma ligeramente esferica de 2.3 cms. de diámetro mayor, es de color pardo claro y al corte muestra una superficie de color blanquecino y aspecto fasciculado. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n', ' Resección de masa uterina:\r\n-LEIOMIOMA.\r\n\r\n\r\n', '', ''),
	(776, 'Q2106-2293', 'Q', '1048933341', 'JUAN CAMILO LOZANO CUETO', '3226750405', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Testiculo  derecho" se recibe el producto de una orquiectomía que mide 4.5 x 2.8 x 2.5 cms. en sus mayores dimensiones, El epididimo de color violáceo mide 4 x 1.5 x 1 cms. La superficie externa del testiculo es lisa y brillante, de color violaceo y la consistencia es firme, trae el segmento de cordon que mide 2.5 cms. Al corte se encuentra una superficie de aspecto hemorrágico que compromete todo el espesor del testiculo extendiendose hasta el epidididmo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran testículo cuyos componentes tisulares están necróticos y hemorrágicos en su totalidad.\r\n\r\n\r\n', ' Orquidectomía derecha:\r\n-NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n\r\n\r\n', '', ''),
	(777, 'Q2106-2294', 'Q', '45548857', 'MARLIN GREYS DONADO BETRUS', '3205547055', 'F', '46', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA', '', ''),
	(778, 'Q2106-2295', 'Q', '0002295', 'MARELVIS TORRES', '000', 'F', '43', 'PARTICULAR', '', '898201', '30215', 'Doctor JHON JAIRO SAMPAR VÁSQUEZ', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro de 0.5 cms. Se toma todo\r\n\r\n\r\n', 'Los cortes muestran cuello uterino cuyo epitelio escamoso muestra un estrato basal engrosado con aumento de la celularidad y desorganización celular. Hay moderada infiltración mononyclear del estroma.  Hay focos de metoplasia escamosa.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LESION INTTRAEPITELIAL (LIE) DE BAJO GRADO (NIC I)\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA\r\n\r\n\r\n\r\n', '', ''),
	(779, 'Q2106-2296', 'Q', '25236420', 'PAOLA QUINTANA PIRELA', '3134485862', 'F', '26', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro mayor de 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran cuello uterino con inflamación crónica y LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA CON LIE DE BAJO GRADO CON CAMBIOS SECUNDARIOS A INFECCION POR HPV.\r\n\r\n\r\n', '', ''),
	(780, 'Q2106-2297', 'Q', '52390162', 'MARIA FERNANDA SERNA ALONSO', '316664110', 'F', '43', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA SEVERA', '', ''),
	(781, 'Q2106-2298', 'Q', '22903751', 'YOLANDA DOLORES SIMANCAS DE ROMERO', '3008371175', 'F', '80', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Cuerpo y antro" en un mismo recipiente, se reciben tres fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que promedian un diaémtro de 0.3 cms. Se toma todo.\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica oxíntica y antral cuya morfología está preservada. Hay leve infiltración linfoplasmocitaria de la lámina propia.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA LEVE\r\n\r\n\r\n\r\n', '', ''),
	(782, 'Q2106-2299', 'Q', '25807594', 'YUDIS JUDITH CONTRERAS MARTINEZ', '3107290224', 'F', '54', 'GASTROPACK SAS', 'PARTICULAR', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Polipo de colon" un fragmento de tejido de forma irregular de color grisáceo y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran fragmentos de mucosa colónica cuyas glandulas conservan su morfología habitual. Hay edema, congestión e infiltración linfoplasmocitaria de la lámina propia. No se encuentran cambios neoplásicos, granulomas ni parásitos.\r\n\r\n', '1-Biopsia endóscopica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2-Biopsia endóscopica de COLON:\r\n-COLITIS CRÓNICA.\r\n\r\n\r\n', '', ''),
	(783, 'Q2106-2300', 'Q', '1007200114', 'VALERIA VALDES CAÑATE', '3008356181', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE PRETELT MENDOZA', NULL, '2021-06-17', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de piel de espalda" se recibe un fragmento eliptico de piel que mide 0.8 x 0.4 cms. en sus mayores dimensiones, la superficie externa es de color pardo oscuro. Se toma todo.\r\n\r\n', 'Los cortes muestran piel en cuya epidermis se observa marcada hiperpigmentación que en algunas áreas se aproxima al estrato superficial sin aparente aumento en el número de melonocitos  ni alteración morfológica de los mismos.\r\n\r\nCOMENTARIO: Los cambios descritos son comunes a un número amplio de entidadesque incluye desde pecas, manchas "Café-au-lait", Sindrome de Albright, Sindrome de Peutz-Jeghers, etcétera. Es necesario hacer correlacion clínico-patológica.\r\n\r\n\r\n', ' Biopsia de lesión pigmentada en espalda:\r\n-VEÁSE DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO.\r\n\r\n\r\n', '', ''),
	(784, 'Q2106-2301', 'Q', '1237441000', 'LISNELLY PEREZ SERRANO', '000', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Esclerodermia (frente)" se recibe un fragmento de piel que mide 0.4 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis conserva su morfología habitual.  En el dermis papilar y reticular se observan unidades pilosebaceas y glándulas sudoriparas. Hay un discreto infiltrado mononuclear perivascular.\r\n\r\n\r\n', ' Biopsia de piel de región frontal:\r\n-VEÁSE DESCRIPCIÓN MICROSCÓPICA E INFORME DE BIOPSIA ANTERIOR.\r\n\r\n\r\n\r\n', '', ''),
	(785, 'Q2106-2302', 'Q', '1238341728', 'ADRIANA LUCIA ARRIETA ZULUAGA', '3002841540', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARIA CLAUDIA BURGOS', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 5 ml. Se toma parte.\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA.\r\n\r\n\r\n\r\n', '', ''),
	(786, 'Q2106-2303', 'Q', '1201228815', 'CRISTIAN DAVID AVILA TERAN', '3132854918', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA ', '', ''),
	(787, 'Q2106-2304', 'Q', '1142936344', 'ADRIANA GARCIA MENDOZA', '3004833826', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE PRETELT MENDOZA', NULL, '2021-06-17', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de piel" se recibe un punch de piel de 0.3 cms. de diámetro. Se toma todo.\r\n\r\n', 'Los cortes muestran piel cuya epidermis es normal. En la dermis se observan folículos dilatados con una reacción inflamatoria crónica en la periferia.  En la interfase se observan numerosos granulomas con una composición celular mixta.\r\n\r\n\r\n', ' Biopsia de lesión en piel de la cara:\r\n-DERMATITIS CRÓNICA GRANULOMATOSA COMPATIBLE CON FOLICULITIS CON RUPTURA.\r\n\r\n\r\n', '', ''),
	(788, 'Q2106-2305', 'Q', '1048600576', 'ANA KARINA DE LAS AGUAS MENDOZA', '3148784089', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-06-17', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Neurofibroma" un fragmento de piel que mide 0.7 cms. en su mayor dimensión. Se toma todo y se rotula A.\r\n2. "Neurofibroma tronco derecho" elipse de piel que mide 1.8 x 1.2 x 1 cms. en sus mayores dimensiones. Al corte se observa una superficie de color blanco amarillento. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B muestran piel en cuya dermis se observa una proliferación difusa de elementos neurales, en cuyo interior se observan filetes y troncos nerviosos.\r\n', '1-Biopsia de piel de codo derecho:\r\n-NEUROFIBROMA PLEXIFORME\r\n2-Biopsia de piel del tronco derecho:\r\n-NEUROFIBROMA PLEXIFORME.\r\n\r\n', '', ''),
	(789, 'Q2106-2306', 'Q', '33130739', 'BERTHA ALCIRA ACEVEDO LAFONT', '000', 'F', '74', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor HERNANDO COBA', NULL, '2021-06-16', '2021-06-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar piriforme que mide 9 x 4 cms. en sus mayores diensiones, la superficie externa está parcialmente cubierta por una serosa despulida de color pardo claro con áreas de color pardo oscuro está previamente abierta en el área del lecho hepático. Al corte las paredes son gruesas, de aspecto fibroso y la mucosa está aplanada.  En la luz se encuentran varios cálculos de forma irregular, color negro, con un diámetro promedio de 4 m.m. Se toman cortes.\r\n\r\n', 'Los cortes muestran vesícula biliar cuya mucosa está casi completamente ulcerada. Hay fibrosis de la pared que está densamente infiltrada por neutrófilos, linfocitos y macrófagos. No hay cambios neoplásicos.\r\n\r\n\r\n', '-COLECISTITIS AGUDA Y CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n', '', ''),
	(790, 'Q2106-2307', 'Q', '45525500', 'YESENIA PEREZ MIRANDA', '000', 'F', '40', 'LIGA CONTRA EL CANCER', '', '', '', 'Doctor CARLOS OSORIO', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre se reciben dos fragmentos de tejido de forma irregular de color pardo amarillento y aspecto adiposo que miden 7.2 X 5.5 x 3.5 cms. y 4 X 3 X 2.5 cms. en sus mayores dimensiones. Viene marcado con un arpón y orientado con sedas asi:\r\n-Seda margen superior \r\n-Seda margen lateral \r\n-Seda margen profundo\r\n-Margen medial \r\nAl corte una superficie de color pardo claro con áreas amarillenteas y marcado con el arpón, en relación con el margen superior, se observa un área de color pardo claro mal delimitada, homogénea que mide 2 X 1 X 1.5 cms. Se toman cortes y se rotulan A. Zona del arpón con relación al margen superior. B-Margen de resección profundo - C Margen de resección lateral - D Margen medial.\r\nEl fragmento menor también viene marcado con una seda. Al corte se observa una supeficie de color pardo claro que alterna con áreas amarillentas. Se toman cortes y se rotulan E.\r\n', 'Los múltiples cortes muestran tejido mamario cuya morfología está alterada por la presencia de quístes de pequeño calibre que reposan en un estroma fibroescleroso. Hay múltiples focos de adenosis. No se observan cambios malignos.\r\n\r\n', ' Biopsia estereotaxíca de mama izquierda:\r\n-CONDICIÓN FIBROQUÍSTICA CON MÚLTIPLES FOCOS DE ADENOSIS.\r\n-VER DESCRIPCIÓN MICROSCÓPICA.\r\n\r\n\r\n', '', ''),
	(791, 'Q2106-2308', 'Q', '1047447148', 'BRENDA DEL CARMEN BENITEZ PADILLA', '000', 'F', '29', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gastrico", se reciben tres diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica antral cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. Hay focos de displasia moderada del epitelio glandular. Hay formación ocasional de acúmulos linfoides. No se observa H. Pylori, actividad inflamatoria ni cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA CON FOCOS DE DISPLASIA MODERADA.\r\n\r\n', '', 'Caso visto en conjunto con el doctor José Caraballo.\r\n\r\n\r\n\r\n\r\n\r\n'),
	(792, 'Q2106-2310', 'Q', '976186', 'FRANCISCO PERNET HURANGO', '000', 'M', '69', 'GASTROPACK SAS', 'PARTICULAR', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gastrico", se reciben tres diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscípica de estómago:\r\n-GASTRITIS CRONICA INACTIVA .\r\n\r\n\r\n', '', 'Ante la presencia de un test de ureasa positivo, se realizaron múltiples cortes del tejido y no se encotró actividad inflamatoria ni H.Pylori.\r\nCaso visto en conjunto con el doctor José Caraballo.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
	(793, 'Q2106-2309', 'Q', '33109354', 'AURA CECILIA AMADOR TAPIA', '000', 'F', '44', 'ORG. CLINICA GENERAL DEL NORTE', '', '', '', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vagina",  se recibe un  fragmento de tejido de forma irregular , color pardo claro, de aspecto membranoso y consistencia blanda que mide 1 X  0.6 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran tejido de granulación densamente infiltrado por PNM neutrófilos y linfocitos.\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA (GRANULOMA PIOGENO)\r\n\r\n\r\n\r\n\r\n', '', ''),
