	(797, 'Q2106-2314', 'Q', '3826924', 'OTTO DE J. REINEMER LLACH', '000', 'M', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n\r\n\r\n', '', ''),
	(798, 'Q2106-2315', 'Q', '22303385', 'AMALIA MARIA JULIAO NAVARRO', '000', 'F', '82', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(799, 'Q2106-2316', 'Q', '1043321534', 'ISAAC S. VALDELAMAR BARRIOS', '000', 'M', '5', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '', '', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1-"Esofago" dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotula A.\r\n2-"Cuerpo gástrico", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todoy se rotula B.\r\n3-"Antro", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotula C.\r\n4-"Bulbo", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotula D.\r\n5-"Segunda porción de duodeno", se recibe un  fragmento de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotula E.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados D y E muestran fragmentos de mucosa duodenal cuyas vellosidades conservan su forma y longitud normal. Hay edema, congestión e infiltración linfoplasmocitaria de la lámina propia. No se encuentran cambios inflamatorios agudos, granulomas ni parásitos.\r\n\r\n', '1-Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO\r\n2-Biopsia endoscópica de cuerpo gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3-Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n4-Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n5-Biopsia endoscópica de segunda porción del duodeno:\r\n-DUODENITIS CRÓNICA.\r\n\r\n\r\n', '', ''),
	(800, 'Q2106-2317', 'Q', '1049535456', 'JANER E. MENDOZA SANTIAGO', '000', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe un apéndice cecal que mide 6.5 X 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está adelgazada y la luz dilatada y contiene abundante material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA.', '', ''),
	(801, 'Q2106-2318', 'Q', 'VEN6210530', 'YONAIKER D. CHIRINOS ALVARADO', '000', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n-"Apéndice", dos fragmentos de apéndice cecal que juntos miden 9.5 X 1 cms. en sus mayores dimensiones. La superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes y se rotulan A.\r\n2-"Ganglio linfático", se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.8 X 0.6 cms. Se toma todo en dos cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nLos cortes rotulados B muestran ganglio linfático cuya morfología está alterada por la presencia de gran cantidad de histrocitos que rodean folículos y se extiende hasta la zona paracortical.\r\n\r\n\r\n', '1-APENDICITIS AGUDA\r\n2-GANGLIO LINFÁTICO CON HIPERPLASIA LINFOHISTIOCITARIA *\r\n\r\n* Sitio anatómico no especificado.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(802, 'Q2106-2319', 'Q', '1047476669', 'NAOMY S. BOSSIO ALTAMAR', '000', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe un apéndice cecal que mide 9.2 X 0.7 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa lisa y brillante con aumento de la trama vascular. Al corte la pared está desgastada y dilatada y contiene abundante material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(803, 'Q2106-2320', 'Q', '1043651019', 'LISBETH P. MENDOZA TORRES', '000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago", se reciben tres diminutos fragmentos de tejido de forma irregular color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(804, 'Q2106-2321', 'Q', '1042609491', 'JOSE LUIS DIAZ DIAZ', '000', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe un apéndice cecal que mide 8.7 X 0.8 cms. la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared.\r\n\r\n\r\n\r\n ', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(805, 'Q2106-2322', 'Q', '1062961592', 'SHARICK T. RAMIREZ SANTOS.', '000', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1-"Estómago", tres fragmentos de tejido de forma irregular color pardo claro y consistencia blandan que promedian 0.5 cms. Se toma todo y se rotula A\r\n2-"Duodeno" se recibe un fragmento de tejido de forma irregular color pardo clar y consistencia blanda que mide 0.4 cm. Se toma todo y se rotula B.\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal que conserva la morfología habitual. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', '1- Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2-Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENA NORMAL.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(806, 'Q2106-2323', 'Q', '1048933254', 'CARLOS EDUARDO PAJARO SUAREZ', '000', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe un apéndice cecal que mide 12.7 X 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está desgastada y la luz dilatada. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(807, 'Q2106-2324', 'Q', '1201277647', 'ISAAC ALFONSO HERRERA PAJARO', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1-"Esofago" un diminuto fragmento de tejido de forma irregular , color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotula A.\r\n2-"Estómago", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotula B.\r\n3-"Duodeno", se recibe un  fragmento de tejido de forma irregular , color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotula C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro. \r\nLos cortes rotulados B muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nlos cortes rotulados C muestran mucosa duodenal que conserva la morfología habitual. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n\r\n', '1-Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO.\r\n2-Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA.\r\n3-Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS.\r\n\r\n\r\n\r\n', '', ''),
	(808, 'Q2106-2325', 'Q', '1142935773', 'REYCHEEL DE J. JIMENEZ MUÑOZ', '000', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe un apéndice cecal que mide 7.2 X 0.6 cms. la superficie externa está cubierta por una serosa lisa y brillante con aumento de la trama vascular. Al corte la pared está engrosada y la luz puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa.  No se observan cambios inflamatorios.\r\n\r\n\r\n', '-APÉNDICE CECAL.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(809, 'Q2106-2326', 'Q', '1053128611', 'BRAYAN BELLO MEDINA', '0', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-22', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de ganglio cervical derecho" se recibe una masa de tejido de color pardo claro y consistencia elástica que mide 1.7 x 1.2 x 0.6 cms.  Al corte una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada por la presencia de un aumento en el número de los folículos linfoides con diferentes formas y tamaños, con centros germinales ensanchados que contienen macrófagos que fagocitan detritus célulares. No se encuentran cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de ganglio cervical derecho:\r\n-HIPERPLASIA FOLICULAR REACTIVA.\r\n\r\n\r\n', '', 'En la muestra no es posible establecer un diagnóstico específico.\r\n\r\n'),
	(810, 'Q2106-2327', 'Q', '1048580947', 'CRISTIAN DAVID FERRER ALVAREZ', '000', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe una apédice cecal que mide 6.8 X 0.7 cms. la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(811, 'Q2106-2328', 'Q', '1235050860', 'GAEL ANDRES TERAN CARDOZO', '000', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-29', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia hepática" se recibe, un fragmento de tejido de forma irregular de color pardo verdoso y consistencia elástica que mide 0.4 x 0.4 x 0.3 cms. Al corte se observan una superficie finamente granular color verdoso. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran hígado cuya morfología cordonal está marcadamente alterada por la presencia de múltiples hepatocitos gigantes, multinucleados, algunos con evidencia de retención biliar. Los espacios porta están ensanchados, de aspecto fibroso y están infiltrados por linfocitos y eosinófilos.\r\n\r\n\r\n', ' Biopsia de hígado:\r\n-HEPATITIS NEONATAL\r\n\r\n\r\n\r\n', '', 'El cuadro histológico de esta entidad es similar independientemente de la etiología.\r\n\r\n'),
	(812, 'Q2106-2329', 'Q', '1064994717', 'ALVARO JOSE HERNANDEZ PEREZ', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rtulados, se reciben:\r\n1-"Apéndice", una apéndice cecal de aspecto necrótico de color pardo oscuro que mide 5 X 0.8 cms. la superficie externa está cubierta por una serosa despulida. Al corte la pared engrosada y la luz puntiforme. se toman cortes y se rotulan A.\r\n2-"Ileon", un segmento de intestino delgado que mide 14.5 X 2.5 cms. , la superficie externa está cubierta por una serosa despulida en la que se destacan dos soluciones de continuidad de bordes irregulares que compromete todo el espesor de la pared. Al corte la mucosa conserva el aspecto habitual excepto en las áreasde las perforaciones en donde se observan edematosas. Se toman cortes y se rotulan áreas cercanas a las perforaciones B y líneas de recección se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nLos cortes rotulados B muestran ileon con áreas extensas de necrósis, hemorrágia e inflamación aguda.  Las líneas de resección son viables.\r\n\r\n', '1-APENDICITIS AGUDA.\r\n2-SEGMENTO DE ILEON CON NECRÓSIS HEMORRÁGICA, PERFORACIÓN E INFLAMACIÓN AGUDA.\r\n -LINEAS DE RESECCIÓN SIN ALTERACIONES.\r\n\r\n\r\n\r\n', '', ''),
	(813, 'Q2106-2330', 'Q', '1022156240', 'JAHAN SALOME BENJUMEA GARCIA', '000', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'DOCTORA KATERNIE BARRIOS', NULL, '2021-09-10', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1."Esofago" dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotula A.\r\n2."Estómago", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todoy se rotula B.\r\n3."Duodeno", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotula C.\r\n4."Ileon", se reciben dos diminutos fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotula D.\r\n5."Sigmoide", se reciben tres  fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotula E.\r\n6."Colon ascendente", se reciben dos  fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotula F.\r\n7."Colon transverso", se reciben dos  fragmentos de tejido de forma irregular , color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotula G.', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro.\r\nLos cortes rotulados B fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran fragmentos de mucosa duodenal que conserva su morfología habitual.\r\nLos cortes rotulados D muestran fragmentos de mucosa ileal con inflamación crónica mediada por linfocitos, células plasmáticas y eosinófilos.\r\nLos cortes rotulados E,F,G y H muestran mucosa colónica cuya lámina propia está congestiva y densamente infiltrada por linfocitos, células plasmáticas y eosinófilos. No se encuentra alteración del componente mucoso, presencia de granulomas ni parásitos.', '1-Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO.\r\n2-Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA\r\n3-Biopsia endoscópica de duodeno:\r\n-FRAGMENTOS DE MUCOSA DUODENAL\r\n4-Biopsia endoscópica de ileon:\r\n-ILEITIS CRÓNICA\r\n5-Biopsia de colon sigmoide:\r\n-COLITIS CRÓNICA\r\n6-Biopsia de colon ascendente:\r\n-COLITIS CRÓNICA\r\n7-Biopsia  de colon transverso:\r\n-COLITIS CRÓNICA\r\n8-Biopsia endoscópica de recto:\r\n-PROCTITIS CRÓNICA.\r\n\r\n\r\n', '', ''),
	(814, 'Q2106-2331', 'Q', '1044005309', 'KLEIVER DE LA ROSA PEÑA', '000', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Tejido en mama derecha", se recibe un fragmento de tejido de forma irregular color pardo claro y consistencia elástica que mide 6.5 X 4.2 X 2 cms. la superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro que alterna con área amarillenta. Se toman cortes.\r\n\r\n', 'Los cortes muestran tejido mamario compuesto por canalículos, algunos quísticamente dilatados que reposan en un estroma escleroso.  No hay componente lobulillar.\r\n\r\n\r\n', '-GINECOMASTIA DERECHA.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(815, 'Q2106-2332', 'Q', '1050846989', 'SANTIAGO DAVID ARIAS CASTILLEJO', '000', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1-"Esófago", un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotula A.\r\n2-"Estómago", dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian  0.2 cms. Se toma todo y se rotula B.\r\n3-"Duodeno", dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotula C.\r\n4-"Colon", un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. Se toma todo y se rotula D.\r\n5-"Recto", dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotula E.\r\n\r\n', 'Los cortes rtulados A muestran fragmentos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nlos cortes rotulados C muestran fragmentos de mucosa duodenal cuya morfología está preservada.\r\nLos cortes rotulados D muestran mucosa colónica cuya morfología está preservada.\r\nLos cortes rotulados E muestran mucosa colónica cuya morfología está preservada.\r\n\r\n', '1-Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO.\r\n2-Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n3-Biopsia endoscópica de duodeno:\r\n-FRAGMENTOS DE MUCOSA DUODENAL.\r\n4-Biopsia endoscópica de colon:\r\n-FRAGMENTOS DE MUCOSA COLÓNICA\r\n5-Biopsia endoscópica de recto:\r\n-FRAGMENTOS DE MUCOSA COLÓNICA.\r\n\r\n\r\n', '', ''),
	(816, 'Q2106-2333', 'Q', '1081810499', 'TANIA PAOLA PERTUZ VILLA', '000', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '', '', 'Doctora DANIELA DIAZ BLANCO', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe una apéndice cecal que mide 6.3 X 1 ms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está desgastada y la luz dilatada.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(817, 'Q2106-2334', 'Q', '1084730428', 'YOLIBETH OROZCO PALACIO', '000', 'F', '26', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '', '', 'Doctor MAURICIO ORTIZ BANQUEZ', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste simple de anexo izquierdo", se recibe una estructura de aspecto quístico de color pardo claro traslúcida y consistencia renitente que mide 6.5 X 5.3 cms.  Al corte hay salida de un líquido claro dejando una cavidad unilocular de paredes delgadas. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por un epitelio seroso con formación ocasional de papilas.\r\n\r\n\r\n', ' Resección de quíste en anexo uterino izquierdo:\r\n-CISTADENOMA PAPILAR', '', ''),
	(818, 'Q2106-2335', 'Q', '22729406', 'DIANA LUZ CANABAL DE LA CRUZ', '000', 'F', '47', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor SAMUEL CANTILLO', NULL, '2021-06-22', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero y trompas" se recibe un útero con sus trompas de Falopio que pesa 724 gms. y mide 13.5 x 14.5 x 9.5 cms., el cervix está tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo está aumentado de tamaño y deformado y parcialmente cubierto por una serosa lisa y brillante, trae adherido las trompas de Falopio, la trompa dercha mide 5.5 cms y la izquierda 5.7 cms. Al corte el canal de la cavidad endocervical es permeable, tapizada por una mucosa delgada. El miometrio está ocupado por múltiples masas de color blanquecino de aspecto arremolinado. la mayor mide 9 cms. y lamenor unos pocos milimetros de localización submucosa intramural y subserosa. Al corte las trompas de Falopio conservan la morfología habitual. Se toman cortes.\r\nLa masa que mide 9 cms. tiene un área de aspecto necrótico en el centro , y mide 4 x 3.5 x 3 cms. Se toman cortes.\r\n\r\n', 'El cervix muestra una reacción inflamatoria crónica. El endometrio está autolisado. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente, el mayor de los mismos muestra áreas extensas de degeneración hialina. Las trompas de Falopio conservan la morfología habitual.\r\n\r\n', ' Útero y trompas (724 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS SUBMUCOSAS, INTRAMURALES Y SUBSEROSOS.\r\n-TROMPAS DE FALOPIO.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(819, 'Q2106-2336', 'Q', '1042577831', 'LYS LAURA NIETO MEZA', '000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice", se recibe apéndice cecal que mide 8.4 X 0.7 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n', '', ''),
	(820, 'Q2106-2337', 'Q', '1041974034', 'LUNA PATRICIA AVILA RODRIGUEZ', '000', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Granuloma Piogeno", se recibe un fragmento cuniforme de tejido de color pardo claro que mide 1.3 X 0.7 X 0.5 cms. Al corte se observa una superficie de color rosado finamente granular. Se toman cortes.\r\n\r\n', 'Los cortes muestran piel con acantosis irregular. En la dermis se observa un tejido de granulación densamente infiltrado por PNM neutrófilos y linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión en primer artejo de pie *:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA.\r\n\r\n*Lado anatómico no especificado.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(821, 'Q2106-2338', 'Q', '33280642', 'BERNUIL MIRANDA DE GONZALEZ', '000', 'F', '68', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor SANTIAGO LORA', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula biliar", se recibe una vesícula biliar que mide 7.3 X 2.3 cms., la superficie externa está parcialmente cubierta por una serosa despulida . Al corte la pared se encuentra ligeramente engrosada, la mucosa ha perdido su aspecto aterciopelado y hay salida de múltiples fragmentos de cálculos de color pardo amarillento. Se toman cortes.\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(822, 'Q2106-2339', 'Q', '45445074', 'SIXTA MOLINARES GUELL', '000', 'F', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor SANTIAGO LORA', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula biliar", se recibe una vesícula biliar que mide 6 X 3 cms., la superficie externa está parcialmente cubierta por una serosa despulida . Al corte la pared está engrosada y  la mucosa ha perdido su aspecto aterciopelado  hay salida de escasos  cálculos medianos de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n', '', ''),
	(823, 'Q2106-2340', 'Q', '33274210', 'KATERINE CARO MARTINEZ', '000', 'F', '36', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor SANTIAGO LORA', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula biliar", se recibe una vesícula biliar que mide 5.7 X 2 cms. en sus mayores dimensiones. Al corte la pared está engrosada, la mucosa ha perdido su aspecto aterciopelado y hay salida de numerosos cálculos pequeños de color pardo amarillento. Se toman cortes.\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n', '', ''),
	(824, 'L2106-91', 'L', '33119920', 'MARIA ISABEL PADILLA DE BERRIO', '000', 'F', '75', 'ORG. CLINICA GENERAL DEL NORTE', '', '', '', 'DOCTOR ALBERTO GALVIS', NULL, '2021-06-19', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Se reciben 10 ml. de un líquido color amarillo claro, se centrifuga y se hace un extendido del sedimento.\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' Citología de orina:\r\n-EXTENDIDOS ACELULARES.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(825, 'L2106-92', 'L', '30759014', 'DELIA LUISA BOSSA GONZALEZ', '000', 'F', '68', 'PARTICULAR', 'C.', '', '', 'DOCTOR LUIS FERNANDO VIAÑA GONZALEZ', NULL, '2021-06-21', '2021-06-17', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre se reciben tres placas con su extendido.\r\n\r\n\r\n\r\n', 'Los extendidos muestran unicamente globulos de tejido adiposo. No se observan cambios malignos.\r\n\r\n\r\n', '- BACAF de nódulo en mama derecha:\r\n-CITOLOGIA NEGATIVA PARA CÉLULAS MALIGNAS.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(826, 'Q2106-2341', 'Q', '43701290', 'EUCARIS VALENCIA PUERTA', '000', 'F', '50', 'PARTICULAR', '', '', '', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-24', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vagina" se reciben, varios fragmentos de tejido irregulares de color pardo claro que promedian un diámetro mayor de 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso maduro que reposa en un estroma compuesto por glandulas y estroma endometrial. En la muestra no se identtifican cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vagina:\r\n-ENDOMETRIOSIS', '', ''),
	(827, 'Q2106-2342', 'Q', '1066354549', 'ALANA MENDOZA DUQUE', '000', 'F', '7', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-06-24', '2021-06-19', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" Un fragmento de tejido irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotula A\r\n2. "Cuerpo" dos fragmentos de tejido irregular de color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo y se rotula B.\r\n3. "Bulbo" Un fragmento de tejido irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotula C.\r\n4. " Segunda porción de duodeno " tres fragmentos de tejido irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo y se rotula D.\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan mucosa oxíntica sin cambios.\r\nLos cortes C revelan mucosa de bulbo sin alteraciones.\r\nLos cortes D muestran duodeno con un infiltrado inflamatorio crónico con formación de foliculos linfaticos.\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.GASTRITIS CRÓNICA INACTIVA\r\n2.MUCOSA OXÍNTICA SIN CAMBIOS\r\n3.MUCOSA DEL BULBO DUODENAL SIN CAMBIOS\r\n4.DUODENITIS CRÓNICA\r\n', '', ''),
	(828, 'Q2106-2343', 'Q', '45691211', 'SANDY INES VERGARA PALENCIA', '000', 'F', '42', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido irregulares de color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado,con formación de agregados linfoides actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n', ' Biopsia endoscópica de esómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD INFLAMATORIA MODERADA \r\n- H.PYLORI PRESENTE.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(829, 'Q2106-2344', 'Q', '1051833520', 'CARMEN ALICIA REYES RUEDAS', '000', 'F', '20', 'LIGA CONTRA EL CANCER', 'PARTICULAR', '', '', 'Doctor CARLOS OSORIO', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Mama superior derecha", se reciben tres fragmentos irregulares de tejido, el mayor mide 6 X 4 X 3 cms. cubierto por una elipse de piel de 4 cms., y el menor mide 3 X 2 X 1 cms. de consistencia blanda, color amarillento y de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan mama que muestran ductos dilatados, algunos con hiperplasia ductal leve, metaplasia apocrina. Se observan focos de adenosis esclerosante. \r\n\r\n', ' Resección de lesión en mama derecha:\r\n-CONDICION FIBROQUISTICA CON HIPERPLASIA DUCTAL LEVE.\r\n\r\n\r\n\r\n', '', ''),
	(830, 'Q2106-2345', 'Q', '45465039', 'MARIA EUGENIA PEADA VARELA', '000', 'F', '55', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '', '', 'Doctor ISMAEL YEPES', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido irregulares de color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa antro corporal sin alteraciones.\r\n\r\n\r\n', ' Biospia de estómago:\r\n-MUCOSA ANTRO CORPORAL SIN ALTERACIONES.\r\n\r\n\r\n\r\n', '', ''),
	(831, 'Q2106-2346', 'Q', '1143332617', 'PAMELA PADILLA PATERNINA', '000', 'F', '32', 'LIGA CONTRA EL CANCER', 'PARTICULAR', '', '', 'Doctor CARLOS OSORIO', NULL, '2021-06-30', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Cuadrante superior externo de mama izquierda" se reciben, tres fragmentos de tejido irregulares de color blanquecino amarillento, consistencia elástica, el mayor mide 5 x 3 x 1.5 cms. y el menor mide 3 x 2.5 x 2 cms. Al corte una superficie blanquecina con algunas formaciones quísticas y salida de líquido claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan mama que muestra algunos ductos quisticamente dilatados, metaplasia apocrina, el estroma infiltrado focalmente por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en mama izquierda cuadrante superior externo:\r\n-CONDICIÓN FIBROQUISTICA', '', ''),
	(832, 'Q2106-2347', 'Q', '19439820', 'LUIS FERNANDO OCHOA TOLOZA', '000', 'M', '60', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctor ISMAEL YEPES', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido irregulares de color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan mucosa oxíntica sin alteraciones.\r\n\r\n\r\n', ' Biopsia de estómago:\r\n-MUCOSA OXINTICA SIN CAMBIOS.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(833, 'Q2106-2348', 'Q', '1043653091', 'JEAN CARLOS GARCIA CUADRO', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice", se recibe un apéndice cecal que mide 8 X 1.5 cms. la superficie externa está cubierta por una serosa dde color pardo claro, opáca bien vascularizada. Al corte salida de material fecal. Se toman cortes.\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APÉNDICITIS AGUDA', '', ''),
	(834, 'Q2106-2349', 'Q', '9287607', 'WILSON LORENZO ALCALA ARELLANO', '000', 'M', '51', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctor ISMAEL YEPES', NULL, '2021-06-22', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido irregulares de color blanquecino y consistencia elástica que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD INFLAMATORIA MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(835, 'Q2106-2350', 'Q', '30772907', 'AIDEE NIETO SANDOVAL', '000', 'F', '55', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '', '', 'Doctor SANTIAGO LORA', NULL, '2021-06-30', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero más anexos" se recibe, un cuerpo uterino, anexos y cuello por separado que pesan 226 gms. El cuello mide 3 x 3 x 2 cms. tapizado por una mucosa blanquecina con orificio alargado de forma transversal, el canal endocervical es permeable. El cuerpo mide 9 X 9 X 4 cms. tapizado por una serosa de color pardo grisáceo. La cavidad endometrial tapizada por una mucosa de color pardo violácea, en el miometrio se encuentra una masa que mide 4 x 4 x 4.5 cms. de color amarillenta. Los ovarios miden 3 x 2 cms. Los segmentos de trompas miden 4 cms. y son macroscopicamente normales. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan cervix con una reacción inflamatoria crónica, el endometrio se encuentra autólisado, la masa descrita en en el miometrio corresponde a un leiomioma. Los ovarios y las trompas de Falopio muestran su estrcutura usual.\r\n\r\n\r\n\r\n', ' Utero (226 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMA\r\n-OVARIOS\r\n-TROMPAS DE FALOPIO', '', ''),
	(836, 'Q2106-2351', 'Q', '9283947', 'ORLANDO VEGA SEGOVIA', '000', 'M', '59', 'GASTROPACK SAS', 'PARTICULAR', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-22', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido irregulares de color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(837, 'Q2106-2352', 'Q', 'VEN110274291036', 'JHON KLEIBER CASSIANI ESCOBAR', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice", se recibe un apéndice cecal que mide 8 X 1 cms. tapizada por una serosa opáca de color pardo claro bien vascularizada. Al corte salida de material fecaloide. Se toman cortes.\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', ' Apendicectomía:\r\n-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n', '', ''),
	(838, 'Q2106-2353', 'Q', '1051884187', 'NAYDELIN SHARYTH JIMENEZ GOMEZ', '000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados se reciben:\r\n1-"Fibroadenoma mama derecha", fragmento de tejido irregular que mide 3 X 2 cms. de color blanquecino y consistencia elástica. Al corte una formación nodular que mide 1.5 X 1 cm de color blanquecino. Se toman cortes y se rotulan A.\r\n2-"Fibroadenoma mama izquierda", formación nodular que mide 2.5 X 2 X 1.5cms. de color blanquecino y consistencia elástica. Al corte una superficie lisa  blanquecina. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n', '1-FIBROADENOMA MAMA DERECHA\r\n2-FIBROADENOMA MAMA IZQUIERDA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(839, 'Q2106-2354', 'Q', '22810937', 'YENIS MARIA MIRANDA LOPEZ', '000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-06-21', '2021-06-19', 'OLIVA MARRUGO GRICE', 'En un mismo recipiente y rotulado "Trompas de Falopio izquierda y derecha", sin ninguna marca se reciben 2 segmentos de trompas que miden 2 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran segmentos de trompa uterina que muestra la estructura usual.\r\n\r\n', '-SEGMENTOS  DE TROMPAS DE FALOPIO IZQUIERDA Y DERECHA.\r\n\r\n\r\n', '', ''),
	(840, 'L2106-93', 'L', '1102881834', 'OSNEIDI ELIZABETH FLOREZ ALVAREZ', '3143870571', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-06-21', '2021-06-21', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 4 ml. de un líquido de color transparente. Se centrifuga y se hace un extendido del sedimento.\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n', ' Citología líquido cefaloraquídea:\r\n-EXTENDIDO ACELULAR.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(841, 'L2106-94', 'L', '1080651281', 'ISABELLA PAVA ACUÑA', '000', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-06-21', '2021-06-21', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 4 ml. de un líquido de color transparente. Se centrifuga y se hace un extendido del sedimento.\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n', ' Citología de líquido cefaloraquideo:\r\n-EXTENDIDO ACELULAR.\r\n\r\n\r\n\r\n', '', ''),
	(842, 'Q2106-2355', 'Q', '33149001', 'ANA SALINAS LEON', '3162459547', 'F', '68', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-23', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n', '', ''),
	(843, 'Q2106-2356', 'Q', '45592939', 'ALEJANDRA PATRICIA MARRUGO LAMBIS', '3136167881', 'F', '43', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'En recipientes separados y rotulados, se reciben:\r\n1. "Vulva" un fragmento de tejido de forma irregular de color blanquecino y negruzco de consistencia elástica que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cupula" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran piel cuya epidermis muestra marcada acantosis. En la superficie se identifican escasos coilocitos.\r\nLos cortes rotulados B muestran epitelio escamoso con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n', '1.Biopsia de vulva:\r\n-CONDILOMA ACUMINADO\r\n2.Biopsia de cúpula vaginal:\r\n-CAMBIOS EPITELIALES SECUNDARIOS A INFECCIÓN POR HPV\r\n\r\n', '', ''),
	(844, 'Q2106-2357', 'Q', '45532269', 'GISELLE KARINA AVENDAÑO AROCA', '30467259560', 'F', '39', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se recibe un fragmento de tejido de forma irregular de color blanco amarillento que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n\r\n', '-POLIPO ENDOCERVICAL  ', '', ''),
	(845, 'Q2106-2358', 'Q', '45754334', 'YAJAIRA DEL SOCORRO MONTES LARA', '3145922898', 'F', '46', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor ERICK ALVAREZ ', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se recibe un fragmento de tejido de forma irregular de color blanquecino y rosado que juntos miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral constituida por células nevicas dispuestas en pequeños nidos intraepitelial y subepiteliales.\r\n\r\n\r\n\r\n', '-NEVO MELANOCITICO DE LA UNIÓN, conjuntiva lado anatómico no especificado', '', ''),
	(846, 'Q2106-2359', 'Q', '1042583376', 'MARIA CLAUDIA RAMOS SANCHEZ', '3017606260', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 2 cms. de color blanquecino, los vasos sanguineos se encuentran ingurgitados. Al corte la pared esta engrosada y el lumen contiene un material blanco negruco. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n', ' Apendice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(847, 'Q2106-2360', 'Q', '1143335263', 'VALERIA VASQUEZ HERRERA', '3017085401', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'MARGHI LIZET GUERRA PEREZ', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se recibe un punch de piel que mide 1.7 x 0.4 cms. de color grisáceo y blanquecino. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso con hiperqueratosis, paraqueratosis focal acantosis regular del epitelio escamoso, hay focos de espongiosis. El dermis papilar muestra un infiltrado perivascular superficial y perianexial mediado por linfocitos.\r\n\r\n\r\n', ' Biopsia de piel de pierna izquierda:\r\n-LIQUEN SIMPLE CRÓNICO\r\n\r\n', '', ''),
	(848, 'Q2106-2361', 'Q', '1007978415', 'JOSE ANGEL CORDERO CASTRO', '3158965992', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se recibe un fragmento de piel de color grisáceo con áreas hemorrágicas que mide 1 x 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso, debajo de está se encuentra un tumor benigno compuesto por melanocitos dispuestos irregularmente alrededor de los anexos y  con pigmento melánico en la zona adyacente a la epidermis. No hay actividad de unión.\r\n\r\n\r\n\r\n', '-NEVUS MELANOCITICO INTRADERMICO, cuero cabelludo\r\n\r\n', '', ''),
	(849, 'Q2106-2362', 'Q', '1013630831', 'MELANY YISNEY SANTAMARIA DALMAUS', '3014101679', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-06-24', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que juntos miden 1.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(850, 'Q2106-2363', 'Q', '22812952', 'JUANA ROSA MARRUGO BELTRAN', '000', 'F', '85', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor CRISTOBAL MASSA ACOSTA', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se recibe un fragmento de tejido de forma irregular de color amarillento, blanquecino y pardo grisáceo que mide 2.5 x 2 x 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido sinovial con un proceso inflamatorio crónico mediado por linfocitos y abundantes macrófagos espumosos, algunos con contenido de hemosiderina. En la superficie se encuentra además el depósito de un material grumoso, proteinaceo.\r\n\r\n\r\n\r\n', ' Biopsia de tejido sinovial de rodilla derecha:\r\n-SINOVITIS CRÓNICA COMPATIBLE CON SINOVITIS VILLONODULAR PIGMENTADA\r\n\r\n', '', ''),
	(851, 'Q2106-2364', 'Q', '9069013', 'OTONIEL DE JESUS TORRES ZUÑIGA', '3215041168', 'M', '72', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que juntos miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(852, 'Q2106-2365', 'Q', '9151307', 'JESUS ANTONIO CORREA OROZCO', '3003682308', 'M', '65', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se reciben dos fragmentos de tejido de forma irregular de color blanqueicno y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(853, 'Q2106-2366', 'Q', '63284239', 'MERCEDES BELTRAN GOMEZ', '3023623966', 'F', '61', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-25', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n', '', ''),
	(854, 'Q2106-2367', 'Q', '23071149', 'MARTHA LUZ CABRERA SARMIENTO', '3126333522', 'F', '59', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-24', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(855, 'Q2106-2368', 'Q', '1047497541', 'LADDY DIANA ROMERO GARCIA', '3012053066', 'F', '23', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-24', '2021-06-22', 'GUILLERMO ROVIRA ROSALES', 'Se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(856, 'Q2106-2369', 'Q', '9078629', 'TUILIO MENDOZA ROMERO', '6648497', 'M', '70', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(857, 'Q2106-2370', 'Q', '1142937425', 'MARIA JOSE HERRERA SANCHEZ', '3007620602', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice + epiplon" se recibe un apéndice cecal que mide 8  x 1.2 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida, color pardo oscuro con presencia de membranas de aspecto purulento. Al corte se encuentra una luz dilatada que contiene un material de aspecto fecal. Se toman cortes.\r\nSe recibe además, un fragmento de tejido de aspecto graso que mide 20 cms. de longitud con un área engrosada de 6 cms. Al corte presenta un aspecto graso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nOtros cortes muestran epiplón con inflamción aguda.\r\n\r\n\r\n\r\n', '1.APENDICITIS AGUDA\r\n2.FRAGMENTO DE EPIPLÓN CON INFLAMACIÓN AGUDA\r\n\r\n', '', ''),
	(858, 'Q2106-2371', 'Q', '1047384023', 'VALERIA DE AVILA MENDOZA', '3145341823', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Fibroadenoma mama izquierda" se recibe una masa de tejido de forma irregular que mide 1.8 x 1.5 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se encuentra una superficie de color blanquecino, finamente granular. Se toma cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-FIBROADENOMA', '', ''),
	(859, 'Q2106-2372', 'Q', '45555617', 'VALENTINA GARCES MONTERROSA', '3205861879', 'F', '45', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora IRINA SEQUEDA', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero + trompas" se recibe un utero que pesa 276 gms. y mide 11  x6.5 x 5 cms. en sus mayores dimensiones. El cervix esta tapizado por una mucosa de color blanquecino sin lesiones aparentes. El cuerpo esta deformado por una gran masa localizada a nivel del istmo esta cubierto por una serosa lisa y brillanlte. Trae la trompa izquierda que mide 5 cms. de longitud, la trompa derecha, se recibe por separado y mide 5 cms. Al corte el canal endocervical es permeable, la masa descrita es esferica y mide 5 cms. en su mayor diámetro. Al corte presenta una superficie de color blanquecino y aspecto fasciculado, la cavidad endometrial esta tapizada por una mucosa de color rosado de 3 milimetros de espesor y en el miometrio se encuentra otra masa esférica de 1 cm. de diámetro, las trompas son macroscópica normales. Se toman cortes.\r\n\r\n\r\n', 'El cervix presenta una reacción inflamatoria crónica. El endometrio es proliferativo. Las masas miometriales estan compuestas por fibras musculares lisas dispuestas irregularmente. Las trompas conservan su estructura usual.\r\n\r\n\r\n', ' Utero y trompas (276 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO PROLIFERATIVO\r\n-LEIOMIOMAS SUBSEROSO E INTRAMURAL\r\n-TROMPAS DE FALOPIO', '', ''),
	(860, 'Q2106-2373', 'Q', '1047484039', 'MARIA ISABEL CASTELLANOS PAJON', '00', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Bazo" se recibe el producto de una esplenectomía pesa 102 gms. esta cubierta por una serosa de colro violáceo y esta fragmentado en uno de sus polos. En este sitio presenta una superficie cruenta, irregular y al corte se encuentra una superficie de color rojo oscuro. En el mismo recipiente, se recibe además, una estructura de forma irregular de color pardo claro y consistencia blanda que mide 3.5 cms. en su mayor dimensión. Al corte tiene una superficie de color pardo claro que rodea un núcleo rojizo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran bazo con áreas extensas de hemorrágia intersticial.\r\n\r\n\r\n\r\n\r\n', ' Esplenectomía:\r\n-RUPTURA TRAUMÁTICA DEL BAZO\r\n\r\n', '', ''),
	(861, 'Q2106-2374', 'Q', '1049826739', 'BRAIDI BERMUDEZ BERMUDEZ', '3108295630', 'F', '32', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR GONZALEZ', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotuladao "Apéndice" se reciben varios fragmentos de tejido de forma irregular, de color pardo claro con áreas de color pardo oscuro y consistencia elástica, el apéndice mide 5 x 1.5 cms. en sus mayores dimensiones y macroscópicamente presenta un aspecto necrótico. Al corte se encuentra una luz dilatada que contiene un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(862, 'Q2106-2375', 'Q', '45539702', 'KEYLA GEORGINA ROMERO FIGUEROA', '3157583899', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Lesión quistica en espalda" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia firme que mide 1.2 cms. en sus mayores dimensiones. Al corte se encuentra una superficie de color pardo claro rodeada de un tejido de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de tejido fibroso con una reacción inflamación aguda y crónica. No se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección de lesión en espalda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(863, 'Q2106-2376', 'Q', '1048662997', 'ALIANA SOFIA CARVAJALINO PADILLA', '3234609998', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4.5 x 0.5 cms. en sus mayores dimensiones, cubierta por una serosa de color pardo claro lisa y brillante. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(864, 'Q2106-2377', 'Q', '1127609043', 'EVA SANDRY MORALES PERTUZ', '3022709108', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ', NULL, '2021-06-29', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Nevo verrugoso" se reciben dos minuscúlos fragmentos de tejido de forma irregular de color pardo oscuro que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis presenta cambios hiperplásicos representados por acantosis irregular, leve hiperqueratosis e hiperpigmentación del estrato basal. Hay, además, múltiples hendiduras que contienen queratina laminar.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en piel de región occipital:\r\n-COMPATIBLE CON NEVO VERRUCOSO\r\n\r\n', '', ''),
	(865, 'Q2106-2378', 'Q', '1041999671', 'SNAIDER DE JESUS ROCHA SOTO', '3008045476', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-29', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ganglio paratraqueal izquierdo" una estructura de forma irregular, de color violáceo y consistencia blanda que mide 1.5 cms. en sus mayores dimensiones. Al corte se encuentra una superficie de color pardo oscuro. Se toma todo y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Seno bronquial y 3er arco" un fragmento de tejido de forma irregular, de color violáceo y consistencia elástica que mide 2.2 x 1.5 x 0.5 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se encuentra una superficie de color grisáceo con una endidura central. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran un conglomerado de pequeños ganglios linfáticos con leves cambios de hiperplasia reactiva mixta.\r\nLos cortes rotulados B muestran tejido tiroideo que rodea una cavidad tapizada por epitelio columnar. En uno de sus lados se observa además una reacción inflamatoria mediada por linfocitos e histiocitos espumosos.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n', '1.Biopsia de ganglios paratraqueales:\r\n-HIPERPLASIA REACTIVA DE TIPO MIXTO\r\n2.Extirpación de lesión en faringe:\r\n-COMPATIBLE CON DIVERTÍCULO FARINGEO\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(866, 'Q2106-2379', 'Q', '1143400229', 'LUIS ALEJANDRO GALLO QUINTERO', '3185270181', 'M', '24', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres minúsculos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(867, 'Q2106-2380', 'Q', '33174062', 'OMAIDA RAQUEL HERAZO DE GUEVARA', '3135097437', 'F', '67', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-06-25', '2021-06-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(868, 'Q2106-2381', 'Q', '19424964', 'LUIS AVILA CABALLERO', '3015412517', 'M', '60', 'PARTICULAR', 'PARTICULAR', '898201', '30215', '', NULL, '2021-06-30', '2021-06-24', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Parpado superior derecho" se  recibe un punch de piel que mide 0.1 cm. de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Epitelio escamoso ligeramente hiperplasico que descansa en un tallo de tejido fibroconttcivo, vascularizado  e infiltrado por linfocitos y plasmocitos.\r\n\r\n\r\n\r\n\r\n', '-PAPILOMA ESCAMOSO, FRAGMENTO, piel parpado superior derecho', '', ''),
	(869, 'Q2106-2382', 'Q', '43739326', 'NANCY MILENA PRECIADO ESTACIO', '3024566951', 'F', '51', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-06-28', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor en espalda" se recibe una msa de tejido de aspecto adiposo de color amarillento que mide 2.5 x 1.5 cms. tapizada por una piel de color oscuro. Al corte una lesión quistica que contiene un material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Piel cuya dermis se observa lesión quistica tapizada por epitelio escamoso conteniendo queratina laminar.\r\n\r\n\r\n\r\n', '-QUÍSTE EPIDERMICO DE INCLUSIÓN, espalda\r\n\r\n\r\n', '', ''),
	(870, 'Q2106-2383', 'Q', '1043329900', 'SHAIRA SOFIA RODRIGUEZ FERRER', '3146483777', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-06-28', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 cms. la serosa es opaca, despulida y al corte la luz ocupada por material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(871, 'Q2106-2384', 'Q', '52149390', 'ERIKA REBECA BASTIDAS SUARES', '3046623229', 'F', '47', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-06-30', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa en cuello" se recibe una masa de tejido de aspecto ovoidea que mide 1 x 1 cms. de consistencia elástica tapizada por una elipse de piel de color pardo claro. Al corte un área de aspecto quistico contiene un material blanquecino rodeada de un tejido de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se observa lesión quistica tapizada por epitelio escamoso, conteniendo queratina laminar y rodeado de un infiltrado inflamatorio agudo y crónico con la presencia de células gigantes a cuerpo extraño.\r\n\r\n\r\n', '-QUÍSTE EPIDERMICO DE INCLUSIÓN ROTO CON REACCIÓN A CUERPO EXTRAÑO, nuca, lado derecho', '', ''),
	(872, 'Q2106-2385', 'Q', '45564234', 'YUDYS DEL SOCORRO CABARCAS ARIZA', '3216485884', 'F', '39', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-06-30', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama derecha" masa de tejido, redondeada que mide 3 x 3.1 x 1.3 cms. marcada con 2 sedas margen superior, 1 seda margen medial y 3 sedas margen profundo, la lesión de aspecto adiposo en su centro presneta un área de consistencia firme. Se toman cortes así: A margen superior, B margen medial y C margen profundo. Al corte se observa un área blanquecina, irregular de 3 x 1.5 cms. que alterna con áreas de tejido adiposo. Se toman cortes y se rotulan D lesión.\r\n2. "Mama izquierda" masa de tejido de color blanco amarillento que mide 5 x 4 x 3 cms. consistencia elástica de aspecto adiposo marcado con 2 sedas margen superior, 1 seda margen lateral y 3 sedas margen profundo. Se toman cortes y se rotulan así: E margen superior, F margen superior, G margen lateral y H lesión.\r\n\r\n', 'Los cortes rotulados mama derecha revelan tejido mamario que muetsra ductos dilatados algunos con metaplasia apocrina, focos de adenosis, el estroma colagenizado con algunas calcificaciones distroficas.\r\nLos cortes B revelan tejido mamario con cambios de condición fibroquistica y la presencia de un papiloma intraductal.\r\n\r\n\r\n', '1.Extirpación de lesión en mama derecha:\r\n-CONDICIÓN FIBROQUISTICA\r\n2.Extirpación de lesión en mama izquierda:\r\n-CONDICIÓN FIBROQUISTICA\r\n-PAPILOMA INTRADUCTAL', '', ''),
	(873, 'Q2106-2386', 'Q', '1043310799', 'EMERSON BECERRA GOMEZ', '3105282094', 'M', '10', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-06-30', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Antro" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.2 cms. Se toma todo y se rotulan D.\r\n5. "2da. porción" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo y se rotulan E.\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa esofagica sin cambios.\r\nLos cortes revelan mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes de bulbo y duodeno revelan la estructura usual.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE MUCOSA ESOFAGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago (antro-cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de bulbo y 2da. porción del duodeno:\r\n-MUCOSA DUODENAL Y BULBO SIN ALTERACIONES', '', ''),
	(874, 'Q2106-2387', 'Q', '1201218667', 'DANIEL DAVID PUELLO ALVAREZ', '3126299073', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-28', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. la serosa es congestiva, de color rosado. Al corte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(875, 'Q2106-2388', 'Q', '33278785', 'MARIA DEL ROSARIO ARRIETA NUÑEZ', '00', 'F', '73', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'EFRAIN RAMIREZ BARAKT', NULL, '2021-07-30', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Aneurisma de MSD" se recibe una masa de tejido tapizada parcialmente por piel que mide 5 x 3 x 1.5 cms. en una de sus caras muestra una solución de continuidad de 1 cm. Al corte formación tubular paredes lisas blanquecina y en su extremo distal de color oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel que recubre una cavidad de paredes irregulares, fibrosas, que contiene coágulos y tronco sanguíneos.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en miembro superior derecho:\r\n-FALSO ANEURISMA (PSEUDONEURISMA)\r\n\r\n\r\n', '', ''),
	(876, 'Q2106-2389', 'Q', '1070397148', 'ZHADANNY SHMITT RAMIREZ CENDALES', '3102971299', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-28', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecla que mide 8 cms. la serosa de color blanquecino y congestiva. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(877, 'Q2106-2390', 'Q', '23088714', 'JOSEFA MARIA RODRIGUEZ BALLESTEROS', '000', 'F', '75', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-06-30', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Segmento de intestino delgado" un segmento de intestino delgado que mide 9 x 3 cms. la serosa de color pardo oscuro y en su centro presenta un área de perforación de 1 cm. Al corte la mucosa conserva su distribución usual de color oscuro con áreas de aspecto hemorrágico. Se toman cortes y se rotulan A.\r\n2. "Saco herniario" un fragmento de tejido alargado que mide 7 x 5 cms. en la cara externa de aspecto adiposo de color oscuro y la interna deja ver una superficie de aspecto hemorrágico. Se toman cortes y se roytulan B.\r\n3. "Segmento de epiplon" un fragmento de tejido de color oscuro, redondeado que mide 2.5 x 2 cms. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo con inflamción aguda y crónica y congestión vascular, se observa además segemnto de intestino delgado con focos de fibrosis, congestión vascular e inflamación por linfocitos y neutrófilos.\r\nLos cortes rotulados epiplon muestran fragmento de tejido adiposo sin cmabios.\r\n\r\n\r\n\r\n', '1.FRAGMENTO DE TEJIDO FIBROADIPOSO CON CONGESTIÓN VASCULAR E INFLAMACIÓN AGUDA Y CRÓNICA COMPATIBLE CON SACO HERNIARIO\r\n2.SEGMENTO DE INTESTINO DELGADO CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n3.FRAGMENTO DE EPIPLON', '', ''),
	(878, 'Q2106-2391', 'Q', '1127602073', 'EDILBERTO JESUS BALLESTAS PALACIO', '3205085367', 'M', '28', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-07-17', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nodulo cervical derecho" se recibe formación nodular de color blanqueicno que mide 0.5 x 0.3 cms. consistencia firme. Al corte una superficie lisa y de color rosado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada por una proliferación difusa predominantemente de células pequeñas con presencia ocasional de células grandes de nucleos hipercromáticos y otras multinucleadas de citoplasma claro que recuerdan las llamadas células en crispeta (popcorn cells).\r\nLos hallazgos son altamente sugestivos de una NEOPLASIA LINFOPROLIFERATIVA. Se requiere practicar marcación inmunohistoquímica para una definición diagnóstica.\r\n\r\n\r\n\r\n', ' Resección de ganglio cervical:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\nSe retira 1 bloque por la señora AURA ELENA PALACION BALLESTEROS CC. 45.781.390(17/jul/2021)', '', ''),
	(879, 'Q2106-2392', 'Q', '1044937840', 'MIRIAM DAYANA MARRUGO COTA', '3175654504', 'F', '21', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2021-07-28', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben fragmentos de tejido de color pardo oscuro que juntos promedian 1.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmentos de tejido decidual con áreas de necrosis y endometrio con reacción de Arias-Stella.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE TEJIDO DECIDUAL CON NECROSIS\r\n-ENDOMETRIO CON REACCIÓN DE ARIAS-STELLA\r\n\r\n', '', ''),
	(880, 'Q2106-2393', 'Q', '1001882779', 'MARINELLA ARCINIEGAS MORALES', '3024591478', 'F', '20', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2021-06-30', '2021-06-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben fragmentos de tejido de color pardo claro que juntos promedian 3 ml. Se toma parte.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan coágulos sanguineos, fragmentos de tejido decidual con áreas de necrosis e inflamación aguda.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE TEJIDO DECIDUAL CON NECROSIS E INFLAMACIÓN AGUDA\r\n\r\n', '', ''),
	(881, 'Q2106-2394', 'Q', '32454389', 'CAROLINA HOYOS PALACIOS', '3045765658', 'F', '71', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-07-01', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Esófago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa esófagica tapizada por epitelio escamoso que alterna con epitelio columnar que contiene células caliciformes, con edema e infiltración mononuclear de la lámina propia.\r\nNo se observan cambios displásicos.\r\n\r\n\r\n', ' Bipsia endoscópica de esófago:\r\n-FRAGMENTO DE ESÓFAGO CON FOCO DE METAPLASIA COLUMNAR COMPATIBLE CON ESOFAGO DE BARRETT\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(882, 'Q2106-2395', 'Q', '87190417', 'MANLIO JAVIER OLIVEROS CUELLAR', '3143656799', 'M', '55', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(883, 'Q2106-2396', 'Q', '45627227', 'PARIBANU EULALI FOLIACO DIAZ', '3126858403', 'M', '67', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(884, 'Q2106-2397', 'Q', '45490452', 'YINA STELLA MEJIA PADILLA', '3114234172', 'F', '61', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(885, 'Q2106-2398', 'Q', '1041987481', 'JOSER DE AVILA PALOMEQUE', '6666425', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(886, 'Q2106-2399', 'Q', '1007254796', 'YEILIS PAOLA CASTELLAR MADERO', '3044657581', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-07-01', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.32 cms. Se toma todo en sus mayores dimensiones. Se toma todo y se rotulan A.\r\n2. "Estómago" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal que conserva la morfología habitual. No se observan parasitos, granulomas, actividad inflamatoria ni cambios displasicos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE EPITELIO ESCAMOSO MADURO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS', '', ''),
	(887, 'Q2106-2400', 'Q', '1042585685', 'JUAN SEBASTIAN ARANGO MARTINEZ', '3205006185', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(888, 'Q2106-2401', 'Q', '1043995068', 'MICHELL ALEJANDRA BERRIO VERGARA', '3022403569', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.6 x 0.7 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta enrgosada y la luz  es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(889, 'Q2106-2402', 'Q', '1043638684', 'MARIA ALEJANDRA MENDOZA MERCADO', '3052943667', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-29', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes', '', '', '', ''),
	(890, 'Q2106-2403', 'Q', '1001834335', 'MELISSA VILLAMIZAR BRAVO', '3242130036', 'F', '21', 'LIGA CONTRA EL CANCER', '', '2020205', '74106', 'Doctor CARLOS OSORIO', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de mama" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 6.4 x 5.3 x 3 cms. en sus mayores dimensiones, la superficie externa esta cubierta por un tejido de color pardo claro que mide 3.5 x 1.3 cms., en el cual se encuentra un reparo. Al corte se observa una superficie homogenea de color pardo claro. Se toman cortes así: A área vecindad del reparo, B otras áreas.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno compuesto por la proliferación combinada de elementos glandulares y estromales.\r\n\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(891, 'Q2106-2404', 'Q', '1064982191', 'MARIA ANGELICA MERCADO JULIO', '3057332720', 'F', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora XINELA ISABEL MORALES ALVARINO', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10.5 x 0.7 cms., la superficie externa está cubierta por una serosa despulida. Al corte la pared esta adelgazada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(892, 'Q2106-2405', 'Q', '1193569295', 'HELLEN TATIANA FORTICH GUILLEN', '3045771231', 'F', '19', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-07-01', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste de ovario izquierdo" se recibe un fragmento de tejido de forma irregular, de color pardo rosado y consistencia elástica que mide 2.2 x 2 x 1.5 cms. en sus mayores dimensiones. Al corte se observa una cavidad previamente evacuada que mide 2 cms. en su mayor dimensión. En el mismo recipiente, se recibe además dos estructuras de aspecto quístico que miden 2.2 x 1.5 x 1.5 y 1.3 x 1 x 1 cms. Al corte hay salida de un líquido claro dejando cavidad uniloculares de paredes delgadas. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran una pared tapizada por un lado por epitelio de tipo seroso y con fibras de músculo liso en el espesor. Hay presencia de pequeñas proyecciones papilares.\r\nOtros campos muestran una pared delgada tapizada por un epitelio aplanado.\r\n\r\n\r\n', '1.Resección de quiste de ovario izquierdo:\r\n-CISTADENOMA SEROSO PAPILAR\r\n2.CAMBIOS COMPATIBLES CON HIDATIDE DE MORGAGNI', '', ''),
	(893, 'Q2106-2406', 'Q', '73137119', 'CARLOS GOMEZ ORTEGA', '3135240063', 'M', '53', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR GONZALEZ', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se reciben dos fragemntos de apéndice cecal que juntos miden 8.5 x 0.7 cms., la superficie externa está cubierta por una serosa despulida. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(894, 'Q2106-2407', 'Q', '1137731503', 'JESUS DAVID VIZCAINO FLOREZ', '3168670924', 'M', '0', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 3.2 x 0.3 cms., la superficie externa está cubierta por una serosa lisa y brillante. Al corte la pared conserva la estructura usual y la luz contiene material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal que conserva la morfología habitual. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n\r\n', '-APENDICE CECAL\r\n\r\n', '', ''),
	(895, 'Q2106-2408', 'Q', '1128055493', 'KATHERINE GAVIRIA BALLESTEROS', '3178479317', 'F', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-06-30', '2021-06-29', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Utero" un cuerpo uterino que pesa 248 gms. y mide 9 x 9.5 x 6.5 cms. La superficie externa esta parcialmente cubierta por una serosa lisa y brillante. Al corte la cavidad endometrial esta tapizada por una mucosa gruesa de color rosado y el miometrio esta ocupado por masas de color blanquecino y aspecto arremolinado, la mayor mide 5.5 cms. y la menor pocos milimetros de localización submucosa, intramural y subserosa. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" una trompa de Falopio que mide 5 x 0.8 cms. La superficie externa esta cubierta por una serosa lisa y brillante y al corte conserva la morfología habitual. Se toman cortes y se rotulan B.\r\n3. "Trompa izquierda" una trompa de Falopio que mide 5.7 x 0.8 cms. La superficie externa esta cubierta por una serosa lisa y brillante y al corte conserva la morfología habitual. Se toman cortes y se rotulan C.\r\n\r\n', 'El endometrio está autólisado. Las masas miometriales descritas estan compuestas por fibras musculares lisas distribuidas irregularmente.\r\nLos cortes rotulados B y C muestran trompas de Falopio que conserva la morfología habitual.\r\n\r\n\r\n', ' Histerectomía abdominal subtotal con salpingectomía bilateral:\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO', '', ''),
	(896, 'Q2107-2409', 'Q', '1142925846', 'DENILSON ORLANDO MEZA MENDOZA', '3218572854', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-07-02', '2021-06-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor benigno en oreja derecha" se recibe una elipse de piel que mide 0.8 cms. presenta una lesión sobreelevada de 0.5 cms. de color pardo grisáceo y consistencia elástica. Al corte una formación quistica que contiene un material grumoso, blanquecino que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en oreja derecha:\r\n-QUISTE QUERATINOSO DE TIPO EPIDERMOIDE', '', ''),
	(897, 'Q2107-2410', 'Q', '1044001748', 'ITZEL SOFIA MATOS JULIO', '3014344935', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-07-02', '2021-06-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se recibe una masa de tejido de forma irregular de color blanquecino y consistencia elástica que mide 3 x 2 x 1 cms. Al corte una supeficie multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA', '', ''),
	(898, 'Q2107-2411', 'Q', '1201240792', 'ISABELLA SOFIA BENITEZ SIERRA', '3145923668', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-06', '2021-06-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglio cervical" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo que mide 1 x 1 cms. de consistencia elástica. Al corte una superficie multinodular de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan ganglio linfático cuya arquitectura esta alterada por el ensanchamiento del espacio interfolicular que contiene acumulos de histiocitos, en general los linfocitos son pequeños y maduros. Se observa en un campo una mitosis anormal que justifica practicar estudios de inmunohistoquímica para una mejor definición diagnóstica.\r\n\r\n\r\n', ' Ganglio linfatico cervical:\r\n-VER DESCIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\nNOTA: Caso visto en conjunto con los doctores José Caraballo.', '', ''),
	(899, 'Q2107-2412', 'Q', '1048600409', 'SHARIK ESTHER REBOLLEDO SAN JUAN', '3135245059', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-07-06', '2021-07-01', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A  revelan epitelio escamoso hiperplasico, ectasia capilar mucosa, células abalonadas.\r\nLos cortes de B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esofago:\r\n-ESOFAGITIS PEPTICA\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(900, 'Q2107-2413', 'Q', '45430094', 'PATRICIA ELENA BERON ZUÑIGA', '6655465', 'F', '61', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-07-02', '2021-07-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa antro-corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear leve, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(901, 'Q2107-2414', 'Q', '73546618', 'DAIRO DAVID TORRES OCHOA', '3145945278', 'M', '51', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', '', NULL, '2021-07-02', '2021-07-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte hay salida de material fecal. \r\nAcompañado a esto, se recibe un fragmento de tejido adiposo y consistencia elástica que mide 5 x 2 cms. se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nFragmento de tejido adiposo con congestión e inflamación aguda.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS CRÓNICA\r\n-FRAGMENTO DE TEJIDO ADIPOSO CON INFLAMACIÓN AGUDA\r\n\r\n', '', ''),
	(902, 'Q2107-2415', 'Q', '22729241', 'ENIT BLANCO DE LA TORRES', '00', 'F', '50', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '898201', '30215', 'Doctor ORLANDO BUSTILLO', NULL, '2021-07-06', '2021-07-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Utero y anexos" se recibe un utero y anexos y cuello por separado pesa 256 gms. El cuello mide 3 x 2 x 2 cms.  tapizado por una mucosa blanquecina con orificio alargado de forma transversal. Al corte el canal endocervical contiene un material mucoide, el cuerpo mide 10 x 8 x 5 cms. tapizada por una serosa de color pardo grisáceo a nivel de la pared lateral derecha presenta una masa ovoide que mide 5 x 5 cms. La cavidad endometrial es permeable a nivel del miometrio se observan varias masas ovoides de color blanquecinas a nivel del miometrio y subseroso la mayor de las cuales mide 5  x5 cms. El ovario izquierdo mide 4 cms. y presenta formaciones quisticas con salida de un líquido claro, el segmento de trompa de Falopio mide 4 cms. El ovario derecho mide 4 cms. y presneta una formación quistica con salida de un líquido claro, el segmento de trompa mide 5 cms. Se toman cortes.\r\n\r\n', 'Los cortes muestran cervix con una reacción inflamatoria crónica. el endometrio se encuentra autólisdo, las masas descritas corresponden a leiomiomas. Los ovarios presentan foliculos quisticos, las trompas sin cambios.\r\n\r\n\r\n\r\n', ' Utero (256 gms.):\r\n-CERVICITIS CÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS\r\n-OVARIOS CON FOLICULOS QUISTICOS\r\n-TROMPAS DE FALOPIO', '', ''),
	(903, 'Q2107-2416', 'Q', '45438613', 'IRIS BERRIO RODRIGUEZ', '000', 'F', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-07-02', '2021-07-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Masa en craneo región frontal derecha"  se reciben dos fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmento de la pared de un quíste tapizada por epitelio escamoso, que contiene queratina laminar.\r\n\r\n\r\n\r\n\r\n', '-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE, región frontal derecha\r\n\r\n', '', ''),
	(904, 'Q2107-2417', 'Q', '1238338081', 'SAMUEL OROZCO VEGA', '3146708392', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS ARTURO VELEZ DUCAN', NULL, '2021-07-06', '2021-07-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Conducto auditivo izquierdo" se reciben cuatro fragmentos de tejido de forma irregular de color pardo oscuro que promedian un diámetro mayor de 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan múltiples fragmentos de tejido necrótico que alternan con tejido de granulación e inflamación aguda y crónica, se observa numerosas colónicas de bacterias. No se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en conducto auditivo izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(905, 'Q2107-2418', 'Q', '1002249334', 'LUISA FERENANDA ARCE ZULETA', '000', 'F', '20', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '2020205', '74106', 'Doctor ORLANDO BUSTILLO', NULL, '2021-07-02', '2021-07-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Endometrio" se reciben varios fragmentos de tejido de forma cilíndrica de color pardo oscuro que miden 2 cms. Acompañado de abundante material mucoide. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan endometrio constituido por glandulas dispuestas de forma irregular, tapizadas por epitelio cilíndrico, el estroma fusocelular con vasos de paredes gruesas.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-POLIPO ENDOMETRIAL DE TIPO HIPERPLASICO\r\n', '', ''),
	(906, 'Q2107-2419', 'Q', '1047418139', 'NATALI DEL CRISTO BARRAGAN ECHEVERRIA', '000', 'F', '31', 'SEGUROS BOLIVAR S.A', '', '2020205', '74106', 'Doctor ORLANDO BUSTILLO', NULL, '2021-08-04', '2021-07-01', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Endometrio" masa de tejido de forma irregular de color pardo oscuro y consistencia friable, hemorrágia que mide 3 x 3 cms. Se toma todo y se rotulan A.\r\n2. "Endometrio" fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que hacen un volumen de 2 ml. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan endometrio con reacción de áeras Stella, decidua con focos de necrosis y algunas vellosidades corionicas.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n1.ENDOMETRIO CON REACCIÓN DE ÁREAS STELLA\r\n2.RESTOS OVULARES', '', ''),
	(907, 'L2107-95', 'L', '45526693', 'IBETH DEL CARMEN HINESTROZA CABALLERO', '00', 'F', '41', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-07-02', '2021-07-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "ACAF de mama izquierda" se reciben 10 ml. de un líquido de color blanquecino. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos corresponden a un exudado compuesto por leucocitos PMN, linfocitos y macrófagos sobre un trasfondo proteinaceo. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Aspiración de lesión quística en mama izquierda:\r\n-EXTENDIDO INFLAMATORIO\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(908, 'Q2107-2420', 'Q', '23234533', 'EDITH DEL CAARMEN CASTRO CASTRO', '3007380991', 'F', '60', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-07-06', '2021-07-03', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento eliptico de piel que mide 2.4 x 1.2 cms. en sus mayores dimensiones, la superficie externa de color pardo claro, muestra en su parte central una zona verrucosa de aspecto verrucoso que mide 0.8 cms. y esta separada de los bordes de resección. Al corte de esa zona se encuentra una superficie de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis está engrosada a expensas de una proliferación de células basaloides que rodean espacios que contienen queratina laminar.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel de mama derecha:\r\n-QUERATOSIS SEBORREICA\r\n', '', ''),
	(909, 'Q2107-2421', 'Q', '1047426936', 'MARY CARMEN DIAZ BERRIO', '3135140806', 'F', '35', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-07-21', '2021-07-03', 'JOSÉ CARABALLO GRACIA', 'En un mismo recipiente, rotulado con su nombre, se reciben dos fragmentos de tejido de color pardo amarillento  y consistencia elástica que mide 3.4 x 3 x 2 y 2 x 1.8 x 1.3 cms. ambos fragmentos vienen marcados con reparos. Al corte de la mayor 1 seda margen superior, 2 sedas margen profundo, 3 sedas margen medial. Al corte se observa una superficie de color pardo amarillento que alterna con un área de mal delimitada de color pardo claro y aspecto homogéneo, el área de color pardo claro mide 2.3 x 1 x 0.8 cms. en sus mayores dimensiones. Se toman cortes y se rotulan así: A margen superior, B margen profundo, C margen medial, D lesión.\r\nEl fragmento menor viene marcado con un reparo y al corte se observa una superficie amarillento que alterna con área de color pardo claro, homogéneo.\r\n\r\n', 'El espécimen presenta defectos de fijación.\r\nLos múltiples cortes muestran tejido mamario con canalículos marcadamente dilatados y ocupados por estructuras papiliformes con cambios hiperplásicos severos del epitelio, que presenta, además, atipias moderadas. Hay áreas sólidas con formación de túbulos que muestran secreción de tipo apocrino. No se observan mitosis. Hay focos en los que no es posible establecer con seguridad la presencia o ausencia de infiltración del estroma. La lesión compromete el margen de resección profundo (B). Los márgenes de resección superior (A) y medial (C), están libres de lesión.\r\nLos cambios descritos son sugestivos, pero no concluyentes de una PAPILOMATOSIS INTRADUCTAL CON HIPERPLASIA EPITELIAL SEVERA Y ATIPIAS MODERADAS, sin embargo, deben practicarse estudios de inmunohistoquímica para definir con exactitud si hay infiltración, en cuyo caso debe manejarse como una lesión maligna.\r\n\r\n', ' Biopsia de nódulo retroareolar de mama izquierda:\r\n-VEASE DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(910, 'Q2107-2422', 'Q', '45469697', 'NELSY BATISTA MARTINEZ', '3002177128', 'F', '57', 'PARTICULAR', 'PARTICULAR', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-06', '2021-07-03', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(911, 'Q2107-2423', 'Q', '34975661', 'ROCIO DEL CARMEN ALVAREZ CORREA', '3205217304', 'F', '61', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-06', '2021-07-03', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda promedian mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Polipo de angulo hepático" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de colon:\r\n-ADENOMA TUBULAR\r\n\r\n', '', ''),
	(912, 'Q2107-2425', 'Q', '1234094168', 'CYNTHIA ALEJANDRA ECHEVERRIA BLANCO', '3145812953', 'F', '60', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-06', '2021-07-03', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(913, 'Q2107-2424', 'Q', '45435692', 'KATIA DEL ROSARIO PEREIRA GAZABON', '3145812953', 'F', '60', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-06', '2021-07-03', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre y cedula de ciudadanía, se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(914, 'Q2107-2426', 'Q', '52057823', 'TULIA PATRICIA VIVAS AVENDAÑO', '3208114150', 'F', '48', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-06', '2021-07-03', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(915, 'Q2107-2427', 'Q', '45460337', 'EVELIS OROZCO MELENDEZ', '3187366504', 'F', '63', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(916, 'Q2107-2428', 'Q', '1143406435', 'YOVANA CAROLINA MARQUEZ  VALDEZ', '3007700518', 'F', '23', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Exocervix" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica, parcialmente tapizados por epitelio escamoso con cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n\r\n', '', ''),
	(917, 'Q2107-2429', 'Q', '1047392993', 'KATIA MILENA MESTRE LOPEZ', '3225872526', 'F', '34', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(918, 'Q2107-2430', 'Q', '1143380774', 'JOHANNA DEL CARMEN ALVIS PEREZ', '3215604694', 'F', '26', 'GASTROPACK SAS', 'PARTICULAR', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(919, 'Q2107-2431', 'Q', '1044917515', 'OSCAR SEGUNDO PAJARO PADILLA', '3102131201', 'M', '30', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(920, 'Q2107-2432', 'Q', '1043638342', 'DANIELIS MARIA VILLADIEGO CASTRO', '324338313', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.7 x 1 cms., la superficie externa está cubierta por una serosa despulidacon aumento de la trama vascular. Al corte la pared esta enrgosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n', '', ''),
	(921, 'Q2107-2433', 'Q', '1030242978', 'JOSE DAVID SIERRA BARBOZA', '3043341347', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10.7 x 0.7 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa.\r\nNo se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', '-APENDICE CECAL', '', ''),
	(922, 'Q2107-2434', 'Q', '1238343332', 'ISACC GONZALEZ DAVILA', '3024374345', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.8 x 1.5 x 1 cms. en sus mayores dimensiones. Al corte se observa una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n', '', ''),
	(923, 'Q2107-2435', 'Q', '52915441', 'YURY KATHERINE GANEN ROJAS', '3144102825', 'F', '37', 'ORG. CLINICA GENERAL DEL NORTE', 'ORG.  CLÍNICA GENERAL DEL NORTE', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(924, 'Q2107-2436', 'Q', '1143360314', 'ANGELICA FAISULLY CAMARGO D', '3116782459', 'F', '28', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica, focos de metaplasia escamosa y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n\r\n\r\n', '', ''),
	(925, 'Q2107-2437', 'Q', '1044006980', 'ALINA SIERRA HERAZO', '3008670299', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que en conjunto hacen un volumen de 2 ml. Al corte una superficie de color pardo claro, homogenea. Se toma parte.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n', '', ''),
	(926, 'Q2107-2438', 'Q', '1047487639', 'AUSTIN MARTINEZ HERNANDEZ', '3026591259', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que juntos miden 3 x 2.5 x 1.2 cms. Al corte una superficie de color pardo calro, homogenea. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n', '', ''),
	(927, 'Q2107-2439', 'Q', '1201261897', 'BRIAN CAMILO NIEVES MARTINEZ', '3004788317', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA YAMAL MATTOS', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que juntos mide 3 x 2.2 x 1.2 cms. Al corte una superficie de color pardo calro, homogenea. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n', '', ''),
	(928, 'Q2107-2440', 'Q', '23238235', 'MARGARITA SUSANA HERRERA GOMEZ', '3114211270', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'ORG.  CLÍNICA GENERAL DEL NORTE', '898201', '30215', 'Doctor SAMUEL CANTILLO', NULL, '2021-07-14', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Endometrio" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está constituido en su mayoría por coágulos sanguíneos entre los que se encuentran pequeñas estructuras papiliformes, tapizadas por un epitelio columnar focalmente estratificado y con atípias nucleares.\r\nLos hallazgos son muy sugestivos de un proceso neoplásico de tipo ADENOCARCINOMA, sin embargo lo escaso del material nos impide afirmarlo categóricamente.\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(929, 'Q2107-2441', 'Q', '9055043', 'ARNOLD ENRIQUE PUELLO TORRES', '6613124', 'M', '77', 'CLIN. SAN JOSE DE TORICES SAS', 'ORG.  CLÍNICA GENERAL DEL NORTE', '898201', '30215', 'Doctor JAVIER EDUARDO ACUÑA BARRIOS', NULL, '2021-07-09', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6.5 x 2.5 cms. La superficie externa esta cubierta por una serosa despulida. Al corte la pared esta engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de múltiples calculos pequeños de color parod oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(930, 'Q2107-2442', 'Q', 'VEN19549519', 'NEILA JENIRE PIÑEREZ RODRIGUEZ', '3243044413', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-07-12', '2021-07-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste paraovarico izquierdo" se reciben dos estructuras de aspecto quistico de color pardo claro, translucido y consistencia renitente que miden 1.5 x 0.8 x 0.8 y 1.3 x 0.8 x 0.8 cms. Al corte hay salida de un líquido claro dejando cavidades uniloculares de paredes delgadas. Se toman sendos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran estructuras quisticas tapizadas por un epitelio seroso que reposa en una pared muy delgada.\r\n\r\n\r\n\r\n\r\n', ' Resección de quístes paraovaricos izquierdos:\r\n-HIDÁTIDES DE MORGAGNI\r\n\r\n', '', ''),
	(931, 'Q2107-2443', 'Q', '26005155', 'CIPRIANA ARRIETA NIEVES', '3044363814', 'F', '72', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(932, 'Q2107-2444', 'Q', '1143347020', 'CONNIE ROMERO JUAN', '000', 'F', '30', 'SEGUROS BOLIVAR S.A', '', '898201', '30215', 'Doctor ORLANDO BUSTILLO', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Exocervix" múltiples fragmentos de tejido de aspecto mucoide que juntos hacen un volumen de 1 ml. Se toma todo y se rotulan A.\r\n2. "Endocervix" varios fragmentos de tejido de forma cilíndrica que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n\r\n', 'Los cortes de A estan representados en su mayoría por endocervix con una reacción inflamatoria aguda y crónica, escasa representación de exocervix.\r\nLos cortes de B endometrio del segmento uterino inferior.\r\n\r\n\r\n\r\nNOTA: Se reviso la citología en junta de patologos y se confirma el diagnóstico.\r\n\r\n\r\n', ' Biopsia de cervix:\r\n1.VER DESCRIPCIÓN MICROSCÓPICA\r\n2.FRAGMENTOS DE ENDOMETRIO DEL SEGMENTO UTERINO INFERIOR', '', ''),
	(933, 'Q2107-2445', 'Q', '73550048', 'AMAURY JAIME DE LA ROSA ADUEN', '3123682418', 'M', '49', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(934, 'Q2107-2446', 'Q', '45455832', 'MONICA DEL ROSARIO PARDO LLAMAS', '3106940677', 'F', '57', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa oxíntica sin alteraciones.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA OXÍNTICA SIN ALTERACIONES\r\n\r\n', '', ''),
	(935, 'Q2107-2447', 'Q', '45453377', 'DILIA JOSEFINA RAMOS MIRANDA', '0000', 'F', '58', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Polipo endometrial" un cilíndrico de color pardo oscuro que mide 2.5 cms. Se toma todo y se rotulan A.\r\n2. "Endometrio" múltiples fragmentos de tejido de color pardo oscuro y consistencia friable que juntos hacen un volumen de 3 ml. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan lesión polipoide constituida por glandulas irregulares tapizadas por epitelio de tipo proliferativo, estratificación nuclear, el estroma abundante con vasos sanguíneos gruesos.\r\nLos cortes de B revelan coágulos sanguineos, diminutos fragmentos de epitelio escamoso, endocervix y estroma endometrial.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n1.POLIPO ENDOMETRIAL TIPO HIPERPLASICO\r\n2.VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(936, 'Q2107-2448', 'Q', '1030244409', 'JASLEIDIS VEGA NAVARRO', '3235345684', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa antro corporal cuya lámina propia es edematosa y ligeramente congestiva. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(937, 'Q2107-2449', 'Q', '28900248', 'ADRIANA PATRICIA MENDOZA RUBIANO', '3046043634', 'F', '55', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Polipo gástrico" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-PÓLIPO DE GLÁNDULAS FÚNDICAS', '', ''),
	(938, 'Q2107-2450', 'Q', '42013896', 'MARIA LILIANA HENAO', '300899377', 'F', '46', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2021-07-12', '2021-07-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Utero + trompas" se recibe un utero sin anexos que pesa 273 gms. y mide 10 x 9 x 6 cms. El cuello tapizado por una mucosa de color blanquecino con orificio alargado de forma transversal, el cuerpo por una serosa de color pardo claro es permeable, la cavidad endometrial esta ocupada por una masa blanda que mide 1.5 x 0.5 cms. de color pardo grisáceo. El endometrio es redundante, a nivel intramural se observa una masa blanquecina, arremolinada que mide 3 x 2 cms., a nivel subseroso se observa una masa de iguales características mide 0.5 cms.\r\nPor separado, y sin rotular, se reciben dos segmentos de trompas de Falopio con fimbrias que presentan hidatide de morgagni. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan cervix con una reacción inflamatoria crónica, el endometrio se encuentra autólisado, la masa descrita en cavidad endometrial corresponden a un polipo endometrial tipo hiperplasico. Las masas descritas en el miometrio corresponden a leiomiomas. Las trompas de Falopio presentan hidatide de morgagni.\r\n\r\n\r\n\r\n', ' Utero (273 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTOLISADO\r\n-POLIPO ENDOMETRIAL DE TIPO HIPERPLASICO\r\n-LEIOMIOMAS\r\n-SEGMENTOS DE TROMPAS DE FALOPIO CON HIDATIDE DE MORGAGNI', '', ''),
	(939, 'Q2107-2451', 'Q', '73200297', 'ALEXANDER MUÑOZ MARRUGO', '000', 'M', '35', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898241', '69000', 'Doctor HERNAN CALDERON', NULL, '2021-07-23', '2021-07-09', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Segmento de yeyuno proximal" sin reparo, se recibe un segmento de intestino de color pardo oscuro, la serosa es opaca y tiene un exudado fibrinopurulento que mide 20 x 5 x 3 cms. Al corte hay salida de material hemorrágico, la mucosa de color pardo oscuro y conserva sus pliegues. Se toman cortes así: A y B bordes, C pared de intestino.\r\n2. "Calcificación en pared intestinal" varios fragmentos de tejido de forma irregular el mayor mide 3 cms. de color amarillento y consistencia pétrea. Se toman cortes y se ponen a descalcificar, se rotulan D.\r\n\r\n\r\n', 'Los cortes revelan intestino delgado con áreas extensas de necrosis hemorrágica que compromete todo el espesor de la pared. uno de los bordes comprometido, el otro borde con edema y congestión. \r\nLos cortes D muestran hueso.\r\n\r\n\r\n', ' Segmento de yeyuno proximal (20 cms.):\r\n-NECROSIS HEMORRÁGICA DE LA PARED\r\n-BORDES DE RESECCIÓN UNO DE ELLOS COMPROMETIDOS\r\n-FRAGMENTOS DE HUESO', '', ''),
	(940, 'L2107-96', 'L', '7454101', 'JESUS ORLANDO LIENDO VILLAMIZAR', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2021-07-15', '2021-07-12', 'JOSÉ CARABALLO GRACIA', 'Sin rotular, se reciben 15 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', '', ' Extendido de sedimento urinario (N° 1):\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS ', '', ''),
	(941, 'Q2107-2452', 'Q', '92495164', 'ALFONSO HERNANDEZ TOUS', '3207287686', 'M', '64', 'PARTICULAR', '', '898201', '30215', 'Doctor JAIME OLIVARES TAYLOR', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de piel que mide 1.2 cms. en su mayor dimensión, en la superficie externa presenta una formación de aspetco verrucoso de color pardo oscuro. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis se encuentra engrosada a expensas de una proliferación de células pequeñas, basaloides, que rodean espacios seudoquísticos que contienen queratina laminar. Hay marcada hiperqueratosis superficial.\r\n\r\n\r\n\r\n', ' Resección de lesión en cuero cabelludo:\r\n-QUERATOSIS SEBORREICA', '', ''),
	(942, 'Q2107-2453', 'Q', '45781543', 'CLAUDIA MARGARITA SERRANO RODRIGUEZ', '3235263412', 'F', '41', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Exocervix" se un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. en su mayor diámetro. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de cuello uterino con inflamación crónica y una LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA\r\n-LIE DE BAJO GRADO CON CAMBIOS SECUNDARIOS A INFECCIÓN POR HPV\r\n\r\n\r\n', '', ''),
	(943, 'Q2107-2454', 'Q', '1142932845', 'SHAYERLIS MARIA POSADA VILLALBA', '6753029', 'F', '10', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora BLEYDIE ESPINONOSA ARIZA', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal fragmentada en dos partes que mide 7 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo lcaro con áreas de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(944, 'Q2107-2455', 'Q', '1047477800', 'LIZETH PAOLA AGAMEZ ARRIETA', '6692335', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora JENNIFER TORRES GOMEZ', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor de ovario izquierdo" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 1 cms. en su mayor dimensión, la superficie externa es de color rosado y al corte se observa una cavidad virtual. Se toman cortes.\r\n\r\n\r\n', 'El espécimen está constituido por estructuras papilares tapizadas por epitelio similar al de la trompa de Falopio que reposan en un estroma fibroconectivo muy vascularizado que contiene fibras de musculo liso. Hay, además, focos aislados de glándulas tapizadas por un epitelio similar. En la muestra no se identifica estroma ovárico.\r\nLos hallazgos descritos son altamente sugestivos de una ENDOSALPINGIOSIS OVARICA.\r\nSe sugiere correlacionar los hallazgos de patología con los quirúrgicos.\r\n\r\n', ' Resección de lesión en ovario izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(945, 'Q2107-2456', 'Q', 'VEN29816221', 'NAIROBIS PATRICIA DIAZ NAVAS', '3106858027', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 2.5 cms. la superficie externa esta parcialmente cubierta por una serosa despulida de color verdoso. Al corte las paredes son gruesas, fibrosas, la mucosa es aterciopelada y de color verde oscuro y en la luz se encuentran múltiples cálculos pequeños, irregulares con un diámetro promedio de 0.2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(946, 'Q2107-2457', 'Q', '1070816606', 'VICTOR ALFONSO MENDEZ ROQUEME', '000', 'M', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 0.5 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(947, 'Q2107-2458', 'Q', '1043654113', 'LUIS ENRIQUE QUINTERO MARQUEZ', '00000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'MARGHI LIZET GUERRA PEREZ', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Verruga" se recibe un fragmento alargado de piel que mide 1.5 x 0.3 cms. en sus mayores dimensiones, presenta en general un aspecto verrucoso. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis presenta papilomatosis con hiperqueratosis superficial y acantosis irregular. El dermis es edematoso con densa infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel del pubis:\r\n-PAPILOMA ESCAMOSO', '', ''),
	(948, 'Q2107-2459', 'Q', '1048439043', 'YANIRIS CUADRADO DIAZ', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 3 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa de color pardo claro y al corte se encuentra un tejido de color amarillento y aspecto graso.\r\nNo se encuentra luz periapendicular.\r\n\r\n\r\n\r\n', 'El especimen está compuesto por una pared fibrosa infiltrada por neutrófilos, linfocitos y macrófagos que rodean un núcleo de tejido adiposo.\r\nNo se encuentran elementos propios del apéndice cecal.\r\n\r\n\r\n\r\n', ' Resección de lesión en ciego:\r\n-COMPATIBLE CON APÉNDICE EPIPLÓICO CON INFLAMACIÓN AGUDA\r\n-VER DESCRIPCIÓN MCROSCÓPICA', '', ''),
	(949, 'Q2107-2460', 'Q', '7921236', 'OMAR TAHIRO LEON IRIARTE', '3185659947', 'M', '42', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que promedian un diámetro mayor de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(950, 'Q2107-2461', 'Q', '45743598', 'MARIA MAGDALENA ORELLANO SANCHEZ', '3114304298', 'F', '49', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que promedian un diámetro mayor de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(951, 'Q2107-2462', 'Q', '45428611', 'JUANA ELVIRA BOLQUELMAN PADILLA', '3004868710', 'F', '61', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-14', '2021-07-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que promedian un diámetro mayor de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(952, 'Q2107-2463', 'Q', '45563921', 'DIANELIS MADERO VERGARA', '31538329824', 'F', '36', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Vulva" un fragmento de tejido de color blanquecino que mide 0.7 cms. La superficie externa es sobre elevada. Se toman cortes y se rotulan A.\r\n2. "Cérvix" dos fragmentos de tejido de color pardo claro y aspecto mucoide que miden 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan epitelio escamoso con hiperqueratosis, acantosis, papilomatosis y cambios coilociticos.\r\nLos cortes de B revelan cérvix tapizado por epitelio escamoso, el estroma densamente infiltrado por linfocitos y plasmocitos, no se observan cambios de LIE en la muestra enviada.\r\n\r\n\r\n', '1.Biopsia de vulva:\r\n-CONDILOMA\r\n2.Biopsia de cérvix:\r\n-CERVICITIS AGUDA Y CRÓNICA SEVERA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(953, 'Q2107-2464', 'Q', '1128049572', 'JOHANA JULIO GONZALEZ', '3145630727', 'F', '34', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes se parados y rotulados, se reciben.\r\n1. "Vulva" un fragmento de tejido de color grisáceo que mide 0.1 cm. Se toma todo y se rotulan A.\r\n2. "Vagina" un fragmento de tejido de color blanquecino que mide 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan epitelio escamoso con acantosis, papilomatosis y cambios coilociticos asociados.\r\nLos cortes B revelan vagina tapizada por epitelio escamoso con una neoplasia intraepitelial de bajo grado y cambios coilociticos asociados, el estroma densamente infiltrado por linfocitos, plasmocitos y neutrófilos.\r\n\r\n', '1.Biopsia de vulva:\r\n-CONDILOMA\r\n2.Biopsia de vagina:\r\n-NEOPLASIA INTRAEPITELIAL VAGINAL DE BAJO GRADO (NIVA 1)\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(954, 'Q2107-2465', 'Q', '1052051860', 'XENIA CELIS OROZCO MADARRIAGA', '3114349824', 'F', '28', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan cérvix tapizado por diminuto fragmento de epitelio escamoso sin cambios, áreas extensas de metaplasia escamosa, el estroma infiltrado por linfocitos, plasmocitos y neutrófilos.\r\n\r\n\r\nOBSERVACIONES: No se observan cambios de LIE en la muestra.\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS AGUDA Y CRÓNICA CON ÁREAS EXTENSAS DE METAPLASIA ESCAMOSA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(955, 'Q2107-2466', 'Q', '1047390186', 'YULY PAOLA THORNE LORDUY', '3104604050', 'F', '34', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(956, 'Q2107-2467', 'Q', '33146454', 'MARIELA DEL CARMEN PARDO DE VALDELAMAR', '3157874348', 'F', '68', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vagina" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso con hiperqueratosis, papilomatosis, acantosis y cambios coilociticos asociados.\r\n\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-CONDILOMA ACUMINADO\r\n', '', ''),
	(957, 'Q2107-2468', 'Q', '9130045', 'JAVIER DE JESUS TORRES POSADA', '3106500048', 'M', '69', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Pólipo gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y  0.1 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\nLos cortes de B revelan mucosa gástrica corporal con inflamación crónica leve.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-PÓLIPO DE GLÁNDULAS FÚNDICAS\r\n2.Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA OXÍNTICA CON INFLAMACIÓN CRÓNICA LEVE', '', ''),
	(958, 'Q2107-2469', 'Q', '1043326192', 'THIAGO ENRIQUE MORENO BAYUELO', '3017485674', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 4 cms. La serosa es de color verdoso. Al corte salida de liquido biliar en abundante cantidad, la presencia de un calculo de 0.6 cms. La mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar que muestra la estructura usual. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', '-COLELITIASIS\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(959, 'Q2107-2470', 'Q', '1238346429', 'KELIANYS JULITH REDONDO BATISTA', '3116710748', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-07-28', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste dermoide" se reciben dos fragmentos de tejido de color amarillento y aspecto adiposo que promedian 1 cm. Al corte una cavidad de aspecto quistico de 0.2 cms. \r\n\r\n\r\n\r\n', 'Los cortes revelan vasos de diferentes tamaños algunos contienen linfa en su interior y están tapizados por endotelio aplanado, descansan en un tejido fibroso.\r\n\r\n\r\n', ' Extirpación de lesión en región intercostal izquierda:\r\n-COMPATIBLE CON LINFANGIOMA\r\n\r\n', '', ''),
	(960, 'Q2107-2471', 'Q', '1050004779', 'MARIANELA PAEZ RODRIGUEZ', '3126393779', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mama derecha" se recibe una masa de tejido de forma ovoidea de color blanquecino y consistencia elástica que mide 3.2 x 2.7 x 2.2 cms. Al corte una superficie blanquecina multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesión en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(961, 'Q2107-2472', 'Q', '1041996309', 'LAURENT SOFIA FUENTES PARRA', '3005342126', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ', NULL, '2021-07-30', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor benigno de tronco" se recibe una masa de tejido de forma ovoidea, bilobulada que mide 0.8 cms. de color pardo rosado y consistencia elástica. Al corte una superficie lisa de color pardo rosado. \r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se encuentra una proliferación de células fusiformes y epiteliales, algunas de las cuales, en la proximidad de la epidermis contiene pigmento melánico. Hay actividad de unión representada por nidos de células epitelioides (tecas). No se encuentra alteración de la epidermis ni migración melanocítica hacia la misma.\r\n\r\n\r\n', ' Resección de lesión en piel del tronco:\r\n-COMPATIBLE CON NEVO DE CÉLULAS FUSIFORMES Y EPITELIOIDES (NEVO DE SPITZ)\r\n\r\n\r\n\r\n', '', 'Es necesario practicar estudios de inmunohistoquímica para confirmación diagnóstica.\r\nEste caso fué estudiado en conjunto por los doctores José Caraballo y Olivia Marrugo y hubo consenso.\r\n\r\n\r\n'),
	(962, 'Q2107-2473', 'Q', '1048444521', 'NICOL CRISTAL CASSIANI ZUÑIGA', '3242070931', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Verruga dorso" en un mismo recipiente, se reciben dos fragmentos de tejido de forma redondeada que promedian 0.5 y 0.4 cms.  de color pardo claro. Se toman cortes y se rotulan así: A fragmento mayor y B fragmento menor.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan marcada hiperqueratosis con paraqueratosis, hipergranulosis y la presencia de células vacuoladas grandes.\r\n\r\n\r\n\r\n\r\n', '-VERRUGAS VULGARES, piel dorso mano izquierdo', '', ''),
	(963, 'Q2107-2474', 'Q', '73091897', 'WILFRIDO MARIMON TRESPALACIOS', '000', 'M', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor en espalda" se recibe un fragmento de tejido de color pardo oscuro que mide 1 cm. que parece corresponder a la pared de un quíste. \r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmentos de epitelio escamoso y queratina laminar.\r\n\r\n\r\n\r\n', '-COMPATIBLE CON QUÍSTE EPIDERMICO DE INCLUSIÓN, espalda', '', ''),
	(964, 'Q2107-2475', 'Q', '1043636814', 'ANGIE NICOLL ALCAZAR VERGARA', '000', 'F', '17', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa región lumbar" se reciben cinco fragmentos de tejido de forma alargada que promedian 1 cm. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n\r\n', '-QUÍSTE EPIDERMOIDE, región lumbar', '', ''),
	(965, 'Q2107-2476', 'Q', '23118586', 'LUZ MARINA BANQUEZ DE CONDE', '000', 'F', '77', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898241', '69000', 'Doctores JOSE RODRIGUEZ BLANCO', NULL, '2021-10-29', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben :\r\n1. "Segmento pulmonar, lóbulo superior izquierdo" se recibe un segmento de pulmón que mide 8 x 3 x 3 cms. La superficie externa es de color pardo grisáceo la consistencia es elástica. Al corte y a 3 cms. de la sutura se observa lesión blanquecina, firme que mide 2.6 x 1 cms. Se toman cortes y se rotulan A.\r\n2. "Pleura parietal" un fragmento de tejido, ovoide que mide 0.5 cms. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes revelan pulmón con un tumor epitelial maligno constituido por formaciones glandulares, irregulares tapizadas por células que muestran hipercromátismo, pleomorfismo nuclear, hay presencia de pequeños nidos sólidos. \r\nLa lesión toca el borde de resección. No se identifico invasión pleural ni linfovascular.\r\nEl segmento de pleura parietal sin cambios.\r\n', '1.Segmentectomía lóbulo superior izquierdo:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n-TAMAÑO TUMORAL: 2.6 x 1 cms. \r\n-NO SE IDENTIFICO INVASIÓN PLEURAL \r\n-NO SE IDENTIFICO INVASIÓN LINFOVASCULAR \r\n-LA LESIÓN TOCA EL BORDE DE RESECCIÓN\r\n2.FRAGMENTO DE PLEURAL PARIETAL SIN CAMBIOS\r\n\r\n\r\nNOTA: Se retiran 10 bloques por la señor CENITH CONDE BANQUEZ CC. 45.505.960 (28 de octubre/2021)', '', ''),
	(966, 'Q2107-2477', 'Q', '1067930333', 'FRAY DAVID RODRIGUEZ PATERNINA', '3003317458', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. la serosa es opaca y despulida. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(967, 'Q2107-2478', 'Q', '1201254911', 'SALOME SILGADO ARRIETA', '3225196373', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-07-16', '2021-07-15', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que juntos promedian 2 ml. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA', '', ''),
	(968, 'L2107-97', 'L', '7454101', 'JESUS ORLANDO LIENDO VILLAMIZAR', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2021-07-16', '2021-07-16', 'VIRNA CARABALLO OSORIO', 'Sin rotular, se reciben 8 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos muestran escasas células escamosas maduras sin cambios.\r\n\r\n\r\n\r\n\r\n', ' Citología de orina:\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS', '', ''),
	(969, 'Q2107-2479', 'Q', '30776614', 'NINFA MORENO ARELLANO', '3203822443', 'F', '49', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor Luis Javier Alzamora', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Exocervix" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Vulva" un fragmento de piel forma irregular de color pardo grisáceo y consistencia blanda que mide 0.3 cms. en sus mayores dimensiones. Se toma todo en dos cortes, y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de cuello uterino con una reacción inflamatoria crónica, focos de metaplasia escamosa y cambios citopáticos por VPH.\r\nLos cortes rotulados B muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n', '1-Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFLAMACIÓN POR VPH).\r\n2-Biopsia de vulva:\r\n-CONDILOMA.\r\n\r\n\r\n', '', ''),
	(970, 'Q2107-2480', 'Q', '22468982', 'ARYDAY ESPINA ERDENES', '3005220060', 'F', '35', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA ', NULL, '2021-07-21', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.7 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno epitelial compuesto por células pequeñas y medianas con núcleos irregulares, hipercromáticos, con abundantes figuras de mitosis, que se disponen formando masas sólidas que infiltran el estroma circundante. Hay áreas extensas de necrosis. Se observa, además, áreas tumorales con células de citoplasma claro.\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CARCINOMA MAL DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(971, 'Q2107-2481', 'Q', '9055643', 'JORGE ARTURO MAESTRE YEPES', '3017383970', 'M', '76', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA.\r\n\r\n\r\n\r\n\r\n\r\n\r\n ', '', ''),
	(972, 'Q2107-2482', 'Q', '1048443806', 'SAMUEL ALEJANDRO RUIZ MUÑOZ', '3003064154', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 1.5 X 0.8 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta engrosada y la luz puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n', '', ''),
	(973, 'Q2107-2483', 'Q', '1143418061', 'DAILER ALEJANDRO PACHECO PUERTA', '3008685502', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor CARLOS ALBERTO BALLESTAS ALMARIO', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Dona derecha" un testículo marcado con un vicryl mide 2 x 1.5 cms. trae un segmento de cordón espermático marcado con gasa mide 2.2 x 0.7 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Túnica albugínea" un fragmento de tejido de forma irregular de aspecto membranoso que mide 4.5 x 1.5 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran testículo compuesto por túbulos seminíferos pequeños sólidos, inmaduros. No se observan cambios neoplásicos.\r\nLos cortes rotulados B muestran un fragmento de tejido fibroconectivo bien vascularizado parcialmente tapizado por un mesotelio.\r\n\r\n\r\n', '1.TESTICULO INFANTIL, (ATRÓFICO)\r\n2.TÚNICA ALBUGINEA (fragmentos)', '', ''),
	(974, 'Q2107-2484', 'Q', '1051418477', 'JESUS DAVID GRAU ANAYA', '3122804521', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS MORENO BALLESTEROS', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10.3 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n', '-APÉNDICE CECAL.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(975, 'Q2107-2485', 'Q', '1048459625', 'JEAN DANIEL DE HORTA FIGUEROA', '3202700636', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-07-21', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos. \r\nLos cortes rotulados C muestran mucosa duodenal que conserva su morfología habitual. Hay edema e infiltración linfoplasmocitaria de la lámina propia.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(976, 'Q2107-2486', 'Q', '1140514586', 'LUIS FERNANDO VASQUEZ OLAVE', '3146857695', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DoctorLUIS RAMON MORENO BALLESTEROS', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4.5 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n', 'Los cortes muestran Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n', '', ''),
	(977, 'Q2107-2487', 'Q', '79883354', 'JULIAN ALBERTO SOTO NIÑO', '3158685716', 'M', '40', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA.\r\n\r\n\r\n\r\n\r\n ', '', ''),
	(978, 'Q2107-2488', 'Q', '8736383', 'OTTO MARQUEZ PEREZ', '3024574714', 'M', '58', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA.\r\n\r\n\r\n\r\n\r\n ', '', ''),
	(979, 'Q2107-2489', 'Q', '1047453722', 'MARIA PAZ LAMBIS MELENDEZ', '000', 'F', '28', 'PARTICULAR', '', '898201', '30215', 'Doctor CARLOS EDUARDO ROMAN HERAZO', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama tejido adiposo derecho" cinco fragmentos de tejido de forma irregular de color pardo amarillento y aspecto adiposo que juntos pesan 1216 gms. y juntos miden 21 x 17 x 6 cms. La superficie externa del fragmento menor esta parcialmente cubierto por piel el fragmento mide 23 x 14 x 5.5 cms. y la piel que lo recubre parcialmente mide 17.5 x 13 cms. Al corte se observa un tejido de color pardo claro y aspecto fibroso que alternan con áreas de color amarillento y aspecto adiposo. Se toman cortes y se rotulan A.\r\n2. "Mama tejido adiposo izquierdo" múltiples fragmentos de tejido de color pardo amarillento y aspecto adiposo juntos pesan 1019 gms. y juntos miden 21.5 x 13.5 x 7.5 cms. El fragmento mide 21.5 x 10 x 6 cms. esta parcialmente cubierto por piel mide 16.7 x 18.3 cms. La cara posterior muestra una superficie cruenta y los múltiples cortes muestran una superficie de color pardo claro y aspecto homogéneo que alternan con un tejido amarillento y aspecto adiposo. No se observan masas. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejido mamario cuya morfología está alterada por la presencia de quistes de pequeño calibre que reposan en un estroma colagenizado. No se observan cambios proliferativos.\r\n\r\n\r\n\r\n', ' Mamoplastia de reducción bilateral:\r\n1.CONDICIÓN FIBROQUISTICA, mama derecha\r\n2.CONDICIÓN FIBROQUISTICA, mama izquierda', '', ''),
	(980, 'Q2107-2490', 'Q', '45464941', 'MARIA PARRA ORTEGON', '000', 'F', '56', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-19', '2021-07-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(981, 'Q2107-2491', 'Q', '23083978', 'DIANA ISABEL ESCANDON DE SALCEDO', '000', 'F', 'NaN', 'PARTICULAR', '', '898201', '30215', 'Doctor BETTY MORALES', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo. \r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(982, 'Q2107-2492', 'Q', '1043968748', 'LAURA VALENTINA GOMEZ JIMENEZ', '3153043367', 'F', '15', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Esófago" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso hiperplásico con hiperplasia de la basal, vasos intraepiteliales con algunos eosinófilos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de esófago:\r\n-ESOFAGITIS PEPTICA\r\n\r\n', '', ''),
	(983, 'Q2107-2493', 'Q', '13457636', 'PABLO SUAREZ ANGARITA', '3042177574', 'M', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(984, 'Q2107-2494', 'Q', '1050954581', 'GLORIA PATRICIA HERNANDEZ DE VOZ', '3008339558', 'F', '31', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad severa, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes de B revelan duodeno que muestra aplanamiento parcial de las vellosidades, la lámina propia muestra un infiltrado mononuclear severo.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD SEVERA\r\n-H.PYLORI PRESENTE\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA CON APLANAMIENTO PARCIAL DE LAS VELLOSIDADES', '', ''),
	(985, 'Q2107-2495', 'Q', '1043647208', 'MIGUEL ANGEL CABARCAS DIAZ', '6637214', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared densamente infiltrada por abundantes PMN neutrófilos que se extiende hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n\r\n', '', ''),
	(986, 'Q2107-2496', 'Q', '1043997313', 'BRYAN ENRIQUE PATERNINA MARTINEZ', '3003598210', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora NELLYS RODRIGUEZ ZULETA', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 3 x 2 x 0.5 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina que mide 3 x 2 x 0.5 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular  de color blanquecino que mide 2 x 1 cms. Se toman cortes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes de C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA', '', ''),
	(987, 'Q2107-2497', 'Q', '1067909413', 'CAMILA ANDREA VICTOR PASTRANA', '3114266475', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'MARGHI LIZET GUERRA PEREZ', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Liquen" se recibe un punch de piel que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso con hiperqueratosis, acantosis irregular del epitelio y un infiltrado inflamatorio perivascular superficial mediado principalmente por linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión en labio mayor izquierdo:\r\n-LIQUEN SIMPLE CRÓNICO\r\n', '', ''),
	(988, 'Q2107-2498', 'Q', '1043658470', 'VALENTINA NOGREIRA CASSIANI', '321598320', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa opaca bien vascularizada, trae adherido material fibrinopurulento. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(989, 'Q2107-2499', 'Q', '1201255464', 'DAYANIS CARO GALINDO', '3188113969', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Granulomas glóticos" se reciben dos fragmentos de forma irregular de tejido de color blanquecino que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmentos de tejido de granulación.\r\n\r\n\r\n\r\n', '-FRAGMENTOS DE TEJIDO DE GRANULACIÓN, glotis', '', ''),
	(990, 'Q2107-2500', 'Q', '1041975305', 'ANDRES MAURICIO PUERTA BATISTA', '3045547236', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. tapizada por una serosa opaca bien vascularizada, trae adherido material fibrinopurulento. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared densamente infiltrada por abundantes PMN neutrófilos que se extiende hasta la grasa periapendicular.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECRÓTIZANTE\r\n', '', ''),
	(991, 'Q2107-2501', 'Q', '1007939057', 'MARIA ISABEL GALVIZ GARCIA', '3005423173', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'MARGHI LIZET GUERRA PEREZ', NULL, '2021-07-23', '2021-07-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Líquen corneo hipertrofico-nevo epidérmico" se recibe un punch de piel que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel con hiperqueratosis, acantosis irregular, el dermis papilar muestra fibrosis dérmica y un infiltrado perivascular superficial mediado principalmente por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de piel glúteo derecho:\r\n-LIQUEN SIMPLE CRÓNICO', '', ''),
	(992, 'Q2107-2502', 'Q', '1050742039', 'AYLIN HOYOS LOPEZ', '3114373423', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Unión ileocecal" un segmento de intestino  representado por 7 cms. de longitud del íleon y 13 cms. del ciego y colon ascendente, la superficie externa esta cubierta por una serosa despulida de color violáceo. Al corte el ciego y colon ascendente están ocupados por un segmento invaginado del íleon que se extiende hasta 9 cms. dentro del colon. en el segmento del íleon invaginado se encuentra una masa ovoide que mide 4 x 1.5 cms. que presenta una superficie externa irregular de color violáceo y al corte una superficie de aspecto hemorrágico, se toman cortes de esta área y se rotulan A. El apéndice cecal, incluido en el área invaginado presenta un aspecto necrótico, hemorrágico así como la pared del ciego. Se toman cortes del apéndice y ciego y se rotulan B, C línea de resección proximal, D línea de resección distal.\r\n2. Un segundo recipiente, rotulado "Colon transverso" contiene un segmento de colon de 15 cms. de longitud y 2 cms. de diámetro, la superficie externa esta cubierta por una serosa despulida y al corte, la luz esta vacía y la mucosa conserva su morfología habitual. Se toman cortes así: E pared de colon, F margen proximal, G margen distal.\r\n\r\n\r\n', 'Los cortes rotulados A muestran pared de intestino delgado con necrosis hemorrágica en la que se distingue en la submucosa un tejido linfoide con cambios hiperplásicos. La pared del ciego y el apéndice (B) muestran asi mismo cambios necróticos hemorrágicos. Las líneas de resección proximal (C) y distal (D) son viables.\r\nLos cortes rotulados E, F y G muestran pared de colon con discreto edema y congestión.\r\n\r\n\r\n', '1.Hemicolectomía derecha extendida:\r\n-INVAGINACIÓN INTESTINAL ILEOCÓLICA CON NECROSIS HEMORRÁGICA DE ILEÓN, CIEGO, APÉNDICE Y PARTE DE COLON ASCENDENTE\r\n-LÍNEAS DE RESECCIÓN VIABLES\r\n2.Resección parcial de colon transverso:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(993, 'Q2107-2503', 'Q', 'VEN277-02', 'HIJA DE JULEIDIS PAOLA ZUARES PADILLA', '3178267876', 'F', '0', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDGAR FRANCISCO FRANCO', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Intestino medio" se recibe un segmento de intestino esta agrupado alrededor de un tallo de aspecto fibroso, al abrirlo mide 28 cms. de longitud, la superficie externa esta cubierta por una serosa de color verdoso y al corte se encuentra una luz vacía con una mucosa aplanada y una pared muy delgada. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran pared intestinal que en un área muestra características histológicas de colon y en otra características de intestino delgado. En este último se observan cambios de necrosis.\r\n\r\n\r\n\r\n\r\n', ' Resección parcial de intestino medio:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(994, 'Q2107-2504', 'Q', '73210207', 'LEONARDO DAVID ATENCIA CARABALLO', '6457536', 'M', '36', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR GONZALEZ', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lesión granulomatosa" un fragmento de tejido de forma irregular, mide 5 x 2.5 x 1.5 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro con áreas de color amarillentas y la consistencia es blanda elástica. Al corte se encuentra una superficie irregular que parece corresponder a una pared de color pardo claro con áreas amarillentas. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Apéndice" se recibe un apéndice cecal que mide 4.5 x 0.8 cms. en sus mayores dimensiones esta cubierta por una serosa lisa y brillante de color pardo claro y al corte se encuentra una luz puntiforme. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'El espécimen (cortes A) está compuesto por tejidos fibroso, adiposo y muscular liso con edema y ligera infiltración mononuclear. No se encuentran granulomas ni actividad inflamatoria.\r\nLos hallazgos recuerdan lo encontrado en un saco herniario.\r\nLos cortes rotulados B muestran apéndice cecal cuya morfología está preservada.\r\n\r\n\r\n', '1.Resección de masa en región inguinal derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.APÉNDICE CECAL', '', ''),
	(995, 'Q2107-2505', 'Q', '1043657377', 'YORJAILY OVIEDO MUÑOZ', '3157174997', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo oscuro, con vasos prominentes. Al corte se emcuentra una luz luz dilatada que contiene un viscoso de aspecto purulento. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(996, 'Q2107-2506', 'Q', '1201228585', 'CAMILO CONTRERAS QUIROZ', '3042099358', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular, de color pardo claro y consistencia elástica que en conjunto hacen un volumen de 3 ml. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(997, 'Q2107-2507', 'Q', '1067885064', 'JOSE ANGEL MARTINEZ HERNANDEZ', '3145791969', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar piriforme que mide 10 x 2.5 cms. La superficie externa esta parcialmente cubierta por una serosa despulida de color verde oscuro. Al corte las paredes son delgadas, la mucosa es aterciopelada de color verde oscuro y la luz contiene una bilis espesa con formación de grumos, irregulares de consistencia firme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar cuya morfología está preservada. No se encuentran cambios inflamatorios.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLELITIASIS\r\n\r\n', '', ''),
	(998, 'Q2107-2508', 'Q', '1143381498', 'JAIDER DAVID RICARDO LOPEZ', '3155096908', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.4 cms., la superficie externa está cubierta por una serosa ligeramente irregular, de color pardo claro. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. En un mismo recipiente, se recibe, además, un fragmento de tejido de forma irregular de color pardo amarillento y consistencia blanda que mide 4.5 x 2.5 x 1 cms. Al corte presenta una superficie de color pardo claro con áreas de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nOtros cortes muestran tejido fibroadiposo con inflamación aguda.\r\n\r\n\r\n', '1.APENDICITIS AGUDA\r\n2.FRAGMENTO DE EPIPLÓN CON INFLAMACIÓN AGUDA\r\n', '', ''),
	(999, 'Q2107-2509', 'Q', '73180248', 'JANER RAFAEL CARABALLO POLO', '000', 'M', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor EDUARDO QUINTERO', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Segmento de yeyuno" se recibe un segmento de intestino delgado que mide 7 x 2 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa de color pardo oscuro en la que se observan dos orificios irregulares, uno de 1.2 cms. de diámetro y el otro, hacia el lado mesentérico de 0.5 cms. Al corte la mucosa conserva su forma habitual y los orificios presentan un borde irregular. Se toman cortes las líneas de resección.\r\n\r\n\r\n\r\n', 'Los cortes muestran intestino delgado con zona de pérdida de la continuidad de la pared de bordes irregulares. Los márgenes de resección son viables.\r\n\r\n\r\n\r\n', ' Resección parcial de yeyuno:\r\n-PERFORACIÓN TRAUMÁTICA\r\n-MÁRGENES DE RESECCIÓN VIABLES\r\n', '', ''),
	(1000, 'Q2107-2510', 'Q', '1201271601', 'MARIA BELEN MARTINEZ PEREZ', '3216386369', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Aritenoide izquierda" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Aritenoide derecha" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A  y B muestran mucosa laríngea tapizada por epitelio escamoso que reposa en una lámina propia edematosa con infiltración linfoplasmocitaria subepitelial.\r\n\r\n\r\n\r\n', '1.Biopsia de mucosa aritenoidea derecha:\r\n-INFLAMACIÓN CRÓNICA\r\n2.Biopsia de mucosa aritenoidea izquierda:\r\n-INFLAMACIÓN CRÓNICA', '', ''),
	(1001, 'Q2107-2511', 'Q', '51577270', 'AMPARO VELASQUEZ CASTILLO', '3107900098', 'F', '61', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-07-23', '2021-07-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1002, 'L2107-98', 'L', '7454101', 'JESUS ORLANDO LIENDO VILLAMIZAR', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2021-07-23', '2021-07-23', 'ANA MAGOLA MANGA CEDEÑO', 'Sin rotular, se reciben 5 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de orina (# 3):\r\n-EXTENDIDO ACELULAR\r\n', '', ''),
	(1003, 'Q2107-2512', 'Q', '30855928', 'DIANA PATRICIA CASTRO TERAN', '3222914665', 'F', '43', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA DE LOS ANGELES ZUÑIGA ALARCON', NULL, '2021-07-28', '2021-07-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1004, 'Q2107-2513', 'Q', '1043998647', 'ANTONELLA ORREGO SEBA', '3168168277', 'F', '6', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-07-28', '2021-07-23', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.3 cms. Se toma todo y se rotulan E.\r\n\r\n', 'Los cortes A muestra fragmentos de mucosa esofágica sin cambios.\r\nLos cortes de B revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes de C revelan mucosa gástrica oxíntica con inflamación crónica leve.\r\nLos cortes de D y E muestran la morfología habitual.\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE MUCOSA ESOFAGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estomago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n3.Biopsia endoscópica de estomago (cuerpo):\r\n-MUCOSA GASTRICA OXÍNTICA CON INFLAMACIÓN CRÓNICA LEVE\r\n4.Biopsia endoscópica de bulbo y segunda porción del duodeno:\r\n-MUCOSA DE BULBO Y DUODENO SIN CAMBIOS', '', ''),
	(1005, 'Q2107-2514', 'Q', '1000706865', 'SANTIAGO ANDRES GONZALEZ MENDOZA', '3224420356', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-28', '2021-07-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" s e recibe un apéndice cecal fragmentada que mide 4 x 1.5 x 1 cms. La serosa es grisácea y despulida. Al corte la luz ocupada por material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1006, 'Q2107-2515', 'Q', '1082883245', 'BETSY LILIANA LOPEZ SERRANO', '3042193908', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE PRETELT MENDOZA', NULL, '2021-07-28', '2021-07-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nevo neoplásico en nariz" se recibe una elipse de piel redondeada de 0.5 x 0.5 cms. en la superficie externa muestra pequeñas áreas sobreelevadas. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se observa una lesión tumoral benigna constituida por una proliferación de células nevicas en un patrón difuso.\r\n\r\n\r\n\r\n', ' Biopsia de piel de nariz:\r\n-NEVUS MELANOCITICO INTRADERMICO\r\n', '', ''),
	(1007, 'Q2107-2516', 'Q', '1047512167', 'LILIANA ZULANGELY MERCADO PEREZ', '3004480932', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-28', '2021-07-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" s e recibe un apéndice cecal que mide 8 x 0.9 cms. La serosa es grisácea y despulida. Al corte la luz ocupada por material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1008, 'Q2107-2517', 'Q', '1044016666', 'SAMUEL DAVID PESTANA BALLESTAS', '0000', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-28', '2021-07-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Segmento de invaginación intestinal" se recibe el producto de una invaginación intestinal, el segmento de colon ascendente de 9 x 1.5 cms. la serosa es brillante y congestiva. Al corte la mucosa muestra la estructura usual. El segmento de ciego esta tapizado por una serosa de color azulado por el que protruye la cabeza de la invaginación, la pared del ciego es de color oscuro y congestiva, el segmento de ileon mide 8 cms. la serosa es congestiva y la mucosa es de color oscuro. El apéndice cecal mide 4 cms. y muestra la estructura usual. Se toman cortes así: A colon ascendente, B pared intestino delgado (sitio de invaginación), C pared de ciego, D apéndice.\r\n\r\n', 'Los cortes A revelan mucosa colónica con edema de la pared.\r\nLos cortes B revelan pared  de intestino delgado con edema, congestión vascular focos de necrosis e inflamación aguda.\r\nLos cortes C revelan pared de ciego con congestión vascular, edema e inflamación aguda.\r\nLos cortes D revelan apéndice cecal sin cambios.\r\n', ' Hemicolectomía derecha:\r\n1.PARED COLONICA CON EDEMA E INFLAMACIÓN AGUDA Y CRÓNICA LEVE\r\n2.PARED DE INTESTINO DELGADO CON EDEMA, CONGESTIÓN VASCULAR Y FOCOS DE NECROSIS E INFLAMACIÓN AGUDA\r\n3.PARED DE CIEGO CON CONGESTIÓN VASCULAR, EDEMA E INFLAMACIÓN AGUDA\r\n4.APÉNDICE CECAL SIN CAMBIOS\r\n-ANTECEDENTE DE INVAGINACIÓN INTESTINAL', '', ''),
	(1009, 'L2107-99', 'L', '22771614', 'ANA ELENA MANRIQUE DE LEON', '318316392', 'F', '83', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor: CARLOS OSORIO - ANTONIO HERAZO', NULL, '2021-07-27', '2021-07-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "ACAF de seno derecho" se reciben 10 ml. de un liquido de color pardo rojizo. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', 'Los extendidos muestran escasos histiocitos y escasas células epiteliales escamosas sin cambios que reposan en un trasfondo hemorrágico.\r\n\r\n\r\n\r\n', ' ACAF de mama derecha:\r\n-CITOLOGIA NEGATIVA PARA CELULAS MALIGNAS\r\n\r\n', '', ''),
	(1010, 'Q2107-2518', 'Q', '45440047', 'LUZ MARINA RAMIREZ ACOSTA', '3137052215', 'F', '60', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva"  se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(1011, 'Q2107-2519', 'Q', '30766213', 'ZULAY CATALINA ALJURE MARTINEZ', '0000', 'F', '46', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '', '', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE', '', ''),
	(1012, 'Q2107-2520', 'Q', '1102809264', 'JACQUELINE ISABELLA ANGELONE QUIROGA', '3006605877', 'F', '35', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1013, 'Q2107-2521', 'Q', '31253370', 'MARTHA ELVIRA GARCIA DE BENEDETTI', '3006656903', 'F', '67', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1014, 'Q2107-2522', 'Q', '17190797', 'HERNANDO RAFAEL ARRIETA LEONES', '3218246620', 'M', '74', 'GASTROPACK SAS', 'MAPFRE', '898201', '30215', 'Doctor ISMAEL YEPES', NULL, '2021-07-29', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Polipo de ciego" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Colon descendente" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan C.\r\n4. "Polipo de sigma" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B y C muestran una estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\nLos cortes rotulados D muestran mucosa colónica con edema, congestión e infiltración mononuclear de la lámina propia. No se observan parásitos, granulomas, disminución del moco ni cambios de pólipo.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Resección endoscópica de lesión en ciego:\r\n-ADENOMA TUBULAR\r\n3.Resección endoscópica de lesión en colon descendente:\r\n-ADENOMA TUBULAR\r\n4.Biopsia endoscópica de mucosa de colon sigmoide:\r\n-COLITIS CRÓNICA INESPECIFICA\r\n', '', ''),
	(1015, 'Q2107-2523', 'Q', '33337682', 'MARTHA JUDITH HERRERA DE OSPINO', '3017944907', 'F', 'NaN', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS POR INFECCIÓN POR VPH)\r\n\r\n\r\n', '', ''),
	(1016, 'Q2107-2524', 'Q', '30764231', 'DEVIS MARTINEZ REYES', '3166162907', 'F', '52', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-07-29', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de mama izquierda" se recibe un fragmento de tejido de forma irregular, de color pardo amarillento y aspecto adiposo que mide 4.3 x 3 x 1.5 cms. La superficie externa es irregular y viene con tres reparos. Al corte se observa una superficie de color paro claro que alternan con áreas de color amarillento, el área de color pardo claro mide 2.5 x 1 x 1 cms. Se toman cortes y se rotulan así: A margen en relación a 1 reparo, B margen en relación a 2 reparos, C margen en relación a 3 reparos.\r\n\r\n\r\n', 'Los cortes rotulados A, B y C muestran tejido mamario subareolar cuya morfología está alterada por la presencia de conductos dilatados, algunos quísticamente, tapizados por un epitelio aplanado y con contenido de un material grumoso, proteinaceo. En la periferia de algunos de estos conductos se observa fibrosis y una reacción inflamatoria crónica mediada por linfocitos y células plasmáticas. Algunos de estos conductos muestran además leves cambios hiperplásicos del epitelio.\r\nNo se encuentran cambios neoplásicos.\r\n\r\n\r\n', ' Resección de lesión en mama izquierda:\r\n-ECTASIA DUCTAL', '', ''),
	(1017, 'Q2107-2525', 'Q', '33333851', 'ARLINE JULIO DE AVILA', '3126305917', 'F', '54', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n\r\n', '', ''),
	(1018, 'Q2107-2526', 'Q', '1142917501', 'YORGELIS PAOLA CRUZ JIMENEZ', '3104471184', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIERREZ', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se reciben dos segmentos de apéndice cecal que juntos mide 7.3 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1019, 'Q2107-2527', 'Q', '1064191089', 'LAURA VANESA VELASQUEZ ALVAREZ', '3013846109', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estomago" cinco fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\nLos cortes rotulados B muestran mucosa duodenal que conserva la morfología habitual. No se observan parasitos, granulomas ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n2.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS', '', ''),
	(1020, 'Q2107-2528', 'Q', '1201219819', 'KEINER DAVID VENECIA LEMO', '3205907723', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.4 x 0.8 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1021, 'Q2107-2529', 'Q', '1042580887', 'ROINER DANIEL BELLO JIMENEZ', '3205780495', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 5.9  x2 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por una serosa despulida. Al corte la pared esta engrosada la mucosa ha perdido su aspecto aterciopelado y hay salida de escasos cálculos de color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1022, 'Q2107-2530', 'Q', '1050976800', 'ANA ELENA PEREZ CABARCAS', '000', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Embarazo ectópico" se recibe una trompa de Falopio que mide 8 cms. de longitud, y se encuentra marcadamente dilatada en el segmento proximal y mide 2.8 cms. de grosor, la superficie externa esta cubierta por una serosa lisa y brillante. Al corte se observa una cavidad que contiene un material blando, de color pardo claro que mide 0.8 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran trompa de Falopio marcadamente dilatada en cuya luz se observan vellosidades coriales sin cambios que alternan con coágulos sanguíneos.\r\n\r\n\r\n\r\n', ' Salpingectomía izquierda:\r\n-EMBARAZO ECTOPICO', '', ''),
	(1023, 'Q2107-2531', 'Q', '1049825629', 'MARYURIS AVILA CORTINA', '000', 'F', '36', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor RAFAEL DIAZ', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Restos ovulares" se reciben multiples fragmento de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 4 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'El espécimen esta constituido por fragmentos de endometrio hipersecretor con reacción de ARIAS-STELLA que alternan con coágulos sanguíneos. No se observan elementos trofoblásticos.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE ENDOMETRIO HIPERSECRETOR CON REACCIÓN DE ARIAS-STELLA\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(1024, 'Q2107-2532', 'Q', '72182670', 'ALEXANDER ALBERTO DOMINGUEZ BOLAÑO', '000', 'M', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor PEDRO IMBETH ACOSTA', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(1025, 'Q2107-2533', 'Q', '33248488', 'DALIA ELENICE YANEZ OROZCO', '000', 'F', '45', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero, cuello, trompa y ovario derecho" se recibe un útero con su anexo uterino derecho que pesa 146 gms. y mide 9.8 x 7 x 4.8 cms. El cérvix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta ligeramente deformado de tamaño. La superficie externa esta parcialmente cubierta por una serosa lisa y brillante. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa gruesa de color pardo oscuro y el miometrio ocupado por múltiples masas de color blanquecino y aspecto arremolinado la mayor mide 2.5 cms. y la menor unos pocos milímetros de localización submucosa, intramural y subserosa. En el mismo recipiente, se recibe una trompa de Falopio que mide 4.5 x 0.5 cms. y el ovario 2.5 x 1.5 cms. Al corte la trompa de Falopio conserva la morfología habitual y el ovario es solido. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio está autólisado. El miometrio muestra focos aislados de glándulas y estroma endometrial. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente. La trompa y el ovario conserva la morfología habitual.\r\n\r\n\r\n', ' Histerectomía abdominal total con salpingectomía derecha:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTOLISADO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-TROMPA DE FALOPIO\r\n-OVARIO', '', ''),
	(1026, 'Q2107-2534', 'Q', '73180248', 'JANER RAFAEL CARABALLO POLO', '000', 'M', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898241', '69000', 'Doctor EDUARDO QUINTERO', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Segmento de intestino" se recibe un segmento de intestino mide 6 x 2.8 cms. La superficie externa esta cubierta por una serosa despulida. Al corte la mucosa se encuentra edematosa de color rosado y hay se observa un área de color pardo oscuro. Se toman cortes así: A intestino, B líneas de resección.\r\n\r\n\r\n\r\n', 'Los cortes muestran intestino delgado con marcado edema, congestión e inflamación aguda transmural.\r\nLas líneas de resección son viables.\r\n\r\n\r\n\r\n\r\n', ' Resección de segmento de intestino delgado:\r\n-SEGMENTO DE INTESTINO DELGADO CON MARCADO EDEMA, CONGESTIÓN E INFLAMACIÓN AGUDA TRANSMURAL\r\n-MARGENES DE RESECCIÓN VIABLES', '', ''),
	(1027, 'Q2107-2535', 'Q', '45500782', 'YASMIN DEL CARMEN CHALABE REYES', '000', 'F', '53', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-07-28', '2021-07-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero + cuello" se recibe un útero con sus trompas de Falopio que pesa 276 gms. y mide 11 x 9 x 7 cms. El cérvix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta aumentado de tamaño, deformado. La trompa de Falopio mide 3.5 cms. y la izquierda 4 cms. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa delgada de color rosado y comprimida por una gran masa de color blanquecina mide 3.5 cms. El miometrio muestra además otras masas similares a las descritas de localización intramural y subserosa cuyos diámetros oscilan entre 2 cms. y unos pocos milímetros. Al corte la trompa derecha contiene un material violáceo y la izquierda conserva la morfología habitual. Se toman  cortes.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio está autólisado. El miometrio muestra focos aislados de glándulas y estroma endometrial. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente. La trompa derecha está dilatada y contiene abundantes coágulos sanguíneos. La trompas izquierda conserva la morfología usual.\r\n\r\n', ' Histerectomía abdominal total con salpingectomía bilateral:\r\n-CERVICITIS CRÓNICA\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-HEMATOSALPINXS, trompa derecha\r\n-TROMPA UTERINA IZQUIERDA', '', ''),
	(1028, 'Q2107-2536', 'Q', '33140871', 'FABIOLA ALVEAR HOYOS', '000', 'F', '68', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1029, 'Q2107-2537', 'Q', '28508177', 'MERYELIN CHIRINO DALES', '3004507768', 'F', '19', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '', '', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Vulva" un fragmento de tejido de forma irregular de color pardo claro que mide 0.4 cms. en su superficie externa presenta diminutas papilas. Se toma todo y se rotulan A.\r\n2. "Exocervix" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso hiperplasico con acantosis irregular, hiperqueratosis, atipias coilociticas, el estroma con un infiltrado inflamatorio.\r\nLos cortes B revelan cérvix con una reacción inflamatoria crónica y metaplasia escamosa.\r\n\r\n\r\n\r\n', '1.Biopsia de vulva:\r\n-CONDILOMA\r\n2.Biopsia de cervix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA\r\n', '', ''),
	(1030, 'Q2107-2538', 'Q', '73097508', 'JAVIER FLOREZ BARRIOS', '3043455285', 'M', '59', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor SABAS GUZMAN', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de forma irregular de color pardo oscuro y consistencia firme que miden 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes están representados por tejido fibroadiposo con una reacción inflamatoria crónica.\r\n\r\n\r\n\r\n', ' Biopsia de maxilar superior:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1031, 'Q2107-2539', 'Q', '45421134', 'ELVIRA RAMOS DE BUITRAGO', '00', 'F', '64', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA DE LOS ANGELES ZUÑIGA ALARCON', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1032, 'Q2107-2540', 'Q', '1001806600', 'ELIS JULIETH SIERRA ARDILA', '000', 'F', '21', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia congestiva presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(1033, 'Q2107-2541', 'Q', '1043636366', 'EDER RAFAEL CARDENAS HERRERA', '3013209460', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada pro una serosa opaca bien vascularizada de color pardo claro que presenta una solución de continuidad de 0.8 cms. Al corte material fecal. Acompañado a esto fragmento de tejido adiposo que mide 11 cms. de color blanco amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra parcialmente ulcerada, la pared congestiva e infiltrada pro gran cantidad de PMN neutrófilos que se extienden hasta la grasa periapendicular.\r\nOtros cortes muestran grasa con una reacción inflamatoria aguda.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n1.APENDICITIS AGUDA NECROTIZANTE\r\n2.FRAGMENTO DE TEJIDO ADIPOSO CON INFLAMACIÓN AGUDA\r\n', '', ''),
	(1034, 'Q2107-2542', 'Q', '1044004066', 'ESTHER SOFIA GARCIA GONZALEZ', '3146332190', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2.5 x 1.5 cms. de color pardo claro y consistencia elástica. Al corte superficie multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2 x 1.5 cms. de color pardo claro y consistencia elástica. Al corte superficie multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1035, 'Q2107-2543', 'Q', '1142943003', 'MIGUEL ANGEL PAJARO PEREZ', '3042691132', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctora JESSICA TIPON GALVIS', NULL, '2021-08-02', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Lesión mucosa labio inferior" se recibe un fragmento de tejido de forma irregular de color blanquecino que mide 0.8 cms. presenta una lesión sobreelevada de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso hiperplásico debajo del epitelio se observa un deposito de moco rodeado por tejido de granulación.\r\n\r\n\r\n\r\n\r\n', ' Lesión en labio inferior:\r\n-MUCOCELE', '', ''),
	(1036, 'Q2107-2544', 'Q', '1138676917', 'ANGEL ALBERTO JIMENEZ ALMARIO', '3126102534', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula que mide 7 x 1.5 x 1 cms. tapizada por una serosa opaca, bien vascularizada de color pardo claro. Al corte salida de material biliar. Al corte la pared se encuentra discretamente engrosada y la mucosa ha perdido su aspecto aterciopelado, además se observa la presencia de un cálculo en el cuello de la vesícula. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar tapizada por un epitelio hiperplásico, la capa muscular discretamente hipertrófica e infiltrada por linfocitos y plasmocitos.\r\n\r\n\r\n\r\n', ' Colecistectomía.\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS\r\n\r\n', '', ''),
	(1037, 'Q2107-2545', 'Q', '1103755912', 'VALERY SOFIA SUBIRIA GARZON', '3133579490', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora JESSICA TIPON GALVIS', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Lesión en cara ventral en lengua" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso en el estroma se observa cavidad delimitada pro tejido de granulación que contiene moco y macrófagos.\r\n\r\n\r\n\r\n\r\n', ' Lesión en cara ventral de lengua:\r\n-MUCOCELE\r\n\r\n', '', ''),
	(1038, 'Q2107-2546', 'Q', '1142944278', 'RONALD ESTIVEN JULIO PALACIOS', '000', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Verruga peliforme" se reciben diminutos fragmentos de tejido de forma irregular de color pardo grisáceo que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión que muestra epitelio escamoso con hiperqueratosis, acantosis, papilomatosis y áreas de paraqueratosis.\r\n\r\n\r\n\r\n\r\n', '-VERRUGA VULGAR, parpado inferior derecho', '', ''),
	(1039, 'L2107-100', 'L', '1047514014', 'ANA MADARRIAGA AVILA', '000', 'F', '35', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora MICALEA ARRIETA ', NULL, '2021-08-02', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Nefrostomía percutánea" se reciben 5 ml. de un liquido de color pardo claro, espeso. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', 'El extendido muestra un exudado constituido en su mayoría por PMN neutrófilos, glóbulos rojos y algunos histiocitos.\r\n\r\n\r\n\r\n', '', '', ' Citología de producto de nefrostomía percutánea:\r\n-EXTENDIDO INFLAMATORIO'),
	(1040, 'L2107-101', 'L', '1103748655', 'YOFRAN STIVEN PADILLA TEHERAN', '321684365', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMELLA', NULL, '2021-07-30', '2021-07-29', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 3 ml. de un liquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1041, 'Q2107-2547', 'Q', '64550730', 'CARMEN ANGELICA CHAPARRO CARRASCAL', '00', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor ALBERTO ACUÑA ARICO', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero + anexos" se recibe un útero con el cuello por separado y ambos anexos, pesa 711 gms. El cérvix mide 2.5 x 2.5 cms. y el cuerpo 12 x 11 x 8 cms. El cérvix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta notablemente deformado, con presencia de masas subserosas. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa de color rosado que se desprende al cortarla, el miometrio esta marcadamente engrosada y con el se distinguen múltiples nódulos de color blanquecinos, consistencia firme con un tamaño promedio de 3 cms. Las trompas son externamente normales y los ovarios son sólidos. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cérvix esta tapizado por un epitelio escamoso atrófico. Hay leve infiltración mononuclear del estroma. El endometrio está autólisado. En el miometrio hay múltiples focos de glándulas y estroma endometrial. Las masas descritas están compuestas por fibras musculares lisas dispuestas irregularmente. Las trompas y los ovarios conservan su estructura usual.\r\n\r\n\r\n', ' Útero y anexos (711 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTÓLSIADO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS\r\n', '', ''),
	(1042, 'Q2107-2548', 'Q', '002548', 'MARGARITA BERMUDEZ DE SANCHEZ', '000', 'F', '84', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor ALEJANDRO MUVDI ', NULL, '2021-08-06', '2021-07-30', 'ANA MAGOLA MANGA CEDEÑO', 'Sin rotular, se recibe un fragmento de tejido de forma irregular  de color pardo claro y consistecia elástica que mide 0.5 cms. e su mayor dimensión. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan piel con hiperqueratosis con hipergranulosis, acantosis irregular del epitelio escamoso con presencia de células grandes vacuoladas, el dermis muestra un infiltrado perivascular superficial mediado por linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesión piel de espalda:\r\n-VERRUGA VULGAR', '', ''),
	(1043, 'Q2107-2549', 'Q', '45754761', 'RUBY NIETO GONZALEZ', '3108395208', 'F', '58', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1044, 'Q2107-2550', 'Q', '22725716', 'ONEIDA ISABEL DIAZ RAMOS', '3008101106', 'F', '65', 'ECOPETROL S.A', '', '', '', 'DOCTOR LUIS FERNANDO VIAÑA GONZALEZ', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia trucut de seno izquierdo" se reciben cuatro fragmentos filiformes de tejido de forma irregular de color pardo claro y consistencia blanda que promedian una longitud de 1 cm. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido mamario que en su mayoría conserva la estructura usual para la edad. Algunos canalículos presentan leve hiperplasia del epitelio con cambios metaplásicos apocrinos.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia con aguja de corte de lesión en mama izquierda:\r\n-HIPERPLASIA CANALICULAR LEVE CON METAPLASIA APOCRINA\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n\r\n'),
	(1045, 'Q2107-2551', 'Q', '32850280', 'YENIS CARMONA MONTT', '000', 'F', '46', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor SABAS GUZMAN', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se reciben tres fragmentos de tejido de forma irregular, color pardo oscuro y consistencia muy friable que promedian un diámetro mayor de 1.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por estructuras que recuerdan espículas oseas irregulares, "desnudas", sin actividad osteoelástica, que reposan en un estroma fibroso. En otras áreas se observan masas de material calcificado que recuerda el cemento, asimismo en un trasfondo fibroso.\r\nEl cuadro descrito encaja en las llamadas LESIONES FIBROOSEAS. Debe hacerse correlación clínico-radiológica-patológica para investigar una DISPLASIA FIBROSA o un FIBROMA CEMENTIFICANTE.\r\n\r\n\r\n', ' Biopsia de lesión en sínfisis mandibular:\r\n-LESIÓN FIBROOSEA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(1046, 'Q2107-2552', 'Q', '3787794', 'ENRIQUE GHISAYS ZOGAIB', '00', 'M', '85', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay focos de metaplasia intestinal completa (tipo I). No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA CON FOCOS DE METAPLASIA INTESTINAL COMPLETA (TIPO I)\r\n\r\n', '', ''),
	(1047, 'Q2107-2553', 'Q', '73108456', 'JAVIER ENRIQUE HOYOS CAÑAVERA', '3157531451', 'M', '57', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1048, 'Q2107-2554', 'Q', '1051894819', 'MILAGRO DE DIOS SANCHEZ ORTIZ', '3207215760', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS ALBERTO BALLESTAS ALMARIO', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cicatriz de nefrostomía" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 3 x 1.5 x 1.5 cms. En el se distingue un orificio que se comunica con un conducto que se extiende hasta la parte mas profunda del espécimen. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Segmento distal de uréter derecho" contiene un fragmento un fragmento tubular de tejido de color pardo claro y consistencia blanda que mide 1.8 x 0.3 cms. en su parte mas ancha. En uno de sus extremos muestra una zona estrecha de 0.1 cm. de diámetro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran piel que se continua en un conducto tapizado por epitelio escamoso que reposa en un estroma fibroso.\r\nLos cortes rotulados B muestran ureter con edema del corion subepitelial y zona de fibrosis.\r\n\r\n\r\n', '1.RESECCIÓN DE ESTOMA DE NEFROSTOMÍA\r\n2.SEGMENTO DE URETER CON EDEMA Y FIBROSIS DE LA PARED\r\n\r\n', '', ''),
	(1049, 'Q2107-2555', 'Q', '1043963482', 'JHOBANA PAMELA LOZANO FUENTES', '3015138718', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO JAIMES GUTIERREZ', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 9 x 2 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida de color pardo grisáceo. Al corte las paredes son gruesas de aspecto fibroso y la luz contiene grandes cálculos de color amarillo muy friables, uno de ellos enclavado en el fondo, la mucosa esta aplanada. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1050, 'Q2107-2556', 'Q', '1136882607', 'DAYRO JOSE BUSTILLO ALVARADO', '000', 'M', '30', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ ELENA LINCE', NULL, '2021-08-02', '2021-07-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(1051, 'Q2108-2557', 'Q', '3995252', 'JOSE EUSTAQUIO SEQUEDA MERCADO', '3136319900', 'M', '81', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor RAFAEL CARMONA VALLE', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n', '', ''),
	(1052, 'Q2108-2558', 'Q', '73166942', 'MICHEL CHALITA ARENDS', '3153597589', 'M', '46', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-06', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'en recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. Un segundo recipiente, rotulados "Pólipo en ciego" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay focos de metaplasia intestinal completa (Tipo I). No se encuentra H. pylori, cambios atróficos ni displásicos.\r\nLos cortes rotulados B muestran una lesión ulcerada compuesta por tejido de granulación densamente infiltrado por neutrófilos y eosinófilos. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA SEVERA CON FOCOS DE METAPLASIA INTESTINAL COMPLETA (TIPO I)\r\n2.Biopsia endoscópica de ciego:\r\n-PSEUDOPOLIPO INFLAMATORIO', '', ''),
	(1053, 'Q2108-2559', 'Q', '45504972', 'ANGELICA MARIA CAMPO PUELLO', '3215754409', 'F', '49', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '', '', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1054, 'Q2108-2560', 'Q', '33168174', 'NELLY REBECA ACOSTA VERGARA', '6532584', 'F', '79', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-05', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Esófago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'El espécimen está compuesto por epitelio glandular gastrico con áreas que muestran células calciformes. Reposan en una lámina propia edematosa y densamente infiltrada por linfocitos y células plasmáticas. No se encuentra epitelio escamoso.\r\n\r\n\r\n\r\nCOMENTARIO: Desde un punto de vista morfológico, por la ausencia de epitelio escamoso, no podemos distinguir una HETEROTOPIA GASTRICA de un esófago de BARRETT. Se sugiere correlacionar los hallazgos histológicos con el cuadro clínico endoscópico.\r\n\r\n', ' Biopsia endoscópica de esófago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO', '', ''),
	(1055, 'Q2108-2561', 'Q', '45459552', 'AURA IRENE ESPINOSA BELTRAN', '3002408457', 'F', '56', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1056, 'Q2108-2562', 'Q', '22844327', 'ROSALBA JUDITH TINOCO ESCUDERO', '3004376274', 'F', '57', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1057, 'Q2108-2563', 'Q', '11434152248', 'NASSER JOSE SIR CEDEÑO', '3145150183', 'M', '22', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(1058, 'Q2108-2564', 'Q', '9022059', 'MIGUEL ANTONIO OSORIO SAYEH', '3008101985', 'M', '39', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', '');
INSERT INTO `informe` (`id`, `informe_cod`, `t_informe`, `numdoc`, `paciente`, `telefono`, `sexo`, `edad`, `entidad`, `eps`, `cups`, `valor`, `medRemitente`, `fec_muestra`, `fec_inf`, `fec_ingreso`, `patologo`, `macro`, `micro`, `diagnostico`, `inmuno`, `observaciones`) VALUES
	(1059, 'Q2108-2565', 'Q', '22739235', 'INGRID MARGARITA BARRIOS LOZANO', '000', 'F', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-08-11', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Endocervical" varios fragmentos de tejido de forma irregular de color pardo oscuro con áreas de color pardo claro y consistencia friable que hacen un volumen de 1 ml. Se toma todo y se rotulan A.\r\n2. "Endometrio" varios fragmentos de tejido de forma irregular, de color pardo claro y consistencia friable que en conjunto hacen un volumen de 2 ml. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran endometrio compuesto por glándulas tubulares con irregularidades de forma y tamaño, tapizadas por un epitelio cilíndrico pseudoestratificado con focos de estratificación.\r\nReposan en un estroma denso, fusocelular con vasos espirales prominentes.\r\n\r\n\r\nCOMENTARIO: Los hallazgos son sugestivos de un endometrio proliferativo con ESTIMULO ESTROGENICO PROLONGADO, sin embargo, en la historia clínica no se consigna el motivo del legrado ni la fecha de la última menstruación lo que nos impide hacer una afirmación diagnóstica.\r\n\r\n\r\n', '1.Biopsia de endocervix:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n2.Legrado uterino diagnóstico:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO', '', ''),
	(1060, 'Q2108-2566', 'Q', '1142936695', 'LUIS SANTIAGO CRUZ MARTINEZ', '3012763694', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-08-05', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro sin cambios.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1061, 'Q2108-2567', 'Q', '1044914540', 'JEIYE CHAVEZ BELTRAN', '3137796185', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice vermiforme que mide 9 x 1.5 cms.  La superficie externa es irregular esta cubierta por una serosa despulida de color pardo claro con áreas de color pardo oscuro y al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUA\r\n\r\n', '', ''),
	(1062, 'Q2108-2568', 'Q', '1143326151', 'JUAN CAMILO SANES RODELO', '3135779559', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotuan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal que conserva la morfología habitual. La lámina propia está edematosa e infiltrada por abundantes linfocitos y células plasmáticas. No se observan parasitos, granulomas, actividad inflamatoria ni cambios displásicos.\r\n\r\n\r\n', '1. Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2. Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA\r\n', '', ''),
	(1063, 'Q2108-2569', 'Q', '1201255944', 'CECILIA RICARDO ALCENDRA', '3016051225', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 0.6 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa de color pardo claro con vasos prominentes. Al corte se encuentra una luz puntiforme que contienen un material grumoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa.\r\nNo se observan cambios inflamatorios.\r\n\r\n\r\n\r\n\r\n', '-APENDICE CECAL', '', ''),
	(1064, 'Q2108-2570', 'Q', '1050282703', 'LUIS FERNANDO ARIAS LOPEZ', '3126238074', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro sin cambios.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal que conserva la morfología usual. No se observan parasitos, granulomas ni cambios displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS SUELTOS DE EPITELIO ESCAMOSO MADURO SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS', '', ''),
	(1065, 'Q2108-2571', 'Q', '1137536592', 'ELIAS MAURICIO CALDERON RUIZ', '3115413703', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala izquierda" una amigdala palatina que mide 2.5 x 1.8 x 1.5 cms. en sus mayores dimensiones, la superficie externa esta cubeirta por una mucosa de color rosado con criptas promientes. Se toman cortes y se rotulan A.\r\n2. "Amigdala derecha" una amigdala palatina que mide 2.5 x 1.8 x 1.5 cms. en sus mayores dimensiones, la superficie externa esta cubeirta por una mucosa de color rosado con criptas promientes. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMÍGDALITIS CRÓNICA', '', ''),
	(1066, 'Q2108-2572', 'Q', '1050842233', 'VALENTINA DE LEON ROBLES', '3103566737', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de aspecto membranoso, color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro sin cambios.\r\nLos cortes rotulados B muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE EPITELIO ESCAMOSO MADURO SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1067, 'Q2108-2573', 'Q', '1043983277', 'ANGUIE GABRIELA ANGULO RAMIREZ', '3017052855', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-08-04', '2021-08-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1068, 'Q2108-2574', 'Q', '1128058676', 'SIRDY NAVARRO PRIMETA', '3135992764', 'F', '33', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-05', '2021-08-05', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un punch de piel que mide 0.5 d ecolor pardo calro. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso con hiperqueratosis, paraqueratosis, acantosis irregular, atipias coilociticas que descansan en un tallo fibrovascular.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(1069, 'Q2108-2575', 'Q', '64523172', 'YARBEIS CORTES BATISTA', '3023736103', 'F', '42', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-05', '2021-08-05', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan cervix con un tumor epitelial maligno constituido por nidos de células grandes hipercromaticas, pleomórficas con queratinización y formación de perlas corneas que infiltran el estroma.\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO, INFILTRANTE', '', ''),
	(1070, 'Q2108-2576', 'Q', '1043975823', 'SHARON YIRETH MACHACON GARCIA', '3058784397', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO', NULL, '2021-08-05', '2021-08-05', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1071, 'Q2108-2577', 'Q', '30894683', 'SINDY LINDA RAMOS ECHENIQUE', '3113871685', 'F', '42', 'GASTROPACK SAS', 'AXA COLPATRIA', '', '', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-05', '2021-08-05', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1072, 'Q2108-2578', 'Q', '33120582', 'ANA CONCEPCION CABARCAS QUINTANA', '000', 'F', '0', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-05', '2021-08-05', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de cervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tumor epitelial maligno constituido por nidos de células escamosas, pleomórficas, hipercromaticas con queratinización y formación de perlas corneas que infiltran el estroma.\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO, INFILTRANTE', '', ''),
	(1073, 'Q2108-2579', 'Q', '40989632', 'YESICA FAJARDO SALAZAR', '000', 'F', '45', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-06', '2021-08-05', 'OLIVA MARRUGO GRICE', 'Rotulado "Polipos" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección endoscópica de polipo gástricos:\r\n-PÓLIPOS DE GLÁNDULAS FÚNDICAS', '', ''),
	(1074, 'Q2108-2580', 'Q', '26035832', 'LEONIT DEL SOCORRO HOYOS VEGA', '000', 'F', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-08-05', '2021-08-05', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5  x1 cms. de color pardo lcaro bien vascularizada. Al crte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1075, 'Q2108-2581', 'Q', '1001972088', 'FELIX ALBERTO AGUILAR ROCHA', '6860451', 'M', '20', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', '', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Resección de quiste pilonidal" se recibe una elipse de piel que mide 2 x 0.8 cms. y 1.2 cms. de profundidad, la superficie externa no muestra alteraciones y al corte se encuentra una superficie blanquecina con áreas amarillentas. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes seriados muestran piel en cuya dermis e hipodermis se encuentra un proceso inflamatorio agudo y crónico con formación de abscesos. No se encuentran granulomas ni elementos pilosos en la muestra.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel*:\r\n-VEASE DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n*Sitio no específicado.\r\n', '', ''),
	(1076, 'Q2108-2582', 'Q', '1048455431', 'ROSA ANALIA FLOREZ PEREZ', '3004921454', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 0.6 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa de color pardo claro con vasos prominentes. Al corte se encuentra una luz puntiforme que contiene un material amarillo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n', '', ''),
	(1077, 'Q2108-2583', 'Q', '1052946960', 'YESENIA CANDELARIA TRESPALACIOS CHARRY', '3216508245', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DOctor ANTONIO DE JESUS ARAUJO OROZCO', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Neuroma traumático cubital izquierdo" se reciben dos fragmentos de tejido de forma irregular, de color blanquecino y consistencia elástica que miden respectivamente 1.5 x 0.8 cms. en sus mayores dimensiones. Al corte muestra una superficie translucida de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión constituida por múltiples troncos nerviosos irregulares dispuestos sobre un estroma fibroso.\r\n\r\n\r\n\r\n', ' Resección de lesión en nervio cubital izquierdo:\r\n-NEUROMA TRAUMÁTICO\r\n\r\n', '', ''),
	(1078, 'Q2108-2584', 'Q', '1044012091', 'KYLIAN ANDRES MIRANDA MARTINEZ', '3004315244', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2.3 x 1.5 x 1 cms. en sus mayores dimensiones, la superficie  externa es irregular de color pardo claro, la consistencia 3e elástica y al corte se encuentra una superficie homogénea de color pardo amarillento. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2.3 x 1.5 x 1 cms. en sus mayores dimensiones, la superficie  externa es irregular de color pardo claro, la consistencia elástica y al corte se encuentra una superficie homogenea de color pardo amarillento. Se toman cortes y se rotulan B.\r\n3. Un tercer rotulado "Adenoides" contiene un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.8 x 1.8 x 0.6 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA', '', ''),
	(1079, 'Q2108-2585', 'Q', '1050277278', 'MARIA FERNANDA ARROYO CARO', '3107096519', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula biliar" se recibe vesícula biliar piriforme que mide 7.5 x 2 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa lisa y brillante de color grisáceo. Al corte las paredes son delgadas, la luz contiene abundante bilis espesa y la mucosa es aterciopelada, color verde con un fino punteado de color amarillo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar cuya morfología se encuentra preservada. Hay discreta infiltración mononuclear de la lámina propia.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1080, 'Q2108-2586', 'Q', '1142942440', 'MATEO MAXIMILIANO BUENVAS GAVIRIA', '3022199933', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JOSE LIBARDO PRETELT MENDOZA', NULL, '2021-08-17', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de piel" se recibe un minúsculo fragmento de tejido de forma irregular, parcialmente cubierto por piel que mide 0.4 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis es normal. Hay edema del dermis papilar y fibrosis con fibras colágenas gruesas en el dermis reticular con atrapamiento de los anexos. Se observan además escasos troncos nerviosos gruesos.\r\nNo se encuentran cambios francos de neurofibroma.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en piel del torax:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(1081, 'Q2108-2587', 'Q', '419105', 'ANDRES ALBERTO CAPRILES CASTILLO', '3128962264', 'M', '57', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(1082, 'Q2108-2588', 'Q', '12579195', 'FERNANDO CASADIEGO QUINTERO', '3208861173', 'M', '77', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y aspecto membranoso que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran epitelio escamoso que alternan con epitelio columnar. Reposan sobre una lámina propia edematosa con infiltración mononuclear.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-CAMBIOS COMPATIBLES CON ESÓFAGO DE BARRETT\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n', '', ''),
	(1083, 'Q2108-2589', 'Q', '1043334255', 'NICOLAS DARIO GOMEZ MIER', '3145085413', 'M', '2', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'En recipeintes separados yr otualdso, se erciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran fragmentos de mucosa oxíntica sin alteraciones.\r\nLos cortes rotulados C Y D muestran mucosa duodenal cuya lámina propia está edematosa y densamente infiltrada por linfocitos y células plasmáticas. No se encuentra alteración de la morfología de las vellosidades ni presencia de parásitos.\r\n\r\n', '1.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA OXÍNTICA\r\n3.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n4.Biopsia endoscópica de la segunda porción del duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(1084, 'Q2108-2590', 'Q', '1047399899', 'GUSTAVO ADOLFO GUEVARA HERAZO', '3005412301', 'M', '32', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden respectivamente 0.1 y  0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1085, 'Q2108-2591', 'Q', '45426234', 'EMILSE LUNA RODRIGUEZ', '0000', 'F', '65', 'GASTROPACK SAS', 'PARTICULAR', '2020205', '74106', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-08-11', '2021-08-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1086, 'Q2108-2592', 'Q', '39085735', 'MARIA GERARDINA MEDINA MEDINA', '3012258021', 'F', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor LUIS MIGUEL COVO SEGRERA', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un punch de piel de forma redondeada que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso que muestra hiperqueratosis, papilomatosis y perdida de la polaridad celular.\r\n\r\n\r\n\r\n', ' Extirpación de lesión piel región frontotemporal derecha:\r\n-QUERATOSIS SOLAR\r\n', '', ''),
	(1087, 'Q2108-2593', 'Q', '1142933933', 'ADRIAN JESUS JULIO PIMENTEL', '3145379452', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A revelan fragmentos de mucosa esofágica sin cambios.\r\nLos cortes rotulados B revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos en moderada cantidad, plasmocitos en moderada cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE MUCOSA ESOFAGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1088, 'Q2108-2594', 'Q', '1025900373', 'LUCIANA MARTINEZ VERGARA', '346730907', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2021-08-18', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Unión pieloureteral izquierda" se reciben dos fragmentos de tejido de forma cilíndrica el mayor mide 2 cms. y presenta un área estenosada, el segundo fragmento mide 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan ureter con fibrosis focal de la pared.\r\n\r\n\r\n\r\n\r\n', '-RESECCIÓN DE UNIÓN PIELOURETERAL ZONA DE ESTENOSIS', '', ''),
	(1089, 'Q2108-2595', 'Q', '1128052201', 'LAURA VANESSA MUÑOZ CABARCAS', '3045995232', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-08-18', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 cms. Al corte la luz ocupada por un material de color amarillento que mide 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal que muestra in tumor neuroendocrino constituido por nidos sólidos de pequeñas células uniformes con escasas figuras  de mitosis, se observa retracción del estroma al rededor de los nidos, el tumor mide 1.5 cms. en su longitud transversal, se extiende de la mucosa hasta la serosa sin sobrepasarla.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICE CECAL CON TUMOR CARCINOIDE CLASICO TIPO (INSULAR) QUE INFILTRA HASTA LA SEROSA\r\n-TAMAÑO TUMORAL 1.5 cms. EN SU LONGITUD TRANSVERSAL', '', ''),
	(1090, 'Q2108-2596', 'Q', '1047480988', 'DAILIS SOFIA AMADOR RUIZ', '3234396853', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Amígdala izquierda" una masa de tejido de forma ovoidea que mide 3 x 2.5 x 1 cms. La superficie externa es blanquecina y al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una masa de tejido de forma ovoidea que mide 3.5 x 2.3 x 1.5 cms. La superficie externa es blanquecina y al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1091, 'Q2108-2597', 'Q', '45425408', 'CARMEN MARRUGO MEDINA', '3145881108', 'F', '64', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '2020205', '74106', 'Doctor ROY BALLESTAS LARIOS', NULL, '2021-08-18', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1092, 'Q2108-2598', 'Q', '1043987027', 'DENZEL STEVENS OLIER VALIENTE', '3147103338', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 cms., la superficie externa está cubierta por una serosa de color pardo oscuro. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1093, 'Q2108-2599', 'Q', '1047432026', 'LUIS ANGEL ALTHAONA ALMEIDA', '3002503173', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-18', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenomegalia cervical izquierda" se recibe una formación nodular que mide 1 x 1 cms. de color blanquecino. Al corte una superficie lisa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Ganglio linfático cuya morfología esta conservada, presenta folículos linfoides de diferentes tamaños y formas con polarización del manto.\r\n\r\n\r\n\r\n\r\n', ' Extirpación de ganglio cervical izquierdo:\r\n-HIPERPLASIA FOLICULAR\r\n\r\n\r\n', '', ''),
	(1094, 'Q2108-2600', 'Q', '1142933234', 'ALBEIRO JOSE LOIZA LENGUA', '3126055973', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Amígdala derecha" una masa de tejido de forma ovoidea que mide 2 x 1.8 cms. La superficie externa es blanquecina y al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una masa de tejido de forma ovoidea que mide 2.5 x 1.5 cms. La superficie externa es blanquecina y al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1095, 'Q2108-2601', 'Q', '1042607872', 'LUIS DAVID DE ARCO QUINTANA', '3145250912', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Testículo derecho" se recibe testículo y elementos del cordón, el testículo mide 4.3  x2.8  x2.5c ms. de color blanco azulado, consistencia firme. Al corte de color oscuro y aspecto hemorrágico. El epidídimo de iguales características. Al corte de color oscuro y aspecto hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan testículo y epidídimo con áreas extensas de necrosis hemorrágica.\r\n\r\n\r\n\r\n\r\n', '-TESTICULO DERECHO CON ÁREAS EXTENSAS DE NECROSIS HEMORRÁGICA POR PORCIÓN\r\n\r\n', '', ''),
	(1096, 'Q2108-2602', 'Q', '1201251323', 'ADRIANA LUCIA RODRIGUEZ RIVERA', '3114342429', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Amígdala izquierda" una masa de tejido de forma ovoidea que mide 2.5 x 1.8 x 1.5 cms. La superficie externa es blanquecina y al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una masa de tejido de forma ovoidea que mide 2.5 x 2.3 x 1.8 cms. La superficie externa es blanquecina y al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1097, 'Q2108-2603', 'Q', '12525433', 'ALVARO ENRIQUE ARIZA VASQUEZ', '3135285746', 'M', '77', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos  y plasmocitos en moderada cantidad, PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1098, 'Q2108-2604', 'Q', '45561944', 'LUZ YEIMY GOMEZ JIMENEZ', '3016682416', 'F', '36', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor benigno de mama izquierda" se recibe una masa de tejido multinodular que mide 4 x 3.3 x 1.8 cms. Al corte una superficie blanquecina, nodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesión en mama izquierda:\r\n-FIBROADENOMA', '', ''),
	(1099, 'Q2108-2605', 'Q', '1050960857', 'VIVIANA JULIO MANRIQUE', '000', 'F', '28', 'CLIN. SAN JOSE DE TORICES SAS', 'FAMISANAR', '898201', '30215', 'Doctor JOSE BORRE', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Trompa derecha e izquierda" en un mismo recipiente, se reciben dos segmentos de trompas de Falopio que promedian 1 cm. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Segmentos de trompa uterina que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n-TROMPAS UTERINAS. SEGMENTOS (2) ', '', ''),
	(1100, 'Q2108-2606', 'Q', '1007979739', 'AURA MARIA RUIZ FRANCO', '000', 'F', '17', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor MAURICIO ORTIZ', NULL, '2021-08-18', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben diminutos fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmento de endometrio con transformación decidual. No se evidencian elementos trofoblásticos en la muestra.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE ENDOMETRIO CON TRANSFORMACIÓN DECIDUAL\r\n', '', ''),
	(1101, 'Q2108-2607', 'Q', '1007979739', 'AURA MARIA RUIZ FRANCO', '000', 'F', '17', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor MAURICIO ORTIZ', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Embarazo ectópico + trompa derecha" se recibe una formación ovoidea de color oscuro y aspecto hemorrágico que mide 3.3 x 3.2 cms. Al corte de color oscuro de aspecto hemorrágico y alternan con áreas blanquecinas. \r\nAcompañado a esto, se recibe un segmento de trompa de Falopio que mide 2 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Trompa de Falopio cuya luz está ocupada por coágulos sanguíneos y vellosidades coriales que en algunas áreas infiltran la pared.\r\n\r\n\r\n\r\n\r\n', '-EMBARAZO TUBÁRICO, trompa derecha', '', ''),
	(1102, 'Q2108-2608', 'Q', '1047417157', 'CESAR ANDRES VERGARA OQUENDOO', '311874104', 'M', '32', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 cms., la superficie externa está cubierta por una serosa de color pardo oscuro. Al corte la luz contiene material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1103, 'Q2108-2609', 'Q', '1006577794', 'ZIRLEIDIS CUEVA JIMENEZ', '3215695608', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-08-18', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms., la superficie externa está cubierta por una serosa de color pardo oscuro. Al corte la luz ocupada por material amarillento. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apéndice cecal con: \r\n-HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(1104, 'Q2108-2610', 'Q', '1002496510', 'CINDY PAOLA ACUÑA GOMEZ', '3006405697', 'F', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'ANGEL VASQUEZ PAJARO', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Ectópico + trompa derecha" se recibe un segmento de trompa de Falopio que mide 5  x 2.3 cms. en su mayor dimensiones, en una de sus caras muestra una solución de continuidad de 0.4 cms. Al corte la luz esta dilatada y ocupada pro material membranoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Trompa de Falopio cuya luz está ocupada por coágulos sanguíneos y vellosidades coriales que en algunas áreas infiltran la pared.\r\n\r\n\r\n\r\n\r\n', '-EMBARAZO TUBARICO, trompa derecha', '', ''),
	(1105, 'Q2108-2611', 'Q', 'VEN23458996', 'KEILYN ANYELIANI GONZALEZ HERNANDEZ', '3006495841', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-08-18', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Ovario derecho" se reciben dos fragmentos de tejido el mayor mide 2 x 1 cms. en una de sus caras deja ver una cavidad quistica unilocular. Se toman cortes\r\nAcompañado a esto, se recibe un fragmento de tejido que mide 1 x 0.6 cms. \r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan ovario en el que se observa la pared de un quiste tapizado por epitelio de tipo mucinoso.\r\n\r\n\r\n\r\n\r\n', '-CISTADENOMA MUCINOSO, ovario derecho', '', ''),
	(1106, 'Q2108-2612', 'Q', '1049831237', 'GLADYS AVILA SALCEDO', '000', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-08-17', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ovario izquierdo y trompa izquierda" un ovario que mide 5 x 2.5 x 1.7 cms. Trae una solución de continuidad en una de sus caras dejando ver una cavidad quística de color oscuro, la trompa de Falopio mide 6 cms. y muestra la estructura usual. Se toman cortes y se rotulan A.\r\n2. "Quiste" un fragmento de tejido de color blanquecino que mide 1.5 x 1.3 cms. en una de sus caras deja ver una cavidad quística unilocular. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes revelan ovario con una lesión tumoral germinal que contiene anexos dérmicos cartílago maduro, tejido tiroideo, se observa además trompa de Falopio.\r\n\r\n\r\n\r\n', '-TERATOMA QUISTICO MADURO, ovario izquierdo\r\n-TROMPA DE FALOPIO IZQUIERDA', '', ''),
	(1107, 'Q2108-2613', 'Q', '1007842420', 'ARMICELIS ZUÑIGA PEREZ', '3206672988', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', '', NULL, '2021-08-19', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Falange distal Halux pie derecho" un fragmento de tejido oseo que mide 1.5 x 1 cms. de color grisáceo. Se toman cortes y se rotulan A de tejido blando.\r\n2. "Falange distal y medial" dos fragmentos de tejido oseo que miden 1 y 1.5 cms. Se toman cortes de tejido blandos y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan tejidos blandos con áreas de necrosis y hemorrágia.\r\n\r\n\r\n\r\n\r\n', '1.Resección de falange distal, pie derecho:\r\n-TEJIDO INVIABLE POR NECROSIS MASIVA\r\n2.Resección de falange distal y medial:\r\n-TEJIDO INVIABLE POR NECROSIS MASIVA\r\n\r\n', '', ''),
	(1108, 'Q2108-2614', 'Q', 'VEN25666113', 'DANELYS COROMOTO GONZALEZ CORONEL', '3022327620', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-08-20', '2021-08-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Teratoma ovario derecho" se reciben tres fragmentos de tejido el mayor de 6 x 4 cms. de aspecto graso y contiene múltiples pelos y el segundo que corresponde a la pared de un quiste que mide 7 x 5 cms. previamente abierto dejando ver una cavidad lisa, contiene múltiples pelos y material de aspecto sebaceo, además se observa una papila. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor germinal benigno constituido en su mayoría por epitelio escamoso, anexos dermicos y focos de cartilago maduro.\r\n\r\n\r\n\r\n\r\n', '-TERATOMA QUISTICO MADURO, ovario derecho\r\n\r\n\r\n\r\n', '', ''),
	(1109, 'Q2108-2615', 'Q', '33335776', 'ARELYS DEL CARMEN GARAY BRACAMONTES', '3232863985', 'F', '43', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n', '', ''),
	(1110, 'Q2108-2616', 'Q', '1051445420', 'CAMILO ANDRES MONTALVO POLO', '3105082370', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11.5 x 5 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulento. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n\r\n', '-APENDICE CECAL', '', ''),
	(1111, 'Q2108-2617', 'Q', '1073830728', 'DILAN CRUZ NARVAEZ', '3506423679', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-08-17', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1. "Estómago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Ileon terminal" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Colon" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan D.\r\n5. "Recto" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan E.\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal que conserva la morfología habitual. No se observan parásitos, granulomas ni cambios displásicos.\r\nLos cortes rotulados C muestran mucosa de intestino delgado con presencia de folículo linfoide hiperplásico.\r\nLos cortes rotulados D y E muestran mucosa colónica cuya mucosa está preservada. Hay presencia de grandes folículos linfoides situados entre la mucosa y la muscular de la mucosa. No se observan parásitos, granulomas ni cambios displásicos.\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL\r\n3.Biopsia endoscópica de ileon:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n4.Biopsia endoscópica de colon y recto:\r\n-CAMBIOS COMPATIBLES CON HIPERPLASIA LINFOIDE NODULAR\r\n', '', ''),
	(1112, 'Q2108-2618', 'Q', '1043642766', 'BLEIDY ANDREA GARCIA QUINTERO', '3126152829', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran mucosa antrocorporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya morfología está preservada. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS SUELTOS DE EPITELIO ESCAMOSO MADURO SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS\r\n', '', ''),
	(1113, 'Q2108-2619', 'Q', '1137528013', 'DIANA SOFIA PADILLA OSPINO', '3152462644', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotula C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro sin cambios.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal que conserva la morfología habitual. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO SIN CAMBIOS\r\n2.Biopsia endoscópica de estomago:\r\n-GASTRITIS CRÓNICA INACTIVA \r\n3. Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS\r\n', '', ''),
	(1114, 'Q2108-2620', 'Q', '1043319120', 'THIAGO ALEXANDER GONZALEZ AMARIS', '000', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.3 x 0.5 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', '-APENDICE CECAL', '', ''),
	(1115, 'Q2108-2621', 'Q', '1050281104', 'YAIRY VANESSA MARIN YEPEZ', '3145640494', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste sebáceo" se recibe un fragmento de tejido de forma irregular, de color pardo claro y consistencia elástica que mide 1.7 x 1.2 cms. en sus mayores dimensiones. \r\nEn el mismo recipiente, se recibe un material grumoso de color pardo claro. Al corte se observa una superficie de color pardo claro que alternan con áreas de color amarillentas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un fragmento de tejido fibroadiposo parcialmente tapizado por piel, con una reacción inflamación crónica granulomatosa a cuerpo extraño.\r\nLos hallazgos pueden corresponder a un QUÍSTE QUERATINOSO EPIDERMICO ROTO.\r\n\r\n\r\n\r\n', ' Resección de lesión en región cervical derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1116, 'Q2108-2622', 'Q', '1137219893', 'MARIA VICTORIA MEERS RUIZ', '3126595787', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fibroadenoma de mama izquierda" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.8 x 2.5 x 2.5 cms. La superficie externa es multilobulada y al corte se observa una superficie homogénea de color paro claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-FIBROADENOMA\r\n', '', ''),
	(1117, 'Q2108-2623', 'Q', '1051884848', 'KATY LUZ MUÑOZ SOLANO', '000', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fibroadenoma de mama derecha" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 3.2 x 3 x 2.8 cms. La superficie externa es multilobulada y al corte se observa una superficie homogénea de color paro claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(1118, 'Q2108-2624', 'Q', '1066720139', 'NELLY GUILLIN CASTILLO', '3215346027', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2021-08-13', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Restos ovulares" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 2 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por numerosos coágulos sanguíneos que alternan con fragmentos de decidua. No se observan elementos trofoblásticos.\r\n\r\n\r\n\r\n ', ' Legrado uterino:\r\n-FRAGMENTOS DE DECIDUA Y COÁGULOS SANGUINEOS\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1119, 'Q2108-2625', 'Q', '23148151', 'CLAUDIA DEL SOCORRO ORTIZ MORALES', '000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'DOctor JOSE RODRIGUEZ', NULL, '2021-09-14', '2021-08-12', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Fragmento de masa pulmonar" diez fragmentos de tejido de forma filiformes de color pardo claro y consistencia blanda que promedian 1 cms. Se toma todo y se rotulan A.\r\n2. "Pleura parietal" un fragmento de tejido de aspecto membranoso de color pardo claro y consistencia blanda que mide 1.2 x 0.4 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran parénquima pulmonar en el que se observa un tumor epitelial maligno compuesto por células pleomórficas con núcleos irregulares, hipercromáticos, con actividad mitótica aumentada, que se disponen formando estructuras glanduliformes y nidos sólidos que infiltran el estroma. No se identifica infiltración linfovascular.\r\nLos cortes rotulados B muestran fragmentos de pleura libre de tumor.\r\n\r\n', '1.Biopsia de masa en pulmón derecho (lóbulo inferior) por toracoscopia:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n2.Biopsia de pleura parietal:\r\n-FRAGMENTO DE PLEURA LIBRE DE TUMOR\r\n\r\n\r\n', 'Se retiran 6 bloques por el señor HERNANDO VILLAREAL CC. 73.072.449  (14 de sept/2021)', 'Se sugiere practicar estudios de inmunohistoquímica para una mayor precisión diagnóstica.\r\n'),
	(1120, 'Q2108-2626', 'Q', '45429565', 'DORLY ISABEL PLAZA VASQUEZ', '3135785645', 'F', '67', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(1121, 'Q2108-2627', 'Q', '52836349', 'YENLY PARDO GUEVARA', '000', 'F', '40', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1122, 'Q2108-2628', 'Q', '8533124', 'JOSE MARIA TORRES CUERVO', '3183539593', 'M', '52', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1123, 'Q2108-2629', 'Q', '33158963', 'MARCELA DEL CARMEN AMADOR ELJAICK', '3157553553', 'F', '67', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1124, 'Q2108-2630', 'Q', '22725716', 'ONEIDA ISABEL DIAZ RAMOS', '3008101106', 'F', '65', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(1125, 'Q2108-2631', 'Q', '1043314834', 'KYARA MATTOS HERNANDEZ', '3008145050', 'F', '8', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-08-18', '2021-08-13', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan C.\r\n4. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B muestran mucosa oxíntica sin cambios.\r\nLos cortes C revelan mucosa duodenal sin cambios.\r\nLos cortes rotulado D revelan duodeno cuya lámina propia es edematosa con infiltrado mononuclear moderado, con formación de un folículo linfoide.\r\n\r\n', ' Biopsia endoscópica múltiple superior:\r\n1.GASTRITIS CRÓNICA INACTIVA, antro\r\n2.MUCOSA OXÍNTICA SIN CAMBIOS, cuerpo\r\n3.BULBO DUODENAL SIN CAMBIOS\r\n4.DUODENITIS CRÓNICA INESPECIFICA, duodeno', '', ''),
	(1126, 'Q2108-2632', 'Q', '1051655150', 'KATERIN VANESSA SERRANO MARTINEZ', '3014798415', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Quiste sebáceo en brazo derecho" se recibe un fragmento de tejido de forma irregular que mide 1  x 0.5 cms. de color blanco amarillento y consistencia elástica. Al corte una formación quística de 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en brazo derecho:\r\n-QUISTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(1127, 'Q2108-2633', 'Q', '1048455377', 'JUAN PABLO BELLO PARRA', '3145060515', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal que muestra hiperplasia de los folículos linfoides en la submucosa, la capa muscular e infiltrado por algunos PMN neutrófilos.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1128, 'Q2108-2634', 'Q', '1143393123', 'JHOSUAD WARNE CASTRO', '3007819340', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo grisáceo que presenta una solución de continuidad de 0.5 cms. trae adherido un material fibrinopurulento. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo con áreas extensas de necrosis que se extiende hasta la serosa.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n\r\n', '', ''),
	(1129, 'Q2108-2635', 'Q', '1201228651', 'KEREN PATRICIA OROZCO MARTINEZ', '3128782838', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1130, 'Q2108-2636', 'Q', '1043306598', 'CALED SANTIAGO MENDIVIL CARVAJAL', '3126433073', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Dcotor CARLOS BALLESTAS ALMARIO', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Varicocele izquierdo" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro mayor de 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan vasos venosos de diferentes tamaños, paredes engrosadas y dilatadas.\r\n\r\n\r\n\r\n\r\n', '-VARICOCELE IZQUIERDO', '', ''),
	(1131, 'Q2108-2637', 'Q', '45466713', 'DELCY VALDES PEREZ', '00000', 'F', '59', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Dcotor SAMUEL CANTILLO VILLAR', NULL, '2021-08-17', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Lesión de verruga en vulva" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia elástica que mide 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Lesión tumoral benigna tapizada en su totalidad por epitelio escamoso que descansa en un estroma fibroso que alternan con focos de tejido adiposo.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesión en vulva:\r\n-FIBROMA BLANDO (ACROCORDON)\r\n\r\n', '', ''),
	(1132, 'Q2108-2638', 'Q', '30774134', 'EDITH JUDITH PAJARO MORALES', '3135520982', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor EDGARDO DURAN GONZALEZ', NULL, '2021-08-18', '2021-08-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Utero + anexos" se recibe un útero con anexos que pesa 149 gms. El útero mide 9  x7 x 5 cms. A través del cervix protruye una masa que dilata el canal endocervical, la masa proviene del istmo, la masa mide 4.5 x 3.5 x 3 cms. Al corte de color blanquecino y aspecto arremolinado, la cavidad endometrial esta tapizada por una mucosa de color pardo y el miometrio se encuentra una masa que mide 1 x 0.5 cms. El ovario izquierdo mide 2 x 2 cms. La trompa izquierda 5 cms. y presenta hidátide de morgagni, el ovario contiene un quíste que contiene un material achocolatado y mide 1 cm. El ovario derecho mide 2 x 1 cms. No muestra cambios y la trompa mide 5 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan cérvix con una reacción inflamatoria crónica, el endometrio es proliferativo hay áreas de adenomiosis, la masa descrita que protruye a través del exocervix corresponde a un leiomioma, al igual que la masa del miometrio, el ovario izquierdo presenta folículo quístico, el ovario derecho y las trompas no muestran cambios.\r\n\r\n\r\n', ' Útero (149 gms. ):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO PROLIFERATIVO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS\r\n-FOLICULO QUISTICO, ovario izquierdo\r\n-OVARIO DERECHO\r\n-TROMPAS DE FALOPIO', '', ''),
	(1133, 'Q2108-2639', 'Q', '45422885', 'YOLIMA INES JARABA GUERRERO', '0000', 'F', '64', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1134, 'Q2108-2640', 'Q', '45554011', 'ANGELICA MARIA ARNEDO MARTINEZ', '0000', 'F', '38', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-08-21', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Se recibe una elipse de piel que mide 2 cms., en uno de sus extremos muestra una lesión sobre elevada. Al corte de color amarillento y aspecto graso. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal constituido por tejido adiposo separado por septos de tejido fibroso y tapizado por epitelio escamoso.\r\n\r\n\r\n\r\n\r\n', '-LIPOMA, gluteo lado no especificado\r\n\r\n', '', ''),
	(1135, 'Q2108-2641', 'Q', '33339211', 'MELIA DEL CARMEN PADILLA SANCHEZ', '3152749511', 'F', '54', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1136, 'Q2108-2642', 'Q', '45552909', 'JENIFER MARTELO BOLIVAR', '3205178505', 'F', '39', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 x 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan cervix tapizado por epitelio escamoso hiperplasico que dencansa en un estroma infiltrado por linfocitos y plasmocitos. No se observan cambios de LIE en la muestra enviada.\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA LEVE', '', ''),
	(1137, 'Q2108-2643', 'Q', '1143391921', 'DIANA CAROLINA RESTREPO RUIZ', '3112130980', 'F', '25', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-08-24', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Seno derecho" se reciben tres fragmentos de tejido el mayor de forma redondeada que mide 3.5 x 2 cms. y el menor de 1 x 1 cms. Al corte del mayor muestra una leisón blanco amarillento, nodular. Se toman cortes y se rotulan A.\r\nEl segundo fragmento mide 2 x 1 cms. y al corte es de color blanquecino, gris. Se toman cortes y se rotualn B\r\nEl tercer fragmento al corte una superficie blanquecna de color amarillento. Se tomanc ortes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A, B y C revelan tumores benignos compuestos por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesiones en mama derecha:\r\n-FIBROADENOMAS HIALINIZADOS(3)\r\n\r\n', '', ''),
	(1138, 'Q2108-2644', 'Q', '45578549', 'LEDIS PATRICIA CUESTA BRACAMONTE', '3205732324', 'F', '49', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', '', NULL, '2021-08-25', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tejido endometrial" se reciben fragmentos de tejido de forma irregular de color pardo claro oscuro y consistencia friable que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'El especimen está compuesto en su mayoría por coágulos sanguineos. Hay fragmentos de endometrio compuesto por glándulas tubulares tapizadas por epitelio con cambios irregulares de secreción, que reposan en un estroma fusocelular de aspecto fibroso. No hay cambios neoplásicos.\r\nLos cambios son sugestivos pero no concluyentes de un defecto de la fase lútea. \r\nNo hay datos en la información suministrada sobre la historia mestrual, administración de hormonas, etc.\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1139, 'Q2108-2645', 'Q', '1007312932', 'YENIFER ELENA PERIÑAN VEGA', '3017565451', 'F', '32', 'PARTICULAR', '', '898201', '30215', 'Doctor ALAN GONZALEZ VALERA', NULL, '2021-08-23', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Capsula mamaria derecha" fragmento de tejido fibroadiposo, redondeada de forma sacular que mide 13 x 9 cms. La cara interna de color pardo claro y la cara externa de color amarillento y aspecto adiposo. Se toman cortes y se rotulan A.\r\n2. "Capsula mamaria izquierda" fragmento de tejido fibroadiposo, redondeada de forma sacular que mide 14 x 8 cms. La cara interna de color pardo claro y la cara externa de color amarillento y aspecto adiposo. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B muestran  pared de tejido fibroso tapizada en una de sus caras por un tejido de aspecto sinovial.\r\n\r\n\r\n', '1-Cápsula periprotésica de mama derecha :\r\n-METAPLASIA SINOVIAL\r\n2-Cápsula periprotésica de mama izquierda :\r\n-METAPLASIA SINOVIAL\r\n\r\n\r\n\r\n', '', ''),
	(1140, 'Q2108-2646', 'Q', '7930469', 'WILMAN JOSE VILLALBA CASTILLO', '3167443791', 'M', '57', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1141, 'Q2108-2647', 'Q', 'VEN100565461', 'GERARD YANNIEL GIRALICO GONZALEZ', '3014380790', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es opaca, congestiva de color pardo oscuro. Al corye la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1142, 'Q2108-2648', 'Q', '45444677', 'NURY MOGOLLON BARRIOS', '000', 'F', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Dcotor JAVIER ACUÑA BARRIOS', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesicula biliar fragmentada el fragmento mayor mide 3 x 2.5 cms. la serosa es de color verdoso y al corte la mucosa conserva el aspecto aterciopelado, adherido a ella fragmento de calculo de color amarillento, el fragmento menor mide 1.5 x 1 cms. Al corte se extrae un gran calculo de color amarillento, la mucosa conserva la estructura usual junto a la vesícula se observan calculos iguales al antes descrito. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa esta infiltrada por linfocitos, plasmocitos e histiocitos espumosos, hay hipertrofia de la muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n-COLESTEROLOSIS', '', ''),
	(1143, 'Q2108-2649', 'Q', '1069471002', 'ELIZABETH SEÑA VEGA', '3213564619', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-25', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es congestiva de color blanquecino. Al corte salida de un material vedoso. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n', '-APÉNDICE CECAL CON HIPERPLASIA FOLICULAR REACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(1144, 'Q2108-2650', 'Q', '1128048825', 'KAREN MARGARITA JIMENEZ CAICEDO', '3205001345', 'F', '35', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares"  se reciben fragmentos de tejido de color oscuro y consistencia friable que juntos promedian 3 ml. Se toma parte.\r\n\r\n\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-RESTOS OVULARES\r\n\r\n', '', ''),
	(1145, 'Q2108-2651', 'Q', 'VEN32590366', 'BEVERLIN YUSLEIDY RODRIGUEZ CHIRIVELLA', '3002262385', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es congestiva de color grisáceo. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1146, 'Q2108-2652', 'Q', '1143396871', 'VICTOR DANIEL PEREIRA CARRANZA', '0000', 'M', '24', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 cms. la serosa es congestiva de color grisácea. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1147, 'Q2108-2653', 'Q', '32615855', 'FEBE DURANGO RUEDA', '6530667', 'F', '64', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Dcotor EDGAR GOMEZ RHENALS', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tejido endometrial" se recibe fragmentos de material mucoide que mide 1 cm. Se intenta procesar.\r\n\r\n\r\n\r\n', 'Los cortes solo revelan moco con abundantes neutróiflos y diminutos fragemntos de glandulas endometriales inadecuadas para diagnóstico.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1148, 'Q2108-2654', 'Q', '1042576298', 'MARIA JOSE VARGAS DEL TORO', '3114168930', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Dcotor CARLOS BALLESTAS ALMARIO', NULL, '2021-09-06', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tejido periapendicular y vesícal posterior" en un mismo recipiente, se reciben cuatro fragmentos de tejido el mayor de ellos de forma alargada que mide 4 cms. tapizado por piel de color gris. Se toman cortes y se rotulan A.\r\nEl segundo fragmento que mide 2 x 1 cms. de color blanquecino y consistencia elástica de aspecto fibroadiposo. Al corte de color blanquecino. Se toman cortes y se rotulan B.\r\nEl tercer fragmento mide 1 x 1 cms. de iguales caracteristicas al anteriormente descrito. Se toman cortes y se rotulan C.\r\nEl cuarto fragmento mide 0.8 cms. de iguales caracteristicas al anteriormente descrito. Se toman cortes y se rotulan D.\r\n\r\n\r\n', 'Los cortes A revelan piel tapizada por epitelio escamoso que descansa en un estroma que muestra edema e inflamación aguda y crónica moderada.\r\nLos cortes de B, C y D  revelan fragmentos de tejido fibroso en el que se observa una proliferación de capilares rodeados de un infiltrado inflamatorio mixto.\r\n\r\n\r\n', '1. FRAGMENTOS DE PIEL CON EDEMA E INFLAMACIÓN AGUDA Y CRÓNICA\r\n2.FRAGMENTOS DE TEJIDO FIBROSO CON ÁREAS DE INFLAMACIÓN AGUDA Y CRÓNICA (Cortes rotulados B, C y D)', '', ''),
	(1149, 'Q2108-2655', 'Q', '45501180', 'EDITH ESPERANZA RIVALDO MUÑOZ', '300883091', 'F', '54', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 10 x 4 cms. previamente abierta en una de sus caras la serosa es de color pardo rosado. Acompañado a esto fragmentos de calculos de color amarillento mide 0.3 cms. Al corte la vesícula sus parades estan engrosadas y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa esta parcialmente atrofica, la pared densamente infiltrada por linfocitos, plasmocitos y neutrófilos en abundantes cantidad, la pared es hipertrofica.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1150, 'Q2108-2656', 'Q', '1201270204', 'VALERY SOFIA RIVERA NAVARRO', '3005635362', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es oaca, despulida y cubierta por material fibrinoide. Al corte la luz ocupada por material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1151, 'Q2108-2657', 'Q', 'VEN16079103', 'JOCSELYN GREY GUTIERREZ SOTO', '3043696162', 'F', '39', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mioma" se recibe una masa de tejido de forma ovoidea que pesa 621 gms. y mide 13 x 11 x 9 cms. La superficie externa es blanquecina en una de sus caras presenta un área cruenta. Al corte una superficie blanquecina de color amarillento con áreas de aspecto mucoide. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Miomectomía:\r\n-LEIOMIOMA (1)', '', ''),
	(1152, 'Q2108-2658', 'Q', '1051819279', 'JAIDER MANUEL DE LA ROSA GARCIA', '0000', 'M', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 cms. la serosa es gris, opaca y despulida cubierta por material fibrinoso. Al corte la luz ocupada por material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1153, 'Q2108-2659', 'Q', '1002246297', 'JUAN DIEGO MARTINEZ YANCES', '3157158810', 'M', '18', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1  cms. la serosa es opaca y despulida. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1154, 'Q2108-2660', 'Q', '22803953', 'CLAUDIA PATRICIA RIVERA GIL', '3233104614', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar fragmentada el segmento mayor mide 5 x 2.5 cms. la serosa es grisáceaAl corte se observan calculos redondeados de color amarillento, promedian 0.3 cms. Las paredes engrosadas y la mucosa conserva el aspecto aterciopelado. El segundo fragmento mide 1 cm. corresponde al cuello de la vesícula y al corte se extrae múltiples calculos. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n', '', ''),
	(1155, 'Q2108-2661', 'Q', '33144465', 'MARTHA RODRIGUEZ MARTINEZ', '000', 'F', '70', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula", se recibe una vesícula biliar que mide 7 x 2 cms. la serosa es de color grisáceo. Al corte la mucosa conserva el aspecto aterciopelado, las paredes son delgadas. Se toman cortes.\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1156, 'Q2108-2662', 'Q', '33144107', 'TEOMILDA VILLAR DE NUÑEZ', '000', 'F', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula", se recibe una vesícula biliar que mide 9 x 1 cms. abierta en una de sus caras. Al corte la presencia de cálculos pequeños de color oscuro, la mucosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica y presencia de histiocitos espumosos, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n-COLESTEROLOSIS\r\n\r\n\r\n', '', ''),
	(1157, 'Q2108-2663', 'Q', '33221426', 'MARTHA ORTIZ VILLANUEVA', '000', 'F', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula", se recibe una vesícula biliar que mide 9 x 2 cms. la serosa de color grisáceseo. Al corte la presencia de múltiples cálculos  de color  amarillento que promedian 1 cm. la mucosa ha perdido parcialmente el aspecto aterciopelado. Se toman cortes.\r\n\r\n', 'Vesícula biliar cuya mucosas esta infiltrada por linfocitos, plasmocitos e histiocitos espumosos, hay hipertrofia de la muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRONICA CON COLELITIASIS\r\n-COLESTEROLOSIS', '', ''),
	(1158, 'Q2108-2664', 'Q', '45592867', 'VILMA RIVERA VERDEZA', '000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA', NULL, '2021-08-25', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula", se recibe una vesícula biliar que mide 8 x 1.5 cms.  la serosa de color grisáceo  Al corte la presencia de abundante material biliar y un cálculo de 1 cm.  . Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(1159, 'Q2108-2665', 'Q', '45425053', 'MARGARITA JIMENEZ DE ISAZA', '000', 'F', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula", se recibe una vesícula biliar que mide 7 x 1.5 cms. la serosa de color verde oscuro.  Al corte la   mucosa conserva su aspecto aterciopelado, las paredes levemente engrosadas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1160, 'Q2108-2666', 'Q', '33204176', 'RUBY GARCIA CAMPO', '000', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA', NULL, '2021-08-20', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula", se recibe una vesícula biliar que mide 6 x 1.5 cms.  Al corte la presencia de cálculos un cálculo de 1.5 cms. de color amarillento, las paredes se encuentran engrosadas. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar cuya mucosas esta infiltrada por linfocitos, plasmocitos e histiocitos espumosos, hay hipertrofia de la muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CON COLELITIASIS.\r\n-COLESTEROLOSIS\r\n\r\n\r\n\r\n', '', ''),
	(1161, 'Q2108-2667', 'Q', 'VEN20411333', 'YERIKA DEL VALLE BARON BRITO', '000', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD JEINS RICARDO V.', NULL, '2021-09-06', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor de ovario izquierdo", se reciben dos lesiones quísticas, la mayor de 0.5 cms. y la menor de 0.2 cms. de color grisáceo traslucida, acompañado a esto una formación blanquecina nodular de consistencia firme de 0.4 cms.  que muestra pequeña área quistica. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesiones quisticas una tapizada parcialmente por epitelio seroso y la otra por células aplanadas.\r\n\r\n\r\n\r\n', '1.QUÍSTE SIMPLE, ovario izquierdo\r\n2.QUÍSTE SEROSO PARAOVÁRICO IZQUIERDO', '', ''),
	(1162, 'Q2108-2668', 'Q', '1050965186', 'LEYLA MARINA SANJUAN CONEO', '000', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDWARD JEINS RICARDO V.', NULL, '2021-08-23', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Placenta", se recibe una placenta que pesa 123 gms. y mide 11 x 5.5 x 3 cms. revestida por una membrana grisácea, el segmento del cordón mide 4 cms. y muestra tres vasos, la cara materna está representada por un material membranoso que alterna con áreas de color oscuro y aspecto hemorrágico. Se toman cortes.\r\n\r\n', 'Los cortes muestran placenta del segundo trimestre cuyas vellosidades están tapizadas por cito y sincicioteofoblasto sin alteraciones. El estroma, marcadamente edematoso, muestra un buen desarrollo de los vasos. No se encuentran anomalías del desarrollo, cambios inflamatorios ni neoplásicos. El cordon umbilical muestra tres vasos.\r\n\r\n\r\n', ' Placenta del segundo trimestre(123 gms):\r\n-MARCADO EDEMA DEL MESENQUIMA COMPATIBLE CON MUERTE FETAL IN UTERO.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1163, 'Q2108-2669', 'Q', '1234098621', 'MARILUZ TORRES BRIEVA', '000', 'F', '48', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora ADRIANA P.LOPEZ CELEDON', NULL, '2021-08-27', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero más trompa izquierda", se recibe cuerpo uterino que pesa 1.053 gms. y mide 17 x 15 x 10 cms. la serosa es de color grisáceo y presenta dos formaciones nodulares. Al corte la cavidad endocervical está rechazada por la presencia de una gran masa blanquecina de aspecto carnoso y mide 10 x 8.5 x 13 cms. El endometrio es plano de color rosado, a nivel de la subserosa y a nivel del itsmo se encuentran  masas de iguales características que miden 6 x 1 cms. el segmento de trompa mide 4 cms. y muestra la estructura usual . Acompañado a esto segmento de trompa de 2.5 cms. que muestra la estructura usual. Se toman cortes.\r\n\r\n', 'Los cortes revelan endometrio con cambios de autolisis, las masas descritas corresponden a Leiomiomas, los segmentos de trompas de Falopio no muestran cambios.\r\n\r\n', ' Cuerpo uterino (1.053 gms)\r\n-ENDOMETRIO AUTOLIZADO\r\n-LEIOMIOMAS\r\n-SEGMENTOS DE TROMPAS DE FALOPIO (2)\r\n\r\n\r\n', '', ''),
	(1164, 'Q2108-2670', 'Q', '45528546', 'NAYIBIS ISABEL FLOREZ LARA', '000', 'F', '46', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora IRINA SEQUEDA LUJAN', NULL, '2021-09-01', '2021-08-19', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Útero" cuerpo uterino que pesa 512 gms. y mide 12 x 11.5 x 6 cms. El cuerpo está cubierto por una serosa de color blanquecino. Al corte la cavidad endocervical está rechazada por la presencia de una gran masa de color grisáceo arremolinada mide 7 x 6 x 10 cms.  El endometrio es plano de color grisáceo. Se toman cortes y se rotulan A.\r\n2. "Trompa izquierda" segmento de trompa de Falopio que mide 2 cms. y muestra la estructura usual. Se toman cortes y se rotula B.\r\n3. "Trompa derecha" segmento de trompa de Falopio que mide 3 cms. y muestra la estructura usual. Se toman cortes y se rotula C.\r\n\r\n', 'Los cortes revelan cuerpo uterino cuyo endometrio es atrófico, la masa descrita corresponde a un leiomioma, las trompas de Falopio no muestran cambios.\r\n\r\n\r\n\r\n', ' Utero (512 gms.):\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMA\r\n-TROMPA DE FALOPIO IZQUIERDA\r\n-TROMPA DE FALOPIO DERECHA', '', ''),
	(1165, 'L2108-102', 'L', '1103748655', 'YOFRAN STIVEN PADILLA TEHERAN', '321684365', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-08-20', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Liquido cefalorraquideo" se reciben 3.6 ml. de un líquido transparente. Se centriga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquideo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1166, 'L2108-103', 'L', '1049831447', 'VALENTINA VEGA BARRIOS', '3137053153', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-08-20', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Liquido cefalorraquideo" se reciben 3.5 ml. de un líquido transparente. Se centriga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquideo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1167, 'L2108-104', 'L', '33217739', 'ROSANA GUTIÉRREZ MORON', '3103681390', 'F', '0', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-20', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Citología de seno izquierdo" se reciben 4.2 ml. de un líquido de color pardo claro. Se centriga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' BACAF de masa en mama izquierda:\r\n-EXTENDIDOS ACELULARES\r\n\r\n', '', ''),
	(1168, 'Q2108-2671', 'Q', '28413173', 'KATERINE TOVAR RUIZ', 'o', 'F', '22', 'LIGA CONTRA EL CANCER', 'PARTICULAR', '', '', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-23', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia monte de Venus", se recibe un diminuto fragmento de piel de forma irregular, color pardo claro y consistencia elástica que mide 0.3 cms. en su mayor dimension. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran piel en la que se observa una zona de engrosamiento de la epidermis con papilomatosis y acantosis irregular.\r\n\r\n\r\n', ' Resección de lesión en piel de monte de Venus:\r\n-PAPILOMA ESCAMOSO.\r\n\r\n\r\n\r\n', '', ''),
	(1169, 'Q2108-2672', 'Q', '45690940', 'IRINA MARGARITA ROCHA BLANCO', '000', 'F', '42', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-08-23', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimension. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay presencia de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA.\r\n\r\n\r\n\r\n', '', ''),
	(1170, 'Q2108-2673', 'Q', '73191622', 'ANDRES MAURICIO BORNACHERA FERIA', '000', 'M', '38', 'GASTROPACK SAS', 'ECOPETROL S.A', '', '', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-08-23', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada  cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n- GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1171, 'Q2108-2674', 'Q', '1042582651', 'SAMUEL PACHECO TORRES', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'dOCTOR OSCAR E. ROMERO ORTIZ', NULL, '2021-08-25', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia osea de femur izquierdo" se reciben cuatro fragmentos de tejido de color pardo claro y consistencia firme que juntos hacen un volumen de 1.5 ml. Se toma todo y se pone a descalsificar.\r\n\r\n\r\n', 'Los cortes muestran espículas óseas desvitalizadas, algunas necróticas, rodeadas por tejido fibroso con moderada infiltración mononuclear. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de lesión en femur izquierdo:\r\n-OSTEOMIELITIS CRÓNICA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1172, 'Q2108-2675', 'Q', '1128227446', 'ESTEFANI ABIGAIL FLOREZ RODRIGUEZ', '000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-23', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 3.2 cms. la superficie externa está parcialmente cubierta por una serosa lisa y brillante. Al corte hay salida de abundante material biliar, la pared está adelgazada y la mucosa ha perdido su aspecto aterciopelado. No se obtienen cálculo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar cuya morfología está preservada. No se encuentran cambios inflamatorios ni neoplásicos.\r\n\r\n\r\n', ' Colecistectomía:\r\n-VER DESCRIPCIÓN MICROSCOPICA.\r\n\r\n\r\n\r\n', '', ''),
	(1173, 'Q2108-2676', 'Q', '1042582651', 'SAMUEL PACHECO TORRES', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'doctor HENRY A. TORRES MONTES', NULL, '2021-08-25', '2021-08-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Curetaje oseo fémur izquierdo" se reciben múltiples fragmentos de tejido de color pardo claro y consistencia firme que en conjunto hacen un volumen de 2 ml.. Se toman cortes y se ponen a descalcificar.\r\n\r\n\r\n', 'El espécimen está compuesto por espículas óseas necróticas que reposan en un tejido fibroso con densa infiltración mononuclear. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de lesión en fémur izquierdo:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n\r\n\r\n', '', ''),
	(1174, 'L2108-105', 'L', '806672722021971', 'CARMEN PASTORA COLMENARES ROJAS', '000', 'F', '50', 'LIGA CONTRA EL CANCER', '', '', '', 'Doctor CARLOS OSORIO', NULL, '2021-08-27', '2021-08-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Acaf seno derecho" se recibe 1 ml. de un líquido color amarillento se centrifuga y se hace un extendido del sedimento.\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n', ' ACAF seno derecho:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\nNOTA: El líquido se recibio mezclado con formol.\r\nSi se repite el procedimiento (sin formol) se practicará el estudio sin costo adicional.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1175, 'Q2108-2677', 'Q', '57435362', 'ANGELICA MARIA NAVIA MUÑOZ', '000', 'F', '50', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '', '', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-08-26', '2021-08-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente.  No se observa atrófia, metaplasia, ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD INFLAMATORIA LEVE\r\n-H.PYLORI PRESENTE.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1176, 'Q2108-2678', 'Q', '1101875701', 'JOSE MANUEL BLANCO LOBO', '000', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados se reciben:\r\n1-"Esófago", dos fragmentos de tejido de forma irregular color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo y se rotula A.\r\n2-"Estómago", dos fragmentos de tejido de forma irregular color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo y se rotula B.\r\n3-"Duodeno", dos fragmentos de tejido de forma irregular color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo y se rotula C.\r\n\r\n', 'Los cortes rotulados A  esofago representado  por epitelio escamoso hiperplásico con vasos intraepiteliales y algunas células inflamatorias.\r\nLos cortes rotulados B  fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C duodeno cuya lámina propia es edematosa con un infiltrado mononuclear moderado, no se observa atrófia, granulomas ni parásitos intestinales.\r\n\r\n', ' Biopsia endoscópica :\r\n1- ESOFAGITIS CRONICA LEVE\r\n2-GASTRITIS CRÓNICA INACTIVA\r\n3-DUODENITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(1177, 'Q2108-2679', 'Q', '33217982', 'RITA PATRICIA RODRIGUEZ HERRERA', '000', 'F', '50', 'ORG. CLINICA GENERAL DEL NORTE', '', '', '', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Exocervix" se reciben tres fragmentos de tejido irregular, blanquecino, mucoide que promedia 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Cervix tapizado por epitelio escamoso hiperplásico con áreas de paraqueratosis y atipias coilocitica.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE BAJO GRADO (CONDILOMA)\r\n\r\n\r\n', '', ''),
	(1178, 'Q2108-2680', 'Q', '1049586675', 'YOSSUAN JOSE LOMBANA BELEÑO', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" cuatro fragmentos de tejido de forma irregular color blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo. \r\n\r\n\r\n', 'Mucosa antro corporal , la lámina propia presenta un infiltrado mononuclear leve, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD INFLAMATORIA LEVE\r\n- H.PYLORI PRESENTE\r\n\r\n\r\n\r\n', '', ''),
	(1179, 'Q2108-2681', 'Q', '1041980042', 'SANTIAGO ANDRES MONTES PATERNINA', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor MARGHI LIZET GUERRA PEREZ', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Nevo dérmico" se recibe un punch de piel  de color pardo grisáceo consistencia elástica que mide 0.6 cms. Se toma todo en dos cortes.\r\n\r\n\r\n', 'Los cortes muestran Piel en cuya dermis se encuentra un tumor benigno compuesto por melanocitos dispuestos irregularmente alrededor de los anexos y  con pigmento melánico en la zona adyacente a la epidermis. No hay actividad de unión.\r\n\r\n\r\n', ' Biopsia de parpado inferior derecho:\r\n-NEVO MELANOCÍTICO INTRADÉRMICO\r\n\r\n\r\n', '', ''),
	(1180, 'Q2108-2682', 'Q', '1106518875', 'HARRISON AGUDELO CARDONA', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-09-06', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Granuloma" se recibe una elipse de piel que mide 1.5 cms. presenta una lesión sobre elevada de 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel en cuya dermis se observa lesión tumoral constituida por una proliferación de células fusiformes dispuestas en un patrón verticilado, se observa ademas, la presencia de pequeños vasos, la lesión toca la unión dermoepidermica y el borde profundo de resección.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en hombro izquierdo.\r\n-HISTIOCITOMA FIBROSO BENIGNO', '', ''),
	(1181, 'Q2108-2683', 'Q', '1142923915', 'LAURA MARIANA ESCUDERO LORDUY', '000', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados se reciben:\r\n1-"Amigdala izquierda" una amígdala palatina que mide 3 x 2.5 x 1 cms. de color pardo grisáceo consistencia elástica. Al corte una superficie múltinodular. Se toman cortes y se rotulan A.\r\n2-"Amigdala derecha" una amígdala palatina que mide 3 x 2 x 1 cms. de iguales características de la anterior. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes A y B muestran Amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide\r\n\r\n\r\n', '-AMÍGDALITIS CRÓNICA', '', ''),
	(1182, 'Q2108-2684', 'Q', '1048464581', 'JHOANIS SOFIA CABARCAS ALVIS', '000', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Fístula preauricular izquierda" se recibe una elipse de piel que mide 1.2 x 1 cms. de color pardo grisáceo consistencia elástica. Al corte una superficie lisa donde se observa trayecto fistuloso coloreado con azul. Se toman cortes.\r\n\r\n', 'Los cortes revelan piel en el que se observa trayecto fistuloso revestido por epitelio escamoso.\r\n\r\n\r\n', '-FISTULA PREAURICULAR IZQUIERDA.\r\n\r\n\r\n\r\n', '', ''),
	(1183, 'Q2108-2685', 'Q', '1043988366', 'LEVER ENRIQUE VIVERO OROZCO', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe una apéndice cecal que mide 6 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la luz dilatada y ocupada por un material fecaloide. Acompañado a esto fragmento de tejido adiposo que mide 6 x 4 cms. Se toman cortes.\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. Acompañado a ésto tejido adiposo con una reacción inflamatoria aguda.\r\n\r\n', ' Apendicectomía:\r\n-APÉNDICITIS AGUDA\r\n-FRAGMENTO DE TEJIDO ADIPOSO CON UNA REACCION INFLAMATORIA AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(1184, 'Q2108-2686', 'Q', '1128052536', 'MICHEL ANDREA CORREA ROCHA', '000', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-08-27', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Lesión de oido izquierdo" se reciben dos fragmentos irregulares de tejido color blanquecino consistencia elástica que promedian un diámetro mayor de 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan tejido de granulación constituidos por vasos pequeños que descansan en un estroma edematoso infiltrado por linfocitos, células plasmáticas y PMN neutrófilos.\r\n\r\n\r\n', '-FRAGMENTO DE TEJIDO DE GRANULACIÓN , Oido izquierdo.\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1185, 'Q2108-2687', 'Q', 'VEN32069480', 'ANGEL ALBERTO PACHECO BARRERA', '000', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe una apéndice cecal que mide 10 x 1 cms. tapizada por una serosa opáca bien vascularizada de color pardo claro. Al corte salida de  material fecaloide. Se toman cortes.\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', ' Apendicectomía:\r\n-APÉNDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(1186, 'Q2108-2688', 'Q', '33150765', 'HILDA ISABEL LARA ZABALETA', '000', 'F', '68', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2021-08-26', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido elástico blanquecino que promedia 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Antro gástrico con muscular de la mucosa cuya lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente.  No se observa atrófia, metaplasia, ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD INFLAMATORIO LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n\r\n\r\n', '', ''),
	(1187, 'Q2108-2689', 'Q', 'VEN17171205', 'EDITH CAROLINA MENDEZ CORONEL', '000', 'F', '36', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-09-20', '2021-08-24', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\nCuerpo uterino que trae adherido placenta y cordón umbilical y pesa 988 gms. El útero mide 12 x 12 x 6 cms. está tapizado por una serosa de color pardo grisáceo, la cavidad endometrial está dilatada y ocupada parcialmente por la placenta que está adherida a su cara anterior. Se toman cortes de la cavidad endometrial y del miometrio. La placenta pesa 400 gms. y trae adherido un cordón que mide 20 cms. Acompañado a ésto trompa izquierda que mide 6 cms. de color pardo grisáceo tubular. Se toman cortes.\r\nEn otro recipiente se recibe segmento de trompa uterina que mide 3 cms. Se toman cortes.\r\n\r\n', 'Los cortes revelan cuerpo uterino donde se observa tejido placentario entre las fibras musculo liso del miometrio, el endometrio esta autolisado. Placenta del 3er. trimestre cordon umbilical con sus tres vasos.\r\nTrompas uterinas muestran la morfología habitual.\r\n\r\n\r\n\r\n', ' Cuerpo uterino (98 gms.):\r\n1.ACRETISMO PLACENTARIO\r\n2.PLACENTA DEL 3er. TRIMESTRE\r\n3.TROMPAS UTERINAS\r\n', '', ''),
	(1188, 'Q2108-2690', 'Q', '64524580', 'YAMILEYS JIMENEZ JULIO', '000', 'F', '42', 'CLINICA GENERAL DEL CARIBE SA.', '', '', '', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-08-25', '2021-08-24', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero más trompas de Falopio"se recibe cuerpo uterino más trompa izquierda que pesa 440 gms. y mide 13 x 9 x 7 cms. tapizado por una serosa de color pardo claro. Al corte la cavidad endometrial se encuentra rechazada por una masa ovoide que mide 5 x 5 x 7 cms. de color blanquecina de aspecto arremolinado. La trompa izquierda mide 6 cms. y se rotula C.\r\n Acompañado a ésto en recipiente separdo y rotulado "Trompa derecha" se recibe fragmento de trompa que mide 4 cms. Se toman cortes y se rotula D.\r\n\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino cuyo endometrio se encuentra autolizado, la masa descrita corresponde a un Leiomioma, se observa además focos de adenomiosis.\r\nLas trompas de Falopio muestran su morfología usual.\r\n\r\n\r\n\r\n', ' Cuerpo uterino (440 gms):\r\n-ENDOMETRIO AUTOLIZADO\r\n-LEIOMIOMAS\r\n-ADENOMIOSIS\r\n-TROMPAS DE FALOPIO IZQUIERDA Y DERECHA\r\n\r\n', '', ''),
	(1189, 'Q2108-2691', 'Q', '33122948', 'EMELINA DIAZ DIAZ', '000', 'F', '75', 'PARTICULAR', 'C.', '', '', 'doctor MONTOYA', NULL, '2021-08-27', '2021-08-26', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados se reciben:\r\n1-"Antro" tres fragmentos de tejido de forma irregular que promedian 0.3, 0.2 y 0.1 cms. Se toma todo y se rotula A.\r\n2-"Cuerpo" dos fragmentos de tejido de forma irregular que promedian 0.2 cms. Se toma todo y se rotula B.', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa gástrica oxíntica cuya morfología está preservada. No hay cambios inflamatorios, metaplásicos ni displásicos.\r\n\r\n', '1-Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRONICA INACTIVA LEVE\r\n2-Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA OXÍNTICA.\r\n\r\n\r\n\r\n', '', ''),
	(1190, 'Q2108-2692', 'Q', '33108795', 'LILIANA CASTELLAR PADILLA', '000', 'F', '46', 'ORG. CLINICA GENERAL DEL NORTE', '', '', '', 'Doctor LUIS JAVIER ALZAMORA TABORDA', NULL, '2021-08-31', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vagina" se recibe fragmento de tejido de color pardo claro y alargado, la superficie externa lisa y mide 0.2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Lesión constituida por una proliferación de capilares que descansan en un estroma edematoso, rodeado de un infiltrado inflamatorio constituido por abundantes neutrófilos.\r\n\r\n\r\n\r\n', '-GRANULOMA PIOGENO, vagina', '', ''),
	(1191, 'Q2108-2693', 'Q', '1103221492', 'JORDAN TOVAR PALENCIA', '000', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-09-01', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos fragmentos de tejido de forma redondeada de color blanquecino y consistencia elástica que mide 0.2 cms. Se toma todo y se rotula A.\r\n2. "Sigmoide" tres fragmentos de tejido de color blanquecino y consistencia elástica que miden 0.3, 0.2 y 0.1 cms. Se toma todo y se rotula B.\r\n3. "Recto" tres fragmentos de tejido de color blanquecino y consistencia elástica que promedian  0.2 cms. Se toma todo y se rotula C.\r\n\r\n', 'Lo scortes A revelan mucosa gastrica antro corporal cuya lámina propia esta edematosa e infiltrada por linfocitos, plasmocitos y neutrófilos en moderada cantidad, hay acumulos linfoides en la lámina propia y H.pylori en muy poca cantidad.\r\nLos cortes B y C revelan mucosa sigmoides y recto en cuya lámina propia esta edematosa e infiltrada por linfocitos, plasmocitos y neutrófilos en cantidad moderada. No se observan áreas de ulceración en la muestra.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n2.Biopsia endoscópica de colon sigmoides:\r\n-PROCTOCOLITIS CRÓNICA ACTIVA\r\n3.Biopsia endoscópica de recto:\r\n-PROCTOCOLITIS CRÓNICA ACTIVA', '', ''),
	(1192, 'Q2108-2694', 'Q', '1142938844', 'DANNA LUISA NISPERUZA ESCORCIA', '000', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'DOCTOR STEVEN OSORIO ANAYA', NULL, '2021-08-31', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido blanquecino el mayor mide 1.5 x 1 cms. y el menor 0.5 cms. Al corte la superficie lisa de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n', '', ''),
	(1193, 'Q2108-2695', 'Q', '1050735668', 'LUCIANA CABALLERO SUAREZ', '000', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-09-06', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago"  dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica de 0.3 y 0.2 cms. Se toma todo y se rotula A.\r\n2. "Esófago"  fragmento de tejido de color blanquecino y consistencia elástica que miden 0.2  cms. Se toma todo y se rotula B.\r\n3. " Duodeno" dos fragmentos de tejido de iguales características del anterior  que promedian  0.3 cms. Se toma todo y se rotula C.\r\n4. "Colon" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica   de 0.3 cms. Se toma todo y se rotula D.\r\n5-"Recto" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica  de 0.3 cms. Se toma todo y se rotula E.\r\n\r\n', 'Los cortes A revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en escasa cantidad y PMN neutrófilos enescasa cantidad. Hay formación ocasional de acúmulos linfoides. No hay atrófia, H.pylori, metaplasia intestinal ni cambios displásicos.\r\nLos cortes de B revelan fragmentos de mucosa esofagica sin cambios.\r\nLos cortes de C mucsoa duodenal que muestra la estructura usual.\r\nLos cortes D revelan fragmentos de mucosa colonica donde se observa edema leve e infiltración por linfocitos y plasmocitos en cantidad moderada con formación de acumulos linfoides.\r\nLos cortes de E revelan mucosa rectal con inflamación aguda y crónica leve.\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA CON ACTIVIDAD INFLAMATORIA LEVE\r\n2.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE MUCOSA ESOFAGICA SIN CAMBIOS\r\n3.Biopsia endoscópica de duodeno:\r\n-FRAGMENTOS DE MUCOSA DUODENAL SIN CAMBIOS\r\n4.Biopsia endoscópica de colon:\r\n-COMPATIBLE CON HIPERPLASIA NODULAR LINFOIDE\r\n5.Biopsia endoscópica de recto:\r\n-MUCOSA RECTAL CON INFLAMACIÓN AGUDA Y CRÓNICA LEVE', '', 'En los cortes rotulados D "Colon" se sugiere correlacionar entre los hallazgos endoscópicos y los de anatomia patologica.\r\n'),
	(1194, 'Q2108-2696', 'Q', '1143329322', 'KATHERINE OLIVERA RUIZ', '000', 'F', '32', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '', '', 'DOCTORA BEATRIZ LINCE VIDES', NULL, '2021-08-31', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n ', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1195, 'Q2108-2697', 'Q', '45463881', 'SILVIA BURGOS TAPIA', '000', 'F', '56', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '', '', 'DOCTORA PAOLA ZUÑIGA ALARCON', NULL, '2021-08-31', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica  de 0.3  cms. Se toma todo .\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos y plasmocitos en moderada cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1196, 'Q2108-2698', 'Q', '1065846745', 'VALERIA DE LOS ANGELES BELEÑO ALBORNOZ', '3024501759', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-08-31', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos y plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n', '', ''),
	(1197, 'Q2108-2699', 'Q', '1050945979', 'DIEGO ANDRES RAMOS ANGULO', '000', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'DOCTOR MARIO A. JAIMES GUTIERREZ', NULL, '2021-08-31', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe apéndice cecal que mide 9 cms. la serosa es opáca, despulida y cubierta por material fibrinopurulento. Al corte la luz ocupada por un material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1198, 'Q2108-2700', 'Q', '9071232', 'MIGUEL IBAÑEZ HERNANDEZ', '000', 'M', '75', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '', '', 'DOCTOR JOSE RODRIGUEZ HERNADEZ', NULL, '2021-09-06', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1-"Pleura parietal izquierda" fragmento de tejido blanquecino firme de 2 X 1 cms. Se toman cortes y se rotulan A.\r\n2-"Segmento pulmonar izquierdo" fragmento de tejido color grisáceo, elástico de forma alargada suturado en uno de sus bordes y mide 2 x 0.6 cms. Al corte el parénquima es de color pardo claro y presenta un área redondeada de color oscuro que toca el área de sutura. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran pleura parietal con un proceso inflamatorio crónica con presencia de granulomas tuberculoides con células gigantes tipo langhans en unos se insinua una necrosis caseosa central.\r\nLos cortes B revelan parenquima pulmonar con una pleura visceral engrosada que contiene granulomas similares a los descritos, se observa además, grandes depositos de material antracotico y alveolos dilatados rotos, compatibles con un proceso enficematoso. No se observan cambios neoplásicos.\r\n\r\n\r\n', '1.Biopsia de pleura parietal izquierda:\r\n-PLEURITIS CRÓNICA GRANULOMATOSA COMPATIBLE CON TBC\r\n2.Biopsia de pulmon:\r\n-CAMBIOS COMPATIBLES CON TUBERCULOSIS\r\n\r\n\r\n', '', 'VER DESCRIPCIÓN MICROSCÓPICA.'),
	(1199, 'L2108-106', 'L', '50900245', 'LEILA ISABEL ORTEGA DE LA ROSA', '000', 'F', '49', 'LIGA CONTRA EL CANCER', '', '', '', '', NULL, '2021-09-01', '2021-08-27', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados, se recibe:\r\n1. "BACAF mama derecha" se recibe 10 m.l de un líquido color rojizo. Se centrifuga y se hace extendido del sedimento y se rotula A.\r\n2. "BACAF mama derecha" Se recibe 10 m.l de un líquido color amarillento. Se centrifuga y se hace extendido del sedimento y se rotula B.\r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' Citología de líquido mama derecha:\r\n-EXTENDIDO ACELULAR', '', ''),
	(1200, 'Q2108-2701', 'Q', '45441152', 'INGRID EBELIA GODIN FERNANDEZ', '000', 'F', '60', 'PARTICULAR', '', '', '', 'Doctor LUIS FERNANDO VIAÑA G.', NULL, '2021-08-30', '2021-08-28', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia trucut lesion axila derecha" se reciben siete cilindros de color blanquecino y consistencia elástica que promedian un diámetro mayor de 1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cilíndros remitidos están compuestos en su mayoría por tejido adiposo maduro con estrías de tejido fibroso moderadamente vascularizados. No se encuentran elementos propios del tejido mamario ni cambios neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia con aguja de corte de lesión en axila derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1201, 'Q2108-2702', 'Q', '64725655', 'ROSA ANGELINA SIERRA PEREZ', '000', 'F', '45', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '', '', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-08-31', '2021-08-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia antro gástrico" se reciben dos fragmentos de tejido de forma irregular color blanquecino y consistencia blnada que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación de foliculos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, MODERADA', '', ''),
	(1202, 'Q2108-2703', 'Q', '1007960788', 'DAYANA RAMIREZ FRANCO', '000', 'F', '18', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '', '', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-08-31', '2021-08-28', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Exocervix" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.6 cms. Se toma todo y se rotula A.\r\n2. "Biopsia de vulva" un punch de piel que mide 0.3 cms. Se toma todo y se rotula B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan cervix con un proceso inflamatorio crónico con metaplasia escamosa y áreas de paraqueratosis y atípias coilociticas.\r\nLos cortes B revelan epitelio escamoso con acantosis irregular, paraqueratosis, atipias coilociticas, el estroma infiltrado por linfocitos y células plásticas.\r\n\r\n\r\n\r\n', '1.Biopsia de cervix:\r\n-LIE DE BAJO GRADO (CONDILOMA)\r\n2.Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(1203, 'Q2108-2704', 'Q', '1048580383', 'MARIA CAMILA MONTOYA HERNANDEZ', '000', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-08-31', '2021-08-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe apéndice cecal que mide 8 X 0.5 cms. tapizada por una serosa opáca bien vascularizada. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(1204, 'Q2108-2705', 'Q', '73139658', 'ABRAHAM CUETO ROMERO', '000', 'M', '51', 'GASTROPACK SAS', 'PARTICULAR', '', '', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-13', '2021-08-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Pólipos bulbo" se reciben dos fragmentos de tejido de forma irregular de colro blanquecino y consistencia elástica que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Duodeno cuya ámina propia congestiva con un infiltrado inflamatorio constituido por linfocitos, células plasmaticas. No se observan cambios morfologicos de polipo.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(1205, 'Q2108-2706', 'Q', '33205582', 'AURELIA ROSA TUIRAN MARTINEZ', '000', 'F', '53', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '', '', 'Doctor JOSE ACEVEDO', NULL, '2021-09-13', '2021-08-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia endometrial" se reciben fragmento irregular de tejido de color pardo oscuro de aspecto membranoso que juntos hacen un volumen de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan en su mayoría coágulos sanguineos y fibrina, glandulas endometriales sueltas y fragmentadas inadecuadas para diagnóstico.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1206, 'Q2108-2707', 'Q', '52434882', 'CARMEN TERESA CARABALLO OSORIO', '000', 'F', '45', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor WILMAR POLO', NULL, '2021-09-02', '2021-08-31', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un minúsculo fragmento de tejido de color pardo claro y consistencia blanda que mide 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis esta ligeramente adelgazada. En el dermis se observa una proliferación de células nevicas dispuestas en nidos sólidos que rodean los anexos y que en la proximidad de la superficie contienen pigmento melánico. No hay actividad de unión.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en piel de la sien derecha:\r\n-NEVO MELANOCITICO INTRADÉRMICO\r\n\r\n\r\n\r\n', '', ''),
	(1207, 'Q2108-2708', 'Q', '1042576738', 'DAYERLIS DE AVILA DIAZ', '3013131284', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-09-02', '2021-08-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 0.6 cms. en sus mayores dimensiones. La superficie externa esta cubierta por una serosa de color pardo claro con vasos prominentes. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1208, 'Q2108-2709', 'Q', '1043642846', 'NATALIA MARIA CAMPO DURANGO', '30042096820', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-02', '2021-08-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste de mama izquierda" se reciben dos fragmentos de tejido de forma irregular de color blanquecino con áreas amarillentas que miden respectivamente 2.4 y 2.5 cms. en sus mayores dimensiones, la superficie externa es irregular como la consistencia es elástica y al corte se encuentra una cavidad irregular sin ningun contenido, el otro fragmento es sólido con una superficie de color blanquecino finamente granular. \r\n\r\n\r\n\r\n', 'Los cortes muestran tejido mamario cuya morfología está alterada por la presencia de estructuras quisticas de mediano y gran calibre que reposan en un estroma fibroescleroso. No hay cambios proliferativos.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en mama izquierda:\r\n-CONDICIÓN FIBROQUISTICA', '', ''),
	(1209, 'Q2108-2710', 'Q', '1067599945', 'ISABELLA DEL PILAR REALES FONSECA', '3043990791', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-09-02', '2021-08-31', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Areola derecha" un fragmento de piel de forma irregular, que mide 0.5 cms. de diámetro mayor, de color pardo oscuro y consistencia blanda. Se toma todo en dos cortes y se rotulan A.\r\n2. Un segundo recipiente rotulado, "Cuadrante inferior derecho" contiene un fragmento de piel de forma irregular, que mide 0.6 cms. en su mayor diámetro. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran piel cuya epidermis muestra focos de espongiosis y alargamiento de los clavos interpapilares en un patrón psoriasiforme. En el dermis se encuentra un denso infiltrado inflamatorio mixto mediado por linfocitos, células plasmáticas y eosinófilos, con predominio de estos últimos.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de piel de la mama derecha:\r\n-DERMATITIS CRÓNICA PSORIASIFORME COMPATIBLE CON DERMATITIS CRÓNICA ALERGICA', '', ''),
	(1210, 'Q2108-2711', 'Q', '1148449271', 'YEISLER ALEJANDRO CAMPO DIAZ', '3216137264', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-09-02', '2021-08-31', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular, color pardo claro y consistencia elástica que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(1211, 'Q2108-2712', 'Q', '1041996962', 'MARY LEYSS SIERRA GUERRERO', '3007234643', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-09-02', '2021-08-31', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Granuloma piogeno" se recibe un fragmento de tejido ligeramente esférico que mide 0.7 cms. de diámetro. Al corte se encuentra una superficie de color pardo grisáceo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se encuentra una proliferación de vasos capilares que se disponen en un patrón lobulado con bandas gruesas de tejido conectivo.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en piel del flanco derecho:\r\n-HEMANGIOMA CAPILAR LOBULADO (GRANULOMA PIÓGENO)\r\n\r\n\r\n\r\n', '', ''),
	(1212, 'Q2108-2713', 'Q', 'VEN04972060', 'JHANNA PATRICIA BLANCO REVERON', '3117816921', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-02', '2021-08-31', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya histomorfología se encuentra preservada. No hay cambios inflamatorios, presencia de H.pylori ni cambios metaplásicos o displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA ANTRAL (2)\r\n\r\n\r\n', '', ''),
	(1213, 'Q2108-2714', 'Q', '33282204', 'ROSA AMALIA BERROCAL ARROYO', '3103957334', 'F', '63', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '2020205', '74106', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-02', '2021-08-31', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotualdos, se reciben:\r\n1. "Esófago" varios fragmentos de tejido de forma irregular de color blanquecino y cosnsitencia blanda que promedian un diámetro mayor de 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color blanquecino y cosnsitencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro. No se encuentran cambios inflamatorios.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1214, 'Q2108-2715', 'Q', '3796252', 'ALCIDES RAFAEL HERNANDEZ MEJIA', '3112235489', 'M', '80', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-02', '2021-08-31', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1215, 'Q2108-2716', 'Q', '2327451742', 'ERICA MILENA CAMPANELLA', '3165310938', 'F', '47', 'GASTROPACK SAS', 'PARTICULAR', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-02', '2021-08-31', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Pólipo gástrico" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran estructura compuesta por glándulas gástricas de diferentes formas y tamaños, que reposan en una lámina propia edematosa. No hay cambios malignos ni epitelio escamoso en la muestra.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-PÓLIPO HIPERPLASICO\r\n\r\n\r\n\r\n\r\nNOTA: En la muestra no se encuentran elementos propios de la histología esofágica.\r\n\r\n\r\n', '', ''),
	(1216, 'Q2109-2717', 'Q', '9100453', 'WILLIAM HERRERA FRANCO', '3126539987', 'M', '55', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '2020205', '74106', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1217, 'Q2109-2718', 'Q', '42204925', 'MARIA ELENA CANCHILA BARRIOS', '3145375810', 'F', '60', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y plasmocitos en escasa cantidad. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1218, 'Q2109-2719', 'Q', '1064979582', 'YEISLY MARTINEZ RUIZ', '3182725667', 'F', '36', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-09', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Colon transverso" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda el mayor mide 0.3 cms. y el menor de 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Colon ascendente" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotualn B.\r\n3. "Colon descendente" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo y se rotulan C.\r\n4. "Recto" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo y se rotulan D.\r\n', 'Los cortes de A revelan colon transverso en cuya lámina propia se observa un infiltrado inflamatorio crónico moderado mediado por linfocitos y plasmocitos.\r\nLos cortes de colon ascendente, descendente y recto muestran mucosa colorectal con focos de edema y un infiltrado inflamatorio agudo y crónico mediado por muy escasos neutrófilos y la presencia de linfocitos y plasmocitos en moderada cantidad. No se observó abscesos cripticos ni disminución del moco glandular.\r\n\r\n\r\n', '1.Biopsia endoscópica de colon transverso:\r\n-PROCTITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de colon ascendente:\r\n-PROCTITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de colon descendente:\r\n-PROCTITIS CRÓNICA INACTIVA\r\n4.Biopsia endoscópica de recto:\r\n-PROCTITIS CRÓNICA INACTIVA', '', ''),
	(1219, 'Q2109-2720', 'Q', '1050979380', 'GISELLE MILAGROS PEINADO PAJARO', '3168082133', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Dcotor CARLOS EDUARDO ROMAN HERAZO', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor mejilla derecha" se recibe una formación nodular que mide 0.5 x 0.3 cms. de color blanquecino. Al corte una consistencia firme. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral constituida por islotes de células basaloides y sombreados, rodeados de un estroma en el que se observan abundantes células gigantes multinucleadas.\r\n\r\n\r\n\r\n\r\n', '-PILOMATRIXOMA, mejilla derecha', '', ''),
	(1220, 'Q2109-2721', 'Q', '1042596244', 'NOHEMI SARAY ZAMORA CONTRERAS', '3202593950', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Dcotor CARLOS EDUARDO ROMAN HERAZO', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Quinto dedo mano izquierda" un dedo que mide 1 x 0.5 cms. recubierto por piel de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Quinto dedo mano derecha" un dedo que mide 1 x 0.5 cms. recubierto por piel de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan dos estructuras propias de un dedo.\r\n\r\n\r\n\r\n\r\n', '1.DEDO SUPERNUMERARIO, mano izquierda\r\n2.DEDO SUPERNUMERARIO, mano derecha', '', ''),
	(1221, 'Q2109-2722', 'Q', '1124059343', 'DERIS DAMAR JIMENEZ TEHERAN', '3004615052', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 cms., la serosa es congestiva y cubierta por material fibrinopurulento. Al corte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1222, 'Q2109-2723', 'Q', '1048444775', 'LUNA ISABEL LOPEZ BARRIOS', '3024692641', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-09-09', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste tirogloso" se recibe una masa de aspecto quistico de consistencia renitente de color blanco azulado que mide 3.3 x 2.8 x 2.3 cms. Al corte salida de un material de aspecto mucoide dejando ver una cavidad unilocular de paredes lisas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Lesión quistica tapizada parcialmente por epitelio escamoso rodeado de focos de tejido tiroideo y un infiltrado inflamatorio crónico.\r\n\r\n\r\n\r\n\r\n', '-QUÍSTE DEL CONDUCTO TIROGLOSO\r\n\r\n', '', ''),
	(1223, 'Q2109-2724', 'Q', '1043644946', 'CRISTAL ROSARIO NARANJO TEHERAN', '3213029492', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'dOCTOR OSCAR ENRIQUE ROMERO ORTIZ', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nodulo en mama derecha" se reciben dos formaciones nodualres, de color blanquecino la mayor mide 1 x 0.5 cms. y la menor de 1 x 0.3 cms. La mayor rodeada por tejido fibroso. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n\r\n', '-FIBROADENOMA, mama derecha\r\n', '', ''),
	(1224, 'Q2109-2725', 'Q', '1138084384', 'DILAN ANDRES MIRANDA BETANCOURT', '3108953686', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2021-09-09', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotualdo, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes A revelan mucosa esofagica hiperplasica en la que se observa la presencia de vasos intraepiteliales e infiltración por linfocitos.\r\nLos cortes B revelan mucosa gastrica antral cuya lámina propia esta infiltrada por escasos linfocitos. En la muestra no se observa H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C revelan mucosa duodenal que muestra la estructura usual.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS POR REFLUJO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL SIN ALTERACIONES\r\n', '', ''),
	(1225, 'Q2109-2726', 'Q', '1001974768', 'ANDREA CAROLINA GARCIA CASTILLO', '000', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" Se recibe un apéndice cecal fragmentada que mide 9 y 2 cms. respectivamente. Al corte la luz ocupada por un material blanqueicno. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1226, 'Q2109-2727', 'Q', '64892256', 'TERESA CANDELARIA PELUFO MONTES', '000', 'F', '48', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor benigno tejido adiposo de espalda" se recibe fragmento de tejido de color oscuro, consistencia elástica que mide 4 x 3 x 1 cms. y trae adherido fragmento de tejido adiposo.\r\nPor separado, se reciben, dos fragmentos de tejido adiposo que miden 0.5 cms. Al corte un tejido amarillento y aspecto adiposo que alternan con áreas de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal constituido por lobulos de tejido adiposo que alternan con tejido fibroso.\r\n\r\n\r\n\r\n\r\n', '-LIPOMA, espalda fragmentos', '', ''),
	(1227, 'Q2109-2728', 'Q', '45556103', 'GISELA BATISTA PINEDA', '000', 'F', '37', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-09-15', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama supernumeraria derecha" dos fragmentos de tejido, juntas pesan 35 gms. de aspecto adiposo, color amarillento, la mayor tapizada por piel de color oscuro y mide 5 x 5 x 2 cms. el mayor mide 3 x 1.3 cms. Al corte una superficie amarillentas y aspecto adiposo. Se toman cortes y se rotulan A.\r\n2. "Mama supernumeraria izquierda"  fragmento de tejido de aspecto adiposo, color amarillento tapizada por piel que pesa 15 gms. y mide 4 x 3 x 1.5 cms. Al corte tejido adiposo de color amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A y B revelan tejido adiposo con escasos canaliculos mamarios dilatados.\r\n\r\n\r\n\r\n', '1.MAMA SUPERNUMERARIA DERECHA\r\n2.MAMA SUPERNUMERARIA IZQUIERDA', '', ''),
	(1228, 'Q2109-2729', 'Q', 'VEN24904540', 'LEIDY GERALDIN SANCHEZ CUELLO', '0000', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula"  se recibe una vesícula biliar que mide 6 x 3 cms. la serosa es de color pardo rosado. Al corte salida de abundante calculos pequeños irregulares de color amarillento, la mucosa conserva el aspecto de terciopelao. Se toman cortes\r\n\r\n\r\n\r\n', 'vesícula biliar cuya mucosa esta infiltrada por linfocitos, plasmocitos e histiocitos espumosos, hay hipertrofia de la muscular y congestión de la serosa.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n-COLESTEROLOSIS', '', ''),
	(1229, 'Q2109-2730', 'Q', '1118561295', 'SASQUIA MARIA GARCIA LIDUEÑA', '00', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. la sereosa es opaca y congestiva. Al corte la luz ocupada pro un material de color oscuro. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal que muestra foliculos linfoides hiperplasicos e infiltración por escasos neutrófilos a nivel de la muscular, hay congestión vascular de la serosa.\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA', '', ''),
	(1230, 'Q2109-2731', 'Q', '22410249', 'GLADYS BAÑOS MARTINEZ', '000', 'F', '70', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-09-06', '2021-09-02', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Utero" se recibe utero sin anexos que mide 7 x 3 x 2 cms. pesa 30 gms. El cuello tapizado por una mucosa de color blanquecino con orificio transversal. El cuerpo esta cubierto por una serosa de color pardo claro. Al corte el canal endocervical y la cavidad endometrial son permeables, el endometrio es plano y blanquecino, el espesor del miometrio es de 1 cm. sin lesiones evidentes. Acompañado a esto tres fragmentos de tejido alargados, tapizados por una mucosa blanquecina el mayor mide 7 cms. y el menor de 1 cm. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cervix tapizado por epitelio escamoso hiperplasico con hiperqueratosis, el estroma infiltrado por linfocitos y plasmocitos. El endometrio es de tipo atrófico.\r\n\r\n\r\n\r\n', ' Utero (30 gms.):\r\n-CERVICITIS CRÓNICA CON HIPERQUERATOSIS\r\n-ENDOMETRTIO ATROFICO', '', ''),
	(1231, 'Q2109-2732', 'Q', '1051814582', 'YULIS GUZMAN HERNANDEZ', '3005799080', 'F', '35', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de granuloma" se reciben dos fragmentos de tejido de forma irregular de color pardo rosado y consistencia blanda que miden 2.2 x 0.8 y 1.8 x 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido de granulación densamente infiltrado pr PMN neutrófilos, células plasmáticas y linfocitos. Hay presencia de células gigantes multinucleadas a cuerpo extraño.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA GRANULOMATOSA\r\n\r\n\r\n', '', ''),
	(1232, 'Q2109-2733', 'Q', '1049586675', 'YOSSUAN JOSE LOMBANA BELEÑO', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estomago" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1233, 'Q2109-2734', 'Q', '1041992208', 'KEMILY ANDREA DIAZ MARIMON', '3116856597', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-09-09', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Nevo melanocitico en mano izquierda" se recibe una elipse de piel de color pardo claro y consistencia elástica que mide 0.7 x 0.5 cms. y la superficie externa se observa una lesión hiperpigmentada mal delimitada. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se observa una proliferación de células névicas de citoplasma claro y aspecto tumefacto algunas multinucleadas, que se disponen en un patrón irregular. No hay actividad de unión.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en piel de la mano izquierda:\r\n-NEVO MELANOCÍTICO INTRADÉRMICO DE CÉLULAS BALONADAS\r\n\r\n', '', ''),
	(1234, 'Q2109-2735', 'Q', '1044927733', 'ROSAURA HERRERA PAYARES', '3122388133', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DOctor ANTONIO DE JESUS ARAUJO OROZCO', NULL, '2021-09-08', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Tumor en nervio meñique de mano derecha" se reciben dos fragmentos de tejido de forma irregular, de color pardo claro y consistencia elástica que miden 0.9 x 0.4 y 0.5 x 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran un tumor neural benigno compuesto por células grandes, poligonales, de nucleos redondeados y citoplasma granular acidofílico. Se disponen en haces y en nidos sólidos. En la periferia se identifican fibras nerviosas.\r\n\r\n\r\n', ' Reseción de lesión en 5to dedo de mano derecha:\r\n-TUMOR DE CÉLULAS GRANULARES\r\n\r\n\r\n\r\n', '', 'Esta lesión corresponde a la anteriormente denominada MIOBLASTOMA DE CÉLULAS GRANULARES.\r\n\r\n'),
	(1235, 'Q2109-2736', 'Q', '1077724836', 'DERLY GRAZIELLI ANDRADE', '3002725992', 'F', '14', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'doctora BLEYDIE ESPINOSA ARIZA', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 3.5 x 0.7 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una reacción inflamatoria aguda mediada por PMN neutrófilos y linfocitos que compromete la serosa y la subserosa.\r\n\r\n\r\n\r\n', '-PERIAPENDICITIS AGUDA\r\n\r\n', '', ''),
	(1236, 'Q2109-2737', 'Q', '45425488', 'AMALFY CONEO RODRIGUEZ', '000', 'F', '62', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesicula biliar que mide 5.5 x 2.5 cms. La superficie extrena esta parcialmente cubierta por una serosa despulida. Al corte la pared esta engrosada, la mucosa ha perdido su aspecto aterciopelado y hay salida de un material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1237, 'Q2109-2738', 'Q', '45439528', 'GLORIA REGINA CABRERA FUENTES', '3103706169', 'F', '60', 'GASTROPACK SAS', 'ECOPETROL S.A', '2020205', '74106', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1238, 'Q2109-2739', 'Q', '1142936002', 'ISABELLA SARABIA CASTRO', '3223718835', 'F', '8', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '', '', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-09-10', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reicben:\r\n1. "Antro" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan D.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica que conserva la morfología habitual. La lámina propia está ligeramente edematosa, congestiva e infiltrada por linfocitos. No se observa H.pylori, actividad inflamatoria ni cambios displásicos.\r\nLos cortes rotulados C y D muestran mucosa duodenal que conserva la morfología usual. La lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. No se observan parasitos, granulomas ni cambios displásicos.\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n3.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n4..Biopsia endoscópica de segunda porción de duodeno:\r\n-DUODENITIS CRÓNICA\r\n', '', ''),
	(1239, 'Q2109-2740', 'Q', '1235048524', 'GABRIELA ISABEL BERRIO VELEZ', '3186106047', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenomegalia cervical nivel V" se recibe una masa de tejido de forma irregular de color pardo rosado y consistencia elástica que mide 1.5 x 1 cms. en su mayor dimensión, la superficie externa es multilobulada y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada por la presencia de folículos con centros germinales activos y contienen histiocitos que fagocitan detritus celulares. Hay acumulos de histiocitos en los espacios interfoliculares. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de ganglio linfático cervical nivel V:\r\n-HIPERPLASIA FOLICULAR REACTIVA\r\n\r\n\r\n\r\n', '', 'Los hallazgos histologicos son muy sugestivos de una entidad sistemica tipo toxoplasmosis.\r\n\r\n\r\n'),
	(1240, 'Q2109-2741', 'Q', '1201274789', 'ISAAC DAVID SANCHEZ NAVARRO', '3016702736', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala derecha" una amigdala palatina de forma irregular de color pardo claro y consistencia elástica que mide 3 x 1.7 cms. en sus mayores dimensiones, la superficie externa es multilobulada y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amigdala izquierda" una amigdala palatina de forma irregular de color pardo claro y consistencia elástica que mide 3.2 x 2 cms. en sus mayores dimensiones, la superficie externa es multilobulada y al corte se observa una superficie homogenea de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.5 x 2.2 x 1.5 cms. la superficie externa es irregular y alc orte se observa una superficie homogenea de color pardo claro. Se toman crotes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n', '', ''),
	(1241, 'Q2109-2742', 'Q', '30768171', 'SARA ESTHER ARNEDO DE SANTOYA', '000', 'F', '70', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898241', '69000', 'Doctor JOSE ACEVEDO', NULL, '2021-09-06', '2021-09-03', 'VIRNA CARABALLO OSORIO', 'Rotulado "Utero + cuello" se recibe un utero que pesa 38 gms. y mide 7.8 x 4 x 3.5 cms. El cervix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo conserva el tamaño y la forma habitual. Al corte el canal endocervical es permeable, la cavidad endometrial esta ocupada por una masa de color pardo claro y consistencia elástica quie mide 1.9 x 0.8 cms. en sus mayores dimensiones. El miometrio es fibrilar. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cervix muestra una reacción inflamatoria crónica. El endometrio es inactivo. La masa descrita en la cavidad endometrial esta compuesta por glándulas dilatadas tapizadas por un epitelio inactivo que reposan en un estroma fibroso.\r\n\r\n\r\n\r\n\r\n', ' Histerectomía vaginal:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO INACTIVO\r\n-PÓLIPO ENDOMETRIAL ATRÓFICO\r\n\r\n', '', ''),
	(1242, 'Q2109-2743', 'Q', '33101395', 'PATRICIA CARABALLO OSORIO', '000', 'F', '42', 'PARTICULAR', 'C.', '898201', '30215', 'Doctora MANUELA BERROCAL', NULL, '2021-09-07', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Capsula periprotésica derecha" una estructura sacular que mide 9.5 x 8 cms. en sus mayores dimensiones, las paredes son delgadas en algunas áreas transparente, la superficie interna es lisa y brillante y la externa es irregular con fragmentos de tejido graso. En la revisión no se encuentran nódulos ni zonas de engrosamiento. Hay presencia en la cara interna de un material viscoso, transparente. Se toman cortes y se rotulan A.\r\n2. "Capsula periprotésica izquierda" una estructura sacular que mide 9.5 x 7 cms. en sus mayores dimensiones, la superficie interna es lisa, brillante, el espesor es variable y la superficie externa es irregular con presencia de fragmentos de tejido adiposo.  Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente rotulado "Tejido mamario del cuadrante super-externo de la mama derecha" contiene un fragmento de tejido de forma irregular, color pardo claro y consistencia firme que mide 2 x 2.3 x 0.6 cms. en sus mayores dimensiones. Al corte presenta una superficie con áreas amarillentas. Se lámina en su totalidad. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran un tejido fibroso que en una de sus caras muestra una proliferación de histiocitos multivacuolados que en algunas áreas se mezclan con las fibras colágenas. Hay focos de inflamación crónica mediada por linfocitos. No se encuentran metaplasia sinovial ni cambios neoplásicos.\r\nLos cortes rotulados B muestran una pared fibrosa que en algunas áreas muestra metaplasia sinovial en su cara interna. No hay cambios neoplásicos.\r\nLos cortes rotulados C muestran tejido mamario cuya morfología está alterada por la presencia de canalículos quísticamente dilatados y focos de adenosis sobre un estroma fibroescleroso. No hay cambios neoplásicos.\r\n\r\n', '1.Resección de capsula periprotésica de mama derecha:\r\n-CAPSULA FIBROSA CON REACCIÓN INFLAMATORIA CRÓNICA \r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.Resección de capsula periprotésica de mama izquierda:\r\n-CAPSULA FIBROSA CON FOCOS DE METAPLASIA SINOVIAL\r\n3.Resección de nódulo en mama derecha:\r\n-CONDICIÓN FIBROQUISTICA CON FOCOS DE ADENOSIS\r\n', '', ''),
	(1243, 'Q2109-2744', 'Q', '43064393', 'OLGA LUCIA VELEZ VELEZ', '3024042930', 'F', '57', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctor FRANCISCO PACHECO CARPIO', NULL, '2021-09-09', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de glandula salival" en un mismo recipiente, se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda cuyos diámetros mayores oscilan entre 0.3 y 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran múltiples lóbulos de glándulas salivares menores de tipo mixto cuya morfología está preservada. En los diferentes lóbulos se identifican entre 2 y 3 acúmulos linfoplasmocitarios de más de 50 células (focos) sin destrucción de los acinos glandulares ni de los conductos intercalares, correspondiendo a un Grado 2 de la escala de Tarpley. No se identifica fibrosis.\r\n\r\n\r\n\r\n', ' Biopsia de glándulas salivares menores:\r\n-SIALADENITIS CRÓNICA CON CAMBIOS CONSISTENTES CON SINDROME DE SJÖGREN \r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1244, 'Q2109-2745', 'Q', '22810204', 'KETTY DE LA ROSA MARTINEZ', '6480063', 'F', '41', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vagina" se recibe un fragmento de tejido, aplanado de color pardo claro y consistencia blanda que mide 0.8 x 0.6 x 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de tejido de granulación con densa infiltración por neutrófilos, linfocitos y células plasmáticas.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n\r\n', '', ''),
	(1245, 'Q2109-2746', 'Q', '1053007227', 'CRISTOBAL IVAN PORTELA ZUÑIGA', '3116614204', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido, membranoso de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido, alargado de color pardo claro y consistencia blanda que promedian 0.5 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro. En algunas áreas hay vasos de la lámina propia propia.\r\nLos cortes rotulados B muestran mucosa antrocorporal que conserva su morfología habitual. No hay cambios inflamatorios ni presencia de H.pylori.\r\nLos cortes rotulados C muestran mucosa duodenal cuya morfología está preservada. Hay edema, congestión e infiltración linfoplasmocitaria de la lámina propia. No se encuentran parásitos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-MUCOSA ANTROCOPORAL SIN ALTERACIONES\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(1246, 'Q2109-2747', 'Q', '1043634069', 'VALENTINA BARRIOS OVIEDO', '3145360327', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(1247, 'Q2109-2748', 'Q', '1043964584', 'LIZETT PAOLA MIRANDA AREVALO', '3145358822', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 0.5 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro con membranas de aspecto fibroso en su superficie. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n', '', ''),
	(1248, 'Q2109-2749', 'Q', '1103497364', 'MEBYS MARIA PERALTA QUINTERO', '3106579001', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido, membranoso de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido, de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido, alargado de color pardo claro y consistencia blanda que mide 0.5 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmento de epitelio escamoso maduro. En algunas se visualiza la lámina propia que muestra densa infiltración linfocítica.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya lámina propia muestra edema, congestión e infiltración línfoplasmocitaria. No se encuentran granulomas ni parásitos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA\r\n', '', ''),
	(1249, 'Q2109-2750', 'Q', '36505519', 'MARIA HERNANDEZ NUÑEZ', '0000', 'F', '43', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color blanco nacarado y consistencia blanda que mide 0.4 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de exocervix con discreta infiltración mononuclear del estroma. No hay cambios de LIE.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de exocervix:\r\n-CERVICITIS CRÓNICA\r\n\r\n', '', ''),
	(1250, 'Q2109-2751', 'Q', '33150177', 'ENITH ESTRADA SALGUEDO', '0000', 'F', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-11-05', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Tejido endometrial" varios fragmentos de tejido, de forma irregular de color pardo grisáceo y consistencia friable que en conjunto hacen un volumen de 2 ml. Se toma todo y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Tejido endometrial" pequeños fragmentos de tejido, de forma irregular de color pardo grisáceo y consistencia friable que en conjunto hacen un volumen de 1 ml. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'El especímen está compuesto en su mayoría por tejido necrótico. Se identifica un tumor maligno compuesto por células pleomórficas con nucleos grandes, irregulares, algunos hipercromáticos, otros vacuolados, que se disponen en un patrón sólido que en algunos campos insinúa estructuras glanduliformes.\r\n\r\n\r\n', ' Legrado uterino:\r\n-TUMOR MALIGNO MAL DIFERENCIADO\r\n\r\n\r\n\r\n', '', 'OBSERVACIONES: Los hallazgos descritos son sugestivos de un ADENOCARCINOMA POBREMENTE DIFERENCIADO, pero lo escaso del material viable nos impide afirmarlo categoricamente.\r\n\r\n\r\nSe retiran 2 bloques por la señora JOSEFINA QUINTANA ESTRADA CC. 45.526.744 (5 denoviembre/2021)\r\n'),
	(1251, 'Q2109-2752', 'Q', '1053008154', 'ANA GABRIELA GONZALEZ PAYARES', '3023447410', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un minusculo fragmento de tejido, membranoso de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso sin alteraciones.\r\nLos cortes rotulados B muestran mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos con presencia de acúmulos linfoides. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya lámina propia muestra densa infiltración linfoplasmocitaria. No se encuentran granulomas ni parásitos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(1252, 'Q2109-2753', 'Q', '33338490', 'MARIA DEL ROSARIO ROJAS CARO', '0000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Tejido endometrial" varios fragmentos de tejido de un material viscoso con aspecto de moco que en conjunto hacen un volumen de 0.5 ml. Se toma todo y se rotualn A.\r\n2. "Tejido endometrial" SIN FIJACIÓN, se reciben fragmentos de tejido de forma irregular de color rosado en conjunto hacen un volumen de 0.5 ml. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\nLos cortes rotulados B muestran tejido endometrial con cambios avanzados de autólisis por falta absoluta de fijación.\r\n\r\n\r\n\r\n\r\n', '1.Biopsia de endocervix:\r\n-PÓLIPO ENDOCERVICAL\r\n2.Legrado uterino:\r\n-VER DESCRIPCIÓN MACRO Y MICROSCÓPICA\r\n\r\n', '', ''),
	(1253, 'Q2109-2754', 'Q', '64551325', 'CARMEN MARIA ROMERO CAMPO', '3136074979', 'F', '58', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentran cambios de ulcera péptica. No se observa H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1254, 'Q2109-2755', 'Q', '1143345777', 'HENRY JESUS MEJIA DE AVILA', '3023545744', 'M', '30', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Valvula ileo cecal" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa colónica compuesta por glándulas tubulares de revestimiento epitelial normal. Hay edema, congestión e infiltración mononuclear de la lámina propia con presencia de acúmulos linfoides. No se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de valvula ileocecal:\r\n-COLITIS CRÓNICA\r\n\r\n', '', ''),
	(1255, 'Q2109-2756', 'Q', '1047503613', 'JESUS DAVID QUINTANA TATIS', '3004934819', 'M', '25', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-08', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1256, 'Q2109-2757', 'Q', '169023116', 'HIJO DE ROSA JULIO RIVERA', '000', 'M', '0', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'doctora BLEYDIE ESPINOSA ARIZA', NULL, '2021-09-16', '2021-09-07', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Pliegue peritoneal" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.8 cms. en sus mayores dimensiones. Al corte presenta una superficie de color blanquecino, homogenea. Se toman cortes y se rotulan A.\r\n2. "Colon transverso" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.5 cms. Se toma todo y se rotualn B.\r\n3. Apéndice" un apéndice cecal que mide 4 x 0.4 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa lisa, brillante con ligero aumento de la trama vascular. Al corte se encuentra una luz ligeramente dilatada. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A y B muestran fragmentos de pared colónica en las que se observan fibras nerviosas hipertróficas en los plexos submucosos y mientéricos. No se identifican células ganglionares.\r\nLos cortes rotulados C muestran apéndice cecal que conserva su morfología habitual.\r\n\r\n\r\n\r\n', '1.Biopsia rotulada "pliegue peritoneal":\r\n-PARED DE COLON CON AUSENCIA DE CÉLULAS GANGLIONARES\r\n2.Biopsia de colon transverso:\r\n-PARED DE COLON CON AUSENCIA DE CÉLULAS GANGLIONARES\r\n3.APÉNDICE CECAL', '', ''),
	(1257, 'Q2109-2758', 'Q', '1044931631', 'DUBAN NUÑEZ BUELVAS', '3215156280', 'M', '25', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1258, 'Q2109-2759', 'Q', '1140899654', 'ANDREA SOFIA FERNANDEZ CANDELARIO', '3007044375', 'F', '21', 'PARTICULAR', '', '898201', '30215', '', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste en nodulo mama derecha" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.2 x 1.2 x 1.2 cms. La superficie externa es multinobulada. Al corte se observa una superficie homogena de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(1259, 'Q2109-2760', 'Q', '45501178', 'ARLEDIS BENITEZ RAMOS', '6901370', 'F', '49', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1260, 'Q2109-2761', 'Q', '45758488', 'CLAUDIA MARGARITA ZUÑIGA BENAVIDES', '000', 'F', '46', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-09-13', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Trucut de seno derecho" se reciben seis fragmentos filiformes de tejido de color pardo claro y consistencia blanda el mayor mide 2 cms. de longitud, y el menor de 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células de núcleos moderadamente plemórficos que se disponen en su mayoría en un patrón intraductal de patron sólido. Se identifican áreas extensas de infiltración del estroma en forma de nidos y cordones. No se identifica infiltración linfovascular.\r\n\r\n\r\n\r\n', ' Biopsia por trucut de mama derecha:\r\n-CARCINOMA DUCTAL MODERADAMENTE DIFERENCIADO, TIPO NO ESPECIAL, INFILTRANTE\r\n\r\n\r\n\r\n', '', 'Vease descripción microscópica.\r\nSe sugiere realizar estudios de inmunohistoquímica para receptores hormonales, HER 2 y KI67.'),
	(1261, 'Q2109-2762', 'Q', '1052053945', 'JUAN DAVID CARPIO QUEVEDO', '3115603982', 'M', '5', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-09-13', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Recto" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotualn A.\r\n2. "Colon derecho" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran mucosa colónica cuya morfología está preservada. La lámina propia está edematosa, congestiva e infiltrada por linfocitos, células plasmáticas y PMN netrófilos. No se observan parásitos, granulomas, abscesos cripticos, disminución del moco ni cambios displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de recto:\r\n-PROCTITIS AGUDA Y CRÓNICA\r\n2.Biopsia endoscópica de colon derecho:\r\n-COLITIS AGUDA Y CRÓNICA\r\n\r\n', '', ''),
	(1262, 'Q2109-2763', 'Q', '102247844', 'LAURA VANESSA SALGADO CASSERES', '000', 'F', '20', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Resección de lesión en axila derecha" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 4.5 x 2.5 x 1 cms. en sus mayores dimentiones, la superficie externa esta parcialmente cubierta por una elipse de piel de 2.5 x 0.5 cms. Al corte se observa una superficie de color pardo claro que alternan con áreas amarillentas. Se toman cortes y se rotulan A.\r\n2. "Resección de lesión en axila izquierda" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 4.5 x 2 x 1.8 cms., la superficie externa esta parcialmente cubierta por una elipse de piel de 2.3 x 1.5 cms. Al corte se observa una superficie de color pardo claro que alternan con áreas amarillentas. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejido mamario cuya morfología está alterada por la presencia de quístes de pequeño calibre que reposan en un estroma fibroso colagenizado. No se observan cambios proliferativos.\r\n\r\n\r\n', '1.Resección de lesión en axila derecha:\r\n-TEJIDO MAMARIO CON CAMBIOS DE CONDICIÓN FIBROQUISTICA\r\n2.Resección de lesión en axila izquierda:\r\n-TEJIDO MAMARIO CON CAMBIOS DE CONDICIÓN FIBROQUISTICA', '', ''),
	(1263, 'Q2109-2764', 'Q', '939205022021981', 'ALBA MARIELA DOMMAR', '000', 'F', '40', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-09-13', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Trucut de seno izquierdo" se reciben cinco fragmentos filiformes de tejido de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligbo compuesto por células con núcleos pleomórficos, hipercromáticos, que se disponen en nidos sólidos, cordones y formando estructuras glanduliformes que infiltran el estroma. El tumor esta presente en los 5 cilíndros recibidos. No se identifica infiltración linfovascular.\r\n\r\n\r\n\r\n', ' Biopsia por tructut de mama izquierda:\r\n-CARCINOMA DUCTAL MODERADAMENTE DIFERENCIADO, TIPO NO ESPECIAL, INFILTRANTE\r\n\r\n\r\n\r\n', '', 'Se sugiere realizar estudios de inmunohistoquímica para receptores hormonales HER 2 y KI67.'),
	(1264, 'Q2109-2765', 'Q', '1001978797', 'JEISON DAVID VALLE VILLANUEVA', '6722016', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'rotulado "Epiplon" se recibe un fragmento fibroadiposo de de aspecto membranoso que mide 15 x 8.5 cms. en sus mayores dimensiones, en la parte central se observa un áreas de aspecto fibroso y al corte se observa una superficie amarillenta de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran epiplon con marcada congestión y áreas de fibrosis. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n\r\n', '-FRAGMENTO DE EPIPLON\r\n\r\n', '', ''),
	(1265, 'Q2109-2766', 'Q', '1001887836', 'VALERIA ISABEL CORREA SERPA', '00', 'F', '21', 'GASTROPACK SAS', 'ECOPETROL S.A', '898241', '69000', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1266, 'Q2109-2767', 'Q', '1143420227', 'JAYKER JESUS OROZCO LOBO', '3042343876', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Testiculo derecho" se recibe un testiculo con sus elementos del cordon que miden 2.3 x 1.5 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte se observa una superficie violácea finamente granular que compromete todo el área testicular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran testiculo inmaduro con áreas extensas de necrosis y hemorrágico.\r\n\r\n\r\n\r\n\r\n', ' Orquiectomía derecha:\r\n-TESTICULO INMADURO CON NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n', '', ''),
	(1267, 'Q2109-2768', 'Q', '33125020', 'YOLANDA SUSANA DULUGAR URANGO', '3014285746', 'F', '75', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898241', '69000', 'EFRAIN RAMIREZ', NULL, '2021-09-20', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Hemangioma auricular" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia elástica que mide 1.8 x 1.5 x 1.4 cms. La superficie externa esta parcialmente cubierta por piel que mide 2.2 x 1.5 cms. Al corte se observa una superficie de color violáceo finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno derivado de los anexos cutáneos, compuesto por células pequeñas, basaloides, que se dispone en un patrón trabeculado, que en algunas áreas rodea grandes espacios vasculares. En las áreas más sólidas las células toman características más claras.\r\n\r\n\r\n\r\n', ' Resección de lesión periauricular derecha:\r\n-ESPIRADENOMA\r\n\r\n\r\n\r\n', '', 'Caso visto en conjunto con el doctor José Caraballo.\r\n\r\n'),
	(1268, 'Q2109-2769', 'Q', '1128052006', 'HAROLD CARO MARTINEZ', '0000', 'M', '35', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.2 X 2.1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1269, 'Q2109-2770', 'Q', '38941202', 'LIDYS DEL CARMEN PALOMO MORA', '0000', 'F', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.3 x 1.3 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1270, 'Q2109-2771', 'Q', '33340603', 'YAMILE ESTHER BARRIOS FERRADANEZ', '000', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'ORG.  CLÍNICA GENERAL DEL NORTE', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-09-13', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto en masa en hipogastrio" se recibe una masa de tejido de forma irregular de color pardo amarillento y consistencia elástica que mide 1.1 x 0.8 x 0.8 cms. Al corte se observa una superficie de color amarillento que alternan con áreas de color blanquecino. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de tejido fibroadiposo con áreas de marcada colagenización.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en hipogastrio:\r\n-FRAGMENTO DE TEJIDO FIBROADIPOSO', '', ''),
	(1271, 'Q2109-2772', 'Q', '45779965', 'MIRLADIS DEL CARMEN TORRES BALLESTERO', '000', 'F', '46', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-09-10', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de masa en región lumbar" se reciben múltiples fragmentos de tejido de forma irregular de color pardo amarillento y consistencia elástica que juntos miden 2 x 2 x 1.2 cms. Uno de los fragmentos de color pardo grisáceo y consistencia elástica. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de una estructura quistica tapizada por epitelio escamoso con contenido de queratina laminar. Otros cortes muestran fragmentos de tejido de aspecto fibroadiposo.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región lumbosacra:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE (FRAGMENTOS)\r\n\r\n', '', ''),
	(1272, 'Q2109-2773', 'Q', '1001937564', 'LUISA MONROY PITALUA', '000', 'F', '20', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', '', NULL, '2021-09-13', '2021-09-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste de ovario" se recibe un fragmento de tejido de forma irregular de color pardo claro con áreas violáceas de consistneia elástica que mide 2.3 x 1.3 x 1 cms. en sus mayores dimensiones. Al corte se observa una superficie de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran ovario comprimido por una estructura quistica parcialmente tapizada por células luteinizadas con contenido de sangre.\r\n\r\n\r\n\r\n\r\n', ' Resección de quíste de ovario izquierdo (cistectomía):\r\n-QUÍSTE LUTEO HEMORRÁGICO', '', ''),
	(1273, 'Q2109-2774', 'Q', '34947270', 'DOLLY VIZCAINO ESTRADA', '000', 'F', '45', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-14', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma ovalada de color gris que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'cervix tapizado por un epitelio escamoso con cambios coilociticos asociados, el estroma edematoso infiltrado por linfocitos, plasmocitos y neutrófilos en cantidad moderada.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE BAJO GRADO (CONDILOMA PLANO)', '', ''),
	(1274, 'Q2109-2775', 'Q', '33135659', 'GRACIELA DEL ROSARIO ROMAN DE GUERRERO', '0000', 'F', '70', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-14', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos,  plasmocitos en escasa cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n', '', ''),
	(1275, 'Q2109-2776', 'Q', '20739939', 'LUZ DEISY RODRIGUEZ LOPEZ', '3118052952', 'F', '41', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-14', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden  0.4 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1276, 'Q2109-2777', 'Q', '1125790025', 'ROBERTO CARLOS ALVAREZ PEREZ', '3013396601', 'M', '38', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-15', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido redondeado de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n', '', ''),
	(1277, 'Q2109-2778', 'Q', '73581610', 'GREGORIO VEGA CAICEDO', '0000', 'M', '44', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-14', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1278, 'Q2109-2779', 'Q', '1142931239', 'YORCELIS CAROLINA MALLARINO SAYAS', '3017485131', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-09-14', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se recibe una masa de tejido de forma ovoidea de color blanquecino y consistencia elástica que mide 3.2 x 1.5 x 1.8 cms. Al corte una superficie homogenea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA', '', ''),
	(1279, 'Q2109-2780', 'Q', '1201223775', 'JESUS DAVID ORTIZ ORTEGA', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-14', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es opaca y congestiva. Al cporte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1280, 'Q2109-2781', 'Q', '1043334562', 'EDEL JUNIOR VALLEJO LOPEZ', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-09-15', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 3 x 1.5 x 0.6 cms. Al corte una superficie de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(1281, 'Q2109-2782', 'Q', '1001970800', 'LUIS FERNNADO DE LA ROSA CAMACHO', '000', 'M', '21', 'CLIN. SAN JOSE DE TORICES SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Dcotor ALVARO MENDOZA BELEÑO', NULL, '2021-09-15', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 cms. la serosa es congestiva de color rosado. Al corte la luz ocupada por un material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal que muestra obliteración fibrosa de la luz.\r\n\r\n\r\n\r\n\r\n', '-APENDICE CECAL CON OBLITERACIÓN FIBROSA DE LA LUZ', '', ''),
	(1282, 'Q2109-2783', 'Q', '1043303513', 'YUSTIN ELIAAT ALVARADO GARCIA', '3207666042', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-09-15', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice + epiplon" se recibe un apéndice cecal que trae adherido fragmento de epiplon, el apendice mide 10 x 1 cms. y el fragmento de epiplon mide 7 cms. la serosa del apéndice es opaca y despulida. Al corte su luz ocupada por material amarillento. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1283, 'Q2109-2784', 'Q', '1050740175', 'MICHAEL DAVID HERRERA CHAMORRO', '3128724597', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-09-20', '2021-09-10', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Fibrosis cuerpo cavernoso" se reciben cinco fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedia 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido fibroconectivo con un infiltrado inflamatorio mediado por escasos linfocitos.\r\n\r\n\r\n\r\n\r\n', '-FRAGMENTO DE TEJIDO FIBROCONECTIVO\r\n\r\n', '', ''),
	(1284, 'Q2109-2785', 'Q', '33117012', 'AMELIA VELEZ DE PUELLO', '0000', 'F', '77', 'PARTICULAR', 'C.', '898201', '30215', 'Doctora MANUELA BERROCAL', NULL, '2021-09-14', '2021-09-13', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lesión en piel de patilla izquierda" un fragmento de piel de forma elíptica que mide 1.5 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular, con excrecencias de color rosado. Una de estas se aproxima al márgen de resección. Se toman cortes así: A márgenes de resección, B se lamina el resto del tejido.\r\n2. Un segundo recipiente, rotulado "Lesión en mejilla izquierda" contiene una elipse de piel que mide 3 x 1.8 cms. en sus mayores dimensiones, la superficie externa presenta un área central deprimida de color blanquecino. Se toman cortes así: C márgenes de resección, D se lamina el resto del tejido.\r\n\r\n', 'Los cortes rotulados A y B muestran piel con epidermis atrófica y cambios de queratosis solar repesentados por cambios displásicos moderados a severos del epitelio escamoso, que se continuan en algunas áreas hacia las unidades pilosebaceas. Hay elastosis del dermis papilar y una reacción inflamatoria crónica mediada en su mayoría por linfocitos. Estos cambios estan limitados al dermis papilar.\r\nLos cortes rotulados C muestran cambios similares a los descritos en A y B.\r\nLos cortes rotulados D muestran cambios de queratosis solar que en algunos campos presentan acantosis irregular con un patrón displasico de tipo bowenoide. Hay, además, una extensa reacción inflamatoria granulomatosa con múltiples células gigantes a cuerpo extraño.\r\n\r\n', '1.Resección de lesión en piel de patilla izquierda:\r\n-QUERATOSIS SOLAR (ACTÍNICA) QUE COMPROMETE EL MÁRGEN DE RESECCIÓN\r\n2.Resección en lesión en piel de mejilla izquierda:\r\n-QUERATOSIS SOLAR (ACTÍNICA) QUE COMPROMETE EL MÁRGEN DE RESECCIÓN\r\n-REACCIÓN GRANULOMATOSA A CUERPO EXTRAÑO\r\n\r\n', '', 'Algunos autores consideran la queratosis solar tipo bowenoide como un CARCINOMA ESCAMOCELULAR IN SITU. \r\nVease descripción microscópica.'),
	(1285, 'Q2109-2786', 'Q', '26731243', 'RIQUILDA DIAZ DE MARTINEZ', '3017259933', 'F', '81', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un punch de piel que mide 0.5 cms. consistencia elástica muestra un área hipopigmentada de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan piel con hiperqueratosis con atrófia de la epidermis, edema, dermis papilar e infiltración por linfoctos en el dermis.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-LIQUEN ESCLEROSO', '', ''),
	(1286, 'Q2109-2787', 'Q', '73079700', 'ANTONIO MARIA PEREZ LOPEZ', '3107358148', 'M', '64', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa oxíntica sin cambios.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA OXÍNTICA SIN CAMBIOS\r\n\r\n\r\n\r\n', '', ''),
	(1287, 'Q2109-2788', 'Q', '37939980', 'CLAUDIA PATRICIA SARMIENTO GOEZ', '3002121922', 'F', '52', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-20', '2021-09-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Antro" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A revelan fragmentos de epitelio escamoso maduro sin representación de la lámina propia. No se observa eosinófilos intraepiteliales.\r\nLos cortes de B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1288, 'Q2109-2789', 'Q', '45539760', 'RAQUEL MENDOZA MONTES', '000', 'F', '38', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan antro gastrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE', '', ''),
	(1289, 'Q2109-2790', 'Q', '45754712', 'CARMEN TERESA VERGARA SALDARIAGA', '3015368362', 'F', '47', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(1290, 'Q2109-2791', 'Q', 'VEN23882086', 'GABRIELA JOSE DEL ROSARIO COLMENAREZ CHIRINOS', '3022294255', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Mioma" se recibe una masa de tejido de forma ovoide de color blanquecino y consistencia elástica que mide 6 x 3 x 2 cms. Al corte de color blanquecino y aspecto arremolinado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Miomectomía:\r\n-LEIOMIOMA', '', ''),
	(1291, 'Q2109-2792', 'Q', '1047411337', 'ALICIA ESTHER MAGALLANES CASTRO', '3113267510', 'F', '32', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.5 cms. tapizada por una serosa opaca bien vascularizada. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendice cecal:\r\n-HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(1292, 'Q2109-2793', 'Q', '1048580848', 'MIGUEL ANGEL UTRIA ORTIZ', '3016388414', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-09-20', '2021-09-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de piel muñeca izquierda" un punch de piel que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Biopsia rodilla izquierda" un punch de piel que mide 0.5 cms. Se toma todo y se rotulan C.\r\n3. "Piel de hipocondrio izquierdo" un punch de piel que mide 0.5 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes A y B revelan piel tapizada por epitelio escamoso con hiperplasia psoriasiforme, áreas de paraqueratosis con formación de costras, se observa, además, marcada espongiosis con formación de vesículas intraepidermicas y la presencia de células inflamatorias aguda principalmente, hay formación de pustulas subcorneas. El dermis papilar es edematoso y esta infiltrado por abundantes neutrófilos.\r\nLos cortes C revelan piel tapizada por epitelio escamoso con focos de espongiosis, el dermis papilar muestra edema y infiltración de neutrófilos y exocitosis de estos al epitelio escamoso.\r\n\r\n\r\n\r\n', '1.Biopsias de piel de rodilla y muñeca izquierda:\r\n-DERMATITIS NUMULAR CON INFLAMACIÓN AGUDA SEVERA Y FORMACIÓN DE COSTRA\r\n2.Biopsia de piel hipocondrio derecho:\r\n-DERMATITIS SUBAGUDA\r\n\r\n', '', ''),
	(1293, 'Q2109-2794', 'Q', '1143411546', 'ANGEL DE JESUS SALAS RAMOS', '3008000142', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS EDUARDO ROMAN HERAZO', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apendice preauricular izquierda" se reciben dos formaciones nodulares cubiertas por piel que miden 0.8 y 0.5 cms. de consistencia elástica. Al corte una superficie lisa, blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso maduro debajo de esta se observan numerosos foliculos pilosos, rodeados de tejido adiposo.\r\n\r\n\r\n\r\n\r\n', '-TRAGO ACCESORIO, región preauricular izquierda', '', ''),
	(1294, 'Q2109-2795', 'Q', '1201245777', 'SANTIAGO DE JESUS RIVERA ARENAS', '3104530547', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se recibe varias fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro mayor de 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA', '', ''),
	(1295, 'Q2109-2796', 'Q', '109584362', 'THAILER GALVAN GONZALEZ', '3163187050', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca de color pardo claro bien vascularizada. Al corte salida de un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA', '', ''),
	(1296, 'Q2109-2797', 'Q', '1145224675', 'MIRIAN SALOME PARDO GONZALEZ', '3006044640', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-20', '2021-09-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres diminutos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de epitelio escamoso maduro sin representación de la lámina propia.\r\nLos cortes B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1297, 'Q2109-2798', 'Q', '1142940362', 'HOSNAIDER DAVID REVOLLO CONTRERAS', '3004792639', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglio cervical derecho" se reciben dos formaciones nodulares que miden 1.5 x 1 y 1 x 1 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan ganglio linfático constituido por foliculos de diferentes formas y tamaños con polarización del manto.\r\n\r\n\r\n\r\n', ' Ganglio cervical derecho:\r\n-HIPERPLASIA FOLICULAR', '', ''),
	(1298, 'Q2109-2799', 'Q', '1201248102', 'KALECT TORRES HERNANDEZ', '3006604407', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-09-20', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de piel de parpado derecho" se recibe un punch de piel que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso debajo de esta se observa lesión granulomatosa constituida por acumulos de histiocitos espumosos con células gigantes tipo Langhans.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en parpado derecho:\r\n-CHALAZION', '', ''),
	(1299, 'Q2109-2800', 'Q', '1042596233', 'CAROL SUGEYS AURELA TOBIAS', '3219027843', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Muestra de mesenterio" se recibe un fragmento de tejido de forma irregular de color blanquecino que mide 1 x 0.5 cms., en uno de sus extremos muestra una formación nodular de 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido adiposo congestivo donde se encuentra un ganglio linfático que muestra una hiperplasia folicular reactiva.\r\n\r\n\r\n\r\n\r\n', '1.HIPERPLASIA FOLICULAR REACTIVA, ganglio mesenterico\r\n2.FRAGMENTO DE TEJIDO ADIPOSO MADURO CONGESTIVO', '', ''),
	(1300, 'Q2109-2801', 'Q', 'VEN839168409042007', 'YOLIVER DANIELA FUENTES AMARO', '3242898559', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-20', '2021-09-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes de A revelan epitelio escamoso hiperplasico con hiperplasia de la basal, vasos intraepiteliales y algunos neutrófilos.\r\nLos cortes B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de foliculos linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes C revelan duodeno cuya lámina propia es congestiva, edematosa con un infiltrado mononuclear moderado.\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.ESOFAGITIS PEPTICA\r\n2.GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n3.DUODENITIS CRÓNICA', '', ''),
	(1301, 'Q2109-2802', 'Q', '1043322368', 'JOSE MADRID JULIO MEZA', '3145915950', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS EDUARDO ROMAN HERAZO', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste epidermoide mejilla derecha" se recibe una formación nodular que mide 0.5 cms. de color pardo oscuro. Al corte formación quistica que contiene un material grumoso. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan tumor benigno constituido por dos tipos de células celulas basofilica y células sombreadas con focos de calcificación.\r\n\r\n\r\n\r\n\r\n', '-PILOMATRIXOMA, mejilla derecha\r\n\r\n', '', ''),
	(1302, 'Q2109-2803', 'Q', '1142933748', 'SERGIO ANDRES PEREZ JIMENEZ', '3004933814', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apendice" se ercibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa de color pardo oscuro, la luz es puntiforme. Se toman cortes .\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1303, 'Q2109-2804', 'Q', '1041976234', 'HELLEN KAROLAY AURELA JIMENEZ', '3242738512', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-20', '2021-09-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro sin representación de la lámina propia.\r\nLos cortes B revelan antro gastrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE \r\n-H.PYLORI PRESENTE', '', ''),
	(1304, 'Q2109-2805', 'Q', '1044626882', 'MARIA PATRICIA LUNA GELES', '3008825887', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(1305, 'Q2109-2806', 'Q', '1143336681', 'VIVIANA VALIENTE CASTILLO', '3147749552', 'F', '32', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor JOSE BORRE', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Trompa derecha e izquierda" en un mismo recipiente, se reciben dos segmentos de trompas de Falopio que miden 1 cm. de color pardo claro y consistencia elástica de aspecto tubular. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Segmentos de trompa uterina que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', '-TROMPAS UTERINAS. SEGMENTOS (2) \r\n\r\n\r\n\r\n', '', ''),
	(1306, 'Q2109-2807', 'Q', '1002442359', 'MATEO RAFAEL RAMIREZ MONTES', '000', 'M', '19', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor RODOLFO VALENCIA', NULL, '2021-09-15', '2021-09-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo grisáceo. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(1307, 'Q2109-2808', 'Q', '30766479', 'BIANEY DIAZ ESPITIA', '3105493560', 'F', '47', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-20', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan un tumor maligno compuesto por células epiteliales pleomórficas con nucleos hipercromáticos que se disponen formando escasas estructuras glanduliformes. hay focos de infiltración del estroma.\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-ADENOCARCINOMA BIEN DIFERENCIADO, INFILTRANTE\r\n\r\n\r\n', '', 'Caso visto en junta de patologos por los doctores José Caraballo, Olivia Marrugo y Virna Caraballo.\r\n\r\n'),
	(1308, 'Q2109-2809', 'Q', '65785768', 'YADDY PAOLA MONTOYA HERRAN', '3178933988', 'F', '42', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Lesión polipoide" se recibe una estructura de forma irregular, color pardo grisáceo y consistencia elástica que mide 1.7 x 0.8 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n', ' Resección de lesión en endocervix:\r\n-POLIPO ENDOCERVICAL\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1309, 'Q2109-2810', 'Q', '1042584140', 'DIDIER LUIS PRADA HERRERA', '3002566744', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.5 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1310, 'Q2109-2811', 'Q', '1097189061', 'KARIN GIULIANNA MORENO ULLOA', '3153722122', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.6 x 1 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta, se observa una solución de contabilidad de bordes irregulares a 1.5 cms. de la punta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(1311, 'Q2109-2812', 'Q', '1050038184', 'VANESSA JOSE TORRES ORTEGA', '3022736178', 'F', '28', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y routlados, se reciben:\r\n1. "Trompa derecha" un segmento tubular de tejido que mide 3.5 x 0.7 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte conserva el aspecto habitual. Se toman cortes y se rotulan A.\r\n2. "Trompa izquierda" un segmento tubular de tejido que mide 3 x 0.7 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte conserva el aspecto habitual. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B muestran  trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n-TROMPA UTERINA DERECHA. (SEGMENTO)	\r\n-TROMPA UTERINA IZQUIERDA. (SEGMENTO)\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1312, 'Q2109-2813', 'Q', '73070225', 'RAFAEL ARMANDO IRIARTE BAHOQUE', 'CENTRO', 'M', '67', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste sebaceo en espalda" se recibe un fragmento de tejido de forma irregular, de color pardo claro y consistencia elástica que mide 3.3 x 2 x 1.8 cms. La superficie externa esta parcialmente cubierta por una elipse de piel que mide 3.2 x 1.9 cms. Al corte se observa por debajo de la piel aspecto quistico que mide 1.4 cms. de diámetro conteniendo un material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n', ' Resección de lesión en espalda:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n\r\n\r\n', '', ''),
	(1313, 'Q2109-2814', 'Q', '1143414310', 'LILIANA RIVERA BABILONIA', '000', 'F', '22', 'SEGUROS BOLIVAR S.A', '', '898201', '30215', 'Doctor ORLANDO BUSTILLO JR.', NULL, '2021-09-20', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia cervixl" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.2 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica, focos de metaplasia escamosa y de una lesión intraepitelial escamosa de alto grado (NIC 2).\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA Y LIE DE ALTO GRADO (NIC 2)', '', ''),
	(1314, 'Q2109-2815', 'Q', '22757285', 'NATIVIDAD MANGONES DE GARCIA', '3002769483', 'F', '84', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n\r\n', '', ''),
	(1315, 'Q2109-2816', 'Q', '33141967', 'ELSI MENDOZA LARA', '3003377419', 'F', '69', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(1316, 'Q2109-2817', 'Q', '23227786', 'ALCIRA ESTER QUINTANA BARRIO', '3135349927', 'F', '81', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(1317, 'Q2109-2818', 'Q', '9088580', 'GILBERTO JIMENEZ SOSSA', '3157696765', 'M', '67', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n\r\n\r\n', '', ''),
	(1318, 'Q2109-2819', 'Q', '4025010', 'FELIPE SANTIAGO MOSCATE VELASQUEZ', '3022288918', 'M', '81', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 8.5 X 3.2 cms. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado. No se observan calculos. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1319, 'Q2109-2820', 'Q', '169026824', 'HIJA DE YEISNERI MARIA CAMARILLO VASQUEZ', '3146514893', 'F', '0', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDGAR FRANCISCO FRANCO', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4.2 x 0.5 cms., la superficie externa está cubierta por una serosa lisa y brillante. Al corte conserva la morfología habitual. Se toman cortes.\r\n\r\n\r\n', 'los cortes muestran apendice cecal que conserva la morfología habitual.\r\n\r\n\r\n', '-APÉNDICE CECAL\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1320, 'Q2109-2821', 'Q', '1002377437', 'DUVAN ZARCOS VASQUEZ', '000', 'M', '30', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe previamente abierta una vesícula que mide 8.8 x 3 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de un gran cálculo color pardo amarillento que mide 2.8 x 2  cms. Se toman cortes.\r\n\r\n\r\n', 'los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1321, 'Q2109-2822', 'Q', '33067743', 'IRLENA ESTHER BOHORQUEZ ACOSTA', '000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 7.9 X 3.2 cms. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de numerosos cálculos fascetados color pardo amarillento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1322, 'Q2109-2823', 'Q', '30758907', 'ROSA ADELA CASTRO DE ESCRUCERIA', '3135169320', 'F', '67', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 8 x 2.5 cms. La superficie externa está parcialmente cubierta por una serosa despulida, la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado, hay salida de pequeños cálculos redondeados color negruzco. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n', '', ''),
	(1323, 'Q2109-2824', 'Q', '32701968', 'DELCY DEL CARMEN BALSEIRO GARCIA', '000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 8.3 x 3.2 cms. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de numerosos cálculos color pardo amarillento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1324, 'Q2109-2825', 'Q', '9080687', 'FERNANDO ANTONIO BARRIOS BANQUEZ', '000', 'M', '71', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Lipoma en región costal derecha" se recibe una masa de tejido de forma irregular de color pardo amarillento y consistencia elástica que mide 5.5  x 3.2 x 1.5 cms. La superficie externa esta cubierta por una fina capsula. Al corte se observa una superficie untuosa de color amarillento. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n', ' Resección de masa en región costal derecha:\r\n-LIPOMA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1325, 'Q2109-2826', 'Q', '1002319066', 'JHON ARLEY FLOREZ SOLARTE', '3117538631', 'M', '19', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Dcotor OSCAR FRAGOSO MAESTRE', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz dilatada. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n', '-APÉNDICE CECAL\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1326, 'L2109-107', 'L', '1102881834', 'OSNEIDI ELIZABETH FLOREZ ALVAREZ', '3143870571', 'F', '38', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "L. C. R" se reciben 6 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'El extendido es Acelular.\r\n\r\n\r\n', ' Citología de líquido cefaloraquideo:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1327, 'L2109-108', 'L', '1080651281', 'ISABELLA PABA ACUÑA', '000', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-09-17', '2021-09-16', 'VIRNA CARABALLO OSORIO', 'Rotulado "L. C. R" se reciben 6.2 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n', 'El extendido es Acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefaloraquídeo:\r\n-EXTENDIDO ACELULAR.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1328, 'Q2109-2827', 'Q', '45431384', 'AUDITH MARIA LONDOÑO GARCIA', '3015482230', 'F', '64', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y plasmocitos en escasa cantidad de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1329, 'Q2109-2828', 'Q', '98542433', 'JAIME ALBERTO CARMONA ARREDONDO', '3216572446', 'M', '51', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1330, 'Q2109-2829', 'Q', '42492832', 'FANNY CECILIA TONCEL GONZALEZ', '3006725673', 'F', '66', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1331, 'Q2109-2830', 'Q', '45448462', 'NASLY ESTHER ALVAREZ PUELLO', '3187727877', 'F', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides, focos de metaplasia intestinal incompleta. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA Y FOCOS DE METAPLASIA INTESTINAL INCOMPLETA', '', ''),
	(1332, 'Q2109-2831', 'Q', '73096835', 'JAIME MIGUEL BALLESTAS CASTAÑO', '3145796768', 'M', '62', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(1333, 'Q2109-2832', 'Q', '1043991250', 'MAURICIO CONTRERAS DE AVILA', '3112910012', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 cms. la serosa es opaca, despulida y cubierta por un material fibrinopurulenta. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1334, 'Q2109-2833', 'Q', '1142940811', 'THIAGO ANGULO PAEZ', '3116930488', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Prepucio" se recibe un fragmento de piel de color oscuro de forma circular que mide 2 x 1.5 cms. Acompañado de un fragmento de tejido alargado que mide 0.3 x 0.1 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel de prepucio que descansa en un estroma con áreas de edema, fibrosis e inflamación crónica.\r\n\r\n\r\n\r\n\r\n', '-PIEL DE PREPUCIO CON FIBROSIS E INFLAMACIÓN CRÓNICA\r\n\r\n', '', ''),
	(1335, 'Q2109-2834', 'Q', '1051891880', 'HANNA SOFIA MENDOZA BENITEZ', '3205298671', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa esofagica sin cambios.\r\nLos cortes rotualdos B muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya lámina propia es ligeramente edematosa e infiltrada por linfocitos, plasmocitos y escasos neutrófilos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-MUCOSA ESOFAGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA \r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL CON INFLAMACIÓN AGUDA Y CRÓNICA LEVE', '', ''),
	(1336, 'Q2109-2835', 'Q', '1043306889', 'SAMUEL ELIAS ANGULO CONTRERAS', '3017934901', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-09-27', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Resección de tejido mamario izquierdo" en un mismo recipiente, se reciben fragmentos de tejido de ovoide de color blanco amarillento y consistencia elástica el mayor mide 2 cms. y el menor de 1.5 cms. Al corte una superficie blanquecina que alternan con áreas amarillentas. Se toman cortes y se rotulan así: A fragmento mayor y B fragmento menor.\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo que contienen canalículos mamarios.\r\n\r\n\r\n\r\n', '-GINECOMASTIA IZQUIERDA', '', ''),
	(1337, 'Q2109-2836', 'Q', '45425347', 'MARY NUBIA OSPINO', '00', 'F', '66', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JOSE ACEVEDO', NULL, '2021-09-24', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Utero" se recibe un utero sin anexo que pesa 36 gms. y mide 7 x 3 x 2.5 cms. Al corte el cuello alargado tapizado por una mucosa blanquecina con orificio transversal. El cuerpo tapizado por una serosa de color pardo claro. Al corte el canal endocervical y la cavidad endometrial es plano y blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cervix tapizado por epitelio escamoso con hiperqueratosis e inflamación crónica. El endometrio muestra cambios por autólisis.\r\n\r\n\r\n\r\n', ' Utero (36 gms.):\r\n-CERVICITIS CRÓNICA CON HIPERQUERATOSIS\r\n-ENDOMETRIO AUTOLISADO', '', ''),
	(1338, 'Q2109-2837', 'Q', '23151757', 'TAIS PATRICIA IGLESIAS MIER', '0000', 'F', '39', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', '', NULL, '2021-11-10', '2021-09-20', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero total" se recibe un útero que pesa 154 gms. y mide 9 x 7.5 x 4 cms. El cuello tapizado por una mucosa blanquecina con orificio transversal. El cuerpo cubierto por una serosa de color pardo claro. Al corte el endometrio es plano de color oscuro, el espesor del endometrio es de 1.5 cms. sin lesiones evidentes. Se toman cortes.\r\n\r\n\r\n\r\n', 'En uno de los cortes de cérvix se observa  una lesión intraepitelial escamosa de alto grado y un foco de un carcinoma invasor superficial con una profundidad menor de 5 milímetros, no se identifica invasión linfovascular ni perineural. El endometrio muestra proliferación de glándulas con atípias citológicas que descansan en un estroma fibroso.\r\n\r\n\r\n\r\n', ' Utero (154 gms.) con:\r\n-CARCINOMA ESCAMOCELULAR MICROINVASIVO SUPERFICIAL (menor de 5 milímetros), cérvix\r\n-ENDOMETRIO CON HIPERPLASIA SIMPLE ATIPICA\r\n\r\n\r\n', '', 'El caso fue visto con los doctores Oliva Marrugo y José Caraballo.'),
	(1339, 'Q2109-2838', 'Q', '45537665', 'CANDELARIA LAGARES MARTINEZ', '3216495021', 'F', '68', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero" se recibe el producto de una histerectomía con salpingooforectomía bilateral que pesa 52 gms. y mide 7 x 5 x 2 cms. en sus mayores dimensiones. El cervix esta tapizado por una mucosa de color pardo claro con zonas de color pardo oscuro alrededor del orificio externo. El cuerpo conserva su forma habitual y los anexos son externamente normales. Al corte el canel endocervical es permeable, se lámina en su totalidad discriminando labios anterior y posterior. Se toman cortes así: A línea de resección vaginal, B labio anterior, C labio posterior.\r\nLa cavidad endometrial esta tapizada por una mucosa muy delgada, el miometrio es homogeneo, los ovarios son sólidos. Las trompas son externamente normales. Se toman cortes y se rotulan E.\r\n\r\n\r\n', 'Los cortes rotulados A muestran línea de resección vaginal que contiene una LIE de alto grado         (NIC 3).\r\nLos cortes rotulados B y C muestran cuello uterino con una LIE de alto grado (NIC 3). En uno de los cortes C (labio posterior) hay un foco de infiltración neoplásica del estroma que genera una reacción inflamatoria mediada por linfocitos. El endometrio es atrófico y los ovarios son normales para la edad.\r\n\r\n\r\n', ' Utero y anexos (52 gms.):\r\n-LIE DE ALTO GRADO (NIC 3) QUE COMPROMETE EL MARGEN DE RESECCIÓN VAGINAL\r\n-CARCINOMA ESCAMOCELULAR MODERADAMENTE DIFERENCIADO, INFILTRANTE (labio posterior)\r\n-ENDOMETRIO ATRÓFICO\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1340, 'Q2109-2839', 'Q', 'VEN26522035', 'YINEILIS MARIEL OSPINO BELEÑO', '3103533683', 'F', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quíste de ovario izquierdo" se recibe un minusculo fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen esta constituido por estroma ovarico y un fragmento de una pared fibrosa sin revestimiento epitelial.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en ovario izquierdo:\r\n-COMPATIBLE CON QUISTE SIMPLE\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1341, 'Q2109-2840', 'Q', '33338116', 'FANNY ESTHER PEREZ PARRA', '0000', 'F', '74', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero" se recibe un utero que pesa 31 gms. y mide 7 x 2.5 x 2 cms. en sus mayores dimensiones. El cervix esta tapizado por una mucosa gruesa, irregular de color blanquecino. Al corte el canal endocervical es permable, la cavidad endometrial esta tapizada por una mucosa muy delgada de color grisáceo y el miometrio es homogeneo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'El cervix está tapizado por epitelio escamoso engrosado, con queratinización superficial, que reposa en un estroma con moderada infiltración por linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Utero (31 gms.):\r\n-CERVICITIS CRÓNICA CON QUERATINIZACIÓN SUPERFICIAL DEL EPITELIO\r\n-ENDOMETRIO ATRÓFICO', '', ''),
	(1342, 'Q2109-2841', 'Q', '45482458', 'LUZ STELLA RODRIGUEZ BERRIO', '320598691', 'F', '54', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de vulva" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.4 cms. Se toma todo y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Lesión polipoide endocervical" contiene un fragmento de tejido de aspecto polipoide de color pardo claro y consistencia blada que mide 1.8 cms. en su mayor dimensión. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran una estructura compuesta por epitelio escamoso que rodea un nucleo de tejido fibroso.\r\nLos cortes rotulados B muestran estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n\r\n', '1.Resección de lesión en vulva:\r\n-PÓLIPO FIBROEPITELIAL\r\n2.PÓLIPO ENDOCERVICAL', '', ''),
	(1343, 'Q2109-2842', 'Q', '1201277188', 'DARLYS SOFIA ACEVEDO OSORIO', '3128849144', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amigdala izquierda" una amigdala palatina que mide 2 x 1.5 x 1 cms. La superficie externa es irregular y al corte se encuentra una superficie homogenea de color pardo amarillento. Se toman cortes y se rotulan A.\r\n2. "Amigdala derecha" una amigdala palatina que mide 2 x 1.5 x 1 cms. La superficie externa es irregular y al corte se encuentra una superficie homogenea de color pardo amarillento. Se toman cortes y se rotulan B.\r\n3. "Adenoides" varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 3 ml. Se toma aprte y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA', '', ''),
	(1344, 'Q2109-2843', 'Q', 'VEN33692734', 'ANNAIKEL JOSE NARVAEZ QUERO', '3205486232', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1.2 cms. en sus mayores dimensiones, la superficie externa es irregular, de color pardo oscuro con membranas de aspecto purulento y al corte se encuentra una luz irregular, dilatada. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1345, 'Q2109-2844', 'Q', '1201256033', 'SHAORI LEE TORRES MEZA', '3016843750', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 2 x 1.8 x 1 cms. Al corte se encuentra una superficie irregular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(1346, 'Q2109-2845', 'Q', '1129533811', 'WILENYS MARGARITA MOLINA GONZALEZ', '3215068800', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que promedian un diámetro mayor de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antro-corporal que conserva su morfología habitual. No hay cambios inflamatorios, atróficos ni displasicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA GASTRICA ANTRO-CORPORAL', '', ''),
	(1347, 'Q2109-2846', 'Q', '1094396597', 'ALAN DAVID CRISTANCHO BARAJAS', '3127726441', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotualn B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya lámina propia esta densamente infiltrada por linfocitos y células plasmáticas con formación de folículos. No se encuentran parásitos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1348, 'Q2109-2847', 'Q', '1143362739', 'DUVIS POLO MORALES', '3046227685', 'F', '28', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor MAURICIO ORTIZ', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Restos ovulares" se reciben varios fragmento de tejido de forma irregular de color pardo grisáceo y consistencia friable que en conjunto hacen un volumen de 5 ml. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'El espécimen está constituido por tejido decidual. No se identifican elementos trofoblásticos.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE TEJIDO DECIDUAL\r\n\r\n', '', ''),
	(1349, 'Q2109-2848', 'Q', '22784319', 'LUCY GARCES DE BURGOS', '3157797127', 'F', '79', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de conjuntiva cuyo epitelio conserva su morfología habitual. El estroma subepitelial está edematoso con densa infiltración inflamatoria mediada por linfocitos y macrófagos. No se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en conjuntiva de ojo izquierdo:\r\n-CONJUNTIVITIS CRÓNICA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1350, 'Q2109-2849', 'Q', '9056576', 'MANUEL SARMIENTO CUETO', '3215736744', 'M', '79', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran conjuntiva cuyo epitelio reposa en un estroma edematoso, moderadamnete vascularizado, con elastosis subepitelial y presencia de un material amorfo basofílico.\r\nNo se identifican cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en conjuntiva bulbar*:\r\n-CAMBIOS COMPATIBLES CON PTERIGION\r\n\r\n\r\n\r\n', '', '*Lado no especificado.\r\n'),
	(1351, 'Q2109-2850', 'Q', '33132917', 'FRANCIA ELENA CRISMATT MADRID', '3017300228', 'F', '71', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA', NULL, '2021-09-22', '2021-09-20', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 1.5 x 1.3 x 0.8 cms. La parte central presenta una lesión irregular de color grisáceo. Se toman cortes así: A línea de resección, B laminación del resto del tejido.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con un tumor epitelial ulcerado, compuesto por células pequeñas, basaloides, que infiltran el dermis formando estructuras trabeculares y nidos sólidos.\r\nEl tumor compromete uno de los márgenes de resección periférico.\r\n\r\n\r\n\r\n', ' Resección de lesión en párpado de ojo izquierdo:\r\n-CARCINOMA BASOCELULAR ULCERADO\r\n-COMPROMISO DEL MARGEN DE RESECCIÓN PERIFERICO', '', ''),
	(1352, 'Q2109-2851', 'Q', '9151376', 'RAMON CUETO ISAZA', '3126907114', 'M', '67', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1353, 'Q2109-2852', 'Q', '22807751', 'INES DEL CARMEN CONSUEGRA MIER', '3177930902', 'F', '41', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmento de cérvix con inflamación crónica y LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cervix:\r\n-LIE DE BAJO GRADO (CONDILOMA)\r\n\r\n', '', ''),
	(1354, 'Q2109-2853', 'Q', '5586968', 'RAMON MORALES CADENAS', '3215183928', 'M', '80', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo con formación de agregados linfoides, actividad severa, H.pylori presente, atrofia leve, metaplasia intestinal incompleta. No se observa displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD SEVERA, ATRÓFIA LEVE Y METAPLASIA INTESTINAL INCOMPLETA\r\n-H.PYLORI PRESENTE', '', ''),
	(1355, 'Q2109-2854', 'Q', '9062610', 'LUIS EDUARDO LINARES FRANCO', '3164114842', 'M', '77', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica sin cambios.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA OXÍNTICA SIN CAMBIOS', '', ''),
	(1356, 'Q2109-2855', 'Q', '33338326', 'LILIA ESTHER BARRIOS AMADOR', '000', 'F', '57', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un punch de piel de color pardo claro que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel con hiperqueratosis, acantosis irregular, atipias coilociticas, el estroma con un infiltrado mononuclear.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva.\r\n-CONDILOMA\r\n\r\n', '', ''),
	(1357, 'Q2109-2856', 'Q', '91222738', 'CARLOS ARTURO OSORIO CASTAÑEDA', '3135320699', 'M', '58', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear leve, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(1358, 'Q2109-2857', 'Q', '1128050760', 'GUILLERMO RAFAEL FRIAS VERGARA', '3043886723', 'M', '34', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo con formación de agregados linfoides, actividad severa, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD SEVERA\r\n-H.PYLORI PRESENTE', '', ''),
	(1359, 'Q2109-2858', 'Q', '1019907299', 'ANTONIA PELAEZ PEREZ', 'CENTRO', 'F', '8', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '', '', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se erciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes A muestran antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B revelan cuerpo gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori en escasa cantidad. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes C y D muestran duodeno cuya lámina propia es congestiva e infiltrado mononuclear moderado. No se observa atrofia ni granulomas.\r\n\r\n', ' Biopsia endoscópica de estomago:\r\n1.GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE Y H.PYLORI PRESENTE, antro \r\n2.GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA, cuerpo\r\n3.Biopsia endoscópica de bulbo:\r\n-DUODENITIS CRÓNICA\r\n4.Biopsia endoscópica de segunda porción:\r\n-DUODENITIS CRÓNICA', '', ''),
	(1360, 'Q2109-2859', 'Q', '1043963263', 'DAYANA VANESA OTERO JULIO', '3125248582', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 1.5 x 1.5 cms. tapizada parcialmente pro una serosa de color pardo grisáceo. Al corte múltiples cálculos de color negruzco, la pared se encuentra engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS', '', ''),
	(1361, 'Q2109-2860', 'Q', '1142939361', 'ALLAN KEIMIS LAMBIS CASTRO', '3007020505', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia. \r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(1362, 'Q2109-2861', 'Q', '1049826542', 'VANESSA SIERRA MACHACON', '3218042489', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-10-15', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de piel de pierna derecha" se recibe una elipse de piel que mide 0.6 cms.  de color pardo grisáceo. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel representada hasta la dermis reticular. La epidermis presenta estrato córneo en cesta y aparente disminución de la pigmentación en estrato basal. No se reconoce ascenso de linfocitos ni daño de interfase vacuolar. La dermis muestra discreto infiltrado linfocítico perivascular superficial, con anexos cutáneos de morfología usual. No se reconocen microorganismos con las coloraciones de rutina.\r\n\r\n\r\nCOMENTARIO: Los hallazgos histológicos descritos son poco específicos, pero pudiesen corresponder a un nevus acrómico en un contexto clínico adecuado. Se recomiendan estudios de histoquímica (PAS, Elástico) e inmunohistoquímica (SOX10, CD3) para descartar diagnósticos diferenciales.\r\n\r\n', ' Piel miembro inferior derecho-biopsia punch:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n\r\n\r\nCaso visto en conjunto con participación de los doctores Reinhard Rodríguez, José Caraballo y Ana Manga.', '', ''),
	(1363, 'Q2109-2862', 'Q', '1041996404', 'CHARLYS DANIEL NIÑO LEDESMA', '3104604611', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-09-27', '2021-09-23', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Pólipo rectal" formación nodular que mide 1 x 0.6 cms. de color pardo grisáceo y consistencia elástica. Al corte una superficie que presenta formaciones quísticas que contienen moco. Se toman cortes y se rotulan D.', 'Los cortes A revelan fragmentos de epitelio escamoso maduro sin lámina propia.\r\nLos cortes B revelan antro que muestra la morfología habitual.\r\nLos cortes C revelan mucosa duodenal sin cambios.\r\nLos cortes D revelan lesión polipoide constituidas por glándulas dilatadas que descansan en un estroma edematoso e infiltrado por linfocitos, células plasmáticas, neutrófilos el epitelio superficial ulcerado.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-ANTRO GASTRICO SIN CAMBIOS\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENO SIN CAMBIOS\r\n4.POLIPO JUVENIL DE RETENCIÓN, recto', '', ''),
	(1364, 'Q2109-2863', 'Q', '1043658951', 'LUIS SEBASTIAN HERNANDEZ BLANCO', '3156864116', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-10-05', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Nevo melanocítico" se recibe una elipse de piel que mide 0.7 cms. presenta una lesión pigmentada de 0.5 cms. Acompañado a esto, un diminuto fragmento de piel que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso con hiperqueratosis e hiperplasia pseudoepiteliomatosa, el dermis muestra un infiltrado inflamatorio severo mediado principalmente por linfocitos y neutrófilos, hay áreas de calcificación.\r\nEn la muestra no se observan microorganismos.\r\n\r\n\r\n\r\n', '  Biopsia de piel de nariz con:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA SEVERA CON HIPERPLASIA PSEUDOEPITELIOMATOSA', '', ''),
	(1365, 'Q2109-2864', 'Q', '1137219294', 'CARLOS MANUEL PEREZ SALAS', '3145400501', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-09-30', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de ulcera en pie" se reciben dos fragmentos de tejido de forma irregulares de color blanquecino que miden 0.8 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo con un proceso inflamatorio crónico de predominio linfocitico. No se observó revestimiento epitelial en la muestra que nos permita hacer un diagnóstico de ulcera.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión en pie izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1366, 'Q2109-2865', 'Q', '79588232', 'LUIS ENRIQUE BARCASNEGRAS VILORIA', '3000', 'M', '67', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor JOSE RODRIGUEZ', NULL, '2021-10-05', '2021-09-23', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Pleura parietal" dos fragmentos de tejido de forma irregular de color pardo grisáceo y consistencia elástica que promedian un diámetro mayor de 2 cms. Se toma todo y se rotulan A.\r\n2. "Segmento pulmonar" un segmento pulmonar que mide 3 x 1.5 x 1 de color pardo oscuro y consistencia elástica. Al corte se observa una formación nodular de color blanquecino que mide 0.5 x 0.5 cms. Se toman cortes y se rotulan B.\r\n', 'Los cortes rotulados A muestran fragmentos de pleura marcadamente engrosada a expensas de una proliferación de tejido fibroso, en algunos campos se encuentra coágulos de fibrina en la superficie. No se encuentran cambios neoplásicos.\r\nLos cortes B revelan parenquima pulmonar en el que se destaca un proceso inflamatorio agudo y crónico con focos de condensación que contienen linfocitos PMN neutrófilos, macrófagos y linfocitos.\r\nEn algunos cortes en relación con la pleura viceral se encuentra una proliferación de estructura papiliforme tapizada por células de aspecto mesotelial que sugiere una infiltración superficial del parenquima.\r\n\r\nCOMENTARIO: Los hallazgos descrito sugieren proceso inflamatorio crónico de tipo neumonico  cambios difíciles de definir entre una hiperplasia mesotelial y un mesotelioma. \r\nEs necesario practicar estudios de inmunohistoquímica para definición diagnóstica precisa.\r\n', ' Biopsia de pleura parietal y segmento pulmonar derechos:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n', '', 'Este caso fue estudiado en junta con la participación de José Caraballo y Ana Magola Manga.\r\n\r\n'),
	(1367, 'Q2109-2866', 'Q', '45366107', 'MARIA ISABEL ARCIA HERRERA', '000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-10-11', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Resección de masa en región clavicular izquierda" se reciben dos fragmentos de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 1 cms. de diámetro mayor . Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel tapizada por epitelio escamoso que muestra hiperplasia pseudoepiteliomatosa que descansan en un estroma vascularizado e infiltrado por linfocitos, plasmocitos y neutrófilos con la presencia de granulomas y células gigantes a cuerpo extraño. En la muestra no se identifica microorganismos.\r\n\r\n\r\n', ' Extirpación de lesión en región clavicular izquierda:\r\n-REACCIÓN INFLAMATORIA CRÓNICA GRANULOMATOSA CON HIPERPLASIA PSEUDOEPITELIOMATOSA\r\n\r\n\r\n\r\n', '', 'Se sugiere ampliar estudio para una mejor definición diagnóstica.\r\n\r\n\r\n'),
	(1368, 'Q2109-2867', 'Q', '45579364', 'LIDIS MARGOTH VASQUEZ DIAZ', '0000', 'F', '47', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-10-04', '2021-09-23', 'OLIVA MARRUGO GRICE', 'Rotulado "Utero + trompa derecha e izquierda y cuello" se recibe un cuerpo uterino con anexos que pesa 560 gms. El cuerpo mide 12 x 12 x 10 cms. esta deformado por múltiples masas. Al corte la cavidad endometrial esta rechazada por una masa que mide 10 x 10 x 5 cms. En el miometrio se encuentran dos masas, ovoides blanquecinas de aspecto arremolinado que miden 4 x 2 y 3 x 2 x 1 cms. a nivel subseroso se visualizan una masa ovoide de color blanquecino que mide 1 x 1 cms. El ovario izquierdo mide 4 x 2 cms. y el segmento de trompa mide 4 cms. El ovario muestra su morfología habitual al igual que la trompa, el ovario derecho mide 4 x 3 cms. de color blanquecino, de consistencia elástica su superficie , lisa amarillenta. La trompa mide 5 cms. y al corte una superficie multinodular de color amarillento. Se toman cortes.\r\nNo se recibe cuello.\r\n\r\n\r\n', 'Los cortes revelan endometrio autólisado, las masas descritas en el miometrio corresponden a leiomiomas. Los ovarios y las trompas no muestran cambios.\r\n\r\n\r\n\r\n', ' Histerectomía subtotal (560 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS\r\n-OVARIOS \r\n-TROMPAS DE FALOPIO', '', ''),
	(1369, 'Q2109-2868', 'Q', '45495385', 'ELISABETH VILLALOBOS BARRAGAN', '000', 'F', '54', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor JOSE ACEVEDO', NULL, '2021-09-29', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Utero, cuello, trompa derecha e izquierda" se recibe un útero con sus anexos que pesa 120 gms. y mide 8 x 6 x 4.5 cms. en sus mayores dimensiones. El cérvix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta aumentado de tamaño y deformado, las trompas y los ovarios son externamente normales. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa irregular de color pardo claro, en el miometrio se encuentran múltiples nódulos de color blanquecino y aspecto fasciculado cuyos diámetro oscilan entre pocos milímetros y 2.5 cms. Las trompas son externamente normales y los ovarios presentan pequeñas cavidad que contienen un material gelatinoso. Se toman cortes.\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio es inactivo. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente. Las trompas y los ovarios conservan la morfología usual.\r\n\r\n\r\n', ' Útero con sus anexos:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO INACTIVO\r\n-LEIOMIOMAS INTRAMURALES\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS\r\n', '', ''),
	(1370, 'Q2109-2869', 'Q', '1048459518', 'JAIME ANDRES CORDERO PATERNINA', '3014550715', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben un fragmento de tejido de forma irregular, de color pardo claro y consistencia blanda que mide 1.8 x 1.5 x 1.5 cms. La superficie externa es irregular y al corte se encuentra una superficie de color blanquecino, homogéneo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(1371, 'Q2109-2870', 'Q', '1238346152', 'ALAN JOSE FAJARDO ROMERO', '3024242116', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor en cuero cabelludo" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.8 cms. en sus mayores dimensiones. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina de tipo triquilemal.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en cuero cabelludo:\r\n-QUERATOSIS DE TIPO PILAR (TRIQUILEMAL)\r\n\r\n', '', ''),
	(1372, 'Q2109-2871', 'Q', '1044011204', 'ANDRES CALEB CERPA ORTEGA', '3006244034', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica cuyos diámetros oscilan entre 1 y 2.5 cms. La superficie externa es irregular y al corte presenta una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes rotulados muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(1373, 'Q2109-2872', 'Q', '1043311271', 'MATIAS OLDENBURG TRESPALACIO', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2.8 x 2 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular con criptas prominentes y al corte se encuentra una superficie homogénea de color blanco amarillento. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2.8 x 2 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular con criptas prominentes y al corte se encuentra una superficie homogénea de color blanco amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1374, 'Q2109-2873', 'Q', '44152929', 'SANDRA PATRICIA SERPA VERGARA', '3233630276', 'F', '39', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1375, 'Q2109-2874', 'Q', '45433646', 'ELIZABETH DEL SOCORRO SANCHEZ DE VENEGAS', '3126697221', 'F', '65', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antrocorporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1376, 'Q2109-2875', 'Q', '1047466894', 'RUSBEL DE LA ROSA GARCIA', '3045286891', 'M', '27', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO CABARCAS', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1377, 'Q2109-2876', 'Q', '56077256', 'OLGA GUERRA MEDINA', '3128873702', 'F', '41', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. No se encuentran cambios atróficos, inflamatorio, displásicos ni presencia de H.pylori.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA ANTRAL\r\n\r\n\r\n', '', ''),
	(1378, 'Q2109-2877', 'Q', '3229448', 'FRANCISCO JAVIER PRIETO AGUILERA', '3165593071', 'M', '67', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-09-27', '2021-09-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1379, 'L2109-109', 'L', '1052097392', 'KATRIN ELIZABETH ARIAS ORTEGA', '000', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-09-27', '2021-09-27', 'JOSÉ CARABALLO GRACIA', 'Rotulado "L.C.R" se reciben 5 ml. de un líquido transparente, se centrifuga y hace hace extendido del sedimento.\r\n\r\n\r\n\r\n', '', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(1380, 'L2109-110', 'L', '1042583626', 'DANNA MAJUL ZAMORA', '3012296105', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-09-27', '2021-09-27', 'JOSÉ CARABALLO GRACIA', 'Rotulado "L.C.R" se reciben 3.6 ml. de un líquido transparente, se centrifuga y hace hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', '', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n', '', ''),
	(1381, 'Q2109-2878', 'Q', '7249542', 'HOOVER AVELLANEDA RODRIGUEZ', '3124347800', 'M', '57', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-01', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa gástrica antro corporal cuya lámina propia esta infiltrada por linfocitos, plasmocitos en poca cantidad. en la muestra no se observa H.pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1382, 'Q2109-2879', 'Q', '79374807', 'JORGE PINO RICCI', '00', 'M', '55', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-10-01', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1, 0.2 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos, plasmocitos en moderada cantidad de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1383, 'Q2109-2880', 'Q', '32938407', 'ELIZABETH MARTINEZ DE AVILA', '3205010342', 'F', '36', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-01', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1384, 'Q2109-2881', 'Q', '45765357', 'VIVIANA REYES VELASQUEZ', '3005343764', 'F', '45', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-01', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1385, 'Q2109-2882', 'Q', '52078257', 'ADRIANA BEATRIZ MALDONADO HERNANDEZ', '3232205170', 'F', '49', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-01', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa  cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B revelan mucosa gástrica antral cuya lámina propia está infiltrada por linfocitos, plasmocitos y neutrófilos en moderada cantidad, se observa H.pylori en poca cantidad en la luz de algunas glándulas.\r\n\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1386, 'Q2109-2883', 'Q', '43253112', 'SANDRA DAVILA AGUILERO', '3162764208', 'F', '39', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-04', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNCIA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1387, 'Q2109-2884', 'Q', '45496463', 'MARIA DEL ROSARIO BLOOM MONSALVE', '3148853987', 'F', '51', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-10-04', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa gastrica antral cuya lámina propia esta infiltrada por linfocitos y plasmocitos en moderada cantidad, hay áreas de metaplasia intestinal incompleta y atrofia leve epitelial.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA CON FOCOS DE METAPLASIA INTESTINAL INCOMPLETA Y ATROFIA LEVE\r\n\r\n', '', ''),
	(1388, 'Q2109-2885', 'Q', '1043645642', 'YURAISIS FERNANDA VILLALBA BATISTA', '3145547985', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-04', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mama izquierda-fibroadenoma" se recibe una masa de tejido, ovoide de color pardo blanquecino y consistencia elástica que mide 1.2 x 0.9 cms. Al corte una superficie blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n\r\n', '-FIBROADENOMA, mama izquierda', '', ''),
	(1389, 'Q2109-2886', 'Q', '1050979300', 'LUZMERY CEDEÑO RAMOS', '3242971535', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-11', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Resección de quiste tirogloso y fistula tiroglosa" se recibe un fragmento de tejido de aspecto quístico, ovoide de consistencia renitente que mide 1.2 x 1 cms. que se continua con un fragmento de tejido oseo que mide 0.6 cms. Al corte lesión quística que contiene un material amarillento, grumoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Lesión quística tapizada por epitelio seudoestratificado conteniendo queratina en su interior.\r\n\r\n\r\n\r\n', '-QUÍSTE DEL CONDUCTO TIROGLOSO', '', ''),
	(1390, 'Q2109-2887', 'Q', '1048467109', 'SHANNY VICTORIA VARGAS MEZA', '3002587604', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-11', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Fistula branquial derecha" se recibe un fragmento de tejido fibroso de color blanquecino que mide 1.5 x 0.5 cms. Al corte se observa un área blanquecina, redondeada de 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Fragmentos de cartílago hialino rodeado de tejido fibroadiposo. No se encuentra conducto en los múltiples cortes ni cambios inflamatorios. \r\nLos hallazgos no permiten evaluar el diagnóstico de fistula aunque la presencia del cartílago es sugestivo de una lesión del arco branquial.\r\n\r\n\r\n', ' Resección de quiste branquial derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1391, 'Q2109-2888', 'Q', '1003242187', 'HAROLD MANUEL CUDRIS PAJARO', '3233774006', 'M', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-10-01', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 12 x 0.5 cms. la serosa es de color gris y renitente, vascularizada. Al corte la luz ocupada pro material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1392, 'Q2109-2889', 'Q', '11935096071', 'TANIA PAOLA CORREA ARRIETA', '3203922140', 'F', '17', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-01', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma ovoide de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Cérvix tapizado por epitelio escamoso hiperplásico con cambios coilociticos asociados.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-LIE DE BAJO GRADO (CONDILOMA)\r\n\r\n', '', ''),
	(1393, 'Q2109-2890', 'Q', '1047500689', 'MARIA TERESA CERRA HERRERA', '3126140568', 'F', '36', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-10-04', '2021-09-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero + trompa izquierda" se recibe un cuerpo uterino sin anexos que pesa 1130 gms. y mide 18 x 12 x 11 cms. aumentado globalmente de tamaño, cubierto por una serosa blanquecina y deformado por la presencia de tres formaciones nodulares de color blanquecino. Al corte la cavidad endometrial esta rechazada y ocupada parcialmente por masas blanquecinas, arremolinadas múltiples a nivel submucoso, intramural y subseroso, la mayor de 9 x 8 x 7 cms. y la menor de 0.1 cms. El endometrio es plano. Se toman cortes del endometrio y las masas descritas. Acompañado a esto, trompa izquierda, un segmento de trompa que mide 4 cms. y muestra la estructura usual.\r\nPor separado y rotulado, Trompa derecha" se recibe un segmento de trompa que mide 4 cms. y a nivel subseroso tiene formación de color amarillento de 0.4 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino con endometrio autólisado, las lesiones descritas a nivel miometrial corresponden a leiomiomas. Las trompas de Falopio no muestran cambios.\r\n\r\n\r\n\r\n', ' Útero (1.130 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS\r\n-TROMPAS DE FALOPIO', '', ''),
	(1394, 'Q2109-2891', 'Q', '33128275', 'JUDITH GONZALEZ BLANCO', '3114289710', 'F', '72', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-05', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis muestra acantosis irregular y un denso infiltrado inflamatorio mixto en el dermis papilar sobre un trasfondo fibroso.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vulva:\r\n-LIQUEN SIMPLE CRÓNICO\r\n', '', ''),
	(1395, 'Q2109-2892', 'Q', '1047459799', 'LIZ CANTILLO MARTINEZ', '3135409818', 'F', '28', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Exocervix" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Biopsia de vulva" dos diminutos fragmentos de piel de color pardo claro y consistencia elástica que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de cuello uterino con una reacción inflamatoria crónica, focos de metaplasia escamosa y cambios citopáticos por VPH.\r\nLos cortes rotulados B muestran fragmentos de piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos pro VPH.\r\n\r\n\r\n', '1.Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n2.Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(1396, 'Q2109-2893', 'Q', '45579361', 'LAUDIT DEL SOCORRO ARIAS NUÑEZ', '3228607956', 'F', '48', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se recibe un diminuto fragmento de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n\r\n', '', ''),
	(1397, 'Q2109-2894', 'Q', '1047452183', 'YIMARA ANDREA JACKSON PACHECO', '3042697497', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1398, 'Q2109-2895', 'Q', '45582558', 'ROSIRIS DEL SOCORRO PUENTES ALVIS', '3114263803', 'F', '44', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 0.6 cms. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n\r\n', '', ''),
	(1399, 'Q2109-2896', 'Q', '1176464320', 'DALWIN JULIAN HERRERA HERNANDEZ', '3136513616', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Papilomas laríngeos" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de estructuras compuestas por la proliferación de células escamosas que se disponen en un patrón papilomatoso con cambios coilociticos.\r\n\r\n\r\n\r\n', '-PAPILOMAS LARINGEOS\r\n\r\n', '', ''),
	(1400, 'Q2109-2897', 'Q', '1043644767', 'JUAN DAVID MARTINEZ PUELLO', '3022447504', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898241', '69000', 'Doctor JORGE LAMBIS RICARDO', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Testículo derecho" se recibe un testículo con sus elementos del cordón que mide 5.5 x 5.5 x 3.8 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte una superficie finamente granular de color violáceo que compromete todo el testículo y los elementos del cordón. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestra testículo con áreas extensas de necrosis y hemorrágia.\r\n\r\n\r\n\r\n\r\n', ' Orquiectomía derecha:\r\n-TESTICULO CON ÁREAS EXTENSAS DE NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n', '', ''),
	(1401, 'Q2109-2898', 'Q', '1048458331', 'JAMES ANDRES CANTILLO LOMBANA', '3008327595', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.5 x 0.8 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1402, 'Q2109-2899', 'Q', '10166092', 'RICHARD NUÑEZ', '3103678094', 'M', '79', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben cinco diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1403, 'Q2109-2900', 'Q', '32622798', 'EMILSE MUÑOZ MARQUEZ', '3002888089', 'F', '65', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1404, 'Q2109-2901', 'Q', '33118639', 'MARIELA REGINA ALVAREZ PEREZ', '3185022681', 'F', '75', 'GASTROPACK SAS', 'COOMEVA medicina prepagada S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1405, 'Q2109-2902', 'Q', '3791863', 'AUGUSTO BELTRAN PAREJA', '3114078879', 'M', '81', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Pólipo de colon" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de una estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de pólipo en ciego:\r\n-ADENOMA TUBULAR (FRAGMENTOS)\r\n\r\n', '', ''),
	(1406, 'Q2109-2903', 'Q', '73081135', 'JAIRO LLERENA TORRES', '0000', 'M', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Tumor benigno en piel" se recibe una masa de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 7 x 5 x 3.8 cms. La superficie externa esta cubierta por piel casi en su totalidad y se destaca un área ulcerada de bordes irregulares de 3.2  x2.5 cms. Al corte se observa una superficie amarillenta de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor mesenquimal benigno compuesto por lóbulos de tejido adiposo maduro. Hay un área de ulceración superficial con fibrosis y una reacción inflamatoria aguda y crónica.\r\n\r\n\r\n\r\n\r\n', ' Resección de  masa en glúteo derecho:\r\n-LIPOMA PEDICULADO\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1407, 'Q2109-2904', 'Q', '1002058865', 'ADELA CASTAÑO MARRUGO', '000', 'F', '35', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice" un apéndice cecal que mide 5.2 x 0.7 cms. La superficie externa esta cubierta por una serosa despulida con aumento de la trama vascular. Se toman cortes y se rotulan A.\r\n2. "Salpingectomía derecha" una trompa de Falopio que mide 4.7 x 1 cms. La superficie externa esta cubierta por una serosa despulida. Al corte la pared esta engrosada y se identifica una solución de continuidad de bordes irregulares que compromete todo el espesor de la pared. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran apéndice cecal con marcada congestión y presencia de un infiltrado inflamatorio agudo que compromete la subserosa.\r\nLos cortes rotulados B muestran trompa de Falopio con un infiltrado inflamatorio agudo mediado por PMN neutrófilos con áreas extensas de necrosis que comprometen todo el espesor de la pared.\r\n\r\n', '1.PERIAPENDICITIS AGUDA\r\n2.Salpingectomía derecha:\r\n-SALPINGITIS AGUDA', '', ''),
	(1408, 'Q2109-2905', 'Q', '45528675', 'LEIDYS DIANA RODRIGUEZ CARO', '3215494747', 'F', '40', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7 x 3.5 cms. La superficie externa esta parcialmente cubierta por una serosa despulida y al corte la pared esta engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes .\r\nNo se reciben calculos.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n', '', ''),
	(1409, 'Q2109-2906', 'Q', '32795530', 'LUISA INES GONZALEZ VIZCAINO', '3024246612', 'F', '46', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora IRINA SEQUEDA LUJAN', NULL, '2021-10-01', '2021-09-30', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero" se recibe el producto de una histerectomía subtotal con su trompa derecha que pesa 738 gms. y mide 9 x 14.5 x 12.7 cms. en sus mayores dimensiones. El cuerpo esta deformado pro la presencia de múltiples masas. Al corte la cavidad endometrial esta tapizada por una mucosa gruesa de color rosado y el miometrio esta ocupado por múltiples masas de color blanquecino y aspecto arremolinado de localización submucosa, intramural y subserosa, la mayor mide 4.5 cms. y la menor unos pocos milímetros. La trompa derecha mide 8 x 0.9 cms. Al corte conserva la estructura habitual. Se toman cortes.\r\nUn segundo recipiente, rotulado "Trompa izquierda" se recibe un trompa que conserva la morfología habitual mide 4.5 x 0.5 cms. La superficie externa esta cubierta por una serosa lisa y brillante y en el extremo distal se observa una estructura de aspecto quístico que mide 1 cm. en sus mayores dimensiones. Al corte la trompa conserva la estructura usual y la estructura descrita hay salida de un líquido claro dejando ver una cavidad unilocular de paredes delgadas. Se toman cortes.\r\n\r\n\r\n', 'El endometrio está autólisado. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente. Las trompas de Falopio conservan la morfología habitual. La estructura quística descrita en la trompa izquierda está tapizada por un epitelio seudoestratificado ciliado.\r\n\r\n\r\n\r\n', ' Histerectomía subtotal con salpingectomía bilateral:\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSO\r\n-TROMPAS DE FALOPIO\r\n-HIDATIDE DE MORGAGNI, trompa izquierda', '', ''),
	(1410, 'Q2110-2907', 'Q', '33158247', 'VICTORIA PORTO BERMEJO', '3145579410', 'F', '65', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de antro:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1411, 'Q2110-2908', 'Q', '73577882', 'LUCIANO TRUJILLO MEDINA', '3008250905', 'M', '45', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1412, 'Q2110-2909', 'Q', '45434719', 'DIANA PATRICIA FACUSEH DAVID', '6651714', 'F', '61', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa oxíntica sin cambios.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA OXÍNTICA SIN CAMBIOS\r\n\r\n', '', ''),
	(1413, 'Q2110-2910', 'Q', '64890618', 'LUZ KELY NAVAS GONZALEZ', '3004487284', 'F', '56', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Nódulo en piel de mama izquierda" se recibe una elipse de piel que mide 3 x 1.5 x 1.5 cms. Trae adherido tejido adiposo. Al corte se observa una formación nodular de color amarillento que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel de la mama que muestra cavidad quística tapizada parcialmente por epitelio escamoso que contiene queratina laminar, el dermis muestra una reacción inflamatoria a cuerpo extraño.\r\n\r\n\r\n\r\n ', ' Biopsia de piel de la mama izquierda:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE ROTO CON REACCIÓN INFLAMATORIA A CUERPO EXTRAÑO\r\n\r\n', '', ''),
	(1414, 'Q2110-2911', 'Q', '1043966914', 'EDIL ANDRES IBARRA MARTINEZ', '3233295512', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DOctor ANTONIO DE JESUS ARAUJO OROZCO', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglión dorsal en muñeca derecha" se recibe una formación nodular de color blanquecino que mide 2 x 2 x 1 cms. de consistencia renitente. Al corte una formación quística con salida de un material mucoide. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de tejido fibroso denso con zonas de degeneración quística.\r\n\r\n\r\n\r\n\r\n\r\n', '-GANGLIÓN, muñeca derecha\r\n\r\n', '', ''),
	(1415, 'Q2110-2912', 'Q', '45527056', 'SHIRLYS DEL CARMEN CONTRERAS AMARANTO', '000', 'F', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Dcotor SAMUEL CANTILLO VILLAR', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa izquierda" segmento de trompa que mide 1.5 cms. de color pardo grisáceo. Al corte muestra la estructura usual. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" segmento de trompa que mide 1.5 cms. de color pardo grisáceo. Al corte muestra la estructura usual. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA IZQUIERDA. SEGMENTO\r\n2.TROMPA UTERINA DERECHA. SEGMENTO', '', ''),
	(1416, 'Q2110-2913', 'Q', '50947884', 'MARGITH ESTELA QUIÑONES GELIS', '000', 'F', '39', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula que mide 7 x 3 x 2 cms. tapizada parcialmente pro una serosa de color pardo grisáceo. Al corte hay salida de material biliar y la presencia de múltiples cálculos de color amarillento, la pared está engrosada y la mucosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular. Además histiocitos espumosos subepiteliales.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS\r\n-COLESTEROLOSIS', '', ''),
	(1417, 'Q2110-2914', 'Q', '1042593283', 'LESLI KORY CHIQUILLO PIMENTEL', '3002762785', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor preauricular derecho" se recibe una elipse de piel que mide 2 cms. y presenta una lesión sobrelevada pediculada de 0.8 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso, en el dermis se observan abundantes folículos pilosos y cartílago maduro.\r\n\r\n\r\n\r\n', '-TRAGO ACCESORIO, derecho', '', ''),
	(1418, 'Q2110-2915', 'Q', '1049936889', 'YULEISIS GONZALEZ MARIMON', '3117911604', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. de color pardo oscuro. Trae adherido material fibrinopurulento y presenta una solución de continuidad de 1 cm. hay salida de material necrótico. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1419, 'Q2110-2916', 'Q', '33103533', 'LENIS MILENA TORRES ARROYO', '000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JOSE ACEVEDO', NULL, '2021-10-25', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Capsula de quiste vulvar" se reciben fragmentos de tejido de color pardo grisáceo y consistencia elástica que mide 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan la pared de un quiste constituido por tejido fibroconectivo y tapizado parcialmente pro epitelio escamoso.\r\n\r\n\r\n\r\n', ' Resección de quíste pared vaginal:\r\n-QUÍSTE DE INCLUSIÓN EPITELIAL', '', ''),
	(1420, 'Q2110-2917', 'Q', '30764189', 'MIRLA PATRICIA SUAREZ ROMERO', '000', 'F', '53', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-05', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de cupula" se recibe un fragmento de tejido de color pardo oscuro que mide 0.8 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan vagina tapizada por epitelio escamoso que muestra áreas ulceradas, además una neoplasia intraepitelial de alto grado, asociada atipias coilociticas.\r\n\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-NEOPLASIA INTRAEPITELIAL DE ALTO GRADO ASOCIADA ATIPIAS COILOCITICAS\r\n\r\n', '', ''),
	(1421, 'Q2110-2918', 'Q', '73160140', 'JULIO ALBERTO ARNEDO DIAZ', '00', 'M', '48', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctora LUISA FERNANDA VIANA', NULL, '2021-10-04', '2021-10-01', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe un minúsculo fragmento de tejido que mide 0.1 cms. Se intenta procesar.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso con hiperqueratosis, acantosis, papilomatosis, el dermis infiltrado por escasos linfocitos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de parpado, lado no especificado):\r\n-PAPILOMA ESCAMOSO', '', ''),
	(1422, 'Q2110-2919', 'Q', '1041976450', 'JULIANA TORRES ROSSI', '3007290495', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-07', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Producto de esplenectomía parcial" se reciben varios fragmentos de tejido de forma irregular, de color pardo oscuro y consistencia friable que macroscópicamente recuerdan la morfología del bazo. en conjunto pesan 462 gms. y muestran superficies cubiertas por una serosa y otras cruentas. Al corte se encuentra una superficie de color rojo vinoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran bazo con gran ensanchamiento de la pulpa roja que muestra sinusoides congestivos con presencia de múltiples eritrocitos tactoides. No se encuentran focos de necrosis, granulomas ni cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Esplenectomía parcial:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1423, 'Q2110-2920', 'Q', '32830581', 'MARELVIS MERCEDES TOMASES', '3022604614', 'F', '52', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ADRIANA LOPEZ CELEDON', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "vesícula" se recibe previamente abierta una vesícula que mide 10 x 6 cms. en sus mayores dimensiones. La superficie externa de color pardo claro está parcialmente cubierta por un tejido de color amarillento, las paredes son gruesas, aspecto fibroso y en el mismo recipiente, se reciben múltiples cálculos irregulares, friables de color pardo oscuro, el mayor de los cuales mide 3.5 cms. de diámetro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1424, 'Q2110-2921', 'Q', '1047396817', 'LAURA VANESA VENERA BELTRAN', '3113239046', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y aspecto membranoso que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro. No hay componente de la lámina propia que nos permita hacer el diagnóstico de inflamación.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya morfología esta preservada. No hay cambios inflamatorios ni presencia de parásitos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL\r\n', '', ''),
	(1425, 'Q2110-2922', 'Q', '1048443884', 'YESID OLIVO CONDE', '3042502794', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro con vasos prominentes que al corte se encuentra una luz dilatada que contiene un material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1426, 'Q2110-2923', 'Q', '1041979696', 'SHARMELL SHARICH CARDALES SALVADOR', '320651350', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y aspecto membranoso que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran epitelio escamoso maduro que reposa en una lámina propia con densa infiltración mononuclear. No hay cambios displásicos ni neoplásicos.\r\nLos cortes rotulados B muestran mucosa gástrica antral cuya morfología está preservada.\r\nLos cortes rotulados C muestran mucosa duodenal cuya lámina propia está edematosa e infiltrada por linfocitos y células plasmáticas.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA ANTRAL\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA', '', ''),
	(1427, 'Q2110-2924', 'Q', '1235045423', 'IMARIAN GENESIS GUETO MARRUGO', '3136659667', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Resección de lesión de mama derecha" se recibe una masa de tejido de forma irregular, multilobulada de color blanquecino y consistencia friable que mide 3.3 x 2.3 x 2 cms. en sus mayores dimensiones, la superficie externa es de color pardo claro, la consistencia es firme y al corte muestra una superficie multinodular de color blanquecino y aspecto untuoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(1428, 'Q2110-2925', 'Q', '9069848', 'WILLIAM WONG SCHOTBORGH', '3023735854', 'M', '71', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctora LUISA FERNANDA VIANA', NULL, '2021-10-07', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de forma irregular, uno de ellos de color blanquecino que se deshace. Al corte con un aspecto sebáceo y dos estructuras de aspecto membranoso de color pardo oscuro que miden respectivamente 0.5 y 0.3 cms. de diámetro mayor.\r\n\r\n\r\n\r\n', 'Los cortes muestran conjuntiva que recubre una lesión quística tapizada por epitelios escamoso y mucinoso. Esta rodeada por un infiltrado inflamatorio mononuclear.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión quística en ojo izquierdo:\r\n-QUÍSTE DE INCLUSIÓN EPITELIAL', '', ''),
	(1429, 'Q2110-2926', 'Q', '37635298', 'ISMARIS ARANGO BASTIDAS', '3125879161', 'F', '52', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo y consistencia blanda, elástica que mide 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por epitelio escamoso con hiperqueratosis, paraqueratosis y acantosis irregular que reposa en un corion fibroso con infiltración mononuclear.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vulva:\r\n-PAPILOMA ESCAMOSO\r\n\r\n\r\n\r\n', '', 'Los hallazgos son sugestivos pero no concluyentes de una lesión condilomatosa.\r\n\r\n\r\n'),
	(1430, 'Q2110-2927', 'Q', '1049939170', 'EMELIS PEREZ MONTERO', '3004000368', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.8 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa que en el extremo distal presenta una coloración violácea y el resto es de color pardo claro. Al  corte se encuentra una luz dilatada que contiene un material grumoso de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1431, 'Q2110-2928', 'Q', '7436063', 'WILSON CHOPERENA PERALTA', '3017992011', 'M', '75', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctora LUISA FERNANDA VIANA', NULL, '2021-10-07', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color pardo grisáceo y consistencia blanda, elástica que mide 0.6 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión epitelial benigna compuesta por múltiples capas de células escamosas con leves atipias nucleares, que se organizan en un patrón papilomatoso sobre un corión edematoso moderadamente vascularizado.\r\nLos márgenes de resección están libres de lesión.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en conjuntiva de ojo derecho:\r\n-PAPILOMA ESCAMOSO\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(1432, 'Q2110-2929', 'Q', '1048443088', 'SHELYS PATRICIA RODRIGUEZ GOMEZ', '3216614180', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 3.5 x 2.5 x 2 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se encuentra una superficie de color blanquecino con estrías de color pardo oscuro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina que mide 3.5 x 2.5 x 2 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se encuentra una superficie de color blanquecino con estrías de color pardo oscuro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1433, 'Q2110-2930', 'Q', '1043336130', 'YOWIN ANDRES FIERRO MESTRE', '3186157305', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica antral sin alteraciones.\r\nLos cortes rotulados B muestran mucosa duodenal cuya lámina propia está edematosa, congestiva, con un denso infiltrado inflamatorio compuesto por linfocitos, células plasmáticas y macrófagos, con formación ocasional de acúmulos linfoides. No se encuentran granulomas ni parásitos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA ANTRAL\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA SEVERA', '', ''),
	(1434, 'Q2110-2931', 'Q', '1201263346', 'DARIANIS SOFIA GARCES GARCIA', '30244889305', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-10-06', '2021-10-05', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2.8 x 1.8 x 1.5 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro y al corte se encuentra una superficie homogénea de color pardo amarillento. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina que mide 2.8 x 1.8 x 1.5 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro y al corte se encuentra una superficie homogénea de color pardo amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1435, 'Q2110-2932', 'Q', '45441152', 'INGRID EBELIA GODIN FERNANDEZ', '000', 'F', '60', 'PARTICULAR', '', '898201', '30215', 'Doctor LUIS FERNANDO VIAÑA G.', NULL, '2021-10-11', '2021-10-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Lipoma en axila derecha" se reciben varios fragmentos de tejido adiposo entre los que se destaca una masa ovoide, lobulado, que mide 7 x 5 x 3.5 cms. Al corte se encuentra una superficie untuosa de color amarillento y aspecto graso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor mesenquimal benigno compuesto por células adiposas maduras que se disponen en lóbulos separados por finas septas de tejido conectivo.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en axila derecha:\r\n-LIPOMA', '', ''),
	(1436, 'Q2110-2933', 'Q', '33341551', 'MARILIS MEJIA ARDILA', '00000', 'F', '47', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso con áreas focales de atrófia, degeneración vascular de la capa basal y un infiltrado inflamatorio focal mediado principalmente por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-COMPATIBLE CON LIQUEN SIMPLE CRÓNICO\r\n\r\n', '', ''),
	(1437, 'Q2110-2934', 'Q', '33273195', 'MERLY RICARDO CALVO', '3158127534', 'F', '39', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Epitelio escamoso hiperplásico que descansa en un estroma vascularizado.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-PAPILOMA ESCAMOSO', '', ''),
	(1438, 'Q2110-2935', 'Q', '45464516', 'ALEXIA PEÑA CASTRO', '3126222748', 'F', '56', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1439, 'Q2110-2936', 'Q', '33130090', 'MARIA DEL ROSARIO DEL RIO DE PEREZ', '3008147590', 'F', '71', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1440, 'Q2110-2937', 'Q', '13953187', 'GERMAN CADENA SANCHEZ', '3215394145', 'M', '58', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++), hay áreas extensas de metaplasia intestinal incompleta y atrófia leve. No se observan cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA, FOCOS DE METAPLASIA INTESTINAL INCOMPLETA', '', ''),
	(1441, 'Q2110-2938', 'Q', '21188546', 'ROBIENNY DEL CARMEN GONZALEZ BRICEÑO', '30000', 'F', '27', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n\r\n', '', ''),
	(1442, 'Q2110-2939', 'Q', '33082246', 'CANDELARIA DEL CARMEN BRAVO RODELO', '000', 'F', '54', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cardias gástrico" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan mucosa gástrica cardial cuya lámina propia muestra un infiltrado inflamatorio mediado por linfocitos, plasmocitos y neutrófilos en poca cantidad, hay formación de acúmulos linfoides en la muestra no se observa H.pylori ni ulceración.\r\nLos cortes B revelan antro gástrico cuya lámina propia es levemente edematosa y esta infiltrada por linfocitos, plasmocitos y neutrófilos en poca cantidad. En la muestra no se observó H.pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de cardias gástrico:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD INFLAMATORIA LEVE\r\n2.Biopsia endoscópica de antro:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(1443, 'Q2110-2940', 'Q', '7454854', 'HUGO RAFAEL CANTILLO ESCORCIA', '3007471191', 'M', '71', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Colon descendente" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa colónica cuya lámina propia es edematosa y muestra un infiltrado inflamatorio mixto moderado, las glándulas no muestran cambios displásicos y conservan el moco glandular. No se observan cambios neoplásicos en la muestra enviada.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon descendente:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1444, 'Q2110-2941', 'Q', '1113325711', 'DANIELA ALEJANDRA ZUÑIGA VASQUEZ', '3008515515', 'F', '14', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden respectivamente 0.4 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 ms. Se toma todo y se rotulan D.\r\n\r\n\r\n', 'Los cortes de A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes de B revelan mucosa gástrica oxíntica sin cambios.\r\nLos cortes C y D muestran mucosa bulbo duodenal con una inflamación crónica leve inespecifica.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA GASTRICA OXINTICA SIN CAMBIOS\r\n3.Biopsia endoscópica de bulbo:\r\n-FRAGMENTOS DE MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA LEVE\r\n4.Biopsia endoscópica de segunda porción:\r\n-FRAGMENTOS DE MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA LEVE', '', ''),
	(1445, 'Q2110-2942', 'Q', '1137537846', 'MARIA LUCIA GONZALEZ LOPEZ', '3046004665', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Condiloma acuminado" se reciben tres formaciones nodulares sobrelevadas de color pardo claro la mayor de ellas de 1 x 0.7 cms. y la menor de 0.5 x 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso con hiperqueratosis, hipergranulosis, acantosis irregular, papilomatosis y cambios coilociticos asociados, que descansan en un fino tallo fibrovascular.\r\n\r\n\r\n\r\n', '-CONDILOMAS ACUMINADOS, anogenitales', '', ''),
	(1446, 'Q2110-2943', 'Q', '1142950202', 'MELANY SOFIA ALFARO SERNA', '3135490201', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quiste pabellón auricular izquierda" se recibe una masa de tejido de aspecto quístico que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Lesión quística tapizada por epitelio seudoestratificado conteniendo queratina en su interior.\r\n\r\n\r\n\r\n\r\n', '-QUÍSTE TRIQUILEMAL, pabellón auricular izquierdo', '', ''),
	(1447, 'Q2110-2944', 'Q', '1051669724', 'MARIA ISABEL OSPINO SEQUEA', '3212805419', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FERNANDO CABRERA CARDOZO', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tumor tejido blando dedo medio derecho" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica, multinodular el mayor mide 1 cms. Al corte una superficie multinodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'los cortes revelan una lesión tumoral constituida por una proliferación de células redondeadas entre mezcladas con bandas de colágeno, hay presencia de células gigantes y formación de granulomas, se observa además algunas células xantomatosas.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en dedo medio de mano derecha:\r\n-TUMOR DE CÉLULAS GIGANTES DE LA VAINA TENDINOSA\r\n\r\n', '', ''),
	(1448, 'Q2110-2945', 'Q', '1142951625', 'SHERALIS SOFIA CSATILLA CUESTA', '3234704319', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mucosa rectal" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 y  0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa rectal levemente edematosa e infiltrada por linfocitos y plasmocitos en cantidad moderada. En la muestra no se observó parásitos intestinales, granulomas, actividad ni disminución del moco glandular.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de mucosa rectal:\r\n-PROCTITIS CRÓNICA INACTIVA', '', ''),
	(1449, 'Q2110-2946', 'Q', '7468253', 'CESAR TULIO ORTIZ CAMPAZ', '0000', 'M', '71', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor PEDRO LUIS IMBET', NULL, '2021-10-14', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Cuerpo gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan una lesión tumoral epitelial maligna constituida por una proliferación difusa de células globulosas de núcleos excéntrico, pleomórfico (células en anillo de sello), hay áreas de fibrosis a nivel submucoso y ulceración focal de la mucosa.\r\n\r\n ', ' Biopsia endoscópica de estómago:\r\n-ADENOCARCINOMA POBREMENTE DIFERENCIADO DE CÉLULAS EN ANILLO DE SELLO, INFILTRANTE\r\n\r\n\r\n\r\n\r\n', '', 'Este caso fue visto con los doctores José Caraballo y Oliva Marrugo.\r\n\r\n\r\n'),
	(1450, 'Q2110-2947', 'Q', '73230052', 'LUIS ALBERTO BUELVAS TAPIA', '000', 'M', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula que mide 4 x 1.5 cms. de color pardo oscuro. Al corte sus paredes están engrosadas y la mucosa conserva su aspecto aterciopelado. En su interior se observa un cálculo color amarillo que 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1451, 'Q2110-2948', 'Q', '1001969699', 'ARGELIA MARIA MENDEZ MENDEZ', '000', 'F', '26', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa derecha" segmento de trompa que mide 1 cms. Al corte la estrcutura usual. Se toman cortes y se rotulan A.\r\n2. "Trompa izquierda" segmento de trompa que mide 1.3 cms. Al corte la estrcutura usual. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA DERECHA. SEGMENTO\r\n2.TROMPA UTERINA IZQUIERDA. SEGMENTO', '', ''),
	(1452, 'Q2110-2949', 'Q', '45533038', 'YHESNY RODRIGUEZ PAJARO', '000', 'F', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Dcotor SAMUEL CANTILLO VILLAR', NULL, '2021-10-11', '2021-10-07', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Utero y trompa" se recibe cun cuerpo uterino y su trompa que pesa 354 gms. y mide 11 x 10 x 6 cms. El cuerpo tapizado por una serosa de color pardo rosado. Al corte la cavidad endometrial es permeable, y esta rechazada por la presencia de una gran masa intramural de color blanquecino y aspecto carnoso que mide 3  x3 x 4 cms. El endometrio es plano de color rojizo. el espesor del miometrio es de 5 cms. en su mayor dimensión. Las trompas de Falopio miden 5 y 5.5 cms. respectivamente y al corte muestran la estructura usual. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino con endometrio secretor, la masa descrita corresponde a un leiomioma, las trompas de Falopio no muestran cambios.\r\n\r\n\r\n\r\n', ' Cuerpo (354 gms. ):\r\n-ENDOMETRIO SECRETOR\r\n-LEIOMIOMAS\r\n-TROMPAS DE FALOPIO IZQUIERDA Y DERECHA SIN CAMBIOS', '', ''),
	(1453, 'Q2110-2950', 'Q', '45694516', 'NERIS DEL CARMEN PEINADO BAUTISTA', '3114399919', 'F', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-13', '2021-10-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay leves cambios atróficos del componente glandular. No se encuentra H. pylori, actividad inflamatoria ni cambios metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1454, 'Q2110-2951', 'Q', '60309358', 'ROSA LEONOR ALVAREZ DIAZ', '000', 'F', '56', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-10-13', '2021-10-13', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1.Bipsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNCIA INACTIVA\r\n2.Bipsia endoscópica de cuerpo gástrico:\r\n-GASTRITIS CRÓNCIA INACTIVA', '', ''),
	(1455, 'Q2110-2952', 'Q', '1043989803', 'LIZ BALLOLET MELENDEZ MEZA', '3216843256', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-10-13', '2021-10-13', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.9 x 0.7 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(1456, 'Q2110-2953', 'Q', '1041971942', 'MELANIS PAOLA PAJARO AVILA', '6476837', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-10-13', '2021-10-13', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Fibroadenoma mama izquierda cuadrante superior interno" una masa de tejido de forma irregular de color pardo claro consistencia elástica que mide 2.5 x 1.5 x 0.8 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2.  "Fibroadenoma mama izquierda cuadrante superior externo" una masa de tejido de forma irregular de color pardo claro consistencia elástica que mide 3.4 x 2 x 1.5 cms. la superficie externa tiene área multilobuladas y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B muestran tumores benignos compuestos por la proliferación combinada de elementos glandulares y estromales. No hay cambios malignos.\r\n\r\n\r\n\r\n\r\n', '1.Resección de masa en cuadrante superior interno de mama izquierda:\r\n-FIBROADENOMA\r\n2.Resección de masa en cuadrante superior externo de mama izquierda:\r\n-FIBROADENOMA', '', ''),
	(1457, 'Q2110-2954', 'Q', '63319509', 'SOLANGE ARIZA GUERRERO', '000', 'F', '56', 'SEGUROS BOLIVAR S.A', '', '898201', '30215', 'Doctor ROY BALLESTAS LARIOS', NULL, '2021-10-25', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa gástrico" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa antral en cuya lámina propia hay proliferación de células mononucleares atípicas. \r\nSe requieren estudios de inmunohistoquímica para descartar un proceso neoplásico.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\nCaso visto en junta de patologos con participación de los doctores José Caraballo y Ana Magola Manga.\r\n\r\n', '', ''),
	(1458, 'Q2110-2955', 'Q', '73094760', 'RUBEN DARIO ROMERO CASTAÑEDA', '3173781174', 'M', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de cuerpo gástrico cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1459, 'Q2110-2956', 'Q', '63459639', 'CLAUDIA MORALES MORENO', '3106811443', 'F', '49', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa oxíntica sin cambios.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA OXÍNTICA SIN CAMBIOS', '', ''),
	(1460, 'Q2110-2957', 'Q', '91420844', 'WILSON DE JESUS ORTIZ QUINTANIA', '3106110366', 'M', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1461, 'Q2110-2958', 'Q', '33067337', 'CLEMENCIA SOFIA RODRIGUEZ RICO', '3014090269', 'F', '44', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(1462, 'Q2110-2959', 'Q', '73094760', 'RUBEN DARIO ROMERO CASTAÑEDA', '3173781174', 'M', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antrocorporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1463, 'Q2110-2960', 'Q', '8693765', 'VICTOR HUGO RADA DIAZ', '3233073114', 'M', '62', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1464, 'Q2110-2961', 'Q', '1238347010', 'MICHELL SOFIA AMAYA BERRIO', '3002316921', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Granuloma piógeno" se recibe una formación nodular que mide 0.5 x 0.5 cms. de color pardo claro y consistencia elástica . Se toma todo.\r\n\r\n\r\n\r\n', 'Lesión vascular benigna constituida por una proliferación de vasos sanguíneos pequeños delgados que descansan en un estroma edematoso infiltrado por linfocitos, plasmocitos, neutrófilos, están tapizados por epitelio escamoso ulcerado.\r\n\r\n\r\n\r\n', '-HEMANGIOMA CAPILAR (GRANULOMA PIOGENO), sitio anatómico no especificado.', '', ''),
	(1465, 'Q2110-2962', 'Q', '1047432048', 'LUIS EDUARDO MELENDEZ TORRES', '3215145664', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-15', '2021-10-13', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reicben:\r\n1. "Esófago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan fragmentos sueltos de epitelio escamoso maduro sin representación de la lámina propia.\r\nLos cortes de B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia. \r\n\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.FRAGMENTOS DE EPITELIO ESCAMOSO MADURO\r\n2.GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(1466, 'Q2110-2963', 'Q', '1043640737', 'LUIS DAVID PEREZ BALCEIRO', '3235265762', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-14', '2021-10-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula que mide 8.2 x 2.5 x 2.5 cms. tapizada parcialmente por una serosa de color pardo grisáceo. Al corte salida de un material biliar, la pared se encuentra engrosada y la mucosa es de color amarillento. Se toman cortes.\r\nNo se reciben cálculos.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular, se observa además, histiocitos espumosos subepiteliales.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLESTEROLOSIS\r\n\r\n', '', ''),
	(1467, 'Q2110-2964', 'Q', '1042592449', 'LUISA FERNANDA ARIAS BARRIOS', '3006329788', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-10-20', '2021-10-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Nevo displásico rodilla" se recibe un punch de piel que mide 0.5 cms. de color pardo oscuro presenta lesión sobreelevada de 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso con hiperqueratosis, focos de paraqueratosis. En la unión dermoepidérmica y dermis medio se observa lesión tumoral constituida por una proliferación de células epiteliales y fusiformes dispuestas en nidos, se observó, además, un infiltrado inflamatorio mediado por linfocitos. Hay abundante pigmento melánico en el dermis y la presencia de cuerpos eosinofílicos (cuerpos globoides de kamino) en la unión dermoepidérmica. No se observó migración ascendente de melanocitos, muy escasa figuras de mitosis.\r\n\r\n', ' Extirpación de lesión en piel, miembro inferior derecho:\r\n-NEVO DE CÉLULAS FUSIFORMES Y EPITELIOIDES (NEVO DE SPITZ)\r\n\r\n\r\n', '', 'Son necesarios estudios de inmunohistoquímica para definir diagnóstico.'),
	(1468, 'Q2110-2965', 'Q', '1142926808', 'YEISON JOSE PARRA URIETA', '3215336799', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-10-14', '2021-10-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. en sus mayores dimensiones, tapizada por una serosa bien vascularizada. Al corte hay salida de un material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1469, 'Q2110-2966', 'Q', '1043296473', 'BRAYAN ENRIQUE GAMARRA MARIMON', '3106040501', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-10-14', '2021-10-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Dermatofibroma" se recibe un punch de piel que mide 0.6 cms. de color parod oscuro y consitenica elástica. S etoma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso hiperplásico en cuyo dermis se observa lesión tumoral constituida por una proliferación de células fusiformes distribuidas en un patrón verticilado, la lesión toca el borde profundo de resección.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en abdomen:\r\n-DERMATOFIBROMA\r\n\r\n', '', ''),
	(1470, 'Q2110-2967', 'Q', '1142943783', 'MATIAS SANTAMARIA GONZALEZ', '3006563975', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-15', '2021-10-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes de A revelan fragmentos de epitelio escamoso hiperplásico sin representación de la lámina propia.\r\nLos cortes de B muestran mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes de C revelan duodeno que presentan edema, congestión e infiltrado mononuclear moderado.\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.FRAGMENTOS DE EPITELIO ESCAMOSO HIPERPLASICOS\r\n2.GASTRITIS CRÓNICA INACTIVA, LEVE\r\n3.DUODENITIS CRÓNICA ', '', ''),
	(1471, 'Q2110-2968', 'Q', '1235044758', 'ANGELES DE JESUS ALMARZA JIMENEZ', '3045364453', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-10-14', '2021-10-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Nevo dermico" se recibe un punch de piel que mide 0.6 cms. presenta una lesión hiperpigmentada de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se observa leisón tumoral constituida por una proliferación de células nevicas dispuestas en pequeños nidos y cordones.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en cuero cabelludo:\r\n-NEVUS MELANOCITICO INTRADERMICO', '', ''),
	(1472, 'Q2110-2969', 'Q', '1043308424', 'RAFAEL ARTURO RODRIGUEZ VILORIA', '3017450160', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-15', '2021-10-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes de B muestran mucosa duodenal sin cambios.\r\n\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.GASTRITIS CRÓNICA INACTIVA, LEVE\r\n2.MUCOSA DUODENAL SIN CAMBIOS', '', ''),
	(1473, 'Q2110-2970', 'Q', '1201221096', 'EMMANUEL JESUS PINEDA AYOLA', '3126386303', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-10-14', '2021-10-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo oscuro presenta una solución de continuidad de 1 cm. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal con ulceración de la mucosa, la pared infiltrada por gran cantidad de PMN neutrófilos que se extienden hasta la serosa.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECRÓTIZANTE\r\n\r\n', '', ''),
	(1474, 'Q2110-2971', 'Q', '1048437811', 'DIEGO ANTONIO PADILLA GONZALEZ', '3014525007', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-15', '2021-10-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A revelan fragmentos de mucosa esofágica sin cambios.\r\nLos cortes de B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes de C revelan mucosa duodenal sin alteraciones.\r\n\r\n\r\n', ' Biopsia endoscópica digestiva superior:\r\n1.MUCOSA ESOFAGICA SIN CAMBIOS\r\n2.GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n3.DUODENO SIN CAMBIOS', '', ''),
	(1475, 'Q2110-2972', 'Q', '1050977516', 'LISBETH MICHELLE SIERRA ANAYA', '3013162773', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-10-14', '2021-10-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice" un apéndice cecal que mide 5 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material fecal. Se toman cortes y se rotulan A.\r\n2. "Ganglio mesentérico" formación nodular de color pardo claro y consistencia elástica que mide 0.8 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\nLos cortes B revelan ganglio linfático que muestra folículos hiperplásicos con polarización del manto.\r\n\r\n\r\n\r\n', '1.Apéndice cecal con:\r\n-HIPERPASIA LINFOIDE REACTIVA\r\n2.Ganglio mesentérico con:\r\n-HIPERPLASIA FOLICULAR REACTIVA\r\n\r\n', '', ''),
	(1476, 'L2110-111', 'L', '1048466869', 'DAHIAN RAMIREZ MONTES', '3000000', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-10-14', '2021-10-14', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se recibe 5.6 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(1477, 'L2110-112', 'L', '1102881834', 'OSNEIDI ELIZABETH FLOREZ ALVAREZ', '3143870571', 'F', '38', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-10-14', '2021-10-14', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 6.2 ml. de un liquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', '  Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n', '', ''),
	(1478, 'Q2110-2973', 'Q', '15701487', 'LUIS MANUEL SOTO COAVAS', '3126118172', 'M', '59', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cicatriz de ulcera" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 y 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa gástrica antral cuya morfología está preservada. hay leve infiltración linfoplasmocitaria de la lámina propia. No hay presencia de H.pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de cicatriz de ulcera antral:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1479, 'Q2110-2974', 'Q', '45444125', 'JACQUELINE BARBUR CHEJUAN', '3153663294', 'F', '59', 'SEGUROS BOLIVAR S.A', '', '898201', '30215', 'Doctora MANUELA BERROCAL', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lesión parpado inferior izquierdo" un fragmento de piel de forma irregular de color pardo claro y consistencia elástica que mide 0.7 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Lesión en dorso nasal" un fragmento de piel de forma irregular de color pardo claro y consistencia elástica que mide 0.7 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Lesión en labio superior izquierdo" un fragmento elíptico de piel que mide 1 cm. de color pardo claro y consistencia elástica. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran piel cuya epidermis se encuentra engrosada a expensas de una proliferación de células escamosas basaloides que rodean espacios que contienen queratina laminar.\r\nLos cortes rotulados B muestran piel en la que se encuentra un tumor epitelial compuesto por células pequeñas, basaloides que infiltran el dermis formando nidos sólidos y cordones con empalizada periférica. El tumor está completamente extirpado.\r\nLos cortes rotulados C muestran piel en la que se encuentra un tumor epitelial compuesto por células pequeñas, basaloides que infiltran el dermis formando nidos sólidos y cordones con empalizada periférica. El tumor está completamente extirpado.\r\n\r\n', '1.Biopsia de lesión en párpado inferior izquierdo:\r\n-QUERATOSIS SEBORREICA\r\n\r\n2.Biopsia de lesión en dorso nasal:\r\n-CARCINOMA BASOCELULAR\r\n-BORDES DE RESECCIÓN LIBRES DE TUMOR\r\n\r\n3.Biopsia de lesión en labio superior izquierdo:\r\n-CARCINOMA BASOCELULAR\r\n-BORDES DE RESECCIÓN LIBRES DE TUMOR', '', ''),
	(1480, 'Q2110-2975', 'Q', '45528675', 'LEIDYS DIANA RODRIGUEZ CARO', '3215494747', 'F', '40', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color blanco grisáceo y consistencia blanda que mide 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1481, 'Q2110-2976', 'Q', '1042606183', 'JORDANIA GUTIERREZ VILLA', '3014348630', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Fibroadenoma de mama derecha" se recibe un fragmento de tejido de forma irregular de color blanquecino consistencia elástica que mide 2.8 x 2 x 2.3 cms. en sus mayores dimensiones, la superficie externa es irregular y esta parcialmente cubierto por un tejido graso. Al corte se encuentra una superficie multinodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(1482, 'Q2110-2977', 'Q', '45476728', 'ANICE DEL CARMEN ZUÑIGA PLAZA', '3116446430', 'F', '54', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Útero" un cuerpo uterino que pesa 166 gms. y mide 8.5 x 6.5 x 5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa lisa y brillante, la forma es irregular. Al corte la cavidad endometrial esta ocupada por una estructura polipoide que mide 3 x 1.5 cms. en sus mayores dimensiones. En el miometrio se encuentran múltiples nódulos que promedian un diámetro de 3 cms. esféricos de color blanquecino, algunos con áreas de color pardo oscuro en su interior son de localización submucosa, intramural y subserosa. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulados "Masa tumoral en ovario derecho" masa de tejido de forma irregular, color pardo claro y consistencia pétrea que mide 10 x 7.5 x 5.5 cms. en sus mayores dimensiones. Al corte se encuentra una superficie multinodular de color pardo claro. Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente, rotulado "Ovario izquierdo" contiene una estructura de aspecto bilobulado que mide 3.5 x 2 x 1.5 cms. en sus mayores dimensiones, en un área es de consistencia renitente y en la otra es de consistencia firme. Al corte de la primera se encuentra una cavidad multilocular que contiene un líquido cetrino, la otra estructura es de color pardo claro con áreas blanquecinas. Se toman cortes y se rotulan C.\r\n\r\n', 'El endometrio es proliferativo. En el miometrio hay múltiples focos de glándulas y estroma endometrial. La masa polipoide está compuesta por glándulas endometriales proliferativas, de diferentes formas y tamaños sobre un estroma fibrovascular. Las masas miometriales están compuestas por fibras musculares lisas dispuestas irregularmente. El ovario izquierdo conserva su morfología habitual y la trompa está dilatada con aplanamiento de la mucosa. La masa ovárica está compuesta por células fusiformes dispuestas irregularmente con abundante producción de colágeno. No se encuentran atípias citológicas ni focos de necrosis.\r\n\r\n', '1.Cuerpo uterino (166 gms.):\r\n-ENDOMETRIO PROLIFERATIVO\r\n-PÓLIPO ENDOMETRIAL HIPERPLÁSICO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n2.FIBROMA DE OVARIO DERECHO\r\n3.HIDROSALPINX IZQUIERDO\r\n4.OVARIO IZQUIERDO ', '', ''),
	(1483, 'Q2110-2978', 'Q', '22973591', 'BIENVENIDA PAJARO AMEL', '000', 'F', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa en pared lumbar derecho" se recibe un fragmento de tejido de forma irregular ligeramente ovoide que mide 5 x 3 x 2 cms. en sus mayores dimensiones es de color amarillo de consistencia blanda y al corte presenta una superficie untuosa de color amarillo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Resección de masa en región dorsolumbar:\r\n-LIPOMA', '', ''),
	(1484, 'Q2110-2979', 'Q', '45508422', 'ZULMA JUDITH SALGADO PEREZ', '000', 'F', '49', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1485, 'Q2110-2980', 'Q', '79406739', 'CARLOS MAURICIO CELY VILLALOBOS', '3015490178', 'M', '54', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1486, 'Q2110-2981', 'Q', '72103523', 'WILIAM RAFAEL BARROS AHUMADA', '3116704640', 'M', '48', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1487, 'L2110-113', 'L', '1053006623', 'CRISTIAN ANDRES MORALES FONSECA', '3216904576', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-10-15', '2021-10-14', 'JOSÉ CARABALLO GRACIA', 'Rotulado "L.C.R" se reciben 5.8 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', '', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1488, 'Q2110-2982', 'Q', '72294292', 'JAIRO ENRIQUE GONZALEZ AVILA', '3204939703', 'M', '37', 'ALLIANZ SEGUROS DE VIDA S.A', '', '898201', '30215', 'Doctor ROY BALLESTAS LARIOS', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1489, 'Q2110-2983', 'Q', '30662811', 'ARGENEDITH DEL CARMEN GUEVARA LLORENTE', '3145484736', 'F', '43', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Cicatriz en cuello" se recibe un fragmento de tejido de forma alargado de color blanquecino y consistencia blanda que mide 1 x 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Epitelio escamoso con focos de hiperplasia que descansan en un estroma edematoso, en el que se observa además abundantes capilares e inflamación aguda.\r\n\r\n\r\n\r\n', '-HEMANGIOMA CAPILAR (TIPO GRANULOMA PIOGENO), cuello', '', ''),
	(1490, 'Q2110-2984', 'Q', '45691580', 'CLAUDIA MARIA QUINTANA DE AVILA', '3013147853', 'F', '43', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Trucut de seno derecho" se reciben tres fragmento cilíndricos de tejido de color blanquecino que promedian 1 x 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmento de tejido mamario que descansan en un tejido fibroadiposo con focos de edema e infiltración por linfocitos.\r\n\r\n\r\n\r\nOBSERVACIONES: No se observa tumor en la muestra enviada.\r\n\r\n\r\n', ' Biopsia pro trucut de mama derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(1491, 'Q2110-2985', 'Q', '52416492', 'LISA MARGARITA DAZA', '000', 'F', '44', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1492, 'Q2110-2986', 'Q', '1201232610', 'KEINER DAVID ARNEDO ALVAREZ', '3145846553', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es opaca y despulida de color pardo oscuro. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(1493, 'Q2110-2987', 'Q', '1043316359', 'MARIA ANTONIA CHARRY JAIMES', '3043462709', 'F', '7', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 y 0.3 cms. Se toma todo y se rotulan E\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa esofágica, hiperplasia que descansa en una lámina propia infiltrada por linfocitos.\r\nLos cortes de B revelan mucosa gástrica antral sin cambios.\r\nLos cortes C revelan mucosa gástrica corporal sin cambios.\r\nLos cortes rotulados D y E bulbo y segunda porción revelan mucosa bulbo duodenal con inflamación crónica leve.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de estómago (antro):\r\n-FRAGMENTOS DE MUCOSA GASTRICA SIN CAMBIOS\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-FRAGEMNTOS DE MUCOSA ANTROCORPORAL SIN CAMBIOS\r\n4.Biopsia endoscópica de bulbo:\r\n-FRAGMENTO DE MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA LEVE\r\n5.Biopsia endoscópica de segunda porción del duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA LEVE', '', ''),
	(1494, 'Q2110-2988', 'Q', '45476629', 'MARIA DEL CARMEN HERNANDEZ JIMENEZ', '000', 'F', '64', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa gástrica antro corporal cuya lámina propia es edematosa y esta infiltrada por linfocitos, plasmocitos en cantidad moderada, hay formación de acúmulos linfoides en la lámina propia. En la muestra no se observa H.pylori, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(1495, 'Q2110-2989', 'Q', '91213310', 'RAFAEL ANAYA RODRIGUEZ', '3156927644', 'M', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 y 0.2 cms. Se toma todo y se rotulan D.\r\n5. "Colon ascendente" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. Se toma todo y se rotulan E.\r\n6. "Fondo de ciego" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan F.\r\n7. "Colon transverso" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. Se toma todo y se rotulan G.\r\n8. "Colon izquierdo" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan H.\r\n9. "Recto" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 y 0.2 cms. Se toma todo y se rotulan I.', 'Los cortes de A y B revelan mucosa gástrica antral cuya lámina propia esta infiltrada pro linfocitos, plasmocitos en abundante cantidad y neutrófilos en cantidad moderada se observa H.pylori en muy poca cantidad en la luz de algunas glándulas. No se observa atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes de C y D revelan bulbo y segunda porción de duodeno muestra mucosa duodenal con inflamación aguda y crónica moderada.\r\nLos cortes de colon (rotulados E, F, G y H) muestran mucosa colónica con focos de edema e infiltración por linfocitos, plasmocitos y neutrófilos en poca cantidad en la muestra no se observan parásitos intestinales, granulomas, disminución del moco glandular.\r\nlos cortes I, recto muestran mucosa rectal con inflamación crónica leve.', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de bulbo y segunda porción:\r\n-DUODENITIS AGUDA Y CRÓNICA MODERADA\r\n3.Biopsia endoscópica de colon (ascendente, transverso, ciego y izquierdo) :\r\n-MUCOSA COLONICA CON INFLAMACIÓN CRÓNICA LEVE\r\n4.Biopsia endoscópica de recto:\r\n-MUCOSA RECTAL CON INFLAMACIÓN CRÓNICA LEVE                       	\r\n \r\n______________________________________\r\nANA MAGOLA MANGA CEDEÑO\r\nMédico Patólogo - Registro: 659', '', ''),
	(1496, 'Q2110-2990', 'Q', '1066899245', 'DEIVIS ELIAS ESQUIVIA LERMA', '3155146339', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-21', '2021-10-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Boca de ileostomía" se recibe un segmento de ileon que mide 4.5 x 2.2 cms. la serosa es de color pardo claro en uno de sus extremos presenta la mucosa evertida y eversión de la mucosa con un punteado blanquecino (boca). Al corte los pliegues muestra la distribución habitual.\r\n\r\n\r\n\r\n', 'Ileon que se continua con fragmento de piel y muestra fibrosis, edema e inflamación aguda y crónica.\r\n\r\n\r\n\r\n\r\n', '-ESTOMA DE ILEOSTOMIA CON FIBROSIS E INFLAMACION AGUDA Y CRÓNICA\r\n', '', ''),
	(1497, 'Q2110-2991', 'Q', '26652917', 'BELIA ROSA TERNERA DE TORREGROSA', '3145812794', 'F', '94', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-11-04', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Trucut de seno izquierdo" se reciben cuatro cilíndros de tejido de color blanquecino y consistencia elástica que promedian un diámetro de 1.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan un tejido compuesto en su mayoría por una proliferación de pequeños vasos con células endoteliales grandes, irregulares que reposan en un estroma que así mismo contiene células de núcleos grandes, irregulares e hipercromáticos. Los hallazgos descritos son muy sugestivos pero no concluyentes de un proceso NEOPLASICO MESENQUIMAL DE BAJO GRADO, es imperativo practicar estudios de inmunohistoquímica para definir diagnóstico.\r\n\r\n\r\n', ' Biopsia por trucut de seno izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\nNOTA: Caso visto con el doctor José Caraballo.', '', ''),
	(1498, 'Q2110-2992', 'Q', '45453521', 'LUZ DEL CARMEN HERNANDEZ BONFANTE', '3174419306', 'F', '57', 'ALLIANZ SEGUROS DE VIDA S.A', '', '898201', '30215', 'Doctor ROY BALLESTAS LARIOS', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antrocorporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA ', '', ''),
	(1499, 'Q2110-2993', 'Q', '455044554', 'IRLENA DE HOYOS CORTECERO', '3002797442', 'F', '48', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmento de cérvix con inflamación crónica y LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CONDILOMA PLANO\r\n\r\n', '', ''),
	(1500, 'Q2110-2994', 'Q', '1067943561', 'PAULA ANDREA USTA TIRADO', '3015374364', 'F', '26', 'ALLIANZ SEGUROS DE VIDA S.A', '', '898201', '30215', 'Doctor ROY BALLESTAS LARIOS', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa gástrica" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA ', '', ''),
	(1501, 'Q2110-2995', 'Q', '8223228', 'CARLOS RAFAEL COSTA BARRAZA', '3002083151', 'M', '82', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor LUIS MIGUEL COVO SEGRERA', NULL, '2021-10-25', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de tejido que mide 0.5 cms. presenta una lesión sobreelevada de tejido de 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes solo revelan fragmento de epitelio escamoso hiperplásico con marcada hiperqueratosis y focos de paraqueratosis.\r\n\r\n\r\nOBSERVACIONES: No se observa tumor en la muestra enviada.\r\n\r\n', ' Extirpación de lesión en lecho ungueal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1502, 'Q2110-2996', 'Q', '45495716', 'IDALIDES LLERENA GARCIA', '3215146235', 'F', '62', 'PARTICULAR', '', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(1503, 'Q2110-2997', 'Q', '33205323', 'NORIS MARIA RODRIGUEZ RODRIGUEZ', '3107366986', 'F', '49', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor JULIAN HIGUERA BLANCO', NULL, '2021-10-25', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe un fragmento de tejido que mide 1 x 0.5 cms. de color pardo claro y consistencia elástica. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso que muestra áreas de hiperplasia seudoepiteliomatosa y descansa en un estroma en la que se observa una lesión tumoral constituida por una proliferación de células grandes globulosas de citoplasma granular que se extiende al tejido muscular.\r\n\r\n\r\n', ' Extirpación de lesión en borde lateral de lengua:\r\n-TUMOR DE CÉLULAS GRANULARES', '', ''),
	(1504, 'Q2110-2998', 'Q', '45535441', 'DORA LUZ PIMIENTA RIVERA', '3012778705', 'F', '39', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Fibroadenoma de mama derecha" en un mismo recipiente, se reciben dos masas de ovoides que mide la mayor 4 x 3 cms. y la menor de 2.5 x 1.5 cms. de color blanco amarillento y consistencia elástica. Al corte de la mayor una superficie lisa, de color blanco amarillento y la menor presenta una formación nodular de color blanquecina que mide 2  x 2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(1505, 'Q2110-2999', 'Q', '19183183', 'FERNANDO JOSE MONTAÑA MERIÑO', '3174407261', 'M', '68', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1506, 'Q2110-3000', 'Q', '45543375', 'YULIS PAOLA GOMEZ CASTILLA', '3135979505', 'F', '38', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVODAD LEVE Y H.PYLORI PRESENTE', '', ''),
	(1507, 'Q2110-3001', 'Q', '1104009880', 'RUTH MARINA MONROY SANTO', '3003106471', 'F', '33', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan antro gástrico cuya lámina propia muestra infiltrado mononuclear leve con formación de agregados linfoides. No se evidencia actividad, H.pylori, atrófia, metaplasia ni displasia.\r\nLos cortes de B revelan cuerpo gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear leve con formación de un agregado linfoide. No se observa actividad, H.pylori, atrófia, metaplasia ni displasia.\r\n\r\n ', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE', '', ''),
	(1508, 'Q2110-3002', 'Q', '1043320409', 'EMILY SOFIA TORREGLOSA AHUMADA', '3045269979', 'F', '6', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes A revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B revelan mucosa oxíntica son cambios.\r\nLos cortes de C y D revelan bulbo y segunda porción del duodeno con inflamación crónica leve.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE Y H.PYLORI PRESENTE\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA OXÍNTICA SIN CAMBIOS\r\n3.Biopsia endoscópica de bulbo duodenal:\r\n-BULBO CON INFLAMACIÓN CRÓNICA LEVE\r\n3.Biopsia endoscópica de 2da. porción del duodeno:\r\n-DUODENO CON INFLAMACIÓN CRÓNICA LEVE', '', ''),
	(1509, 'Q2110-3003', 'Q', 'VEN6181854', 'MIGUELANGEL JOSE GUANIPA GONZALEZ', '3022159441', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa, opaca bien vascularizada de color pardo claro. Al corte salida de un material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n', '', ''),
	(1510, 'Q2110-3004', 'Q', '49666311', 'LICETH BELLO GOMEZ', '3135390735', 'F', '43', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-11-03', '2021-10-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cuadrante de mama derecha" un fragmento de tejido que mide 5 x 5 x 2 cms. de color blanco amarillento y consistencia elástica. Al corte salida de un líquido claro, los quistes promedian un diámetro de 1 cm. Se toman cortes y se rotulan A.\r\n2. "Cuadrante de mama izquierdo" un fragmento de tejido que mide 6 x 4 x 3 cms. de color blanco amarillento y consistencia elástica. Al corte una superficie lisa y de color blanco amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan mama que muestra canalículos quísticamente dilatados, metaplasia apocrina, el estroma focalmente infiltrado por linfocitos con fibrosis.\r\nLos cortes de B revelan mama que muestra canalículos dilatados algunos con hiperplasia epitelial leve, el estroma muestra fibrosis.\r\n\r\n\r\n', '1.Resección de lesión en mama derecha:\r\n-CAMBIOS FIBROQUISTICOS\r\n2.Resección de lesión en mama izquierda:\r\n-CAMBIOS FIBROQUISTICOS E HIPERPLASIA EPITELIAL DUCTAL LEVE\r\n\r\n', '', ''),
	(1511, 'Q2110-3005', 'Q', '1142942879', 'SANTIAGO VIDES VIAFARA', '3128254187', 'M', '7', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se erciebn:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan E.\r\n\r\n', 'Los cortes de A revelan mucosa esofágica que muestra hiperplasia del epitelio escamoso, la lámina propia congestiva con un infiltrado mononuclear leve.\r\nLos cortes B y C revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes D y E revelan bulbo y mucosa duodenal que muestra además, congestión y un infiltrado mononuclear moderado, se identifica atrófia, parásitos ni cambios epiteliales.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNCIA INACTIVA\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNCIA INACTIVA\r\n4.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA MODERADA\r\n5.Biopsia endoscópica de 2da. porción del duodeno:\r\n-DUODENITIS CRÓNICA MODERADA', '', ''),
	(1512, 'Q2110-3006', 'Q', '1043961228', 'ANGELA PAOLA AGUADO ESTRADA', '3013595615', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 3 x 2 cms. tapizada por una serosa de color pardo grisáceo bien vascularizada. Al corte salida de material biliar y la presencia de múltiples cálculos de color amarillento. Al corte la mucosa conserva su aspecto aterciopelado y la mucosa se encuentra aterciopelada. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1513, 'Q2110-3007', 'Q', '1041984525', 'NICOLLE SOFIA COGOLLO PADILLA', '3008702574', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia es edematosa, congestiva con infiltrado mononuclear moderado, actividad leve focal. No se encuentra H. pylori, atrófia, metaplásia ni displásia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n\r\n', '', ''),
	(1514, 'Q2110-3008', 'Q', '1048606608', 'CIELO ASTRID PARRA ALTAMAR', '3127927519', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor WILLIAN URIBE LUNA', NULL, '2021-11-02', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Tejido blando de pie izquierdo" se recibe un fragmento de tejido que mide 2 x 1.5 cms. de color pardo grisáceo presenta una formaciones verrugosas de 0.5 cms. Al corte una superficie blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral constituida por una proliferación de células fusiformes gruesas dispuestas en haces cortas y fasciculares.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en tejido blando pie izquierdo:\r\n-COMPATIBLE CON MIOFIBROMA SOLITARIO', '', ''),
	(1515, 'Q2110-3009', 'Q', '1137535777', 'ARIAN PEREZ MEZA', '3005691389', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes de A revelan mucosa esofágica cuyo epitelio escamoso es hiperplásico, infiltrado inflamatorio representado por linfocitos y eosinófilos en el epitelio y en la lámina propia además, ectasia capilar mucosa.\r\nLos cortes B revelan mucosa antral cuya lámina propia muestra infiltrado mononuclear severo con formación de agregados linfoides, actividad severa y H.pylori presente.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS POR REFLUJO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD SEVERA Y H.PYLORI PRESENTE\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS', '', ''),
	(1516, 'Q2110-3010', 'Q', '1047510911', 'YOFREYDER JOSE ALVAREZ ATENCIO', '3012073944', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-10-25', '2021-10-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lesión ulcerativa en escrito" elipse de piel que mide 1 x 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Saco herniario" un fragmento de tejido de forma sacular de color grisáceo y consistencia elástica que mide 7 x 4 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan piel tapizada por epitelio escamoso con focos de ulceración que descansan en un estroma infiltrado por linfocitos, plasmocitos y abundantes neutrófilos con la presencia de escasas células gigantes a cuerpo extraño.\r\nLos cortes B muestran tejido fibroconectivo con congestión y edema.\r\n\r\n', '1.PIEL DE ESCROTO CON ULCERACIÓN E INFLAMACIÓN AGUDA Y CRÓNICA Y CÉLULAS GIGANTES A CUERPO EXTRAÑO\r\n2.SACO HERNIARIO', '', ''),
	(1517, 'Q2110-3011', 'Q', 'VEN807273924122010', 'DANNA SOFIA ESPINA MORAN', '3022650001', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-25', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1518, 'Q2110-3012', 'Q', '1048606547', 'YERLIS QUINTERO ACOSTA', '3133963247', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Trompa derecha e izquierda" en un mismo recipiente, sin discriminar, se reciben dos segmentos de trompas de Falopio con sus fimbrias que miden 5 cms. cada una de color pardo grisáceo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Segmentos de trompa uterina que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n\r\n', '-TROMPAS UTERINAS. SEGMENTOS (2) ', '', ''),
	(1519, 'Q2110-3013', 'Q', '1049925513', 'VERONICA JUDITH MARTINEZ SALDARRIAGA', '3104112351', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-25', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con agregados linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(1520, 'Q2110-3014', 'Q', '1041977445', 'HEIDY LUZ GARCIA VILLALBA', '3135534225', 'F', '22', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2022-01-19', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Placenta" se recibe una placenta que pesa 96 gms. y mide 9 x 9 x 4 cms. La cara materna está representada por varios cotiledones de color pardo claro. La cara fetal es de aspecto membranoso, trae un segmento de cordón umbilical que mide 9 cms. de implantación central que muestra dos vasos y además, muestra torsión y adelgazamiento en su extremo distal. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran tejido placentario del 2° trimestre compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblasto sin alteraciones morfológicas que alteren la viabilidad del feto. El cordón tiene 2 vasos.\r\n\r\n\r\n\r\n', ' Placenta del 2° trimestre (96 gms.):\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1521, 'Q2110-3015', 'Q', '1044928991', 'ANDRES ALFARO MEZA RAMOS', '301', 'M', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora NATALIA LEDESMA', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca de color pardo claro. Al corte salida de material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1522, 'Q2110-3016', 'Q', '33104763', 'GEIDIS MARGARITA CAMPILLO DIAZ', '3012046657', 'F', '42', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-10-25', '2021-10-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Utero" cuerpo uterino que pesa 658 gms. y mide 19 x 10 x 8 cms. tapizada por una serosa de color pardo grisáceo. Al corte la cavidad endometrial esta rechazada por dos masas miometriales, ovoides de color blanquecinas la mayor mide 9 x 9 x 8 cms. y la menor rechaza la cavidad mide 5 x 5 x 4 cms. ocupando la cavidad se encuentra una masa mide 2 x 2 cms. La masa que ocupa la cavidad, se rotual A, el endometrio y la masa miometrial se rotulan B. A nivel subseroso se encuentra una masa mide 4 x 3 cms.\r\n2. Por separado, rotulado "Trompa de Falopio izquierda" un segmento de trompa de Falopio con su fimbria que mide 3 cms. presneta hidatide de morgagni. S etoman cortes y se rotulan C.\r\n3. Por separado, rotulado "Trompa de Falopio derecha" un segmento de trompa que mide 2 cms. con fimbria. S etoman cortes y se rotulan D.\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino en el que se observa leiomiomas submucoso, intramural y subseroso. El endometrio esta autólisado. Las trompas de Falopio no muestran cambios.\r\n\r\n\r\n', ' Cuerpo uterino:\r\n-LEIOMIOMAS\r\n-ENDOMETRIO AUTÓLISADO\r\n-TROMPS DE FALOPIO IZQUIERDA Y DERECHA', '', ''),
	(1523, 'Q2110-3017', 'Q', '1137542717', 'MARIA DE LOS ANGELES TORRES BELTRAN', '000', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-03', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Resección de fistula rafia peri vestibular" se recibe un fragmento de tejido de forma irregular que mide 1 x 1 cms. de color amarillento en uno de sus extremos viene marcado con seda. Al corte se observa trayecto fistuloso. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan trayecto fistuloso tapizado por epitelio escamoso, el estroma edematoso y congestivo.\r\n\r\n\r\n\r\n', '-FISTULA, región peri vestibular\r\n\r\n', '', ''),
	(1524, 'Q2110-3018', 'Q', '1127614834', 'YULIANIS CORREA OSPINA', '3017070857', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-11-03', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Liquen estriado" se recibe un punch de piel que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso sin cambios, el dermis muestra un infiltrado leve superficial mediado por linfocitos. En la muestra enviada no se observan cambios de liquen estriado.\r\n\r\n\r\n', ' Biopsia de piel de muslo derecho:\r\n-DERMATITIS PERIVASCULAR SUPERFICIAL\r\n\r\n\r\n', '', 'Se recomienda correlacionar con la clínica y si clínicamente esta indicado tomar nueva muestra.\r\nCaso visto en conjunto con los doctores José Caraballo y Ana Magola Manga.\r\n\r\n\r\n'),
	(1525, 'Q2110-3019', 'Q', '45687455', 'ELSA BEATRIZ MERCADO VILLADIEGO', '0000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor CARLOS EDUARDO ROMAN HERAZO', NULL, '2021-11-24', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor de cicatriz umbilical" se recibe una elipse de piel que mide 2 cms. presenta una lesión sobreelevada de 1 cm. Al corte una superficie lisa y blanquecina. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan tejido fibroconectivo en el que se identifican algunas glándulas de aspecto endometrial.\r\n\r\n\r\n\r\n', ' Lesión en cicatriz umbilical:\r\n-COMPATIBLE CON ENDOMETRIOSIS\r\n\r\n', '', ''),
	(1526, 'Q2110-3020', 'Q', '30772564', 'JOSEFA MARIA VELASCO MARRUGO', '00', 'F', '55', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 5 x 3 cms. tapizada parcialmente por una serosa de color pardo grisáceo. Al corte salida de material biliar y la presencia de un calculo de color amarillento y la mucosa presenta un punteado de color amarillento. \r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular e histiocitos espumosos subepiteliales.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLESTEROLOSIS\r\n-COLELITIASIS\r\n', '', ''),
	(1527, 'Q2110-3021', 'Q', '32687002', 'AURORA SANTIAGO HERRERA', '3008804176', 'F', '57', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-11-02', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 4 x 1.5 cms. tapizada parcialmente por una serosa de color pardo grisáceo. Al corte la pared se encuentra engrosada y la mucosa ha perdido su aspecto aterciopelado. No Se observan cálculos.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA ', '', ''),
	(1528, 'Q2110-3022', 'Q', '45556829', 'LEYDIS ROSA LOPEZ MORILLO', '000', 'F', '38', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 4 x 3 cms. tapizada parcialmente pro una serosa de color pardo grisáceo. Al corte salida de múltiples cálculos de color amarillento, la pared es adelgazada y conserva su aspecto aterciopelado. \r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan vesícula biliar que muestra edema y congestión de la pared, además infiltrado inflamatorio crónico.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n1.COLECISTITIS CRÓNICA\r\n2.COLELITIASIS', '', ''),
	(1529, 'Q2110-3023', 'Q', '23191559', 'YANINE PADILLA DURANT PADILLA', '000', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-10-22', '2021-10-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Epiplon" se recibe un fragmento de tejido de forma irregular de color amarillento que mide 15 x 7 cms. de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido adiposo maduro con congestión.\r\n\r\n\r\n\r\n\r\n', '-FRAGMENTO DE TEJIDO ADIPOSO MADURO\r\n\r\n\r\n', '', ''),
	(1530, 'Q2110-3024', 'Q', 'VEN31979284', 'SEBASTIAN ISAAC MARTINEZ ALCALA', '000', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-25', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Riñón izquierdo" se recibe el producto de una nefrectomía que pesa 231 gms. y mide 11 x 5 x 4 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por un tejido de color pardo oscuro y en la misma se observa una solución de continuidad en la cara posterior de forma irregular que mide 1.8 cms. en sus mayores dimensiones y muestra un material de sutura, en la cara anterior, hacia el polo inferior se encuentra otra solución de continuidad que mide 2.5 cms. en sus mayores dimensiones. Al corte todo el sistema pielocalicial contienen múltiples coágulos sanguíneos y se logra establecer una continuidad entre ambas soluciones de continuidad descritas. No se observan otras alteraciones anatómicas. Se toman cortes.\r\n\r\n', 'Los cortes muestran riñón cuya histomorfología es normal. Hay una zona de perdida de substancia con gran hemorragia que se extiende al sistema pielocalicial y al intersticio intertubular.\r\n\r\n\r\n', ' Nefrectomía izquierda:\r\n-PERFORACIÓN TRAUMÁTICA CON GRAN HEMORRÁGIA INTERSTICIAL Y PIELOCALICIAL\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(1531, 'Q2110-3025', 'Q', '34967869', 'EDITH EPIFANIA ORTEGA SANCHEZ', '000', 'F', '67', 'CLIN. SAN JOSE DE TORICES SAS', '', '898241', '69000', 'Doctor HERNAN CALDERON MORON', NULL, '2021-10-25', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Colon descendente" se recibe el producto de una colectomía parcial que mide 21 x 7 cms. La superficie externa es irregular, esta parcialmente cubierta por un tejido adiposo y una membrana irregular de color blanquecino. Al corte se encuentra que la luz esta expedita y en la periferia se encuentran múltiples estructuras saculares algunas de las cuales contienen material seropurulento y otras un material de aspecto necrótico. Macroscópicamente no se identifican una lesión neoplásica. Se toman que se rotulan A, se toman cortes de la línea de resección que se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes muestran colon cuya mucosa conserva su estructura habitual. Hay presencia en la periferia de estructuras saculares revertidas de mucosa colónica, algunas de estas muestran contenido de un exudado mediado principalmente por neutrófilos. Una de estas bolsas está rota con extensión del proceso inflamatorio a la grasa pericólica.\r\nNo se encuentran cambios neoplásicos. Las líneas de resección son viables.\r\n\r\n', ' Resección parcial de colon descendente:\r\n-ENFERMEDAD DIVERTICULAR\r\n-DIVERTICULITIS AGUDA CON FORMACIÓN DE ABSCESO\r\n-LÍNEAS DE RESECCIÓN VIABLES\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(1532, 'Q2110-3026', 'Q', '45456380', 'GLEVIS ESTHER CABEZA SIMANCAS', '000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-10-25', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 7 x 2 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida de color verde claro. Al corte las paredes son gruesas de aspecto fibroso,  la mucosa esta focalmente ulcerada y la luz contiene múltiples cálculos irregulares de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1533, 'Q2110-3027', 'Q', '9297525', 'ALEJANDRO TORRES ANGULO', '000', 'M', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-10-25', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 6.5 x 1.8 cms. La superficie externa está parcialmente cubierta por una serosa despulida de color pardo amarillento. Al corte las paredes son gruesas de aspecto fibroso, la mucosa es irregular con algunas excrecencias que se proyectan a la luz está contiene múltiples cálculos irregulares de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1534, 'Q2110-3028', 'Q', '22705557', 'SHIRLYS ROMERO GERONIMO', '0000', 'F', '37', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-10-25', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 3.5 x 2.2 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida de color verde grisáceo. Al corte las paredes son gruesas, aspecto fibroso y la  mucosa es aterciopelada con fino retículo de color amarillento. En la luz se encuentran pequeños cálculos facetados de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestra vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1535, 'Q2110-3029', 'Q', 'VEN32724842', 'WINDER JOSE QUILARQUEZ MEDINA', '3132064291', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor WILLIAN URIBE LUNA', NULL, '2021-11-02', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tejido oseo de tibia izquierda" se recibe un fragmento de hueso aplanado que mide 3 x 0.7 x 0.3 cms. en sus mayores dimensiones. Se toma parte y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por tejido oseo compacto que en un área muestra espículas desvitalizadas y rodeadas por tejido fibroso con infiltración por linfocitos y neutrófilos.\r\nNo hay cambios neoplásicos en la muestra.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en tibia izquierda:\r\n-OSTEOMIELITIS CRÓNICA', '', ''),
	(1536, 'Q2110-3030', 'Q', '1047418712', 'ZORAIDA ISABEL ALARCON CAMARGO', '3008384034', 'F', '31', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-10-25', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Pólipos de colon transverso" se reciben cuatro fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que promedian un diámetro de 0.4 cms.  Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de una estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n\r\n', ' Resección de pólipo en colon transverso:\r\n-ADENOMA TUBULAR (FRAGMENTOS)\r\n\r\n', '', ''),
	(1537, 'Q2110-3031', 'Q', '45420568', 'LUZMILA DAZA VILLADIEGO', '3176587480', 'F', '65', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-25', '2021-10-22', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1538, 'Q2110-3032', 'Q', '9081457', 'CESAR EDUARDO SANCHEZ VERGARA', '3215398814', 'M', '69', 'PARTICULAR', 'C.', '898201', '30215', 'Doctores ANTONIO MARIA MARTINEZ - ALONSO CORTINA', NULL, '2021-11-02', '2021-10-26', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de musculo tercio distal de miembro superior izquierdo" un fragmento de tejido fijado en un bajalengua con 2 agujas hipodérmicas mide 1.5 x 1 x 0.3 cms. es de color blanquecino con áreas amarillentas. Se toman un corte transversal al eje mayo y el resto del tejido en forma longitudinal. Se toman corte así: A1 corte transversal, A2 cortes longitudinal.\r\n2. "Biopsia de musculo de tercio próximo de muslo izquierdo" un fragmento de tejido de forma irregular de color pardo claro con áreas amarillentas que mide 1 x 0.7 x 0.3 cms. Se toma un corte transversal al eje mayor y B2 el resto se lámina longitudinal.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejidos fibroso y adiposo que contienen múltiples fibras nerviosas y vasos sanguíneos. No hay presencia de musculo estriado en las muestras.\r\n\r\n\r\n\r\n', '1.Biopsia de tercio distal de miembro superior izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.Biopsia de tercio proximal de muslo izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1539, 'Q2110-3033', 'Q', '30772779', 'NICOLASA DEL CARMEN ALCALA CABARCAS', '3158446940', 'F', '56', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. No se observa H.pylori, atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1540, 'Q2110-3034', 'Q', '1143395102', 'DANIEL ESTEBAN PEREZ LONDOÑO', '3014269420', 'M', '25', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-02', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 y 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan mucosa esofágica constituida por epitelio escamoso hiperplásico densamente infiltrado por eosinófilos, en algunos campos sobrepasa el número de cien, se observa además escasos neutrófilos.\r\nLos cortes B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-COMPATIBLE CON ESOFAGITIS EOSINÓFILICA\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1541, 'Q2110-3035', 'Q', '45522349', 'YAJAIRA BLANQUICETH GUZMAN', '3175388523', 'M', '42', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-11-03', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un fragmento de tejido mamario y aspecto fibroadiposo, de forma alargada que mide 8 x 2 cms. Al corte una superficie de color amarillento que alternan con áreas de color oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido mamario que muestra espacios quísticos, algunos con un material eosinofílico en su interior, rodeado de un denso infiltrado inflamatorio mediado por linfocitos, histiocitos y neutrófilos. No se observó tumor en la muestra enviada.\r\n\r\n\r\n', ' Extirpación de lesión en mama izquierda:\r\n-GALACTOCELE \r\n-MASTITIS AGUDA Y CRÓNICA', '', ''),
	(1542, 'Q2110-3036', 'Q', '10545033', 'JORGE HUMBERTO BAYONA BOTERO', '3007040142', 'M', '57', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-02', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes de A revelan esófago con metaplasia cilíndrica y la presencia de células caliciformes.\r\nLos cortes de B revelan estómago cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación de acúmulos linfoides. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes de C revelan duodeno cuya lámina propia es levemente inflamatoria y esta infiltrada por linfocitos y plasmocitos en moderada cantidad. No se observan parásitos intestinales, granulomas ni cambios displásicos en la muestra enviada.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGO DE BARRETT\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA CON ACTIVIDAD INFLAMATORIA LEVE\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA MODERADA', '', ''),
	(1543, 'Q2110-3037', 'Q', '1002391735', 'NATALY PAOLA GUERRERO ARELLANO', '3188306185', 'F', '19', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1544, 'Q2110-3038', 'Q', '1042581456', 'LAURA VANESSA VENECIA PIMIENTA', '3103669700', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa en mama izquierda" se recibe una masa de tejido de forma ovoide de color amarillento y consistencia elástica que mide 4.5 x 4 x 3 cms. Al corte una superficie nodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido mamario con un tumor benigno que muestra elementos glandulares y estromales donde predomina una proliferación de pequeños espacios glandulares tapizados por dos hileras celulares y presencia de células mioepiteliales.\r\n\r\n\r\n\r\n  ', ' Extirpación de lesión en mama izquierda:\r\n-FIBROADENOMA JUVENIL\r\n\r\n', '', ''),
	(1545, 'Q2110-3039', 'Q', '104400887', 'ANTONELLA PAJARO GRAU', '3216200222', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una masa de tejido de forma ovoide que mide 2.5 x 1.5 x 1 cms. de color blanco amarillento y consistencia elástica. Al corte una superficie de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una masa de tejido de forma ovoide que mide 2.3 x 2 x 1 cms. de color blanco amarillento y consistencia elástica. Al corte una superficie de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular de color blanquecino que mide 1 x 1 cms. Se toman cortes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes de C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(1546, 'Q2110-3040', 'Q', '1143340602', 'ASTRID CAROLINA GOMEZ OLEA', '3217675998', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda el mayor mide 0.4 cms. y el menor de 0.1 cm. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(1547, 'Q2110-3041', 'Q', '1142939017', 'SHAIRA SOFIA MALDONADO JULIO', '3003973493', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1548, 'Q2110-3042', 'Q', '1103507527', 'SNEIDER DAVID DIAZ HERNANDEZ', '3043700089', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nlos cortes B revelan mucosa duodenal cuya lámina propia es ligeramente edematosa infiltrada pro linfocitos, plasmocitos en moderada cantidad, en la muestra no se observan parásitos intestinales.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA, LEVE', '', ''),
	(1549, 'Q2110-3043', 'Q', 'VEN7445644', 'REINNELA MARIA CHIQUINQUIRA ROMERO QUINTERO', '3246642436', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 x 1 cms. la serosa es opaca y despulida. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1550, 'Q2110-3044', 'Q', '1143385934', 'JESUS DAVID JIMENEZ PEREZ', '3013452514', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Papilomas laríngeos" se reciben múltiples fragmentos de tejido de forma irregular de color blanquecino y que juntos promedian 1.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Múltiples fragmentos de epitelio escamoso hiperplasico con áreas de acantosis papilomatosos que descansan en un tallo fibrovascular.\r\n\r\n\r\n\r\n', '-PAPILOMAS LARINGEOS, (múltiples fragmentos)\r\n\r\n', '', ''),
	(1551, 'Q2110-3045', 'Q', '1048441073', 'JHOWER GOMEZ BARRIOS', '3218450903', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. cubierta por una serosa opaca, despulida. Al corte salida de un material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1552, 'Q2110-3046', 'Q', '1043326042', 'SANTIAGO AYOLA BELLO', '3013948469', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una masa de tejido de forma ovoide de consistencia elástica que mide 1.8 x 1.7 cms. Al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una masa de tejido de forma ovoide de consistencia elástica que mide 2 x 2.1 cms. Al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMÍGDALITIS CRÓNICA', '', ''),
	(1553, 'Q2110-3047', 'Q', 'VEN310', 'KEILI ZARITMA LOPEZ HERRERA', '3042148089', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es de color pardo oscuro y recubierta por un material fibrinopurulento. Al corte la luz cubierta por una blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1554, 'Q2110-3048', 'Q', '9096132', 'GUSTAVO MONSALVE DIAZ', '3012473056', 'M', '49', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ADRIANA LOPEZ CELEDON', NULL, '2021-10-29', '2021-10-26', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. con abundante meso, la serosa es opaca, despulida y ricamente vascularizada. Al corte la luz cubierta por material oscuro. Se toman cortes .\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n', '', ''),
	(1555, 'Q2110-3049', 'Q', '52267953', 'JIOVANNA CANTILLO CANTILLO', '3135485867', 'F', '47', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', '', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Granuloma" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo y consistencia blanda que mide 0.8 x 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido de granulación densamente infiltrado por PMN neutrófilos, linfocitos y células plasmáticas.\r\n\r\n\r\n\r\n', ' Extirpación de lesión polipoide*:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA (GRANULOMA PIOGENO)\r\n\r\n\r\n\r\n*Sitio anatómico no especificado.\r\n', '', ''),
	(1556, 'Q2110-3050', 'Q', '9086293', 'ROBERTO ANTONIO BORDA MARTELO', '3105834572', 'M', '67', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-11-02', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia elástica que mide 0.5 x 0.3 cms. en sus mayores dimensiones. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con un tumor epitelial compuesto por células pequeñas, basaloides que se disponen en nidos sólidos y cordones con empalizada periférica. El tumor está ulcerado.\r\n\r\n\r\n\r\n', ' Biopsia incisional de lesión en mejilla derecha:\r\n-CARCINOMA BASOCELULAR\r\n\r\n', '', ''),
	(1557, 'Q2110-3051', 'Q', '1148186752', 'ADONAI ANDRES EPIEYU', '3113199908', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.5 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz es puntiforme.  Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1558, 'Q2110-3052', 'Q', '1043328725', 'IVAN JUNIOR ROJANO ZUÑIGA', '3006469315', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en sus mayores dimensiones. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en sus mayores dimensiones. Se toma todo y se rotulan B.\r\n3. "Colon" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.6 cms. en sus mayores dimensiones. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal que conserva la morfología habitual. No se observan parásitos, granulomas ni cambios displásicos.\r\nLos cortes rotulados C muestran mucosa colónica cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. No se observa parásitos, granulomas, disminución del moco ni cambios displásicos.\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS\r\n3.Biopsia endoscópica de colon:\r\n-COLITIS CRÓNICA INESPECIFICA', '', ''),
	(1559, 'Q2110-3053', 'Q', '1048601537', 'LILIBETH TORREGLOSA CANOLES', '3205186844', 'F', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 4 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', '-APENDICE CECAL', '', ''),
	(1560, 'Q2110-3054', 'Q', '33136321', 'KETY MARIA CORREA DE ACOSTA', '3106112575', 'F', '72', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-11-02', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color pardo amarillento y consistencia elástica que mide 4.2 x 3 x 1.2 cms. Al corte se observa una superficie de color pardo amarillento que alternan con áreas de color pardo oscuro finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido mamario cuya morfología está alterada por la presencia de quistes de pequeño y mediano calibre que reposa en un estroma fibroso-colagenizado. No se observan cambios proliferativos ni de papiloma intraductal.\r\n\r\n\r\n\r\n', ' Biopsia de mama izquierda:\r\n-CONDICIÓN FIBROQUISTICA\r\n', '', ''),
	(1561, 'Q2110-3055', 'Q', '45527056', 'SHIRLYS DEL CARMEN CONTRERAS AMARANTO', '000', 'F', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'ORG.  CLÍNICA GENERAL DEL NORTE', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Masa en seno izquierdo" se recibe un fragmento de tejido de forma irregular, de color pardo claro y consistencia elástica que mide 3 x 1.8 x 2 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por un fragmento de piel de forma irregular que mide 2.5 x 1.5 cms. Al corte se observa una superficie de color pardo claro que alternan con áreas de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido mamario cuya morfología está alterada por la presencia de quistes de mediano calibre que reposan en un estroma fibroso colagenizado. No se observan cambios proliferativos.\r\n\r\n\r\n\r\n', ' Resección de masa en región axilar izquierda:\r\n-TEJIDO MAMARIO CON CAMBIOS DE CONDICIÓN FIBROQUISTICA', '', ''),
	(1562, 'Q2110-3056', 'Q', '30898497', 'GREGORIA ROMERO JULIO', '000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Dcotor SAMUEL CANTILLO VILLAR', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Utero" un cuerpo uterino que pesa 156 gms. y mide 7.5 x 8 x 5.5 cms. La superficie externa esta parcialmente cubierta por una serosa y al corte la cavidad endometrial esta tapizada por una mucosa delgada de color rosado, el miometrio esta ocupado por múltiples masas de color blanquecino y aspecto arremolinado la mayor 1.5 cms. y la menor de unos pocos milímetros de localización intramural y subserosa. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" una trompa de Falopio que conserva la morfología habitual mide 4.8 x 0.6 cms. La superficie externa esta cubierta por una serosa lisa y brillante y al corte la morfología habitual. Se toman cortes y se rotulan B.\r\n3. "Trompa izquierda" un segmento de trompa de Falopio que mide 3 x 0.8 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte conserva la morfología habitual. Se toman cortes y se rotulan C.\r\n\r\n', 'los cortes rotulados A muestran endometrio autólisado. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente.\r\nlos cortes rotulados B y C muestran trompas de Falopio que conservan la morfología habitual.\r\n\r\n\r\n', ' Histerectomía abdominal subtotal con salpingectomía bilateral:\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO', '', ''),
	(1563, 'Q2110-3057', 'Q', '803126921032000', 'ARGERLIS CAROLINA GUERRA HERRERA', '3046760249', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-11-12', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero" se recibe un utero que pesa 1629 gms. y mide 19.5 x 19 x 14.5 cms. El cérvix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta aumentado de tamaño y deformado. Al corte la cavidad endometrial esta tapizada por una mucosa delgada  el miometrio esta ocupado por una gran masa de color rojo oscuro y aspecto carnoso que mide 13.5 x 10 x 15 cms. de localización submucosa e intramural. Se toman cortes de  la masa y el cérvix se lamina e incluye en su totalidad.\r\nEn el mismo recipiente, se recibe además una trompa de Falopio que mide 5.7 x 0.5 cms. La superficie externa esta cubierta por una serosa lisa y brillante y al corte conserva la morfología habitual. Se toman cortes.\r\nUn segundo recipiente, rotulado "Trompa izquierda" un segmento de trompa de Falopio que mide 6 x 0.8 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Se toman cortes.\r\n\r\n\r\n', 'Los múltiples cortes del cérvix muestran una reacción inflamatoria crónica y cambios citopáticos por VPH. El endometrio está  autólisado. La masa endometrial descrita está compuesta por fibras musculares lisas con atipias focales que se disponen en haces entrelazadas y ovillos. No se observan mitosis ni áreas de necrosis.\r\nLas trompas de Falopio conservan la morfología usual.\r\n\r\n\r\n', ' Histerectomía abdominal total con salpingectomía bilateral:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMA SUBMUCOSO CON ATIPIAS FOCALES\r\n-TROMPAS DE FALOPIO', '', ''),
	(1564, 'Q2110-3058', 'Q', '73115940', 'LUIS EDUARDO VALDELAMAR NAVARRO', '3157213174', 'M', '56', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1565, 'Q2110-3059', 'Q', '45420079', 'LUZMILA RODRIGUEZ CONTRERAS', '3007449936', 'F', '66', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1566, 'Q2110-3060', 'Q', '9172360', 'JUAN ALBERTO PERTUZ VERGARA', '000', 'M', '61', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1567, 'Q2110-3061', 'Q', '11296616', 'ARNULFO NAVARRETE BARRETO', '3114152122', 'M', '68', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo. \r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica antral cuya lámina propia está edematosa, congestiva e infiltrada por polimorfonucleares neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). Hay focos de metaplasia intestinal completa. No hay atrófia,  ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA Y FOCOS DE METAPLASIA INTESTINAL COMPLETA', '', ''),
	(1568, 'Q2110-3062', 'Q', '1144630112', 'VALERIA GAVIRIA TRIBIÑO', '3204639500', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.2 x 0.9 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1569, 'Q2110-3063', 'Q', '1043320893', 'SHARIN MILAGROS CASTRO BERRIO', '3017154000', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.8 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulento. Al corte la pared esta engrosada y la luz contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n', '', ''),
	(1570, 'Q2110-3064', 'Q', '1049539760', 'JERONIMO CARRILLO MACEA', '3003276443', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice preauricular izquierda" se recibe una estructura de forma irregular de color pardo claro y consistencia elástica que mide 1.2 x 0.7 cms. la superficie externa esta cuberita por piel casi en su totalidad y se observa una superficie homogénea de color pardo claro. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por piel que rodea un núcleo de tejido adiposo.\r\n\r\n\r\n\r\n\r\n', '-APENDICE PREAURICULAR IZQUIERDA', '', ''),
	(1571, 'Q2110-3065', 'Q', '30771631', 'NORA ESTHER MORALES MARTINEZ', '0000', 'F', '57', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-11-02', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de ganglio de cuello" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia elástica que mide 1.5  x0.8 x 0.5 cms. Al corte se observa una superficie de color pardo oscuro finamente granular. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por tejido fibroadiposo moderadamente vascularizado. No se identifica ganglio linfático en la muestra.\r\n\r\n\r\n\r\n', ' Biopsia de nódulo en cuello:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1572, 'Q2110-3066', 'Q', '45758874', 'RODMIRIS CARDONA CABARCAS', '000', 'F', '45', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2021-10-29', '2021-10-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero, trompa y cuello" se recibe un utero con sus trompas de Falopio que pesa 139 gms. y mide 10.3 x 7 x 5.5 cms. El cérvix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta ligeramente aumentado de tamaño y deformado. La trompa derecha mide 5.5 x 0.8 cms. La izquierda mide 7.5 x 1 cms. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizada por una mucosa gruesa de color rosado y el miometrio esta ocupado por múltiples masas de color blanquecino y aspecto arremolinado, la mayor mide 1.5 cms. y la menor de unos pocos milímetros de localización intramural y subserosa. Al corte las trompas conservan la morfología habitual. Se toman cortes.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio está autólisado. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente. Las trompas conservan la morfología habitual.\r\n\r\n\r\n', ' histerectomía abdominal total con salpingectomía bilateral:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO', '', ''),
	(1573, 'Q2110-3067', 'Q', '1007660740', 'JAVIER TORRES MARTYUS', '3157237419', 'M', '20', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE Y H.PYLORI PRESENTE', '', ''),
	(1574, 'Q2110-3068', 'Q', '33121676', 'JULIA DE LA CRUZ LOPEZ DE DAVILA', '3157311819', 'F', '74', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1575, 'Q2110-3069', 'Q', '9097207', 'ROBERTO CARLOS PELAEZ BENEDETTY', '3202305262', 'M', '44', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA Y H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(1576, 'Q2110-3070', 'Q', '1142918220', 'JORDY DE JESUS RICO ALVAREZ', '3106474600', 'M', '14', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'E n recipientes  separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan D.\r\n\r\n\r\n', 'Los cortes de A revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B muestran cuerpo gástrico cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes de C y D revelan duodeno cuya lámina propia es edematosa, congestiva con un infiltrado mononuclear moderado. No se observa atrófia ni parásitos intestinales.\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE Y H.PYLORI PRESENTE\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de bulbo:\r\n-DUODENITIS CRÓNICA\r\n4.Biopsia endoscópica de segunda porción:\r\n-DUODENITIS CRÓNICA', '', ''),
	(1577, 'Q2110-3071', 'Q', '45555854', 'VANESA TORRES PADILLA', '3107713467', 'F', '38', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Cuadrante superior externo de mama izquierda" se recibe una mas irregular de tejido que mide 5 x 3 x 3 cms. en un extremo marcado con seda. Al corte una superficie lisa, blanco amarillento a 1.5 cms. de la seda se observa una formación nodular que mide 2 x 1.5 cms. Se toman cortes y se rotulan A y B el sitio marcado con seda.\r\n\r\n\r\n\r\n', 'Los cortes revelan mama con tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de cuadrante super externo de mama izquierda:\r\n-FIBROADENOMA', '', ''),
	(1578, 'Q2110-3072', 'Q', '1044015789', 'DARYEL CASTILLO MARRUGO', '3213561356', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglio mesentérico" se recibe una formación nodular que mide 1  x 0.5 cms. de color blanquecino y consistencia elástica. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan ganglio linfático que muestra folículos linfoides de diferentes tamaños y formas con polarización del manto. No se observan cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de ganglio mesentérico:\r\n-HIPERPLASIA FOLICULAR REACTIVA', '', ''),
	(1579, 'Q2110-3073', 'Q', '1001978864', 'WILMER JOSE CARABALLO CARRILLO', '3106724072', 'M', '18', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-11-08', '2021-10-29', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Epidídimo derecho" formación nodular que mide 1.5 x 1 cms. de color pardo grisáceo. Al corte una superficie lisa. Se toman cortes y se rotulan A.\r\n2. "Epidídimo izquierdo" un fragmento irregular de tejido que mide 2 x 1.5 cms. de color blanquecino y consistencia elástica. Al corte una superficie multinodular de color blanquecino. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B muestran epidídimo con edema, congestión un infiltrado inflamatorio mixto severo con formación de absceso.\r\n\r\n\r\n\r\n', '-EPIDIDIMITIS AGUDA, epidídimo derecho e izquierdo', '', ''),
	(1580, 'Q2110-3074', 'Q', '1043645881', 'BRIYITH PAOLA PRADA HERRERA', '3216633034', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Cuadrante superior de quiste de mama derecha" se recibe una formación nodular que mide 2 x 2 x 1 cms. de consistencia elástica. Al corte una superficie lisa y blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en cuadrante superior en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(1581, 'Q2110-3075', 'Q', '1047402536', 'JUAN DAVID MONTOYA GONZALEZ', '3058781388', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-11-19', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Testículo derecho" se recibe un testículo y elementos del cordón, el testículo mide 6 x 5 x 3 cms. El segmento del cordón mide 5 cms. de color pardo grisáceo y bien vascularizado. Al corte el testículo esta reemplazado por una masa multinodular de color blanquecino que mide 4 x 3 x 2 cms. Se rotulan así: A1 tumor, B epidídimo, C conducto deferente.\r\n\r\n\r\n\r\n', 'Los múltiples cortes revelan testículo con tumor germinal compuesto por elementos mesenquimales representados por cartílago en diferentes fases maduración, epitelio escamoso que forma quíste con contenido de queratina. no se identifica elementos inmaduros. \r\nNo se identifican extensión tumoral fuera de la túnica vaginal, hay elementos propios del testículo y del epidídimo esté último libre de tumor.\r\nLa línea de resección (cordón espermático) está libre de tumor.\r\n\r\n', ' Orquiectomía derecha:\r\n-TERATOMA MADURO\r\n-VOLUMEN TUMORAL 6 x 5 x 3 cms.\r\n-LINEA DE RESECCIÓN LIBRE DE TUMOR\r\n-TUMOR LIMITADO AL TESTICULO\r\n\r\n\r\n', '', 'Es importante practicar estudios de inmunocitoquímica para mayor precisión diagnóstica.\r\nCaso visto en conjunto con los doctores José Caraballo y Ana Manga.\r\n\r\n\r\nNOTA: Se retiran 10 bloques por el señor OSCAR CABRERA MIRANDA (Mensajero) 73.115.091 (19/Nov/2021)'),
	(1582, 'Q2110-3076', 'Q', '1137524940', 'NICOL CAROLINA VEGA MATURANA', '3205823875', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898241', '69000', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de fémur derecho" se reciben fragmentos irregulares de espículas oseas que miden 1 x 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan espículas oseas desvitalizadas y tejidos blandos con inflamación crónica.\r\n\r\n\r\n\r\n', ' Biopsia de fémur derecho:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(1583, 'Q2110-3077', 'Q', '45561430', 'BETTY ESTHER PUERTA ROMERO', '3148260773', 'F', '50', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-02-04', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Cuadrante inferior interno de mama izquierda" se reciben dos fragmentos el mayor mide 5 x 3.5 x 2 cms. y el menor de 3.5 x 2 x 1 cms. de consistencia blanda y aspecto adiposo de color amarillento el mayor trae una elipse de piel de 2 cms. Al corte una superficie lisa de aspecto adiposo el menor presenta una formación nodular que mide 1 x 0.5 cms. Se toman cortes del mayor y se rotulan A, B fragmento menor.\r\n\r\n\r\n', 'Los cortes de A revelan en su mayoría tejido adiposo con escasos canalículos.\r\nlos cortes B revelan un tumor epitelial maligno constituido por nidos sólidos de núcleos pleomórficos, hipercromáticos con figuras de mitosis anormales que infiltran el estroma. No se identifica invasión linfovascular.\r\nEl tumor toca focalmente un borde de resección.\r\n\r\n', ' Cuadrante inferior interno de mama izquierda:\r\n-CARCINOMA CANALICULAR NO ESPECIAL INFILTRANTE GRADO 3 (NOTTINGHAM TUBULOS 3, NUCLEO 3 Y MITOSIS 2)\r\n-VOLUMEN TUMORAL 1 x 0.5 cms.\r\n-NO INVASIÓN LINFOVASCULAR\r\n-BORDE DE RESECCIÓN COMPROMETIDO\r\n\r\nNOTA: Se retiran 7 bloques por señora KARINA MORALES PUERTA CC. 1.047.458.317 (4/febrero/2022)\r\n', '', ''),
	(1584, 'Q2110-3078', 'Q', '49776825', 'ELIZABETH PASCO OSORIO', '000', 'F', '46', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-11-02', '2021-10-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero" se recibe un cuerpo uterino que pesa 326 gms. y mide 15 x 10 x 8 cms. tapizado por una serosa de color pardo claro y deformado por múltiples masas subserosas. Al corte la cavidad esta dilatada y ocupada por dos masas que miden la mayor 3 x 3 x 3 cms. y la menor de 3 x 2 cms. de color blanquecinas de aspecto arremolinado, de consistencia elástica. En el miometrio se observan múltiples masas ovoides, blanquecinas y aspecto arremolinado, la mayor mide 4 x 3 cms. y la menor de 1 x 0.5 cms. a nivel subseroso se observan múltiples masas de iguales características. Se toman cortes.\r\nNo se reciben trompas de Falopio.\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino que presenta múltiples leiomiomas submucosos, intramurales y subserosos, el endometrio está autólisado.\r\n\r\n\r\n\r\n', ' Utero (326 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS INTRAMURALES Y SUBSEROSOS\r\n', '', ''),
	(1585, 'Q2111-3079', 'Q', '3881879', 'MANUEL ANTONIO GUERRERO GUERRERO', '000', 'M', '67', 'PARTICULAR', '', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1586, 'Q2111-3080', 'Q', '1044930045', 'YASMITH JINETE GARRIDO', '000', 'F', '26', 'PARTICULAR', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de vulva" un fragmento de tejido de forma irregular de color gris y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Biopsia de exocervix" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan epitelio escamoso hiperplasico con cambios coilociticos asociados.\r\nLos cortes B revelan cervix tapizado por epitelio escamoso con cambios coilociticos asociados, el estroma muestra un infiltrado inflamatorio mixto mediado por linfocitos, plasmocitos y neutrófilos.\r\n\r\n\r\n', '1.Biopsia de vulva:\r\n-CONDILOMA\r\n2.Biopsia de cervix:\r\n-LIE DE BAJO GRADO (CONDILOMA PLANO)\r\n\r\n', '', ''),
	(1587, 'Q2111-3081', 'Q', '33339440', 'KATIA BERNARDA RODRIGUEZ YEPES', '000', 'F', '53', 'PARTICULAR', '', '898201', '30215', 'Doctora MANUELA BERROCAL REVUELTAS', NULL, '2021-11-05', '2021-11-04', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Capsula periprotésica mama derecha" un fragmento de tejido de aspecto fibroadiposo de color blanquecino y forma sacular mide 15 x 14 cms. en su mayor dimensión, presenta un área blanquecina de aspecto fibroso, el resto del tejido delgado de color amarillento. Se toman cortes y se rotulan A.\r\n2. "Capsula periprotésica mama izquierda" un fragmento de tejido de aspecto fibroadiposo de color blanquecino y forma sacular mide 15 x 13 cms. en su mayor dimensión, presenta un área blanquecina de aspecto fibroso, el resto del tejido delgado de color amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran una pared fibrosa delgada que en una de sus caras contiene elementos propios del tejido mamario y en la otra focos de metaplasia sinovial. No hay cambios inflamatorios ni neoplásicos.\r\n\r\n\r\n\r\n', '1.Resección de capsula periprotésica de mama derecha:\r\n-PARED FIBROSA CON FOCOS DE METAPLASIA SINOVIAL\r\n\r\n2.Resección de capsula periprotésica de mama izquierda:\r\n-PARED FIBROSA CON FOCOS DE METAPLASIA SINOVIAL\r\n\r\n', '', ''),
	(1588, 'Q2111-3082', 'Q', '30768137', 'ISABEL SARMIENTO GONZALEZ', '3137898853', 'F', '68', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Fragmento polipo endocervical" se recibe un fragmento de aspecto mucoide que mide 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL', '', ''),
	(1589, 'Q2111-3083', 'Q', '30761407', 'YOMAIRA DE JESUS ACEVEDO GONZALEZ', '3114146679', 'F', '59', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Fragmento de lesión polipoide en vagina" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan una proliferación de capilares rodeados de un infiltrado inflamatorio agudo severo mediado por neutrófilos.\r\n\r\n\r\n\r\n', '-HEMANGIOMA CAPILAR TIPO GRANULOMA PIOGENO, vagina\r\n\r\n', '', ''),
	(1590, 'Q2111-3084', 'Q', '1041982384', 'SANDY CAOLINA VANEGAS DURANGO', '3015750637', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es grisácea y congestiva. Al corte la luz ocupada pro material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', '-APENDICE CECAL CON HIPERPLASIA FOLICULAR REACTIVA', '', ''),
	(1591, 'Q2111-3085', 'Q', '1043303174', 'LEIDY LAURA BUELVAS LOPEZ', '3116313141', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nevo región supra labial derecha" se recibe un punch de piel de color pardo oscuro que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso, el dermis muestra lesión tumoral constituida por una proliferación de células nevicas dispuestas en nidos, hay abundante pigmento melánico, la lesión toca el borde profundo de resección.\r\n\r\n\r\n', ' Extirpación de lesión piel en región supra labial derecha:\r\n-NEVUS MELANOCITICO INTRADERMICO', '', ''),
	(1592, 'Q2111-3086', 'Q', 'VEN9670042', 'DIONEIKER DAVID CARVAJAL CHAVEZ', '3232964317', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-16', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa cervical izquierda" se recibe una masa multilobulada de color pardo grisáceo y consistencia elástica que mide 6 x 4.5 x 3.5 cms. Al corte es de color blanco amarillento muestra áreas de aspecto quístico con salida de material de aspecto gomoso. Se toman cortes.\r\n\r\n\r\n', 'Lesión tumoral germinal benigna constituida por piel y anexos dérmicos, tejido adiposo maduro, epitelio respiratorio. No se observan elementos inmaduros en la muestra.\r\n\r\n\r\n\r\n\r\n', '-TERATOMA MADURO, región cervical izquierda', '', ''),
	(1593, 'Q2111-3087', 'Q', '1050979796', 'HADER DAVID TORRES DE AVILA', '3145050335', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-01-04', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de piel de parpado izquierdo"  se recibe un punch de piel de forma redondeada que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel cuya epidermis está aplanada a expensas de una proliferación de células mononucleares atípicas algunas con citoplasma claro, que se distribuyen en un patrón sólido, ocupa el dermis papilar y en algunas áreas toca el dermis reticular, hay focos de migración epidérmica de las células descritas.\r\n\r\nOBSERVACIONES: Los hallazgos descritos son altamente sugestivos de un proceso neoplásico de probable origen linfo-reticular. Es imprescindible la practica de estudios de inmunohistoquímica para definición diagnóstica.\r\n\r\n ', ' Biopsia de lesión en piel de parpado ojo izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\nEste caso fue visto en conjunto con los doctores José Caraballo y Oliva Marrugo.\r\n\r\nSe retira 1 bloque por la señora HERLYS DE AVILA CC. 1.050.957.608 (4/enero/2022)', '', ''),
	(1594, 'Q2111-3088', 'Q', '1142938033', 'ISAIAS CABEZA MEJIA', '3002401851', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Lesión quística en pabellón auricular izquierdo" se recibe un fragmento de tejido de forma redondeada que mide 1 cm. de color blanquecino. Al corte pequeña cavidad quística y salida de material blanquecino. Se toma todo.\r\n\r\n\r\n\r\n', 'Lesión quística tapizada por epitelio escamoso conteniendo queratina laminar, rodeado de tejido fibroso con la presencia de células gigantes a cuerpo extraño.\r\n\r\n\r\n\r\n', '-QUÍSTE EPIDERMICO DE INCLUSIÓN ROTO, pabellón auricular izquierdo', '', ''),
	(1595, 'Q2111-3089', 'Q', '1042585002', 'DANNAIS DANIELA VEGA PABUENA', '3107039065', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 cms. la serosa es opaca, despulida. Al corte la luz ocupada pro material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1596, 'Q2111-3090', 'Q', '1038263194', 'SHIRLEY SOFIA LEON ZULUAGA', '3042104162', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Lipoma interescapular" se recibe una mas de tejido de forma ovoide y aspecto fibroadiposo, consistencia elástica que mide 7 x 5 cms. tapizada por una elipse de piel que mide 4 x 5 cms. Al corte superficie multinodular de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', '-LIPOMA, región interescapular ', '', ''),
	(1597, 'Q2111-3091', 'Q', '1047489846', 'JHON DAVID CHICO MARTINEZ', '3014129370', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 cms. la serosa es grisácea y congestiva, la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1598, 'Q2111-3092', 'Q', '1042609099', 'SANTIAGO JOSE DIAZ CAMARGO', '3148147501', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una masa de tejido de forma ovoide que mide 3 x 1.5 x 1.5 cms. Al corte una superficie multinodular de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una masa de tejido de forma ovoide que mide 3 x 1.7 x 1.5 cms. Al corte una superficie multinodular de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 2  x 1 cms. Se toman cortes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes de C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA', '', ''),
	(1599, 'Q2111-3093', 'Q', '1007376043', 'CRISTIAN RAFAEL MERCADO TRUJILLO', '3024609337', 'M', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es de color grisáceo y congestiva. Al corte la luz ocupada por material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1600, 'Q2111-3094', 'Q', 'VEN247938809', 'MARIA ANDREINA CARMONA LOPEZ', '000', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JOSE BLANCO RICARDO', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Embarazo ectópico roto derecho" se recibe fragmento de tejido de color pardo oscuro tapizado parcialmente por una serosa de color pardo claro, el fragmento mide 6.5 x 4 x 2 cms. Acompañado a esto fragmento de tejido de color oscuro el mayor mide 3 cms. y el menor de 0.5 cms. Al corte la luz ocupada por material hemorrágico de color oscuro. Se toman cortes.\r\n\r\n\r\n', 'Trompa de Falopio cuya luz está ocupada por coágulos sanguíneos y vellosidades coriales que en algunas áreas infiltran la pared.\r\n\r\n\r\n\r\n\r\n', '-EMBARAZO TUBARICO, derecho', '', ''),
	(1601, 'Q2111-3095', 'Q', '73207061', 'QUERUBIN ALEJANDRO CORVIS TORRES', '3504140505', 'M', '38', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.5 cms. la serosa es opaca, despulida de color oscuro. Al corte la luz ocupada pro material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1602, 'Q2111-3096', 'Q', '30871105', 'MAYGUALIDA HERNANDEZ CABARCAS', '000', 'F', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor RAFAEL DIAZ MONROY', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben fragmentos de tejido de color oscuro de aspecto membranoso que juntos miden 4 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-RESTOS OVULARES', '', ''),
	(1603, 'Q2111-3097', 'Q', '1002488092', 'EDILSA SANCHEZ VANEGAS', '3103744264', 'F', '19', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor RAUL MOGOLLON SAKER', NULL, '2022-01-13', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Placenta" se recibe una placenta que pesa 485 gms. y mide 15 x 15 x 4 cms. Trae adherido segmento de cordón umbilical que mide 39 cms. La cara materna está representada por múltiples cotiledones de color pardo claro, la cara fetal de aspecto membranoso. Al corte la placenta de color pardo rosado y muestra la estructura usual. Al corte del cordón umbilical está representado por tres vasos. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta del tercer trimestre con vellosidades que muestran un infiltrado mononuclear del estroma, focos de fibrosis y alteración de la pared de algunos vasos. No se encuentran inclusiones de citomegalovirus (CMV). El cordón tiene 3 vasos.\r\n\r\n\r\n\r\nCOMENTARIO: La ausencia de inclusiones no descarta una infección por CMV. En un embarazo avanzado generalmente no se encuentran y los cambios son inespecíficos.\r\n\r\n\r\n', ' Placenta del tercer trimestre (485 gms.):\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO', '', ''),
	(1604, 'Q2111-3098', 'Q', '63457456', 'CLAUDIA VICTORIA GARCIA RINCON', '3143368104', 'F', '52', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1605, 'Q2111-3099', 'Q', '30771311', 'ITAMAR DE JESUS GUERRA DIAZ', '3023078356', 'F', '57', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1606, 'Q2111-3100', 'Q', '407055', 'ANTHONY FERNANDO DISCEPOLO DISCEPOLO', '3007651890', 'M', '64', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1607, 'Q2111-3101', 'Q', '6812505', 'HERNAN NOVOA SALCEDO', '3113671188', 'M', '71', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Polipos de cuerpo gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago (cuerpo):\r\n-PÓLIPO DE GLÁNDULAS FÚNDICAS', '', ''),
	(1608, 'Q2111-3102', 'Q', '1050484596', 'DEIBYMAR NAZARETH MENDOZA MONROY', '3016647196', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa en mama derecha" se recibe una masa de tejido de forma ovoidea, de color blanquecino y consistencia elástica que mide 2.7 x 1.7 x 1.5 cms. Al corte una superficie de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', '-FIBROADENOMA, mama derecha', '', ''),
	(1609, 'Q2111-3103', 'Q', '1043651577', 'ANGEL DAVID CUESTA LIÑAN', '3217303555', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor FERNANDO CABRERA CARDOZO', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Hemangioma en muslo izquierdo" se fragmentos de tejido de color blanco grisáceo que promedian 1 cm. \r\n\r\n\r\n\r\n', 'El espécimen esta representado por fragmentos de musculo estriado y tejido adiposo en donde se observan tres vasos . No se encuentran cambios neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión muslo izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1610, 'Q2111-3104', 'Q', '45433256', 'MARIA DEL CARMEN OROZCO MENDOZA', '3008172103', 'F', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Producto de resección de tumor en región dorsal" se reciben fragmentos de tejido de color oscuro que promedian 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmentos de tejido adiposo con focos de infiltración por linfocitos.\r\n\r\n\r\n\r\n', '-FRAGEMTNO DE TEJIDO ADIPOSO CON INFLAMACIÓN CRÓNICA, región dorsal.\r\n\r\n\r\n', '', ''),
	(1611, 'Q2111-3105', 'Q', '73161329', 'ENRIQUE LUIS CASTRO ANGULO', '000', 'M', '47', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Producto de resección de tumor en tejidos blandos hipocondrio derecho" se reciben fragmentos de tejido de forma irregular de color pardo amarillento que alternan con áreas de color oscuro el mayor mide 3 x 1 cms. Al corte de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n|', '-LIPOMA, hipocondrio derecho', '', ''),
	(1612, 'Q2111-3106', 'Q', '7885865', 'LUIS ALBERTO MARTINEZ GUARDO', '000', 'M', '58', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-08', '2021-11-04', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Hidrocele izquierdo" se recibe fragmento de tejido de color pardo grisáceo, alargado que mide 8 x 2.5 cms. Se toman cortes.\r\n\r\n\r\n', 'Fragmento de tejido fibroadiposo con congestión y edema.\r\n\r\n\r\n\r\n', '-FRAGMENTO DE TEJIDO FBROADIPOSO CON CONGESTIÓN Y EDEMA, región inguinal izquierda', '', ''),
	(1613, 'Q2111-3107', 'Q', '73091477', 'CESAR RAMOS ARNEDO', '3107372261', 'M', '63', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-11-09', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un diminuto fragmento de tejido de forma irregular, color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Cuerpo" cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulado B muestran mucosa antro corporal cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos. No se observa actividad inflamatoria, H.pylori, cambios metaplásicos ni displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', 'Caso estudiado en conjunto con el doctor José Caraballo.'),
	(1614, 'Q2111-3108', 'Q', '33150688', 'ANA CARDENAS DE BALCEIRO', '3103670912', 'F', '66', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1615, 'Q2111-3109', 'Q', '33135222', 'CARMEN MARINA GUERRERO DE VILLADIEGO', '000', 'F', '72', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-11-09', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Trucut de seno derecho" se reciben cinco fragmentos filiformes de tejido de color pardo claro y consistencia blanda que promedian 1.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los corte muestran un tumor epitelial maligno compuesto por células pleomórficas de núcleos grandes, irregulares, hipercromáticos (G 3) con moderada actividad mitótica (2). Se disponen formando nidos sólidos y cordones (3) que infiltran el estroma generando una gran reacción desmoplastica.\r\nNo se identifica infiltración linfovascular.\r\n\r\n\r\n', ' Biopsia con aguja de corte de masa en mama derecha:\r\n-CARCINOMA DUCTAL, TIPO NO ESPECIAL, POBREMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n\r\n\r\n', '', 'Es pertinente practicar estudios de receptores estrogénicos, progesterona, HER2 y KI 67.\r\n\r\n'),
	(1616, 'Q2111-3110', 'Q', '9072928', 'ALFREDO EDUARDO CARRASCAL NIEVES', '30000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JAIME OLIVARES TAYLOR', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe una elipse de piel de color pardo claro y consistencia  blanda que mide 1.2 x 0.7 cms. en la superficie externa se observa una lesión hiperpigmentada y mal delimitada. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se observa un tumor compuesto por la proliferación de células basaloides que se disponen en nidos sólidos con empalizada periférica. Las líneas de resección están libres de tumor.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel de dorso nasal:\r\n-CARCINOMA BASOCELULAR \r\n-MARGENES DE RESECCIÓN SIN COMPROMISO TUMORAL', '', ''),
	(1617, 'Q2111-3111', 'Q', '45429896', 'MARTHA PATRICIA PEÑA DE PEREZ', '3162867519', 'F', '62', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1618, 'Q2111-3112', 'Q', '45544893', 'DIANUDYS DE LEON GALE', '000', 'F', '38', 'SEGUROS BOLIVAR S.A', '', '898201', '30215', 'Doctor ORLANDO BUSTILLO JR.', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia cervical" se reciben tres diminutos  fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción aguda y crónica y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS AGUDA Y CRÓNICA\r\n-LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n\r\n\r\n', '', ''),
	(1619, 'Q2111-3113', 'Q', '1049582954', 'DILAN STIK ARELLANO ALFARO', '3042560601', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Hidrocele izquierdo" se reciben cuatro fragmentos de tejido de forma irregular de color pardo grisáceo y aspecto membranoso el mayor mide 7 x 5 cms. y el menor promedia 4 x 2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran pared de tejido fibroconectivo bien vascularizado parcialmente  tapizado por un epitelio aplanado.\r\n\r\n\r\n\r\n', '-SACO DE HIDROCELE (lado izquierdo)', '', ''),
	(1620, 'Q2111-3114', 'Q', '1193600151', 'YADIRIS RESTREPO PEREZ', '3182734019', 'F', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Embarazo ectopico izquierdo + trompa izquierda" se recibe una trompa de Falopio que mide 5.7 x 0.8 cms. La superficie externa esta cubierta por una serosa despulida. En el mismo recipiente, se recibe un tejido esponjoso de color pardo claro con áreas de color pardo oscuro y consistencia friable que mide 3 x 1.7 x 1.5 cms. Al corte la trompa conserva la morfología habitual. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran trompa de Falopio con áreas extensas de hemorrágia.\r\nOtros cortes muestran vellosidades coriales tapizadas por cito y sinciotrofoblasto sin alteraciones que alternan con coágulos sanguíneos.\r\n\r\n\r\n\r\n', ' Salpingectomía izquierda:\r\n-EMBARAZO ECTOPICO\r\n\r\n', '', ''),
	(1621, 'Q2111-3115', 'Q', '30758754', 'DINNIA SIMANCA CASTILLO', '3182552734', 'F', '70', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 7 x 3.3 cms. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de dos cálculos color oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1622, 'Q2111-3116', 'Q', 'VEN32872049', 'HAILEEN PAOLA OCHOA ZAMBRANO', '000', 'F', '15', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-11-12', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Placenta" se recibe una placenta con sus membranas y un segmento de cordón que pesa 125 gms. y mide 11 x 6.5 x 1.8 cms. La cara fetal esta cubierta por una serosa lisa y brillante y el cordón umbilical de implantación central en el cordón mide 8.5 cms. y al corte se identifican tres vasos, la cara materna se muestra una superficie cruenta mamelonada. Al corte se observa una superficie de color pardo claro finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta del segundo trimestre tapizado por cito y sinciotrofoblasto sin alteraciones. Algunas vellosidades presentan edema del mesénquima. El cordón umbilical conserva la morfología habitual. No se observan cambios inflamatorios ni neoplásicos.\r\n\r\n\r\n\r\n', ' Placenta del segundo trimestre (125 gms.) con:\r\n-CAMBIOS HIDROPICOS FOCALES\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n', '', 'Los hallazgos son compatibles con los cambios secundarios a muerte fetal in útero.\r\n\r\n'),
	(1623, 'Q2111-3117', 'Q', '33103729', 'MIRLEY PEREZ MEZA', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor JOSE ACEVEDO', NULL, '2021-11-08', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Utero, cuello y trompa derecha" se recibe un útero con su trompa derecha que pesa 637 gms. y mide 16.5 x 11.5 x 7 cms. en sus mayores dimensiones. El cérvix esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta amentado de tamaño y deformado tapizado por una serosa lisa y brillante. Al corte el canal endocervical es permeable, la cavidad endometrial esta tapizado por una mucosa gruesa de color pardo claro y el miometrio esta ocupado por una gran masa de color pardo claro y aspecto arremolinado, submucoso que mide 8 x 6.5 x 11 cms. \r\nEn el mismo recipiente, se reciben además una trompa de Falopio de conserva la forma habitual mide 5.5 x 0.8 cms. La superficie externa esta cubierta por una seros lisa y brillante. Al corte conserva la morfología habitual. Se toman cortes.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica con focos de metaplasia escamosa. El endometrio está autólisado. La masa miometrial descrita está compuesta por fibras musculares lisas distribuidas irregularmente. La trompa de Falopio conserva la morfología habitual.\r\n\r\n\r\n', ' Histerectomía total con salpingectomía derecha:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMA SUBMUCOSO\r\n-TROMPA DE FALOPIO', '', ''),
	(1624, 'Q2111-3118', 'Q', '1001897276', 'ELIS MARGARITA TERAN PADILLA', '3126635655', 'F', '32', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-03-10', '2021-11-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "Placenta" se recibe una placenta con sus membranas y un segmento de cordón umbilical que pesa 353 gms. y mide 14.5 x 11 x 2.5 cms. La cara fetal está cubierta por una serosa lisa y brillante, trae un segmento de cordón umbilical que mide 38 x 1.3 cms. de implantación marginal, el cordón umbilical se identifican tres vasos, la cara materna muestra una superficie irregular cruenta de color pardo oscuro con áreas de color pardo claro. Al corte se observa una superficie finamente granular de color pardo grisáceo que alternan con áreas de color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran placenta del tercer trimestre cuya morfología está preservada. Hay escasos focos de trombos del espacio intervelloso. El cordón umbilical conserva su morfología habitual.\r\n\r\n\r\n\r\n', ' Placenta del tercer trimestre (353 gms.):\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(1625, 'Q2111-3119', 'Q', '73107356', 'FREDYS ENRIQUE PALACIOS SAMPAYO', '000', 'M', '60', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JAIME OLIVARES TAYLOR', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una masa de tejido que mide 2 x 2 cms. de consistencia blanda y aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro, separado por gruesos septos de tejido fibroconectivo.\r\n\r\n\r\n\r\n ', ' Resección de lesión en región lumbar:\r\n-FIBROLIPOMA\r\n\r\n', '', ''),
	(1626, 'Q2111-3120', 'Q', '73199620', 'LEONARDO JAVIER BETANCOUR TERAN', '000', 'M', '39', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1627, 'Q2111-3121', 'Q', '33137441', 'ELVIRA PACHECO DE GILCHRIST', '000', 'F', '70', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa antro corporal y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(1628, 'Q2111-3122', 'Q', '73146574', 'RODRIGO RAUL REYES PEREIRA', '3205348805', 'M', '52', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-29', '2021-11-09', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotuladso, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Pólipo gástrico" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Pólipo gástrico cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\nLos cortes C revelan estructura compuesta por glándulas gástricas de diferentes formas y tamaños, que reposan en una lámina propia edematosa. No hay cambios malignos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de pólipo gástrico:\r\n-PÓLIPO DE GLÁNDULAS FÚNDICAS\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-PÓLIPO HIPERPLÁSICO ', '', ''),
	(1629, 'Q2111-3123', 'Q', '1129508090', 'EDGAR MAURICIO DURAN PRADA', '3188045130', 'M', '33', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1630, 'Q2111-3124', 'Q', '1050731844', 'MIZAEL DIAZ LEYTON', '3215762830', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mie 7 x 1 cms. tapizada por una serosa, opaca bien vascularizada de color pardo claro presenta una solución de continuidad de 1 cm. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA', '', ''),
	(1631, 'Q2111-3125', 'Q', '1052739026', 'LUCIA ISABEL JIMENEZ TORRES', '3163992924', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(1632, 'Q2111-3126', 'Q', '1049935341', 'ANDRES FELIPE BALLESTAS BERRIO', '3233849354', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.5 cms. tapizada pro una serosa, opaca bien vascularizada de color pardo claro tiene adherido un material fibrinopurulento. Al corte salida de material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1633, 'Q2111-3127', 'Q', '1041999671', 'SNAIDER DE JESUS ROCHA SOTO', '3008045476', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Granuloma traqueal supra esternal" se reciben dos fragmentos de tejido de color blanquecino y consistencia elástica que miden 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido de granulación constituido por una proliferación de vasos pequeños delgados que descansan en un estroma edematoso infiltrado por linfocitos y plasmocitos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en región supra esternal:\r\n-FRAGMENTOS DE TEJIDO DE GRANULACIÓN', '', ''),
	(1634, 'Q2111-3128', 'Q', '1049949223', 'BRAYAN DAVID MONTERROSA YERENA', '3208365064', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-11-12', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Divertículo de Meckel + apéndice" se recibe un apéndice cecal que mide 6 x 0.5 cms. tapizada por una serosa de color pardo claro bien vascularizada.\r\nAcompañando a esto, segmento de intestino que mide 5 cms. a 1 cm. de uno de los bordes de resección se observa una formación sacular, pediculada que se comunica con el intestino que mide 5 x 4 cms. de color pardo grisáceo. Se toman cortes de la formación sacular y del intestino.\r\n\r\n\r\n', 'Los cortes de A revelan apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular muestra la estructura usual, se observa además a nivel de la serosa edema, congestión e infiltración por neutrófilos.\r\nLos cortes B revelan pared de intestino delgado con edema y congestión. \r\nSe observa además un divertículo verdadero con ulceración de la mucosa, edema, congestión e infiltrado inflamatorio agudo severo en toda la pared.\r\n\r\n\r\n\r\n', '1.PERIAPENDICITIS AGUDA\r\n2.DIVERTICULO DE MECKEL CON INFLAMACIÓN AGUDA SEVERA\r\n3.SEGMENTO DE INTESTINO DELGADO CON EDEMA Y CONGESTIÓN\r\n\r\n', '', ''),
	(1635, 'Q2111-3129', 'Q', '45493198', 'EDELMA CARDONA ACOSTA', 'centro', 'F', '57', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe previamente abierta una vesícula que mide 7 x 3 cms., La  pared está engrosada con perdida de su superficie aterciopelada, en su superficie externa se observa una formación de 1 cm. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa se observa y ulcerada, la pared engrosada con un infiltrado agudo, edema y congestión. El nódulo descrito corresponde a un ganglio linfático con hiperplasia folicular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS AGUDA Y CRÓNICA\r\n-GANGLIO LINFÁTICO CON HIPERPLASIA FOLICULAR\r\n\r\n', '', ''),
	(1636, 'Q2111-3130', 'Q', '1192921466', 'MARLIN CARMONA GONZALEZ', '000', 'F', '22', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-12-13', '2021-11-09', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cono" un cono cervical previamente abierto que mide 3 x 2.5 x 2 cms. Se toman cortes del labio anterior y se rotulan A, B labio posterior.\r\n2. "Legrado endocervical" diminutos fragmentos de tejido que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan múltiples cortes de cuello uterino muestra hiperplasia del epitelio escamoso, inflamación crónica y LIE de bajo grado con cambios citopáticos secundarios a infección por HPV. Hay presencia de lesión en el borde de resección vaginal.\r\nEl vértice está libre de lesión.\r\nLos cortes rotulados C muestran diminutos fragmentos de endocervix con inflamación.\r\n\r\n\r\n', '1. Cono cervical:\r\n-LESIÓN INTRAEPITELIAL ESCAMOSA DE BAJO GRADO CON CAMBIOS CITOPÁTICOS SECUNDARIOS A INFECCIÓN POR HPV\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2. ENDOCERVICITIS CRÓNICA\r\n\r\n', '', ''),
	(1637, 'Q2111-3131', 'Q', 'VEN21444544', 'LUZ ELIDE GARCIA CADENAS', '000', 'F', '41', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-11-10', '2021-11-09', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.5 cms. tapizada por una serosa de color pardo claro, opaca bien vascularizada. Al corte salida de material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', '-APENDICE CECAL CON HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(1638, 'Q2111-3132', 'Q', '1143325316', 'JAIRO MENDOZA GALLEGO', '313414481', 'M', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora DANIELA DIAZ BLANCO', NULL, '2021-11-16', '2021-11-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se recibe un fragmento de estómago de aspecto sacular que mide 30 cms. la curvatura mayor y 17 cms. en el área suturada, la superficie externa esta cubierta por una serosa lisa y brillante. Al corte la mucosa esta aplanada y la luz contiene un material viscoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran pared gástrica antral y corporal cuya morfología está preservada. Hay discreta infiltración mononuclear de la lámina propia. No se identifican bacilos con la morfología de H.pylori.\r\n\r\n\r\n\r\n', ' Gastrectomía parcial (Sleeve):\r\n-FRAGMENTO DE PARED GÁSTRICA\r\n', '', ''),
	(1639, 'Q2111-3133', 'Q', '45462957', 'ESTHER RAMOS CASTELLANOS', '3242428279', 'F', '58', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero, cuello, trompa y ovario" se recibe un cuerpo uterino marcadamente irregular que mide 16 x 12 x 8 cms. pesa 930 gms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa lisa y brillante y eh ella se observan masas subserosas con tamaños que van desde pocos milímetros hasta 11 cms. Trae adherido una trompa de Falopio que mide 8 cms. de longitud y un ovario de 3 cms. de diámetro mayor. Al corte se encuentran múltiples masas de localización subserosa, intramural y submucosa, la cavidad endometrial esta tapizada por una mucosa delgada de color rosado. Las masas al corte presentan un color blanquecino y aspecto fasciculado. Las trompas son externamente normales y el ovario es sólido.\r\nSeparadamente se recibe, una trompa  de Falopio y un ovario. La trompa es externamente normal, el ovario mide 3 cms. y al corte es sólido. Se toman cortes.\r\n\r\n\r\n', 'El endometrio es atrófico. El endometrio es atrófico. Las masas miometriales están compuestas por fibras musculares lisas dispuestas irregularmente con áreas extensas de hialinización. Las trompas y los ovarios son normales.\r\n\r\n\r\n', ' Cuerpo uterino, trompas y ovarios (930 gms.):\r\n-ENDOMETRIO ATRÓFICO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS', '', ''),
	(1640, 'Q2111-3134', 'Q', '45550364', 'EVELIA MARQUEZ HERNANDEZ', '000', 'F', '38', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "utero, trompas y cuello" se recibe un útero con sus trompas que pesa 353 gms. y mide 12 x 8 x 6.5 cms. El cuello esta tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo esta aumentado de tamaño y deformado. Las trompas miden respectivamente 4 y 4 cms. Al corte la cavidad endometrial esta tapizada por una mucosa delgada de color pardo amarillento y esta rechazada por una masa esférica de color blanquecino y aspecto fasciculado de 6 cms. en su mayor diámetro. Las trompas son externamente normales. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica. El endometrio es atrófico. La masa descrita está compuesta por fibras musculares lisas dispuestas irregularmente. Las trompas son normales.\r\n\r\n\r\n\r\n', ' Utero y trompas (353 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO CON CAMBIOS ATRÓFICOS POR COMPRESIÓN\r\n-LEIOMIOMA SUBMUCOSO E INTRAMURAL\r\n-TROMPAS DE FALOPIO', '', ''),
	(1641, 'Q2111-3135', 'Q', '33101556', 'ADELA DEL CARMEN BALLESTEROS TAPIA', '3225922787', 'F', '52', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora IRINA SEQUEDA LUJAN', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero, trompas y cuello" se recibe un útero con sus anexos que pesa 436 gms. y mide 13 x 9.5 x 7 cms. en sus mayores dimensiones. El cérvix esta tapizado por una mucosa de color pardo claro que rodea un orificio externo puntiforme. El cuerpo esta aumentado de tamaño y deformado, las trompas son externamente normales, el ovario derecho mide 3.5 cms. en sus mayores dimensiones y el izquierdo mide 4 cms. y presenta una zona de aspecto quístico previamente abierta. Al corte el canal endocervical es permeable, la cavidad endometrial esta y tapizada por una mucosa irregular, mamelonada de color grisáceo, en el miometrio se encuentran múltiples masa esféricas de color blanquecino la mayor de las cuales mide 4 cms. de diámetro mayor, son de localización intramural. El ovario derecho es sólido y el izquierdo muestra una cavidad de paredes irregulares previamente abierto con un diámetro mayor de 2.5 cms. Se toman cortes.\r\n\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica. El endometrio es secretor. Las masas descritas están compuestas por fibras musculares lisas dispuestas irregularmente. Las trompas son normales. El ovario derecho es normal. El izquierdo muestra una cavidad tapizada por elementos foliculares latinizados, con contenido hemorrágico.\r\n\r\n\r\n', ' Útero, trompas y ovarios (436 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO SECRETOR\r\n-LEIOMIOMAS INTRAMURALES\r\n-TROMPAS DE FALOPIO\r\n-QUÍSTE LUTEO HEMORRÁGICO, ovario izquierdo\r\n-OVARIO DERECHO', '', ''),
	(1642, 'Q2111-3136', 'Q', '1041970689', 'DAYUNIS PAOLA GAVIRIA CERVANTES', '3126056709', 'F', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-11-24', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Placenta" se recibe una placenta con sus membranas y cordón que pesa 588 gms. y mide 16 x 13 x 2.5 cms. Trae adherida una estructura con características similares, separada por una zona de aspecto fibroso, que mide 9 x 6.5 x 2.5 cms., la cara fetal es lisa, brillante de color pardo grisáceo y trae un segmento de cordón umbilical, de implantación central, de 52 cms. de longitud, la cara materna muestra sus cotiledones completos. Las membranas no muestran particularidades. Al corte se encuentra una superficie de aspecto esponjoso, de color pardo grisáceo, que incluyen las membranas y el cordón que contienen tres vasos. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran placenta del tercer trimestre compuesto por vellosidades terciarias con aumento del número de nidos sincitiales y edema del estroma. Hay presencia de cambios vasculares en las arterias espirales con cambios de aterosis. Hay, además, disminución del contenido sanguíneo en el espacio intervelloso.\r\n\r\n\r\n\r\n', ' Placenta del tercer trimestre (588 gms.):\r\n-SIGNOS DE HIPOPERFUSIÓN VASCULAR MATERNA\r\n\r\n', '', ''),
	(1643, 'Q2111-3137', 'Q', '33136864', 'GLORIA EDILMA PELUFO DIAZ', '3333333', 'F', '78', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor EFRAIN RAMIREZ', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Aneurisma de fistula arteriovenosa de antebrazo derecho" se recibe una masa de tejido de forma ligeramente esférica que mide 4.5 x 3.5 x 3.5 cms. La superficie externa es irregular, la consistencia es firme. Al corte se encuentra una cavidad irregular, vacía cuyas paredes muestran un aspecto en capas concéntricas. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran piel por debajo de la pared cual se encuentra una cavidad de paredes fibrosas que contiene coágulos sanguíneos. No se identifican elementos de la pared vascular.\r\n\r\n\r\n\r\n\r\n ', ' Resección de fístula arteriovenosa:\r\n-PSEUDOANEURISMA\r\n\r\n', '', ''),
	(1644, 'Q2111-3138', 'Q', '9077605', 'JHON LAURENCE GILCHRIST', '3008007037', 'M', '70', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lengüeta esofágica" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Cicatriz de ulcera de cardias" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 cms. de aspecto mucoide. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran epitelio escamoso maduro que alternan con epitelio columnar que contiene células caliciformes. Reposan en una lámina propia congestiva con leve infiltración mononuclear.\r\nEn los cortes rotulados B no se identifican elementos tisulares.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESÓFAGO DE BARRETT\r\n2.Biopsia endoscópica de estómago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1645, 'Q2111-3139', 'Q', '23007355', 'YOLANDA BELTRAN CASARES', '3137405505', 'F', '75', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuyo dermis se encuentra una proliferación de vasos capilares que reposan en un tejido conectivo laxo.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vulva:\r\n-HEMANGIOMA CAPILAR', '', ''),
	(1646, 'Q2111-3140', 'Q', '8693237', 'ISIDRO MANUEL ACUÑA GRAU', '3126231760', 'M', '64', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro gástrico" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. Un segundo recipiente rotulado "Pólipo de colon" contiene dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de colon:\r\n-ADENOMA TUBULAR', '', ''),
	(1647, 'Q2111-3141', 'Q', '33107832', 'INES MARIA ARRIETA ARIÑA', '3043952395', 'F', '51', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.3 cms. en su mayor dimensión.  Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran cuello uterino con una LIE de bajo grado (NIC 1). Hay cambios sugestivos pero no concluyentes de infección por HPV.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-LESIÓN INTRAEPITELIAL DE BAJO GRADO (NIC 1)\r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1648, 'Q2111-3142', 'Q', '9050111', 'HUMBERTO ENRIQUE GOMEZ FORTICH', '3145518915', 'M', '80', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-11-24', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de piel de forma ligeramente elíptica que mide 0.5 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis presenta hiperqueratosis con paraqueratosis, pérdida focal de la capa granular y acantosis psoriasiforme. El dermis muestra infiltrados inflamatorios focales mediados por linfocitos.\r\n\r\n\r\n\r\nCOMENTARIOS: Los hallazgos descritos comparten algunas características con la ACRODERMATITIS CONTINUA DE HALLOPEAU (PSORIASIS PUSTULAR) pero no llenan todos los criterios de esta entidad. El cuadro histológico puede estar modificado por el estado de la enfermedad, tratamientos previos, etcétera.\r\n\r\n', ' Biopsia de piel de dedo de mano derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO', '', ''),
	(1649, 'Q2111-3143', 'Q', '1201249939', 'KARIM DAVID ALTAMIRANDA  CASTRO', '3114123923', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Ganglio linfático nivel V" se recibe una masa de tejido de forma ligeramente ovoide que mide 1.8 x 1.5 x 0.6 cms. en sus mayores dimensiones, la superficie externa es de color pardo claro, la consistencia es blanda, elástica y al corte presenta una superficie homogénea de color blanco amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada por la presencia de folículos aumentados en número y tamaño con abundantes histiocitos que fagocitan detritus. Hay presencia, además, de acúmulos de histiocitos en la periferia de los folículos.\r\nEl cuadro histológico descrito es altamente sugestivo de TOXOPLASMOSIS.\r\n\r\n\r\n', ' Biopsia de ganglio linfático cervical:\r\n-HIPERPLASIA FOLICULAR REACTIVA\r\n', '', ''),
	(1650, 'Q2111-3144', 'Q', '1142930603', 'MELANI ANDREA TORRES LOPEZ', '3226553579', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Colon" dos fragmentos de tejido de forma alargada de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal sin alteraciones.\r\nLos cortes rotulados C muestran mucosa colónica sin alteraciones.\r\n\r\n ', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n2.Biopsia endoscópica de duodeno:\r\n-FRAGMENTOS DE MUCOSA DUODENAL\r\n\r\n3.Biopsia endoscópica de colon:\r\n-FRAGMENTOS DE MUCOSA COLÓNICA\r\n', '', ''),
	(1651, 'Q2111-3145', 'Q', '1050742265', 'JESUS MIGUEL MUÑOZ TORRES', '3118784552', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-17', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Vesícula" un fragmento de tejido de forma irregular de color pardo amarillento con áreas verdosas que mide 1.5 cms. en su mayor dimensión. Al corte se encuentra una cavidad de paredes muy delgadas. Se incluye en su totalidad y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Quíste coledo" contiene una estructura sacular que mide 1.2 cms. en su mayor dimensión, es de color pardo claro con áreas de color verde y al corte se encuentra paredes  delgadas que rodean una cavidad previamente abierta. Se toman cortes y se rotulan B.\r\n3. un segundo recipiente, rotulado "Hígado" un fragmento de tejido de forma irregular que mide 0.6 cms. de color verdoso y consistencia firme. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran una estructura con una cavidad central tapizada por una capa de epitelio columnar, sugestiva de una vesícula biliar primitiva.\r\nLos cortes rotulados B muestran una estructura sacular de paredes fibrosas, tapizadas por un epitelio plano, simple.\r\nLos cortes rotulados C muestran hígado cuya morfología está completamente alterada por la formación de nódulos separados por septos de tejido fibroso que contienen una proliferación de pequeños conductos biliares, algunos con tapones biliares. Los nódulos están compuestos por hepatocitos distribuidos irregularmente con cambios secundarios a colestasis.\r\n\r\n', '1.Resección de estructura en localización de la vesícula biliar:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n2.Resección de estructura paracoledociana:\r\n-QUÍSTE DEL COLÉDOCO\r\n\r\n3.Biopsia de hígado:\r\n-CIRROSIS BILIAR SECUNDARIA\r\n', '', ''),
	(1652, 'Q2111-3146', 'Q', '1043641897', 'ANDREA CAROLINA ARRIETA GALVIS', '3126377655', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian un diámetro 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO\r\n\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA LEVE', '', ''),
	(1653, 'Q2111-3147', 'Q', 'VEN33057446', 'DUBAL ALONSO VICUÑA PRADO', '3046480557', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro. Al corte se encuentra una luz dilatada contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1654, 'Q2111-3148', 'Q', '1027295574', 'SARA VALENTINA GUEVARA GUTIERREZ', '3167403133', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctor HENRY A. TORRES MONTES', NULL, '2021-11-16', '2021-11-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Curetaje oseo pubis derecho" se reciben múltiples fragmentos de hueso de forma irregular, de color pardo claro que en conjunto hacen un volumen de 1 ml.\r\n\r\n\r\n\r\n', 'Los cortes muestran espículas oseas desvitalizadas que reposan en un estroma fibroso infiltrado por linfocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en pubis derecho:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(1655, 'Q2111-3149', 'Q', '19115533', 'RAIMUNDO JOSE GRICE', '3008555483', 'M', '71', 'PARTICULAR', 'C.', '', '', 'Doctor ROY BALLESTAS LARIOS', NULL, '2021-11-16', '2021-11-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipo de colon transverso" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon transverso:\r\n-ADENOMA TUBULAR, FRAGMENTOS', '', ''),
	(1656, 'Q2111-3150', 'Q', 'VEN5828212', 'NELSIDA BENEDICTA DIAZ DE PAZ', '0000', 'F', '62', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-11-16', '2021-11-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula piriforme que mide 9 x 4 x 2 cms., la serosa es opaca de color pardo claro se encuentra previamente evacuada y muestra una solución de continuidad en el extremo distal de 2 cm. Las paredes engrosadas y la mucosa ha perdido su aspecto aterciopelado. Acompañado a esto un gran cálculo brillante que mide 5 x 2.5 x 2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa es atrófica y densamente infiltrada por linfocitos, plasmocitos y neutrófilos, hay edema de la pared y hipertrofia de la capa muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n', '', ''),
	(1657, 'Q2111-3151', 'Q', '1201249192', 'MARIANIS SOFIA TAPIA LLERENA', '3017301223', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-11-16', '2021-11-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 cms. la serosa es congestiva y de color gris. Al corte la luz contiene un material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(1658, 'Q2111-3152', 'Q', '1048606571', 'VALERIN SOFIA ALTAMAR ALCAZAR', '0000', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-11-16', '2021-11-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1 cms. la serosa es congestiva y de color gris. Al corte la luz contiene un material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1659, 'Q2111-3153', 'Q', '1044017732', 'NEYTHAN DAVID MIRANDA MUÑOZ', '0000', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-19', '2021-11-16', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Vesícula" vesícula biliar que mide 2 x 0.5 cms. La serosa es de color gris. Al corte la mucosa conserva el aspecto aterciopelado. Se toman cortes y se rotulan A.\r\n2. "Biopsia hepática" un fragmento hepático de color verdoso que mide 1 cm. Se toma todo y se rotulan B.\r\n3. "Placa biliar" fragmento de tejido de color blanquecino que mide 0.5 x 0.4 cms. en uno de sus extremos está limitado por una seda de color oscuro. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes de A revelan vesícula biliar sin alteraciones.\r\nLos cortes B revelan hígado cuya morfología está alterada por perdida del patrón cordonal de los hepatocitos que se agrupan formando nódulos separados por septos de tejido conectivo que se proyectan desde los espacios porta, hay cambios en los hepatocitos representados por degeneración plumosa y cambios de colestasis con presencia de tapones biliar. Los espacios portas muestran fibrosis, proliferación de conductillos biliares algunos con tapones biliares, esta fibrosis en algunas áreas se extiende hasta formar puentes con otros espacios portas formando pequeños nódulos.\r\nLos cortes C revelan fragmento de tejido fibroso moderadamente vascularizado con pequeños conductos, hay focos de infiltración mononuclear.\r\n\r\n', '1. VESÍCULA BILIAR\r\n2. CIRROSIS BILIAR SECUNDARIA\r\n3. PLACA BILIAR CON FOCOS DE INFILTRACIÓN MONONUCLEAR\r\n\r\n', '', ''),
	(1660, 'Q2111-3154', 'Q', '73078695', 'CESAR ENRIQUE RUIZ VIANA', '00000', 'M', '63', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor OSVALDO MOLINA', NULL, '2021-11-24', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Cápsula de hematoma subdural" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.2 cms., en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por una cápsula fibrosa moderadamente vascularizada que contiene hemosiderófagos y linfocitos. Uno de los fragmentos recuerda la estructura de la leptomeninge.\r\n\r\n\r\n\r\n', ' Drenaje de hematoma subdural (cápsula):\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1661, 'Q2111-3155', 'Q', 'VEN20438863', 'JESENIA DEL CARMEN RAMIREZ UZCATEGUI', '3016351294', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar previamente abierta que mide 6 x 2 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa de color pardo claro. Al corte las paredes son de aspecto fibroso, la mucosa es aterciopelada de color pardo amarillento. Se toman cortes.\r\nNo se encuentran cálculos. \r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n-COLELITIASIS (por historia)', '', ''),
	(1662, 'Q2111-3156', 'Q', '1041978720', 'LUIS MIGUEL POLO HERNANDEZ', '3116299653', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898241', '69000', 'Doctor JORGE LAMBIS RICARDO', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Testículo izquierdo" se recibe un testículo que mide 5 x 3.5 x 3 cms. en sus mayores dimensiones, la superficie externa es lisa, brillante de color violáceo, la consistencia es firme. Trae un segmento de cordón de 1 cm. de longitud. Al corte se encuentra el parénquima del testículo está reemplazado por un tejido de aspecto hemorrágico, color rojo violáceo, lo cual incluye el epidídimo con iguales características. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran testículo con necrosis hemorrágica que compromete todo el tejido testicular y el epidídimo.\r\n\r\n\r\n\r\n', ' Orquiectomía izquierda:\r\n-NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n\r\n', '', ''),
	(1663, 'Q2111-3157', 'Q', '1044017119', 'EMELIS SOFIA ORTIZ NAVIA', '3003314525', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Ganglio cecal" se recibe un ganglio linfático que mide 1.5 x 0.8 x 0.6 cms. en sus mayores dimensiones, es de color pardo claro y consistencia firme. Al corte se encuentra una superficie de color pardo claro con áreas de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada pro la presencia de folículos aumentados en número y tamaño, con centros germinales ensanchados que contienen abundantes histiocitos que fagocitan detritus. hay además, aumento en el número de histiocitos en el área interfolicular. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Resección de ganglio linfático de región cecal:\r\n-HIPERPLASIA REACTIVA DE TIPO MIXTO\r\n\r\n', '', ''),
	(1664, 'Q2111-3158', 'Q', 'VEN32331130', 'KLEYBER ALEXANDER ROMERO CARREÑO', '3156774504', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor HENRY TORRES MONTES', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Drenaje de hematoma" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia friable que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está representado por múltiples coágulos de sangre y de fibrina.\r\n\r\n\r\n\r\n', ' Producto de drenaje de lesión en muslo derecho:\r\n-COÁGULOS DE SANGRE Y DE FIBRINA\r\n\r\n\r\n', '', ''),
	(1665, 'Q2111-3159', 'Q', '73132252', 'NEVER ENRIQUE CORONADO GUERRERO', '000', 'M', '54', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Producto de masa región dorsal derecha" se reciben varios fragmentos de tejido de forma irregular de color grisáceo y consistencia friable que en conjunto hacen un volumen de 1 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n ', ' Resección de lesión en región dorsal:\r\n-QUISTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(1666, 'Q2111-3160', 'Q', '22821478', 'MARIA HERENANDEZ MORALES', '3113626850', 'F', '78', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1667, 'Q2111-3161', 'Q', '1043659262', 'MIRLY MICHEL CASTRO ESTRELLA', '3113388712', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.8 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro con vasos prominentes.  Al corte se encuentra una luz dilatada que contiene un material viscoso de color verdoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1668, 'Q2111-3162', 'Q', '33138369', 'CELMIRA LOBELO TAPIA', '000', 'F', '70', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden respectivamente 0.5 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1669, 'Q2111-3163', 'Q', '1048609484', 'YAILETH PATRICIA PEREZ PEÑA', '3005149468', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Resección verrugas víricas" se reciben tres fragmentos de tejido de forma irregular, de color pardo claro, con una superficie irregular que miden respectivamente 1.5, 0.8 y 1 cms. en sus mayores dimensiones. Se toman sendos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con papilomatosis, hiperqueratosis e hipergranulosis. Los hallazgos son similares en todas las muestras.\r\n\r\n\r\n\r\n', ' Resección de lesiones en piel de extremidades:\r\n-VERRUGAS VULGARES\r\n\r\n', '', ''),
	(1670, 'Q2111-3164', 'Q', '45448923', 'ENITH CARVAJAL DE MEJIA', '3145512134', 'F', '69', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1671, 'Q2111-3165', 'Q', '1201261149', 'ANA LUCIA LLANOS HERRERA', '3205710123', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS VELEZ DUCAN', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Placa de miringoesclerosis oído izquierdo" se reciben dos fragmentos de tejido de forma irregular que miden respectivamente 0.4 y 0.2 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran  un fragmento de membrana tapizada por un epitelio simple que reposa en un estroma moderadamente infiltrado por linfocitos.\r\nOtro fragmento muestra áreas extensas de calcificación distrófica.\r\n\r\n\r\n\r\n', ' Resección de lesión en tímpano izquierdo:\r\n-MIRINGITIS CRÓNICA\r\n-MIRINGOESCLEROSIS', '', ''),
	(1672, 'Q2111-3166', 'Q', '1053000435', 'ADRIANA PAOLA SIERRA ALVARINO', '0000', 'F', '24', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(1673, 'Q2111-3167', 'Q', '1042583721', 'WILDER JAVIER VILLALBA MORALES', '3218371198', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quiste epidídimo derecho" se recibe una estructura quística de color blanco grisáceo de forma irregular de consistencia renitente que mide 2 x 2 x 1.5 cms. en sus mayores dimensiones. Al corte expulsa un contenido líquido transparente, las paredes son muy delgadas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una cavidad de pared fibrosa muy delgada, tapizada por un epitelio aplanado. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección de lesión quística en epidídimo derecho:\r\n-QUISTE SIMPLE\r\n\r\n', '', ''),
	(1674, 'Q2111-3168', 'Q', '19110910', 'FERNANDO TOVAR CALA', '3107056544', 'M', '71', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por fragmentos de mucosa gástrica antral y de mucosa duodenal que conserva su morfología habitual.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA ANTRAL Y MUCOSA DUODENAL\r\n\r\n', '', ''),
	(1675, 'Q2111-3169', 'Q', '1095909273', 'DANIEL ANDRES HERNANDEZ MANTILLA', '3002169787', 'M', '34', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1676, 'Q2111-3170', 'Q', '9185388', 'JACOB VILLAMIZAR RUIZ', '000', 'M', '53', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 1.4 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene un material de aspecto purulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1677, 'Q2111-3171', 'Q', '13489566', 'JUAN CARLOS JUISA RANGEL', '3183355247', 'M', '54', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-11-19', '2021-11-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1678, 'L2111-114', 'L', '13820948', 'HERIBERTO DURAN ROBLES', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2021-11-19', '2021-11-19', 'JOSÉ CARABALLO GRACIA', 'Sin rotular, se reciben 5 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos contienen células epiteliales sin alteraciones y escasos cristales de oxalato de calcio.\r\n\r\n\r\n\r\n', ' Extendido de sedimento urinario:\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n', '', ''),
	(1679, 'Q2111-3172', 'Q', '36668972', 'MARLY EDITH DIAZ PEÑA', '3234612856', 'F', '45', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-24', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1680, 'Q2111-3173', 'Q', '45537230', 'DARLIN BARRAZA GOMEZ', '0000', 'F', '42', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ORLANDO BORRE ARRIETA', NULL, '2021-11-24', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Endocervix" se reciben fragmentos de tejido de aspecto mucoide que juntos promedian 0.7 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan en su mayoría moco con abundantes neutrófilos y fragmentos de glándulas endocervicales y epitelio escamoso sin cambios. No se observan cambios de LIE en la muestra enviada.\r\n\r\n\r\n\r\n', ' Legrado endocervical:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(1681, 'Q2111-3174', 'Q', '113981771', 'RODRIGO BRUZUAL ALVARADO', '3154463418', 'M', '49', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-24', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1682, 'Q2111-3175', 'Q', '1042592014', 'KEILLYS ANDREA MONTALVO GALINDO', '3007504162', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-24', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 cms. la serosa es blanquecina y congestiva. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1683, 'Q2111-3176', 'Q', '39304925', 'AMADA CAICEDO MONTES', '3002283161', 'F', '52', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-29', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Polipo de recto" dos lesiones polipoides de tejido de color pardo claro y aspecto polipoide que mide la mayor 1 cms. y la menor de 0.5 x 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan lesión polipoide constituida pro una proliferación de glándulas con displasia leve del epitelio, disminución del moco, se observa además, áreas vellosas el estroma es congestivo infiltrado por linfocitos y células plasmáticas.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de recto:\r\n-ADENOMA TUBULOVELLOSO', '', ''),
	(1684, 'Q2111-3177', 'Q', '1048461565', 'KEYSHELL SOPHIA HERRERA PADILLA', '000', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-11-24', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA', '', ''),
	(1685, 'Q2111-3178', 'Q', '1048942451', 'JHOAN MANUEL MENDOZA PIMIENTA', '3148003776', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-11-24', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" masa de tejido de forma ovoide que mide 2.6 x 2 x 1 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular de color amarillento. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" masa de tejido de forma ovoide que mide 2.2 x 1.8 x 1 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular de color amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(1686, 'Q2111-3179', 'Q', '1142939741', 'EMMANUEL ANTONIO MACHACON ALVAREZ', '3002275209', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-24', '2021-11-22', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.5 x 1.5 cms. en su mayor dimensión, la serosa  es oscura, opaca y despulida. Al corte la luz ocupada por un material de aspecto fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '- APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1687, 'Q2111-3180', 'Q', '9081457', 'CESAR EDUARDO SANCHEZ VERGARA', '3215398814', 'M', '69', 'PARTICULAR', 'C.', '898201', '30215', 'Doctores ANTONIO MARIA MARTINEZ - ALONSO CORTINA', NULL, '2021-11-23', '2021-11-23', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia muscular" se recibe un fragmento de tejido de aspecto carnoso de color pardo oscuro que mide 1.3 x 0.5 x 0.3 cms. Se toman cortes así: A cortes transversales, B cortes longitudinales.', '', '', '', ''),
	(1688, 'Q2111-3181', 'Q', '1070821337', 'DINA LUZ NUÑEZ AVILA', '3003300977', 'F', '27', 'ALLIANZ SEGUROS DE VIDA S.A', '', '898201', '30215', 'Doctor ROY BALLESTAS LARIOS', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mucosa gástrica" se reciben dos fragmentos de tejido de forma filiforme de color pardo claro y consistencia blanda que promedian 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1689, 'Q2111-3182', 'Q', '45495897', 'NUBIA INES MUÑOZ CONTRERAS', '0000', 'F', '50', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.4 cms. en sus mayores dimensiones.Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos sueltos de cuello uterino con una reacción inflamatoria crónica y cambios citopáticos por infección por VPH.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n', '', ''),
	(1690, 'Q2111-3183', 'Q', '1101176869', 'LAURA ARRIETA LARA', '3213289499', 'F', '29', 'PARTICULAR', '', '898201', '30215', 'Doctor ORLANDO BORRE ARRIETA', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cono" el producto de una conización cervical que mide 1.5 x 1.8 cms. de base y 1.5 cms. de altura, la superficie externa esta parcialmente pro una mucosa de color pardo claro sin lesiones aparentes. Sé lámina e incluye en su totalidad y se rotulan A, y B el vértice del cono.\r\n2. "Legrado endocervical" múltiples fragmentos de tejido de forma irregular, color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 1 ml. Se toma todo y se rotula C.\r\n\r\n\r\n', 'Los múltiples cortes del cérvix (rotulado A) muestran una reacción inflamatoria crónica con cambios citopáticos por VPH. La lesión compromete las líneas de resección exocervicales en algunos cortes.\r\nLa línea de resección endocervical está libre de lesión (cortes B).\r\nLos cortes rotulados C muestran fragmentos sueltos de endocervix libre de lesión.\r\n\r\n\r\n', '1.Cono LEEP:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n2. Legrado endocervical:\r\n-FRAGMENTOS SUELTOS DE ENDOCERVIX\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(1691, 'Q2111-3184', 'Q', '52001610', 'LAURA VICTORIA ANCHIQUE NUÑEZ', '3164470751', 'F', '52', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión benigna compuesta por epitelio escamoso que se dispone en un patrón papilomatoso con cambios citopáticos por VPH.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n\r\n', '', ''),
	(1692, 'Q2111-3185', 'Q', '1238346473', 'JEISYS ESTHER MEDINA BOYER', '3243017202', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-11-25', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1693, 'Q2111-3186', 'Q', '32055337', 'JHAVEYS ISMAEL MASA ROMERO', '3106716330', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4.7 x 0.5 cms. La superficie externa esta cuberieta por una serosa lisa y brillante con aumento de la trama vascular. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', '-APENDICE CECAL\r\n\r\n', '', ''),
	(1694, 'Q2111-3187', 'Q', '1052975557', 'ANAHIS CASTRO ARIAS', '3128030719', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro sin cambios.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1. Biopsia endoscópica de esófago:\r\n-FRAGMENTOS SUELTOS DE EPITELIO ESCAMOSO SIN CAMBIOS\r\n2. Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1695, 'Q2111-3188', 'Q', 'VEN247', 'EIDER ALEXANDER ESCORCIA THOMAS', '3206249346', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.2 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1696, 'Q2111-3189', 'Q', '1049926226', 'YAIR ALBERTO ALTAMIRANDA GOMEZ', '3208651819', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-11-25', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa esofágica tapizados por epitelio escamoso maduro. La lámina propia está edematosa, congestiva e infiltrada por linfocitos.\r\nLos cortes rotulados B muestran mucosa oxíntica cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1. Biopsia endoscópica de estómago:\r\n-ESOFAGITIS CRÓNICA\r\n2. Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1697, 'Q2111-3190', 'Q', '1043654102', 'MAICOL JAVIER GALARCIO MONTES', '3002126055', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mastectomía simple derecha" un fragmento de tejido de forma irregular, de color pardo claro con áreas amarillentas y consistencia elástica que mide 5.2 x 5 x 2.5 cms. La superficie externa es irregular y al corte se observa una superficie blanquecina que alternan con áreas amarillentas. Se toman cortes y se rotulan A.\r\n2. "Mastectomía simple izquierda" un fragmento de tejido de forma irregular, de color pardo claro con áreas amarillentas y consistencia elástica que mide 5.7 x 4.5 x 3.5 cms. La superficie externa es irregular y al corte se observa una superficie blanquecina que alternan con áreas amarillentas. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejido mamario compuesto por canalículos que reposan en un estroma escleroso. No hay componente lobulillar.\r\n\r\n\r\n\r\n', '1. Mastectomía simple derecha:\r\n-GINECOMASTIA\r\n2. Mastectomía simple izquierda:\r\n-GINECOMASTIA', '', ''),
	(1698, 'Q2111-3191', 'Q', '1122941337', 'SAMUEL ANDRES AGUDELO BUITRAGO', '3213381469', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2021-12-03', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Humero izquierdo" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia firme que mide 1.5 x 0.7 cms. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los múltiples cortes muestran tejidos oseo y cartilaginoso que conservan su estructura usual. Algunas espículas se observan desvitalizadas y reposan en un estroma fibroso. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', ' Biopsia de humero izquierdo:\r\n-VÉASE DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1699, 'Q2111-3192', 'Q', '1051887794', 'KIMBERLY TOVAR MARRUGO', '3007875838', 'F', '32', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora JENNIFER TORRES GOMEZ', NULL, '2021-12-09', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Placenta" se recibe una placenta con sus membranas y un segmento de cordón que pesa 170 gms. y mide 9 x 7.5 x 3 cms. La cara fetal esta cubierta por una serosa lisa y brillante y trae un segmento de cordón umbilical que mide 22 cms. de implantación marginal en el que se identifican tres vasos, la cara materna muestra una superficie cruenta de color pardo claro. Al corte se observa una superficie de color rosado finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta del tercer trimestre compuesta pro vellosidades pequeñas con abundantes nudos sincitiales. Hay alteración de los vasos espirales con necrosis y densa eosinofilia de la pared que contiene macrófagos espumosos (aterosis).\r\nLos hallazgos descritos son los descritos en el síndrome de hipoperfusión placentaria secundaria a preclampsia.\r\n\r\n\r\n', ' Placenta del tercer trimestre (170 gms.):\r\n-CAMBIOS SECUNDARIOS A HIPOPERFUSIÓN VASCULAR MATERNA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1700, 'Q2111-3193', 'Q', '1002027488', 'SERGIO LUIS OSORIO RODELO', '0000', 'M', '20', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor ALVARO MENDOZA BELEÑO', NULL, '2021-11-24', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.5 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA', '', ''),
	(1701, 'Q2111-3194', 'Q', '30764917', 'YANETH DEL CARMEN MARTINEZ PAJARO', '000', 'F', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2021-11-25', '2021-11-23', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero, trompa izquierda y derecha y ovario derecho" se recibe el producto de una histerectomía subtotal con sus trompas y el ovario izquierdo que pesa 75 gms. El cuerpo mide 6 x 5 x 4.5 cms. Esta parcialmente cubierta por una serosa lisa y brillante, la trompa derecha es tortuosa y mide 4 cms. La izquierda mide 4.3 cms. y el ovario mide 3.5 cms. Al corte la cavidad endometrial está tapizada por una mucosa de color rosado y el miometrio está ocupado por múltiples masas de color blanquecino y aspecto arremolinado, la mayor mide 1 cm. y la menor de unos pocos milímetros de localización submucosa, intramural y subserosa, las trompas conservan la morfología usual y el ovario muestra una cavidad que contiene un material achocolatado y mide 2.5 cms. en sus mayores dimensiones. En el mismo recipiente, se recibe, además, dos masas de color pardo claro y consistencia elástica que miden 3.5 x 3 x 2.5 y 0.8 x 0.6 x 0.5 cms. Al corte se observa una superficie de color pardo claro y aspecto arremolinado. Se toman cortes.\r\n\r\n', 'El endometrio es inactivo. El miometrio muestra focos aislados de glándulas y estroma endometrial. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregulares. Las trompas de Falopio conservan la morfología usual y el ovario muestra una cavidad tapizada por células luteinizadas con contenido de sangre.\r\n\r\n\r\n', ' Histerectomía abdominal subtotal con salpingectomía bilateral y ooforectomía izquierda:\r\n-ENDOMETRIO INACTIVO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n-QUISTE LÚTEO HEMORRÁGICO, ovario izquierdo', '', ''),
	(1702, 'L2111-115', 'L', '13820948', 'HERIBERTO DURAN ROBLES', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2021-11-24', '2021-11-24', 'VIRNA CARABALLO OSORIO', 'Sin rotular, se reciben 15 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido está compuesto por escasas células escamosas maduras sin cambios.\r\n\r\n\r\n\r\n', ' Citología de orina (seriada):\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n', '', ''),
	(1703, 'Q2111-3195', 'Q', '45475976', 'MIRTA CUENTAS VILLEGAS', '000', 'F', '59', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1704, 'Q2111-3196', 'Q', '1067943561', 'PAULA ANDREA USTA TIRADO', '3015374364', 'F', '26', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '898201', '30215', 'Doctora MAYELA CALDERON CARRASCAL', NULL, '2021-12-16', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe un punch de piel que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso. En el dermis se observa lesión tumoral constituida pro una proliferación de células nevicas, hay pigmento melánico.\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesión en piel dorso de espalda:\r\n-NEVUS MELANOCITICO INTRADÉRMICO', '', ''),
	(1705, 'Q2111-3197', 'Q', '9084510', 'AMAURI DEL CARMEN CABALEIRO TORRES', '3145618117', 'M', '70', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-06', '2021-11-25', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Pólipo de colon ascendente" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. Se toma todo y se rotulan A.\r\n2. "Pólipo de sigma" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan estructuras compuestas por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de colon ascendente:\r\n-ADENOMA TUBULAR \r\n2..Biopsia endoscópica de colon de sigma:\r\n-ADENOMA TUBULAR ', '', ''),
	(1706, 'Q2111-3198', 'Q', '1030541792', 'EMERSON FABIAN RUBIO', '3104831853', 'M', '34', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente con formación de agregados linfocides. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE \r\n-H.PYLORI PRESENTE', '', ''),
	(1707, 'Q2111-3199', 'Q', '9077525', 'FILADELFO GALARZA ROMERO', '3017381190', 'M', '70', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. Hay formación ocasional de acúmulos linfoides. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B revelan cuerpo gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(1708, 'Q2111-3200', 'Q', '1047439282', 'MARIA CAROLINA HERNANDEZ ORTEGA', '3012445635', 'M', '30', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1709, 'Q2111-3201', 'Q', '497183', 'JORGE ACEVEDO ORTEGA', '3008103608', 'M', '83', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan mucosa esofágica, hiperplásica. Uno de los cortes muestra epitelio escamoso con focos de mucosa gástrica con metaplasia intestinal.\r\nLos cortes B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-COMPATIBLE CON ESÓFAGO DE BARRETT\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(1710, 'Q2111-3202', 'Q', '1110518745', 'MAIKOL LUGO BRISNEDA', '3116767048', 'M', '29', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1711, 'Q2111-3203', 'Q', '33026168', 'LUZ NEIS CASTELLON CORREA', '3017150435', 'F', '38', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula que mide 8 x 3 x 3 cms., tapizada por una serosa de color pardo grisáceo. Al corte salida de un material biliar y la presencia de múltiples cálculos de color amarillento, la pared se encuentra engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1712, 'Q2111-3204', 'Q', '1007451233', 'SANDRA PAOLA SALAS IRIARTE', '3154904025', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Miomas" se reciben tres masas de tejido de forma ovoide de color blanquecino la mayor mide 6 x 4 x 3 cms. y la menor de 1 x 0.5 cms. de consistencia elástica y aspecto arremolinado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumores benignos mesenquimales compuestos por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n', ' Miomectomía:\r\n-LEIOMIOMAS', '', ''),
	(1713, 'Q2111-3205', 'Q', '33142062', 'DENIS DEL CARMEN TORRES DE SUAREZ', '000', 'F', '69', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora ADRIANA PAOLA LOPEZ', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7 x 4 x 3 cms. tapizada parcialmente por una serosa de color pardo grisáceo. Al corte la pared está adelgazada y conserva su aspecto aterciopelado, hay salida de cálculos de color negruzco en su interior. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1714, 'Q2111-3206', 'Q', '1044935038', 'ANGELIS SOFIA PORRAS CRESPO', '3015800463', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Osteomielitis radio izquierdo" se recibe se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide el mayor 2 cms. y el menor de 1 cms. \r\n\r\n\r\n\r\n', 'Los cortes revelan tejido fibroconectivo con edema, congestión e infiltrado mononuclear. No se identifica tejido óseo en el material enviado.\r\n\r\n\r\n', ' Biopsia de radio izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1715, 'Q2111-3207', 'Q', '1043294460', 'ENEIDA DEL CARMEN BELLO BUSTILLO', '3178475953', 'F', '17', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste ovario izquierdo" se recibe una masa ovoide de tejido que mide 2 x 1.5 cms. de color blanquecino y consistencia renitente con salida de un líquido claro. \r\n\r\n\r\n\r\n', 'Los cortes revelan la pared de un quíste tapizado por epitelio de tipo seroso.\r\n\r\n\r\n\r\n', '-CISTADENOMA SEROSO, ovario izquierdo', '', ''),
	(1716, 'Q2111-3208', 'Q', '30776848', 'OLGA LILIANA LENGUA CANOLE', '000', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" Se recibe una vesícula biliar que mide 6 x 3 x 2 cms. tapizada parcialmente por una serosa de color pardo grisáceo. Al corte su pared gruesa conserva su aspecto aterciopelado. Acompañado a esto un cálculo, ovoide de color amarillento que mide 2.5 x 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular, se observan además histiocitos espumosos subepiteliales.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n-COLESTEROLOSIS\r\n\r\n', '', ''),
	(1717, 'Q2111-3209', 'Q', '1051818344', 'AMAIRA LUCY CASTILLO BARRIOS', '000', 'F', '32', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Trompa izquierda y derecha" en un mismo recipiente, sin discriminar, se reciben dos segmentos de trompas de Falopio que miden cada una 2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Segmentos de trompa uterina que muestra la estructura usual.\r\n\r\n\r\n\r\n', '1.TROMPA UTERINA DERECHA. SEGMENTO	\r\n2.TROMPA UTERINA IZQUIERDA. SEGMENTO\r\n', '', ''),
	(1718, 'Q2111-3211', 'Q', '33157329', 'MARIA DEL ROSARIO MEZA BATISTA', '000', 'F', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7 x 2.5 x 2 cms. tapizada parcialmente pro una serosa de color pardo grisáceo. Al corte salida de material biliar, la mucosa presenta una formación nodular sésil que mide 0.8 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan vesícula biliar en cuya mucosa se observa una lesión polipoide constituida pro una proliferación de glándulas de tipo pilorico, el estroma es edematoso congestivo con infiltración mononuclear, el resto de la vesícula muestra su morfología habitual.\r\n\r\n\r\n', ' Colecistectomía:\r\n-VESÍCULA BILIAR CON ADENOMA TUBULAR\r\n\r\n', '', ''),
	(1719, 'Q2111-3212', 'Q', '1042576128', 'ZENAIDA ISABEL CHICO OCHOA', '000', 'F', '17', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 5 x 1.5 x 1 cms. tapizada por una serosa de color pardo grisáceo. Al corte la presencia de múltiples cálculos de color amarillento, la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1720, 'Q2111-3213', 'Q', '45497788', 'ELSA PACHECO PEREZ', '000', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Masa en región lumbar" se reciben dos fragmentos de tejido de aspecto membranoso que mide 1.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión quística tapizada por epitelio escamoso conteniendo queratina laminar.\r\n\r\n\r\n\r\n', ' Biopsia de piel de región lumbar:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(1721, 'Q2111-3214', 'Q', '45485289', 'ROCIO ANGELICA PEREZ CERVANTES', '000', 'F', '53', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 2 x 1 cms. cubierta por una serosa de color pardo grisáceo. Al corte salida de material biliar. Al corte la pared se encuentra engrosada y la mucosa conserva parcialmente su aspecto aterciopelado. Acompañado a esto, un cálculo ovoide de color amarillento que mide 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1722, 'Q2111-3210', 'Q', '33254539', 'DELFINA ARNEDO VELEZ', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro su luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1723, 'Q2111-3215', 'Q', '32878327', 'MILENA CASSIANI HERNANDEZ', '000', 'F', '44', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Producto de masa en axila derecha" se recibe una masa de tejido de forma ovoide que mide 5 x 2.5 x 1.5 cms. Cubierta parcialmente pro una elipse de piel de 4 cms. La masa es de color amarillento, consistencia blanda y aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', '-LIPOMA, axila derecha', '', ''),
	(1724, 'Q2111-3216', 'Q', '73231210', 'LUIS GABRIEL CARMONA CARMONA', '000', 'M', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar previamente abierta que mide 5 x 2.5 x 2 cms. tapizada por una serosa de color pardo grisáceo, la pared se encuentra marcadamente engrosada. Acompañada a esto, se reciben dos cálculos ovoides que miden 1.5 cms. de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía.\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1725, 'Q2111-3217', 'Q', '45520743', 'ROSANA ISABEL ALEMAN TERAN', '000', 'F', '42', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-11-29', '2021-11-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero" se recibe un cuerpo uterino que pesa 248 gms. y mide 10 x 10 x 6 cms. tapizado por una serosa de color pardo grisáceo y deformado por múltiples masas subserosas. Al corte la cavidad endometrial esta tapizada por una mucosa de color pardo claro. En el miometrio y a nivel subseroso se encuentran masas ovoides, blanquecinas de aspecto arremolinado, la mayor de las cuales mide 4 x 4 cms. y la menor de 1 x 0.5 cms. \r\nPor separado, rotulado "Trompa derecha" se recibe un segmento de trompa que mide 2 cms. Se toman cortes y se rotulan A.\r\nun 3er. recipiente, rotulado "Trompa izquierda" se recibe un segmento de trompa con su fimbria que mide 3 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino cuyo endometrio se encuentra autólisado, en el miometrio hay focos de adenomiosis y las  múltiples masas descritas corresponden a leiomiomas. Se encuentran además, segmentos de trompas de Falopio izquierda y derecha.\r\n\r\n\r\n\r\n', ' Cuerpo uterino (248 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS SUBMUCOSOS E INTRAMURALES\r\n-TROMPA DE FALOPIO IZQUIERDA Y DERECHA', '', ''),
	(1726, 'L2111-116', 'L', '13820948', 'HERIBERTO DURAN ROBLES', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2021-11-29', '2021-11-26', 'OLIVA MARRUGO GRICE', 'Sin rotular, se reciben 8 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos contienen células epiteliales sin alteraciones.\r\n\r\n\r\n', ' Extendido de sedimento urinario.\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n', '', ''),
	(1727, 'L2111-117', 'L', '1222129642', 'JHONATAN DAVID AREVALO GALVIS', '000', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-11-29', '2021-11-26', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 3.8 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de L.C.R:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1728, 'Q2111-3218', 'Q', '1143338617', 'YURANIS PAOLA RUIZ GUTIERREZ', '000', 'F', '32', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(1729, 'Q2111-3219', 'Q', '73116755', 'ISAAC SEGUNDO MANGA OROZCO', '000', 'M', '57', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1730, 'Q2111-3220', 'Q', '52477188', 'SILVANA MARGARITA GONZALEZ TURIZO', '3006500711', 'F', '43', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1731, 'Q2111-3221', 'Q', '42204346', 'ADELA DEL CARMEN BENAVIDES CARDENAS', '3014346536', 'F', '62', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Bulbo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Mucosa de sigma" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal cuya morfología está preservada. la lámina propia está edematosa, congestiva y densamente infiltrada por linfocitos y células plasmáticas. No hay granulomas ni parásitos.\r\nLos cortes rotulados C muestran mucosa colónica cuya lámina propia está moderadamente infiltrada por linfocitos, células plasmáticas y eosinófilos ocasionales. No hay cambios en el epitelio glandular, granulomas ni parásitos.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n2.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n\r\n3.Biopsia endoscópica de colon sigmoides:\r\n-COLITIS CRÓNICA\r\n', '', ''),
	(1732, 'Q2111-3222', 'Q', '30761166', 'MARELIS NUÑEZ DE HERRERA', '3145893572', 'F', '60', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1733, 'Q2111-3223', 'Q', '45431775', 'ZAIDA GUZMAN MONDOL', '3012014858', 'F', '64', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotula A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'El espécimen rotulado A consiste en su totalidad de mucosa con características del antro gástrico. No se encuentra epitelio escamoso.\r\nLos cortes rotulados B muestra fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE MUCOSA COMPATIBLE CON HETEROTOPIA GÁSTRICA\r\n\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1734, 'Q2111-3224', 'Q', '1050720722', 'CAROLINA PALOMINO AVILA', '3006753026', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DOctor ANTONIO DE JESUS ARAUJO OROZCO', NULL, '2021-12-10', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor en quinto dedo de mano derecha" se reciben varios fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que en conjunto hacen un volumen de  0.5 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de piel glabra en la que se observa, por debajo dl epitelio una proliferación de pequeños vasos ramificantes, que reposan en un estroma mixoide. La lesión está fragmentada, lo que impide una valoración diagnóstica más precisa.\r\n\r\n\r\n\r\n', ' Resección de lesión en 5to. dedo de mano derecha.\r\n-COMPATIBLE CON ANGIOFIBROMA DE LOS TEJIDOS BLANDOS\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(1735, 'Q2111-3225', 'Q', 'VEN31403148', 'YURIBYSKY VALERIA BARRIOS JARAMILLO', '6907017', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa irregular de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1736, 'Q2111-3226', 'Q', '1041991767', 'MARIA ISABEL LOZANO MORALES', '3004990809', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2 x 1.4 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una mucosa irregular de color pardo claro. Al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2 x 1.4 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una mucosa irregular de color pardo claro. Al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA', '', ''),
	(1737, 'Q2111-3227', 'Q', '1043641865', 'EDWIN JOSE LLAMAS CASTRO', '3104450085', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo claro que en su extremo distal, toma una coloración violácea. Al corte se encuentra luz dilatada que contiene un material grumoso. de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1738, 'Q2111-3228', 'Q', '1238338146', 'YESICA PAOLA BELTRAN MARTINEZ', '000', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Embarazo ectópico derecho" se recibe una trompa de Falopio que mide 7.5 x 2.2 x 1.8 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa lisa y brillante de color violácea. Al corte se encuentra una cavidad de paredes gruesas irregulares en la que se identifican un embrión de 8 ml. de longitud, cráneo-caudal.\r\n\r\n\r\n\r\n', 'Los cortes muestran trompa de Falopio en la que se identifican un tejido placentario que infiltra la pared y un embrión.\r\n\r\n\r\n\r\n', ' Salpingectomía derecha:\r\n-EMBARAZO TUBÁRICO\r\n', '', ''),
	(1739, 'Q2111-3229', 'Q', 'VEN22457355', 'ROXANA CAROLINA GUTIERREZ PAULINE', '3134675522', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-11-29', '2021-11-29', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Mioma" se recibe una masa de tejido de forma irregular que mide 2.2 cms. en sus mayores dimensiones, la superficie externa es irregular y la consistencia es firme. Al corte es de color blanquecino y aspecto fasciculado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n\r\n', '-LEIOMIOMA UTERINO\r\n\r\n\r\n\r\nOBSERVACIONES: Espécimen de miomectomía.\r\n', '', ''),
	(1740, 'Q2111-3230', 'Q', '1047500358', 'IVAN RAMOS PINO', '3016553010', 'M', '23', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1741, 'Q2111-3231', 'Q', '1042346419', 'YESSICA JOHANA MELENDEZ MENDOZA', '3135573135', 'F', '35', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de exocervix" se recibe fragmento de tejido  que mide 0.3 cms., de color blanquecino y consistencia elástica.\r\nAcompañado a esto, se recibe fragmento de tejido que mide 0.1 cm. Se toma todo.\r\n\r\n\r\n\r\n', 'Cérvix tapizado por epitelio escamoso con cambios coilociticos asociados, el estroma infiltrado por abundantes linfocitos, plasmocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CONDILOMA PLANO\r\n-CERVICITIS AGUDA Y CRÓNICA SEVERA\r\n\r\n', '', ''),
	(1742, 'Q2111-3232', 'Q', '33112375', 'BERTHA AURA DEL CARMEN COLOMBO JIMENEZ', '3008115325', 'F', '79', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Fondo" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos,  plasmocitos en moderada cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides y atrófia leve del epitelio.  No hay metaplasia intestinal ni cambios displásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica de estómago (fondo):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA Y ATROFIA LEVE', '', ''),
	(1743, 'Q2111-3233', 'Q', '73579953', 'ENRIQUE GUZMAN ACUÑA', '3017327069', 'M', '45', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide  el mayor 0.3 cms. y el menor de 0.1 cm. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1744, 'Q2111-3234', 'Q', '1043309520', 'ISABELA BOSIO VASQUEZ', '3008153866', 'F', '11', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes rotulados A revelan mucosa gástrica antral infiltrada por  linfocitos y plasmocitos de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C revelan cuerpo gástrico con inflamación crónica leve.\r\nLos cortes B y D revelan bulbo y segunda porción del duodeno y muestran un infiltrado inflamatorio agudo y crónica mediado por linfocitos, plasmocitos y neutrófilos. No se observan parásitos intestinales en la muestra enviada.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de bulbo duodenal:\r\n-CON INFLAMACIÓN AGUDA Y CRÓNICA LEVE\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-CON INFLAMACIÓN CRÓNICA LEVE\r\n4.Biopsia endoscópica de 2da. porción del duodeno:\r\n-CON INFLAMACIÓN AGUDA Y CRÓNICA LEVE', '', ''),
	(1745, 'Q2111-3235', 'Q', '45461582', 'JANETH DEL CARMEN OSTA LEFRAN', '3008116766', 'F', '57', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1746, 'Q2111-3236', 'Q', '9084510', 'AMAURI DEL CARMEN CABALEIRO TORRES', '3145618117', 'M', '70', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 y 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan mucosa oxíntica sin cambios.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-FRAGMENTOS DE MUCOSA OXÍNTICA SIN CAMBIOS', '', ''),
	(1747, 'Q2111-3237', 'Q', '126807704', 'SAMANTHA MERY RAMIREZ', '3013651147', 'F', '11', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes de A revelan fragmentos de mucosa esofágica sin cambios.\r\nLos cortes B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C revelan mucosa duodenal con un infiltrado inflamatorio agudo y crónica moderado. No se observan parásitos intestinales en la muestra.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE MUCOSA ESOFÁGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de 2da. porción del duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL CON INFLAMACIÓN AGUDA Y CRÓNICA MODERADA', '', ''),
	(1748, 'Q2111-3238', 'Q', '1047416431', 'JUAN DAVID BELLO AVILA', '302523159', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es opaca, congestiva. Al corte la luz ocupada por un material purulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1749, 'Q2111-3239', 'Q', '167406500', 'HIJA DE GABRIELA JIMENEZ BRAVO', '3104396038', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-27', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Divertículo de Meckel" fragmento de tejido de forma cilíndrica, la serosa es de color pardo claro que mide 1 cm. Al corte salida de un material de aspecto mucoide. Se toman cortes y se rotulan A.\r\n2. "Resección de intestino delgado y colon ascendente" segmento de intestino delgado que mide 14 cms. tapizado por una serosa de color pardo claro, el segmento de colon mide 8 cms. la serosa es lisa y brillante a nivel del ciego se observa la cabeza de la invaginación. El apéndice cecal mide 5 cms. Al corte del intestino delgado la mucosa muestra la estructura usual. Se toman cortes del intestino delgado y se rotulan B, C área invaginada de colon, D apéndice cecal y E área invaginada.\r\n\r\n', 'Los cortes A revelan un divertículo verdadero que muestra edema leve y congestión.\r\nLos cortes B y C revelan segmento de intestino delgado y grueso con edema de la pared, congestión vascular e inflamación aguda.\r\nEl apéndice cecal muestra la estructura usual.\r\n\r\n\r\n\r\n', '1. DIVERTÍCULO DE MECKEL\r\n2. Hemicolectomía derecha:\r\n-INVAGINACIÓN ILEO, CÓLICA CON EDEMA, CONGESTIÓN VASCULAR E INFLAMACIÓN AGUDA\r\n3. APÉNDICE CECAL', '', ''),
	(1750, 'Q2111-3240', 'Q', '1048608849', 'MARIANA LUCIA BARRIOS DE AVILA', '3207568531', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice + epiplón" se recibe un apéndice cecal fragmentada que mide 8 cms. la serosa es opaca, despulida y de color pardo oscuro. Al corte la luz ocupada por material oscuro.\r\nAcompañado a esto, fragmento de epiplón de color blanco amarillento que mide 6 x 3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. Además, fragmentos de tejido adiposo densamente infiltrado por neutrófilos.\r\n\r\n\r\n\r\n', '1. APENDICITIS AGUDA\r\n2.FRAGMENTO DE EPIPLÓN CON INFLAMACIÓN AGUDA', '', ''),
	(1751, 'Q2111-3241', 'Q', '45504259', 'ARGENIT ALICIA JULIO POLO', '3135109857', 'F', '51', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-12-15', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cono" un cono cervical que mide 3 x 2 x 0.7 cms. El labio anterior viene marcado con dos sedas a la hora 12. Se toman cortes y se rotulan así: A labio anterior, B labio posterior.\r\n2. "Legrado endocervical" material mucoide que promedia 0.5 cms. Se intesta procesar y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B revelan cérvix con una lesión intraepitelial escamosa de alto grado (NIC 2) que se extiende a algunas glándulas endocervicales. Los bordes de resección vaginal están libres de lesión, al igual que el vértice.\r\nEl legrado endocervical esta representado por moco.\r\n\r\n\r\n', '1.Conización cervical:\r\n-LESIÓN INTRAEPITELIAL ESCAMOSA DE ALTO GRADO (NIC 2) CON EXTENSIÓN GLANDULAR\r\n-BORDES DE RESECCIÓN LIBRES DE LESIÓN\r\n2.Legrado endocervical:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1752, 'Q2111-3242', 'Q', '9139993', 'WADITH JOSE SERPA OLIVERO', '3229228493', 'M', '56', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 cms. la serosa es blanquecina y congestiva. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1753, 'Q2111-3243', 'Q', '45540837', 'TATIANA INES CORTINA VILLALBA', '3002509283', 'F', '39', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero" se recibe un cuerpo uterino que pesa 589 gms. y mide 13 x 12 x 10 cms. cubierto por una serosa de color pardo amarillento deformado en su cara anterior y posterior. Al corte la cavidad endometrial está ocupada por la presencia de cinco masas blanquecinas, arremolinadas la mayor mide 3 x 2 cms. El endometrio es de color rosado y muestra cambios de autólisis, el espesor del miometrio mide 3 cms. y muestra múltiples masas de iguales características. Se toma cortes.\r\nAcompañando a esto, rotulado "Trompa izquierda" segmento de trompa de Falopio que mide 4 cms. Se toman cortes y se rotulan A.\r\nAcompañando a esto, rotulado "Trompa derecha" segmento de trompa de Falopio que mide 1.5 cms. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes revelan cuerpo uterino cuyo endometrio muestra cambios por autólisis, las masas descritas corresponden a leiomiomas, las trompas de Falopio muestran la estructura usual.\r\n\r\n\r\n\r\n', ' Útero 8(589 gms.):\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES\r\n-TROMPA DE FALOPIO IZQUIERDO\r\n-TROMPA DE FALOPIO DERECHO', '', ''),
	(1754, 'Q2111-3244', 'Q', 'VEN27253947', 'YOEGLISMAR COROMOTO MARIN VALLES', '3138426229', 'F', '24', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-12-06', '2021-11-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Teratoma ovario izquierdo" previamente abierto, se reciben tres fragmentos de tejido que corresponden a la cápsula de la lesión que mide 9 x 3, 9 x 4 y 3 x 2 cms. aproximadamente traen adherido múltiples pelos y material sebáceo, la cara externa es de color amarillento.\r\nAcompañado a esto, se recibe un fragmento de tejido de color amarillento constituido por material sebáceo y abundantes pelos. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan un tumor germinal constituido por piel, anexos dérmicos, tejido adiposo y epitelio respiratorio.\r\n\r\n\r\n\r\n', '-TERATOMA QUÍSTICO MADURO, ovario izquierdo', '', ''),
	(1755, 'Q2112-3245', 'Q', '26956676', 'CATALINA CASTRO DE GALERAS', '3155105118', 'F', '81', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-09', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Trucut de seno derecho" se reciben múltiples diminutos fragmentos de tejido de forma filiformes de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran diminutos fragmentos de tejido mamario. No se observan cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia tru-cut de mama derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1756, 'Q2112-3246', 'Q', '33340029', 'JUDITH ESCALANTE PACHECO', '3205491217', 'F', '52', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de piel de forma ovalada que mide 0.3 cms. en la superficie externa  se observa una lesión sobre elevada e hipopigmentada que mide 0.2 cms. Se toma todo en dos cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran piel en la que se destaca un crecimiento lobular de la epidermis hacia la dermis. Las células epiteliales contienen inclusiones eosinofílicas grandes ("cuerpos de moluscos").\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-MOLUSCO CONTAGIOSO\r\n\r\n', '', ''),
	(1757, 'Q2112-3247', 'Q', '33106884', 'NORMA DEL SOCORRO FERNANDEZ VASQUEZ', '3114052266', 'F', '68', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-09', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia tru-cut de seno derecho" se reciben múltiples fragmentos de tejido de forma filiformes de color pardo claro y consistencia blanda que promedian 0.9 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células con núcleos pleomórficos, hipercromáticos que se disponen en cordones y nidos sólidos que infiltran el estroma. El tumor está presente en solo un diminuto fragmento de tejido. No se identifica infiltración linfovascular. \r\nEl volumen tumoral en la muestra es muy pequeño para establecer una graduación con seguridad.\r\n\r\n\r\n\r\n', ' Biopsia por tru-cut de mama derecha:\r\n-CARCINOMA DUCTAL, TIPO NO ESPECIAL, INFILTRANTE\r\n\r\n\r\n', '', 'Ver Descripción microscópica.\r\n\r\nSe retira 1 bloque por la señora CARMEN TAPIAS FERNÁNDEZ CC. 33.226.975 (9 de diciembre/2021)'),
	(1758, 'Q2112-3248', 'Q', '33308498', 'LUZ MARIA CERRO MELENDEZ', '3004446177', 'F', '40', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello uterino con una reacción inflamatoria crónica parcialmente cubierta por un epitelio escamoso con cambios citopáticos por VPH.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n\r\n\r\n', '', ''),
	(1759, 'Q2112-3249', 'Q', '1148692205', 'ANAIS ARZUZA HERRERA', '3013870319', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-09', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste dermoide" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia renitente que mide 1.2 x 1 x 0.8 cms. La superficie externa está parcialmente cubierta por una elipse de piel que mide 0.7 x 0.3 cms. Al corte hay salida de un material grumoso de color pardo claro. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada pro epitelio escamoso que reposa en un estroma que contiene anexos cutáneos.\r\n\r\n\r\n\r\n', ' Resección de masa en región anterior del cuello:\r\n-QUÍSTE DERMOIDE\r\n\r\n', '', ''),
	(1760, 'Q2112-3250', 'Q', '1047392560', 'DANIELA MARIA JIMENEZ PINEDA', '3042363381', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fibroadenoma de mama derecha" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 2.6 x 2 x 1.7 cms. La superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno compuesto por la proliferación combinada de elementos glandulares y estromales.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(1761, 'Q2112-3251', 'Q', '1041991470', 'LUIS CAMILO MORENO OROZCO', '3118362655', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-10', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste dermoide" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.7 x 1.2 x 1.5 cms. La superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Al corte se observa una superficie de color pardo claro que alternan con áreas de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno compuesto por la proliferación de células fusiformes dispuestas en un patrón irregular mezclándose con numerosas células xantomatosas. No hay actividad mitótica ni focos de necrosis.\r\n\r\n\r\n\r\n', ' Resección de lesión en región occipital lateral izquierda:\r\n-HISTIOCITOMA FIBROSO\r\n\r\n', '', ''),
	(1762, 'Q2112-3252', 'Q', '45495411', 'DELUX SILVA MEÑACA', '30000', 'F', '52', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Resección de masa en región dorsal" se reciben múltiples fragmentos de tejido de forma irregular de color pardo grisáceo y consistencia blanda que juntos miden 1.5 x 1.2 x 0.8 cms. Al corte se observa una cavidad que contiene un material grumoso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de una estructura cavitada parcialmente cubierta por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región dorsal:\r\n-QUÍSTE QUERATINOSO TIPO EPIDERMOIDE (fragmentos)\r\n\r\n\r\n', '', ''),
	(1763, 'Q2112-3253', 'Q', '22697175', 'DERLIN YUSNEY MEDINA', '000', 'F', '28', 'CLIN. SAN JOSE DE TORICES SAS', '', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Restos ovulares" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia friable que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por fragmentos de decidua que alterna con fragmentos de endometrio hipersecretor con Reacción de Arias Stella. No se observan elementos trofoblasticos.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE DECIDUA Y DE ENDOMETRIO HIPERSECRETOR CON REACCIÓN DE ARIAS-STELLA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1764, 'Q2112-3254', 'Q', '23216242', 'MARIA CONCEPCION LOZANO DE CARTA', '000', 'F', '75', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor JOSE RODRIGUEZ', NULL, '2021-12-09', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Segmento de masa pulmonar" ocho fragmentos filiformes de tejido de color pardo grisáceo y consciencia elástica que promedian 1.5 cms. En el mismo recipiente, se recibe, además, dos fragmentos de tejido de aspecto membranoso que miden 1.2 x 1 y 1.2 x 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Pleura parietal" dos fragmentos de tejido de aspecto membranoso de color pardo amarillento y consistencia blanda que miden 2.8 x 0.5 y 1.3 x 0.4 cms. en sus mayores dimensiones. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran un tumor maligno compuesto por estructuras glanduliformes de células pleomórficas con núcleos irregulares, hipercrómaticos, que en algunos campos se proyectan hacia la luz formando las llamas células "en tachuela". Reposan en un estroma fibroso con focos de metaplasia osea. Hay focos de infiltración compuestos por células grandes, de núcleos monstruosos que se disponen irregularmente en el estroma. \r\nLos cortes rotulados B muestran lóbulos de tejido adiposo recubiertos por un epitelio plano simple. No se encuentra tumor en esta muestra.\r\n\r\nCOMENTARIO: Los cambios descritos son compatibles con un CARCINOMA BRONQUIOLOALVEOLAR NO MUCINOSO, INFILTRANTE, sin embargo, es necesario practicar estudios complementarios con inmunohistoquímica para una definición diagnóstica más precisa.\r\n\r\n', '1.Resección de segmento de masa en pulmón derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n2.Biopsia de pleura parietal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1765, 'Q2112-3255', 'Q', '23191392', 'LEONOR CASTILLO GUZMAN', '000', 'F', '53', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Resección de masa en nuca" se reciben dos fragmentos de tejido de forma irregular de color amarillento y aspecto adiposo que juntos miden 23 x 1.6 x 0.8 cms. La superficie externa es multilobulada y al corte se observa una superficie untuosa de color amarillento, consistencia blanda. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor mesenquimal benigno compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Resección de masa en nuca:\r\n-LIPOMA\r\n\r\n', '', ''),
	(1766, 'Q2112-3256', 'Q', '9093335', 'UVIBERTO ENRIQUE HERNANDEZ ACUÑA', '000', 'M', '67', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de resección de masa en región pronto parietal derecha" se reciben múltiples fragmentos de tejido de forma irregular de color pardo amarillento y aspecto adiposo que juntos miden 3.8 x 2 x 1.5 cms. Al corte se observa una superficie untuosa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de un tumor mesenquimal benigno compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Resección de masa en región fronto parietal derecha:\r\n-LIPOMA (FRAGMENTOS)\r\n\r\n', '', ''),
	(1767, 'Q2112-3257', 'Q', '1143391793', 'JULIETH PAOLA CASTILLO RIVERA', '3135554643', 'F', '25', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.2 x 0.7 cms. La superficie externa esta cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1768, 'Q2112-3258', 'Q', '33248024', 'ZANDRA PATRICIA GOMEZ MENDOZA', '3162325944', 'F', '49', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 11.5 x 2.3 cms. La superficie externa esta parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada, la mucosa ha perdido su aspecto aterciopelado y hay salida de tres cálculos facetados de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1769, 'L2112-118', 'L', '1042583626', 'DANNA MAJUL ZAMORA', '3012296105', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-03', '2021-12-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "LCR" se reciben 4 ml. de un líquido transparente. Se centrifuga y se hace extendido del sediemnto.\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1770, 'Q2112-3259', 'Q', '1043960318', 'ANNY LUCIA AVILA ARRAUT', '3052293156', 'F', '17', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe elipse de piel que mide 2.5 x 1.5 cms. presenta una formación sobreelevada de 1 cm. Al corte formación nodular de 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se observa lesión quística tapizada por epitelio escamoso conteniendo pelos en su interior y un infiltrado inflamatorio agudo severo, dicha lesión está rodeada de un infiltrado inflamatorio agudo y crónico moderado.\r\n\r\n\r\n', ' Extirpación de lesión en glúteo izquierdo:\r\n-QUÍSTE PILONIDAL', '', ''),
	(1771, 'Q2112-3260', 'Q', '30881200', 'JACKELINE PAYARES CASTAÑO', '3168376778', 'F', '42', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotula A.\r\n2. "Fondo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n3. "Cuerpo" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes A revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear leve, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B revelan fondo gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear leve con formación de folículo linfoide, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes C revelan cuerpo gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE Y H.PYLORI PRESENTE\r\n2.Biopsia endoscópica de estómago (fondo):\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE Y H.PYLORI PRESENTE\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE Y H.PYLORI PRESENTE', '', ''),
	(1772, 'Q2112-3261', 'Q', '26450228', 'XIOMARA NAILETH LARA SARMIENTO', '3243045011', 'F', '22', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una formación nodular que mide 4 x 3 x 2 cms. de forma ovoide de color blanquecino y consistencia elástica. Al corte una superficie de color blanquecino multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de lesión en mama izquierda:\r\n-FIBROADENOMA', '', ''),
	(1773, 'Q2112-3262', 'Q', '1142938000', 'AKON MENDOZA RODRIGUEZ', '3168182910', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctores ANTONIO MARIA MARTINEZ', NULL, '2021-12-13', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor dedo medial mano derecha" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que miden 0.6 cms. de diámetro mayor. Se toma todo.\r\n\r\n\r\n\r\n', 'La muestra esta constituida por tejido fibroso que muestra una reacción inflamatoria crónica granulomatosa a cuerpo extraño. En la muestra no se encuentran elementos neurales ni cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en dedo medial de mano derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(1774, 'Q2112-3263', 'Q', '1201287306', 'JHOYDER DAVID MERCADO GARCIA', '3002715303', 'M', '0', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'doctora BLEYDIE ESPINOSA ARIZA', NULL, '2021-12-13', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se reciben dos fragmentos de tejido el mayor mide 2 x 0.5 cms. y el menor de 1 x 0.5 cms. de color pardo claro y consistencia elástica. \r\nNo se reconoce apéndice cecal. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo, congestivo con una reacción inflamatoria mixta, además se observa un ganglio linfático que muestra su estructura usual.\r\n\r\n\r\n\r\n', '-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(1775, 'Q2112-3264', 'Q', 'VEN7666845', 'JOSHUA DAVID REYES PRIMERA', '3153213354', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-12-13', '2021-12-04', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Pie de tercio distal pierna izquierda" un punch de piel que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Pie de tercio distal pierna izquierda" dos fragmentos de tejido de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran piel con ligera hiperplasia del epitelio escamoso, el dermis muestra edema, áreas de fibrosis y un infiltrado inflamatorio agudo mediado por neutrófilos, eosinófilos e inflamación crónica moderada que se extiende hasta la hipodermis.\r\nLos cortes B solo revelan fragmentos de tejido con inflamación aguda, crónica severa y focos de necrosis. En la muestra enviada no se observan cambios que sugieran leishmaniasis como tampoco microorganismos.\r\n\r\n', ' Biopsia de piel de pierna izquierda con:\r\n-EDEMA ÁREAS DE FIBROSIS E INFLAMACIÓN AGUDA Y CRÓNICA SEVERA\r\n\r\n\r\n\r\nNOTA: Caso visto en conjunto con los doctores José Caraballo y Ana Manga.', '', ''),
	(1776, 'Q2112-3265', 'Q', '1043653632', 'HEIDY LUCIA MONTES GONZALEZ', '3003940878', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1777, 'Q2112-3266', 'Q', '1047395013', 'YIRIS YAICETH MOSQUERA CARCAMO', '3114311639', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DOctor ANTONIO DE JESUS ARAUJO OROZCO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Muñeca izquierda" se reciben dos fragmentos de tejido de forma irregular de color blanquecino que miden 1.5 cms. Al corte una formación quística con salida de material mucoide. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de tejido fibroso denso con zonas de degeneración quística.\r\n\r\n\r\n\r\n', '-GANGLIÓN, muñeca izquierda', '', ''),
	(1778, 'Q2112-3267', 'Q', '73577579', 'CARLOS ENRIQUE CARRASQUILLA BARONE', '00', 'M', '45', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo con formación de agregados linfoides, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(1779, 'Q2112-3268', 'Q', '1041989418', 'MICHELL MARIANA HERNANDEZ QUINTANA', '3106810080', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 0.5 cms. tapizada por una serosa opaca, de color pardo grisáceo y al corte tiene adherido material fibrinopurulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1780, 'Q2112-3269', 'Q', '1047370722', 'JHON MARIO VILLADIEGO CRESPO', '6699423', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Región suprapubica" se recibe un punch de piel pilosa que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan estructura compuesta pro epitelio escamoso hiperplásico con atípias coilociticas, hipergranulosis que descansa en un tallo de tejido fibroconectivo.\r\n\r\n\r\n\r\n', '-PAPILOMA ESCAMOSO, región suprapubica', '', ''),
	(1781, 'Q2112-3270', 'Q', '1237441305', 'SARAHY LINOR BENITEZ LEDESMA', '00', 'F', '19', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. de color pardo oscuro, la serosa presenta una solución de continuidad de 1 cm. se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared densamente infiltrada por PMN neutrófilos que se extiende hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n\r\n', '', ''),
	(1782, 'Q2112-3271', 'Q', '73193307', 'EVER ENRIQUE MINOTAS JARAMILLO', '000', 'M', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor JHOANNY CONTRERAS', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. Tra adherido abundante grasa periapendicular, la serosa es opaca de color pardo oscuro. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared densamente infiltrada por PMN neutrófilos que se extiende hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE', '', ''),
	(1783, 'Q2112-3272', 'Q', '29600536', 'RASHEEL ALEXANDRA VARGAS ACOSTA', '000', 'F', '20', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-06', '2021-12-04', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe masa de tejido de forma ovoide de color pardo claro y consistencia elástica que mide 8 x 6 x 4 cms. Al corte una superficie multinodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de tumor en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(1784, 'Q2112-3273', 'Q', '23139594', 'ADALGIZA DEL SOCORRO JARABA CASTILLO', '000', 'F', '44', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero y trompas" se recibe un cuerpo uterino que pesa 206 gms. y mide 8 x 7.5 x 5.5 cms. en sus mayores dimensiones, la superficie externa esta cubería por una serosa lisa y brillante. Al corte se encuentra una cavidad endometrial tapizada por una mucosa gruesa de color rosado y grisáceo y en el miometrio se encuentran múltiples nódulos esféricos de color blanquecinos, el mayor de los cuales mide 1.5 cms. de diámetro mayor. \r\nSeparadamente, se recibe "Trompa izquierda" un fragmento tubular de tejido que mide 4 cms. de longitud por 0.6 cms. de diámetro, la luz esta dilatada y contiene un material de color pardo oscuro. \r\nRotulado "Trompa derecha" un fragmento de trompa de Falopio que mide 5 x 0.6 cms. Se toman cortes.\r\n\r\n\r\n', 'El endometrio es secretor. En el miometrio hay múltiples focos de glándulas y estroma endometrial. Las masas descritas están compuestas por fibras musculares lisas dispuestas irregularmente.\r\nLas trompas son normales.\r\n\r\n\r\n\r\n\r\n', ' Cuerpo uterino y trompas (206 gms.):\r\n-ENDOMETRIO SECRETOR\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS INTRAMURALES\r\n-TROMPAS DE FALOPIO', '', ''),
	(1785, 'Q2112-3274', 'Q', '1128061462', 'YEIDYS PAOLA ALVAREZ JIMENEZ', '3017662618', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Fibroadenoma mama izquierda" se recibe una masa d etejido ligeramente esférica que mide 3.5 cms. en sus mayores dimensiones, la superficie externa presenta pequeñas nodulaciones y al corte se encuentra una superficie multinodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(1786, 'Q2112-3275', 'Q', '1041987366', 'SANTIAGO LEAL PEREZ', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo grisáceo. Al corte la luz marcadamente dilatada que contiene un material viscoso. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n', '', ''),
	(1787, 'Q2112-3276', 'Q', '1101442218', 'YIRALIS MARIA GUERRERO CASTRO', '3004211926', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa en mama derecha" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia dura, elástica que miden respectivamente 2.5 y 3 cms. en sus mayores dimensiones. La superficie externa esta cubierta por una fina membrana transparente y al corte se encuentra una superficie multinodular de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(1788, 'Q2112-3277', 'Q', 'VEN6243560', 'SARA VICTORIA UZCATEGUI MARQUEZ', '3244762871', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 0.6 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa lisa y brillante. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1789, 'Q2112-3278', 'Q', '1051889917', 'LUIS DAVID CASTRO MACHACON', '3046209071', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 0.8 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro con vasos prominentes. Al corte la pared se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro.  Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual. En la luz se encuentran abundantes huevos de Ascaris lumbricoides.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(1790, 'Q2112-3279', 'Q', '1001835532', 'LUIS ALBERTO MORALES RUIZ', '100000', 'M', '20', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo grisáceo. Al corte se encuentra una luz dilatada que contiene un material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1791, 'Q2112-3280', 'Q', '1138082574', 'DAMIAN HERNANDEZ PEÑA', '000', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-12-09', '2021-12-07', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1792, 'Q2112-3281', 'Q', '45761901', 'EVERLET ZUÑIGA MENDEZ', '0000', 'F', '51', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Pólipo" se recibe envuelto en un material mucoide, se reciben varios fragmentos de tejido de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 0.4 ml. mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de endocervix:\r\n-PÓLIPO ENDOCERVICAL (fragmentos)\r\n\r\n', '', ''),
	(1793, 'Q2112-3282', 'Q', '9200173', 'MANUEL BATISTA ZUÑIGA', '000', 'M', '77', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben cuatro pequeños fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian un diámetro mayor de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes múltiples cortes muestran mucosa gástrica antral cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. El componente glandular conserva su morfología habitual con focos de metaplasia intestinal completa (tipo I). No se encuentra actividad inflamatoria, presencia de H.pylori ni cambios neoplásicos.\r\n\r\n\r\n\r\n  ', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA CON FOCOS DE METAPLASIA INTESTINAL COMPLETA (TIPO I)\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1794, 'Q2112-3283', 'Q', '33117248', 'MARIA DEL SOCORRO BUENDIA MADERO', '000', 'F', '76', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctora MANUELA BERROCAL', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. Lesión frontal medial" elipse de piel que mide 2.8 x 1.5 cms. e su parte central presenta una formación elevada de aspecto verrucoso que mide 0.6 cms. en su mayor dimensión. Se toman cortes así: A1 lesión, A2 líneas de resección.\r\n2. "Lesión frontal supraciliar" un fragmento de piel de forma irregular, que mide 0.8 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Tumor en piel en punta nasal" elipse de piel que mide 1.5 x 1 cms. en su mayor dimensión. La superficie externa es de color pardo claro. Al corte, por debajo de la epidermis, se encuentra una zona de color blanquecina. Se toman cortes y se rotulan C.\r\n4. "Lesión en región infraorbitaria derecha" elipse de piel que mide 1.4 x 0.8 cms. en la parte externa muestra una elevación de forma irregular, de color grisáceo, que mide 0.5 cms. en su mayor dimensión. Se toman cortes y se rotulan así: D1 lesión, D2 línea de resección. \r\n', 'Los cortes rotulados A muestran piel en cuya dermis se encuentra un tumor epitelial compuesto por células pequeñas, basaloides, que se disponen en nidos sólidos y cordones con empalizada periférica. Las líneas de resección están libres de tumor.\r\nLos cortes rotulados B y C muestran piel en cuya dermis se encuentra un tumor epitelial compuesto por células pequeñas, basaloides, que se disponen en nidos sólidos y cordones con empalizada periférica. Las lesiones están completamente extirpadas.\r\nLos cortes rotulados D muestran piel cuya epidermis está engrosada a expensas de una proliferación de células basaloides que rodean espacios que contienen queratina laminar. No hay cambios neoplásicos.\r\n\r\n', '1.Resección de lesión en piel de región frontal medial:\r\n-CARCINOMA BASOCELULAR\r\n-LINEAS DE RESECCIÓN LIBRES DE TUMOR\r\n2.Resección de lesión en piel de región frontal supraciliar derecha:\r\n-CARCINOMA BASOCELULAR, COMPLETAMENTE EXTIRPADO\r\n3.Resección de lesión en piel de punta nasal:\r\n-CARCINOMA BASOCELULAR, COMPLETAMENTE EXTIRPADO\r\n4.Resección de lesión en piel de región infraorbitaria derecha.\r\n-QUERATOSIS SEBORREICA ', '', ''),
	(1795, 'Q2112-3284', 'Q', '33247848', 'CATALINA DEL CARMEN MENDOZA VILLAREAL', '000', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero + ovarios + trompas" se recibe un cuerpo uterino con sus anexos que pesa 325 gms. y mide 8 x 10 x 5 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte la cavidad endometrial esta deformada por la presencia de masas submucosas de color blanquecino y forma esférica cuyos diámetros oscilan entre 0.8 y 0.6 cms. Las trompas son externamente normales, los ovarios son sólidos con pequeñas cavidades que contienen un material gelatinoso. Se toman cortes.\r\n\r\n\r\n', 'El endometrio es secretor. En el miometrio hay focos aislados de glándulas y estroma endometrial. Las masas descritas están compuestas por fibras musculares lisas dispuestas irregularmente. Las trompas son normales. Los ovarios tienen folículos quísticos y uno de ellos un cuerpo amarillo.\r\n\r\n\r\n\r\n', ' Cuerpo uterino y anexos (325 gms.):\r\n-ENDOMETRIO SECRETOR\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS SUBMUCOSOS E INTRAMURALES\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS\r\n', '', ''),
	(1796, 'Q2112-3285', 'Q', '1047459006', 'RAIZA RODRIGUEZ MARAÑON', '3118035188', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Seno preauricular derecho" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia firme que mide 1.5 x 0.6 cms. en sus mayores dimensiones. Al corte se encuentra un trayecto de aspecto fistuloso, que contiene un pigmento azúl. Se toman cortes.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel por debajo de la cual se encuentra un conducto o cavidad tapizado por epitelio escamoso y una reacción inflamatoria crónica en la periferia.\r\n\r\n\r\n\r\n', ' Resección de lesión preauricular:\r\n-SENO PREAURICULAR CON INFLAMACIÓN CRÓNICA\r\n\r\n', '', ''),
	(1797, 'Q2112-3286', 'Q', '1102575705', 'SANDY CAROLAIS MARTINEZ ROMERO', '3218809934', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898241', '69000', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-14', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de medula derecha" un fragmento cilíndrico de tejido que mide 1.2 cms. de longitud. Se toma todo y se rotula A.\r\n2. "Biopsia de medula izquierda" un fragmento cilíndrico de tejido que mide 1.2 cms. de longitud. Se toma todo y se rotula B.\r\n\r\n', 'Las muestra rotulada A está representada por diez espacios intertrabeculares que contienen medula osea. \r\nLa muestra rotulada B contiene ocho espacios intertrabeculares.\r\n\r\nLos hallazgos medulares son similares en ambas muestras.\r\n\r\nRELACIÓN GRASA/CELULARIDAD: 30/70\r\nCARACTERÍSTICAS DE LA SERIE MEGACARIOCÍTICA: Presente, sin anomalías\r\nCARACTERÍSTICAS DE LA SERIE GRANULOCÍTICA: Maduración terminal, sin anomalías\r\nCARACTERÍSTICAS DE LA SERIE ERITROIDE: Maduración terminal, sin anomalías\r\nOTROS HALLAZGOS: No hay fibrosis, granulomas ni presencia de infiltración tumoral.\r\n\r\n', '1.Biopsia de medula ósea (espina ilíaca posterosuperior derecha):\r\n-MEDULA ÓSEA NORMOCELULAR\r\n\r\n2.Biopsia de medula ósea (espina ilíaca posterosuperior izquierda):\r\n-MEDULA ÓSEA NORMOCELULAR\r\n', '', ''),
	(1798, 'Q2112-3287', 'Q', '1201252983', 'ALI DAVID CARABALLO DIAZ', '00', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2.5 x 1.8 x 1.2 cms. La superficie externa esta cubierta por una mucosa irregular de color rosado y al corte una superficie de color rosado. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina que mide 2.5 x 1.8 x 1.2 cms. La superficie externa esta cubierta por una mucosa irregular de color rosado y al corte una superficie de color rosado. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 2.5 x 1.5 x 1 cms. en sus mayores dimensiones. La superficie externa es irregular y al corte se encuentra una superficie homogénea. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(1799, 'Q2112-3288', 'Q', '1043990879', 'JESUS DAVID SALGUEDO CORTES', '3002208177', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.2 cms., la superficie externa está cubierta por una serosa despulida de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz que contiene material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1800, 'Q2112-3289', 'Q', '1049539481', 'MARIA DEL CARMEN FONTALVO SUAREZ', '3217641250', 'F', '22', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor ALVARO MENDOZA BELEÑO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 0.5 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo oscuro. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1801, 'Q2112-3290', 'Q', '1042595140', 'YURLENIS LORENA AVENDAÑO VASQUEZ', '3188792292', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2.2 x 1.5 x 1.5 cms. La superficie externa esta cubierta por una serosa irregular de color pardo claro.  Al corte se encuentra una superficie de color pardo claro con áreas de color pardo oscuro. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2.2 x 1.5 x 1.5 cms. La superficie externa esta cubierta por una serosa irregular de color pardo claro.  Al corte se encuentra una superficie de color pardo claro con áreas de color pardo oscuro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 3 ml. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1. AMIGDALITIS CRÓNICA\r\n2. HIPERPLASIA ADENOIDEA\r\n', '', ''),
	(1802, 'Q2112-3291', 'Q', 'VEN3126', 'ROIMAR DULANIS MENDOZA MORLES', '3215968909', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 X 1.5 cms., la superficie externa está cubierta por una serosa de color pardo claro con áreas de color pardo oscuro y al corte se encuentra una luz dilatada que contiene en su extremo distal un material de aspecto purulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA', '', ''),
	(1803, 'Q2112-3292', 'Q', '22540760', 'YOLIMA DEL CARMEN ARMENTA SARMIENTO', '000', 'F', '38', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Endocervix" pequeños fragmentos de tejido de forma irregular de color pardo grisáceo y consciencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Endometrio" varios fragmentos de tejido de forma irregular de color pardo oscuro y consciencia friable que en conjunto hacen un volumen de 4 ml. Se toma todo y se rotula B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran endocervix con inflamación aguda y crónica.\r\nLos cortes rotulados B muestran endometrio compuesto por glándulas tubulares, tortuosas tapizadas por epitelio cilíndrico seudoestratificado. Reposan en un estroma fibroso infiltrado por linfocitos, células plasmáticas y macrófagos.\r\n\r\n\r\n\r\n', '1. Biopsia de endocervix:\r\n-ENDOCERVICITIS AGUDA Y CRÓNICA\r\n\r\n2. Biopsia de endometrio:\r\n-ENDOMETRITIS CRÓNICA\r\n\r\n', '', ''),
	(1804, 'Q2112-3293', 'Q', '1142921258', 'DOMINIC PARRA PEREZ', '3014643296', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2021-12-14', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Testículo izquierdo" se recibe un testículo que mide 4.5 x 3 x 2.8 cms. en sus mayores dimensiones, la superficie externa es de color pardo claro y al corte se encuentra una zona de color pardo rojizo que comprime el tejido testicular y aspecto necrótico, hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran testículo en el que se observa una marcada congestión venosa y un área extensa de necrosis hemorrágica.\r\n\r\n\r\n\r\n\r\n', ' Orquiectomía izquierda:\r\n-TESTÍCULO CON NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n', '', ''),
	(1805, 'Q2112-3294', 'Q', '6812505', 'HERNAN NOVOA SALCEDO', '3113671188', 'M', '71', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia friable que en conjunto hacen un volumen de 2 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran múltiples estructuras compuestas por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección endoscópica de lesiones en mucosa gástrica:\r\n-PÓLIPOS DE GLÁNDULAS FÚNDICAS\r\n\r\n', '', ''),
	(1806, 'Q2112-3295', 'Q', '1128047367', 'DIANA EDITH PUELLO DORIA', '3002013599', 'F', '35', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden respectivamente 0.1 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1807, 'Q2112-3296', 'Q', '9090126', 'ALFONSO GARCIA IMITOLA', '000', 'M', '68', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2021-12-15', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia en sacabocado de lesión de piel en pierna izquierda" se recibe una elipse de piel que mide 2.5 x 0.7 cms. en sus mayores dimensiones, en uno de sus extremos muestra una zona pigmentada de color grisáceo que toca en un lado el margen de resección. Se lamina e incluye en su totalidad.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con zona ulcerada cuyo cráter está cubierto por una costra que contiene leucocitos PMN neutrófilos, linfocitos y macrófagos. Hay marcada fibrosis del dermis que toca la hipodermis.\r\nNo se encuentran cambios específicos.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel de miembro inferior izquierdo:\r\n-PIEL CON INFLAMACIÓN AGUDA Y CRÓNICA Y ULCERACIÓN\r\n\r\n', '', ''),
	(1808, 'Q2112-3297', 'Q', '34943948', 'DELIA DOMINGUEZ PEREZ', '3107454515', 'F', '49', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(1809, 'Q2112-3298', 'Q', 'VEN7831978', 'LEONEL DE JESUS MACHADO MORELO', '3024612802', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa irregular de color pardo oscuro con vasos prominentes. Al corte se encuentra una la luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1810, 'Q2112-3299', 'Q', '7521537', 'JOSE RUBEN CASTRO YATE', '3126193709', 'M', '64', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1811, 'Q2112-3300', 'Q', '1041976759', 'OMAR YESID OSPINO RIVERA', '3147521361', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1812, 'Q2112-3301', 'Q', '91237174', 'GERARDO MEJIA MEJIA', '3135321798', 'M', '46', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1813, 'Q2112-3302', 'Q', '33146071', 'GLORIA ESTELA GONZALEZ RODRIGUEZ', '3155095447', 'M', '69', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1814, 'Q2112-3303', 'Q', '30766600', 'INGRID PATRICIA CASTILLO MATURANA', '3145040799', 'F', '46', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-13', '2021-12-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1815, 'L2112-119', 'L', '39014725', 'ANA CECILIA MIRANDA ARQUEZ', '000', 'F', '50', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-13', '2021-12-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "ACAF seno izquierdo" se reciben 10 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos contienen escasas células epiteliales con cambios de citólisis. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' ACAF de quiste en mama izquierda:\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n', '', ''),
	(1816, 'L2112-120', 'L', '32831743', 'MILENA VIRGINIA CONRRADO BARRIOS', '2222', 'F', '48', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-13', '2021-12-13', 'JOSÉ CARABALLO GRACIA', 'Rotulado "ACAF seno derecha" se reciben 4 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n\r\n', ' ACAF de quiste en mama derecha:\r\n-EXTENDIDOS ACELULARES\r\n\r\n', '', ''),
	(1817, 'Q2112-3304', 'Q', '1044909975', 'GLADIS ISABEL SIMANCAS ROMERO', '3145906516', 'F', '38', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Mucosa antro corporal cuya lámina propia es edematosa con un infiltrado mononuclear moderado con formación de agregados linfoides, focos de metaplasia intestinal. No se observa H.pylori, actividad, atrófia,  ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON FOCOS DE METAPLASIA INTESTINAL', '', ''),
	(1818, 'Q2112-3305', 'Q', '1042994515', 'YASERIS DE JESUS SERGE OROZCO', '3138955738', 'F', '37', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmento de cérvix con inflamación crónica y LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-LIE DE BAJO GRADO', '', ''),
	(1819, 'Q2112-3306', 'Q', '1090389222', 'NATALIA ANDREA SIERRA FUENTES', '3005751946', 'F', '34', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori en escasa cantidad. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(1820, 'Q2112-3307', 'Q', '1238343959', 'JOSE JOGENDRY FUENTEMAYOR CASTRILLON', '3212439432', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-12-22', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Seno preauricular derecho" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 1 x 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan formación quística tapizada por epitelio escamoso que contiene queratina laminar, además se observa cartílago.\r\n\r\n\r\n\r\n', '-QUÍSTE PREAURICULAR DERECHO\r\n\r\n', '', ''),
	(1821, 'Q2112-3308', 'Q', '1048455015', 'DANIEL GUSTAVO RANGEL GONZALEZ', '3157533809', 'M', '12', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-01-24', '2021-12-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan E.\r\n', 'Los cortes de A revelan fragmentos de epitelio escamoso hiperplásico sin representación de lámina propia. \r\nLos cortes B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C muestran mucosa oxíntica sin cambios.\r\nLos cortes D y E revelan mucosa de bulbo y segunda porción duodenal sin alteraciones.\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO HIPERPLÁSICO\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA OXÍNTICA SIN CAMBIOS\r\n4.Biopsia endoscópica de bulbo:\r\n-MUCOSA DE BULBO DUODENAL\r\n5.Biopsia endoscópica de segunda porción:\r\n-MUCOSA DE LA SEGUNDA PORCIÓN DEL DUODENO SIN ALTERACIONES', '', ''),
	(1822, 'Q2112-3309', 'Q', '1142918922', 'MARIANA OROZCO PARDO', '3042014710', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FELIX CABRERA CORREA', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. tapizada por una serosa opaca, de color pardo oscuro. Trae adherido material fibrinopurulento, adherido al meso trae un nódulo de 1 cms. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. Además, la masa descrita corresponde a un ganglio linfático con una hiperplasia folicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n1.APENDICITIS AGUDA\r\n2.GANGLIO LINFÁTICO CON HIPERPLASIA FOLICULAR\r\n\r\n', '', ''),
	(1823, 'Q2112-3310', 'Q', '1043326763', 'ELIAN DAVID FLOREZ HERRERA', '3148479220', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina de color pardo claro y consistencia elástica que mide 3 x 1.5 cms. Al corte una superficie multinodular de color blanquecino. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina de color pardo claro y consistencia elástica que mide 2 x 1.5 cms. Al corte una superficie multinodular de color blanquecino. Se toman cortes y se rotulan B. \r\n3. "Adenoides" varios fragmentos de tejido de color pardo claro que promedian un diámetro mayor de 1 cm. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n', '', ''),
	(1824, 'Q2112-3311', 'Q', '1043310879', 'SHARID SANDRID OSPINO URUETA', '3188451409', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.6 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de epitelio escamoso hiperplásico sin representación de lámina propia.\r\nLos cortes B revelan mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO HIPERPLÁSICO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n', '', ''),
	(1825, 'Q2112-3312', 'Q', '1048443479', 'SANTIAGO CUADRO ZARZA', '3229309182', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Granuloma fosa nasal" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan una lesión constituida por una proliferación de pequeños vasos de paredes delgadas que descansan en un estroma edematoso e infiltrado por PMN neutrófilos, tapizados por epitelio escamoso.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en fosa nasal derecha:\r\n-HEMANGIOMA CAPILAR TIPO GRANULOMA (GRANULOMA PIOGENO)\r\n\r\n', '', ''),
	(1826, 'Q2112-3313', 'Q', '1142936918', 'GABRIELA RIVERO ZUÑIGA', '3215662168', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FELIX CABRERA CORREA', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la luz está dilatada y hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1827, 'Q2112-3314', 'Q', '1043313996', 'SHEYMAR CAMILA CARRANZA PADILLA', '3135758868', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Micosis fungoide hipopigmentada" se recibe un punch de piel que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel cuya epidermis conserva la morfología usual. El dermis muestra un infiltrado perivascular superficial mediado por linfocitos. No se encuentran cambios que permitan un diagnóstico específico.\r\n\r\n\r\n', ' Biopsia de piel de muslo izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(1828, 'L2112-121', 'L', '1222129642', 'JHONATAN DAVID AREVALO GALVIS', '000', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-15', '2021-12-14', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 4.8 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de L.C.R:\r\n-EXTENDIDO ACELULAR', '', ''),
	(1829, 'Q2112-3315', 'Q', '33147674', 'JULIA ESTHER PAREJA MORALES', '000', 'F', '68', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-22', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe lesión de aspecto polipoide de color pardo claro que mide 0.6 cms. tapizada totalmente por piel de color pardo oscuro. Se toma todo.\r\n\r\n\r\n\r\n', 'Lesión polipoide tapizada en su totalidad por epitelio escamoso y descansan en un estroma fibroso con focos de tejido adiposo.\r\n\r\n\r\n\r\n\r\n', '-FIBROMA BLANDO, vulva\r\n\r\n\r\n', '', ''),
	(1830, 'Q2112-3316', 'Q', '33121773', 'REBECA PUELLO BARRIOS', '3008077953', 'F', '74', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe una elipse de piel de color pardo claro que mide 1 x 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Piel en la que se observa una lesión tumoral constituida por una proliferación de células basaloides dispuestas en su mayoría en un patrón sólido con empalizada periférica. Los bordes de resección están libres de tumor.\r\n\r\n\r\n\r\n', ' Piel, ala nasal izquierda:\r\n-CARCINOMA DE CÉLULAS BASALES\r\n-BORDES DE RESECCIÓN LIBRES DE TUMOR', '', ''),
	(1831, 'Q2112-3317', 'Q', '45576869', 'SANDRA ROCIO MADARRIAGA URDA', '000', 'F', '51', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctora YAJAIRA MEZA MULETT', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se reciben varios fragmentos de tejido de forma irregular de color pardo oscuro que juntos promedian 4 ml. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes solo revelan coágulos sanguíneos y fibrina.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(1832, 'Q2112-3318', 'Q', '3928124', 'CECILIO IGNACIO DIAZ ALVARINO', '000', 'M', '73', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un fragmento de tejido de color blanquecino que mide 0.4 x 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel con una lesión tumoral constituida por células basaloides con empalizada periférica dispuestas en un patrón sólido.\r\n\r\n\r\nOBSERVACIONES: La lesión toca uno de los bordes de resección.\r\n\r\n\r\n', ' Extirpación de lesión en piel, región frontal:\r\n-CARCINOMA BASOCELULAR\r\n-VER OBSERVACIONES', '', ''),
	(1833, 'Q2112-3319', 'Q', '64517969', 'MARIA ELENA LUNA SOLAR', '000', 'F', '57', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de vulva" un fragmento de tejido de forma irregular de color pardo oscuro que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Biopsia de exocervix" dos fragmentos de tejido de color pardo claro que mide 0.2 y 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan epitelio escamoso que muestra acantosis irregular, hipergranulosis y atipias coilociticas, el estroma infiltrado por células mononucleares.\r\nLos cortes B revelan cérvix tapizado por epitelio escamoso con cambios coilociticos asociados, el estroma infiltrado por linfocitos.\r\n\r\n\r\n', '1.Biopsia de vulva:\r\n-CONDILOMA\r\n2.Biopsia de cérvix:\r\n-LIE DE BAJO GRADO, CONDILOMA PLANO', '', ''),
	(1834, 'Q2112-3320', 'Q', '1238345860', 'ANA LUCIA MARTINEZ VELASQUEZ', '3008427321', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-12-22', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de rodilla derecha" se recibe una elipse de piel que mide 0.4 cms. que en su centro presenta un área de color pardo oscuro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel con hiperqueratosis laminar, hay presencia de tapones de queratina en orificios foliculares, la epidermis muestra hipergranulosis con hiperplasia psoriasiforme, el dermis muestra un infiltrado perivascular superficial mediado por neutrófilos.\r\n\r\n\r\n\r\nOBSERVACIONES: Los hallazgos encontrados son compatibles con ictiosis tipo laminar, se recomienda correlacionar con la clínica.\r\n\r\n\r\n', ' Biopsia de piel de rodilla derecha:\r\n-VER OBSERVACIONES\r\n\r\n\r\n', '', ''),
	(1835, 'Q2112-3321', 'Q', 'VEN331', 'CRISTAL MICHELLE GUERRERO RODRIGUEZ', '3024301206', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1 cms. la serosa es gris y opaca. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1836, 'Q2112-3322', 'Q', '1142916099', 'MICHELLE DURAN ORTEGA', '3184849990', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ALEJANDRO JOSE LOPEZ MUSKUS', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Granuloma en hallux derecha" se recibe fragmento de tejido de color grisáceo que mide 1 x 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Epitelio escamoso hiperplásico que descansa en un estroma donde se observa una proliferación de capilares y un infiltrado inflamatorio severo agudo y crónico.\r\n\r\n\r\n\r\n', '-HEMANGIOMA CAPILAR (TIPO GRANULOMA PIÓGENO), región lateral de hallux derecho', '', ''),
	(1837, 'Q2112-3323', 'Q', '1137534379', 'EMMILY LIÑAN ELLES', '3106231101', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-12-24', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Piel de pierna derecha" se recibe un punch de piel que mide 0.3 cms. Acompañado a esto fragmento de tejido de color blanquecino que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel tapizada por epitelio escamoso, el dermis papilar muestra focos de fibrosis además se observa a nivel de vasos pequeños del dermis papilar y medio un infiltrado perivascular superficial mediado por linfocitos algunos penetran la pared de estos, hay además hiperplasia endotelial.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de piel pierna derecha:\r\n-VASCULITIS LINFOCÍTICA NO NECROTIZANTE\r\n', '', ''),
	(1838, 'Q2112-3324', 'Q', '1043481075', 'ANNA KAMILA PARRA GARCIA', '3145892190', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 4 cms. la serosa es de color verdoso. Al corte salida de material biliar, la mucosa conserva el aspecto aterciopelado, las paredes son delgadas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', '-VESÍCULA BILIAR', '', ''),
	(1839, 'Q2112-3325', 'Q', '1041990624', 'ROONEY GODOY FRIAS', '3007597898', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. la serosa es congestiva. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1840, 'Q2112-3326', 'Q', '73006751', 'WAGNER STEVEN GOMEZ PEREZ', '3016323016', 'M', '37', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide el mayor 0.3 cms. y el menor de 0.1 cm. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(1841, 'Q2112-3327', 'Q', '1238340435', 'ABRAHAM DAVID GARRIDO ZORRILLA', '3128339440', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-20', '2021-12-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mies 4 cms. la serosa es opaca y despulida cubierta por un material fibrinoso. Al corte la luz contiene un material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1842, 'Q2112-3328', 'Q', '1047432773', 'JUAN HENRIQUE BERRIO DE POMBO', '3205652771', 'M', '30', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1843, 'Q2112-3329', 'Q', '1103501961', 'ELIUD PEREZ GAMARRA', '3135100528', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-25', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de adenomegalia de ganglio derecho" se recibe una masa de tejido de forma ovoide de color blanquecino que mide 2.2 x 1 x 0.8 cms. \r\n\r\n\r\n\r\n', 'Los cortes revelan ganglio linfático cuya morfología esta alterada por la presencia de múltiples folículos linfoides de diferentes formas y tamaños algunos con centros germinales ensanchados que contienen macrófagos que fagocitan detritus celulares, además se observa la presencia de gran cantidad de histiocitos que rodean folículos y se extienden a la cortical, se observa además algunos folículos pequeños con una población linfoide atípica.\r\n\r\n\r\n', ' Extirpación de ganglio superior derecho:\r\n-COMPATIBLE CON HIPERPLASIA FOLICULAR\r\n\r\n\r\n', '', 'Se recomienda estudios de inmunocitoquímica para descartar lesión linfoproliferativa.\r\nEste caso fue visto con los doctores Oliva Marrugo, Virna Caraballo y hubo consenso.\r\n\r\n\r\n\r\nNOTA: Se retiran 2 bloques por el señor (mensajero de HINFP) OSCAR CABRERA MIRANDA CC. 73.115.091 (25/ene/2022)'),
	(1844, 'Q2112-3330', 'Q', '45561434', 'INDIRA HERNANDEZ FUENTES', '000', 'F', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor MAURICIO ORTIZ', NULL, '2021-12-22', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben varios fragmentos de tejido de color oscuro que juntos promedian 2 ml. Se toma muestra.\r\n\r\n\r\n\r\n', 'Los cortes revelan sangre y fragmento de endometrio constituido por glándulas endometriales tubulares tapizado por epitelio cilíndrico el estroma se encuentra infiltrado por plasmocitos. No se identificó tejido decidual ni vellosidades coriales.\r\n\r\n\r\n', ' Legrado uterino:\r\n-ENDOMETRITIS CRÓNICA\r\n', '', ''),
	(1845, 'Q2112-3331', 'Q', '1049537101', 'JEILER DAVID AMADOR PORTO', '0000', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-20', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1 cms. la serosa es opaca y despulida. Al corte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1846, 'Q2112-3332', 'Q', '1237441236', 'RODOLFO ROA HERNANDEZ', '000', 'M', '24', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctora YOLIMA PAJARO ALVAREZ', NULL, '2022-01-14', '2021-12-16', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Traquea" se reciben tres fragmentos de tejido de color oscuro que mide el mayor 3 x 2.5 cms. y el menor de 1 cms. en la parte posterior del mayor tejido de color blanquecino, de consistencia muy firme. Se toman cortes.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por un epitelio escamoso maduro que reposa en un corion de tejido fibroso colagenizado con focos de inflamación crónica mediada por linfocitos y células plasmáticas.\r\nEn la muestra no se identifican elementos propios de la tráquea.\r\n\r\n\r\n\r\n', '-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1847, 'Q2112-3333', 'Q', '8739303', 'EDWIN ARTURO JIMENEZ BASTIDAS', '000', 'M', '57', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Resección de masa en brazo derecho" se recibe una masa de tejido de forma irregular de color pardo amarillento y aspecto adiposo que mide 7 x 3 x 1.8 cms. La superficie externa esta cubierta por una fina cápsula de aspecto multilobulado y al corte se observa una cápsula untuosa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en brazo derecho:\r\n-LIPOMA\r\n\r\n', '', ''),
	(1848, 'Q2112-3334', 'Q', '1049534547', 'YULIANA PADILLA RODRIGUEZ', '3215190321', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.5 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada congestión y dilatación d elos vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', '-APENDICE CECAL\r\n', '', ''),
	(1849, 'Q2112-3335', 'Q', '1048438030', 'LEONARDO FAVIO CASTILLO ANGULO', '3228880636', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Varicocele" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 x 0.3 y 0.3 x 0.2 cms. en sus mayores dimensiones. Al corte de los mismos se identifica estructuras tubulares. Se toman sendos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vasos venosos dilatados con cambios degenerativos de la pared, que reposan en un tejido fibriadiposo.\r\n\r\n\r\n', '-VARICOCELE, izquierdo', '', ''),
	(1850, 'Q2112-3336', 'Q', '1137534875', 'EDWIN JUNIOR AMAYA REYES', '3007310010', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2021-12-27', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Criptorquidectomía derecha" se recibe un fragmento de tejido alargado de color pardo grisáceo y consistencia blanda que miden 6.3 x 1 cms. No se identifico testículo.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'Los múltiples cortes muestran un fragmento de tejido fibroadiposo bien vascularizado. No se identifican elementos propios del testículo.\r\n\r\n\r\n\r\n\r\n', ' Criptorquiectomía izquierda:\r\n-VÉASE DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1851, 'Q2112-3337', 'Q', '12904129', 'ALBERTO CASTILLO', '000', 'M', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Resección de masa en dorso izquierdo" dos fragmentos de tejido de forma irregular de color pardo oscuro con áreas de color pardo claro que miden 1.1 x 0.8 y 1 x 0.5 cms. La superficie externa de las mismas es irregular y al corte se observa una superficie homogénea de color pardo claro que alternan con áreas de color pardo oscuro. Se toman cortes y se rotulan A.\r\n2. "Resección en masa región dorso lumbar izquierda" dos fragmentos de tejido de forma irregular de color pardo claro y aspecto adiposo que juntos miden 6 x 4.5 x 2.5 cms. Al corte se observa una superficie untuosa de color amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de tejido fibroadiposo.\r\nLos cortes rotulados B muestran un tumor benigno compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', '1.Resección de masa en región dorsal izquierda:\r\n-FRAGMENTOS DE TEJIDO FIBROADIPOSO\r\n2.Resección de masa en región dorso lumbar izquierda:\r\n-LIPOMA', '', ''),
	(1852, 'Q2112-3338', 'Q', '30762888', 'MARIA DE LOS ANGELES TORRES NUÑEZ', '3116568883', 'F', '55', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Bulbo" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Pólipo gástrico" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada intensidad. No se observan parásitos, granulomas ni cambios displásicos.\r\nLos cortes rotulados C muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS AGUDA Y CRÓNICA\r\n3.Biopsia endoscópica de lesiones polipoides en cuerpo:\r\n-PÓLIPOS DE GLÁNDULAS FÚNDICAS\r\n', '', ''),
	(1853, 'Q2112-3339', 'Q', '23135779', 'AMINTA CAMACHO AYOLA', '000', 'F', '64', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1854, 'Q2112-3340', 'Q', '45508074', 'NASLI DEL CARMEN GOMEZ RODRIGUEZ', '00', 'F', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Utero + trompas + ovario izquierdo" se recibe el producto de una histerectomía subtotal con salpingectomía bilateral y ooforectomía derecha que pesa 190 gms. El cuerpo uterino está parcialmente cubierto por una serosa lisa y brillante mide 8 x 7.5 x 6.5 cms. en sus mayores dimensiones, la trompa derecha es tortuosa mide 5.5 cms. y la izquierda recibida por separado mide 4.5 cms. Al corte la cavidad endometrial está tapizada por una mucosa gruesa de color pardo claro. El miometrio está ocupado por múltiples masas blanquecinas y aspecto arremolinadas que promedian 1 cm. de localización intramural y subserosa. Las trompas conservan la estructura usual y la trompa izquierda muestra una estructura de aspecto quístico que mide 2 cms. en su mayor dimensión. Al corte hay salida de un líquido claro dejando ver una cavidad unilocular de paredes delgadas. Al corte el ovario muestra una cavidad de paredes gruesas que contienen un material de aspecto achocolatado. Se toman cortes.\r\n\r\n\r\n', 'El endometrio está autólisado. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente. Las trompas conservan la estructura usual y el ovario muestra una cavidad tapizada por células luteinizadas con contenido de sangre.\r\n\r\n\r\n\r\n', ' Histerectomía subtotal con salpingectomía bilateral y ooforectomía izquierda:\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMA INTRAMURAL Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n-QUÍSTE LÚTEO HEMORRÁGICO, ovario', '', ''),
	(1855, 'Q2112-3341', 'Q', '1143369027', 'HEIDY ESTHER NUÑEZ SANMARTIN', '00', 'F', '28', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2021-12-20', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de antro" se recibe un fragmento de tejido de forma alargada de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1856, 'Q2112-3342', 'Q', '9078337', 'HERNAN RINCON LLACH', '0000', 'M', '69', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor RAFAEL CARMONA VALLE', NULL, '2021-12-27', '2021-12-17', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de mucosa recto-sigmoides (escalonada)" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa colónica con focos de erosión superficial. La lámina propia está edematosa, congestiva y densamente infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación de abscesos crípticos y disminución del moco en el epitelio glandular. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de mucosa recto-sigmoide:\r\n-COMPATIBLE CON COLITIS ULCERATIVA EN FASE ACTIVA\r\n\r\n\r\n', '', 'Se recomienda realizar correlación clínico-patológica.'),
	(1857, 'Q2112-3343', 'Q', '40988315', 'NOVATNA ALIDIS BOWLE MYLES', '000', 'F', '47', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1858, 'Q2112-3344', 'Q', '1044937806', 'LIANT JOSE LORA BARRIOS', '3244058122', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo oscuro, trae adherido un segmento de grasa. Al corte la luz está dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1859, 'Q2112-3345', 'Q', '1043322344', 'MAURICIO ALEJANDRO RODRIGUEZ SANDOVAL', '3014824481', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se reciben dos fragmentos de tejido de forma irregular que mide 3 x 1 cms. de color blanquecino y consistencia elástica. Al corte una superficie multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(1860, 'Q2112-3346', 'Q', '1201229353', 'KIMBERLY ECHEVERRIA VERGARA', '3107333968', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice" se recibe un apéndice cecal que mide 6 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(1861, 'Q2112-3347', 'Q', '1142924197', 'SAMUEL ALEXANDER SALAS SALGUEDO', '000', 'M', '12', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor FREDY HERRERA', NULL, '2022-02-01', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste dentígeno" se reciben varios fragmentos de tejido de color pardo claro y consistencia elástica que promedian un diámetro de 3 cms. \r\n\r\n\r\n\r\n', 'Los cortes revelan una cápsula fibrosa infiltrada por linfocitos, plasmocitos, PMN neutrófilos y abundantes macrófagos con formación de células gigantes, se observan algunas espículas óseas viables. No se encuentran cambios neoplásicos ni elementos que permitan un diagnóstico específico.\r\n\r\n\r\n\r\n', ' Resección de lesión en seno paranasal izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1862, 'Q2112-3348', 'Q', '1041983288', 'JANIER DAVI HERNANDEZ BLANCO', '3127623186', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. tapizado por una serosa opaca bien vascularizada de color pardo grisáceo. Al corte salida de un material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apéndice cecal:\r\n-APÉNDICITIS AGUDA', '', ''),
	(1863, 'Q2112-3349', 'Q', 'VEN23888026', 'SAILY VALEREIA SOTO PEREZ', '311656408', 'F', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Mioma" se recibe una formación nodular que mide 1 x 1 cms. de color blanquecino y consciencia elástica. Al corte una superficie blanquecina de aspecto arremolinado. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n\r\n', ' Miomectomía:\r\n-LEIOMIOMA', '', ''),
	(1864, 'Q2112-3350', 'Q', '1001891237', 'JASHAYSARAH AHUMADA CANTILLO', '000', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Quíste de ovario izquierdo" formación nodular que mide 0.5 x 0.5 cms. de consistencia renitente de paredes lisas, translúcidas y salida de un líquido de color pardo claro. Se toma todo y se rotula A.\r\n2. "Tumor de pared abdominal" masa irregular que mide 3  x 1.5 cms. de color pardo oscuro y consistencia elástica. Al corte una superficie lisa de color amarillento. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan estructura quística constituida por una pared delgada de tejido fibroconectivo tapizado por epitelio cilíndrico ciliado.\r\nLos cortes B revelan tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', '1.QUÍSTE PARAOVARICO IZQUIERDO\r\n2.LIPOMA, pared abdominal', '', ''),
	(1865, 'Q2112-3351', 'Q', '1002198536', 'MILAGRO MARIA RODRIGUEZ BERMUFEZ', '3216109048', 'F', '18', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Hemorroides externas" se reciben tres fragmentos de tejido de color pardo oscuro y consciencia elástica que promedian un diámetro de 3 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Mucosa anorectal que reposa en un corion que contiene vasos venosos dilatados y congestivos.\r\n\r\n\r\n\r\n\r\n', '-HEMORROIDES', '', ''),
	(1866, 'Q2112-3352', 'Q', '45557772', 'SUAMEIRA ISABEL ARIAS HERRERA', '3103658414', 'F', '38', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JOSE BLANCO RICARDO', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Embarazo ectópico derecho" se recibe una trompa de Falopio dilatada que mide 9 x 6 x 4 cms. de color pardo oscuro y consistencia renitente. Al corte hay salida de un líquido hemorrágico y la presencia de un embrión que mide 3 x 1.5 cms. El cordón umbilical mide 5 cms. Se toman cortes del embrión y de la trompa de Falopio. \r\n\r\n\r\n\r\n', 'Trompa de Falopio dilatada cuya luz está ocupada por embrión, vellosidades coriales que en algunas áreas infiltran la pared.\r\n\r\n\r\n\r\n\r\n', '-EMBARAZO TUBÁRICO DERECHO', '', ''),
	(1867, 'Q2112-3353', 'Q', '1143361424', 'ADRIANA ESTHER YANES MENDOZA', '3002287917', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Mioma" se recibe una masa irregular de tejido que mide 5 x 3.5 x 2.5 cms. de color blanquecino y consistencia elástica. Al corte una superficie blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n\r\n', ' Miomectomía.\r\n-LEIOMIOMA\r\n\r\n', '', ''),
	(1868, 'Q2112-3354', 'Q', '1007962768', 'YORIS JULIO PADILLA', '6384749', 'F', '18', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Tejido desvitalizado de abdomen" se reciben dos fragmentos de tejido de color blanquecino y consistencia elástica que mide 1.5 x 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo congestivo con un infiltrado inflamatorio mixto.\r\n\r\n\r\n\r\n', '-FRAGMENTO DE TEJIDO FIBROADIPOSO CON INFLAMACIÓN AGUDA Y CRÓNICA, abdomen', '', ''),
	(1869, 'Q2112-3355', 'Q', '1048081341', 'JULIAN DE JESUS OSPINA URUETA', '3006439304', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-03', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Intestino delgado" se recibe segmento de intestino delgado que mide 30 cms. tapizado por una serosa de color pardo claro en uno de sus extremos y marcado con seda presenta un área de sutura de 3 cms. Al corte mucosa edematosa. \r\nSe toman cortes así: A borde de resección proximal a la sutura, B área proximal a la sutura, C mucosa aspecto normal, D borde distal.\r\n\r\n\r\n', 'Los cortes revelan intestino delgado con edema y congestión. Los bordes son viables.\r\n\r\n\r\n\r\n\r\n', ' Segmento de intestino delgado (30 cms.) con:\r\n-EDEMA Y CONGESTIÓN\r\n-BORDES DE RESECCIÓN VIABLES\r\n\r\n', '', ''),
	(1870, 'Q2112-3356', 'Q', '30776995', 'ROSA CONCEPCION MORANTE VILLANES', '000', 'F', '48', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor ALVARO MENDOZA BELEÑO', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Tejido pared abdominal" se recibe un fragmento de tejido que mide 10 x 7 x 4 cms. en uno de sus extremos rotulado lateral derecho marcado con dos sedas, se rotulan A, B cefálico.\r\nParcialmente cubierto por piel. Al corte tejido adiposo que trae adherido un tejido de aspecto necrótico. Se toman cortes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes A y B revelan piel y tejido celular subcutáneo que muestra inflamación aguda, áreas de necrosis y formación de absceso.\r\nLos cortes C revelan tejido adiposo con inflamación aguda.\r\n\r\n\r\n\r\n', ' Tejido de pared abdominal con:\r\n-INFLAMACIÓN AGUDA, FORMACIÓN DE ABSCESO Y ÁREAS DE NECROSIS\r\n\r\n', '', ''),
	(1871, 'Q2112-3357', 'Q', '30854672', 'MARIA DE JESUS SALGADO JULIO', '000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor CANTILLO - JAIME CABARCAS', NULL, '2021-12-24', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Histerectomía abdominal útero, trompa derecha e izquierda y cuello" se recibe un útero y cuello por separado que pesa 197 gms. El cuello mide 5 x 4 x 3 cms. tapizado por una mucosa de color pardo claro con orificio puntiforme. El cuerpo mide 9 x 8 x  4 cms. tapizado por una serosa de color pardo claro y deformado por múltiples masas subserosas, blanquecinas. Al corte la cavidad endometrial está tapizada por una mucosa de color pardo claro, ocupada parcialmente por una masa ovoide que mide 1.5 x 1.5 cms. En el miometrio se observa una masa de iguales características. Las trompas de Falopio miden 5 cms. y son macroscópicamente normales. Se toman cortes.\r\n\r\n', 'Los cortes revelan cérvix con una reacción inflamatoria crónica, el endometrio se encuentra autólisado, las masas descritas a nivel subseroso, intramural y submucoso corresponden a leiomiomas. Se observa además, focos de adenomiosis.\r\nLas trompas de Falopio muestran su estructura usual.\r\n\r\n\r\n\r\n', ' Utero (197 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTOLISADO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS\r\n-TROMPAS DE FALOPIO', '', ''),
	(1872, 'Q2112-3358', 'Q', '32936171', 'JULIS DEL CARMEN JULIO CONTRERAS', '3114163880', 'F', '37', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Miomas" siete masas de tejido de forma irregular de color pardo claro y consistencia elástica de aspecto arremolinado. La mayor mide 8 x 9 x 6 cms. y la menor 2 x 1 cms. Se toman cortes y se rotulan A.\r\n2. "Trompas" en un mismo recipiente, se reciben dos segmentos de trompas que miden 1.5 cms. cada una de aspecto tubular de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan tumores benignos mesenquimales compuestos por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\nLos cortes B revelan segmentos de trompa uterina que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', '1.Miomectomía:\r\n-LEIOMIOMAS\r\n2.TROMPAS UTERINAS. SEGMENTOS ', '', ''),
	(1873, 'Q2112-3359', 'Q', '1123631443', 'ISMAEL ALFONSO BERRIO BALDIRIS', '000', 'M', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Intestino delgado" un segmento de intestino delgado que mide 10 x 2.5 cms. que muestra a 4 cms. de uno de los bordes de resección muestra una solución de continuidad que mide 3 cms. y a 4 cms. de dicha solución continua presenta otra con las mismas características. Se toman cortes así: A bordes de resección, B solución de continuidad.\r\n2. "Apéndice" se recibe un apéndice cecal que mide 6 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro su luz es puntiforme. Se toman cortes y se rotulan D.\r\n\r\n\r\n', 'Los cortes revelan intestino delgado que muestra áreas extensas de necrosis hemorrágica con perforación. Bordes de resección viables.\r\nApéndice cecal muestra a nivel de la serosa edema, congestión e infiltrado por PMN neutrófilos.\r\n\r\n\r\n\r\n', ' Resección de intestino delgado por perforación traumática con:\r\n-INFLAMACIÓN AGUDA, ÁREAS EXTENSAS DE NECROSIS HEMORRÁGICA Y PERFORACIÓN\r\n-BORDES DE RESECCIÓN VIABLES\r\n-PERIAPENDICITIS AGUDA\r\n\r\n', '', ''),
	(1874, 'Q2112-3360', 'Q', 'VEN21346794', 'CARMEN ELIZA ARAUJO BRICEÑO', '000', 'F', '37', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2021-12-22', '2021-12-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Ovario izquierdo" se recibe una masa de tejido que mide 5 x 3.5 x 2.5 cms. trae adherido un segmento de trompa de 3 cms. de color pardo grisáceo. Al corte una superficie que muestra dos formaciones quísticas la mayor mide 3 x 2.5 x 2.5 cms. y la menor de 1.5 x 1.5 cms. y contiene un material mucoide. Al corte la trompa muestra la estructura usual. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan ovario que muestra formaciones quísticas tapizadas por células foliculares leteinizadas conteniendo coágulos sanguíneos y algunos folículos quísticos, se observa además trompa de Falopio sin cambios.\r\n\r\n\r\n\r\n\r\n', ' Ovario izquierdo con:\r\n-FOLÍCULOS QUÍSTICOS\r\n-QUÍSTE LÚTEO HEMORRÁGICO\r\n-SEGMENTO DE TROMPA DE FALOPIO IZQUIERDA', '', ''),
	(1875, 'Q2112-3361', 'Q', '1047472550', 'MARIA FERNANDA MARTINEZ RUBIO', '3127889275', 'F', '27', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un punch de piel que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Epitelio escamoso con hiperqueratosis, acantosis irregular y cambios coilociticos asociados.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA PLANO\r\n\r\n', '', ''),
	(1876, 'Q2112-3362', 'Q', '45422135', 'AYDA ARGUMEDO DURANGO', '000', 'F', '67', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1877, 'Q2112-3363', 'Q', 'VEN32189552', 'GENESIS CAROLINA MIQUELENA LOPEZ', '000', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es gris y congestiva. Al corte la luz ocupada por material de aspecto fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared, hay escasos neutrófilos. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1878, 'Q2112-3364', 'Q', '73077798', 'ARCELIO JOSE JIMENEZ BARBOZA', '3216169411', 'M', '65', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe formación nodular que mide 1 x 0.5 cms. Al corte una cavidad quística de 0.4 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Lesión quística tapizada pro epitelio escamoso conteniendo en su interior abundante queratina laminar.\r\n\r\n\r\n\r\n', '-QUÍSTE EPIDÉRMICO DE INCLUSIÓN, espalda\r\n\r\n\r\n', '', ''),
	(1879, 'Q2112-3365', 'Q', '1048581309', 'RAFAEL DE JESUS JURADO CUETO', '3226282200', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-01-14', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mucosa aritenoide derecha" un fragmento de tejido de color pardo claro que mide 0.6 cms. Se toma todo y se rotulan A.\r\n2. "Mucosa aritenoide izquierda" un fragmento de tejido de color pardo claro que mide 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran mucosa aritenoidea con edema e inflamación mediada por linfocitos.\r\n\r\n\r\n\r\n', '1.Resección de mucosa aritenoidea derecha:\r\n-INFLAMACIÓN CRÓNICA\r\n2.Resección de mucosa aritenoidea izquierda:\r\n-INFLAMACIÓN CRÓNICA', '', ''),
	(1880, 'Q2112-3366', 'Q', '73187332', 'RICARDO DIAZ GRANADOS', '3145960911', 'M', '40', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1881, 'Q2112-3367', 'Q', '1049831391', 'YULIANIS ESTHER HIDALGO DIAZ', '3114051027', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quiste dermoide región retroauricular izquierda"  se recibe un fragmento de tejido de color gris que mide 0.5 cms. Acompañado a un material blanquecino, sebáceo que mide 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n', '-- QUISTE QUERATINOSO DE TIPO EPIDERMOIDE, región retroauricular derecha\r\n\r\n\r\n', '', ''),
	(1882, 'Q2112-3368', 'Q', '1137977694', 'ELKIN ANDRES POSADA MELENDEZ', '3206558143', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan C.\r\n4. "Pólipo rectal" un fragmento de tejido de forma redondeada de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes de A revelan unión gastro esofágica que muestra la estructura usual.\r\nLos cortes B revelan mucosa antral sin cambios.\r\nLos cortes C revelan lesión polipoide que muestra proliferación de capilares e inflamación aguda.\r\nLos cortes D revelan mucosa duodenal cuya lámina propia está infiltrada por linfocitos y plasmocitos en poca cantidad. No se observan parásitos intestinales.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE MUCOSA ESOFÁGICA\r\n2.Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA ANTRAL\r\n3.Biopsia endoscópica de duodeno:\r\n-PÓLIPO INFLAMATORIO\r\n4.Biopsia endoscópica de recto:\r\n-MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA LEVE', '', ''),
	(1883, 'Q2112-3369', 'Q', '1043319569', 'FARIANI SOFIA FARIA LUNA', '3008612900', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor HENRY TORRES MONTES', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Resección de masa en pie derecho" se reciben tres fragmentos de tejido tapizados parcialmente por piel que promedian 1.5 cms. cada uno. \r\n\r\n\r\n\r\n', 'Piel gruesa tapizada por epitelio escamoso que descansa en un dermis con áreas de fibrosis infiltrado por linfocitos, plasmocitos y abundantes neutrófilos, con la presencia de células gigantes multinucleadas. La lesión se exctiende al tejido celular subcutáneo.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel, pie derecho con:\r\n-INFLAMACIÓN AGUDA, CRÓNICA Y REACCIÓN A CUERPO EXTRAÑO', '', ''),
	(1884, 'Q2112-3370', 'Q', '73089888', 'GERMAN ELADIO GONINA PINTO', '00', 'M', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-03', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'SIN MATERIAL DE FIJACIÓN, Rotulado "Resección + drenaje de absceso en muslo izquierdo" se recibe una masa de tejido pediculado y tapizado parcialmente por piel que mide 3 x 3.5 cms. Al corte de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral benigna constituida por tejido adiposo separado por septos finos de tejido fibroso y cubierta en su totalidad por piel.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en muslo izquierdo:\r\n-LIPOMA\r\n', '', ''),
	(1885, 'Q2112-3371', 'Q', '1050955398', 'LUZ VANESSA ARELLANO ROMERO', '000', 'F', '29', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 2.5 cms. de forma piriforme, la serosa de color verdoso. Al corte las paredes estan engrosadas y la mucosa conserva el aspecto de terciopelo. Se toman cortes.\r\nNo se reciben cálculos.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa está infiltrada en su mayoría por linfocitos y neutrófilos en poca cantidad, hay presencia de histiocitos espumosos, la muscular es hipertrófica.\r\n\r\n\r\n\r\n', '-COLECISTITIS AGUDA Y CRÓNICA\r\n-COLESTEROLOSIS\r\n\r\n', '', ''),
	(1886, 'Q2112-3372', 'Q', '45471287', 'CARMEN CECILIA FUENTES SABALZA', '000', 'F', '57', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 8 x 2 cms. la serosa es de color verdoso previamente evacuada. Acompañado de múltiples cálculos de roma piramidal que promedian 1 cm. en su interior se extraen otros calculos, las paredes están ligeramente engrosadas y la mucosa conserva su aspecto de terciopelo Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1887, 'Q2112-3373', 'Q', '45434181', 'TERESA ISABEL MENDOZA CONTRERAS', '3000', 'F', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 10 x 2 cms. muestra una solución de continuidad en una de sus caras. Al corte las paredes están engrosadas y se extrae fragmentos de cálculos, la mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa es atrófica y está infiltrada por linfocitos y escasos plasmocitos, hay hipertrofia de la capa muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(1888, 'Q2112-3374', 'Q', '9142689', 'YOVANI CALLEJAS ARRIETA', '00', 'M', '53', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar de color verdoso que mide 6 x 1 cms. Al corte se extrae un gran cálculo que mide 1.5 cms. Las paredes engrosadas y la mucosa conserva el aspecto de terciopelo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa está infiltrada por linfocitos, plasmocitos e histiocitos espumosos, hay hipertrofia de la muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n', '', ''),
	(1889, 'Q2112-3375', 'Q', '1125230990', 'THIAGO DE JESUS GUEVARA ACOSTA', '3002661708', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor HENRY TORRES MONTES', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Humero derecho" se reciben fragmentos de tejido de color blanquecino que juntos promedian 1 cm. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan en su mayoría tejidos blandos con una inflamación mixta constituida por linfocitos, plasmocitos y PMN neutrófilos, se observa además, espículas óseas necróticas.\r\nFragmentos de cartílago.\r\n\r\n\r\n\r\n', ' Fragmento de humero derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1890, 'Q2112-3376', 'Q', 'VEN21691730', 'GEXIMAR DEL CARMEN QUINTERO GONZALEZ', '3024445421', 'F', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2022-03-22', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Placenta" se recibe una placenta que pesa 173 gms. y mide 13 x 10 x 2.5 cms. La cara materna representada pro múltiples cotiledones de color pardo claro, la cara fetal de aspecto membranoso. Trae adherido segmento de cordón umbilical que muestra 3 vasos. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta del 2do. trimestre compuesto por vellosidades edematosas que alternan con otras con fibrosis del estroma. No hay cambios del cito ni del sinciciotrofoblasto. No hay cambios inflamatorios ni neoplásicos. El cordón tiene 3 vasos.\r\nLos hallazgos sugieren una muerte fetal in útero.\r\n\r\n\r\n\r\n', ' Placenta del segundo trimestre (173 gms.):\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(1891, 'Q2112-3377', 'Q', '45504766', 'GUILLERMINA RUIZ SUAREZ', '00', 'F', '48', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2021-12-27', '2021-12-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero" se recibe un cuerpo uterino que pesa 269 gms. y mide 9 x 8 x 9 cms. El cuerpo tapizado por una serosa de color pardo claro y aumentado globalmente de tamaño. Al corte la cavidad endometrial es plana blanquecina, está rechazada por la presencia de una gran masa de color blanquecino que mide 7 x 6 x 5 cms. a nivel miometrio se encuentra formaciones similares pequeñas. No se reciben trompas de Falopio. Se toman cortes.\r\n\r\nNOTA: No se reciben trompas de Falopio.\r\n\r\n\r\n', 'Los cortes revelan cuerpo uterino cuyo endometrio es atrófico. Las masas descritas corresponden a leiomiomas.\r\n\r\n\r\n\r\n', ' Cuerpo uterino (269 gms.):\r\n-ENDOMETRIO ATRÓFICO\r\n-LEIOMIOMAS\r\n-VER DESCRIPCIÓN MACROSCÓPICA', '', ''),
	(1892, 'L2112-122', 'L', '1103748655', 'YOFRAN STIVEN PADILLA TEHERAN', '321684365', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-27', '2021-12-24', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Líquido cefalorraquídeo" se reciben 8 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1893, 'L2112-123', 'L', '1080651281', 'ISABELLA PAVA ACUÑA', '000', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-27', '2021-12-24', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Líquido cefalorraquídeo" se reciben 5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1894, 'L2112-124', 'L', '1052630864', 'ANDREA CAROLINA CARRASQUILLA MOVILLA', '000', 'F', '14', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-01-03', '2021-12-24', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "ACAF de tiroides" se reciben tres placas con su extendido.\r\n\r\n\r\n\r\n', 'El extendido está representado por abundantes células foliculares algunas presentan agrandamientos nuclear irregularidad en su membrana e inclusiones nucleares. No se observan hendiduras nucleares en la muestra.\r\n\r\n\r\n\r\n', ' BACAF de tiroides, lado no especificado:\r\n-PRESUNTO CARCINOMA PAPILAR (SISTEMA DE BETHESDA V)\r\n', '', ''),
	(1895, 'Q2112-3378', 'Q', '7464599', 'OTILIO SARMIENTO RODRIGUEZ', '3002360933', 'M', '71', 'PARTICULAR', '', '898201', '30215', 'Doctora YELISA RIOS GOMEZ', NULL, '2022-01-04', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se reciben tres fragmentos de tejido de forma irregular de color pardo claro con áreas de color pardo oscuro y consistencia elástica que miden 1.2 x 0.8, 0.8 x 0.6 y 0.6 x 0.4 cms. Al corte del mayor se observa una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión cubierta por un epitelio escamoso con cambios marcados de acantosis irregular que reposa en un corion densamente infiltrado de linfocitos, células plasmáticas y neutrófilos.\r\nNo se observan granulomas, levaduras ni cambios neoplásicos. El proceso inflamatorio compromete el margen de resección profundo.\r\n\r\n\r\n', ' Biopsia de masa en encía vestibular de OD (13 y 14):\r\n-INFLAMACIÓN CRÓNICA CON HIPERPLASIA SEUDOEPITELIOMATOSA\r\n-VER DESCRIPCIÓN MICROSCÓPICA \r\n\r\n\r\n', '', 'Si clínicamente se continúa pensando en un proceso neoplásico se sugiere tomar una biopsia excisional para un estudio más completo.\r\n\r\n'),
	(1896, 'Q2112-3379', 'Q', '23100302', 'MARIA DE LOS ANGELES ORTEGA ARRIETA', '3217183279', 'F', '69', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor FERNANDO BELTRAN HERNANDEZ', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Dedo de pie derecho" se recibe un fragmento de tejido de forma irregular de color pardo oscuro con áreas de color pardo claro y consistencia elástica que mide 2.8 x 3 x 1.3 cms. La superficie externa está parcialmente cubierta por un fragmento de piel de color pardo oscuro con áreas de ulceración. Al corte se observa una superficie de color pardo claro que alternan con áreas de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de tejido fibroconectivo con áreas extensas de necrosis y densa infiltración por PMN neutrófilos. Hay focos de calcificación distrófica.\r\n\r\n\r\n\r\n', ' Resección de hallux de pie derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(1897, 'Q2112-3380', 'Q', '1099543806', 'JHOAN FERNANDO CONTRERAS DUARTE', '3506046641', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado" Apéndice" se recibe un apéndice cecal que mide 9.5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pare esta engrosada y la luz contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1898, 'Q2112-3381', 'Q', '73148465', 'LEONARDO URRIOLA MEZA', '000', 'M', '48', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-17', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de resección de masa en codo derecho" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.5 x 1.2 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por piel y al corte se observa una superficie de color pardo claro, homogénea. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión quística tapizada por epitelio escamoso y con contenido de queratina laminar. En la periferia del quiste se observa una gran reacción inflamatoria granulomatosa a cuerpo extraño.\r\n\r\n\r\n\r\n', ' Resección de lesión en codo derecho:\r\n-QUÍSTE QUERATINOSO ROTO CON REACCIÓN GRANULOMATOSA A CUERPO EXTRAÑO\r\n\r\n\r\n', '', ''),
	(1899, 'Q2112-3382', 'Q', '45766562', 'INGRID DEL CARMEN FRANCO ROMERO', '00', 'F', '45', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Masa región dorsal" se reciben múltiples fragmentos de tejido de forma irregular de color pardo amarillento y aspecto adiposo que miden respectivamente 5.5 x 4 x 2 cms. en sus mayores dimensiones. Al corte se observa una superficie untuosa de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de un tumor mesenquimal benigno compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región dorsal:\r\n-LIPOMA (FRAGMENTOS)\r\n\r\n', '', ''),
	(1900, 'Q2112-3383', 'Q', '9158463', 'PEDRO JAVIER SILVA GONZALEZ', '000', 'M', '39', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Masa en región inguinal izquierda" se recibe una masa de tejido de forma irregular de color pardo amarillento y aspecto adiposo que mide 7.2 x 5.5 x 3.5 cms. La superficie externa esta cubierta por una fina cápsula y al corte se observa una superficie untuosa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor mesenquimal benigno compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región inguinal izquierda:\r\n-LIPOMA\r\n\r\n', '', ''),
	(1901, 'Q2112-3384', 'Q', '45497991', 'NELCY LUZ LEON ZARATE', '00', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-04', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de resección de masa región umbilical" se recibe una masa de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 1.7 x 1.2 x 1.3 cms. La superficie externa esta parcialmente cubierta por piel. Al corte se observa una superficie blanquecina, homogénea. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión benigna compuesta por una proliferación de células con núcleos alargados, fusiformes que se disponen en bandas irregulares que desplazan los anexos cutáneos. No se observan cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección de masa en región umbilical:\r\n-NÓDULO FIBROSO DE PROBABLE ORIGEN CICATRIZAL', '', ''),
	(1902, 'Q2112-3385', 'Q', '1043000411', 'MAUREN GISELLA TORRES DE LA ROSA', '00', 'F', '34', 'CLIN. SAN JOSE DE TORICES SAS', '', '898201', '30215', 'Doctor RODOLFO VALENCIA', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Bazo" se recibe el producto de una esplenectomía que pesa 145 gms. y mide 11 x 7 x 5 cms. La superficie externa muestra una solución de continuidad de bordes irregulares que mide 6 x 3 cms. Al corte se observa una superficie de color violáceo que alternan con área de color pardo claro finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran bazo con áreas extensas de necrosis y hemorrágica.\r\n\r\n\r\n\r\n\r\n', ' Laparotomía exploratoria:\r\n-BAZO CON NECROSIS HEMORRÁGICA EXTENSA SECUNDARIA A RUPTURA TRAUMÁTICA\r\n\r\n', '', ''),
	(1903, 'Q2112-3386', 'Q', '1050731307', 'ISAAC DAVID VELASQUEZ OVIEDO', '3122658166', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-01-04', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia ósea de 4to. metatarsiano izquierdo" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia firme que promedian 0.5 cms. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de tejido óseo esponjoso sin cambios. Otros cortes muestran tejido conectivo laxo con densa infiltración linfoplasmocitaria. No se encuentran cambios neoplásicos ni alteraciones en el componente óseo de la muestra.\r\n\r\n\r\n\r\n', ' Biopsia de 4to. metatarsiano de pie izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1904, 'Q2112-3387', 'Q', '22766290', 'MARINA ESTHER NORIEGA YEPES', '3135416280', 'F', '80', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad severa, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD SEVERA\r\n-H.PYLORI PRESENTE', '', ''),
	(1905, 'Q2112-3388', 'Q', '1048438389', 'KEISY CARMONA SALCEDO', '301281782', 'F', '16', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una masa de tejido de forma irregular de color blanquecino y consistencia elástica que mide 3 x 2 x 1.5 cms. Al corte una superficie multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de nódulo de mama derecha:\r\n-FIBROADENOMA\r\n\r\n\r\n', '', ''),
	(1906, 'Q2112-3389', 'Q', '52021143', 'MARLENE BEJARANO HERRERA', '00', 'F', '51', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1907, 'Q2112-3390', 'Q', '1048608100', 'SHARITH VANESSA VARGAS SOLANO', '3137172725', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal fragmentada, uno de sus fragmentos mide 3 x 1.5 cms. y el otro 6 x 1 cms. tapizada pro una serosa opaca de color pardo oscuro que trae adherido un exudado fibrinopurulento. Al corte hay salida de material fecaloide. \r\nAcompañado a esto segmento de meso que mide 18 x 5 cms. de color amarillento y aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes del apéndice cecal cuya mucosa se encuentra ulcerada, la pared infiltrada pro gran cantidad PMN neutrófilos que se extiende hasta la grasa periapendicular. Además, se observa tejido adiposo congestivo infiltrado por PMN neutrófilos.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n1.APENDICITIS AGUDA NECROTIZANTE (FRAGMENTOS)\r\n2.TEJIDO ADIPOSO CON INFLAMACIÓN AGUDA\r\n\r\n', '', ''),
	(1908, 'Q2112-3391', 'Q', '73131036', 'LUIS EDUARDO VIDAL BERMUDEZ', '3004202841', 'M', '54', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-14', '2021-12-28', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Válvula" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran un tejido de granulación densamente infiltrado por linfocitos y neutrófilos. No se identifican cambios neoplásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia de úlcera en válvula ileocecal:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n', '', ''),
	(1909, 'Q2112-3392', 'Q', '1043305297', 'DIOMEDEZ DE JESUS DE AGUSTIN RICAUTE', '310602113', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal fragmentada que mide 6 y 1.5 cms. respectivamente, la serosa es opaca y gris la luz ocupada por material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA (FRAGMENTADA)', '', ''),
	(1910, 'Q2112-3393', 'Q', '91213310', 'RAFAEL ANAYA RODRIGUEZ', '3156927644', 'M', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Pólipo gástrico" se recibe una lesión polipoide de color pardo claro y consistencia blanda que mide 1 x 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión polipoide que muestra elongación de las criptas, ramificación y dilatación quística de algunas glándulas, la lámina propia edematosa con infiltrado inflamatorio mixto.\r\n\r\n\r\n\r\n', ' Biopsia de endoscópica de estómago:\r\n-PÓLIPO HIPERPLÁSICO', '', ''),
	(1911, 'Q2112-3394', 'Q', '1235044698', 'CRIHISTIAN ORTEGA LUNA', '3105589144', 'M', '22', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. la serosa es gris y despulida. Al corte la luz ocupada pro material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1912, 'Q2112-3395', 'Q', '1201217833', 'ANGEL DANIEL BARROS DIAZ', '3134879979', 'M', '11', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo y se rotulan C.\r\n4. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo y se rotulan D.\r\n\r\n', 'Los cortes A revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. Hay formación ocasional de acúmulos linfoides. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B revelan cuerpo gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. Hay formación ocasional de acúmulos linfoides. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes de C y D muestran mucosa duodenal sin cambios.\r\n\r\n', ' Biopsia endoscópica múltiple digestiva superior:\r\n1.GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA Y H.PYLORI PRESENTE, antro\r\n2.GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA Y H.PYLORI PRESENTE, cuerpo\r\n3.MUCOSA DE BULBO SIN ALTERACIONES, bulbo\r\n4.MUCOSA DE LA SEGUNDA PORCIÓN DEL DUODENO SIN ALTERACIONES, segunda porción', '', ''),
	(1913, 'Q2112-3396', 'Q', '1045735807', 'JULIETH PAOLA BERDUGO BERDUGO', '00', 'F', '26', 'CLIN. SAN JOSE DE TORICES SAS', 'FAMISANAR', '898201', '30215', 'Doctor MAURICIO ORTIZ', NULL, '2022-01-03', '2021-12-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Fragmento de endometrio" se reciben varios fragmentos de tejido de color oscuro que juntos promedian 2 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan en su mayoría coágulos sanguíneos con algunas glándulas endometriales sueltas y fragmentados y diminutos fragmento de tejido decidual con necrosis. No se observan vellosidades coriales.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1914, 'Q2112-3397', 'Q', '9103566', 'MARIO FERNANDEZ BARRIOS', '3222559184', 'M', '42', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1915, 'Q2112-3398', 'Q', '22792909', 'CEFERINA VILLARREAL BENAVIDES', '00', 'F', '57', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2021-12-29', '2021-12-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Segmento de estenosis de colon" se reciben dos fragmentos de tejido de forma irregular de color pardo oscuro el mayor mide 3 cms. y el menor de 1 cm. de consistencia firme. Al corte una superficie blanquecina que alternan con áreas oscuras. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmentos de pared de colon infiltrado por un adenocarcinoma moderadamente diferenciado. No se puede definir nivel de infiltración la muestra se encuentra fragmentada.\r\n\r\n\r\n\r\n', ' Segmento de estenosis colon:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n (VER DESCRIPCIÓN MICROSCÓPICA)\r\n', '', ''),
	(1916, 'L2112-125', 'L', '1044015747', 'DYLAN ALEXANDER FERRER MARTINEZ', '000', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "Líquido cefalorraquídeo" se reciben 10 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR', '', ''),
	(1917, 'L2112-126', 'L', '1053006623', 'CRISTIAN ANDRES MORALES FONSECA', '3216904576', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "LCR" se reciben 8 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(1918, 'L2112-127', 'L', '1103748655', 'YOFRAN STIVEN PADILLA TEHERAN', '321684365', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2021-12-29', '2021-12-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "LCR" se reciben 9 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1919, 'Q2112-3399', 'Q', '9051647', 'GUILLERMO JOAQUIN ROVIRA ROSALES', '00', 'M', '79', 'PARTICULAR', 'C.', '898201', '30215', 'Doctores ANTONIO MARIA MARTINEZ', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1920, 'Q2112-3400', 'Q', '45495034', 'MARTA CECILIA GUETO FERNANDEZ', '000', 'F', '58', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un punch de piel de color gris que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Epitelio escamoso con hiperqueratosis, acantosis y cambios coilociticos asociados.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n\r\n', '', ''),
	(1921, 'Q2112-3401', 'Q', '1043313717', 'RAFAEL ORTIZ UNDERSHAUSEN', '000', 'M', '33', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipo de recto" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmentos de mucosa rectal con edema, congestión y un infiltrado mononuclear moderado mediado por linfocitos y plasmocitos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de recto:\r\n-INFLAMACIÓN CRÓNICA MODERADA  ', '', ''),
	(1922, 'Q2112-3402', 'Q', '7938509', 'JORGE LUIS PUERTA SALAS', '3166169122', 'M', '36', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa oxíntica sin cambios.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA OXÍNTICA', '', ''),
	(1923, 'Q2112-3403', 'Q', 'VEN0602014', 'ENDYANIS VALENTINA ALVAREZ FEREIRA', '310557878', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. la serosa es opaca, despulida y cubierta pro un material fibrinoso, la luz ocupada por un material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1924, 'Q2112-3404', 'Q', '45487060', 'LORCY ASTRIDT RODRIGUEZ VILLALBA', '000', 'F', '55', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA \r\n\r\n\r\n', '', ''),
	(1925, 'Q2112-3405', 'Q', '1043648356', 'MARIA FERNANDA JIMENEZ HURTADO', '3005193100', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es gris, opaca cubierta por un material fibrinoso, la luz ocupada por un material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1926, 'Q2112-3406', 'Q', '806255706021985', 'CELENIA COROMOTO CAMACARO CATARI', '6521456', 'F', '36', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mioma" se recibe un fragmento de tejido de color pardo claro y consistencia elástica  que mide 2 x 1.8 x 1.3 cms. Al corte una formación nodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Lesión tumoral constituida por haces entrecruzados de músculo liso.\r\n\r\n\r\n\r\n\r\n', ' Miomectomía (1):\r\n-LEIOMIOMA', '', ''),
	(1927, 'Q2112-3407', 'Q', '1143386315', 'JUAN JOSE OLIVERA MEZA', '00', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-03', '2021-12-30', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 cms. la serosa es de color gris, opaca ricamente vascularizada. Al corte la luz ocupada pro un material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(1928, 'Q2201-3408', 'Q', '45557914', 'MONICA RIOS MIRANDA', '000', 'F', '38', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-01-05', '2022-01-04', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular que mide 3 x 2 x 1 cms. de color pardo claro, de consistencia firme. Al corte una superficie blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan mama que muestra un proceso inflamatorio constituido por la presencia de granulomas no caseificantes, células gigantes y abundantes linfocitos alrededor de los lobulillos. No se observan microorganismos ni cambios neoplásicos en la muestra.\r\n\r\n\r\n\r\n', ' Biopsia de mama izquierda:\r\n-MASTITIS GRANULOMATOSA\r\n\r\n', '', ''),
	(1929, 'Q2201-3409', 'Q', '45579953', 'DENIS MARIA FERNANDEZ TAPIA', '3005446057', 'F', '48', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', '', NULL, '2022-01-05', '2022-01-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Colecistectomía" se recibe una vesícula biliar previamente abierta y fragmentada que mide 5 x 4 x 2 cms. tapizada parcialmente por una serosa de color pardo grisáceo, la pared delgada y conserva su aspecto aterciopelado. Acompañado a esto múltiples cálculos de negruzcos. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA \r\n-COLELITIASIS', '', ''),
	(1930, 'Q2201-3410', 'Q', '1043658208', 'LAURA VALENTINA MARRUGO AGAMEZ', '3233874727', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-05', '2022-01-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(1931, 'Q2201-3411', 'Q', '22949595', 'YASNY MENDOZA ANILLO', '000', 'F', '60', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor KEREN ORTIZ CASTRO', NULL, '2022-01-05', '2022-01-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Legrado biopsia" se reciben varios fragmentos de tejido de color pardo oscuro que juntos hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión polipoide constituida por glándulas dilatadas tapizadas por epitelio de tipo endocervical el estroma fibroso bien vascularizado. \r\nSe observa además, coágulos sanguíneos, fibrina y algunas glándulas del segmento uterino.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-PÓLIPO ENDOCERVICAL\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1932, 'Q2201-3412', 'Q', '1047437759', 'ESTEILIS RODRIGUEZ JULIO', '3137123280', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-01-05', '2022-01-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa opaca despulida de color pardo claro que trae adherido material fibrinopurulento. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1933, 'Q2201-3413', 'Q', '1143359756', 'ANGELA ESTHER TABORDA MEJIA', '3017773144', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-05', '2022-01-04', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la luz se encuentra dilatada con salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1934, 'Q2201-3414', 'Q', '1123631443', 'ISMAEL ALFONSO BERRIO BALDIRIS', '000', 'M', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Hemicolectomía derecha" se recibe el producto de una hemicolectomía derecha que trae un segmento de ileon de 7 cms. de longitud y colon ascendente incluido el ciego, de 35 cms. de longitud, la superficie externa esta parcialmente cubierta por apéndice epiploico, todo el espécimen está cubierto por una serosa despulida. En la zona correspondiente al ciego se encuentra un área marcadamente irregular que contiene múltiples putos de sutura. Al corte de la zona descrita se encuentra un engrosamiento irregular en el que se identifican múltiples puntos de sutura. Se toman cortes y se rotulan así: A lesión descrita, B colon a otros niveles, C líneas de resección proximal, D líneas de resección distal.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran pared de colon con focos de inflamación aguda y crónica que compromete todo el espesor de la pared. Los cortes B muestran pared de colon con inflamación crónica del revestimiento peritoneal.\r\nLas líneas de resección son viables.\r\n\r\n\r\n\r\n', ' Hemicolectomía derecha:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA TRANSMURAL EN CIEGO\r\n-PERITONITIS AGUDA Y CRÓNICA\r\n-LÍNEAS DE RESECCIÓN VIABLES\r\n\r\n', '', ''),
	(1935, 'Q2201-3415', 'Q', '1044919564', 'KAREN INES PAJARO MIRANDA', '3106682266', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Placenta" se recibe una placenta que pesa 358 gms. es de forma discoide y mide 15 x 11 x 2 cms. en sus mayores dimensiones, trae sus membranas completas con pequeños coágulos sanguíneos en la zona marginal. La cara materna muestra sus cotiledones completos, la cara fetal es lisa, brillante y muestra un cordón umbilical de implantación periférica, el cordón mide 40 cms. de longitud y muestra 3 vasos. En uno de ellos, se identifica un gran coágulo que lo expande hasta 1 cm. de diámetro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran placenta del tercer trimestre compuesta por vellosidades tapizadas pro cito y sinciciotrofoblasto, con presencia de abundantes nudos sinciciales. Hay cambios de hipoperfusión materna, representados pro vellosidades poco desarrolladas.\r\n\r\n\r\n\r\n', ' Placenta del tercer trimestre (358 gms.).\r\n-SIGNOS DE HIPOPERFUSIÓN MATERNA\r\n\r\n\r\n\r\n', '', 'Los hallazgos descritos son compatibles con los producidos en la preclampsia.\r\n\r\n'),
	(1936, 'Q2201-3416', 'Q', '22977858', 'GRACIELA DEL CARMEN CASTRO ARCE', '3166661826', 'F', '64', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898241', '69000', 'Doctor EDGARDO DURAN GONZALEZ', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero" se recibe un útero sin sus anexos que pesa 28 gms. y mide 6.5 x 3 x 2.5 cms. El cérvix está tapizado por una mucosa de color pardo claro con áreas de color pardo oscuro que rodea un orificio externo irregular. El cuerpo conserva su estructura habitual y está tapizada por una serosa lisa y brillante. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizada por una mucosa delgada de color rosado, el miometrio es homogéneo. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica. El endometrio es atrófico.\r\n\r\n\r\n\r\n\r\n', ' Utero (28 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO ATRÓFICO', '', ''),
	(1937, 'Q2201-3417', 'Q', 'VEN33273305', 'LEANDRO JOSUE FERNANDEZ VIRLA', '32116430466', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 1.7 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa irregular de color pardo oscuro, en su extremo distal y de color pardo claro. Al corte se encuentra una luz marcadamente dilatada que contiene un material de aspecto fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA', '', ''),
	(1938, 'Q2201-3418', 'Q', '1101452079', 'YOINER CHAVEZ CAMARGO', '3206339330', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2022-01-14', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Medula osea de tibia izquierda" en un mismo recipiente, se reciben dos fragmentos de tejido uno de color pardo grisáceo y consistencia blanda, elástica que mide 0.8 cms. en su mayor dimensión. Otro fragmento de consiste en un fragmento de tejido óseo que mide 0.8 x 0.9 x 0.2 cms. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido conectivo laxo densamente infiltrado por linfocitos, células plasmáticas y neutrófilos.\r\nOtros cortes muestran espículas óseas desvitalizadas.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en tibia izquierda:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(1939, 'Q2201-3419', 'Q', '45689202', 'HEYDYS NATIVIDAD UTRIA VERGARA', '00', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Segmento de trompa izquierda" un segmento tubular de tejido que mide 1.5 cms. de longitud. Se toman cortes y se rotulan A.\r\n2. "Segmento de trompa derecha" un segmento tubular de tejido que mide 1.5 cms. de longitud. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA IZQUIERDA. SEGMENTO	\r\n2.TROMPA UTERINA DERECHA. SEGMENTO\r\n\r\n\r\n\r\n', '', ''),
	(1940, 'Q2201-3420', 'Q', '33104894', 'YESMIN CHICA CORREA', '3148637425', 'F', '43', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular, color blanquecino y consistencia elástica que mide 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de cuello uterino con una LIE de bajo grado. Hay cambios sugestivos pero no concluyentes de infección por HPV.\r\n\r\n\r\n\r\n ', ' Biopsia de cérvix:\r\n-LIE DE BAJO GRADO \r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1941, 'Q2201-3421', 'Q', '1002276252', 'YORLADIS MARTINEZ EUSSE', '00', 'F', '30', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'CALDERON', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.7 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida de color pardo claro y al corte se encuentra una luz ligeramente dilatada que contiene un material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(1942, 'L2201-128', 'L', '1137530577', 'EDWUIN ALTAMAR SALAS', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-01-13', '2022-01-06', 'JOSÉ CARABALLO GRACIA', 'Rotulado "LCR" se reciben 6 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', '', ' Extendido de L.C.R.:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(1943, 'Q2201-3422', 'Q', '1048454665', 'MARTIN ANDRES MARTINEZ RODRIGUEZ', '3433988', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-01-17', '2022-01-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se recibe fragmento irregular  de color que mide 2 x 1.9 x 1 cms. de color pardo claro y consistencia elástica. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(1944, 'Q2201-3423', 'Q', '1047389364', 'YARLINA VASQUEZ MARIMON', '000', 'F', '34', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2022-01-18', '2022-01-13', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa derecha" segmento de tropa de Falopio que mide 1.3 cms. Al corte muestra la estructura usual. Se toman cortes y se rotulan A.\r\n2. "Trompa izquierda" segmento de tropa de Falopio que mide 1.8 cms. Al corte muestra la estructura usual. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA DERECHA. SEGMENTO	\r\n2.TROMPA UTERINA IZQUIERDA. SEGMENTO\r\n', '', ''),
	(1945, 'Q2201-3424', 'Q', '2901718', 'JOSE PEDRO VIVAS PEREIRA', '3208114150', 'M', '82', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-18', '2022-01-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(1946, 'Q2201-3425', 'Q', '1058355707', 'QUEWIN DARIO MERCADO HUERTA', '3145088000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-02-01', '2022-01-13', 'ANA MAGOLA MANGA CEDEÑO', 'Se recibe un fragmento irregular de tejido de color pardo grisáceo, consciencia elástica que mide 3.5 cms. Al corte pequeño orificio de 0.2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Epitelio escamoso que descansa en un estroma fibroso que muestra trayecto fistuloso rodeado por tejido de granulación.\r\n\r\n\r\n\r\n\r\n', '-FISTULA, hendidura branquial\r\n\r\n', '', ''),
	(1947, 'Q2201-3426', 'Q', '23140450', 'EVIS MARIA COGOLLO BLANCO', '3046425483', 'F', '37', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2022-01-24', '2022-01-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Cápsula de ovario" se recibe una formación sacular previamente abierta que mide 5 x 4 cms. de aspecto membranoso de color gris, la superficie interna es lisa. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan la pared de un quiste tapizado por epitelio tipo seroso.\r\n\r\n\r\n\r\n', '-CISTADENOMA SEROSO, ovario izquierdo', '', ''),
	(1948, 'Q2201-3427', 'Q', '23139777', 'JILMA ROSA FLORES RAMOS', 'CENTRO', 'F', '64', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2022-01-24', '2022-01-13', 'ANA MAGOLA MANGA CEDEÑO', 'Se reciben varios fragmentos de tejido de color oscuro que juntos promedian 0.4 ml. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan en su mayoría coágulos sanguíneos y estroma endometrial fusocelular. No se identifican glándulas endometriales.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(1949, 'Q2201-3428', 'Q', '33126786', 'VICTORIA VELASQUEZ ROCA', '3116635806', 'F', '74', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora DANIELA DIAZ BLANCO', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral. En uno de ellos se encuentra discreta elongación de los cuellos glandulares. La lámina propia está moderadamente infiltrada por linfocitos y células plasmáticas. No se encuentran cambios metaplasicos, neoplásicos ni presencia de H.pylori.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1950, 'Q2201-3429', 'Q', '1047473924', 'WANDA PAOLA MANRIQUE PEREZ', '3046369600', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. tapizada por una serosa de color pardo claro, congestiva. Al corte la luz ocupada por material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n', '', ''),
	(1951, 'Q2201-3430', 'Q', '1143398314', 'MARIA VICTORIA PADILLA VERTEL', '3022509933', 'F', '25', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Formación sacular, previamente evacuada que mide 4 x 3 cms. salida de material grumoso de color amarillento que contiene pelos, la superficie externa es lisa y de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión quística compuesta por elementos tisulares maduros derivados de diferentes campos germinales.\r\n\r\n\r\n\r\n', ' Resección de lesión quística de ovario derecho:\r\n-TERATOMA QUÍSTICO MADURO\r\n\r\n', '', ''),
	(1952, 'Q2201-3431', 'Q', '1002317060', 'NELLIS PATRICIA GOMEZ LADEUS', '3052861830', 'F', '18', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-01-21', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Placenta" se recibe un fragmento de placenta que pesa 141 gms. y mide 11 x 8 x 2 cms. segmento de cordón umbilical mide 0.3 cms. La cara fetal es de aspecto membranoso, la cara materna presenta múltiples cotiledones con focos de aspecto hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta del segundo trimestre compuesta por vellosidades tapizadas por cito y sinciciotrofoblasto y con marcado edema del mesénquima. Hay marcada inflamación y necrosis del corion y del amnios. No se encuentran elementos que permitan un diagnóstico específico.\r\n\r\n\r\n ', ' Placenta del 2° trimestre (141 gms.):\r\n-CORIOAMNIONITIS AGUDA\r\n\r\n', '', ''),
	(1953, 'Q2201-3432', 'Q', '1001972094', 'TOMAS ALEJANDRO MARTINEZ DIAZ', '3016797892', 'M', '20', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya lámina propia está densamente infiltrada por linfocitos y células plasmáticas. hay presencia de escasos H.pylori (x/xxx) en algunos cuellos glandulares con actividad inflamatoria moderada. No hay cambios atróficos, metaplasicos ni neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(1954, 'Q2201-3433', 'Q', '91220336', 'GUILLERMO QUINTERO CORREDOR', '3126230741', 'M', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1955, 'Q2201-3434', 'Q', '1143361959', 'ALEX FABIAN ESPAÑA VELASQUEZ', '3218457872', 'M', '29', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestra fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1956, 'Q2201-3435', 'Q', '73143508', 'JOSE RAUL RICARDO PACHECO', '3024677875', 'M', '51', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1957, 'Q2201-3436', 'Q', '1137533366', 'JHOJAN DAVID PAYARES CURE', '3115615653', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal con edema e infiltración mononuclear de la lámina propia.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA SEVERA\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA\r\n', '', ''),
	(1958, 'Q2201-3437', 'Q', '1044910952', 'SANTIAGO CASTRO CARRILLO', '3044193744', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 0.6 cms. tapizada por una serosa, opaca y despulida. Al corte salida de material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n', '', ''),
	(1959, 'Q2201-3438', 'Q', '1047432048', 'LUIS EDUARDO MELENDEZ TORRES', '3215145664', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. tapizada pro una serosa de color pardo claro, congestiva. Al corte salida de material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1960, 'Q2201-3439', 'Q', '1044002587', 'ELIANI JANETTE GONZALEZ PEREZ', '31114380445', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. tapizada por una serosa opaca, congestiva con material fibrinopurulento. Al corte hay salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1961, 'Q2201-3440', 'Q', '1049829718', 'NEIVER ANDRES DE ARCO HERRERA', '3217201778', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es opaca bien vascularizada, cubierta por material fibrinopurulento. Al corte salida de material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(1962, 'Q2201-3441', 'Q', '1043982328', 'MELANIE SOFIA JIMENEZ RUIZ', '3024229108', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Se recibe un fragmento de tejido de forma irregular que mide 0.4 cms. tapizado parcialmente por piel. Al corte superficie blanquecina.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por epitelio escamoso que reposa en un corión que contiene anexos cutáneos.\r\n\r\n\r\n\r\n', ' Resección de lesión en región retroauricular derecha:\r\n-QUÍSTE DERMOIDE\r\n\r\n', '', ''),
	(1963, 'Q2201-3442', 'Q', '1047486021', 'JAIDER LUIS MORELO BARRIOS', '3023524982', 'M', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Rotulado "Fístula perianal" se recibe fragmento de tejido de forma irregular que mide 0.7 x 0.3 cms. de color pardo claro. Al corte se observa una cavidad de 0.2 cms. \r\n\r\n\r\n\r\n', 'Los cortes muestran un conducto tapizado por epitelio escamoso maduro que reposa en un corión con focos de infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Resección de lesión perianal:\r\n-FÍSTULA PERIANAL\r\n\r\n', '', ''),
	(1964, 'Q2201-3443', 'Q', '32664369', 'MORAIMA ORTEGA GONZALEZ', '000', 'F', '58', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Se recibe una masa ovoide, tapizada por piel de color oscuro que mide 1  x 0.5 cms. Al corte superficie blanquecina. \r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por epitelio escamoso que rodea y recubre un núcleo de tejido fibroadiposo moderadamente vascularizado.\r\n\r\n\r\n\r\n', ' Resección de lesión en muslo derecho:\r\n-PÓLIPO FIBROEPITELIAL\r\n\r\n', '', ''),
	(1965, 'Q2201-3444', 'Q', '23140619', 'CARMEN CECILIA OSORIO CABRERA', '3144378324', 'F', '36', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-01-15', '2022-01-13', 'OLIVA MARRUGO GRICE', 'Se recibe un útero sin anexos que pesa 137 gms. y mide 10 x 7 x 4 cms. El cuello tapizado por una mucosa blanquecina con orificio transversal. El cuerpo por una serosa de color pardo claro. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizada por una mucosa rojiza. El espesor del miometrio es de 1 cm. sin alteraciones. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica. El endometrio está compuesto por glándulas tubulares de pequeño calibre que reposan en un estroma con signos de predecidualización.\r\n\r\n\r\n\r\n\r\n', ' Útero de 137 gms. con:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO CON TRANSFORMACIÓN DECIDUAL\r\n\r\n\r\n\r\n', '', 'Los cambios endometriales son sugestivos de la administración de progestágenos.\r\n\r\n\r\n'),
	(1966, 'L2201-129', 'L', '3800603', 'YELSON HINCAPIE OTERO', '00', 'M', '52', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor GILBERTO GOMEZ POSSO', NULL, '2022-01-14', '2022-01-14', 'JOSÉ CARABALLO GRACIA', 'Se reciben dos placas con su extendido.\r\n\r\n\r\n\r\n', 'Los extendidos son marcadamente hemorrágicos y contienen coloide y muy escasas células foliculares.\r\n\r\n\r\n\r\n\r\n', ' BACAF de nódulo tiroideo:\r\n-MUESTRA NO DIAGNÓSTICA\r\n-CATEGORIA I DE BETHESDA', '', ''),
	(1967, 'Q2201-3445', 'Q', '33139797', 'GLORIA AYALA DE ALZAMORA', '', 'F', '70', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de cúpula" se recibe un minúsculo fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 x 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está compuesto por un epitelio escamoso atrófico que reposa en un corión con moderada infiltración linfoplasmocitaria. No hay cambios displásicos ni neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de cúpula vaginal:\r\n-COLPITIS ATRÓFICA\r\n\r\n', '', ''),
	(1968, 'Q2201-3446', 'Q', '45525845', 'VICKY MARTINEZ ATENCIO', '31022161893', 'F', '45', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1969, 'Q2201-3447', 'Q', '45460304', 'LUZ RIOS AGUDELO', '3002718867', 'F', '56', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de exocervix" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian un diámetro mayor de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cérvix con inflamación crónica, metaplasia escamosa. Hay cambios citológicos sugestivos pero no concluyentes de infección por HPV.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n\r\n'),
	(1970, 'Q2201-3448', 'Q', '1007763902', 'KELLY JOHANNA PEREZ NAJERA', '00', 'F', '22', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se reciben varios fragmentos de tejido de forma irregular de color amarillento y consistencia blanda cuyos diámetros oscilan entre 1 y 2.2 cms. en mayor de estos muestra una zona central blanquecina que al corte presenta una superficie de color pardo claro con áreas de color pardo oscuro y pequeñas cavidades. Se toman cortes. \r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido mamario cuya morfología está alterada por la presencia de pequeñas estructuras quísticas que reposan en un estroma fibroescleroso. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en mama izquierda:\r\n-CONDICIÓN FIBROQUÍSTICA', '', ''),
	(1971, 'Q2201-3449', 'Q', '1043975015', 'VANESSA MARIA CASTILLO SAMPAYO', '3116592314', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '', '', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice" un apéndice cecal que mide 8 x 0.5 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa lisa y brillante, color pardo grisáceo. Al corte se encuentra una luz puntiforme. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Cuña de ovario derecho" contiene un fragmento de tejido de aspecto sacular previamente abierto que mide 2.8 cms. en su mayor dimensión, la superficie externa es irregular de color pardo oscuro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran apéndice cecal cuya morfología está preservada.\r\nLos cortes rotulados B muestran ovario en el que se identifica una cavidad tapizada por elementos foliculares luteinizados. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', '1.APENDICE CECAL\r\n\r\n2.QUISTE LÚTEO, ovario derecho (cistectomía)', '', ''),
	(1972, 'Q2201-3450', 'Q', '1201257849', 'DAVINSON ALEXIS JIMENEZ GOMEZ', '3145318218', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2.6 x 1.2 x 1 cms. La superficie externa es irregular de color rosado y al corte se encuentra una superficie de color pardo rojizo. Se toman cortes y se rotulan A.\r\n2.  "Amígdala izquierda" una amígdala palatina que mide 2.6 x 1.2 x 1 cms. La superficie externa es irregular de color rosado y al corte se encuentra una superficie de color pardo rojizo. Se toman cortes y se rotulan B.\r\n3. "Adenoides" varios fragmentos de tejido de forma irregular de color pardo rosado y consistencia elástica que miden en conjunto 2.5 x 0.5 cms. en sus mayores dimensiones. Al corte se encuentra una superficie de color pardo rojizo. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n\r\n2.HIPERPLASIA ADENOIDEA\r\n', '', ''),
	(1973, 'Q2201-3451', 'Q', '22779736', 'MARIA DE LOS ANGELES PALOMINO PEREZ', '00', 'F', '82', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora ADRIANA PAOLA LOPEZ', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia peri bronquial lóbulo medio" se reciben tres fragmentos diminutos de tejido de forma irregular de color blanquecino y consistencia blanda los cuales mide 0.1 cm. y el mayor 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de pared bronquial con infiltración por linfocitos, células plasmáticas y eosinófilos. en uno de los fragmentos hay modificación del epitelio por hiperplasia basal.\r\nNo se encuentran cambios neoplásicos ni granulomas.\r\n\r\n\r\n\r\n', ' Biopsia peribronquial del lóbulo medio.\r\n-BRONQUITIS CRÓNICA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(1974, 'Q2201-3452', 'Q', '1201257549', 'JULIANA PADILLA BLANCO', '3135083843', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARIA CLAUDIA BURGOS', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2 x 1.5 x 1.5 cms. en sus mayores dimensiones. La superficie externa es ligeramente irregular y al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2.  "Amígdala izquierda" Amígdala derecha" una amígdala palatina que mide 2 x 1.5 x 1.5 cms. en sus mayores dimensiones. La superficie externa es ligeramente irregular y al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan  B.\r\n3. "Adenoides" varios fragmentos de tejido de forma irregular de color pardo rosado y consistencia blanda que miden en conjunto hacen un volumen de 4 ml. Se toman cortes y se rotulan C.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestra amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMÍGDALITIS CRÓNICA\r\n\r\n2.HIPERPLASIA ADENOIDEA', '', ''),
	(1975, 'Q2201-3453', 'Q', '1049830768', 'JUAN JAVIERE VILLA ESPINOSA', '3226537704', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Hidrocele derecho" se reciben varios fragmentos de tejido de aspecto membranoso de color pardo grisáceo el mayor de los cuáles mide 5 cms. en su mayor dimensión.  Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura membranosa tapizada por uno de sus lados por un mesotelio.\r\n\r\n\r\n\r\n', ' Hidrocelectomía derecha:\r\n-HIDROCELE\r\n\r\n', '', ''),
	(1976, 'Q2201-3454', 'Q', '1048469980', 'EMILIANO OSPINO RODRIGUEZ', '3022424301', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que promedia 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso sin alteraciones.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada.\r\nLos cortes rotulados C muestran fragmento de mucosa duodenal sin cambios.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n\r\n2.Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA ANTRAL\r\n\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL\r\n', '', ''),
	(1977, 'Q2201-3455', 'Q', '32458152', 'ROSALBA VERGARA DE MONTES', '3218588307', 'F', '71', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1978, 'Q2201-3456', 'Q', '45453987', 'YOLANDA FALCON PRASCA', '6614369', 'F', '62', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(1979, 'Q2201-3457', 'Q', '6481359', 'SAMUEL ARTURO VILLEGAS GIRALDO', '3128811569', 'M', '67', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-17', '2022-01-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Esófago" se reciben múltiples fragmentos de tejido de forma irregular de color pardo grisáceo y consistencia friable que en conjunto hacen un volumen de 1 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno epitelial compuesto por células pleomórficas de núcleos grandes, irregulares, hipercromáticos, que se disponen formando estructuras glanduliformes y áreas sólidas. En uno de los fragmentos se identifica el epitelio escamoso por encima del tumor.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de lesión en esófago:\r\n-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(1980, 'Q2201-3458', 'Q', '45578549', 'LEDIS PATRICIA CUESTA BRACAMONTE', '3205732324', 'F', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor MARLON DEL TORO HERRERA', NULL, '2022-01-19', '2022-01-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero, trompas y ovario" se recibe un útero con sus anexos que pesa 339 gms. y mide 10 x 9 x 6 cms.  en sus mayores dimensiones. El cérvix está tapizado por una mucosa de color pardo amarillento que rodea un orificio externa alargado transversalmente. El cuerpo está aumentado de tamaño y deformado por la presencia de múltiples masas subserosas. Las trompas u los ovarios son externamente normales. Al corte el canal endocervical es permeable, la cavidad endometrial está ocupada por una gran masa polipoide que se desprende del fondo que mide 5.5 x 2 x 2 cms. en sus mayores dimensiones. En el miometrio se observan múltiples masas de localización intramural y subserosa cuyos diámetros oscilan entre pocos milímetros y 5 cms. Se toman cortes.\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica. El endometrio está compuesto por glándulas de pequeño calibre tapizadas por epitelio cilíndrico bajo. Estos cambios se repiten en la estructura polipoidea descrita. Las masas descritas están compuestas por fibras musculares lisas dispuestas irregularmente. Las trompas y los ovarios son normales.\r\n\r\n\r\n\r\n', ' Útero y anexos (339 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO CON TRANSFORMACIÓN DECIDUAL DE PROBABLE ORIGEN IATROGÉNICO\r\n-PÓLIPO ENDOMETRIAL CON TRANSFORMACIÓN DECIDUAL DE PROBABLE ORIGEN IATROGÉNICO\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS', '', ''),
	(1981, 'Q2201-3459', 'Q', '1052973875', 'ANTONY LUIS GAMARRA POLANCO', '3015857391', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-01-19', '2022-01-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Unión pieloureteral derecha" se recibe un fragmento tubular de tejido que mide 2.5 cms. de longitud, en uno de sus extremos se encuentra dilatado formado una especie de embudo. Al corte en la unión del área dilatada y el uretel se encuentra una zona estenotica. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un conducto tapizado por un urotelio que en un extremo está dilatado y en el otro muestra una zona de estenosis.\r\n\r\n\r\n\r\n', ' Resección de unión pieloureteral:\r\n-ESTENOSIS DE UNIÓN PIELOURETERAL', '', ''),
	(1982, 'Q2201-3460', 'Q', '1142921369', 'KEILIN SAITH CASTRO GARCIA', '3002208032', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctor RODRIGO DE VIVERO', NULL, '2022-01-19', '2022-01-18', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotula A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal cuya lámina propia está edematosa, congestiva y densamente infiltrada por linfocitos, células plasmáticas y neutrófilos. No se encuentran parásitos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS SUELTOS DE EPITELIO ESCAMOSO\r\n\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n3.Biopsia endoscópica de duodeno:\r\n-DUODENITIS AGUDA Y CRÓNICA', '', ''),
	(1983, 'Q2201-3461', 'Q', '1051890348', 'MARISOL GONZALEZ GONZALEZ', '3012963652', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-01-19', '2022-01-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.8 cms. en sus mayores dimensiones. En su extremo distal se encuentra una solución de continuidad de 1 cm. de diámetro cubierto por una serosa despulida, irregular de color pardo grisáceo. Al corte se encuentra en la solución de continuidad descrita una cavidad irregular que se extiende hacia la luz, que contiene un material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA PERFORADA\r\n\r\n', '', ''),
	(1984, 'Q2201-3462', 'Q', '73191815', 'GLEN ALCIDES PALOMINO SARAVIA', '3168279211', 'M', '39', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-19', '2022-01-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1985, 'Q2201-3463', 'Q', '45761950', 'PATRICIA MEDRANO ALFARO', '3136574954', 'F', '45', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-19', '2022-01-18', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1986, 'Q2201-3464', 'Q', '73007006', 'JUAN CAMILO CRUZ RODRIGUEZ', '3017945362', 'M', '37', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-19', '2022-01-18', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa gástrica oxíntica que conserva su morfología habitual.\r\n\r\n\r\n', '1.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n2.Biopsia endoscópica de cuerpo gástrico:\r\n-MUCOSA GÁSTRICA OXÍNTICA', '', ''),
	(1987, 'Q2201-3465', 'Q', '9076873', 'JUAN MERCADO MARIMON', '3107237877', 'M', '70', 'GASTROPACK SAS', 'PARTICULAR', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fondo" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica oxíntica cuya morfología está preservada. Hay discreto infiltrado linfoplasmocitario alrededor de los cuellos glandulares. No se identifican H.pylori.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(1988, 'Q2201-3466', 'Q', '45469206', 'IGNACIA CAMACHO PACHECO', '3217547847', 'F', '56', 'ORG. CLINICA GENERAL DEL NORTE', '', '2020205', '74106', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de exocervix" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.7 x 0.4 cms. Se toma todo en dos cortes y se rotulan A.\r\n2. "Biopsia de lesión polipoide endocervical" una estructura alargada de forma irregular de color pardo claro y consistencia blanda que mide 0.8 x 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de cuello uterino con una LIE de bajo grado con cambios citopáticos secundarios a infección por HPV. Hay densa infiltración mononuclear del estroma.\r\nLos cortes rotulados B muestran una estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n', '1.Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA CON LIE DE BAJO GRADO CON CAMBIOS SECUNDARIOS A INFECCIÓN POR HPV\r\n\r\n2.PÓLIPO ENDOCERVICAL', '', ''),
	(1989, 'Q2201-3467', 'Q', '32939802', 'KENIA LUCIA JARAMILLO BENITO', '3014936248', 'F', '36', 'GASTROPACK SAS', 'PARTICULAR', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Pólipo esofágico" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotula A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran una lesión compuesta pro tallos de tejido fibrovascular recubiertos por epitelio escamoso hiperplásico. Hay discretas atípias focales.\r\nLos cortes rotulados B muestran mucosa gástrica antral cuya lámina propia está densamente infiltrada por linfocitos y células plasmáticas. Hay, además, infiltración por neutrófilos alrededor de los cuello glandulares. En algunas de estos se identifican H.pylori en escasa cantidad (x/xxx). No hay cambios atróficos, metaplasicos o displásicos.\r\n\r\n\r\n\r\n', '1.Resección endoscópica de lesión en esófago:\r\n-PAPILOMA ESCAMOSO\r\n\r\n2.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON MODERADA ACTIVIDAD INFLAMATORIA', '', ''),
	(1990, 'Q2201-3468', 'Q', '1143391444', 'ZHEYDY JULIETH GARCIA GALINDO', '00', 'F', '23', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7.8 x 2.8 cms. La superficie externa esta parcialmente cubierta por una serosa despulida y al corte está engrosada y la mucosa ha perdido su aspecto aterciopelado y la luz está ocupada por un material grumoso de color pardo amarillento y fragmentos de cálculo biliar. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(1991, 'Q2201-3469', 'Q', '33144473', 'ELSY MARIA BARCASNEGRAS DE REDONDO', '0000', 'F', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Resección de lesión en piel de masa en nuca" se recibe una masa de tejido de forma irregular, de color pardo amarillento y consistencia elástica que mide 1.5 x 1 cms. en sus mayores dimensiones. Al corte se observa una superficie untuosa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Resección de masa en cuello:\r\n-LIPOMA\r\n\r\n', '', ''),
	(1992, 'Q2201-3470', 'Q', '33157628', 'EDITH PIÑA SABALZA', '3116876817', 'F', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de resección en masa glúteo izquierdo" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.5 x 1 x 0.7 cms. La superficie externa esta cubierta por una elipse de piel que mide 1.7 x 0.5 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel por debajo de la cual se encuentra un tumor benigno de origen neural compuesto por células grandes, de citoplasma finamente granular y núcleos pequeños, redondeados y ovoides, que se disponen en un patrón sólido.\r\n\r\n\r\n\r\n', ' Resección de masa en región glútea izquierda:\r\n-TUMOR DE CÉLULAS GRANULARES\r\n\r\n', '', ''),
	(1993, 'Q2201-3471', 'Q', '8668104', 'JOSE MARIA CAICEDO CASTILLA', '00', 'M', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de resección de masa en pierna izquierda" se recibe una masa de tejido de forma irregular de color pardo amarillento y consistencia elástica que mide 5 x 4 x 1.5 cms. Al corte se observa una superficie untuosa de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en miembro inferior izquierdo:\r\n-LIPOMA\r\n\r\n', '', ''),
	(1994, 'Q2201-3472', 'Q', '1002430661', 'YORLIS PATRICIA CORTINA JARABA', '3215481858', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora LAURISELL GUTIERREZ BLANCHAR', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.2 x 0.5 cms. La superficie externa esta cubierta por una serosa despulida y con un ligero aumento de la trama vascular. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal que en su extremo distal muestra ausencia de mucosa cuya luz ha sido reemplazada por tejido fibroso denso. No se encuentran cambios inflamatorios.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-OBLITERACIÓN FIBROSA DEL APÉNDICE\r\n\r\n\r\n', '', ''),
	(1995, 'Q2201-3473', 'Q', '1052074254', 'KEINER DAVID TERAN ROMERO', '3225925038', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor HENRY TORRES MONTES', NULL, '2022-01-24', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Curetaje fémur distal" se recibe un fragmento de tejido óseo de forma irregular de color pardo claro y consistencia firme que mide 2.8 x 1.2 cms. en su mayor dimensión. En el mismo recipiente, se recibe además múltiples fragmentos de tejido de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 1 ml. Se toma parte del tejido óseo y se pone a descalcificar. Se incluye todos los fragmentos de tejidos blandos. \r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran espículas oseas desvitalizadas y un tejido que contiene elementos propios de la medula osea y un infiltrado inflamatorio mediado por neutrófilos, linfocitos y macrófagos con áreas de aspecto necrótico.\r\n\r\n\r\n\r\n', ' Curetaje biopsia de fémur distal izquierdo:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(1996, 'Q2201-3474', 'Q', '1044930987', 'LUIS GIRALDO ALTAMAR CASERES', '3137116823', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Tumor benigno de región dorsal" se reciben dos diminutos fragmentos de piel de color pardo oscuro y consistencia elástica que miden 0.7 x 0.4 y 0.5 x 0.2 cms. en su mayor dimensión. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se observa una proliferación de vasos capilares que reposan en un estroma denso, colagenizado. Algunos vasos muestran en la periferia un infiltrado mononuclear.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en región dorsal:\r\n-HEMANGIOMA CAPILAR\r\n\r\n', '', ''),
	(1997, 'Q2201-3475', 'Q', '1044011351', 'ABID SOFIA MANRRIQUE MIRANDA', '3052114239', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-01-24', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Leucodermia" se recibe un fragmento de piel de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis muestra hiperqueratosis sin paraqueratosis. En el estrato basal los melanocitos conservan su morfología y número. Hay disminución focal del pigmento melánico. En el dermis superior se encuentra un infiltrado perivascular mediado por linfocitos.\r\n\r\n\r\n\r\nOBSERVACIONES: Los hallazgos son sugestivos pero no concluyentes de una LEUCODERMIA POSTINFLAMATORIA. Se recomienda correlación clínico-patológica.\r\n\r\n\r\n', ' Biopsia de lesión hipopigmentada en antebrazo izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO', '', ''),
	(1998, 'Q2201-3476', 'Q', '1043999520', 'JEISON RAFAEL HERNANDEZ MEDINA', '3245154243', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Prepucio" se recibe un fragmento de prepucio de color pardo oscuro y consistencia elástica que mide 2.5 x 1.5 cms. en su mayor dimensión. Se toma cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en la que se observa una reacción inflamatoria aguda y crónica mediada por linfocitos, macrófagos y neutrófilos.\r\n\r\n\r\n\r\n', ' Resección de prepucio:\r\n-POSTITIS AGUDA Y CRÓNICA\r\n\r\n', '', ''),
	(1999, 'Q2201-3477', 'Q', '45538665', 'JAQUELINE GAMARRA CHIQUILLO', '000', 'F', '46', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Resección de lipoma en espalda" se recibe una masa de tejido de forma irregular de color pardo amarillento y consistencia elástica que mide 6.5 x 3.2 x 2.5 cms. La superficie externa está cubierta por una fina cápsula. Al corte se observa una superficie untuosa de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en espalda:\r\n-LIPOMA\r\n\r\n', '', ''),
	(2000, 'Q2201-3478', 'Q', '32935577', 'YILIAN LORENA CASTILLO HURTADO', '000', 'F', '37', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7 x 2.6 cms. en sus mayores dimensiones. La superficie externa esta parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de fragmentos de cálculos de color pardo amarillento. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2001, 'Q2201-3479', 'Q', '23232872', 'LINA ESTHER CASTILLA DE PEREZ', '00', 'F', '79', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 5 x 2 cms. en sus mayores dimensiones. La superficie externa esta parcialmente cubierta por una serosa despulida, la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de múltiples cálculos pequeños que rodean un área de fibrosis. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(2002, 'Q2201-3480', 'Q', '45491883', 'ROSALBA DIAZ OROZCO', '00', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7.5 x 2.3 cms. La superficie externa esta cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de cálculo de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2003, 'Q2201-3481', 'Q', '1047389758', 'ORLANDO CESPEDES ROMERO', '0000', 'M', '32', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7.8 x 2.4 cms. en su mayor dimensión, la superficie externa esta parcialmente cubierta por una serosa despulida y al corte está engrosada y la mucosa ha perdido su aspecto aterciopelado y la salida de cálculos pequeños facetados. Se toman cortes .\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(2004, 'Q2201-3482', 'Q', '23143801', 'EDITH MARIA ALTAMAR TORREGLOSA', '0000', 'F', '79', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898241', '69000', 'Doctor JOSE ACEVEDO', NULL, '2022-01-21', '2022-01-20', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero" se recibe un útero sin anexos que pesa 31 gms. y mide 8.8 x 3.4 x 2 cms. El cérvix está tapizado por una mucosa gruesa de color pardo claro sin lesiones aparentes. El cuerpo conserva su forma habitual. Al corte el canal endocervical es permeable, y la cavidad endometrial está tapizada por una mucosa delgada. El miometrio es fibrilar y mide hasta 1 cm. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica e hiperqueratosis superficial. El endometrio es atrófico.\r\n\r\n\r\n\r\n\r\n', ' Útero de 31 gms. con:\r\n-CERVICITIS CRÓNICA CON HIPERQUERATOSIS SUPERFICIAL\r\n-ENDOMETRIO ATRÓFICO', '', ''),
	(2005, 'Q2201-3483', 'Q', '45491223', 'LINEY JIMENEZ LUNA', '00', 'F', '51', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con se nombre, se recibe un punch de piel que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan piel con hiperqueratosis, hipergranulosis focal y un infiltrado en banda que toca la unión dermoepidermica mediado principalmente por linfocitos, hay presencia de melanofagos en el dermis papilar.\r\n\r\n\r\n\r\n', ' Biopsia de piel de dorso de pie derecho:\r\n-LIQUEN PLANO', '', ''),
	(2006, 'Q2201-3484', 'Q', '1050034355', 'PAOLA ANDREA DE ORO HERRERA', '3046721007', 'F', '35', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n', '', ''),
	(2007, 'Q2201-3485', 'Q', '8713092', 'ALVARO ENRIQUE ARROYO FONSECA', '000', 'M', '60', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Mucosa de papila" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotula B.\r\n\r\n\r\n', 'Los cortes A muestran mucosa gástrica cuya lámina propia está edematosa, congestiva, infiltrada por linfocitos,  plasmocitos en moderada cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B rotulado "papila" muestra fragmento de mucosa duodenal con inflamación crónica leve.\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA LEVE ', '', ''),
	(2008, 'Q2201-3486', 'Q', '1231339926', 'JHON ESTEBAN GARCES ANAYA', '3017315544', 'M', '3', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotula A.\r\n2. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan E.', 'Los cortes A solo revelan fragmentos de mucosa esofágica sin alteraciones.\r\nLos cortes B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes de C revelan mucosa oxíntica sin alteraciones.\r\nLos cortes de D y E revelan mucosa de duodeno con inflamación crónica moderada.\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE MUCOSA ESOFÁGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de Estómago (cuerpo):\r\n-MUCOSA OXÍNTICA SIN ALTERACIONES\r\n4.Biopsia endoscópica de bulbo:\r\n-MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA MODERADA\r\n5.Biopsia endoscópica de segunda porción:\r\n-MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA MODERADA', '', ''),
	(2009, 'Q2201-3487', 'Q', '1121887585', 'JUAN SEBASTIAN SUAREZ RAMIREZ', '3158559956', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-31', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es de color rosado y congestiva. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(2010, 'Q2201-3488', 'Q', '33152415', 'GRACIELA BOSSIO FORERO', '000', 'F', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Legrado" se reciben varios fragmentos de tejido de color pardo oscuro que juntos promedian 4 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan en su mayoría coágulos sanguíneos y un fragmento de lesión polipoide constituida por glándulas dispuestas de forma irregular tapizadas por epitelio cilíndrico bajo, el estroma fusocelular con vasos de paredes gruesas.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTO DE PÓLIPO ENDOMETRIAL TIPO ATRÓFICO', '', ''),
	(2011, 'Q2201-3489', 'Q', '42207902', 'IRINA MERCEDES ANAYA HERNANDEZ', '3106014527', 'F', '58', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un fragmento de tejido que mide 1.3 x 1 cms. Al corte una superficie amarillenta de aspecto adiposo Se toman cortes.\r\n\r\n\r\n\r\n', 'Lesión tumoral benigna tapizada por epitelio escamoso que descansan en un estroma fibroadiposo.\r\n\r\n\r\n\r\n', '-FIBROMA BLANDO, región posterior del muslo derecho\r\n\r\n', '', ''),
	(2012, 'Q2201-3490', 'Q', 'VEN27253529', 'RICHIR ROIBELIN MARTINEZ BRETT', '3226031461', 'F', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste paraovarico derecho + trompa" se recibe una trompa de Falopio que mide 8 cms. en uno de sus extremos muestra una lesión quística translúcida de 6 x 3 cms. en el otro extremo está dilatada. Al corte de la lesión quística se observa salida de un líquido claro, la superficie interna es lisa y brillante. Se toman cortes y se rotulan A, cortes de la trompa se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan lesión quística tapizada por epitelio aplanado, los cortes de B revelan trompas de Falopio dilatadas conteniendo material hemático.\r\n\r\n\r\n\r\n', '1.QUÍSTE SIMPLE PARATUBARICO DERECHO\r\n2.HEMATOSALPINX', '', ''),
	(2013, 'Q2201-3491', 'Q', '45464604', 'MARGARITA CRISTINA RODRIGUEZ ESPAÑA', '00', 'F', '60', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Endometrio" se reciben fragmentos de tejido de color oscuro de aspecto hemorrágico que juntos promedian 1.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes solo revelan coágulos sanguíneos, fragmentos sueltos de epitelio escamoso. No se observa tejido endometrial.\r\n\r\n\r\n\r\n', ' legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2014, 'Q2201-3492', 'Q', '1043990115', 'ORIELSI SOFIA MENDIVIL MESTRE', '3022755516', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'DOctor ANTONIO DE JESUS ARAUJO OROZCO', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Ganglión" se recibe un fragmento de tejido de forma irregular de color blanquecino que mide 1 x 0.5 cms. Al corte cavidad quística de 0.4 cm. Se toma todo. \r\n\r\n\r\n\r\n', 'Fragmentos de tejido fibroso denso con zonas de degeneración quística.\r\n\r\n\r\n\r\n', '-GANGLIÓN, dorso muñeca izquierda', '', ''),
	(2015, 'Q2201-3493', 'Q', '1047438303', 'LUIS ENRIQUE CARREAZO LEON', '3216548151', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia está edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2016, 'Q2201-3494', 'Q', '1201227587', 'JOSIAS DAVID NARVAEZ TEJEDOR', '3126589629', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es opaca y despulida. Al corte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2017, 'Q2201-3495', 'Q', '1066184643', 'IVANNA SOFIA MONTIEL LOBO', '3013509534', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, MODERADA\r\n\r\n', '', ''),
	(2018, 'Q2201-3496', 'Q', '1047219693', 'JESUS DAVID BARRIOS CARDONA', '30467020209', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 cms. la serosa es gris y congestiva. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2019, 'Q2201-3497', 'Q', '1047500683', 'LUIS DAVID BARRERA MONTALVO', '3014492951', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Testículo derecho" se recibe un testículo y elementos del cordón. El testículo mide 2.5 x 1.5 cms. La superficie externa es de color blanco azulado. Al corte de color pardo oscuro, la superficie es levemente granular de color oscuro. Se toman cortes del epidídimo.\r\n\r\n\r\n\r\n', 'Testículo constituido por túbulos atróficos con hiperplasia de células de Sertoli engrosamiento de la membrana basal, se observa además áreas de necrosis hemorrágica.\r\n\r\n\r\n\r\n', '-TESTÍCULO CRIPTORQUIDICO DERECHO\r\n-EPIDÍDIMO', '', ''),
	(2020, 'Q2201-3498', 'Q', '1048458166', 'SEBASTIAN JUNIOR BARBOZA SUAREZ', '3234623010', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1.5 cms. La serosa es de color oscuro. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2021, 'Q2201-3499', 'Q', '22763067', 'TERESA ELVIRA MARTINEZ PEDROZO', '00', 'F', '84', 'LIGA CONTRA EL CANCER', '', '898201', '30215', '', NULL, '2022-02-01', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe una masa de tejido, ovoidea de color blanco amarillento de aspecto fibroadiposo que mide 4 x 2.8 x 2 cms. Al corte una formación de 2 x 1.5 x 1 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes revelan mama con un tumor epitelial maligno constituido por células con núcleos pleomórficos, hipercromáticos con abundante citoplasma que se disponen formando túbulos y nidos sólidos, se observan figuras de mitosis anormales, el tumor infiltra el estroma. No hay invasión peri neural ni vascular.\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-CARCINOMA DUCTAL DE TIPO NO ESPECIAL GRADO II, (NOTTINGHAM 6)  (NÚCLEOS 3), (TÚBULOS 2), (MITOSIS I)', '', ''),
	(2022, 'Q2201-3500', 'Q', '1010092772', 'LEONOR GIRADO GALERA', '00', 'F', '59', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora LAURISELL GUTIERREZ BLANCHAR', NULL, '2022-01-26', '2022-01-21', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero + cuello + trompa" se recibe un útero que pesa 1270 gms. y mide 22 x 14 x 10 cms. El cuello alargado tapizado por una mucosa blanquecina con orificio puntiforme, el cuerpo tapizado por una serosa de color pardo rosado aumentado globalmente de tamaño. Al corte el canal endocervical es permeable, la cavidad endometrial está rechazada por la presencia de una gran masa blanquecina, arremolinada que mide 10 x 8 x 7 cms. Se observan pequeñas masas de iguales características a nivel miometrial. \r\nPor separado, se reciben dos segmentos de trompas de Falopio que miden 1.5 cms. Se toman cortes.\r\n\r\n\r\n', 'Cérvix tapizado por epitelio escamoso, el estroma infiltrado por escasos linfocitos, el endometrio muestra cambios por autólisis. Las masas descritas corresponden a leiomiomas. Las trompas de Falopio no muestran cambios.\r\n\r\n\r\n\r\n', ' Útero (1270 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS\r\n-SEGMENTOS DE TROMPAS DE FALOPIO (2)\r\n\r\n', '', ''),
	(2023, 'Q2201-3501', 'Q', '30767587', 'YOMAIRA MARTINEZ TORRES', '3205517669', 'F', '44', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben varios fragmentos de tejido de forma irregular de color blanquecino y aspecto mucoide que promedian un diámetro mayor de 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmento de cérvix con inflamación crónica y LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-LIE DE BAJO GRADO (CONDILOMA)\r\n\r\n', '', ''),
	(2024, 'Q2201-3502', 'Q', '1128057299', 'MARIA NATALIA FARAH UPARELA', '3167943048', 'F', '34', 'PARTICULAR', '', '898241', '69000', 'Doctora MANUELA BERROCAL', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Capsula mamaria derecha" un fragmento de tejido de forma sacular, aspecto membranoso que mide 10 x 10 cms. de color pardo claro. Se toma corte y se rotulan A.\r\n2. "Capsula mamaria izquierda" un fragmento de tejido de forma sacular, aspecto membranoso que mide 9 x 8 cms. de color pardo claro. Se toma corte y se rotulan B.', 'Los múltiples cortes rotulados A muestran una pared fibrosa tapizada en una de sus caras por un tejido de aspecto sinovial, edematoso, con células de núcleos redondos y citoplasma acidofílico que alternan con linfocitos. No se encuentra actividad mitótica ni cambios neoplásicos.\r\nLos cortes rotulados B muestran una pared fibrosa tapizada en una de sus caras por un tejido de aspecto sinovial. No hay cambios neoplásicos.\r\n\r\n', '1.Cápsula periprotesica de mama derecha:\r\n-METAPLASIA SINOVIAL CON INFLAMACIÓN CRÓNICA\r\n2.Cápsula periprotesica de mama izquierda:\r\n-METAPLASIA SINOVIAL CON INFLAMACIÓN CRÓNICA', '', ''),
	(2025, 'Q2201-3503', 'Q', '45546961', 'KATHERINE CAPACHERO PACHECO', '000', 'F', '38', 'PARTICULAR', '', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Cuello uterino con infiltración mononuclear del estroma. No hay cambios de LIE en la muestra enviada. \r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA', '', ''),
	(2026, 'Q2201-3504', 'Q', '73120956', 'ANTONIO JOSE JIMENEZ ORTIZ', '3156956912', 'M', '56', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 4 cms. parcialmente cubierta por una serosa de color pardo grisáceo. Al corte hay salida de un cálculo de color negruzco, la pared se encuentra engrosada y la luz ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2027, 'Q2201-3505', 'Q', '1128058576', 'KATERINE BARRIOS ALCAZAR', '3206629984', 'F', '34', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Cuello uterino con infiltración mononuclear del estroma. No hay cambios de LIE en la muestra enviada, se observan áreas de metaplasia escamosa.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA\r\n\r\n', '', ''),
	(2028, 'Q2201-3506', 'Q', '1143418453', 'ANTONELLA SOFIA QUINTERO MARTINEZ', '3136043520', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste preauricular" se recibe un fragmento de tejido de forma irregular de color blanco amarillento y consistencia elástica que mide 1.5 x 1 cms. Al corte una superficie blanquecina. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan quiste tapizado por epitelio escamoso que contiene queratina laminar descansa en un estroma donde se observa tejido de granulación y cartílago.\r\n\r\n\r\n\r\n', '-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE, región preauricular izquierda', '', ''),
	(2029, 'Q2201-3507', 'Q', '1041971732', 'ADRIANA SAN JUAN MIELES', '3104575827', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal fragmentada que miden 3 x 1 y 4 x 1 cms.  tapizada por una serosa opaca bien vascularizada de color pardo claro que tiene adherido material fibrinopurulento, la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:.\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2030, 'Q2201-3508', 'Q', '1143417135', 'LIANA SOFIA LOPEZ BELLO', '3006044899', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro mayor de 1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2031, 'Q2201-3509', 'Q', '1047452183', 'YIMARA ANDREA JACKSON PACHECO', '3042697497', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO CAMACHO', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2032, 'Q2201-3510', 'Q', '1043318046', 'ANDRES DAVID ARCIA PINEDA', '3022382121', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-01', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor de reja costal izquierda" se recibe una masa ovoide que mide 3 x 1.5 x 2 cms. de color blanquecino y consistencia firme. Al corte una superficie lisa y blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tumor neural constituido por células alargadas con núcleo oscuro ondulado que descansan en un estroma mixoide.\r\n\r\n\r\n\r\n\r\n', '-NEUROFIBROMA CON CAMBIOS MIXOIDES, región costal izquierda\r\n\r\n', '', ''),
	(2033, 'Q2201-3511', 'Q', '1071429631', 'YINA MARCELA GUEVARA PACHECO', '3135675826', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA ', '', ''),
	(2034, 'Q2201-3512', 'Q', '1047425330', 'JUANDI DEL CARMEN PUERTA ACEVEDO', '3008205584', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "Fibroadenoma mama derecha" se recibe una masa de tejido de forma irregular, que mide 7 x 5 x 4 cms. multinodular de color blanquecino y consistencia elástica. Al corte una superficie multindular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Resección de tumor en mama derecha:\r\n-FIBROADENOMA', '', ''),
	(2035, 'L2201-130', 'L', '1042583626', 'DANNA MAJUL ZAMORA', '3012296105', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR', '', ''),
	(2036, 'L2201-131', 'L', '1222129642', 'JHONATAN DAVID AREVALO GALVIS', '000', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-01-26', '2022-01-25', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR', '', ''),
	(2037, 'Q2201-3513', 'Q', '88206149', 'HERIBERTO ORTIZ CALDERON', '3135679553', 'M', '49', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-01-29', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2038, 'Q2201-3514', 'Q', '33137311', 'RENEY BARBOZA DE SARMIENTO', '00', 'F', '75', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-01-31', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un fragmento elíptico de piel de color pardo claro y consistencia elástica que mide 1.3 x 0.7 cms. en sus mayores dimensiones, en la superficie externa se observa una lesión hipopigmentada y mal delimitada. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se observa un tumor epitelial compuesto por la proliferación de células basaloides que se disponen en nidos sólidos con empalizada periférica. Las líneas de resección están libres de tumor.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel de mejilla izquierda:\r\n-CARCINOMA BASOCELULAR \r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n\r\n', '', ''),
	(2039, 'Q2201-3515', 'Q', '39007628', 'FANNY ESTHER ZABALETA SAVEDRA', '3186685551', 'F', '68', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-01-29', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto infiltrado linfoplasmocitario de la lámina propia. No hay cambios atróficos, displásicos, metaplasicos, ni presencia de H.pylori.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE', '', ''),
	(2040, 'Q2201-3516', 'Q', '32941115', 'MILENA DEL CARMEN TORRES OROZCO', '000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor CANTILLO', NULL, '2022-02-01', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Endometrio" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 6 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'Endometrio compuesto por glándulas tubulares, algunas retraídas, tapizadas por epitelio cilíndrico secretor. Alternan con glándulas de tipo proliferativo. El estroma muestra cambios que van de la fase proliferativa a secretora y contienen abundantes macrófagos cargados de hemosiderina que evidencian sangrado.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-ENDOMETRIO SECRETOR CON DESCAMACIÓN IRREGULAR\r\n\r\n\r\n\r\n\r\nNOTA: Este cuadro histórico se asocia en algunos casos a persistencia del cuerpo lúteo.\r\n\r\n', '', ''),
	(2041, 'Q2201-3517', 'Q', '1050954104', 'LEIDY ESTEFANI MUENTES CERVANTES', '000', 'F', '32', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', '', NULL, '2022-01-29', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral. Hay edema, congestión e infiltración de la lámina propia por linfocitos, células plasmáticas y neutrófilos. En los cuellos glandulares y en el moco superficial se identifican abundantes H.pylori (xxx/xxx). No hay cambios atróficos, displásicos ni metaplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON MODERADA ACTIVIDAD INFLAMATORIA', '', ''),
	(2042, 'Q2201-3518', 'Q', '645777001', 'CARMEN ALICIA TOUS BERRIO', '00', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-01-31', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Resección de masa en muslo izquierdo" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que juntos miden 2.1 x 1.5 x 0.7 cms. Al corte se observa una superficie untuosa de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en muslo izquierdo:\r\n-LIPOMA\r\n\r\n', '', ''),
	(2043, 'Q2201-3519', 'Q', '45480937', 'LILIANA YUNES VERGARA', '3163823704', 'F', '53', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-01-31', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2044, 'Q2201-3520', 'Q', '1043316434', 'FADER JOSE MONCARIS GAMARRA', '3158067350', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-31', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz está dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2045, 'Q2201-3521', 'Q', '9558572', 'ARISTIDES SEGUNDO BELTRAN CUETO', '6461872', 'M', '76', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-01-31', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2046, 'Q2201-3522', 'Q', '1142920252', 'ANGEL DAVID CARABALLO LOPEZ', '3205577238', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-02-07', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Testículo izquierdo" se recibe un testículo con sus elementos del cordón que mide 3.5 x 2 x 0.8 cms. La superficie externa esta cubierta por una serosa lisa y brillante. Al corte se observa una superficie de color violáceo que rodea el testículo propiamente dicho mide 1.1 x 0.8 x 0.8 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran testículo cuya morfología está marcadamente alterada con perdida casi total del componente tubular que ha sido reemplazado por un tejido fibroso infiltrado por macrófagos y con zonas extensas de hialinización y focos de calcificación distrófica. El epidídimo conserva su morfología habitual.\r\n\r\n\r\n\r\n', ' Orquiectomía izquierda:\r\n-TESTÍCULO CON FIBROSIS EXTENSA \r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(2047, 'Q2201-3523', 'Q', '1043017814', 'JULIO ALEJANDRO CANO AYOLA', '6912447', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-01-31', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.2 x 0.8 cms. La superficie externa esta cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2048, 'Q2201-3524', 'Q', '45765651', 'ELIDES MARTINEZ GARCIA', '000', 'F', '45', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor ALBERTO JOSE ACUÑA ARICO', NULL, '2022-01-31', '2022-01-27', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero + cuello" se recibe un útero sin sus anexos que pesa 515 gms. y mide 15.5 x 10.5 x 8 cms. en sus mayores dimensiones. El cérvix está tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo está aumentado de tamaño y deformado. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizado por una mucosa gruesa de color rosado y el miometrio está ocupado por múltiples masas de color blanquecino y aspecto arremolinado, la mayor mide 7.5 cms. de diámetro y la menor de unos pocos milímetros de localización submucosa, intramural y subserosa. Se toman cortes.\r\nNo se recibieron las trompas de Falopio.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio está autólisado. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente.\r\n\r\n\r\n\r\n', ' Histerectomía abdominal tota:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n', '', ''),
	(2049, 'L2201-132', 'L', '1102881834', 'OSNEIDI ELIZABETH FLOREZ ALVAREZ', '3143870571', 'F', '38', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-01-31', '2022-01-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "LCR" se reciben 4.8 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n\r\n', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(2050, 'L2201-133', 'L', '1053006623', 'CRISTIAN ANDRES MORALES FONSECA', '3216904576', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898001', '18900', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-01-31', '2022-01-28', 'VIRNA CARABALLO OSORIO', 'Rotulado "LCR" se reciben 4.5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n', '  Citología de LCR:\r\n-EXTENDIDO ACELULAR', '', ''),
	(2051, 'Q2201-3525', 'Q', '45497433', 'EDELMIRA PACHECO CARDENAS', '3136174590', 'F', '50', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-07', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de color blanquecino que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Epitelio escamoso con focos de acantosis que descansan en un estroma infiltrado predominantemente por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en región perianal con:\r\n-INFLAMACIÓN CRÓNICA INESPECÍFICA', '', 'No se observa lesión de componente quístico en la muestra.\r\n\r\n'),
	(2052, 'Q2201-3526', 'Q', '22804555', 'YOLIMA LIMA SABALZA', '3017296676', 'F', '41', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-07', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color  pardo claro que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se observa un infiltrado inflamatorio crónico mediado por linfocitos y macrófagos, hay disminución de la pigmentación del estrato basal con presencia de melanocitos con morfología y número normal.\r\nLos hallazgos son compatibles con liquen simple crónico e hipomelanosis post-inflamatorio.\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2053, 'Q2201-3527', 'Q', '33116231', 'TULIA MARTELO CANDELARIA MARTINEZ DE BARRIOS', '3174409446', 'F', '77', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-02', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2054, 'Q2201-3528', 'Q', '9084510', 'AMAURI DEL CARMEN CABALEIRO TORRES', '3145618117', 'M', '70', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-02', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipos intestinales" se reciben fragmentos de tejido de aspecto polipoide color pardo claro y consistencia blanda el mayor mide 0.7 cms. y el menor de 0.2 cms. Al corte una superficie de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-ADENOMAS TUBULARES (2)\r\n\r\n', '', ''),
	(2055, 'Q2201-3529', 'Q', '45424050', 'NANCY ESTHER PADILLA DE SILVA', '000', 'F', '67', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-02-02', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un punch de piel de forma redondeada que mide 0.6 cms. tapizada en su totalidad de color pardo oscuro. Al corte una superficie blanquecina y lisa.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral tapizado totalmente por epitelio escamoso que descansan en tallo fibroadiposo.\r\n\r\n\r\n\r\n\r\n', '-FIBROMA BLANDO, seno izquierdo\r\n', '', ''),
	(2056, 'Q2201-3530', 'Q', '1049832390', 'JUAN SEBASTIAN OSPINO PUERTAS', '3008811686', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-02-07', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pieloureteral izquierda" se recibe espécimen que mide 3 cms. que muestra área dilatada en forma de embudo que se continúa con una estructura tubular. \r\n\r\n\r\n\r\n', 'Los cortes revelan que la estructura descrita esta tapizada por urotelio que se extiende a lo largo de la muestra incluida el área estenotica.\r\n\r\n\r\n', ' Resección de unión pieloureteral:\r\n-ESTENOSIS DE LA UNIÓN PIELOURETERAL\r\n\r\n', '', ''),
	(2057, 'Q2201-3531', 'Q', '1044010078', 'SANTHIAGO ANDRES BARRIOS JIMENEZ', '3002427947', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-02-02', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una masa de tejido de forma ovoidea de color blanquecino y consciencia elástica que mide 3 x 2 x 1.5 cms. Al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una masa de tejido de forma ovoidea de color blanquecino y consciencia elástica que mide 3 x 2 x 1.5 cms. Al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan B.\r\n3. "Adenoides" dos fragmentos de tejido que miden el mayor 3 x 3 x 0.5 cms. y el menor de 1 x 1 x 1 cms. Al corte una superficie de color pardo claro. Se toma cortes y se rotulan C.\r\n\r\n', 'Los cortes A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2058, 'Q2201-3532', 'Q', '1049825463', 'DARLING LLERENA TORREGLOSA', '3022890277', 'F', '35', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2022-02-02', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Ectópico, trompa derecha" se recibe una trompa de Falopio que mide 6.5 x 1 x 1 cms. la serosa es de color oscuro en uno de sus extremos se encuentra previamente abierta, donde se observa una formación de color oscuro de forma redondeada. Al corte la luz está dilatada y contiene un material de aspecto hemático. Se toman cortes.\r\n\r\n\r\n\r\n', 'Trompa de Falopio cuya luz está ocupada por coágulos sanguíneos y vellosidades coriales que en algunas áreas infiltran la pared.\r\n\r\n\r\n', '-EMBARAZO TUBÁRICO DERCHO', '', ''),
	(2059, 'Q2201-3533', 'Q', '22789985', 'ANYELYTH PATRICIA OLIVO CASTRO', '3146243177', 'F', '45', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2022-02-02', '2022-01-28', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero, cuello + trompas" se recibe un útero, con sus anexos por separado. El útero pesa 238 gms. y mide 11 x 10 x 5 cms. El cuello es alargado cubierto por una mucosa blanquecina con orificio transversal. El cuerpo aumentado globalmente de tamaño y cubierto por una serosa de color pardo claro. Al corte el canal endocervical es permeable al igual la cavidad endometrial, el endometrio es plano de color rojizo. En el miometrio el espesor se encuentra una masa blanquecina arremolinada que mide 5 x 5 x 4.5 cms. Acompañando formaciones nodulares, blanquecinas, pequeñas.\r\nPor separado, se reciben dos segmentos de trompas de Falopio que miden 4 y 5 cms. que muestran la estructura usual. Se toma cortes.\r\n\r\n', 'Los cortes revelan cérvix tapizado por epitelio escamoso, el estroma infiltrado por escasos linfocitos, el endometrio muestra cambios por autólisis, las formaciones nodulares descritas corresponden a leiomiomas. Las trompas de Falopio no muestran cambios.\r\n\r\n\r\n\r\n', ' Útero (238 gms.):\r\n-CERVICITIS CRÓNICA LEVE\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS\r\n-FRAGMENTOS DE TROMPAS DE FALOPIO (2)\r\n\r\n', '', ''),
	(2060, 'Q2202-3534', 'Q', '23229501', 'MARIA PUELLO DE MESTRE', '3205838569', 'F', '72', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', '', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2061, 'Q2202-3535', 'Q', '45481875', 'ARLETH CORREA PADILLA', '3017388425', 'F', '54', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de lesión polipoide endocervical" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.7 x 1.1 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión endocervical:\r\n-PÓLIPO ENDOCERVICAL\r\n\r\n', '', ''),
	(2062, 'Q2202-3536', 'Q', '33333915', 'ANA MILENA SOTO LOPEZ', '3218389404', 'F', '44', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2063, 'Q2202-3537', 'Q', '45502757', 'ETELVINA MARIA CANO MARIN', '3003454218', 'F', '51', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. No se observa actividad inflamatoria, H.pylori ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(2064, 'Q2202-3538', 'Q', 'VEN33418549', 'TAYLOR ANTOINE CADENAS MILLAN', '3244057097', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.2 x 0.8 cms. La superficie externa esta cubierta pro una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2065, 'Q2202-3539', 'Q', '1043340946', 'JEREMY ARCHIBOLD GARCIA', '3126338423', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-02-04', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'Rotulado "Ileon distal" se recibe un fragmento de ileon que mide 7.5 cms. de largo y 2 cms. de ancho, un segmento está marcadamente disminuido de grosor y mide 3.3 x 1 cms. y se continúa con un área de aspecto dilatado que mide 3 cms. de longitud, y 2.5 cms. de ancho. Al corte hay salida de material fecal de color amarillento, la mucosa del segmento estenotico conserva la morfología habitual, y la pared del área dilatada se encuentra adelgazada y ha perdido los pliegues habituales. Se toman cortes así: A segmento estenotico, B segmento dilatado, C margen de resección distal al segmento estenotico.\r\n\r\n\r\n', 'Los cortes rotulados A muestran pared de intestino delgado cuya mucosa está edematosa, congestiva con una reacción inflamatoria crónica mediada por linfocitos y células plasmáticas.\r\nLos cortes rotulados B muestra pared de intestino delgado con aplanamiento de la mucosa. La lámina propia está edematosa e infiltrada por linfocitos y células plasmáticas.\r\nLos cortes rotulados C muestran pared de intestino delgado que conserva la morfología habitual.\r\n\r\n\r\n', ' Resección de segmento de ileon distal:\r\n-ESTENOSIS\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2066, 'Q2202-3540', 'Q', '1042583719', 'JEIFREN GABRIEL CABARCAS ROMERO', '3114150640', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Resección de ginecomastia derecha" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 3 x 2.8 x 1.5 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Resección de ginecomastia izquierda" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 3.2 x 3 x 2 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejido mamario compuesto por canalículos que reposan en un estroma escleroso. No hay componente lobulillar.\r\n\r\n\r\n\r\n\r\n', '1.GINECOMASTIA DERECHA\r\n2.GINECOMASTIA IZQUIERDA', '', ''),
	(2067, 'Q2202-3541', 'Q', '1043655450', 'JHONATAN DAVID VARGAS CONTRERAS', '3052112295', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se reciben dos fragmentos de apéndice cecal que juntos miden 11.6 x 0.9 cms. en sus mayores dimensiones, la superficie externa esta cubierta por una serosa despulida. Al corte la pared está adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes .\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2068, 'L2202-134', 'L', '3800603', 'YELSON HINCAPIE OTERO', '00', 'M', '52', 'ORG. CLINICA GENERAL DEL NORTE', '', '898001', '18900', 'Doctor GILBERTO GOMEZ POSSO', NULL, '2022-02-02', '2022-02-01', 'VIRNA CARABALLO OSORIO', 'Rotulado "Nódulo tiroideo derecho" se reciben tres placas con su extendido.\r\n\r\n\r\n\r\n', 'Los extendidos están compuestos por escasas células foliculares con núcleos uniformes que se disponen individualmente y en grupos pequeños y reposan en un trasfondo hemorrágico.\r\n\r\n\r\n\r\n', ' BACAF de nódulo tiroideo derecho:\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS (CATEGORIA DIAGNÓSTICA II DEL SISTEMA BETHESDA)\r\n\r\n\r\n', '', ''),
	(2069, 'Q2202-3542', 'Q', '1044000035', 'JOSUAN ENRIQUE JULIO SIERRA', '3104169546', 'M', '22', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', '', NULL, '2022-03-23', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de tejido inguinal" se reciben cuatro fragmentos de tejido de forma irregular que promedian un diámetro mayor de 3.5 cms. de color pardo claro. Al corte una superficie blanquecina, multinodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan ganglios linfáticos en los que se destaca un aumento en el número y tamaño de los folículos que presentan, además, formas irregulares. Los centros germinales contienen abundantes macrófagos que fagocitan detritus celulares. El espacio interfolicular es muy vascularizado y congestivo y contiene linfocitos con atipias leves.\r\n\r\n\r\nCOMENTARIO: Los hallazgos descritos son sugestivos de una hiperplasia folicular reactiva a un proceso sistémico. Sería pertinente ampliar los estudios serológicos y practicar estudios de inmunohistoquímica en la muestra para una definición diagnóstica.\r\n\r\n\r\n', ' Resección de cadena ganglionar inguinal izquierda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n\r\nSe hace entrega de 8 bloques de parafina al señor JORGE REYES, C.C. 102351958,(Domiciliario) Marzo 23 de 2022', '', ''),
	(2070, 'Q2202-3543', 'Q', '1047470090', 'LUISA NOVOA ESTRADA', '3146347898', 'F', '27', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2071, 'Q2202-3544', 'Q', '33209452', 'CANDELARIA PATRICIA ARIAS PAYARES', '3216867798', 'F', '47', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se reciben tres diminutos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Piel que muestra hiperqueratosis, hipergranulosis, acantosis irregular, atípias citológicas moderadas figuras de mitosis y coilocitos, el estroma infiltrado por linfocitos y plasmocitos.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-VIN DE ALTO GRADO (GRADO 2) DE TIPO VERRUCOSO\r\n\r\n', '', ''),
	(2072, 'Q2202-3545', 'Q', '1007609788', 'ALBA CUDRIS MAESTRE', '3218451247', 'F', '18', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(2073, 'Q2202-3546', 'Q', '45506208', 'SEUDITH TERESA LAMAR ALDANA', '000', 'F', '50', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Pólipo endocervical" se recibe lesión polipoide que mide 0.5 x 0.5 cms. de color blanquecino y consistencia elástica Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL\r\n\r\n\r\n', '', ''),
	(2074, 'Q2202-3547', 'Q', '27949626', 'BERNARDA GUALDRON MARTINEZ', '3164650278', 'F', '80', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(2075, 'Q2202-3548', 'Q', '33196442', 'ESPERANZA BENITA MARTINEZ ALVAREZ', '3163487564', 'F', '60', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2076, 'Q2202-3549', 'Q', '1047421566', 'SADDAM JOCE DANIEL ALJURE', '3005499405', 'M', '31', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2077, 'Q2202-3550', 'Q', '22806798', 'MARGARITA FAJARDO CUADRO', '3043943183', 'F', '42', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Pólipo en cuerpo gástrico" un fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n1.GASTRITIS CRÓNICA INACTIVA, LEVE\r\n2.POLIPO DE GLÁNDULAS FÚNDICAS', '', ''),
	(2078, 'Q2202-3551', 'Q', '1043986770', 'MICHEL OLIVERO COGOLLO', '3004538664', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca, bien vascularizada de color pardo claro con áreas de color pardo oscuro, trae adherido material fibrinopurulento. Al corte salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared y se extiende a la grasa pericolica.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2079, 'Q2202-3552', 'Q', '1001979390', 'IVANA FORTICH PASTRANA', '3013444805', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Restos ovulares" se reciben fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que juntos hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan coágulos sanguíneos, fibrina y decidua con focos de necrosis. No se identifican vellosidades corionicas.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2080, 'Q2202-3553', 'Q', '22813269', 'EVELINA MARRUGO BARCENAS', '00', 'F', '90', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor PEDRO LUIS IMBET', NULL, '2022-02-07', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa gástrica que muestra un infiltrado mononuclear moderado, actividad moderada. En uno de sus extremos se observa una zona de necrosis, coágulos de fibrina. No se identica H.pylori.\r\n\r\n\r\n', ' Fragmento de mucosa gástrica con:\r\n-ZONA DE NECROSIS Y COÁGULOS DE FIBRINA, COMPATIBLE CON ÚLCERA PÉPTICA\r\n\r\n', '', ''),
	(2081, 'Q2202-3554', 'Q', '9176025', 'JOSE LUIS GUZMAN GUZMAN', '3216415418', 'M', '50', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-02-07', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.5 cms. la serosa es opaca, despulida bien vascularizada. Al corte hay una zona blanquecina de 0.5 x 0.5 cms. Hay salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2082, 'Q2202-3555', 'Q', '30840849', 'MARINA ISABEL PEREZ TABORDA', '3146909524', 'F', '39', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JOSE BLANCO RICARDO', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Ectópico, trompa derecha" se recibe una trompa de Falopio dilatada que mide 4 x 2 cms. presenta una solución de continuidad que mide 1.5 cms. Al corte hay salida de material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Trompa de Falopio cuya luz está ocupada por coágulos sanguíneos y vellosidades coriales que en algunas áreas infiltran la pared.\r\n\r\n\r\n\r\n\r\n', '-EMBARAZO TUBÁRICO DERECHO\r\n\r\n\r\n', '', ''),
	(2083, 'Q2202-3556', 'Q', '33151939', 'NORIS DEL CARMEN PEREZ MUÑOZ', '3008061175', 'F', '67', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(2084, 'Q2202-3557', 'Q', '9058061', 'JORGE ELIECER VELEZ BARRIOS', '00', 'M', '76', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-07', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Producto de resección de lesión en región cervical" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian un diámetro mayor de 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral benigna constituida por tejido adiposo maduro que alternan con haces gruesas  de tejido fibroso.\r\n\r\n\r\n', '-FIBROLIPOMA, TEJIDOS BLANDOS, nuca\r\n\r\n', '', ''),
	(2085, 'Q2202-3558', 'Q', '1043295047', 'DANIELA RODELO MARTELO', '3233974721', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor OSCAR ENRIQUE ROMERO ORTIZ', NULL, '2022-02-07', '2022-02-03', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama izquierda" una masa de tejido, multinodular que mide 6 x 4 x 3 cms. Al corte una superficie multinodular de color blanquecino. Se toman cortes y se rotulan A.\r\n2. "Mama derecha" una masa de tejido, multinodular que mide 7 x 6 x 5 cms. Al corte una superficie multinodular de color blanquecino. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan tumores benignos compuestos por la proliferación combinada de elementos estromales y glandulares, el estroma es mixoide. No se identifica atípia citológica.\r\n\r\n\r\n\r\n', '1.Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n2.Resección de masa en mama izquierda:\r\n-FIBROADENOMA\r\n\r\n\r\n\r\n', '', ''),
	(2086, 'Q2202-3559', 'Q', '1001971607', 'MARCELA PATRICIA SANMARTIN NAVARRO', '3205177279', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-02-07', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Trompa derecha, ectópico" se recibe una trompa de Falopio dilatada que mide 4 x 3 cms. Al corte la luz se encuentra dilatada y ocupada pro un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Trompa de Falopio cuya luz está ocupada por coágulos sanguíneos y vellosidades coriales que en algunas áreas infiltran la pared.\r\n\r\n\r\n\r\n\r\n', '-EMBARAZO TUBÁRICO DERECHO', '', ''),
	(2087, 'Q2202-3560', 'Q', '1043658670', 'JESUS DAVID ESALAS PEREZ', '3002689879', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JORGE LAMBIS RICARDO', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Testículo izquierdo" se recibe testículo y elementos del cordón que mide 5 x 4 x 3 cms. de color pardo oscuro de consciencia elástica. Al corte la superficie está completamente hemorrágica. Se toman cortes.\r\n\r\n\r\n\r\n', 'Testículo y elementos del cordón que muestran áreas extensas de necrosis hemorrágica.\r\n\r\n\r\n\r\n', ' Testículo izquierdo con:\r\n-NECROSIS HEMORRÁGICA POR TORSIÓN\r\n\r\n', '', ''),
	(2088, 'Q2202-3561', 'Q', '9145393', 'LEWINS DE JESUS BAENA RODRIGUEZ', '00', 'M', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-04', '2022-02-03', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama derecha" una masa de tejido, de forma ovoidea, pesa 40 gms. y mide 8 x 5 x 2.5 cms. Acompañado a esto, fragmento de tejido que mide 5 x 3 x 2 cms. de color blanco amarillento de aspecto adiposo y consistencia elástica. Al corte una superficie lisa, aspecto adiposo. Se toman cortes y se rotulan A.\r\n2. "Mama izquierda" una masa de tejido, de forma ovoidea, pesa 60 gms. y mide 10 x 6 x 2 cms. Al corte una superficie lisa, aspecto adiposo. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan en su mayoría tejido adiposo con escasos canalículos sin cambios.\r\n\r\n\r\n\r\n', '1.Mamoplastia por reducción derecha (40 gms.):\r\n-TEJIDO MAMARIO\r\n2.Mamoplastia por reducción izquierda (60 gms.):\r\n-TEJIDO MAMARIO', '', ''),
	(2089, 'Q2202-3562', 'Q', '33025360', 'MALVIS MEDINA MUÑOZ', '3137515188', 'F', '59', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-02-07', '2022-02-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero" se recibe un útero que pesa 43 gms. y mide 8 x 5 x 3 cms. El cuello tapizado por una mucosa blanquecina. El cuerpo por una serosa de color pardo grisáceo. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizada por una mucosa de color pardo grisáceo, atrófico. El miometrio mide 1 cm. y de aspecto fibrilar. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cérvix con una reacción inflamatoria crónica. El endometrio es atrófico, en el miometrio hay focos de adenomiosis.\r\n\r\n\r\n\r\n', ' Utero (43 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO ATRÓFICO\r\n-ADENOMIOSIS\r\n\r\n', '', ''),
	(2090, 'Q2202-3563', 'Q', '9077709', 'JOSE LUIS ROSALES BECERRA', '00', 'M', '70', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898241', '69000', 'Doctor HERNAN CALDERON MORON', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Testículo izquierdo" se recibe un testículo con sus membranas de recubrimiento mide 5 x 3 x 2.5 cms. en sus mayores dimensiones, al abrir la túnica vaginal expulsa un líquido cetrino. Al corte conserva la morfología habitual. Se toman cortes así: A testículo y epidídimo.\r\nEn el mismo recipiente, se recibe además, una estructura de aspecto membranoso que mide 13 x 8 cms. con una cara cruenta y una lisa recubierta por una membrana lisa y brillante. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran testículo que conserva su morfología habitual.\r\nLos cortes rotulados B muestran una pared fibrosa tapizada en una de sus caras por un mesotelio.\r\n\r\n\r\n\r\n', '1.TESTÍCULO IZQUIERDO\r\n\r\n2.SACO HERNIARIO, región escrotal izquierda\r\n\r\n', '', ''),
	(2091, 'Q2202-3564', 'Q', '22785378', 'JULIA MARRUGO PITALUA', '000', 'F', '35', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quíste de ovario izquierdo" se recibe una estructura quística de forma ligeramente esférica que mide 5 cms. de diámetro, trae adherido un segmento de trompas de Falopio de 3.5 cms. de longitud. Al corte se encuentra una pared muy delgada transparente y un contenido delgado muy seroso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística compuesta por una pared fibrosa tapizada internamente por un epitelio cilíndrico de tipo seroso. Otros cortes muestran trompas de Falopio sin alteraciones.\r\n\r\n\r\n\r\n', ' Resección de quiste de ovario izquierdo:\r\n-CISTADENOMA SEROSO\r\n-TROMPA DE FALOPIO (SEGMENTO)\r\n\r\n', '', ''),
	(2092, 'Q2202-3565', 'Q', '1103106751', 'LEONARDO FABIO PEREZ SUAREZ', '000', 'M', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 1.7 cms. La superficie externa esta cubierta pro una serosa despulida de color pardo claro. Al corte se encuentra una luz marcadamente dilatada que contiene material fecal petrificado. Las paredes son delgadas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2093, 'Q2202-3566', 'Q', '30838356', 'YESENIA CARREAZO YEPEZ', '3116312926', 'F', '40', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2094, 'Q2202-3567', 'Q', '64522834', 'MARINELLA JULIO GUERRERO', '000', 'F', '44', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de piel de forma irregular de color pardo claro que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuyo epitelio muestra acantosis irregular, hiperqueratosis y atípias coilocíticas en el estrato superficial.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vulva:\r\n-CONDILOMA ACUMINADO', '', ''),
	(2095, 'Q2202-3568', 'Q', '1020448394', 'ERLID HERNANDEZ JIMENEZ', '0..', 'M', '29', 'PARTICULAR', '', '', '', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2096, 'Q2202-3569', 'Q', '13001a1293', 'ANTHONELLA NOHEMI RAMIREZ CALMA', '3246648879', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Pólipo" se recibe una masa de tejido de forma esférica que mide 2 cms. de diámetro, la superficie externa es ligeramente irregular, la consistencia es elástica y al corte presenta una superficie de color pardo oscuro con áreas de color pardo claro y pequeñas cavidades. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por glándulas colónicas de diferentes formas y tamaños, algunas quísticas, que reposan en una lámina propia edematosa y congestiva.\r\n\r\n\r\n\r\n', ' Resección de masa en recto:\r\n-PÓLIPO DE RETENCIÓN (JUVENIL)\r\n\r\n', '', ''),
	(2097, 'Q2202-3570', 'Q', '909448', 'CARLOS EDUARDO TORRES ZABALA', '3126700042', 'M', '81', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2098, 'Q2202-3571', 'Q', '1042585034', 'LIZET CATERINE JIMENEZ ROSERO', '3045781996', 'F', '30', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran un fragmento de mucosa gástrica antral y uno de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2099, 'Q2202-3572', 'Q', '1048440973', 'KAROLAY DAYANIS ALEAN ESPINOSA', '3126440269', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-07', '2022-02-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya lámina propia está edematosa, congestiva y densamente infiltrada por linfocitos y células plasmáticas, que en algunas áreas forman acúmulos linfoides. Las glándulas conservan su morfología habitual. No se identifican H.pylori ni actividad inflamatoria.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, SEVERA\r\n', '', ''),
	(2100, 'Q2202-3573', 'Q', '73094760', 'RUBEN DARIO ROMERO CASTAÑEDA', '3173781174', 'M', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-14', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos, plasmocitos y neutrófilos en poca cantidad en la lámina propia. No se encuentra H. pylori, ni cambios atróficos, metaplásicos ni displásicos. \r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE FOCAL\r\n\r\n', '', ''),
	(2101, 'Q2202-3574', 'Q', '1143402054', 'ALBERTH HERNANDO VEGA PETRO', '3007835413', 'M', '24', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2102, 'Q2202-3575', 'Q', '1201223417', 'SARA SOFIA PEREZ NARVAEZ', '3165549067', 'F', '11', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-02-14', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan C.\r\n4. Rotulado "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan D.', 'Los cortes A revelan mucosa gástrica cuya lámina propia es edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B revelan mucosa corporal cuya lámina propia está edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente.  \r\nLos cortes C revelan bulbo duodenal con inflamación crónica moderada.\r\nLos cortes D revelan duodeno cuya lámina propia está infiltrada por linfocitos y plasmocitos. No se observan parásitos intestinales.\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n3.Biopsia endoscópica de bulbo:\r\n-BULBO DUODENAL CON INFLAMACIÓN CRÓNICA\r\n4.Biopsia endoscópica de segunda porción del duodeno:\r\n-MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA SEVERA', '', ''),
	(2103, 'Q2202-3576', 'Q', '1044928204', 'LEONARDO ALVAREZ CONSUEGRA', '322653247', 'M', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2022-02-14', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ángulo esplénico de colon" segmento de colon que mide 4 x 3.5 cms. tapizado por una serosa de color pardo claro en una de sus caras presenta una solución de continuidad que compromete el espesor de la pared de bordes irregulares que mide 2 x 2 cms. Al corte la mucosa es edematosa. Se toman cortes y se rotulan A.\r\n2. "Yeyuno" segmento de yeyuno que mide 13 x 13 cms. en una de sus caras muestra un área de perforación de 1 cm. Se observa además, un área de 1 cm. de una contusión hemorrágica. Se toman cortes y se rotulan B.\r\n3. "Apéndice" un apéndice cecal que mide 10 cms. la serosa es de color pardo claro y muestra la estructura usual. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes A revelan pared colónica con edema, inflamación aguda y áreas de necrosis.\r\nLos cortes B revelan yeyuno con áreas de hemorrágia, inflamación y focos de necrosis.\r\nLos cortes C revelan apéndice cecal que muestra un infiltrado inflamatorio agudo en la serosa.\r\n\r\n\r\n\r\n', '1.Segmento de colon de 4 cms. con.\r\n-INFLAMACIÓN AGUDA, HEMORRÁGIA Y NECROSIS POR PERFORACIÓN TRAUMÁTICA\r\n2.Segmento de yeyuno con:\r\n-INFLAMACIÓN AGUDA Y NECROSIS POR PERFORACIÓN TRAUMÁTICA\r\n3.PERIAPENDICITIS', '', ''),
	(2104, 'Q2202-3577', 'Q', '1201215771', 'FRANKLIN ANTONIO AGRESOTH CANO', 'centro', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice" un apéndice cecal que mide 7 cms. la serosa es opaca y despulida. Al corte la luz se encuentra dilatada y contiene un material fecal. Se toman cortes y se rotulan A.\r\n2. "Ganglio periapendicular" formación nodular de 0.8 x 0.5 cms. Al corte una superficie grisácea. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes A revelan apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nLos cortes B revelan ganglio linfático con hiperplasia sinusoide.\r\n\r\n\r\n\r\n', '1.APENDICITIS AGUDA\r\n2.GANGLIO LINFÁTICO PERIAPENDICULAR CON HIPERPLASIA SINUSOIDAL\r\n\r\n', '', ''),
	(2105, 'Q2202-3578', 'Q', '1048463127', 'GABRIEL EDUARDO BUELVAS BRAVO', '3015279982', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda el mayor mide 1.3 cms.y el menor de 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2106, 'Q2202-3579', 'Q', '1048465375', 'JEHILYN SOFIA CABARCAS LLERENA', '3004252649', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una masa de tejido de forma ovoidea que mide 2 x 1.5 cms. Al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una masa de tejido de forma ovoidea que mide 2.3 x 1.9 cms. Al corte una superficie blanquecina, multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(2107, 'Q2202-3580', 'Q', '1052982699', 'ADRIANA MARGARITA QUINTERO MENCO', '3217202163', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-03-10', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice" un apéndice cecal que mide 9 cms. la serosa es grisácea y levemente congestiva. Al corte la luz es permeable. Se toman cortes y se rotulan A.\r\n2. "Cuerpo extraño en vía digestiva" formación alargada de color pardo claro, amarillento y consistencia firme, pétrea mide 6 x 3 x 2.5 cms. Se toman cortes y se pone a descalcificar, se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\nLos cortes B muestran una estructura de 6 x 3 x 2.5 cms. \r\n\r\nOBSERVACIONES: No es posible determinar el carácter químico de esta estructura.\r\n\r\n', '1.Apendice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n2.VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2108, 'Q2202-3581', 'Q', '1041990686', 'MATEO DAVID PUELLO GOMEZ', '3234338764', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 cms. la serosa es gris, opaca y despulida. Al corte la luz ocupada pro material blanquecino. Se toman cortes.\r\nNOTA: No se recibe omento.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2109, 'Q2202-3582', 'Q', '1137542289', 'DANNA SOPHIA MARTINEZ PIRELA', '3014525762', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-02-15', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Dermatitis" se recibe un punch de piel que mide 0.4 x 0.4 x 0.5 cms. de color blanquecino. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Piel tapizada pro epitelio escamoso que muestra acantosis irregular, hiperqueratosis, paraqueratosis con formación de costra y focos de hipogranulosis. El dermis papilar muestra infiltración de neutrófilos con exocitosis de estos al epitelio escamoso absceso de Munro.\r\n\r\n\r\nNOTA: El cuadro histológico es sugestivo de una psoriasis vulgar, se recomienda correlacionar con la clínica.\r\n\r\n\r\n', ' Biopsia de piel pierna derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2110, 'Q2202-3583', 'Q', '1104382301', 'JUAN DURAN HENRIQUEZ', '3203200914', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Riñón derecho" se recibe un riñón que mide 8 x 7 x 5 x 3 cms. multilobular de color pardo claro con ausencia de polo inferior del riñón en la cual se observa un área cruenta al corte la relación corticomedular está conservada, hay áreas de hemorrágia en su parénquima y se observa la ligadura de los vasos renales. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan riñón que muestra áreas extensas de hemorrágia, focos de necrosis e inflamación aguda.\r\n\r\n\r\n\r\n', ' Riñón derecho con:\r\n-HEMORRAGIA, NECROSIS E INFLAMACIÓN AGUDA ANTECEDENTE DE LESIÓN TRAUMÁTICA\r\n\r\n', '', ''),
	(2111, 'Q2202-3584', 'Q', '1043974640', 'SARA MARCELA ESCORCIA CONTRERAS', '6698830', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-02-15', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Piel región perianal" se recibe varios fragmentos de tejido de color pardo claro de consistencia blanda que promedian 0.5 cms. Se toma muestra representativa.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral neural constituida por una proliferación de células elongadas entremezcladas con haces finas de colágeno, dispuestos en nódulos rodeados de fascículos nerviosos.\r\n\r\n\r\n', ' Extirpación de lesión en región perianal:\r\n-NEUROFIBROMA PLEXIFORME\r\n\r\n', '', '');
INSERT INTO `informe` (`id`, `informe_cod`, `t_informe`, `numdoc`, `paciente`, `telefono`, `sexo`, `edad`, `entidad`, `eps`, `cups`, `valor`, `medRemitente`, `fec_muestra`, `fec_inf`, `fec_ingreso`, `patologo`, `macro`, `micro`, `diagnostico`, `inmuno`, `observaciones`) VALUES
	(2112, 'Q2202-3585', 'Q', '1062077916', 'JESSICA LORENA PITO VARGAS', '3004210303', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-02-15', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Psoriasis" se recibe un punch de piel de 0.3 cms. de color blanquecino. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso que muestra un patrón psoriasiforme con elongación de las redes de cresta, edema papilar, hiperqueratosis con focos de hipogranulosis y la presencia de pústula espongiforme de Kogoj. El dermis infiltrado predominantemente por neutrófilos con exocitosis de estos.\r\n\r\n\r\n\r\n', '  Biopsia de piel región pabellón auricular derecha:\r\n-PSORIASIS VULGAR\r\n\r\n\r\n\r\n', '', ''),
	(2113, 'Q2202-3586', 'Q', '1127620745', 'SOLANGEL VILMAR PEREZ MADRID', '3118488630', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-02-15', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nevo" se  recibe una formación nodular tapizada en su totalidad por piel de color pardo oscuro que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se observa una lesión tumoral benigna constituida pro una proliferación de células nevicas dispuestas en pequeños nidos rodeados de un tejido colagenizado que hacia la parte más profunda las células nevicas toman características neurales (neurotización).\r\n\r\n\r\n\r\n\r\n', ' Extirpación de lesión en piel rodilla derecha:\r\n-NEVUS INTRADÉRMICO', '', ''),
	(2114, 'Q2202-3587', 'Q', '1143342325', 'MANUEL FERNANDO RODRIGUEZ GUZMAN', '3813542', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-02-15', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste epidérmico - quíste triquilemal" se recibe una lesión de piel de color oscuro que mide 1.5 x 1 cms. en su centro presenta un área sobreelevada de 0.6 cms. Al corte una formación nodular de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel tapizada por epitelio escamoso, en el dermis se observa lesión tumoral constituida por una proliferación de células fusiformes, dispuestas en un patrón entrecruzado, se identifican algunas células gigantes a cuerpo extraño y células de touton.\r\n\r\n\r\n \r\n', '-DERMATOFIBROMA, antebrazo izquierdo\r\n\r\n\r\n', '', ''),
	(2115, 'Q2202-3588', 'Q', '1043972080', 'YULIBETH SOFIA PRINS ANAYA', '3016056007', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(2116, 'Q2202-3589', 'Q', '1050954927', 'ANDRES FELIPE GARCIA YEPES', '3146203747', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Piel de espalda" se recibe un punch de piel de forma redondeada de color pardo oscuro que mide 0.4 x 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso, en el dermis se observa lesión tumoral constituida pro una proliferación de células nevicas dispuestas en nidos y cordones.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en piel de espalda:\r\n-NEVUS NEVO CELULAR INTRADÉRMICO\r\n\r\n', '', ''),
	(2117, 'Q2202-3590', 'Q', '1143337582', 'DAWIN COGOLLO BARROSO', '3114059004', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-02-14', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nevo epidérmico" se reciben diminutos fragmentos de tejido de color pardo oscuro que juntos promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Epitelio escamoso con hiperqueratosis, acantosis que descansan en un tejido fibrovascular.\r\n\r\n\r\n\r\n', '-VERRUGA VULGAR, región clavicular izquierda, (FragmentoS)\r\n', '', ''),
	(2118, 'Q2202-3591', 'Q', '1043326915', 'JEHSUAT DAVID SALINAS PADILLA', '3053906142', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-02-11', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una masa de tejido de forma ovoidea que mide 1.5 x 1 cms. de color gris. Al corte una superficie de color rosado, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una masa de tejido de forma ovoidea que mide 1.5 x 1.7 cms. de color gris. Al corte una superficie de color rosado, multinodular. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2119, 'Q2202-3592', 'Q', '45547364', 'YULI ZARATE URZOLA', '3014094396', 'F', '39', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-02-14', '2022-02-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de exocervix" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda el mayor mide 1 cm. y el menor de 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Cérvix en la que se observa una neoplasia intraepitelial escamosa de bajo grado.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-LIE DE BAJO GRADO (NIC 1)\r\n\r\n', '', ''),
	(2120, 'L2202-135', 'L', '37558510', 'MAYERLIS ALVAREZ QUINTERO', '3014905383', 'F', '41', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-09', '2022-02-08', 'VIRNA CARABALLO OSORIO', 'Rotulado "ACAF de seno derecho" se reciben 10 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' ACAF de seno derecho:\r\n-EXTENDIDOS ACELULARES', '', ''),
	(2121, 'Q2202-3593', 'Q', '1065601215', 'JAZMINE PADILLA ACOSTA', '3178441444', 'F', '33', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de exocervix" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Biopsia de vulva" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de cuello uterino con una reacción inflamatoria crónica y cambios citopáticos por VPH.\r\nLos cortes rotulados B muestran una lesión benigna compuesta por una proliferación de células escamosas que se disponen en un patrón papilomatoso con cambios citopáticos por VPH.\r\n\r\n\r\n', '1.Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA Y LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n2.Biopsia de vulva:\r\n-CONDILOMA', '', ''),
	(2122, 'Q2202-3594', 'Q', '2577063', 'HERMELINDA MENDEZ SOTO', '3008041880', 'F', '75', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n\r\n', '', ''),
	(2123, 'Q2202-3595', 'Q', '33339590', 'ALBA BUELVAS MARTINEZ', '3126928612', 'F', '53', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Pólipo" se reciben dos fragmentos de tejido de forma alargada de color pardo claro y consistencia blanda que miden 1.2 x 0.7 y 1.5 x 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL\r\n\r\n\r\n', '', ''),
	(2124, 'Q2202-3596', 'Q', '33280272', 'RUTH DEL SOCORRO YEPES FONTALVO', '3117357168', 'F', '64', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', '', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Tumor benigno en espalda" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.8 x 0.8 x 0.8 cms. en sus mayores dimensiones, la superficie externa esta parcialmente cubierta por una elipse de piel que mide 1.7 x 0.7 cms. Al corte se observa una superficie homogénea de color pardo claro que rodea una lesión de aspecto quístico que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se observa una estructura quística tapizada por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en espalda:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(2125, 'Q2202-3597', 'Q', '1043308903', 'AVI ANTONIO LLERENA MENDOZA', '3005377580', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.5 x 1 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2126, 'Q2202-3598', 'Q', '1045668498', 'SARA JHIRE DANIEL BERRIO', '3205055264', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.7 x 0.8 cms., la superficie externa está cubierta por una serosa despulida. Al corte la pared está adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2127, 'Q2202-3599', 'Q', '52283008', 'MARIA ANDREA PINTO GOMEZ', '3183489847', 'F', '47', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2128, 'Q2202-3600', 'Q', '1047502096', 'ARNOLD STEVEN DE LA ROSA MACHADO', '3017005608', 'M', '23', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica con edema, congestión e inflamación crónica de la lámina propia. No se observan H.pylori, actividad inflamatoria ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(2129, 'Q2202-3601', 'Q', '1001035529', 'ANA MARIA SALAS BEITAR', '000', 'F', '21', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.8 x 0.8 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2130, 'Q2202-3602', 'Q', '1036682310', 'FRANKLIN MANOTAS MURILLO', '3217504117', 'M', '23', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica con edema, congestión e infiltración mononuclear de la lámina propia. No se observan H.pylori, actividad inflamatoria ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2131, 'Q2202-3603', 'Q', '45453927', 'MARTHA AREVALO TOVAR', '3157539227', 'F', '59', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa antro corporal que conserva la morfología habitual. La lámina propia está ligeramente edematosa, congestiva e infiltrada por linfocitos y células plasmáticas.\r\nNo se observan H.pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2132, 'Q2202-3604', 'Q', '45691354', 'CRISTINA SAMUDIO COVO', '3164492744', 'F', '43', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(2133, 'Q2202-3605', 'Q', '4322430', 'JOSE MANUEL ROBLEDO GOMEZ', '3205428238', 'M', '77', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2134, 'Q2202-3606', 'Q', '4969934', 'CARLOS ALBERTO BARRETO', '301734467', 'M', '85', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2135, 'Q2202-3607', 'Q', '1002196628', 'LUIS ANGEL FERRER CARVAJALINO', '000', 'M', '22', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2136, 'Q2202-3608', 'Q', '1047436417', 'ANDREA PAOLA CASTRO MUÑOZ', '000', 'F', '30', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Resección de producto de masa axilar izquierda" se reciben tres fragmentos de tejido de forma irregular, de color pardo amarillento, aspecto adiposo y consistencia elástica que juntos miden 6 x 4.8 x 3 cms. La superficie externa del mayor de los fragmentos está parcialmente cubierta por una elipse de piel que mide 4 x 2.5 cms. Al corte se observa una superficie untuosa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido mamario cuya morfología está alterada por la presencia de quistes de pequeño calibre que reposan en un estroma fibroescleroso. No se observan cambios proliferativos.\r\n\r\n\r\n\r\n', ' Resección de masa en axila izquierda:\r\n-TEJIDO MAMARIO CON CAMBIOS DE CONDICIÓN FIBROQUÍSTICA\r\n\r\n', '', ''),
	(2137, 'Q2202-3609', 'Q', '9151140', 'RAMON TORRES MIRANDA', '000', 'M', '67', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de resección de masa en hombro derecho" se reciben múltiples fragmentos de tejido de forma irregular de color pardo amarillento y aspecto adiposo que juntos miden 3 x 3 x 1.1 cms. Al corte se observa una superficie untuosa de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de un tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n ', ' Resección de masa en hombro derecho:\r\n-LIPOMA (FRAGMENTOS)\r\n\r\n\r\n\r\n', '', ''),
	(2138, 'Q2202-3610', 'Q', '1001902105', 'DARCY ALEJANDRA ROMERO RAMOS', '000', 'F', '25', 'CLIN. SAN JOSE DE TORICES SAS', '', '898241', '69000', 'Doctor JOSE RODRIGUEZ', NULL, '2022-02-16', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Segmento de tráquea" se reciben dos segmentos de tráquea que miden 3.2 x 2.1 x 1.2 y 2 x 1.5 x 1.5 cms. de color pardo rosado y consistencia elástica. Al corte se observa una superficie de color pardo claro que rodea un área de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tráquea con una reacción inflamatoria crónica mediada por linfocitos con áreas extensas de fibrosis. Otros cortes muestran un área tapizada por un tejido de granulación densamente infiltrado por PMN neutrófilos.\r\nNo se observan cambios displásicos.\r\n\r\n\r\n', ' Reconstrucción de tráquea vía abierta:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2139, 'Q2202-3611', 'Q', '33204857', 'CARMEN ALICIA MORALES VIVERO', '000', 'F', '52', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor LUIS ALCAZAR', NULL, '2022-02-16', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Bazo" se recibe el producto de una esplenectomía que pesa 82 gms. y mide 10.2 x 5 x 2.5 cms. La superficie externa esta cubierta por una fina cápsula con dos soluciones de continuidad. Al corte se observa una superficie de color violáceo y aspecto hepático, se observa una lesión mal delimitada ligeramente más oscura que el parénquima circundante que mide 2.5 x 2 cms. en ella se observan pequeñas estructuras de aspecto quístico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión benigna mal delimitada compuesta por la proliferación de espacios vasculares de diferentes formas y tamaños, algunos quísticos, con contenido de sangre.\r\n\r\n\r\n\r\n', ' Esplenectomía (82 gms.):\r\n-HEMANGIOMA CAVERNOSO\r\n\r\n', '', ''),
	(2140, 'Q2202-3612', 'Q', '45511144', 'NANCY MENDIVIL ORTIZ', '3014462426', 'F', '48', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-02-16', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Útero" un cuerpo uterino que pesa 1009 gms. y mide 14.5 x 11.5 x 9.5 cms. Al corte la cavidad endometrial está tapizada pro una mucosa gruesa de color rosado, el miometrio está ocupado por una gran masa de color rosado con áreas de color amarillento y mide 10.5 x 8 x 8 cms. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" un segmento de trompa de Falopio que incluyen las fimbrias que mide 3 x 1.3 cms. en la parte distal se observan dos estructuras de aspecto quístico que miden 1.2 y 0.8 cms. Se toman cortes y se rotulan B.\r\n3. "Trompa izquierda" un segmento de trompa de Falopio que incluyen las fimbrias, de aspecto quístico mide 1.5 x 1 cms. Al corte hay salida de un líquido claro dejando una cavidad de paredes delgadas. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran endometrio autólisado. La masa miometrial descrita está compuesta por fibras musculares lisas distribuidas irregularmente.\r\nLos cortes rotulados B muestran trompa de Falopio que conserva la estructura usual y dos estructuras quísticas tapizadas por un epitelio cilíndrico ciliado.\r\nLos cortes rotulados C muestran trompa de Falopio tapizada por un epitelio aplanado con escasos pliegues que se proyectan hacia la luz y reposa sobre una pared fibrosa.\r\n\r\n ', ' Histerectomía abdominal subtotal con salpingectomía bilateral:\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMA INTRAMURAL\r\n-HIDÁTIDES DE MORGAGNI, trompa derecha\r\n-HIDROSALPINX, trompa izquierda\r\n', '', ''),
	(2141, 'Q2202-3613', 'Q', '22845996', 'ELENIA ARTETA SALAS', '000', 'F', '62', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctora ONEYS LOPEZ FLOREZ', NULL, '2022-02-11', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero y anexos" se recibe un útero con sus anexos que pesa 79 gms. y mide 7.5 x 4 x 3.5 cms. El cérvix está tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo conserva el cuerpo y el tamaño habitual, la trompa de Falopio derecha mide 7 cms. y la izquierda 8.1 cms. El ovario derecho mide 2.7 cms. y el izquierdo 2.8 cms. Al corte el canal endocervical es permeable, la cavidad endometrial está ocupada por una masa de aspecto polipoide de color pardo claro y consistencia elástica que mide 3 x 1.2 cms. El miometrio está ocupado por una masa de color pardo claro de aspecto arremolinado mide 1.5 cms. de localización submucosa y al corte de las trompas conservan la morfología habitual y los ovarios son sólidos. Se toman cortes.\r\n\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio está autólisado. La masa descrita en la cavidad endometrial está compuesta por glándulas quísticas tapizadas por un epitelio aplanado que reposan en un estroma fibroso. La masa miometrial descrita está compuesta por fibras musculares lisas distribuidas irregularmente. Las trompas y los ovarios conservan la morfología habitual.\r\n\r\n\r\n', ' Histerectomía abdominal total con salpingooforectomía bilateral por laparoscopia:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-PÓLIPO ENDOMETRIAL ATRÓFICO\r\n-LEIOMIOMA SUBMUCOSO\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS', '', ''),
	(2142, 'Q2202-3614', 'Q', '825926', 'LUIS ALFREDO PARODY BERMUDEZ', '000', 'M', '92', 'PARTICULAR', '', '898201', '30215', 'Doctora MANUELA BERROCAL', NULL, '2022-02-14', '2022-02-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Pectoral derecho" un fragmento de piel de forma irregular, de color pardo claro y consistencia elástica que mide 3.5 x 2.2 cms. en la superficie externa se observa una lesión hiperpigmentada y mal delimitada que mide 0.8 x 1.6 cms. en sus mayores dimensiones. Se toman cortes de la lesión y se rotulan A, B líneas de resección.\r\n2. "Pectoral izquierdo" un fragmento elíptico de piel de color pardo claro y consistencia elástica que mide 2.5 x 1.2 cms. La superficie externa se observa una lesión mal delimitada de aspecto puntiforme. Se toman cortes y se rotulan así: C lesión, D líneas de resección.\r\n3. "Lesión mentón lado izquierdo" un fragmento discoide de piel de color pardo claro y consistencia elástica que mide 2.1 x 1.7 cms. La superficie externa se observa una lesión irregular ligeramente sobreelevada y mal delimitada que mide 1.2 x 1.2 cms. Se toman cortes y se rotula E.\r\n4. "Pómulo izquierdo" un fragmento triangular de piel que mide 1.3 cms. de altura y 0.8 cms. de base se destaca una zona ligeramente sobreelevada mal delimitada que mide 0.5 cms. Se toman cortes seriados que incluyen las líneas de resección, se rotulan F.\r\n5. "Mejilla derecha" un fragmento discoide de piel de color pardo claro y consistencia elástica que mide 2.4 x 2 cms. La superficie externa se observa una zona deprimida de aspecto ulcerado mal delimitada que mide 1.5 x 1 cms. en sus mayores dimensiones. Se marcan los bordes y se toman cortes de la lesión, se rotulan G.\r\n6. "Mandíbula derecha" un fragmento irregular de piel de color pardo claro y consistencia elástica que mide 4.5 x 1 cms. La superficie externa es irregular y muestra lesiones ligeramente hiperpigmentadas y sobreelevadas que miden 0.5 x 0.3 y 0.3 x 0.2 cms. se marcan los bordes y se toman cortes de los bordes incluyendo las líneas de resección, se rotulan H.\r\n7. "Malar derecha" un fragmento de piel de forma irregular de color pardo claro consistencia elástica que mide 1.8 x 1.1 cms. La superficie externa muestra una lesión sobreelevada e hipopigmentada que mide 0.6 cms. de diámetro. Se toman cortes que incluye las líneas de resección, se rotulan I.\r\n8. "Fronto parietal derecha" un fragmento discoide de tejido que mide 2.3 x 2 cms. de color pardo claro y consistencia elástica, la superficie externa se observa una lesión mal delimitada e hipopigmentada que respeta macroscópicamente las líneas de resección y mide 0.9 x 0.7 cms. Se toman cortes y se rotulan J.\r\n9. "Frontal izquierdo" elipse de piel de color pardo claro y consistencia elástica que mide 2 x 0.8 cms. La superficie externa muestra una lesión mal delimitada con áreas hiperpigmentadas e hipopigmentada macroscópicamente mide 0.6 cms. de diámetro. Se toman cortes que incluyen las líneas de resección, se rotulan K.\r\n10. "Cuero cabelludo región central" elipse de piel que mide 2.9 x 1.5 cms. La superficie externa es de aspecto ulcerado y está parcialmente cubierta por una costra que mide 1.5 cms. Se toman cortes seriados que incluyen las líneas de resección, se rotulan L.\r\n', 'Los cortes rotulados "pectoral derecho" y "pectoral izquierdo" muestran piel con tumores epiteliales superficiales, compuestos pro células pequeñas, basaloides, que se disponen en nidos sólidos con empalizada periférica que infiltran la dermis superior. Las líneas de resección están libres de tumor. Los cortes rotulados "mentón lado izquierdo", muestran piel con un tumor similar al descrito, que infiltran más profundamente y está focalmente ulcerado. Las líneas de resección están libres de tumor. "Pómulo izquierdo": muestra piel cuya epidermis está engrosada a expensas de una proliferación de células basaloides que rodean espacios que contienen queratina. No se encuentra tumor. "Mejilla derecha": piel con un tumor similar al descrito con foco de ulceración. Las líneas de resección están libres de tumor. "Región mandibular derecha": tumor epitelial similar al descrito. Las líneas de resección están libres de tumor. "Región malar derecha": piel en la que se identifican dos tumores, uno compuesto por células basales y el otro por células escamosas pleomórficas que infiltran la dermis. Las líneas de resección están libres de tumor. "Región fronto-parietal derecha y región frontal izquierda": muestran piel con tumores de células basales similares a los descritos. Las líneas de resección están libres de tumor. "Cuero cabelludo": piel cuya epidermis presenta hiperqueratosis, acantosis irregular y atípias nucleares moderas. Hay cambios de elastosis del dermis papilar. Las líneas de resección están libres de lesión.', '1. Resección de lesión en piel de pectoral derecho:\r\n-CARCINOMA BASOCELULAR\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n2. Resección de lesión en piel de pectoral izquierdo:\r\n-CARCINOMA BASOCELULAR\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n3. Resección de lesión en piel de mentón lado izquierdo:\r\n-CARCINOMA BASOCELULAR, ULCERADO\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n4. Resección de lesión en piel de pómulo izquierdo:\r\n-QUERATOSIS SEBORREICA\r\n5. Resección de lesión en piel de mejilla derecha:\r\n-CARCINOMA BASOCELULAR, ULCERADO\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n6. Resección de lesión en piel de región mandibular derecha:\r\n-CARCINOMA BASOCELULAR, ULCERADO\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n7. Resección de lesión en piel de región malar derecha:\r\n-CARCINOMA BASOCELULAR\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO, INFILTRANTE\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n8. Resección de lesión en piel de región fronto-parietal derecha:\r\n-CARCINOMA BASOCELULAR\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n9. Resección de lesión en piel de región frontal izquierda:\r\n-CARCINOMA BASOCELULAR\r\n-LÍNEAS DE RESECCIÓN LIBRES DE TUMOR\r\n10. Resección de lesión en cuero cabelludo:\r\n-QUERATOSIS SOLAR (ACTÍNICA)\r\n-MÁRGENES DE RESECCIÓN LIBRES DE LESIÓN', '', ''),
	(2143, 'Q2202-3615', 'Q', '1101815464', 'LILIBETH MENDOZA NARVAEZ', '00', 'F', '31', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-03-07', '2022-02-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Miomectomía-miomas" en un mismo recipiente, se recibe un cuello uterino que mide 3 x 1.5 x 1.5 cms. tapizado por una mucosa blanquecina con orificio alargado de forma transversal. Al corte el canal endocervical es permeable. Se toman cortes y se rotulan A.\r\nSe reciben, además, dos masas de tejido de forma irregular que miden 4 x 3 x 2 y 3 x 3 x 2.5 cms. respectivamente de consistencia elástica, multinodular y aspecto arremolinado. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan cuello uterino tapizado por epitelio escamoso, el estroma con un infiltrado inflamatorio crónico.\r\nLos cortes B revelan tumores benignos mesenquimales compuestos por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n', '1.Cuello uterino:\r\n-CERVICITIS CRÓNICA\r\n2.Miomectomía:\r\n-LEIOMIOMAS\r\n\r\n\r\nNOTA: Se hicieron nuevos cortes de todo el material remitido y fueron revisados en junta de patólogos en la que se ratifica todo lo consignado en el informe anterior.\r\n\r\n', '', ''),
	(2144, 'Q2202-3616', 'Q', '1143343433', 'LEIDY DIAZ HERNANDEZ', '000', 'F', '32', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-02-15', '2022-02-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe formación nodular de color pardo grisáceo y consistencia elástica que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan epitelio escamoso hiperplásico con hiperqueratosis, hipergranulosis rodeado por un núcleo de tejido fibroconectivo. No se observan coilocitos.\r\n\r\n\r\n\r\n', ' Resección de lesión en vulva:\r\n-PAPILOMA ESCAMOSO\r\n\r\n', '', ''),
	(2145, 'Q2202-3617', 'Q', '73092463', 'MILCIADES BERNARDO OSORIO DIAZ', '3207521444', 'M', '61', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-14', '2022-02-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE', '', ''),
	(2146, 'Q2202-3618', 'Q', '33253988', 'SAMIRNA MIRANDA HERNENDEZ', '00', 'F', '47', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-02-15', '2022-02-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trucut de mama izquierda" un cilíndro de tejido de forma irregular de color pardo claro y consistencia blanda que miden 2 cms. Se toma todo y se rotulan A.\r\n2. "Trucut mama izquierda" diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Trucut mama derecha" tres cilíndros de tejido de forma irregular de color pardo claro y consistencia blanda que miden 1.5 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B revelan tejido mamario, en algunos canalículos se observa hiperplasia ductal moderada sin atípias.\r\nLos cortes C revelan tejido mamario que conserva su morfología usual.\r\n\r\n\r\n\r\n', '1.Trucut de mama izquierda:\r\n-HIPERPLASIA DUCTAL MODERADA SIN ATÍPIAS\r\n2.Trucut de mama derecha:\r\n-TEJIDO MAMARIO\r\n\r\n', '', ''),
	(2147, 'Q2202-3619', 'Q', '45436100', 'SANDRA DIAZ CUETER', '3005542368', 'F', '60', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-14', '2022-02-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear leve, actividad leve focal. No se identifica H.pylori, atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE FOCAL', '', ''),
	(2148, 'Q2202-3620', 'Q', '1041982708', 'JOSE CAMILO CARVAJAL ANZOATEGUI', '3005336053', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-02-14', '2022-02-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice + epiplón" se recibe un apéndice cecal que mide 10 x 1 cms. tapizada por una serosa opaca, de color pardo oscuro y trae adherido material fibrinopurulento se observa una solución de continuidad de 2 cms. Al corte salida de material fecaloideo. Se toman cortes.\r\nAcompañado a esto, fragmento de tejido adiposo que mide 4 x 2 cms. de color pardo claro bien vascularizado. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal cuya mucosa se encuentra ulcerada, la pared densamente infiltrada por abundantes PMN neutrófilos que se extienden hasta la grasa periapendicular.\r\nSe identifica tejido adiposo con inflamación aguda.\r\n\r\n\r\n', ' Apendicectomía:\r\n1.APENDICITIS AGUDA NECROTIZANTE\r\n2.TEJIDO ADIPOSO CON INFLAMACIÓN AGUDA\r\n', '', ''),
	(2149, 'Q2202-3621', 'Q', '1043304296', 'JORGE ISAAC GALVIS SOLIS', '3054512926', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-03-14', '2022-02-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia ósea de cresta iliaca izquierda" se reciben espículas óseas que miden 2 x 1 cms. de consistencia pétrea de color blanquecino. Se toman cortes y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes revelan hueso esponjoso infiltrado por linfocitos, plasmocitos PMN neutrófilos y espículas óseas necróticas.\r\n\r\n\r\n\r\n', ' Biopsia de cresta iliaca izquierda:\r\n-OSTEOMIELITIS CRÓNICA\r\n-(VER DESCRIPCIÓN MICROSCÓPICA)\r\n\r\n', '', ''),
	(2150, 'Q2202-3622', 'Q', '1201227009', 'KLEIDER MANUEL FLOREZ PARRA', '3126751912', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctora ANA MARIA OTOYA', NULL, '2022-02-14', '2022-02-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2.5 x 2 cms. de color blanquecino y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina que mide 2.5 x 2 cms. de color blanquecino y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan B.\r\n3. "Adenoides" varios fragmentos de tejido de color blanquecino y consistencia elástica que promedian un diámetro mayor de 1.5 cms. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2151, 'Q2202-3623', 'Q', '1201262118', 'KAILIN MARIEL PUELLO AHUMADA', '3122934947', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARCO ARAUJO OROZCO', NULL, '2022-02-14', '2022-02-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ganglión mano izquierda" dos fragmentos de tejido de color blanquecino que promedian un diámetro mayor de 0.8 cms. Se toma todo y se rotulan A.\r\n2. "Ganglión mano derecha" dos fragmentos de tejido de color blanquecino que promedian un diámetro mayor de 0.8 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan fragmentos de tejido fibroso denso con zonas de degeneración quística.\r\n\r\n\r\n\r\n', '1.GANGLIÓN MANO IZQUIERDA\r\n2..GANGLIÓN MANO DERECHA', '', ''),
	(2152, 'Q2202-3624', 'Q', '1138680736', 'ABIGAIL ARCIA ACOSTA', '3233803149', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-03-07', '2022-02-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Segmento ureteral derecho" varios fragmentos de forma cilíndrica de color blanquecino, el mayor mide 3 cms. Se toman cortes y se rotulan A.\r\n2. "Segmento distal ureteral derecha" segmento de uretel que mide 5 cms. en uno de sus extremos se observa dilatado midiendo su luz 1.3 cms. a 1 cm. del extremo dilatado el uretel mide 0.4 cms. y en su extremo distal la luz está más estrechada, mide 0.2 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan piel de intestino delgado con edema, congestión de la serosa y un infiltrado inflamatorio mixto moderado, hay focos de necrosis (boca de colostomía).\r\nLos cortes B revelan pared colónica con edema, congestión e inflamación aguda y crónica leve.\r\n\r\n\r\n\r\n', '1.Pared de intestino delegado (boca de colostomía) con:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA, CONGESTIÓN EDEMA Y FOCOS DE NECROSIS\r\n2.Segmento de colon con:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA LEVE, EDEMA Y CONGESTIÓN\r\n\r\n', '', ''),
	(2153, 'Q2202-3625', 'Q', '1050277333', 'CARLOS JOSE GONZALEZ NAVARRO', '000', 'M', '16', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', '', NULL, '2022-02-14', '2022-02-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo oscuro. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2154, 'Q2202-3626', 'Q', '33248912', 'INGRIS MARGARITA OROZCO LLAMAS', '3216463996', 'F', '43', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctora LAURISELL GUTIERREZ BLANCHAR', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Útero" un cuerpo uterino que pesa 1.201 gms. y mide 13 x 13 x 10 cms. La superficie externa está cubierta por una serosa lisa, brillante de color rosado. Al corte se encuentra una gran masa esférica de consistencia blanda y de color blanquecino que mide 10 x 9 x 9 cms. en sus mayores dimensiones. Está masa rechaza periféricamente la cavidad endometrial que está tapizada por una mucosa de color rosado.\r\n2. Separadamente, se recibe "Trompa derecha" un segmento de trompa de Falopio que mide 3 cms. de longitud. Se toman cortes y se rotulan A.\r\n3. Por separado "Trompa izquierda" un segmento de trompa de Falopio que mide 3 cms. de longitud. que contiene además, una estructura quística de 2.5 cms. de diámetro que al corte muestra unas paredes muy delgadas y un contenido de líquido claro. Se toman cortes y se rotulan B.\r\n\r\n', 'Los múltiples cortes muestran un endometrio autólisado. La masa descrita está compuesta por fibras musculares lisas dispuestas irregularmente. No se encuentran atípias ni focos de necrosis. Las trompas son morfológicamente normales. En la trompa izquierda se encuentra, además, una estructura quística de paredes delgadas tapizadas por un epitelio cilíndrico simple.\r\n\r\n\r\n ', '1.Cuerpo uterino (1.201 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMA\r\n2.TROMPA DE FALOPIO DERECHA (SEGMENTO)\r\n3.TROMPA DE FALOPIO IZQUIERDA (SEGMENTO)\r\n-HIDÁTIDE DE MORGAGNI\r\n', '', ''),
	(2155, 'Q2202-3627', 'Q', '73561430', 'DAVID CORONELL BOLIVAR', '3005250366', 'M', '51', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JUAN GUEVARA SERNA', NULL, '2022-03-31', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor epidural de columna dorsal" se reciben varios fragmentos de tejido de forma irregular de color pardo amarillento y consistencia elástica cuyos diámetros oscilan entre 1 y 3 cms. Al corte muestran una superficie de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una proliferación difusa de linfocitos grandes, atípicos que alternan con histiocitos. Hay además, proliferación de vasos ramificados. Hay escasa actividad mitótica.\r\nEl cuadro histológico es compatible con un LINFOMA DIFUSO DE CÉLULA GRANDE. Es imprescindible practicar estudios de inmunohistoquímica para confirmación diagnóstica y clasificación citogenética.\r\n\r\n\r\n', ' Resección de tumor epidural:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\nNOTA: Se retiran 3 bloques por la señora LUCI CASTRO CORONELL CC 1.051.887.016 (31/mzo de 2022)', '', ''),
	(2156, 'Q2202-3628', 'Q', '23191237', 'ROSA ESCORCIA IBARRA', '000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JOSE ACEVEDO', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero" se recibe un útero sin sus anexos que pesa 63 gms. y mide 8 x 4.5 x 3 cms. en sus mayores dimensiones. El cuello está cubierto por una mucosa irregular, color grisáceo y el cuerpo conserva su forma habitual. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizada por una mucosa delgada de color grisáceo y en el miometrio se encuentra un nódulo blanquecino de 1 cm. de diámetro. Se toman cortes. \r\n\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica. El endometrio es atrófico. El nódulo descrito está compuesto por fibras musculares lisas dispuestas irregularmente.\r\n\r\n\r\n\r\n', ' Útero (63 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO ATRÓFICO\r\n-LEIOMIOMA INTRAMURAL\r\n\r\n', '', ''),
	(2157, 'Q2202-3629', 'Q', 'VEN23859119', 'LUISA PAOLA IRIARTE CASTILLO', '3136366105', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar previamente abierta que mide 6 x 2.5 cms. en sus mayores dimensiones, la superficie externa está parcialmente cubierta por una serosa despulida de color pardo grisáceo. La mucosa es aterciopelada. En el mismo recipiente, se reciben dos cálculos de forma irregular de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2158, 'Q2202-3630', 'Q', '72179370', 'MANFRED DIAZ PUA', '3002996488', 'F', '50', 'PARTICULAR', '', '898201', '30215', 'Doctor JUAN HOYOS VALDELAMAR', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Colon sigmoides" se recibe un fragmento de tejido de forma irregular de color blanquecino y coincidencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está compuesto por tejido de granulación densamente infiltrado por linfocitos, células plasmáticas y neutrófilos. Hay necrosis superficial. No se encuentra tumor en la muestra.\r\n\r\n\r\n\r\n', ' Resección de lesión en zona de anastomosis colo-colónica:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n\r\n', '', ''),
	(2159, 'Q2202-3631', 'Q', '45475206', 'ALBA ROSA VALDEZ ESPINOSA', '000', 'F', '55', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-02-17', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia firme, que miden respectivamente 0.8, 1 y 1.5 cms. Al corte se encuentra una superficie de color pardo oscuro con áreas amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel por debajo de la cual se encuentra una reacción inflamatoria mediada por linfocitos, neutrófilos y abundantes histiocitos de citoplasma claro. No se encuentra evidencia de quíste.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en piel de mama izquierda:\r\n-INFLAMACIÓN CRÓNICA GRANULOMATOSA\r\n\r\n', '', ''),
	(2160, 'Q2202-3632', 'Q', '1201273333', 'MATHIAS JOSE PATERNINA MEDINA', '3002607841', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-25', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Ganglio cervical derecho" se recibe una masa de tejido de forma ovoide que mide 1.4 cms. en sus mayores dimensiones, la superficie externa es ligeramente irregular y al corte se encuentra una superficie homogénea de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada por la presencia de folículos aumentados de tamaño y acúmulos de histiocitos en el espacio interfolicular. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección de ganglio linfático cervical:\r\n-HIPERPLASIA REACTIVA DE TIPO MIXTO\r\n\r\n\r\nNOTA: Se retiran 4 bloques por el señor OSCAR CABRERA MIRANDA CC. 73.115.091 (mensajero HINFP)', '', ''),
	(2161, 'Q2202-3633', 'Q', '1041979138', 'ERNESTO DANIEL MARTINEZ ARNEDO', '3122329008', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 2 y 2 cms. en sus mayores dimensiones. Al corte uno de ellos se encuentra un orificio rodeado por una pared de aspecto muscular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya mucosa está preservada. Hay gran reacción inflamatoria aguda de la serosa y grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-PERIAPENDICITIS AGUDA\r\n\r\n', '', ''),
	(2162, 'Q2202-3634', 'Q', '1048661708', 'ANY CAROLINA CONTRERAS PACHECO', '3116707257', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RAFAEL VIVERO CONEO', NULL, '2022-02-28', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Odontoma complejo periapical" se reciben cuatro estructuras que recuerdan piezas dentarias y un tejido blando de color pardo grisáceo que mide 1 x 0.5 x 0.4 cms. Se toma este tejido.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por una membrana de tejido fibroso tapizada en una de sus caras por un epitelio cúbico simple. Hay, además, fragmentos sueltos de espículas óseas.\r\nEn el estudio histológico no se identifican tejidos dentales salvo el epitelio descrito, que pudiera corresponder a epitelio odontogénico. Los hallazgos descritos, más la presencia de los dentículos, son compatibles con un ODONTOMA COMPUESTO. Se sugiere correlacionar con los hallazgos radiológicos.\r\n\r\n', ' Resección de lesión periapical de incisivo superior:\r\n-VER DESCRIPCIÓN MACRO Y MICROSCÓPICA\r\n\r\n', '', ''),
	(2163, 'Q2202-3635', 'Q', '1043647896', 'ESNEDI CAMILA CARDENAS BURITICA', '3016184952', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de aspecto membranoso de color blanquecino y consistencia friable que mide 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran fragmentos de mucosa duodenal sin alteraciones morfológicas.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL SIN ALTERACIONES\r\n', '', ''),
	(2164, 'Q2202-3636', 'Q', '1044921969', 'LEONEL MESSI MARTINEZ ARROYO', '3005582577', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor retroauricular derecho" se recibe una masa de tejido de forma ovoide que mide 2.5 cms. en su mayor dimensión. La superficie es lisa, la consistencia es renitente y al corte se encuentra una cavidad que contiene un material grumoso de color pardo amarillento, rodeado por unas paredes muy delgadas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una cavidad quística tapizada pro epitelio escamoso y con contenido de queratina laminar. En la pared se encuentran unidades pilosebaceas.\r\n\r\n\r\n\r\n', ' Resección de masa retroauricular derecha:\r\n-QUÍSTE DERMOIDE\r\n\r\n\r\n', '', ''),
	(2165, 'Q2202-3637', 'Q', '1042592628', 'SHERLANDY SOFIA CUADRO PARRA', '3002206370', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RAFAEL VIVERO CONEO', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Mucocele labial" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.2 cms. en su mayor dimensión. Al corte se encuentra una cavidad que contiene un material de aspecto mucoide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran epitelio escamoso que reposa en un corion que contiene glándulas salivares menores de tipo mixto. Hay, además, una cavidad en cuya periferia se encuentran abundantes macrófagos, linfocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Resección de lesión en labio inferior:\r\n-MUCOCELE\r\n\r\n', '', ''),
	(2166, 'Q2202-3638', 'Q', '1142917675', 'MARIO DAVID QUIROZ PARRA', '3007800934', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1.2 cms., la superficie externa está cubierta por una serosa despulida de color pardo oscuro y al corte la pared esta adelgazada y la luz ligeramente dilatada que contiene un material de color rojizo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared.\r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2167, 'Q2202-3639', 'Q', '1128062367', 'SEBASTIAN DE JESUS MUÑOZ FRANCO', '3235185130', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de tejido de úlcera inguinal izquierda" se reciben tres fragmentos de tejido de forma irregular de color pardo oscuro y consistencia elástica cuyos diámetros oscilan entre 0.6 y 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel debajo de la cual se observa una reacción inflamatoria crónica mediada por linfocitos, células plasmáticas y macrófagos. Estos últimos se disponen en grupos formando granulomas celulares.\r\n\r\n\r\nCOMENTARIO: Los hallazgos descritos son compatibles con un GRANULOMA INGUINAL. Se debe confirmar el diagnóstico con estudio bacteriológico.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en región inguinal izquierda:\r\n-INFLAMACIÓN CRÓNICA GRANULOMATOSA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica y comentario.\r\n'),
	(2168, 'L2202-136', 'L', '73560541', 'PEDRO CABALLERO ARELLANO', '00', 'M', '58', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-02-16', '2022-02-15', 'JOSÉ CARABALLO GRACIA', 'El 14 de febrero, Rotulado "Líquido peritoneal" se reciben 35 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', '', ' Citología de líquido peritoneal:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n\r\nNOTA: El líquido se recibió en el laboratorio 4 días después de la laparoscópia.\r\n\r\n', '', ''),
	(2169, 'Q2202-3640', 'Q', '1123631881', 'JUSELI VALDEZ PAJARO', '300', 'F', '27', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(2170, 'Q2202-3641', 'Q', '45463856', 'BERTINA MUÑOZ LEON', '3106500186', 'F', '59', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '2020205', '74106', 'Doctor ORLANDO BORRE ARRIETA', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipo" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular.\r\n\r\n\r\n\r\n', ' Legrado endocervical:\r\n-PÓLIPO ENDOCERVICAL (fragmentos)\r\n\r\n', '', ''),
	(2171, 'Q2202-3642', 'Q', '45469634', 'GUADALUPE PAJARO MEZA', '3154912272', 'F', '55', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2172, 'Q2202-3643', 'Q', '1142917426', 'CAMILO ANDRES CAMACHO BARRIOS', '3014285746', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-02-21', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Nevo verrucoso en cuero cabelludo" se recibe un fragmento de tejido de forma irregular de color pardo claro que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan cuero cabelludo con hiperqueratosis, papilomatosis, acantosis y quistes córneos.\r\n\r\n\r\n\r\n', ' Extirpación de lesión cuero cabelludo:\r\n-QUERATOSIS SEBORREICA\r\n\r\n', '', ''),
	(2173, 'Q2202-3644', 'Q', '45491425', 'EMMA LEONOR ALVAREZ GONZALEZ', '3167443791', 'F', '52', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(2174, 'Q2202-3645', 'Q', '9057578', 'ADOLFO RAFAEL ARRIETA OSORIO', '3158951028', 'M', '76', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-21', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipo gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas gástricas de diferentes formas y tamaños, que reposan en una lámina propia edematosa. No hay cambios malignos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-PÓLIPO HIPERPLÁSICO', '', ''),
	(2175, 'Q2202-3646', 'Q', '73099114', 'IVAN INFANTE LOZADA', '3000', 'M', '60', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Fondo gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos. \r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n2.Biopsia endoscópica de estómago (fondo):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2176, 'Q2202-3647', 'Q', '45486698', 'LUZ NEIRA LICONA BANQUETT', '00', 'F', '54', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7 x 2 cms. La serosa es opaca de color gris. Al corte la presencia de un gran cálculo que mide 2 x 2 cms. La pared está engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2177, 'Q2202-3648', 'Q', '64517478', 'NARCISA BERRIO TORRES', '00', 'F', '57', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 2.5 x 2 cms. La serosa es de color gris. Al corte las paredes están engrosadas y la mucosa ha perdido su aspecto aterciopelado y se observan múltiples cálculos pequeños de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con atrófia del epitelio focal densamente infiltrada por linfocitos, plasmocitos y neutrófilos que invaden la muscular.\r\n\r\n\r\n', '-COLECISTITIS AGUDA Y CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2178, 'Q2202-3649', 'Q', '1049934678', 'YURANIS BLANCO HERRERA', '000', 'F', '31', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor ALBERTO JOSE ACUÑA ARICO', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa izquierda" un segmento de trompa de Falopio que mide 1 cm. Al corte muestra la estructura usual. Se toman cortes y se rotulan A.\r\n2.  "Trompa derecha" un segmento de trompa de Falopio que mide 1.5 cm. Al corte muestra la estructura usual. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Salpingectomía bilateral:\r\n1.TROMPA UTERINA IZQUIERDA. SEGMENTO	\r\n2.TROMPA UTERINA DERECHA. SEGMENTO\r\n\r\n\r\n\r\n', '', ''),
	(2179, 'Q2202-3650', 'Q', '33212215', 'ESTHER MARTINEZ MARTINEZ', '000', 'F', '66', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-02-21', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 8 x 3 cms. la serosa es de color verdoso. Al corte salida de material biliar y salida de diminutos cálculos de color verdoso, la mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa está infiltrada por linfocitos, plasmocitos e histiocitos espumosos, que llega a la muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n-COLESTEROLOSIS\r\n\r\n', '', ''),
	(2180, 'Q2202-3651', 'Q', '33103830', 'CARMIÑA CAUSADO CASTILLA', '000', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-02-21', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 2.5 cms. La serosa es de color verdoso. Al corte las paredes están engrosadas y la presencia de un cálculo de color oscuro que mide 0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2181, 'Q2202-3652', 'Q', '64583085', 'LILIA PATRICIA ESCAÑO SIERRA', '000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor MARLON DEL TORO HERRERA', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Cuello uterino" se recibe cuello uterino que mide 3 x 2 x 2 cms. con un orificio alargado central, tapizado por una mucosa de color pardo claro. Al corte el canal endocervical es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan cérvix tapizado por epitelio escamoso, el estroma infiltrado por escasos linfocitos y plasmocitos.\r\n\r\n\r\n\r\n\r\n', ' Cuello uterino:\r\n-CERVICITIS CRÓNICA LEVE\r\n\r\n', '', ''),
	(2182, 'Q2202-3653', 'Q', '45520908', 'ZULAY DEL CARMEN CAICEDO CHAVEZ', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898241', '69000', 'Doctor HERNAN CALDERON MORON', NULL, '2022-02-18', '2022-02-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulad "Segmento intestino delgado" se recibe un segmento de intestino delgado que mide 30 cms. la serosa es de color gris cubierto parcialmente por un material amarillento, se observan dos áreas de perforación que compromete el espesor de la pared de tamaño promedio de 1 x 1.5 cms. de bordes irregulares. Al abrirlo, la mucosa conserva el aspecto habitual, la pared es ligeramente edematosa. Se toman cortes.\r\nAcompañado a esto, se recibe segmento de intestino que mide 1 cm.\r\n\r\n\r\n', 'Los cortes  revelan pared de intestino delgado con áreas de edema, ulceración y un infiltrado inflamatorio agudo que compromete el espesor de la pared.\r\n\r\n\r\n\r\n', ' Segmento de intestino delgado de 30 cms. con:\r\n-ULCERACIÓN, INFLAMACIÓN AGUDA SEVERA Y PERFORACIÓN \r\n\r\n\r\n', '', ''),
	(2183, 'Q2202-3654', 'Q', '73137463', 'GABRIEL BERRIO PEREZ', '000', 'M', '52', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JOSE RODRIGUEZ BLANCO', NULL, '2022-02-23', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de líquido pleural" 5 ml. de un líquido de color rojizo. Se centrifuga y se hace extendido del sedimento.\r\n2. "Biopsia pleural visceral" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.3 x 1 y 1.8 x 1.1 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran pleura con marcada fibrosis y una reacción inflamatoria aguda y crónica mediada por neutrófilos, linfocitos y macrófagos. No hay cambios neoplásicos.\r\nLos extendidos de líquido pleural muestran un exudado compuesto por neutrófilos y macrófagos en su mayoría. No hay cambios neoplásicos.\r\n\r\n\r\n', '1.Biopsia de pleura visceral derecha:\r\n-PLEURITIS AGUDA Y CRÓNICA\r\n2.Extendido de líquido pleural:\r\n-EXUDADO\r\n\r\n', '', ''),
	(2184, 'Q2202-3655', 'Q', '73143570', 'JOHANNY BARRIOS MUÑIZ', '3000', 'F', '51', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2185, 'Q2202-3656', 'Q', '21929976', 'LUZ MARINA LLORENTE MARTINEZ', '3108612891', 'F', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(2186, 'Q2202-3657', 'Q', '45765357', 'VIVIANA REYES VELASQUEZ', '3005343764', 'F', '46', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran mucosa oxíntica cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. No se observan H.pylori, actividad inflamatoria ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(2187, 'Q2202-3658', 'Q', '33111418', 'JOSEFINA TORRES DE GAVIRIA', '3225969938', 'F', '79', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-02-28', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un fragmento de piel de forma irregular de color pardo claro y consistencia elástica que mide 0.7 x 0.3 cms. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis presenta focos de hiperqueratosis con paraqueratosis. Hay leve espongiosis. En el dermis papilar se encuentra un infiltrado perivascular mediado por linfocitos y macrófagos.\r\nNo se identifican levaduras en la capa cornea.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en pierna derecha:\r\n-COMPATIBLE CON ECZEMA SUBAGUDO\r\n\r\n\r\n', '', ''),
	(2188, 'Q2202-3659', 'Q', '4558327', 'MARELIS DEL SOCORRO CAUSADO PARRA', '00', 'F', '49', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', '', NULL, '2022-02-23', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia endometrio" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 4 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran endometrio compuesto por glándulas irregulares en forma, tamaño y orientación, tapizadas por epitelio cilíndrico seudoestratificado que reposan en un estroma denso, fibroso, con vasos grandes de paredes gruesas.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-PÓLIPO ENDOMETRIAL HIPERPLÁSICO\r\n\r\n\r\n', '', ''),
	(2189, 'Q2202-3660', 'Q', '45366799', 'ALCIRA RUBY LONDOÑO VELEZ', '3205737462', 'F', '52', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe una masa de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.2 x 0.9 x 0.7 cms. La superficie externa está cubierta por piel casi en su totalidad y al corte se observa una superficie de color pardo claro con áreas de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión benigna constituida por un núcleo de tejido fibroso laxo rodeado pro piel.\r\n\r\n\r\n', ' Resección de lesión en el tronco (lado izquierdo):\r\n-PÓLIPO FIBROEPITELIAL\r\n\r\n\r\n', '', ''),
	(2190, 'Q2202-3661', 'Q', '1128063848', 'CARMEN ROSA ARRIETA CASTELLAR', '3014645901', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898241', '69000', 'Doctor ANTONIO DE JESUS ARAUJO OROZCO', NULL, '2022-02-23', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Ganglión dedo medio" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.9 x 0.8 cms. La superficie externa es de aspecto multilobular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por una proliferación de tejido fibroso marcadamente colagenizado y vascularizado. No se encuentran los cambios degenerativos propios de un ganglión.\r\n\r\n\r\n\r\n', ' Resección de lesión en dedo medio izquierdo:\r\n-NÓDULO FIBROSO\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n\r\n\r\n'),
	(2191, 'Q2202-3662', 'Q', '73128569', 'ROBERTO GONZALEZ CASTILLA', '3246645834', 'M', '54', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-02-23', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un fragmento de piel, elíptico que mide 0.7 x 0.4 cms. de color pardo claro. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis muestra acantosis regular, hiperqueratosis con paraqueratosis, ausencia casi completa de capa granular y presencia de acúmulos de neutrófilos en la capa cornea. En el dermis se encuentra un infiltrado inflamatorio mediado por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en piel de la pierna derecha:\r\n-PSORIASIS VULGAR\r\n\r\n', '', ''),
	(2192, 'Q2202-3663', 'Q', '1053122435', 'NEIVER LUIS CAMARRA JULIO', '3152188303', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2193, 'Q2202-3664', 'Q', '22786808', 'AURORA ELENA GARCIA ZUÑIGA', '3167386125', 'F', '45', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-03-17', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un fragmento de piel de forma irregular de color pardo oscuro y consistencia elástica que mide 0.7 x 0.3 cms. en sus mayores dimensiones. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis es atrófica con pérdida del patrón de clavos interpapilares. Hay hiperqueratosis superficial. El dermis se observa homogéneo con un infiltrado linfocítico y de histiocitos cargados de melanina. Hay presencia de dos folículos pilosos, uno de ellos con un tapón de queratina.\r\n\r\n\r\nCOMENTARIO: Los cambios descritos en la epidermis son sugestivos de un LUPUS DISCOIDE, sin embargo, los cambios dérmicos son inespecíficos.\r\n\r\n', ' Biopsia de lesión en cuero cabelludo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n', '', ''),
	(2194, 'Q2202-3665', 'Q', '1051891112', 'MIGUEL ANDRES GOMEZ MENDOZA', '3232044600', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.7 x 0.8 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2195, 'Q2202-3666', 'Q', '1048580064', 'DIEGO ARMANDO RODRIGUEZ OROZCO', '3214461142', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-03-11', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia falange distal del pulgar izquierdo" se reciben tres fragmentos de tejido de forma irregular de color pardo claro, dos de ellos son de consistencia firme y el otro de consistencia balda que promedian 0.3 cm. Se toma todo y se ponen a descalcificar, los fragmentos de tejido óseo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de tejido óseo desvitalizado rodeado por un tejido fibroso densamente infiltrado por neutrófilos y linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de falange distal del pulgar izquierdo:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(2196, 'Q2202-3667', 'Q', '94471821', 'JORGE ALEXIS PIZARRO DE LA CRUZ', '000', 'M', '45', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 11.7 x 3 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de múltiples cálculos el mayor mide 3.8 cms. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n\r\n\r\n', '', ''),
	(2197, 'Q2202-3668', 'Q', '1137540053', 'MARIAN MICHELLE MEDINA RIOS', '00', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-03-02', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fémur distal izquierdo" se recibe un fragmento de forma irregular, de color pardo rosado y consistencia elástica que mide 0.7 x 0.4 cms. en su mayor dimensión. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran espículas oseas desvitalizadas que reposan en un tejido fibroso infiltrado por linfocitos y neutrófilos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de lesión en fémur izquierdo:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(2198, 'Q2202-3669', 'Q', '45518851', 'CANDELARIA RODRIGUEZ GOMEZ', '3225437346', 'F', '57', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(2199, 'Q2202-3670', 'Q', 'VEN23452983', 'ASTRIS CAROLINA ARCAYA MELENDEZ', '000', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2200, 'Q2202-3671', 'Q', '1047365410', 'YURANIS DEL CAARMEN MORILLO PEREZ', '3024204719', 'F', '38', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-02-28', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mucosa gástrica" se reciben cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica cuya morfología está alterada por un proceso inflamatorio crónico mediado en su mayoría por linfocitos. En uno de los fragmentos se encuentran glándulas de pequeño calibre tapizadas por células con atípias nucleares severas.\r\nEl cuadro descrito es sugestivo pero no concluyente de una neoplasia maligna. Si se considera conveniente, se sugiere repetir la biopsia.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-VÉASE DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2201, 'Q2202-3672', 'Q', '1047518781', 'CRISTIAN CAMILO DE ARMAS VILORA', '3165825300', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antrocorporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2202, 'Q2202-3673', 'Q', '1047449829', 'CAROLINA BENITEZ ZAKZUK', '3052999971', 'F', '30', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', '', NULL, '2022-02-21', '2022-02-18', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro-cuerpo" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa antro corporal cuya lámina propia está edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(2203, 'Q2202-3674', 'Q', '1201257859', 'LUIS GABRIEL PEREIRA', '000', 'M', '20', 'PARTICULAR', '', '898201', '30215', 'Doctor CRISTIAN PUELLO CORREA', NULL, '2022-03-14', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe un fragmento de tejido de color blanquecino y consistencia pétrea que mide 1 x 1 cms. Se toman cortes de las partes blandas que lo rodean.\r\n\r\n\r\n\r\n', 'El espécimen consiste de una pared fibrosa parcialmente tapizada pro epitelio escamoso que contiene una reacción inflamatoria crónica mediada por linfocitos, células plasmáticas, células gigantes multinucleadas y macrófagos espumosos. No se encuentran cambios neoplásicos.\r\nLos hallazgos son compatibles con un QUÍSTE RADICULAR ó PERIAPICAL. Se sugiere correlacionar con los hallazgos clínico-radiológicos.\r\n\r\n\r\n', ' Biopsia de lesión en diente 38:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2204, 'Q2202-3675', 'Q', '33117519', 'ELENA ALICIA VILLALBA ROSAL', '3186933474', 'F', '76', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(2205, 'Q2202-3676', 'Q', '73086539', 'CARLOS MANUEL OSPINO ALVAREZ', '3023078356', 'M', '62', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Pólipo de colon" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructuras compuestas por glándulas de tipo colónico con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-ADENOMAS TUBULARES\r\n\r\n', '', ''),
	(2206, 'Q2202-3677', 'Q', '34976496', 'ALBA ELENA ARDILA PASTRANA', '3005376244', 'F', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA, ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE\r\n\r\n\r\n\r\n', '', ''),
	(2207, 'Q2202-3678', 'Q', '46379054', 'ANDREA PAOLA ROJAS AVELLA', '3114473122', 'F', '41', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-07', '2022-02-22', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lesión elevada de antro gástrico" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n3."Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan C.\r\n', 'Los cortes A y B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. Hay formación ocasional de acúmulos linfoides. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes C presentan cuerpo gástrico con infiltrado mononuclear moderado, actividad leve. No se observa H.Pylori.\r\n\r\n', '1.Biopsia endoscópica de estómago (lesión elevada):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n', '', ''),
	(2208, 'Q2202-3679', 'Q', '5627292', 'YERWIN MANUEL MONTERROSA PAUTT', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4 x 0.8 cms. tapizada por una serosa opaca de color pardo claro bien vascularizada. Al corte hay salida de material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2209, 'Q2202-3680', 'Q', '1143341731', 'NICOLLE ANDREA CARDENAS GONZALEZ', '3012316074', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2210, 'Q2202-3681', 'Q', 'VEN32078425', 'FARUD FERNANDO FADUL RAMIREZ', '3105327178', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1 cms. tapizada por una serosa opaca de color pardo. Al corte hay salida de material purulento. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n', '', ''),
	(2211, 'Q2202-3682', 'Q', '1043335212', 'MOISES ALEJANDRO PEÑA SANTAMARIA', '3127317359', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2.5 x 1.5 x 1 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2.5 x 2 x 1 cms. de color pardo claro y consistencia elástica. Al corte una superficie multinodular. Se toman cortes y se rotulan B.\r\n3. "Adenoides" varios fragmentos de tejido de color blanquecino y consistencia elástica que promedian un diámetro mayor de 1.5 cm. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(2212, 'Q2202-3683', 'Q', '1042580393', 'VALENTINA CARDILES BARRIOS', '3205217649', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia. \r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n\r\n\r\n', '', ''),
	(2213, 'Q2202-3684', 'Q', '1043334651', 'SARA SOFIA THOMPSON PEREZ', '3215900092', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Granuloma región clavicular izquierda" se reciben dos fragmentos de tejido de forma irregular de color pardo grisáceo que miden 1 y  0.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido de granulación constituido por pequeños vasos delgados que descansan en un estroma edematoso infiltrado por PMN neutrófilos, linfocitos y células plasmáticas.\r\n\r\n\r\n', '-FRAGMENTO DE TEJIDO DE GRANULACIÓN, región clavicular izquierda\r\n\r\n\r\n', '', ''),
	(2214, 'Q2202-3685', 'Q', '1048463217', 'JHOSEL DAVID BARRIOS VILLA', '3166005255', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que miden 1 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(2215, 'Q2202-3686', 'Q', '1137534042', 'LAUREN MARGARITA CARDENAS PEREZ', '3002300045', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-07', '2022-02-22', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Planta pie izquierdo" un punch de piel que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Palma mano izquierdo" un punch de piel que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes A y B revelan piel con marcada hiperqueratosis con formación de tapones de queratina que se invaginaron a la epidermis con ligera depresión de esta, la epidermis muestra acantosis irregular y un infiltrado inflamatorio mediado principalmente por linfocitos en la unión dermo epidérmica.\r\n\r\n', '1.Biopsia de planta de pie izquierdo:\r\n-COMPATIBLE CON QUERATODERMIA TIPO PUNTIFORME\r\n2.Biopsia de piel mano izquierda:\r\n-COMPATIBLE CON QUERATODERMIA PUNTIFORME', '', ''),
	(2216, 'Q2202-3687', 'Q', '1127951536', 'DLEIYERS EDILBERTO SIBAJA PADILLA', '3216030821', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se reciben dos fragmentos de apéndice cecal que miden 3 x 1 y 3.5 x 1 cms. tapizada por una serosa opaca de color pardo claro, bien vascularizada. Al corte salida de material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared densamente infiltrada por PMN neutrófilos que se extiende hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE (FRAGMENTOS)\r\n\r\n', '', ''),
	(2217, 'Q2202-3688', 'Q', '1048467174', 'LIZDAYANA AGUILAR PEREZ', '3205264160', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-01', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Nevo epidérmico" se recibe un punch de piel que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel con hiperqueratosis, hipergranulosis, acantosis con elongación de las redes de cresta y espongiosis leve del epitelio escamoso. El dermis papilar muestra un infiltrado inflamatorio perivascular superficial mediado por linfocitos.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en antebrazo izquierdo:\r\n-NEVO EPIDÉRMICO LINEAL INFLAMATORIO', '', ''),
	(2218, 'Q2202-3689', 'Q', '1201251764', 'VALERY SOFIA ESPRIELLA FUENTES', '3008199317', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 2 x 1.5 x 1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(2219, 'Q2202-3690', 'Q', '1044019351', 'JOSE JUNIOR HERRERA HERNANDEZ', '3044824492', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor WILLIAN URIBE LUNA', NULL, '2022-03-07', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Dedo supernumerario mano izquierdo" se recibe una formación nodular que mide 1.5 x 1 x 0.5 cms. de color pardo grisáceo y consistencia elástica. Al corte una formación quística que contiene un material hemorrágico y mide 1.5 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan una cavidad quística de paredes delgadas que contienen elementos sanguíneos.\r\nNo se identifican elementos propios del dedo supernumerario.\r\n\r\n\r\n\r\n', ' Resección de lesión mano izquierda:\r\n-COMPATIBLE CON HEMATOMA\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2220, 'Q2202-3691', 'Q', '73180619', 'JOSE DANIEL AHUMADA OROZCO', '3016708382', 'M', '42', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se reciben dos fragmentos de apéndice cecal que mide el mayor 5 x 1 cms. y el menor de 3 x 1 cms. tapizada por una serosa opaca bien vascularizada de color grisáceo que trae adherido material fibrinopurulento. Se toman cortes. \r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared densamente infiltrada por PMN neutrófilos que se extiende hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE (FRAGMENTOS)\r\n\r\n', '', ''),
	(2221, 'Q2202-3692', 'Q', '1047431097', 'WENDY PEROZA URUETA', '3145425365', 'F', '32', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-02-23', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste de ovario derecho" se recibe un quíste de ovario que mide 15 x 14 x 6 cms. de color pardo grisáceo y consistencia renitente. Al corte salida de un material mucoide de aspecto cetrino dejando ver una cavidad multinodular de paredes delgadas que muestran algunas excrecencias. Trae adherido un segmento de trompa de Falopio que mide 5 cms. Se toman cortes asó: A ovario y B trompa.\r\n\r\n\r\n\r\n', 'Los cortes A revelan estructura quística constituida por una delgada pared de tejido conectivo, tapizado por epitelio de tipo mucinoso.\r\nLos cortes B revelan trompa de Falopio que muestra su estructura usual.\r\n\r\n\r\n\r\n', '1.CISTADENOMA MUCINOSO, ovario derecho\r\n2.TROMPA DE FALOPIO DERECHA\r\n\r\n', '', ''),
	(2222, 'Q2202-3693', 'Q', '45553288', 'LUZ YANET BLANQUICET HERRERA', '000', 'F', '42', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-03-01', '2022-02-22', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Útero y trompa izquierda" cuerpo uterino que pesa 937 gms. y mide 14 x 15 x 10 cms. tapizado por una serosa de color pardo grisáceo. Al corte se observan algunos nódulos subserosos, el mayor mide 1 x 1 cms. Al corte la cavidad endometrial se encuentra rechazada por una masa que mide 12 x 14 x 6 cms. de color blanquecino, multinodular, la trompa mide 5 cms. y es de apariencia normal. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" un segmento de trompa que mide 5 cms. con su fimbria. Al corte la estructura usual. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes revelan cuerpo uterino cuyo endometrio es atrófico, las masas descritas a nivel subseroso y en el miometrio corresponden a leiomiomas. Las trompas muestran la estructura usual.\r\n\r\n\r\n', ' Cuerpo uterino (937 gms.):\r\n-ENDOMETRIO ATRÓFICO\r\n-LEIOMIOMAS\r\n-TROMPAS DE FALOPIO DERECHA E IZQUIERDA\r\n\r\n', '', ''),
	(2223, 'Q2202-3694', 'Q', '1050965784', 'MARIA MATEOS ROMERO', '3004994164', 'F', '27', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-03-03', '2022-02-22', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro mayor de 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan cérvix con una lesión intraepitelial escamosa de bajo grado.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-LESIÓN INTRAEPITELIAL ESCAMOSA DE BAJO GRADO (NIC I)\r\n\r\n\r\n', '', ''),
	(2224, 'Q2202-3695', 'Q', '1047383364', 'ALEXANDRA CAVELIER HERNANDEZ', '00', 'F', '35', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '2020205', '74106', 'Doctora MANUELA BERROCAL', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cápsula periprotesica derecha" un fragmento de tejido de aspecto membranoso de color pardo claro y consistencia elástica que mide 10 x 9 cms. en sus mayores dimensiones, una de la superficie es lisa y brillante y la otra contiene fragmentos de tejido adiposo. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Cápsula periprotesica izquierda" contiene un espécimen similar al descrito. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran paredes fibrosas que en una de sus caras contienen elementos propios del tejido mamario. En los cortes B el tejido mamario contienen estructuras quísticas de pequeño calibre que reposan en un estroma fibroescleroso.\r\nNo se encuentran cambios inflamatorios, metaplasicos ni neoplásicos.\r\n\r\n\r\n', '1.CAPSULA PERIPROTESICA DERECHA\r\n\r\n2.CAPSULA PERIPROTESICA IZQUIERDA\r\n-CONDICIÓN FIBROQUISTICA\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(2225, 'Q2202-3696', 'Q', '1027997869', 'LINA MOLINA CHICA', '000', 'F', '31', 'PARTICULAR', '', '898241', '69000', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa y ovario derecho" contiene un fragmento de tejido de forma irregular, de color pardo claro y áreas de color pardo oscuro y consistencia elástica que muestra un segmento de membrana y un área de aspecto quístico previamente abierto, está última mide 3.5 x 2 x 2.5 cms. Al corte muestra una cavidad de paredes gruesas y la superficie interna es de color pardo oscuro. En el otro extremo del área membranosa se encuentra una zona engrosada que al corte muestra un segmento tubular de tejido con una luz que contiene un material amarillento. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Trompa y ovario izquierdos" contiene un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 3.5 x 2.5 x 2 cms. Trae adherido un segmento de tejido de aspecto tubular que mide 3 x 0.8 cms. Al corte del primero se encuentran dos lóbulos de color blanquecino con un núcleo de color pardo oscuro. El segmento tubular muestra una luz de color pardo amarillento. Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente, rotulado "Apéndice" contiene un apéndice cecal que mide 5.5 x 0.6 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa irregular de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz puntiforme. Se toman cortes y se rotulan C.\r\n', 'Los cortes rotulados A muestran tejido ovárico que rodea una cavidad tapizada por un tejido de granulación que contiene múltiples macrófagos cargados de hemosiderina. La trompa es normal.\r\nLos cortes rotulados B muestran ovario que contiene múltiples focos de glándulas y estroma endometrial. La trompa es normal.\r\nLos cortes rotulados C muestran apéndice cecal que conserva su morfología habitual.\r\n\r\n', '1.Resección de ovario y trompa derechos:\r\n-ENDOMETRIOMA\r\n-TROMPA DE FALOPIO\r\n2.Resección de ovario y trompa izquierdos:\r\n-ENDOMETRIOSIS OVÁRICA\r\n-TROMPA DE FALOPIO\r\n3.APÉNDICE CECAL', '', ''),
	(2226, 'Q2202-3697', 'Q', '23190567', 'GLADIS ESTHER REBOLLEDO SARMIENTO', '3145185103', 'F', '62', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa en región dorsal izquierda" se reciben dos de tejido de forma irregular de color amarillo y consistencia elástica que miden respectivamente 3.5 y 3 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte muestran una superficie untuosa, homogénea de color amarillo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región dorsal izquierda:\r\n-LIPOMA\r\n\r\n', '', ''),
	(2227, 'Q2202-3698', 'Q', '71252096', 'JAIRO DIAZ SOTO', '000', 'M', '46', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-03-02', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa en región torácico abdominal derecha" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia firme que mide 3 x 2.5 x 2 cms. en sus mayores dimensiones, la superficie externa es ligeramente irregular y al corte se encuentra una superficie de color pardo claro, homogénea. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor mesenquimal compuesto por la proliferación combinada de elementos fibrosos e histiocíticos en un patrón estoriforme. Hay atípias citológicas focales, mínima actividad mitótica y ausencia de necrosis.\r\nLos hallazgos son compatibles con un HISTIOCITOMA FIBROSO, sin embargo, es necesario practicar estudios de inmunohistoquímica para una definición diagnóstica precisa.\r\n\r\n\r\n', ' Resección de masa en región toraco-abdominal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n', '', 'Estos tumores tienden a recurrir localmente en un alto porcentaje.\r\n\r\n'),
	(2228, 'Q2202-3699', 'Q', '1052740433', 'LUCIA FERNANDA LLAMAS MARTINEZ', '000', 'F', '22', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa en muslo derecho" se recibe una masa de tejido de aspecto quístico previamente abierta que mide 1.2 cms. en sus mayores dimensiones. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una cavidad tapizada por epitelio escamoso, con contenido de queratina laminar.\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en muslo derecho:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n', '', ''),
	(2229, 'Q2202-3700', 'Q', '1047465618', 'DILSA JARAMILLO TOBON', '3004556356', 'F', '28', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Vulva" un fragmento de tejido de forma irregular de color pardo claro con áreas de color pardo oscuro y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Cérvix" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran piel cuya epidermis muestra hiperqueratosis con hipergranulosis y acantosis irregular. El dermis muestra un infiltrado mononuclear y abundantes capilares.\r\nLos cortes rotulados B muestran fragmentos de cuello uterino con inflamación crónica y una lesión intraepitelial de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n', '1.Biopsia de lesión en vulva:\r\n-LIQUEN SIMPLE CRÓNICO\r\n2.Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA\r\n-LIE DE BAJO GRADO CON CAMBIOS SECUNDARIOS A INFECCIÓN POR HPV\r\n\r\n', '', ''),
	(2230, 'Q2202-3701', 'Q', '1002316627', 'LAURA VANESSA HERRERA SALCEDO', '3126124751', 'F', '19', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 5 x 2 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa de color verdoso. Al corte las paredes son gruesas, la mucosa es aterciopelada y la luz contiene una bilis espesa de color verde oscuro. Se toman cortes.\r\nNo se encuentran cálculos.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar cuya morfología está preservada. Hay leve infiltración mononuclear de la lámina propia de la mucosa.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(2231, 'Q2202-3702', 'Q', '1201285313', 'EMMANUEL DAVID MERCADO HERNANDEZ', '3136386616', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina de forma irregular que mide 2.4 x 1.2 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte una superficie de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina esencialmente similar a la anteriormente descrita. Se toman cortes y se rotulan B.\r\n3. "Adenoides" varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 3 ml. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMÍGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2232, 'Q2202-3703', 'Q', '1201224785', 'MARIA ANGEL RUIZ MERCADO', '3243119559', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 6 x 2 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida de color verdoso. Al corte las paredes son gruesas de aspecto fibroso, la mucosa es de color verde oscuro con un fino retículo de color amarillento en la luz se encuentra un cálculo de color blanco amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2233, 'Q2202-3704', 'Q', '1028941730', 'ESMERALDA OLIER CARMONA', '3134407544', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 4.5 x 0.8 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz ligeramente dilatada que contiene un material de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(2234, 'Q2202-3705', 'Q', '1043991232', 'ISACC DAVID RAMIREZ BRAVO', '3128828693', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice + epiplón" se recibe un apéndice cecal que mide 6.7 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo oscuro y al corte se encuentra una luz muy dilatada que contiene un material grumoso de color verde oscuro. En el mismo recipiente, se recibe además, un fragmento de epiplón que mide 17 cms. en su mayor dimensión de color pardo claro con áreas amarillas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nOtros cortes muestran epiplón con inflamación aguda y fibrosis.\r\n\r\n\r\n\r\n\r\n', '1.APENDICITIS AGUDA\r\n2.FRAGMENTOS DE EPIPLÓN CON INFLAMACIÓN AGUDA\r\n\r\n\r\n', '', ''),
	(2235, 'Q2202-3706', 'Q', '1142938991', 'MARIMAR AVILA CASSIANI', '3226329121', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-03-02', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor de tejido blando región preauricular derecha" se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia firme que mide 1.5 cms. en su mayor dimensión. Al corte se encuentra un tejido de aspecto óseo, color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno derivado de las estructuras pilosas de la piel, compuesto por células basaloides que forman masas rodeadas por espículas óseas. Hay además células escamosas de núcleos vacíos (células fantasmas).\r\n\r\n\r\n', ' Resección de masa preauricular derecha:\r\n-PILOMATRIXOMA (EPITELIOMA CALCIFICANTE DE MALHERBE)\r\n\r\n\r\n', '', ''),
	(2236, 'Q2202-3707', 'Q', '33115364', 'EVERNIS MARIA CARABALLO ACEVEDO', '000', 'F', '77', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa en región lumbar izquierda" se recibe una masa de tejido de forma irregular de forma ovoide que mide 4.5 x 2  x 2 cms. en sus mayores dimensiones, la superficie externa es de color amarillo y consistencia elástica y al corte se encuentra una superficie untuosa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Resección de masa en región lumbar izquierda:\r\n-LIPOMA\r\n\r\n\r\n', '', ''),
	(2237, 'Q2202-3708', 'Q', '1051894882', 'ISSAD LORENZO CONEO DIAZ', '3212855670', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quíste dermoide" se recibe una pequeña masa de forma ovoide de color blanquecino y consistencia renitente que mide 1 cm. en sus mayores dimensiones. Al corte se encuentra una cavidad de paredes delgadas y contiene un material grumoso de color blanquecino y aspecto sebáceo. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por epitelio escamoso con contenido de queratina laminar y presencia de anexos cutáneos en la pared.\r\n\r\n\r\n\r\n', ' Resección de masa en región superciliar derecha:\r\n-QUÍSTE DERMOIDE\r\n\r\n\r\n', '', ''),
	(2238, 'Q2202-3709', 'Q', '1047395013', 'YIRIS YAICETH MOSQUERA CARCAMO', '3114311639', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Lipoma en espalda" se recibe una masa de tejido de color blanquecino y consistencia pétrea que mide 3.5  x 2.5 x 1.5 cms. La superficie externa es de color blanquecino y al corte se encuentra una superficie granular de aspecto calcificado de color blanco anacarado y se pone a descalcificar. \r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión benigna derivada de anexos cutáneos compuestos por epitelio escamoso dispuesto en nidos y con múltiples áreas de calcificación.\r\n\r\n\r\n\r\n', ' Resección de masa en espalda:\r\n-PILOMATRIXOMA (EPITELIOMA CALCIFICANTE DE MALHERBE)\r\n\r\n\r\n', '', ''),
	(2239, 'Q2202-3710', 'Q', '1143354498', 'ELIAS DANIEL CABEZA TABORDA', '3243017857', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro que reposan en una lámina propia edematosa con infiltración mononuclear.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral y antrocorporal cuya morfología está preservada.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de estómago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2240, 'Q2202-3711', 'Q', '33285331', 'IMER CECILIA SIERRA YEPES', '000', 'F', '56', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', '', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Legrado biopsia" se reciben varios fragmentos de tejido de forma irregular de color pardo rojizo con áreas de color pardo claro y consistencia friable y de ellos se extraen múltiples fragmentos de un tejido de color blanquecino y consistencia friable que en conjunto hacen un volumen aproximado de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno epitelial compuesto por glándulas irregulares en forma y tamaño, tapizadas por múltiples capas de células con núcleos marcadamente atípicos y numerosas mitosis. En algunas áreas el tumor toma una conformación sólida sobre un estroma denso, fusocelular.\r\n\r\n\r\n', ' Legrado uterino:\r\n-ADENOCARCINOMA ENDOMETRIAL MODERADAMENTE DIFERENCIADO (GRADO II)\r\n\r\n\r\n', '', ''),
	(2241, 'Q2202-3712', 'Q', '91354458', 'LUDVING HERNANDO CERON BASTO', '3157624925', 'M', '39', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n\r\n', '', ''),
	(2242, 'Q2202-3713', 'Q', '8852031', 'JUAN JAVIER VERGARA BENITEZ', '3016151203', 'M', '41', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-02-25', '2022-02-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2243, 'Q2202-3714', 'Q', '45447000', 'MARIA BERNARDA SOSA GUERRERO', '3135367587', 'F', '60', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-01', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Polipo de fundo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA \r\n2.Biopsia endoscópica de estómago:\r\n-PÓLIPO DE GLÁNDULAS FÚNDICAS\r\n\r\n', '', ''),
	(2244, 'Q2202-3715', 'Q', '22886309', 'BETTY DE LA CRUZ ARREOLA PEREZ', '000', 'F', '70', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-02', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia esta infiltrada por linfocitos y plasmocitos en poca cantidad con infiltración focal leve por neutrófilos. En la muestra enviada no se observó H. pylori, ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE FOCAL\r\n\r\n\r\n', '', ''),
	(2245, 'Q2202-3716', 'Q', '33103500', 'ERIKA BALLESTAS LONG', '000', 'F', '43', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-03-11', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trucut de seno derecho" cuatro cilíndros de tejido de color blanquecino y consistencia blanda, uno de ellos mide 1 cm. y el resto 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Trucut de seno izquierdo" tres cilíndros de tejido de color blanquecino, el mayor mide 1 cms. y los menores 0.4 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A revelan tejido mamario con un foco de adenosis constituido por glándulas pequeñas tubulares, células epiteliales hiperplásicas y células mioepiteliales. No se observan cambios neoplásicos.\r\nLos cortes rotulados B revelan tejido mamario con una hiperplasia ductal moderada, en el borde de uno de los ductos se observan núcleos pleomórficos e hipercromáticos. No se observan cambios neoplásicos.\r\n\r\n\r\n', '1.Biopsia por trucut de mama derecha:\r\n-ADENOSIS FOCAL\r\n\r\n2.Biopsia por trucut de mama izquierda:\r\n-HIPERPLASIA DUCTAL ATÍPICA', '', ''),
	(2246, 'Q2202-3717', 'Q', '45546972', 'NIRIS MARIA PARRA DAZA', '000', 'F', '38', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-03-04', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión constituida por glándulas irregulares, algunas quísticamente dilatadas, tapizadas en su mayoría por epitelio foveolar, que reposan en una lámina propia edematosa, congestiva, y densamente infiltrada por linfocitos y células plasmáticas.\r\n\r\n\r\n\r\n', ' Resección de lesión en estómago:\r\n-PÓLIPO HIPERPLÁSICO\r\n\r\n\r\n', '', ''),
	(2247, 'Q2202-3718', 'Q', '1043327501', 'JERONIMO ANDRES VALDELAMAR CERVANTES', '000', 'M', '4', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-03-02', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan E.\r\n6. "Ciego" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan F.\r\n7. "Recto" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda el mayor de los cuáles mide 0.4 cms. y los menores 0.2 cms. Se toma todo y se rotulan G.', 'Los cortes A revelan fragmentos de epitelio escamoso hiperplásico.\r\nLos cortes B revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C revelan mucosa gástrica oxíntica que muestra la estructura usual.\r\nLos cortes D y E revelan mucosa duodenal infiltrada por linfocitos, plasmocitos y neutrófilos en moderada cantidad.\r\nLos cortes F revelan mucosa colónica infiltrada por linfocitos, plasmocitos y neutrófilo.\r\nLos cortes G revelan mucosa rectal infiltrada por linfocitos, plasmocitos y neutrófilos y eosinófilos.', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE EPITELIO ESCAMOSO HIPERPLASICO\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA GÁSTRICA OXÍNTICA SIN ALTERACIONES\r\n4.Biopsia endoscópica de bulbo y segunda porción duodenal:\r\n-INFLAMACIÓN CRÓNICA MODERADA\r\n5.Biopsia endoscópica de ciego:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA MODERADA\r\n6.Biopsia endoscópica de recto:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA MODERADA', '', ''),
	(2248, 'Q2202-3719', 'Q', '45530107', 'EMPERATRIZ RINCON MERCADO', '3174019628', 'F', '40', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-03-01', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n', '', ''),
	(2249, 'Q2202-3720', 'Q', '1043966240', 'YEIRIS VIVANIS CASTRO HENAO', '3017907308', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-01', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa gástrica antro corporal cuya lámina propia es levemente edematosa y está infiltrada por linfocitos y plasmocitos en poca cantidad y áreas focales de infiltración por neutrófilos. En la muestra no se observa H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD FOCAL LEVE\r\n\r\n', '', ''),
	(2250, 'Q2202-3721', 'Q', '1049832424', 'FREDY JOSE MARRUGO BARRIOS', '3215711144', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-03-07', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Testículo derecho" en un mismo recipiente, se reciben dos fragmentos de tejido de forma alargada de color gris y consistencia elástica que miden 7 y 6.5 cms. Se toman cortes y se rotulan A.\r\n2. "Persistencia del conducto peritoneo vaginal" fragmento de tejido de forma alargada de 5 x 1 cms. Al corte deja ver una cavidad de paredes lisas. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de  A y B revelan tejido fibroso tapizado por mesotelio.\r\nNo se identifican elementos propios del testículo.\r\n\r\n\r\n', ' Hidrocelectomía:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2251, 'Q2202-3722', 'Q', '1041985500', 'FABIO RAFAEL MARTINEZ JULIO', '3187931386', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-03-07', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Testículo izquierdo" se recibe un fragmento de tejido de color gris y consistencia elástica que mide 6 x 0.7 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los múltiples cortes solo revelan epidídimo. No se encuentran otros elementos del testículo.\r\n\r\n\r\n\r\n', '-FRAGMENTO DE EPIDIDIMO\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2252, 'Q2202-3723', 'Q', '1043651826', 'DANIELA PUELLO AYALA', '6422261', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-01', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 y 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2253, 'Q2202-3724', 'Q', '1038487720', 'ADRIEL ISAAC ARCIA LUCAS', '310532115', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-03-07', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ileon terminal" segmento de intestino que mide 5 x 3 cms. el cual se estrecha la luz en uno de sus extremos con eversión de la mucosa. Al corte la mucosa es de aspecto edematoso y está ligeramente aplanada. Se toman cortes y se rotulan A.\r\n2. "Colon" un segmento de colon que mide 2.5 x 1 cms. la serosa es de color pardo claro y suturado en uno de sus extremos con seda de color pardo negro. Al corte la mucosa conserva la distribución usual y se aíslan una formación nodular de 1 cm. Se toman cortes de esta y se rotulan B, y el resto B.\r\n\r\n\r\n', 'Los cortes A revelan pared de intestino delgado con edema y congestión de la serosa y un infiltrado inflamatorio mixto moderado, hay focos de necrosis (boca de colostomía).\r\nLos cortes B revelan pared colonica con edema, congestión e inflamación aguda y crónica leve.\r\n\r\n\r\n\r\n', '1.Pared de intestino delgado (boca de colostomía) con:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA CONGESTIÓN, EDEMA Y FOCOS DE NECROSIS\r\n2.Segmento de colon con:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA LEVE, EDEMA Y CONGESTIÓN\r\n\r\n\r\n', '', ''),
	(2254, 'Q2202-3725', 'Q', '45491398', 'LUZMILA GONZALEZ LOMINET', '00', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JOSE ACEVEDO', NULL, '2022-03-07', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tejido endometrial" se reciben varios fragmentos de tejido de color oscuro que juntos promedian 1 cm. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan endometrio constituido por glándulas irregulares tapizadas por epitelio proliferado con estratificación y atipias citológicas, el estroma abundante fusocelular.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-HIPERPLASIA ENDOMETRIAL SIMPLE ATIPICA', '', ''),
	(2255, 'Q2202-3726', 'Q', '1201287772', 'EMMANUEL JESUS MIRANDA BABILONIA', '3233339751', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-03-02', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.5 cms. La serosa es de color gris. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(2256, 'Q2202-3727', 'Q', '45520387', 'MERLY SALGADO CABARCAS', '000', 'F', '41', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2022-03-01', '2022-02-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Utero + trompas derecha e izquierda" se recibe un útero sin sus anexos que pes 80 gms. y mide 8 x 5 x 4 cms. El cuello cubierto por una mucosa blanquecina con orificio transversal. El cuerpo tapizado por una serosa de color pardo oscuro. Al corte el canal endocervical y la cavidad endometrial son permeables, el espesor del miometrio es de 4 cms. en su mayor dimensión y muestra dos masas blanquecinas arremolinadas que mide 3  x 3 x 2.5 cms.\r\nPor separado, se reciben dos segmentos de trompa de Falopio que mide 2 y 2.5 cms. respectivamente. Al corte muestra la estructura usual. \r\n\r\n', 'Cérvix tapizado por epitelio escamoso, el estroma infiltrado por escasos linfocitos. El endometrio es de tipo proliferativo, las masas descritas corresponden a leiomiomas, se observan focos de adenomiosis.\r\n\r\n\r\n', ' Utero (80 gms.):\r\n-CERVICITIS CRÓNICA LEVE\r\n-ENDOMETRIO PROLIFERATIVO\r\n-ADENOMIOSIS\r\n-LEIOMIOMAS\r\n-SEGMENTOS DE TROMPAS DE FALOPIO (2)\r\n', '', ''),
	(2257, 'Q2203-3728', 'Q', '7928722', 'RAMON BORRE ARRIETA', '3162420140', 'M', '66', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor ORLANDO BORRE ARRIETA', NULL, '2022-03-07', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Piel hombro" se recibe un fragmento de piel de forma irregular, de color pardo claro que mide 0.7 x 0.5 cms. en la superficie externa se destaca una lesión sobreelevada hiperpigmentada que mide 0.6 cms. de diámetro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperqueratosis, acantosis irregular y formación de pseudoquistes córneos. La dermis superficial muestra un infiltrado inflamatorio crónico mediado por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de piel de hombro izquierdo:\r\n-QUERATOSIS SEBORREICA\r\n\r\n\r\n\r\n', '', ''),
	(2258, 'Q2203-3729', 'Q', '45550495', 'MARCELA ANDREA BERMUDEZ GUERRERO', '3135322710', 'F', '38', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(2259, 'Q2203-3730', 'Q', '1043306499', 'MATIAS DAVID SALAS URIETA', '3014434589', 'M', '12', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan E.\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro sin cambios. No se observa infiltrado inflamatorio ni cambios displásicos.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa oxíntica cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. No se observan H.pylori, actividad inflamatoria, atrófia ni cambios displásicos.\r\nLos cortes rotulados D muestran mucosa duodenal que conserva la morfología habitual. No se observan parásitos, granulomas ni cambios displásicos. \r\nLos cortes rotulados E muestran mucosa duodenal que conserva la morfología usual. La lámina propia está edematosa, congestiva e infiltrada por linfocitos y células plasmáticas. No se observan parásitos, granulomas ni cambios displásicos.\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE EPITELIO ESCAMOSO MADURO\r\n2.Biopsia endoscópica de etómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n4.Biopsia endoscópica de duodeno (bulbo):\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n5.Biopsia endoscópica de duodeno (2da. porción):\r\n-DUODENITIS CRÓNICA', '', ''),
	(2260, 'Q2203-3731', 'Q', '1043302396', 'ELIZABETH OROZCO TORRES', '3002230683', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina de tejido de forma irregular de color pardo claro que mide 3.2 x 2 x 1.8 cms. La superficie externa es irregular. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina de tejido de forma irregular de color pardo claro que mide 3 x 2 x 1.8 cms. La superficie externa es irregular. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que en conjunto hacen un volumen de 1 ml. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran fragmentos amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n', '', ''),
	(2261, 'Q2203-3732', 'Q', '1128046646', 'ZHARICK SHADDI BARRIOS GOMEZ', '000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 6.2 x 1.8 cms. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está marcadamente engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de un cálculo color amarillo que mide 1.5 cms. de diámetro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2262, 'Q2203-3733', 'Q', 'VEN923502011', 'DEIKELY NOEMI NAVA MENDOZA', '3106574511', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran mucosa duodenal cuya morfología está preservada. Hay edema, congestión y aumento del número de linfocitos y células plasmáticas de la lámina propia. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENITIS CRÓNICA\r\n\r\n', '', ''),
	(2263, 'Q2203-3734', 'Q', '1142914467', 'LUIS ANGEL TERAN TORDECILLA', '3015098021', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina de forma irregular de color pardo rosado y consistencia elástica que mide 3.7 x 2 x 1.7 cms. La superficie externa es irregular y al corte una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina de forma irregular de color pardo rosado y consistencia elástica que mide 4 x 2 x 1.8 cms. La superficie externa es irregular y al corte una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(2264, 'Q2203-3735', 'Q', '1042585070', 'GINA PAOLA MENDOZA BELLO', '3016622012', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 6.6 x 2.2 cms. La superficie externa está parcialmente cubierta por una serosa despulida y al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado. Hay salida de fragmentos de cálculos de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2265, 'Q2203-3736', 'Q', '1103108285', 'RIGOBERTO JOSE PEREZ ROMERO', '3126974703', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(2266, 'Q2203-3737', 'Q', '1044002627', 'PABLO ALBERTH OSUNA ESCOBAR', '3003125599', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina de forma irregular de color pardo claro y consistencia elástica que mide 3 x 1.8 x 1.5 cms. La superficie externa es irregular y al corte una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina de forma irregular de color pardo claro y consistencia elástica que mide 3.2 x 2 x 1.5 cms. La superficie externa es irregular y al corte una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(2267, 'Q2203-3738', 'Q', '1043643511', 'NEYLIS DALLANY CACERES BONILLA', '3122918853', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fístula traqueocutanea" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.7 x 0.8 cms. La superficie externa está parcialmente cubierta por un fragmento de piel que mide 1.8 x 0.5 cms. Al corte una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un fragmento de tejido fibroconectivo parcialmente tapizado por piel en el que se destaca un trayecto fistuloso tapizado por epitelio escamoso.\r\n\r\n\r\n\r\n', ' Resección de lesión en cuello:\r\n-FISTULA TRAQUEO-CUTANEA\r\n\r\n', '', ''),
	(2268, 'Q2203-3739', 'Q', '1048467080', 'CARLOS DANIEL PEREIRA MEZA', '3242077802', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2.3 x 1.8 x 1.5 cms. La superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2."Amígdala izquierda" una amígdala palatina que mide 2.5 x 1.5 x 1.7 cms. La superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 1.5 cms. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n', '', ''),
	(2269, 'Q2203-3740', 'Q', '1143336258', 'DAYMAR CASSERES OBEZO', '3175245485', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-11', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Persistencia del uraco y quíste dermoide" se recibe una estructura de aspecto quístico de color pardo claro y consistencia renitente que mide 2.2 x 1.5 x 1.3 cms. La superficie externa está parcialmente cubierta por piel de la parte inferior se desprende una estructura alargada de color pardo claro y consistencia elástica que mide 1.5 x 2 cms. Al corte se observa una cavidad que contiene un material grumoso de color pardo claro dejando una cavidad unilocular de paredes delgadas. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por epitelio escamoso con contenido de queratina laminar.\r\nOtros cortes muestran fragmentos de tejido fibroconectivo.\r\n\r\n\r\n\r\n', ' Resección de lesión umbilical:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n-VÉASE DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2270, 'Q2203-3741', 'Q', '1102877395', 'YOVANNY ANDRES PEREZ CORRALES', '0', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe dos fragmentos de apéndice cecal que juntos miden 8.2 x 0.8 cms. La superficie externa está cubierta por una serosa despulida. Al corte la pared está engrosada y la luz dilatada y contiene material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2271, 'Q2203-3742', 'Q', '1047415522', 'JOSE RODOLFO DIAZ BARRAZA', '000', 'M', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se reciben fragmentos de vesícula biliar que juntos miden 10 x 3.8 cms. en su mayor dimensión. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está marcadamente engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de múltiples fragmentos de cálculos de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran pared de vesícula biliar con una reacción inflamatoria aguda y crónica, fibrosis e hipertrofia de la capa muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS AGUDA Y CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2272, 'Q2203-3743', 'Q', '45454487', 'ESPERANZA ZUÑIGA REALES', '3218493481', 'F', '63', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-03-04', '2022-03-02', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero" se recibe un útero que pesa 86 gms. y mide 9 x 5 x 4 cms. en sus mayores dimensiones. El cérvix está tapizado por una mucosa de color pardo claro. El cuerpo conserva el amaño habitual. Al corte el canal endocervical es permeable, la cavidad endometrial está ocupada por una estructura polipoide alargada que mide 2.5 cms. de longitud, la mucosa es delgada de color pardo claro y el miometrio está ocupado por masas de color blanquecino y aspecto arremolinadas, intramurales la mayor de 1.3 cms. y la menor de unos pocos milímetros. Se toman cortes.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria aguda y crónica. La masa descrita en la cavidad endometrial y el endometrio están autolisados. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente.\r\n\r\n\r\n ', ' Histerectomía vaginal:\r\n-CERVICITIS AGUDA Y CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-PÓLIPO ENDOMETRIAL AUTOLISADO\r\n-LEIOMIOMAS INTRAMURALES\r\n\r\n', '', ''),
	(2273, 'Q2203-3744', 'Q', '45433738', 'MARIA DEL CARMEN JIMENEZ MALAGON', '307143527', 'F', '62', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa oxíntica que muestra su morfología usual.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA OXÍNTICA SIN CAMBIOS\r\n\r\n', '', ''),
	(2274, 'Q2203-3745', 'Q', '33262419', 'MARIBEL VASQUEZ ARIZA', '3217217928', 'F', '45', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia pólipo" se recibe una lesión polipoide que mide 2 x 0.5 cms.  de color pardo claro y aspecto mucoide. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas endocervicales dispuestas irregularmente sobre un estroma fibrovascular, se observan áreas de metaplasia escamosa.\r\n\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL\r\n\r\n\r\n', '', ''),
	(2275, 'Q2203-3746', 'Q', '45758020', 'MARIA ELENA ARROYO GONZALEZ', '3188277823', 'F', '46', 'PARTICULAR', 'C.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2276, 'Q2203-3747', 'Q', '1050944614', 'RONY EDER BABILONIA CABARCAS', '000', 'M', '36', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2277, 'Q2203-3748', 'Q', '30773505', 'MARIA DEL ROSARIO PUELLO ESPINOSA', '3053226065', 'F', '55', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2278, 'Q2203-3749', 'Q', '1201273131', 'JORGE ELIECER BATISTA SERPA', '3224305720', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-03-14', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Unión pieloureteral izquierda" se recibe un fragmento de tejido que mide 1 x 0.5 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran un conducto tapizado por un urotelio que en un extremo está dilatado y en el otro muestra una zona de estenosis.\r\n\r\n\r\n', ' Resección de unión pieloureteral izquierda:\r\n-ESTENOSIS DE UNIÓN PIELOURETERAL\r\n\r\n', '', ''),
	(2279, 'Q2203-3750', 'Q', '1216980947', 'MACKENZIE BACHE LOBO', '3173196834', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Lesiones condilomatosas" se reciben cinco lesiones verrucosas que miden 0.5 cms. de diámetro mayor. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan estructuras compuestas pro epitelio escamoso hiperplásico con atipias coilociticas que descansan en un tallo de tejido fibroconectivo.\r\n\r\n\r\n\r\n', '-CONDILOMAS ACUMINADOS, vagina, perine\r\n\r\n\r\n', '', ''),
	(2280, 'Q2203-3751', 'Q', '1043996358', 'JHOAINE SOFIA BARRIOS VILLA', '3116289596', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Liquen estriado parte posterior izquierdo" se recibe un punch de piel que mide 0.3 cms. de color pardo claro. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso con atrófia leve focal debajo de este se observa un infiltrado perivascular de predominio superficial mediado por linfocitos que toca la epidermis con exocitosis de algunas células y espongiosis leve.\r\n\r\n\r\n\r\n', ' Biopsia de piel muslo izquierdo:\r\n-COMPATIBLE CON LIQUEN ESTRIADO\r\n\r\n\r\n', '', ''),
	(2281, 'Q2203-3752', 'Q', '8699958', 'JOSE LUIS ARRIETA JIMENEZ', '000', 'M', '74', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Saco herniario" se recibe una estructura sacular que mide 7 x 4 cms. de color pardo amarillento y consistencia elástica. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo bien vascularizado infiltrado por linfocitos, plasmocitos y abundantes neutrófilos.\r\n\r\n\r\n\r\n', '-TEJIDO FIBROADIPOSO CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n\r\n', '', ''),
	(2282, 'Q2203-3753', 'Q', '33272549', 'KELLY JOHANA SIERRA SERRANO', '00', 'F', '40', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-03-14', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Producto resección de masa en mama derecha" se recibe una formación nodular que mide 2.5  x 2 x 1 cms. de color blanquecino y consistencia firme. Al corte una superficie blanco amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares, con esclerosis y calcificación.\r\n\r\n\r\n\r\n', '-FIBROADENOMA CON ESCLEROSIS Y CALCIFICAIÓN, mama derecha\r\n\r\n', '', ''),
	(2283, 'Q2203-3754', 'Q', '1047365410', 'YURANIS DEL CARMEN MORILLO PEREZ', '3024204719', 'F', '38', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglio mesentérico" se recibe un fragmento irregular de tejido de color blanquecino donde se observan dos nódulos que mide 1 cm. cada uno. Se toman cortes.\r\n\r\n\r\n\r\n', 'Ganglio linfático infiltrado por un adenocarcinoma moderadamente diferenciado.\r\n\r\n\r\n\r\n', '-ADENOCARCINOMA MODERADAMENTE DIFERENCIADO METASTASICO A GANGLIO MESENTÉRICO\r\n\r\n\r\n', '', ''),
	(2284, 'Q2203-3755', 'Q', '33112643', 'ELBA ROSA CASTRO DE PERALTA', '000', 'F', '79', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctores ALVARO HERNANDEZ - SCHENAYDER LOPEZ', NULL, '2022-03-14', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 3 x 0.5 cms. tapizada por una serosa de color pardo claro bien vascularizada. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal que muestra un infiltrado inflamatorio agudo con edema y congestión a nivel de la serosa.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-PERIAPENDICITIS AGUDA\r\n\r\n', '', ''),
	(2285, 'Q2203-3756', 'Q', '1042586926', 'ERIK YESID DIAZ PEREZ', '000', 'M', '22', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898241', '69000', 'Doctora SINDY DIAZ DAVILA', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Fibrina paretal" se recibe dos fragmentos de tejido de color pardo claro que miden 2 cms. de diámetro mayor y aspecto membranoso. Se toman cortes.\r\n\r\n', 'Los cortes revelan tejido fibroconectivo con una reacción inflamatoria crónica granulomatoso con células gigantes y necrosis  caseosa.\r\n\r\n\r\n\r\n', ' Resección de pleura parietal\r\n-INFLAMACIÓN CRÓNICA GRANULOMATOSA CASEIFICANTE COMPATIBLE CON TBC\r\n\r\n', '', ''),
	(2286, 'Q2203-3757', 'Q', '33109215', 'CELMIRA ESTHER CARO PACHECO', '000', 'F', '47', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados se reciben:\r\n1. "Resección de masa en mama izquierda" una masa de tejido de forma ovoidea y aspecto adiposo tapizada parcialmente por una elipse de piel de color pardo claro la masa mide 4.5 x 3 x 1.5 cms. y la elipse de piel mide 3.8 x 2.8 cms. Al corte una superficie de color amarillento y aspecto adiposo. Se toman cortes y se rotulan A.\r\n2. "Resección de masa en mama derecha" una masa de tejido de iguales características a la anteriormente descrita que mide 4 x 2 x 2 cms. Se toman cortes y se rotulan B.\r\nAcompañado a esto, un fragmento de tejido adiposo de color amarillento que mide 1 cm. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan tejido mamario que conserva su morfología usual.\r\n\r\n\r\n\r\n', '1.MAMA SUPERNUMERARIA IZQUIERDA\r\n2.MAMA SUPERNUMERARIA DERECHA\r\n\r\n\r\n', '', ''),
	(2287, 'Q2203-3758', 'Q', '73241447', 'JAIR MARTINEZ BAZA', '3016499479', 'M', '46', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-03-14', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. la serosa es de color gris, opaca y tapizada parcialmente por un material de aspecto fibrinoso. Al corte la luz ocupada por material blanquecino. Se toman cortes.\r\nAcompañado a esto, se reciben dos fragmentos de tejido fibroadiposo que mide 3 y 1 cms. \r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. Otros cortes muestran fragmentos de tejido adiposo con inflamación aguda.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITS AGUDA\r\n\r\n', '', ''),
	(2288, 'Q2203-3759', 'Q', '1047452375', 'YULINEIS ROSSI RAMIREZ', '3158213857', 'F', '29', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDGAR GOMEZ RHENALS', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Trompa y cuerno uterino izquierdo" se recibe una trompa de Falopio que mide 8 cms. Adherido a esto en su extremo proximal se observa un área firme de aspecto redondeado de aspecto membranoso, hemorrágia de 3 x 2.5 cms. Al corte del área antes mencionada un área de color pardo oscuro. Se toman cortes.\r\nAdemás, se toman cortes de la trompa y al corte muestra la estructura usual. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan trompa de Falopio, en cuya base se identifican coágulos sanguíneos y vellosidades coriónicas que la infiltran.\r\n\r\n\r\n\r\n', ' Embarazo ectópico:\r\n-TROMPA DE FALOPIO IZQUIERDA\r\n\r\n', '', ''),
	(2289, 'Q2203-3760', 'Q', '1066351923', 'EVA SANDRITH SOTO SILVERA', '3205670517', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-03-03', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Placenta" se recibe placenta que pesa 279 gms. y mide 10 x 10 x 2.5 cms. Trae adherido segmento de cordón umbilical de 22 cms. el cual en su extremo distal es de color oscuro. Al corte del cordón se observa la presencia de tres vasos, la cara fetal de aspecto membranoso de color gris oscuro y está representada por múltiples cotiledones. Se toman cortes del cordón, membranas y placenta.\r\nAcompañado a esto dos segmentos de trompa de Falopio que mide 1 cms. que muestra la estructura usual. Se toman cortes.', '', '', '', ''),
	(2290, 'Q2203-3761', 'Q', '45591514', 'ERNESTINA CABARCAS BUENDIA', '00', 'F', '45', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero" se recibe un cuerpo uterino que pesa 1324 gms. y mide 18 x 13 x 9 cms. en sus mayores dimensiones, aumentado globalmente de tamaño y tapizado por una serosa de color pardo claro. Al corte el canal endocervical es permeable, el endometrio es plano de color rojizo, el espesor del miometrio es de 9 cms. en su mayor dimensión y muestra múltiples masas blanquecinas, arremolinadas mide la mayor 8 x 7 x 7 cms. y la menor de 1 x 1 cms. Se toman cortes.\r\n\r\nNOTA: No se reciben trompas de Falopio.\r\n\r\n', 'Cuerpo uterino que muestra múltiples tumores benignos mesenquimales compuestos por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.  El endometrio es atrófico.\r\n\r\n', ' Cuerpo uterino de (1.324 gms.):\r\n-LEIOMIOMAS\r\n-ENDOMETRIO ATRÓFICO', '', ''),
	(2291, 'Q2203-3762', 'Q', '33334878', 'DEVIS MARTINEZ AMARIS', '00', 'F', '-1', 'ALLIANZ SEGUROS DE VIDA S.A', '', '898201', '30215', 'Doctor JAIME OLIVARES TAYLOR', NULL, '2022-03-07', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una formación nodular tapizada totalmente pro piel que mide 0.5 x 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por  epitelio escamoso maduro que rodea un núcleo de tejido fibroconectivo moderadamente vascularizado.\r\n\r\n\r\n\r\n', ' Resección de lesión en pezón izquierdo:\r\n-PÓLIPÓ FIBROEPITELIAL\r\n\r\n\r\n', '', ''),
	(2292, 'Q2203-3763', 'Q', '92131471', 'ABRAHAM ELIAS NAIZZIR VILLAREAL', '000', 'M', '41', 'PARTICULAR', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-03-10', '2022-03-03', 'OLIVA MARRUGO GRICE', 'Rotulado "Varicocele izquierdo" se reciben tres fragmentos de tejido de forma irregular, el mayor mide 1 cm. y el menor de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan una proliferación de vasos venosos congestivos y tortuosos que descansan en un estroma fibroadiposo.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '-VARICOCELE IZQUIERDO\r\n\r\n', '', ''),
	(2293, 'Q2203-3764', 'Q', '1047435219', 'KATY ISABEL ALGARIN BUSTOS', '00', 'F', '31', 'PARTICULAR', '', '898201', '30215', 'Doctor ORLANDO BORRE ARRIETA', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de exo y endocervix" en un mismo recipiente, se reciben dos fragmentos de tejido. Uno de ellos de forma irregular, color blanquecino y consistencia elástica que mide 0.5 cms. en su mayor dimensión. \r\nEl segundo fragmento de tejido de color pardo grisáceo y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes de exo y endocervix muestran un proceso inflamatorio agudo y crónico. En el exocervix hay una metaplasia escamosa extensa en la que se identifica una LIE de alto grado (NIC 2) y cambios coilociticos asociados.\r\n\r\n\r\n', ' Biopsia de exo y endocervix:\r\n-CERVICITIS AGUDA Y CRÓNICA CON METAPLASIA ESCAMOSA\r\n-LIE DE ALTO GRADO (NIC 2) CON CAMBIOS COILOCÍTICOS ASOCIADOS\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n\r\n'),
	(2294, 'Q2203-3765', 'Q', '1048605066', 'DORIANI HIDALGO MARRUGO', '000', 'F', '30', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe una masa de tejido de forma irregular de color blanquecino y aspecto lobulado que mide 2.8  x 2 x 1.8 cms. La superficie externa es de color pardo claro y al corte se encuentra una superficie multinodular de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en mama derecha:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(2295, 'Q2203-3766', 'Q', '1201281453', 'THAYLER MANUEL VILLERO HERNANDEZ', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor en cuello lado derecho" se recibe una masa de tejido de forma ovoidea, color blanquecino y consistencia elástica que mide 1 cm. en su mayor dimensión. Al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada pro la presencia de folículos aumentados en número y tamaño, con centros germinales que contienen abundantes macrófagos con detritus celulares.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección de masa en cuello:\r\n-GANGLIO LINFÁTICO CON HIPERPLASIA FOLICULAR REACTIVA\r\n\r\n', '', ''),
	(2296, 'Q2203-3767', 'Q', '21929976', 'LUZ MARINA LLORENTE MARTINEZ', '3108612891', 'F', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Pólipo gástrico" se recibe un fragmento de tejido de forma irregular de color blanquecino con áreas de color pardo oscuro y consistencia blanda que mide 1 cms. en su mayor dimensión. Al corte se fragmenta con facilidad. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por glándulas gástricas de diferentes formas y tamaños, algunas quísticamente dilatadas, tapizadas por epitelio foveolar. Reposan en una lámina propia edematosa con un infiltrado linfoplasmocitario. No se identifican H.pylori.\r\n\r\n\r\n\r\n', ' Resección de lesión en estómago:\r\n-PÓLIPO HIPERPLÁSICO\r\n\r\n\r\n', '', ''),
	(2297, 'Q2203-3768', 'Q', '45466784', 'VIVIANA MARGARITA GUERRERO ARRIETA', '3005187319', 'F', '56', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2298, 'Q2203-3769', 'Q', '45421086', 'JUDITH AGAMEZ SARABIA', '3016337877', 'F', '65', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Dcotor FERNANDO JIMENEZ', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2299, 'Q2203-3770', 'Q', '1142922377', 'DANIEL ALEJANDRO PACHECO RHENALS', '3186842326', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice + ganglio periapendicular" en un mismo recipiente, se recibe un apéndice cecal que mide 8 x 1 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro. Al corte en el extremo distal la luz está dilatada y contiene un fragmento de material fecal compactado. Se toman cortes.\r\nSe recibe, además, una pequeña masa de color pardo amarillento de consistencia elástica, forma ovoide que mide 1 cm. en su mayor dimensión. \r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\nOtros cortes muestran ganglio linfático con cambios hiperplásicos difusos.\r\n\r\n\r\n\r\n', '1.APENDICITIS AGUDA\r\n2.Ganglio linfático periapendicular:\r\n-HIPERPLASIA REACTIVA DE TIPO MIXTO\r\n\r\n', '', ''),
	(2300, 'Q2203-3771', 'Q', '1041987075', 'YULIETH PAOLA VALDEZ BOLIVAR', '000', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARIA CLAUDIA BURGOS', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una masa de tejido de forma ovoidea que mide 3.3 cms. en sus mayores dimensiones. La superficie externa es de color pardo claro con criptas prominentes. Al corte se encuentra una superficie ligeramente lobulada de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una masa de tejido de forma ovoidea que mide 3.3 cms. en sus mayores dimensiones. La superficie externa es de color pardo claro con criptas prominentes. Al corte se encuentra una superficie ligeramente lobulada de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(2301, 'Q2203-3772', 'Q', '1050979124', 'SAMUEL DAVID CHAPARRO NABARRO', '3005310354', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Granuloma codo izquierdo" se recibe un fragmento de tejido de forma irregular de color blanco grisáceo con áreas amarillentas y consistencia blanda, elástica que mide 2 cms. en su mayor dimensión. Al corte se encuentra una superficie blanquecina con áreas de color pardo claro. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión parcialmente cubierta por epitelio escamoso y ulcerada en su mayor parte, compuesta por un tejido de granulación con densa infiltración por neutrófilos, linfocitos y macrófagos.\r\n\r\n\r\n\r\n', ' Resección de lesión en codo izquierdo:\r\n-TEJIDO DE GRANULACIÓN CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n\r\n\r\n', '', ''),
	(2302, 'Q2203-3773', 'Q', '1044018756', 'DANIEL DAVID TORRES MEDRANO', '318413728', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.5 cms. en sus mayores dimensiones. La superficie externa está cubierta por una serosa despulida de color pardo claro y pardo oscuro en su extremo distal. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya morfología está preservada. Hay edema, congestión e infiltración mononuclear d ela serosa y subserosa.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2303, 'Q2203-3774', 'Q', '80417272', 'LUIS FANOR VERBEL PEINADO', '3177494739', 'M', '52', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. en sus mayores dimensiones. La superficie es irregular y al corte en el extremo distal no se encuentra luz y en la base se encuentra una luz dilatada que contiene un material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2304, 'Q2203-3775', 'Q', '45527856', 'IVETH MENDOZA PAUTT', '000', 'F', '40', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-03-07', '2022-03-04', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(2305, 'Q2203-3776', 'Q', '45459100', 'FRANCIA HELENA REDONDO SALGADO', '000', 'F', '58', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe una elipse de piel de color pardo oscuro que mide 5 x 1.3 x 1 cms. Acompañado por un fragmento de tejido adiposo redondeado de 1 cms. Al corte una superficie lisa y blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso que descansa en un estroma fibroso con infiltración por linfocitos, plasmocitos y neutrófilos en abundante cantidad con formación de absceso, se observa, además, la presencia de células gigantes multinucleadas.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en mama derecha:\r\n-MASTITIS AGUDA Y CRÓNICA CON FORMACIÓN DE ABSCESO\r\n\r\n\r\n', '', ''),
	(2306, 'Q2203-3777', 'Q', '1041994228', 'DANIELA ISABEL CHICA UHIA', '3003249619', 'F', '6', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan E.', 'Los cortes A revelan en su mayoría fragmentos sueltos de epitelio escamoso maduro, una de ellas descansan en una lámina propia infiltrada por linfocitos.\r\nLos cortes B revelan mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C revelan cuerpo gástrico cuya lámina propia infiltrada por linfocitos y plasmocitos en poca cantidad.\r\nLos cortes D y E (bulbo y segunda porción del duodeno) que muestran la lámina propia infiltrada por linfocitos, plasmocitos y neutrófilos.\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n4.Biopsia endoscópica de bulbo y segunda porción del duodeno:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA LEVE', '', ''),
	(2307, 'Q2203-3778', 'Q', '1047376786', 'MEIBELLYN PAJARO CORTEZ', '3024339805', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-28', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Piel hombro derecho" se recibe un punch de piel de forma redondeada que mide 0.3 x 0.4 cms. de color pardo oscuro. Se toma todo en dos cortes.\r\n\r\n\r\n', 'Piel tapizada pro epitelio escamoso con hiperqueratosis, acantosis irregular, focos de degeneración vacuolar, fibrosis dérmica y la presencia de abundantes melanofagos en el dermis papilar.\r\n\r\n\r\n\r\n', ' Biopsia de piel hombro derecho:\r\n-DERMATITIS DE INTERFASE TIPO VACUOLAR\r\n\r\n\r\n\r\n', '', 'El cuadro arriba mencionado puede ser visto en una dermatitis cenicienta, liquen pigmentogeno, erupción fija por medicamento, toxicodermia. Se recomienda correlacionar con la clínica.\r\n\r\n'),
	(2308, 'Q2203-3779', 'Q', '1201233363', 'STIVEN ANDRES RAMIREZ FAJARDO', '3218665263', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Xantogranuloma-neurofibroma" se recibe una masa de tejido de forma redondeada, tapizada totalmente por piel que mide 1 x 1 cms. Al corte una superficie de color amarillento.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral constituida por una proliferación de histiocitos que adoptan un patrón verticilado que involucran el dermis y toca la unión dermoepidermica con aplanamiento de esta, hay presencia de células gigantes multinucleadas y células de Touton además, la presencia de linfocitos.\r\n\r\n\r\n', ' Extirpación de lesión en piel puente nasal:\r\n-XANTOGRANULOMA JUVENIL\r\n\r\n', '', ''),
	(2309, 'Q2203-3780', 'Q', '1042000294', 'JOSE LUIS MENDEZ VASQUEZ', '3005594691', 'M', '18', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-15', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulado, se reciben:\r\n1. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 y 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Ileo terminal" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Colon proximal" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo y se rotulan D.\r\n5. "Colon transverso" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan E.\r\n6. "Colon descendente" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo y se rotulan F.\r\n7. "Colon sigmoide" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 y 0.3 cms. Se toma todo y se rotulan G.\r\n8. "Recto" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 y 0.1 cms. Se toma todo y se rotulan H.', 'Los cortes A revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de foliculos linfoides. En las luces glandulares se observa H.pylori. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B revelan mucosa duodenal infiltrada por linfocitos y plasmocitos.\r\nLos cortes C revelan mucosa de ileon con inflamación crónica leve.\r\nLos cortes de D, E, F y G revelan mucosa colonica cuya lámina propia está infiltrada por linfocitos, plasmocitos y neutrófilos.\r\nLos cortes H revelan mucosa rectal que muestra infiltración por linfocitos en poca cantidad.', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENO CON INFLAMACIÓN CRÓNICA LEVE\r\n3.Biopsia endoscópica de ileon terminal:\r\n-ILEON CON INFLAMACIÓN CRÓNICA\r\n4.Biopsia endoscópica de colon proximal, transverso, descendente y sigmoides:\r\n-INFLAMACIÓN AGUDA Y CRÓNICA LEVE\r\n5.Biopsia endoscópica de recto:\r\nINFLAMACIÓN AGUDA Y CRÓNICA', '', ''),
	(2310, 'Q2203-3781', 'Q', '1238347127', 'SHAIRA SOFIA SOTO RIVERA', '3014041161', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-15', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mastocitoma" se recibe un punch de piel de forma redondeada que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso con acantosis irregular, en el dermis papilar y medio se observan nidos de células con características morfológicas de células cebadas,  la mayoría con una disposición perivascular.\r\nEs necesario estudios de inmunohistoquímica para confirmar diagnóstico.\r\n\r\n\r\n', ' Biopsia de piel en codo derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n', '', ''),
	(2311, 'Q2203-3782', 'Q', '1137526221', 'NAYELIS GARCIA CASTILLO', '3104650682', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 y 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B muestran fragmento de mucosa duodenal con leve infiltración linfocítica.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica de duodeno:\r\n-FRAGMENTOS DE MUCOSA DUODENAL SIN ALTERACIONES\r\n\r\n', '', ''),
	(2312, 'Q2203-3783', 'Q', '1126255192', 'ANGEL EMANUEL YEPES HERNANDEZ', '3007976053', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Tejido aritenoideo izquierdo" un fragmento de tejido de color blanquecino que mide 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Tejido aritenoideo derecho" un fragmento de tejido de color blanquecino que mide 1 x 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan epitelio escamoso hiperplásico que descansa en un estroma ricamente vascularizado.\r\n\r\n\r\n\r\n', '1.Tejido aritenoideo izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.Tejido aritenoideo derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2313, 'Q2203-3784', 'Q', '1143419772', 'LAUREN MARIA RECUERO CASTELLON', '3016498143', 'F', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 1 y 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2314, 'Q2203-3785', 'Q', '1043640780', 'JUAN DAVID GONZALEZ PEÑA', '6632819', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa gástrica antral que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA SIN ALTERACIONES\r\n\r\n', '', ''),
	(2315, 'Q2203-3786', 'Q', '1142929961', 'LINDA CAROLINA TERAN SANCHEZ', '3045309211', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Xantogranuloma" se recibe un punch de forma redondeada que mide 0.4 cms. en su centro presenta un área deprimida. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión tumoral constituida por una proliferación de células de núcleos vesiculosos con citoplasma eosinofílico dispuestos en un patrón verticilado e infiltrado por linfocitos en poca cantidad, hay presencia de células gigantes tipo Touton en abundante cantidad.\r\n\r\n\r\n\r\n', '-XANTOGRANULOMA JUVENIL, piel antebrazo derecho\r\n\r\n', '', ''),
	(2316, 'Q2203-3787', 'Q', '1043325740', 'LANDER DAVID RAMIREZ CARABALLO', '3244766579', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" masa de tejido de forma ovoide que mide 2.5 x 1.6 x 1 cms. Al corte una superficie de color blanquecino, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" masa de tejido de forma ovoide que mide 2.5 x 1.3 x 1 cms. Al corte una superficie de color blanquecino, multinodular. Se toman cortes y se rotulan B.\r\n3. "Adenoides" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica, el mayor mide 1.3 x 1 cms. Al corte una superficie lisa, blanquecina. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2317, 'Q2203-3788', 'Q', '1018517905', 'DANIEL ALEJANDRO FIGUEREDO PEREZ', '3223912796', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma alargada de color pardo claro y consistencia blanda que promedian 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa antral que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA ANTRAL SIN ALTERACIONES\r\n\r\n', '', ''),
	(2318, 'Q2203-3789', 'Q', 'VEN33104674', 'RUBELY VALENTINA PARRA SANCHEZ', '3046714465', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1 cms. La serosa es opaca y despulida. Al corte la luz ocupada por material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2319, 'Q2203-3790', 'Q', '1102865312', 'JHON SEBASTIAN PEREZ MERCADO', '3008285011', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 y 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan mucosa gástrica antral que conserva la estructura usual.\r\nLos cortes B revelan mucosa duodenal con un infiltrado inflamatorio leve mediado en su mayoría por linfocitos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA ANTRAL SIN CAMBIOS\r\n2.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL QUE MUESTRA LA ESTRUCTURA USUAL\r\n\r\n', '', ''),
	(2320, 'Q2203-3791', 'Q', '1063716705', 'CARMEN ALICIA MIRANDA PEREZ', '000', 'F', '44', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDGAR GOMEZ RHENALS', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Exocervix" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 1 y  0.7 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran estroma fibroso en el que se observa un tumor epitelial maligno constituido por células de escamosas que muestran pleomórfismo nuclear, diferentes tamaños y abundante citoplasma y figuras de mitosis, las cuales se disponen en nidos sólidos.\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CARCINOMA DE CÉLULAS ESCAMOSAS MODERADAMENTE DIFERENCIADO, INFILTRANTE', '', ''),
	(2321, 'Q2203-3792', 'Q', '1053009324', 'VALENTINA SANTOS VARGAS', '3127040207', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n', '', ''),
	(2322, 'Q2203-3793', 'Q', '1042587893', 'YORELYS PATRICIA CANTILLO GOMEZ', '3114216440', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-10', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa gástrica antral que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA ANTRAL SIN ALTERACIONES\r\n\r\n', '', ''),
	(2323, 'Q2203-3794', 'Q', '22609609', 'MILENA MERCADO OSPINO', '000', 'F', '39', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-03-15', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe una masa de tejido de color amarillento que mide 7 x 5 x 3.5 cms. Al corte masa de tejido de color amarillento de bordes irregulares, de consistencia firme, que mide 5 x 4 x 3.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tejido mamario que se observa un tumor constituido por la proliferación combinada de elementos estromales y glandulares. E algunas áreas el estroma está compuesto por células de núcleos grandes irregulares, vacuolados, algunos con nucleolo prominentes que sugieren un proceso neoplásico mesenquimal.\r\nEs imperativo practicar estudios de inmunohistoquímica para una definición diagnóstica.\r\n\r\n\r\n\r\n', ' Resección de masa en mama izquierda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2324, 'Q2203-3795', 'Q', '45496296', 'MARTHA CECILIA PEREZ LEON', '3005478534', 'F', '50', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-04-06', '2022-03-08', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero y trompas" se recibe cuerpo uterino y dos segmentos de trompas por separado, Útero que pesa 393 gms. y mide 12 x 10 x 7 cms. aumentado globalmente de tamaño y deformado por la presencia de múltiples masas. Al corte el endometrio es plano de color rojizo, el espesor del miometrio es de 4 cms. en su mayor dimensión. y presenta múltiples masas blanquecinas arremolinadas, la mayor mide 4 x 3 cms. y la menor de 1.5 cms. Acompañado a esto, se reciben dos segmentos de trompas de Falopio que miden cada una 4 cms. y al corte muestra la estructura usual. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cuerpo uterino cuyo endometrio muestra cambios por autólisis. Las formaciones nodulares descritas corresponden a leiomiomas. Los segmentos de trompas de Falopio no muestran cambios.\r\n\r\n\r\n\r\n\r\n', ' Cuerpo uterino (393 gms.):\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS\r\n-SEGMENTOS DE TROMPAS DE FALOPIO (2) SIN ALTERACIONES', '', ''),
	(2325, 'L2203-137', 'L', '45694879', 'ADRIANA ISABEL AVENDAÑO GOENAGA', '00', 'F', '43', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-03-09', '2022-03-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "ACAF de seno derecho" se reciben 4 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' ACAF de seno derecho:\r\n-EXTENDIDOS ACELULARES\r\n\r\n\r\n', '', ''),
	(2326, 'L2203-138', 'L', '7454101', 'JESUS ORLANDO LIENDO VILLAMIZAR', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2022-03-09', '2022-03-09', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se reciben 10 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' Citología seriada de orina:\r\n-EXTENDIDOS ACELULARES\r\n\r\n\r\n', '', ''),
	(2327, 'L2203-139', 'L', '1137219686', 'KEINER ANDRES TERAN MENDOZA', '000', 'M', '18', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-03-09', '2022-03-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "LCR" se reciben 5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(2328, 'L2203-140', 'L', '1052097392', 'KATRIN ELIZABETH ARIAS ORTEGA', '000', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-03-09', '2022-03-09', 'VIRNA CARABALLO OSORIO', 'Rotulado "LCR" se reciben 6.5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n\r\n\r\n', '', ''),
	(2329, 'Q2203-3796', 'Q', '33193151', 'MAGALY DE JESUS DIAZ TAPIA', '3003533777', 'F', '65', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 1 ml. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células escamosas con núcleos pleomórficos, hipercromáticos que se disponen en nidos sólidos que infiltran el estroma.  Hay formación ocasional de perlas de queratina.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CARCINOMA ESCAMOCELULAR INFILTRANTE', '', ''),
	(2330, 'Q2203-3797', 'Q', '22809800', 'ROSA DEL CARMEN GARCIA GARCIA', '6417967', 'F', '41', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-03-16', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Verruga perianal" se recibe un fragmento de piel de color pardo claro y consistencia elástica que mide 0.8 x 0.4 cms. la superficie externa es irregular y al corte se observa una superficie homogénea de color pardo grisáceo. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por epitelio escamoso que rodea un núcleo de tejido fibroso con leve infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Resección de lesión perianal:\r\n-PÓLIPO FIBROEPITELIAL\r\n\r\n', '', ''),
	(2331, 'Q2203-3798', 'Q', '15133046', 'MIRYIS MORELA ESCALONA', '00', 'F', '40', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-03-17', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de cérvix" múltiples fragmento de tejido de forma irregular de color pardo claro que alternan con otros de color pardo oscuro y consistencia elástica, friable que en conjunto hacen un volumen de 5 ml. Se toma todo y se rotulan A.\r\n2. "Biopsia de vulva" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 0.5 y 0.2 cms. en sus mayores dimensiones. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de cérvix con LIE de bajo grado con cambios citopáticos secundarios a infección por HPV. \r\nLos cortes rotulados B muestran lesión benigna compuesta por la proliferación de células escamosas que se disponen en un patrón papilomatoso con cambios citopáticos por VPH.\r\n\r\n\r\n\r\n', '1.Biopsia de cérvix:\r\n-LIE DE BAJO GRADO (CAMBIOS ASOCIADOS A INFECCIÓN POR VPH)\r\n2.Biopsia de vulva:\r\n-CONDILOMA ACUMINADO\r\n\r\n\r\n\r\n', '', ''),
	(2332, 'Q2203-3799', 'Q', '23136477', 'MILDRED CECILIA LICONA ARENAS', '00', 'F', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Masa de hombro derecho" se recibe una masa de tejido de forma irregular de color pardo amarillento y consistencia elástica que mide 3.2 x 2.5 x 1.7 cms. La superficie externa está cubierta por una fina cápsula y aspecto multilobulada y al corte se observa una superficie untuosa de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n', ' Resección de masa en hombro derecho:\r\n-LIPOMA', '', ''),
	(2333, 'Q2203-3800', 'Q', '1002196880', 'QUENDRIS MONTES LOBO', '00', 'F', '19', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor RODOLFO VALENCIA', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.3 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz es puntiforme y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA', '', ''),
	(2334, 'Q2203-3801', 'Q', '1002430288', 'DIEGO ANDRES SANCHEZ ACOSTA', '3012297520', 'M', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.2 x 0.9 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2335, 'Q2203-3802', 'Q', '45555929', 'DIANA MARIA PAREJA LOPEZ', '00', 'F', '40', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '2020205', '74106', 'Doctora MANUELA BERROCAL', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cápsula periprotesica lado derecho" un fragmento de tejido de color pardo claro y aspecto membranoso que mide 12 x 8.5 cms. La superficie externa del mismo es irregular y al corte se observa una cavidad virtual que contiene un material gelatinoso, transparente. Se toman cortes y se rotulan A.\r\n2. "Cápsula periprotesica lado izquierdo" un fragmento de tejido de color pardo claro y aspecto membranoso, sacular que mide 9.5 x 7 cms. La superficie externa del mismo es irregular y al corte se observa una cavidad virtual. No se observa el material gelatinoso descrito en el espécimen lado derecho. Se toman cortes y se rotulan B.\r\n3. "Cuadrante infero-medial mama izquierda" múltiples fragmentos de tejido de forma irregular de color pardo amarillento y consistencia elástica que juntos miden 10.5 x 6 x 3.5 cms. La superficie externa es irregular y al corte se observa una superficie amarillenta que alternan con áreas de color pardo claro, homogénea. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran un tejido fibroso que en una de sus caras muestra una proliferación de histiocitos multivacuolados. Hay focos de inflamación crónica mediados por linfocitos. No se encuentra metaplasia sinovial, ni cambios neoplásicos.\r\nLos cortes rotulados B muestran una pared fibrosa que en algunas áreas muestra metaplasia sinovial en su cara interna. No se observan cambios neoplásicos.\r\nLos cortes rotulados C muestran tejido mamario cuya morfología está alterada por la presencia de canalículos quísticamente dilatados que reposan sobre un estroma fibroescleroso. No hay cambios proliferativos ni neoplásicos.\r\n\r\n', '1-Resección de cápsula peri protésica de mama derecha:\r\n-CÁPSULA FIBROSA CON REACCIÓN INFLAMATORIA CRÓNICA\r\n2-Resección de cápsula peri protésica de mama izquierda:\r\n-CÁPSULA FIBROSA CON FOCOS DE METAPLASIA SINOVIAL.\r\n3-Resección de cuadrante inferomedial de mama izquierda:\r\n-CONDICIÓN FIBROQUÍSTICA\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2336, 'Q2203-3803', 'Q', '22376101', 'MARIA CRISTINA GOMEZ DE BOLIVAR', '3217096895', 'F', '79', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero" se recibe un útero sin anexos que pesa 65 gms. y mide 10 x 5.8 x 3.5 cms. El cérvix está tapizado por una mucosa gruesa de color pardo claro sin lesiones aparentes. El cuerpo conserva la forma y el tamaño habitual. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizada por una mucosa delgada y ocupada por una masa de color pardo claro que mide 2.5 x 1.7 x 1.5 cms. El miometrio está ocupado por múltiples masas de color blanquecino y aspecto arremolinado, la mayor mide 1 cm. y la menor unos pocos milímetros de localización intramural. Se toman cortes.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio es inactivo. La masa descrita en la cavidad endometrial está compuesta por glándulas tapizadas por un epitelio aplanado que reposan en un estroma fibroso. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente.\r\n\r\n\r\n', ' Útero (65 gms.) con:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO INACTIVO\r\n-PÓLIPO ENDOMETRIAL ATRÓFICO\r\n-LEIOMIOMAS INTRAMURALES\r\n', '', ''),
	(2337, 'Q2203-3804', 'Q', '33149285', 'MARIA DEL ROSARIO DE FATIM FLOREZ CARRASQUILLA', '00', 'F', '68', 'PARTICULAR', '', '', '', 'Doctor LUIS FERNANDO VIAÑA G.', NULL, '2022-03-14', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Trucut" se reciben tres fragmentos cilíndricos de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 1.8 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células de tamaño mediano con citoplasma anfofílico y núcleos moderadamente pleomórficos e hipercromáticos (2), con moderada actividad mitótica (2), que se disponen en nidos sólidos y cordones sin diferenciación tubular (3). El tumor infiltra un estroma fibroso con acúmulos de linfocitos. Hay imágenes sugestivas pero no concluyentes de infiltración linfovascular.\r\n\r\n\r\n ', ' Biopsia con aguja de corte de masa en mama izquierda:\r\n-CARCINOMA DUCTAL, TIPO NO ESPECIAL, MODERADAMENTE DIFERENCIADO (GRADO II, NOTTINGHAN), INFILTRANTE\r\n\r\n\r\n\r\n', '', 'Se sugiere practicar estudios de inmunohistoquímica para receptores hormonales, Her2 y Ki67.\r\n\r\n'),
	(2338, 'Q2203-3805', 'Q', '22449358', 'PIEDAD XIMENA SILVA RODRIGUEZ', '3215419177', 'F', '52', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n\r\n\r\n', '', ''),
	(2339, 'Q2203-3806', 'Q', '80482', 'JULIAN GONZALEZ NAJERA', '6655698', 'M', '83', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-14', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ulcera de antro" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya lámina propia muestra fibrosis focal y un infiltrado inflamatorio mediado por linfocitos y células plasmáticas. En uno de los fragmentos hay cambios displásicos leves del epitelio glandular. No se identifican H.pylori.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica oxíntica cuya morfología está preservada.\r\n\r\n\r\n', '1.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA OXÍNTICA\r\n\r\n', '', ''),
	(2340, 'Q2203-3807', 'Q', '45481198', 'BEATRIZ ELENA BERRIO CUDRI', '3015957462', 'F', '57', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(2341, 'Q2203-3808', 'Q', '53167712', 'LORENA BUENO HENAO', '000', 'F', '36', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de folículos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2342, 'Q2203-3809', 'Q', '1047509354', 'NASHAL MILETH RIOS LLERENA', '3043454963', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina de forma irregular de color pardo claro y consistencia, elástica que mide 3.2 x 2 cms. en sus mayores dimensiones. La superficie externa es irregular y al corte una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina de forma irregular de color pardo claro y consistencia, elástica que mide 2.9 x 1.7 x 1.5 cms. en sus mayores dimensiones. La superficie externa es irregular y al corte una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con una reacción inflamatoria aguda y crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-AMIGDALITIS AGUDA Y CRÓNICA\r\n\r\n\r\n', '', ''),
	(2343, 'Q2203-3810', 'Q', '1101820054', 'JORGE LUIS RIVERO HERNANDEZ', '3014411162', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor HENRY TORRES MONTES', NULL, '2022-03-22', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Curetaje óseo tibia derecha" se reciben múltiples fragmentos de tejido de color pardo claro y consistencia firme que promedian un volumen de 0.5 ml. Se toa todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran espículas óseas inviables que reposan en un estroma fibroso infiltrado por linfocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en tibia derecha:\r\n-CAMBIOS COMPATIBLES CON OSTEOMIELITIS CRÓNICA\r\n\r\n\r\n', '', ''),
	(2344, 'Q2203-3811', 'Q', '1041988644', 'YERLIS PAOLA TORREGLOSA BRUN', '3054411554', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-03-11', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 2.3 x 2 x 0.8 cms. Al corte se observa una superficie homogénea de color pardo claro. Se toma parte.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n', '', ''),
	(2345, 'Q2203-3812', 'Q', '1201275756', 'HAROLD ADVID TABORDA BARBOSA', '3004498821', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-03-14', '2022-03-10', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ileon proximal" un segmento de ileon que mide 11 x 2.4 cms. La superficie externa está cubierta por una serosa lisa y brillante. Al corte la pared es de aspecto edematoso, la mucosa conserva el aspecto habitual. Se toman cortes de la línea de resección y se rotulan A, B otras áreas.\r\n2. "Fístula enterocutánea" un fragmento de tejido de color pardo claro y consistencia elástica que mide 2.8 x 2 x 1.5 cms. La superficie externa está parcialmente cubierta por una elipse de piel que mide 1.8 x 0.8 cms. Se toman cortes y se rotulan C.\r\n3. "Colon ascendente" un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.6 x 0.8 cms. en su mayor dimensión. Se toma todo en dos cortes y se rotulan D.\r\n4. "Colon descendente" un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.6 x 0.8 cms. Se toam todo en dos cortes y se rotulan E.\r\n\r\n', 'Los cortes rotulados A y B muestran pared de intestino delgado, con edema marcado y congestión vascular. No se observan cambios inflamatorios. Las líneas de resección son viables.\r\nLos cortes rotulados C muestran un fragmento de tejido fibroconectivo parcialmente cubierto por piel en el que se destaca un trayecto fistuloso parcialmente tapizado por tejido de granulación densamente infiltrado por PMN neutrófilos.\r\nLos cortes rotulados D y E muestran pared colónica que conserva la morfología habitual. Hay presencia de células ganglionares.\r\n\r\n\r\n', '1.Resección de segmento de ileon proximal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n2.Resección de fístula enterocutánea lateral izquierda:\r\n-COMPATIBLE CON FÍSTULA ENTEROCUTÁNEA CON INFLAMACIÓN AGUDA\r\n3.Biopsia de colon ascendente:\r\n-PARED COLÓNICA CON PRESENCIA DE CÉLULAS GANGLIONARES\r\n4.Biopsia de colon descendente:\r\n-PARED COLÓNICA CON PRESENCIA DE CÉLULAS GANGLIONARES\r\n', '', ''),
	(2346, 'L2203-141', 'L', '7454101', 'JESUS ORLANDO LIENDO VILLAMIZAR', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2022-03-11', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se reciben 9.5 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', 'Los extendidos muestran escasas células escamosas maduras.\r\n\r\n\r\n\r\n', ' Citología seriada de orina:\r\n-NEGATIVA PARA MALIGNIDAD.', '', ''),
	(2347, 'L2203-142', 'L', '7454101', 'JESUS ORLANDO LIENDO VILLAMIZAR', '000', 'M', '71', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JIMMY ALMEIDA TORRES', NULL, '2022-03-11', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se reciben 9 ml. de un líquido de color amarillento. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', 'Extendidos acelulares.\r\n\r\n\r\n\r\n', ' Citología seriada de orina:\r\n-EXTENDIDOS ACELULARES\r\n\r\n', '', ''),
	(2348, 'L2203-143', 'L', '1053006623', 'CRISTIAN ANDRES MORALES FONSECA', '3216904576', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-03-11', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "LCR" se reciben 4.2 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento. \r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(2349, 'Q2203-3813', 'Q', '1047503613', 'JESUS DAVID QUINTANA TATIS', '3004934819', 'M', '25', 'PARTICULAR', '', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2350, 'Q2203-3814', 'Q', '3977719', 'LUIS ALFONSO MOLINARES MOLINA', '3137136921', 'M', '62', 'PARTICULAR', '', '898201', '30215', 'Doctor RIOS', NULL, '2022-03-18', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una formación nodular que mide 2 x 1 cms. pediculada, color pardo oscuro y consistencia renitente. Al corte una superficie quística que contiene un material grumoso de color pardo oscuro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión quística tapizada por epitelio escamoso, con ulceración parcial, la pared presenta infiltrado inflamatorio mixto, cristales de colesterol, histiocitos espumosos y células gigantes multinucleadas.\r\n\r\n\r\n\r\n', '-QUÍSTE PERIAPICAL, maxilar superior en 13-11\r\n\r\n\r\n', '', ''),
	(2351, 'Q2203-3815', 'Q', '1129564299', 'SERGIO MEJIA CALLE', '3007427977', 'M', '36', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Colon ascendente" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad moderada, H.pylori presente No se observa atrófia, metaplasia ni displasia.\r\nLos cortes B revelan colon cuya lámina propia es edematosa, congestiva con un infiltrado inflamatorio mixto.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n2.Biopsia endoscópica de colon ascendente:\r\n-COLITIS CRÓNICA ACTIVA\r\n', '', ''),
	(2352, 'Q2203-3816', 'Q', '1038116894', 'YESICA LORENA SERNA NORIEGA', '00', 'F', '30', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-03-18', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Endometrio" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que juntos hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan endometrio constituido por glándulas dispuestas de forma irregular con cambios secretorios, el estroma denso.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-POLIPO ENDOMETRIAL TIPO FUNCIONAL\r\n\r\n', '', ''),
	(2353, 'Q2203-3817', 'Q', '1048439471', 'JULIETH BORELLY ZARATE', '3009818692', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte la pared es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(2354, 'Q2203-3818', 'Q', '1064801701', 'LEIDY JOHANA CASTAÑO GIRALDO', '000', 'F', '25', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de endometrio" se reciben varios fragmentos de tejido de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 2 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan endometrio constituido por glándulas irregulares tapizadas por epitelio proliferativo con estratificación, el estroma fusocelular.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-HALLAZGOS COMPATIBLES CON ESTIMULO ESTROGÉNICO PROLONGADO CORRELACIONAR CON LA HISTORIA MENSTRUAL.\r\n\r\n', '', ''),
	(2355, 'Q2203-3819', 'Q', '79944512', 'CARLOS ANDRES GAITAN ANZOLA', '3015908267', 'M', '44', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '2020205', '74106', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Pólipo de esófago" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmento de mucosa gástrica de tipo cardial.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de esófago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2356, 'Q2203-3820', 'Q', '1129521883', 'CINTYA PAOLA SANDOVAL ACEVEDO', '3003586426', 'F', '33', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENETE\r\n\r\n', '', ''),
	(2357, 'Q2203-3821', 'Q', '45469542', 'SAIDE ANGULO MOSCOTE', '3053378697', 'F', '55', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2358, 'Q2203-3822', 'Q', '73077758', 'SILFREDO DIAZ PEÑARANDA', '3145644265', 'M', '65', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan mucosa oxíntica sin cambios.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA OXÍNTICA SIN CAMBIOS\r\n\r\n', '', ''),
	(2359, 'Q2203-3823', 'Q', '73162963', 'ALDEMAR ANTONIO BENITO REBOLLO BONFANTE', '3136942057', 'M', '48', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lengüeta esofágica" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan mucosa cardial con un denso infiltrado linfoplasmocitario de la lámina propia.\r\nLos cortes B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE MUCOSA CARDIAL CON INFLAMACIÓN CRÓNICA\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2360, 'Q2203-3824', 'Q', '1052988937', 'SANTIAGO MARTINEZ ROJAS', '3025639320', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía.\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2361, 'Q2203-3825', 'Q', '1053127929', 'JESUS DANIEL MAZA PEÑA', '3103657590', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Apéndice" un apéndice cecal que mide 6 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material verdoso. Se toman cortes y se rotulan A.\r\n2. "Ganglio" una formación nodular que mide 1 x 0.5 cms. de color pardo claro. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\nLos cortes B revelan ganglio linfático con una hiperplasia folicular reactiva.\r\n\r\n\r\n', '1.Apéndicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n2.Ganglio periapendicular:\r\n-HIPERPLASIA FOLICULAR REACTIVA\r\n\r\n', '', ''),
	(2362, 'Q2203-3826', 'Q', '1012467251', 'THIAGO IMITOLA MELENDEZ', '30163237775', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.5 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(2363, 'Q2203-3827', 'Q', '1142930865', 'SHARINA ISABEL CARRASCAL GOMEZ', '3002922257', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo claro. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APÉNDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2364, 'Q2203-3828', 'Q', '22799807', 'PAOLA INES BONFANTE VERGARA', '00', 'F', '42', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JOSE ACEVEDO', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa izquierda" un segmento de trompa de forma tubular que mide 1.5 cms. de color pardo claro y consistencia elástica. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" un segmento de trompa de forma tubular que mide 1.5 cms. de color pardo claro y consistencia elástica. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan trompas uterinas que muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Salpingectomía parcial bilateral:\r\n1.TROMPA UTERINA IZQUIERDA. SEGMENTO\r\n2.TROMPA UTERINA DERECHA. SEGMENTO\r\n\r\n', '', ''),
	(2365, 'Q2203-3829', 'Q', '1047377833', 'ERIKA GALAN MURILLO', '3013397811', 'F', '49', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero, trompas y ovarios" se recibe un útero con anexos que pesa 410 gms. y mide 12 x 12 x 8 cms. el cuello tapizado por una mucosa blanquecina con orificio puntiforme. el cuerpo aumentado de tamaño tapizado por una serosa de color pardo claro y deformado por unas masas subserosas, la mayor de las cuales mide 4 x 4 cms. En el miometrio se observan múltiples masas, la mayor de las cuales mide 7 x 7 x 5 cms. de color blanquecino, aspecto arremolinado. El ovario izquierdo mide 5 x 2.5 cms. La trompa 5 cms. Al corte se observa un cuerpo lúteo quístico, el ovario derecho mide 3 x 3 cms. La superficie lisa, la trompa mide 5 cms. y presenta un hidátide de morgagni de 5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cérvix con una reacción inflamatoria crónica leve, el endometrio es atrófico. Las masas descritas en el miometrio y a nivel subseroso corresponden a leiomiomas. El ovario izquierdo muestra quiste lúteo hemorrágico, el derecho muestra su morfología usual. La trompa derecha e izquierda muestran la morfología habitual, en la trompa derecha se observa hidátide de morgagni.\r\n\r\n\r\n', '1.Útero y anexos (410 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO ATRÓFICO\r\n-LEIOMIOMAS\r\n2.QUÍSTE LÚTEO HEMORRÁGICO, ovario izquierdo\r\n3.VARIO DERECHO\r\n4.HIDÁTIDE DE MORGAGNI, trompa derecha\r\n5.TROMPAS DE FALOPIO', '', ''),
	(2366, 'Q2203-3830', 'Q', '45450082', 'JACQUELINE TORRES OSPINA', '0000', 'F', '1', 'PARTICULAR', 'C.', '898201', '30215', '', NULL, '2022-03-14', '2022-03-11', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa gástrica" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico con muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2367, 'Q2203-3831', 'Q', 'VEN26078999', 'OSMARY MARYELIS MOLINA GARCIA', '000', 'F', '23', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-03-22', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Placenta" en un mismo recipiente, se reciben varios fragmentos de tejido placentarios que incluyen cotiledones y fragmentos de membranas que en conjunto pesa 475 gms. externamente, son de color rosado. Trae por separado un segmento de cordón umbilical que mide 41 cms. de longitud que al corte trae tres vasos, uno de ellos marcadamente dilatados. Se toman cortes e incluyen las membranas.\r\n\r\n\r\n\r\n', 'Los cortes muestran placenta del tercer trimestre compuesto por vellosidades marcadamente edematosas, tapizadas por cito y sinciciotrofoblasto sin alteraciones. Hay una reacción inflamatoria aguda y crónica que compromete las membranas.\r\nNo hay cambios neoplásicos. El cordón tiene su vascularidad normal.\r\n\r\n\r\n', ' Placenta del 3° trimestre (fragmentos) 475 gms.:\r\n-CORIOAMNIONITIS AGUDA Y CRÓNICA\r\n\r\n', '', ''),
	(2368, 'Q2203-3832', 'Q', '1137219530', 'LEONARDO RIOS BANQUEZ', '00', 'M', '18', 'CLIN. SAN JOSE DE TORICES SAS', 'Coosalud', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Riñón izquierdo" se recibe un riñón que pesa 118 gms. y mide 9 x 6 x 4 cms. en sus mayores dimensiones, la superficie externa es irregular, está cubierto por una cápsula que se desprende con facilidad y en una de sus caras se encuentra una gran solución de continuidad hacia la parte media que lo divide en dos fragmentos, está solución de continuidad es irregular y contiene múltiples coágulos de sangre. En el sistema pielocalicial se observan, además, el depósito de múltiples coágulos sanguíneos. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran riñón con áreas extensas de solución de continuidad y hemorragias extensas del intersticio y del sistema pielocalicial.\r\n\r\n\r\n\r\n', ' Nefrectomía izquierda:\r\n-RUPTURA TRAUMATICA\r\n\r\n', '', ''),
	(2369, 'Q2203-3833', 'Q', 'VEN21102966', 'YECENIA CAROLINA NIEVES VELASQUEZ', '3127185716', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Nódulo de epiplón" se recibe una masa de tejido de forma irregular, ligeramente ovoide que mide 2 x 1.3 x 1.2 cms. es de consistencia firme de color pardo amarillento y al corte se encuentra una cavidad que contiene un líquido viscoso de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una cavidad de paredes fibrosas, sin revestimiento epitelial, que contiene un material grumoso proteinaceo.\r\n\r\n\r\n\r\n', ' Resección de nódulo en epiplón:\r\n-PSEUDOQUISTE PERITONEAL\r\n\r\n', '', ''),
	(2370, 'Q2203-3834', 'Q', '1081915081', 'MAIRA ALEJANDRA OSPINO MORENO', 'CE', 'F', '32', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de endometrio" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia friable que en conjunto hacen un volumen de 2 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran endometrio compuesto por glándulas tubulares, tapizadas por epitelio cilíndrico seudoestratificado con focos de estratificación. Reposan en un estroma denso, fusocelular con pequeños trombos hialinos en algunas vénulas superficiales.\r\nEl cuadro descrito es compatible con un ENDOMETRIO PROLIFERATIVO CON ESTIMULO ESTROGÉNICO PROLONGADO (ciclo anovulatorio). Es necesario correlacionar con la historia menstrual y el día del ciclo en que se toma la muestra.\r\n\r\n\r\n', ' Biopsia de endometrio:\r\n-ENDOMETRIO PROLIFERATIVO CON CAMBIOS COMPATIBLES CON UN ESTÍMULO ESTROGÉNICO PROLONGADO \r\n\r\n\r\n', '', ''),
	(2371, 'Q2203-3835', 'Q', '30758911', 'CECILIA DEL CARMEN MORALES', '6293181', 'F', '67', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que promedian un diámetro de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de exocervix con una marcada hiperqueratosis e hipergranulosis de un epitelio escamoso engrosado que reposa en un estroma con moderada infiltración mononuclear. No hay cambios displásicos.\r\n\r\n\r\n', ' Biopsia de exocervix:\r\n-CERVICITIS CRÓNICA CON HIPERQUERATOSIS\r\n\r\n\r\n\r\n', '', ''),
	(2372, 'Q2203-3836', 'Q', '1137524078', 'CRISNER CASTILLO SANMARTIN', '3206488866', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Granuloma" se recibe una masa de tejido de forma redondeada cubierta por piel en su mayor parte, de consistencia firme que mide 0.8 cms. en su mayor diámetro. Al corte se encuentra un núcleo de color blanquecino. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por la proliferación de vasos capilares que se disponen en lóbulos que reposan en un estroma de tejido conectivo laxo.\r\n\r\n\r\n\r\n', ' Resección de lesión en lado izquierdo del cuello:\r\n-HEMANGIOMA CAPILAR LOBULADO (GRANULOMA PIÓGENO)\r\n\r\n\r\n\r\n', '', ''),
	(2373, 'Q2203-3837', 'Q', '9107360', 'GUIDO ALFONSO GONZALEZ GUERRERO', '00', 'M', '74', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 6.5 x 2.5 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida de color pardo grisáceo. Al corte las paredes son gruesas, fibrosas, la mucosa es aterciopelada y en la luz se encuentran numerosos cálculos de color amarillo de forma irregular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2374, 'Q2203-3838', 'Q', '1049534629', 'LEYNER DE JESUS RODRIGUEZ OROZCO', '3235344925', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro y externamente está cubierta por una serosa despulida de color pardo claro y al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2375, 'Q2203-3839', 'Q', '1050735864', 'RAUL DAVID BUELVAS ROMERO', '000', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-03-30', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de piel de miembro inferior derecho" se recibe un punch de piel que mide 0.6 cms. de diámetro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya epidermis se observa hiperqueratosis, hipergranulosis en cuña y elongación regular de los clavos interpapilares. Hay un denso infiltrado perivascular superficial mediado por linfocitos.\r\nEl cuadro histológico descrito es compatible con una DERMATITIS ATÓPICA, aunque no podemos descartar un LIQUEN SIMPLE CRÓNICO.\r\n\r\n\r\n', ' Biopsia de piel de rodilla derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2376, 'Q2203-3840', 'Q', '1049830853', 'NATALYS BELEÑO TORREGLOSA', '3225929438', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.6 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro y al corte se encuentra una luz ligeramente dilatada que contiene un material grumoso de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya mucosa está preservad. hay un denso infiltrado inflamatorio agudo que compromete la serosa y subserosa.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-PERIAPENDICITIS AGUDA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n\r\n'),
	(2377, 'Q2203-3841', 'Q', '45366700', 'YENIS MAGOLA MARTINEZ PADILLA', '00', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Endometrio" se recibe un fragmento de tejido de forma alargada, de color pardo oscuro y consistencia friable que mide 2 x 0.3 cms. en sus mayores dimensiones. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen consiste de coágulos sanguíneos entre los que se observan minúsculos fragmentos de endometrio.\r\nEl material es insuficiente para una valoración diagnóstica.\r\n\r\n\r\n\r\n', ' Biopsia de endometrio:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2378, 'Q2203-3842', 'Q', '1201213066', 'ISABEL ROMERO PINEDA', '00', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-16', '2022-03-15', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa irregular de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2379, 'Q2203-3843', 'Q', '30775519', 'MARIELA SANTOS VARGAS', '3002322319', 'F', '51', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-03-22', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipo endocervical" se recibe una masa de tejido forma redondeada, mide 1.1 x 1 cms. Al corte una superficie de color grisáceo. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan lesión polipoide constituida por glándulas de tipo endocervical, tapizado por epitelio escamoso con áreas de metaplasia escamosa inmadura.\r\n\r\n\r\n\r\n', '-PÓLIPO ENDOCERVICAL\r\n\r\n\r\n', '', ''),
	(2380, 'Q2203-3844', 'Q', '24251803', 'GABRIEL CASTELLANO CONTRERAS', '3219045700', 'M', '29', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n', '', ''),
	(2381, 'Q2203-3845', 'Q', '33272304', 'GABRIELA CASTRO VASQUEZ', '000', 'F', '43', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un punch de piel de color gris que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso hiperplásico en el que se observan abundantes cuerpos de molusco.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en piel de vulva:\r\n-MOLUSCO CONTAGIOSO\r\n\r\n', '', ''),
	(2382, 'Q2203-3846', 'Q', '30571763', 'ROSIRIS SUAREZ GONZALEZ', '3145479322', 'F', '50', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2383, 'Q2203-3847', 'Q', '23105136', 'OMAYDA ISABEL ANGULO NIEBLES', '000', 'F', '64', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula de forma piriforme que mide 6 x 3 cms. La serosa de color verdoso. Al corte en su interior se observan tres cálculos de color oscuro que promedian 1 cm. La mucosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2384, 'Q2203-3848', 'Q', '1151959945', 'SANTIAGO OSORIO HERNANDEZ', '000', 'F', '25', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. La serosa es opaca de color oscuro. Al corte la luz ocupada por material fecaloideo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2385, 'Q2203-3849', 'Q', 'VEN31016733', 'LEOMAR GABRIEL LANDAETA VILORIA', '000', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 y 0.1 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 y 0.1 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes de A revelan fragmentos de epitelio escamoso sin alteraciones.\r\nLos cortes B revelan mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C revelan mucosa duodenal cuya lámina propia está infiltrada por linfocitos y plasmocitos en poca cantidad. No se observan parásitos intestinales, atrófia ni granulomas.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA LEVE\r\n\r\n', '', ''),
	(2386, 'Q2203-3850', 'Q', '1142919547', 'DAMIAN MARIMON GARCES', '3113019300', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor OSCAR ENRIQUE ROMERO ORTIZ', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal fragmentado, el fragmento mayor mide 4 x 1 cms. y el menor de 0.5 cms. La serosa es opaca y despulida. Al corte la luz ocupada por material blanquecino. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2387, 'Q2203-3851', 'Q', '1051885660', 'XAVIER ENRIQUE COTA TARON', '3023606592', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 y 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. en su mayor dimensión. Se toma todo y se rotula B.\r\n\r\n\r\n', 'Los cortes A revelan antro gástrico cuya lámina propia está infiltrada por linfocitos y plasmocitos en moderada cantidad y neutrófilos en poca cantidad que penetran el epitelio de algunas glándulas, hay presencia de H.pylori en poca cantidad. No se observa hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B revelan mucosa duodenal cuya lámina propia está infiltrada por linfocitos, plasmocitos y neutrófilos en poca cantidad. No se observan parásitos intestinales ni ulceración en la muestra enviada.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n2.Biopsia endoscópica de duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL CON INFLAMACIÓN CRÓNICA LEVE', '', ''),
	(2388, 'Q2203-3852', 'Q', '1042593601', 'JUAN CAMILO VALIENTE NAVARRO', '3205455721', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2022-05-20', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia quiste de fémur derecho" se reciben varios fragmentos de tejido de color pardo oscuro que juntos promedian 4 ml. Se toma parte.\r\n\r\n\r\n', 'El espécimen está constituido por masas de tejido fibroso moderadamente celulares que muestran focos de calcificación distrófica. Hay además coágulos sanguíneos y masas de fibrina. Los cambios sugieren una lesión de tipo fibroso que pudiera corresponder a un fibroma no osificante; sin embargo, en los estudios radiológicos que recibimos no es posible visualizar la lesión. Además, que en la historia clínica se habla de lesión intertrocanterica.\r\n\r\n\r\n', ' Biopsia de lesión en fémur derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2389, 'Q2203-3853', 'Q', '1007120939', 'DIANA CAROLINA PEREZ DIA', '000', 'F', '20', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. la serosa opaca de color pardo oscuro y despulida. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2390, 'Q2203-3854', 'Q', '9092566', 'DIONICIO CASTILLA FLOREZ', '00', 'M', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Resección de masa en región perianal izquierda" se recibe una formación redondeada tapizada en su totalidad por piel de color oscuro. Al corte una superficie lisa y amarillenta que mide 1 x 1 cms. \r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal constituido por tejido adiposo maduro, cubierto por epitelio escamoso.\r\n\r\n\r\n\r\n', '-LIPOMA, región perianal izquierda\r\n\r\n', '', ''),
	(2391, 'Q2203-3855', 'Q', '1042587886', 'JEINER LUIS MORENO JIMENEZ', '3246087122', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar, de forma alargada, que mide 7 x 1 cms. la serosa es de color verdoso. Al corte salida de abundante material biliar, la mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2392, 'Q2203-3856', 'Q', '1043977403', 'JUANA DE DIOS PEREZ ESCUDERO', '3015400790', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-22', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. la serosa es congestiva de color blanquecino. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n\r\n', '', ''),
	(2393, 'Q2203-3857', 'Q', '1043985513', 'JOHAN SUAREZ MEJIA', '3000', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-03-18', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Testículo izquierdo" se recibe un testículo, epidídimo y elementos del cordón. El testículo mide 3.2 x 2 x 1.5 cms. de color violáceo. Al corte una superficie granular de aspecto hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Testículo y epidídimo con áreas extensas de necrosis hemorrágica.\r\n\r\n\r\n\r\n', '-TESTÍCULO IZQUIERDO Y EPIDÍDIMO CON ÁREAS EXTENSAS DE NECROSIS HEMORRÁGICA POR TORCIÓN\r\n\r\n ', '', ''),
	(2394, 'Q2203-3858', 'Q', '11296616', 'ARNULFO NAVARRETE BARRETO', '3114152122', 'M', '68', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-22', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 y 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan mucosa antral cuya lámina propia está densamente infiltrada por linfocitos, plasmocitos, hay focos de metaplasia intestinal completa y atípias de leve a moderadas del epitelio glandular.\r\nLos cortes B revelan mucosa gástrica oxintica con inflamación crónica severa y focos de metaplasia intestinal completa.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA SEVERA CON FOCOS DE METAPLASIA INTESTINAL COMPLETA Y ATÍPIAS LEVE A MODERADAS DE EPITELIO GLANDULAR\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-MUCOSA GÁSTRICA OXÍNTICA CON INFLAMACIÓN CRÓNICA SEVERA Y FOCOS DE METAPLASIA INTESTINAL COMPLETA\r\n', '', ''),
	(2395, 'Q2203-3859', 'Q', '9268842', 'VICTOR ESCANDON SUAREZ', '300', 'M', '52', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', '', NULL, '2022-03-22', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n\r\n', '', ''),
	(2396, 'Q2203-3860', 'Q', '45478292', 'NELLYS DEL CARMEN IGLESIAS CABARCAS', '3116973160', 'F', '55', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-22', '2022-03-17', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico cuya lámina propia es ligeramente edematosa y está infiltrada por linfocitos y plasmocitos en moderada cantidad y PMN neutrófilos en poca cantidad. Hay presencia de acúmulos linfoides, se observa H.pylori en poca cantidad en la luz de algunas glándulas. No se observa atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE', '', ''),
	(2397, 'Q2203-3861', 'Q', '45507242', 'SILVIA FERNANDEZ RAMIREZ', '00', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-03-28', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 8 x 2.8 cms. la serosa es de color pardo oscuro, las paredes están engrosadas. Al corte la presencia de tres cálculos de color amarillento, el mayor promedia 1 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2398, 'Q2203-3862', 'Q', '1007960844', 'ANSHULI PADILLA NAVARRO', '00', 'F', '20', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2022-03-22', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben fragmentos de tejido de color oscuro de aspecto hemorrágico que juntos promedian 3.5 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-RESTOS OVULARES\r\n\r\n', '', ''),
	(2399, 'Q2203-3863', 'Q', '33122563', 'EMILIA ISABEL SILVA DE CARDENAS', '000', 'F', '75', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-03-22', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar de forma piriforme que mide 8 x 3.5 cms. Al corte salida de material biliar, la mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n\r\n', '', ''),
	(2400, 'Q2203-3864', 'Q', 'PE823085403091994', 'ROSANA ANDREINA PEREZ RODRIGUEZ', '000', 'F', '27', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2022-03-22', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Restos ovulares" se reciben fragmentos de tejido de color oscuro de aspecto hemorrágico que promedian 2.5 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'Tejido placentario compuesto por vellosidades edematosas tapizadas por cito y sinciciotrofoblásto sin alteraciones.\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-RESTOS OVULARES\r\n\r\n', '', ''),
	(2401, 'Q2203-3865', 'Q', '32710969', 'MERIS MEZA ROJAS', '000', 'F', '55', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-03-22', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 2 cms. la serosa es de color verdoso. Al corte las paredes están engrosadas y la presencia de cálculos de color amarillento el mayor de 1 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2402, 'Q2203-3866', 'Q', '1047501788', 'DIEGO CAMILO ESPEJO GOMEZ', '3024291906', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-22', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar de forma piriforme que mide 9 x 3 cms. Al corte salida de abundante material biliar y la presencia de diminutos cálculos de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2403, 'Q2203-3867', 'Q', '23136966', 'MARELYS DEL CARMEN VEGA GONGORA', '000', 'F', '53', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-03-22', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar de forma alargada que mide 9.7 x 2.5 cms. Al corte las paredes están engrosadas y la presencia de diminutos cálculos de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n-COLESTEROLOSIS\r\n\r\n', '', ''),
	(2404, 'Q2203-3868', 'Q', '45502529', 'YAMILETH SAYAS CONTRERAS', '000', 'F', '49', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-03-22', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar de forma alargada que mide 11 x 3 cms.  Al corte salida de material biliar y la presencia de múltiples cálculos de color amarillento, forma piramidal, las paredes están ligeramente engrosadas y la mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\nAcompañado a esto, y sin rotular, se recibe un fragmento de tejido de forma irregular  de color gris que mide 1 x 0.8 cms. Al corte salida de un cálculo de color amarillento. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(2405, 'Q2203-3869', 'Q', '45691459', 'BELQUIS PATRICIA GUERRA VILLAMIL', '000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-04-04', '2022-03-18', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 8 x 3 cms. la serosa es de color gris. Al corte la presencia de múltiples cálculos de color amarillento que promedian 0.3 cms. Las paredes están engrosadas y la mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2406, 'Q2203-3870', 'Q', '9090869', 'HECTOR ENRIQUE RIVERA HERRERA', '00', 'M', '67', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'DOctor ALEJANDRO VARGAS GENES', NULL, '2022-03-29', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Biopsia de lesión tumoral del bronquio principal derecho" se reciben 3 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento, se rotula A.\r\n2. "Biopsia de lesión tumoral del bronquio principal derecho" se reciben 3.2 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento, se rotula B.\r\n3. "Biopsia de lesión tumoral del bronquio principal derecho" un diminuto fragmento de tejido de forma irregular d ecolor pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n', 'El extendido rotulado A es acelular.\r\nEl extendido rotulado B muestra escasas células de tamaño mediano con núcleos moderadamente pleomórficos, hipercromáticos y citoplasma acidofilico que se disponen individualmente y en pequeños grupos. Estos cambios son altamente sugestivos pero no concluyentes de un PROCESO NEOPLÁSICO MALIGNO.\r\nLos cortes rotulados C muestran pared bronquial tapizada por epitelio respiratorio que reposa en una lámina propia edematosa, densamente infiltrada por linfocitos, histiocitos y neutrófilos. No se observan cambios neoplásicos.\r\n\r\n\r\n', '1.Citología de lavado bronquial del bronquio principal derecho:\r\n-EXTENDIDO ACELULAR\r\n2.Citología de lavado bronquial del bronquio principal derecho:\r\n-VÉASE DESCRIPCIÓN MICROSCÓPICA\r\n3.Biopsia de lesión en bronquio principal derecho:\r\n-FRAGMENTO DE PARED BRONQUIAL CON INFLAMACIÓN AGUDA Y CRÓNICA\r\n', '', ''),
	(2407, 'Q2203-3871', 'Q', '88157067', 'LEONARDO ENRIQUE MORENO MEDINA', '3167409058', 'M', '50', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n\r\n', '', ''),
	(2408, 'Q2203-3872', 'Q', '22766801', 'DORIS MARIA VILORIA DE CORREA', '000', 'F', '82', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe una elipse de piel de color pardo claro y consistencia elástica que mide 0.8 x 0.6 cms. en la superficie externa se destaca una lesión sobreelevada e hipopigmentada que mide 0.7 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuyo dermis se destaca una proliferación de células névicas que se disponen en nidos sólidos y cordones. No hay actividad de unión. Las líneas de resección están libres de lesión.\r\n\r\n\r\n\r\n', ' Resección de lesión en región interciliar:\r\n-NEVO MELANOCITICO INTRADÉRMICO\r\n-LÍNEAS DE RESECCIÓN LIBRES DE LESIÓN\r\n\r\n', '', ''),
	(2409, 'Q2203-3873', 'Q', '21225312', 'YOLANDA SANCHEZ RODRIGUEZ', '3234881282', 'F', '72', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Pólipo de colon izquierdo" múltiples diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de foliculos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', '1.Biopsia endsocópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n2.Biopsia endsocópica de colon izquierdo:\r\n-ADENOMA TUBULAR\r\n\r\n', '', ''),
	(2410, 'Q2203-3874', 'Q', '1043305149', 'JOSWAR GOMEZ TORRES', '3017145231', 'M', '13', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-03-23', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado con su nombre, se recibe un fragmento de piel de forma irregular de color pardo claro y consistencia elástica que mide 1.4 x 1.2 cms. en sus mayores dimensiones, la superficie externa es irregular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por epitelio escamoso dispuesto en un patrón papilomatoso, con marcada hiperqueratosis superficial e hipergranulosis.\r\n\r\n\r\n\r\n', ' Resección de lesión en codo izquierdo:\r\n-VERRUGA VULGAR\r\n\r\n', '', ''),
	(2411, 'Q2203-3875', 'Q', '1047422244', 'BRITANNY ALEJANDRA VERGARA MATAS', '3158735541', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.2 x 0.7 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n', '-APENDICE CECAL\r\n\r\n', '', ''),
	(2412, 'Q2203-3876', 'Q', '1044936707', 'BRAHIM DAVID CHIQUILLO MENDIVIL', '3012833643', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.5 x 1.8 x 1.3 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n\r\n\r\n', '', ''),
	(2413, 'Q2203-3877', 'Q', '1044612671', 'ARISTIDES SALAS TORRES', '6920984', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JUAN ALFONSO MACIA CARRASQUILLA', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Testículo derecho" se recibe un testículo con sus elementos del cordón que juntos miden 6 x .5 x 4 cms. La superficie externa es lisa y brillante de color pardo oscuro. Al corte se observa una superficie de color violáceo finamente granular, se logra identificar el testículo y mide 4.5 x 3 x 2.4 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran testículo inmaduro con áreas extensas de necrosis y hemorrágia.\r\n\r\n\r\n\r\n', ' Orquiectomía derecha:\r\n-TESTÍCULO INMADURO CON NECROSIS HEMORRÁGICA SECUNDARIA A TORSIÓN\r\n\r\n\r\n', '', ''),
	(2414, 'Q2203-3878', 'Q', '1143338267', 'YERENITH MARIA COTA MARTINEZ', '3106504503', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10.5 x 1.2 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2415, 'Q2203-3879', 'Q', '1047420003', 'KARINA PAOLA YANEZ VANEGAS', '000', 'F', '32', 'CLIN. SAN JOSE DE TORICES SAS', 'SALUD TOTAL', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 7 x 3 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está marcadamente engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de múltiples cálculos de color pardo amarillo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran pared de vesícula biliar con una reacción inflamatoria aguda y crónica, fibrosis e hipertrofia de la capa muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS AGUDA Y CRÓNICA CON COLELITIASIS\r\n\r\n\r\n', '', ''),
	(2416, 'Q2203-3880', 'Q', '1052946374', 'SHEILA ESTHER TARRIFA SALCEDO', '3045908888', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 0.7 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cambios inflamatorios.\r\n\r\n\r\n\r\n\r\n', '-APENDICE CECAL\r\n\r\n\r\n', '', ''),
	(2417, 'Q2203-3881', 'Q', '23104644', 'DELMA MARIA MUÑOZ TORRES', '000', 'F', '83', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-03-23', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de mama izquierda" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que juntos miden 4 x 3.5 x 2 cms. en sus mayores dimensiones. La superficie externa de las mismas es irregular y al corte se observa una superficie homogénea de color pardo claro, uno de los fragmentos está parcialmente cubierta pro piel que mide 1.8 x 0.8 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células pleomórficas de tamaño mediano y núcleos pleomórficos, hipercromáticos (3) con moderada actividad mitótica (2) que se disponen en nidos sólidos y cordones sin diferenciación tubular (3). El tumor infiltra un estroma fibroso con áreas extensas de necrosis. No se identifica infiltración linfovascular.\r\n\r\n\r\n\r\n', ' Biopsia de masa en mama izquierda:\r\n-CARCINOMA DUCTAL, TIPO NO ESPECIAL, POBREMENTE DIFERENCIADO, INFILTRANTE (GRADO II, NOTTINGHAM)\r\n\r\n', '', ''),
	(2418, 'Q2203-3882', 'Q', '73137463', 'GABRIEL BERRIO PEREZ', '000', 'M', '52', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-03-23', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'SIN MATERIAL DE FIJACIÓN, en recipientes separados y rotulados, se reciben:\r\n1. "Pleura parietal" un fragmento de tejido de forma irregular de color pardo rosado y consistencia elástica que mide 3.5 x 2 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Pleura parietal" un fragmento de tejido de forma irregular de color pardo rosado y consistencia elástica que mide 3.2 x 1.4 cms. en sus mayores dimensiones, la superficie externa está parcialmente cubierta por un material grumoso, friable de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B muestran fragmentos de pleura con un proceso inflamatorio agudo en la superficie interna y un proceso inflamatorio crónico de todo el espesor de la pared que se extiende hasta la grasa periférica. No se encuentran cambios neoplásicos.\r\n\r\n\r\n', '1.Biopsia de pleura parietal:*\r\n-PLEURITIS AGUDA Y CRÓNICA\r\n2.Biopsia de pleura parietal:*\r\n-PLEURITIS AGUDA Y CRÓNICA\r\n\r\n\r\n\r\n*Lado no especificado.\r\n', '', ''),
	(2419, 'Q2203-3883', 'Q', '45693045', 'ELAINE SALCEDO FLOREZ', '3118014860', 'F', '43', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2022-03-22', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero y trompas" se recibe un útero que pesa 227 gms. y mide 12 x 8.5 x 6 cms. El cérvix está tapizado por una mucosa de color pardo claro sin lesiones aparentes. El cuerpo está aumentado de tamaño y deformado. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizada por una mucosa gruesa de color rosado y el miometrio está ocupado por múltiples masas de color pardo claro y aspecto arremolinado, la mayor mide 4.5 cms. y la menor de unos pocos milímetros de localización intramural y subserosa. En el mismo recipiente y sin discriminar, se reciben dos trompas de Falopio con sus fimbrias que conservan la morfología habitual que miden 3.7 x 0.8 y 3 x 0.7 cms. La superficie externa de las mismas están cubiertas por una serosa lisa y brillante y al corte conserva la morfología habitual. Se toman cortes.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio está autólisado. Las masas miometriales descritas estan compuestas por fibras musculares, lisas distribuidas irregularmente.\r\nLas trompas de Falopio conservan la morfología habitual.\r\n\r\n\r\n\r\n', ' Histerectomía abdominal total con salpingectomía bilateral:\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMA INTRAMURAL Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n\r\n ', '', ''),
	(2420, 'Q2203-3884', 'Q', '45421944', 'LENIS DEL SOCORRO PAREDES DE GONZALEZ', '000', 'F', '71', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-04-29', '2022-03-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Trucut de seno izquierdo" se reciben cinco fragmentos cilíndricos de tejido de color pardo claro y consistencia blanda, que juntos promedian 1.8 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células con núcleos pleomórficos, hipercromáticos (3) con escasa actividad mitótica (1) que se disponen en nidos sólidos, cordones y formando estructuras glanduliformes (2) que infiltran el estoma. El tumor compromete los 5 cilíndros enviados. No se identifica infiltración linfovascular.\r\n\r\n\r\n\r\n', ' Biopsia con trucut de mama izquierda:\r\n-CARCINOMA DUCTAL, TIPO NO ESPECIAL, MODERADAMENTE DIFERENCIADO, INFILTRANTE (GRADO II, NOTTINGHAN)\r\n\r\n\r\n', '', 'NOTA: Se retiran 6 bloques de parafina por la señora ADRIANA PATRICIA GONZALEZ PAREDES CC. 45.543.168 (29 de abril de 2022)'),
	(2421, 'L2203-144', 'L', '45519123', 'HEIDY DEL CARMEN MONROY FUENTES', '00', 'F', '48', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "ACAF de seno izquierdo" se reciben 8 ml. de un líquido de color pardo oscuro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos contienen muy escasas células epiteliales sin alteraciones.\r\n\r\n\r\n\r\n', ' ACAF de mama izquierda.\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n\r\n', '', ''),
	(2422, 'L2203-145', 'L', '1137530577', 'EDWUIN ALTAMAR SALAS', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "liquido cefalorraquídeo" se reciben 4 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' Citología de LCR:\r\n-EXTENDIDOS ACELULARES\r\n\r\n\r\n', '', ''),
	(2423, 'Q2203-3885', 'Q', '49658045', 'CRUZANA VERENA GONZALEZ QUINTERO', '00', 'F', '51', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero" se recibe un cuerpo uterino que pesa 182 gms. y mide 8.5 x 7 x 5.5 cms. La superficie externa está cubierta por una serosa lisa y brillante y en ella se observan varias masas polipoide subserosas. Al corte, la cavidad endometrial está rechazada periféricamente por una masa esférica de color blanquecino y aspecto fasciculado de 4.5 cms. de diámetro. Se toman cortes y se rotulan A. \r\nSeparadamente, rotulado "Trompa izquierda" se recibe un fragmento de trompa de Falopio que mide 3.5 cms. de longitud. Se toman cortes y se rotulan B.\r\nUn tercer recipiente, rotulado "Trompa derecha" se recibe un fragmento de trompa de Falopio que mide 3.5 cms. de longitud. Se toman cortes y se rotulan C.\r\n\r\n', 'El endometrio presenta cambios atróficos por compresión. Las masas descritas están compuestas pro fibras musculares lisas dispuestas irregularmente. Las trompas son morfológicamente normales.\r\n\r\n\r\n\r\n', '1.Cuerpo uterino (182 gms.):\r\n-ENDOMETRIO ATRÓFICO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n2.TROMPAS DE FALOPIO\r\n', '', ''),
	(2424, 'Q2203-3886', 'Q', '1043980508', 'YASLEIDIS RODRIGUEZ RUIZ', '000', 'F', '33', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 0.8 cms., la superficie externa está cubierta por una serosa lisa y brillante de color pardo claro. Al corte se encuentra una luz ligeramente dilatada que contiene material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(2425, 'Q2203-3887', 'Q', '1043982508', 'GERMAN DARIO PINILLA TEJEDA', '3022305078', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Lesión de tejidos blandos en región torácica posterior" se reciben varios fragmentos de tejido de forma irregular de color blanquecino y consistencia friable cuyos diámetros oscilan entre pocos milímetros y 2.2 cms. entre estos se logra identifica un tejido con aspecto de piel que mide 2 x 0.5 cms Se toman cortes.\r\n\r\n\r\n\r\n', 'El espécimen está compuesto en su mayoría por una pared fibrosa que tiene una reacción inflamatoria aguda y crónica con formación de granulomas a cuerpo extraño. Hay fragmentos sueltos de epitelio escamoso. No hay cambios neoplásicos.\r\nEl cuadro histológico es sugestivo de un QUÍSTE QUERATINOSO ROTO.\r\n\r\n\r\n\r\n', ' Resección de lesión en espalda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(2426, 'Q2203-3888', 'Q', '1052990056', 'ANGELICA MARIA PUELLO GUERRERO', '3208770085', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 0.8 cms., en sus mayores dimensiones, la superficie externa está cubierta por una serosa de color pardo claro con trama vascular. Al corte se encuentra una luz ligeramente dilatada que contiene material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(2427, 'Q2203-3889', 'Q', '1047401146', 'LINET NUÑEZ INFANZON', '000', 'F', '33', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se encuentran masas de epitelio escamoso con diferenciación central hacía cuerpos acidofilicos (cuerpos de molusco).\r\n\r\n\r\n\r\n\r\n', ' Resección de lesión en vulva:\r\n-MOLUSCO CONTAGIOSO\r\n\r\n', '', ''),
	(2428, 'Q2203-3890', 'Q', '1041989839', 'LUZ DEL SOL ZUÑIGA QUIÑONES', '320597818', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 0.6 cms., en sus mayores dimensiones, la superficie externa está cubierta por una serosa de color pardo claro con trama vascular. Al corte se encuentra una luz ligeramente dilatada que contiene material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2429, 'Q2203-3891', 'Q', '1143337008', 'LORENA MILENA PADILLA VISBAL', '3008462772', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que en que mide 2.5 cms. compuesto por múltiples lóbulos que al corte muestran una superficie homogénea de color pardo claro.  Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(2430, 'Q2203-3892', 'Q', '1031134033', 'CRISTIAN CAMILO FABRA CASTRO', '3225954630', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-30', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1.8 cms., en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro y en la base se encuentra una zona de dilatación. Al corte se encuentra una luz marcadamente especialmente hacia la base en la que se encuentra un fecalito de 1 cm. de diámetro, que obstruye la luz en ese sitio.  Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya luz se encuentra marcadamente dilatada con aplanamiento de la mucosa. No se encuentran cambios inflamatorios.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2431, 'Q2203-3893', 'Q', '1047454136', 'JEAN CARLOS MORELOS ROSALES', '323791793', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2.8 x 1.5 x 1.2 cms. La superficie externa está cubierta por una mucosa ligeramente irregular. Al corte se encuentra una superficie de color pardo claro con un punteado de color pardo oscuro. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2.8 x 1.5 x 1.2 cms. La superficie externa está cubierta por una mucosa ligeramente irregular. Al corte se encuentra una superficie de color pardo claro con un punteado de color pardo oscuro. Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente, rotulado "Adenoides" contiene varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 5 ml. Se toma parte y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2432, 'Q2203-3894', 'Q', '1050723709', 'KENIA DAYAN VALLE OSPINO', '3107032211', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 0.8 cms., en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color pardo claro con vasos prominentes. Al corte se encuentra una luz ligeramente dilatada que contiene material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n\r\n', '', ''),
	(2433, 'Q2203-3895', 'Q', '1044612671', 'ARISTIDES SALAS TORRES', '6920984', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1.4 cms., en sus mayores dimensiones, la superficie externa está cubierta por una serosa irregular de color pardo claro con áreas de color pardo oscuro. Al corte se encuentra una luz dilatada que contiene material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2434, 'Q2203-3896', 'Q', '45525407', 'YAJAIRA MARISOL SAYAS MUÑOZ', '3106020682', 'F', '41', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor LUIS ALCAZAR', NULL, '2022-05-12', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor de glándula supra renal derecha" se recibe una masa de tejido ligeramente esférica que pesa 514 gms. y mide 12 x 10 x 6.5 cms. en sus mayores dimensiones. La superficie externa es irregular, esta parcialmente cubierta por una cápsula, la consistencia es blanda y es de color pardo claro con áreas amarillentas. Al corte se encuentra una superficie de color pardo rojizo con un área central de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno epitelial compuesto por células de citoplasma acidofilico, finamente granular y núcleos que en algunas áreas son redondos, regulares y en otras son grandes, pleomórficos, algunos vacuolados con nucleolo prominente. Hay moderada actividad mitótica con presencia ocasional de figuras anormales. Estas células se disponen en un patrón sólido que en algunas áreas recuerda la zona glomerular de la glándula suprarenal. El tumor infiltra la cápsula.\r\n\r\n\r\n', ' Resección de tumor de glándula suprarenal derecha:\r\n-CARCINOMA CORTICAL SUPRARENAL\r\n\r\n\r\n\r\n', '', 'Es imperativo practicar estudios de inmunohistoquímica para una mayor precisión diagnóstica.\r\n\r\n\r\nNOTA: Se retiran 6 bloques por la señora YAJAIRA SAYAS MUÑOZ CC. 45525407 (12 de mayo /2022)'),
	(2435, 'Q2203-3897', 'Q', '1047474757', 'JAROD ANDRES BELLO DE AVILA', '3163697760', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 2.8 x 1.8 x 1.4 cms. La superficie externa es ligeramente irregular y al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 2.8 x 1.8 x 1.4 cms. La superficie externa es ligeramente irregular y al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(2436, 'Q2203-3898', 'Q', '1201259139', 'JOHANA ARCELA CASTRO OROZCO', '3156024906', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una amígdala palatina que mide 3.2 x 1.8 x 1.4 cms. en sus mayores dimensiones. La superficie externa es irregular y al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una amígdala palatina que mide 3.2 x 1.8 x 1.4 cms. en sus mayores dimensiones. La superficie externa es irregular y al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente, rotulado "Adenoides" contiene un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 3 x 1.5 x 0.5 cms. en sus mayores dimensiones. Al corte se encuentra una superficie homogénea de color pardo claro. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2437, 'Q2203-3899', 'Q', '45470918', 'LUZ DARY VARGAS GUTIERREZ', '3116323422', 'F', '55', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2438, 'Q2203-3900', 'Q', '1042589264', 'JULIO CESAR MANJARREZ IZQUIERDO', '3135993149', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms., la superficie externa está cubierta por una serosa irregular de color pardo claro con vasos prominentes. Al corte se encuentra una luz ligeramente dilatada que contiene material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2439, 'Q2203-3901', 'Q', '1137528760', 'ANDRES FELIPE ROCHA LANS', '3243361961', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 1.2 cms., en sus mayores dimensiones, la superficie externa está cubierta por una serosa irregular con membrana de aspecto fibrinopurulento. Al corte se encuentra una luz dilatada que contiene material grumoso de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2440, 'Q2203-3902', 'Q', '1103761816', 'JESUS ANDRES REVOLLO GUERRO', '3045755485', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora JESSICA TIPON GALVIS', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Lesión en labio inferior" se recibe un fragmento de tejido de aspecto polipoide que mide 0.6 cms. en sus mayores dimensiones, la superficie externa es de aspecto translúcido y al corte se encuentra una cavidad que contiene un material viscoso de color cetrino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa labial en la que se identifica una cavidad sin revestimiento epitelial que contiene células epiteliales, mucinosas, sueltas, neutrófilos y macrófagos. En la periferia hay glándulas salivares nerviosas sin alteraciones.\r\n\r\n\r\n\r\n ', ' Resección de lesión en labio inferior.\r\n-MUCOCELE\r\n\r\n', '', ''),
	(2441, 'Q2203-3903', 'Q', '1052985890', 'LUIS EDUARDO GUERRA ROJAS', '3108143118', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1.4 cms., en sus mayores dimensiones, la superficie es ligeramente irregular de color pardo claro con áreas de color pardo oscuro y al corte se encuentra una luz dilatada que contiene material grumoso de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2442, 'Q2203-3904', 'Q', '71905036', 'JESUS OSVAL MONSALVE SIERRA', '3167826654', 'M', '57', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Cuerpo" se reciben tres minúsculos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.1 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica oxíntica sin alteraciones.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2443, 'Q2203-3905', 'Q', '23048168', 'DORIS ISABEL PINZON NAVARRO', '3183775952', 'F', '69', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-25', '2022-03-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2444, 'Q2203-3906', 'Q', '73073881', 'OSCAR PEÑUELA MONTOYA', '000', 'M', '67', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898241', '69000', 'Doctor JOSE RODRIGUEZ BLANCO', NULL, '2022-04-06', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Líquido pleural" 10 ml. de un líquido de color pardo oscuro de aspecto gelatinoso. \r\n2. "Segmento pulmonar" segmento de lóbulo pulmonar que mide 7 x 3 x 1.3 cms. la superficie externa es de color gris y alternan con múltiples formaciones nodulares, blanquecinas. Al corte múltiples lesiones nodulares, blanquecinas, que promedian 1 y 0.3 cms. Se toman cortes y se rotulan A.\r\n3. "Pleura parietal" dos fragmentos de tejido de forma irregular de forma alargada de color amarillento y consistencia firme, el mayor mide 2 x 1 cms. y el menor de 1 x 1 cms. Al corte una superficie blanquecina. Se toman cortes y se rotulan B.\r\n\r\n', 'Los extendidos son positivos para células malignas.\r\nLos cortes revelan pulmón infiltrado por un tumor epitelial maligno constituido por células de núcleos vacuolados, nucleolos prominentes, que se disponen en un patrón sólido, en otras áreas hay nidos de células que muestran más hipercromátismo y pleomorfismo nuclear, hay abundantes figuras de mitosis. La pleura parietal está infiltrada por la misma lesión.\r\n\r\n', '1.Biopsia de lesión pulmonar lóbulo inferior derecho:\r\n-CARCINOMA MAL DIFERENCIADO\r\n2.Biopsia de lesión pleura parietal:\r\n-CARCINOMA MAL DIFERENCIADO\r\n3.Citología de líquido pleural:\r\n-POSITIVO PARA CÉLULAS MALIGNAS\r\n', '', ''),
	(2445, 'Q2203-3907', 'Q', '1143358362', 'TRIANA CAROLINA CASTRO MARTINEZ', '3113887066', 'F', '30', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2446, 'Q2203-3908', 'Q', '73195582', 'MILTON RUSSI QUINTERO', '3052134682', 'M', '39', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA', '', ''),
	(2447, 'Q2203-3909', 'Q', '23236923', 'BERTA CECILIA MURILLO DE OROZCO', '000', 'F', '86', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-04-06', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Trucut de seno izquierdo" se reciben seis fragmentos de tejido de forma cilíndrica que promedian 2 cms. de color blanquecino, consistencia elástica. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido mamario con un tumor epitelial maligno constituido en su mayoría por nidos y cordones de células de núcleos que muestran pleomorfismo nuclear, hipercromatismo, hay figuras de mitosis atípicas. La lesión está presente en todos los cilíndros estudiados. No se observó invasión linfovascular ni perineural.\r\n\r\n\r\n\r\n', ' Trucut de mama izquierda:\r\n-CARCINOMA DUCTAL INFILTRANTE TIPO NO ESPECIAL POBREMENTE DIFERENCIADO GRADO 3, NOTTINGHAM\r\n-NO SE OBSERVÓ INVASIÓN LINFOVASCULAR EN LA MUESTRA ENVIADA.\r\n\r\n\r\nNOTA: Se retiran 6 bloques por la señora MARIA MATTOS OROZCO CC. 33.262.769 (6 de abril de 2022)', '', ''),
	(2448, 'Q2203-3910', 'Q', '9087975', 'AROLDO ROMAN PORRAS', '3145961257', 'M', '68', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2449, 'Q2203-3911', 'Q', '73185363', 'ROBERTO FABIO GONZALEZ THERAN', '3008341247', 'M', '40', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 y  0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n', '', ''),
	(2450, 'Q2203-3912', 'Q', '1128057439', 'JORGE DAVID TUÑON VILLAMIL', '3013678776', 'M', '34', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2451, 'Q2203-3913', 'Q', '1047435219', 'KATY ISABEL ALGARIN BUSTOS', '00', 'F', '31', 'PARTICULAR', '', '898201', '30215', 'Doctor ORLANDO BORRE ARRIETA', NULL, '2022-04-01', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cono LEEP" sin reparo, se recibe un cono que mide 2 x 1.5 cms. Se lámina e incluye en su totalidad, se rotula A.\r\n2. "Legrado endocervical" varios fragmentos de tejido de color pardo oscuro y consistencia friable que promedian 2 ml. Se toa todo y se rotulan B.\r\n\r\n\r\n', 'Los múltiples cortes revelan cérvix tapizado por epitelio escamoso con focos de una lesión intraepitelial de alto grado con focos de extensión glandular y cambios coilociticos asociados. El vértice está libre de lesión. \r\nEl endocervix está representando por glándulas de tipo endocervical sin cambios y la presencia de neutrófilos en cantidad moderada.\r\n\r\n\r\n', '1.Cono LEEP:\r\n-LIE DE ALTO GRADO NIC III CON EXTENSIÓN GLANDULAR CON CAMBIOS COILOCITICOS\r\n-BORDES DE RESECCIÓN LIBRES DE LESIÓN\r\n2.Legrado endocervical:\r\n-ENDOCERVICITIS AGUDA\r\n\r\n', '', ''),
	(2452, 'Q2203-3914', 'Q', '1100689970', 'CINTHIA CAROLINA BENITEZ SANTOS', '000', 'F', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mioma" se recibe una masa de tejido de forma ovoidea de color blanquecino que mide 3.5 x 3 x 2.5 cms. Al corte una superficie blanquecina, multinodular. Se  toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n\r\n', ' Miomectomía:\r\n-LEIOMIOMA\r\n\r\n', '', ''),
	(2453, 'Q2203-3915', 'Q', '6810552', 'JORGE ELIECER DE LA ESPRIELLA JIMENEZ', '000', 'M', '74', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-03-28', '2022-03-25', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 4 x 2 cms. la serosa es de color pardo claro. Al corte las paredes están engrosadas, la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa es atrófica y esta infiltrada por linfocitos y plasmocitos, hay hipertrofia de la capa muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n\r\n', '', ''),
	(2454, 'Q2203-3916', 'Q', '45692739', 'ESTELLA GARCES HERRERA', '00', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898241', '69000', 'Doctor EDGARDO DURAN GONZALEZ', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Útero" se recibe un útero que pesa 307 gms. y mide 12 x 8 x 6 cms. aumentado y deformado de tamaño tapizado por una serosa de color pardo claro. Al corte la cavidad endometrial está rechazada por la presencia de masas subserosas, submucosa e intramural. El espesor del miometrio es de 6 cms. en sus mayores dimensiones y presenta masas blanquecinas, arremolinadas la mayor de 6 x 6 cms. y la menor de 1 x 1 cms. \r\nPor separado y rotulado "Cuello de útero" se recibe cuello uterino que mide 4.5 x 3 x 4 cms. tapizado por una mucosa de color blanquecino con orificio transversal. Al corte el canal endocervical es permeable. \r\nAcompañado a esto rotulado "Trompa derecha" segmento de trompa de Falopio que mide 4 cms. y muestra la estructura usual. Se toman cortes.\r\n\r\n', 'Cuerpo uterino cuyo endometrio muestra cambios de autolisis, las masas descritas a nivel submucoso e intramural corresponden a leiomiomas. El cérvix recibido por separado está tapizado por epitelio escamoso que descansan en un estroma levemente infiltrado por linfocitos. La trompa de Falopio derecha no muestran cambios.\r\n\r\n\r\n\r\n', '1.Cuerpo uterino con:\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS\r\n2.Cervix:\r\n-CERVICITIS CRÓNICA LEVE\r\n3.TROMPA DE FALOPIO DERECHA SIN CAMBIOS', '', ''),
	(2455, 'Q2203-3917', 'Q', '45429127', 'ALINA DEL CARMEN GARCIA DE RAMIREZ', '000', 'F', '73', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-03-28', '2022-03-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Trucut de seno izquierdo" se reciben siete fragmentos cilíndricos de tejido de color blanco grisáceo de consistencia blanda que promedian una longitud de 1.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Tejido mamario que muestra un tumor epitelial maligno constituido por células de núcleos hipercromáticos, pleomórficos, algunos con nucleolos prominentes dispuestos en pequeños nidos y cordones, hay figuras de mitosis atípicas. La lesión está presente en cuatro de los siete cilíndros estudiados con un compromiso del 90%.\r\nEn la muestra enviada no se observó invasión perineural ni linfovascular.\r\n\r\n ', ' Biopsia trucut de mama izquierda:\r\n-CARCINOMA DUCTAL INFILTRANTE TIPO NO ESPECIAL MODERADAMENTE DIFERENCIADO GRADO 2 NOTTINGHAM \r\n\r\n\r\n ', '', ''),
	(2456, 'Q2203-3918', 'Q', '1201237818', 'NEIDER ENRIQUE MERCADO RODRIGUEZ', '3000', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-03-30', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 10 x 0.8 cms. La superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pare esta engrosada y la luz ligeramente dilatada que contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2457, 'Q2203-3919', 'Q', 'VEN7464991', 'ROGER ANTONIO HERRERA FINOL', '3128424179', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'Doctor WILLIAN URIBE LUNA', NULL, '2022-04-06', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Tibia derecha" se reciben múltiples diminutos fragmentos de tejido de forma irregular, de color pardo claro y consistencia firme que promedian 0.4 cms. en su mayor dimensión. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran espículas óseas inviables que reposan en un tejido fibroso infiltrado por linfocitos y neutrófilos.\r\n\r\n\r\n\r\n', ' Biopsia de tibia derecha:\r\n-COMPATIBLE CON OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(2458, 'Q2203-3920', 'Q', '1048443682', 'MATEO MEZA GOMEZ', '3135175802', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-03-30', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Estómago" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. en su mayor dimensión. Se toma todo y se rotula C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro sin cambios.\r\nLos cortes rotulados B muestran mucosa antro-corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal que conserva la morfología habitual. No se observan parásitos, granulomas ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS\r\n', '', ''),
	(2459, 'Q2203-3921', 'Q', '1137532666', 'ORIANA MARCELA JULIO VILLALBA', '3225953799', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020205', '74106', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-03-30', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2.8 x 2 x 1.5 cms. La superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2. "Amígdala izquierda" una amígdala palatina que mide 2.8 x 2 x 1.5 cms. La superficie externa es irregular y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n3. "Adenoides" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 3.5 x 1.5 x 1.1 cms. Al corte una superficie homogénea de color pardo claro. Se toman cortes y se rotulan C.\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)', '', ''),
	(2460, 'Q2203-3922', 'Q', '1047452566', 'KELLY DEL CARMEN MATUTE PEREZ', '000', 'F', '29', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor RODOLFO VALENCIA', NULL, '2022-03-30', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.6 x 0.6 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya mucosa está preservada. No se observa infiltrado inflamatorio agudo en la capa muscular. Hay marcada congestión y dilatación de los vasos de la subserosa y una reacción inflamatoria aguda mediado por neutrófilos que compromete la serosa y la subserosa.\r\n\r\n\r\n\r\n', '-PERIAPENDICITIS AGUDA\r\n\r\n', '', ''),
	(2461, 'Q2203-3923', 'Q', '73166792', 'EDWIN BALDIRIS SAEZ', '3013497777', 'M', '47', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ELKIN ROMERO CAMARGO', NULL, '2022-03-30', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2462, 'Q2203-3924', 'Q', '1049826919', 'MARTHA LUCIA IRIARTE BUELVAS', '3234338792', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-04', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Cuña de ovario derecho" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.3 x 0.8 cms. Sé lámina e incluye en su totalidad.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran un fragmento de tejido ovárico en el que se observa una pequeña cavidad tapizada por un epitelio plano simple. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de ovario derecho:\r\n-QUÍSTE SIMPLE\r\n\r\n', '', ''),
	(2463, 'Q2203-3925', 'Q', '1047379612', 'JIMMY CARRILLO PALOMINO', '3016874119', 'M', '35', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-03-30', '2022-03-29', 'VIRNA CARABALLO OSORIO', 'Rotulado "Omento" se recibe un fragmento de epiplón de color pardo amarillento y consistencia elástica que mide 14 x 14.5 cms. en sus mayores dimensiones, la superficie externa es irregular y en ellas se destacan algunas bandas de aspecto fibroso. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran omento con marcada dilatación y congestión de los vasos sanguíneos. Hay áreas extensas de fibrosis. No se observan cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Herniorrafia inguinal derecha:\r\n-FRAGMENTO DE OMENTO CON ÁREAS EXTENSAS DE FIBROSIS', '', ''),
	(2464, 'Q2203-3926', 'Q', '15015854', 'RAMIRO MUENTES ALVAREZ', '000', 'M', '75', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-04-11', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe un punch de piel que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel (fragmentada) tapizada por epitelio escamoso con focos de hiperplasia en el que se observan perdida de la polaridad celular y atipias de las células del epitelio. El dermis papilar muestra cambios marcados de elastosis solar y un infiltrado mononuclear moderado.\r\n\r\n\r\n\r\n ', ' Biopsia de lesión en región retroauricular izquierda:\r\n-QUERATOSIS SOLAR\r\n\r\n', '', ''),
	(2465, 'Q2203-3927', 'Q', '25869673', 'XENIA MARIA MARTELOS BURGOS', '000', 'F', '62', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor FULVIO CORREA VITOLA', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Cápsula de mama izquierda" se recibe una formación sacular que mide 9 x 6 cms. de aspecto membranoso de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido fibroadiposo con áreas colagenizadas, algunas congestivas con infiltrado inflamatorio crónico, áreas de metaplasia sinovial.\r\nNo se observan cambios neoplásicos.\r\n\r\n\r\n\r\n', '-CÁPSULA DE PRÓTESIS MAMARIA CON METAPLASIA SINOVIAL\r\n\r\n', '', ''),
	(2466, 'Q2203-3928', 'Q', '73100489', 'PEDRO GANDARA CHAVEZ', '00', 'M', '59', 'GASTROPACK SAS', 'LIBERTY SEGUROS S.A.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n\r\n', '', ''),
	(2467, 'Q2203-3929', 'Q', '320842224', 'NELLY CRISTANCHO DE SANCHEZ', '3206426961', 'F', '86', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Cuerpo" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Cuerpo gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve. No se identifica H.pylori, metaplasia, atrófia  ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n\r\n', '', ''),
	(2468, 'Q2203-3930', 'Q', '1201283358', 'HERNAN DAVID LOPEZ ZUÑIGA', '3244056736', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Linfangioma de cuello" se recibe un fragmento de tejido de forma irregular  de color pardo claro y consistencia elástica que mide 8 x 2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tejido blando que muestra espacios dilatados revestidos por endotelio aplanado, el estroma presenta linfocitos.\r\n\r\n\r\n\r\n', ' Resección de masa en cuello lado derecho:\r\n-LINFANGIOMA QUÍSTICO\r\n\r\n', '', ''),
	(2469, 'Q2203-3931', 'Q', '1201271207', 'FERNANDA LUCIA HERNANDEZ TORRES', '3205992132', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-06', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Recto" se reciben un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que promedian 3 x 1.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan fragmento de tejido fibroso y muscular liso, se observa además mínimo fragmento de mucosa colónica acompañado de tejido de granulación.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de recto:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2470, 'Q2203-3932', 'Q', '1041979611', 'DAVID ENRIQUE BALLESTAS MORALES', '3053035199', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama izquierda" masa de tejido de forma ovoide que mide 6 x 5 x 2 cms. de color blanco amarillento y consistencia elástica. Al corte una superficie lisa, blanquecina. Se toman cortes y se rotulan A.\r\n2. "Mama derecha" masa de tejido de forma ovoide que mide 5.5 x 3 x 2.5 cms. de color blanco amarillento y consistencia elástica. Al corte una superficie lisa, blanquecina. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A y B revelan tejido mamario que muestra escasos canalículos con hiperplasia ductal leve, el estroma colagenizado focalmente infiltrado por linfocitos.\r\n\r\n\r\n\r\n', '1.GINECOMASTIA, mama izquierda\r\n2.GINECOMASTIA, mama derecha\r\n', '', ''),
	(2471, 'Q2203-3933', 'Q', '1048467721', 'MATEO ANDRE ESCORCIA GAVIRIA', '3045644639', 'M', '1', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2022-04-18', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Resección de polidactilia pie derecho" se recibe una formación nodular de color blanquecino que mide 1.5 x 1 cms. de consistencia elástica cubierta por piel. Al corte una superficie lisa, blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por los tejidos blandos propios de un dedo con un núcleo cartilaginoso.\r\n\r\n\r\n\r\n\r\n', '-DEDO SUPERNUMERARIO, pie derecho\r\n\r\n', '', ''),
	(2472, 'Q2203-3934', 'Q', '73116817', 'FRANDI MANUEL MONTERROSA LOPEZ', '000', 'M', '56', 'CLIN. SAN JOSE DE TORICES SAS', '', '898201', '30215', 'Doctor ORLANDO COGOLLO', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 8 x 5 x 4 cms. tapizada parcialmente por una serosa de color pardo grisáceo bien vascularizada. Al corte hay salida de material biliar y la presencia de múltiples cálculos pequeños negruzcos, la pared es delgada y la mucosa conserva su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS\r\n\r\n', '', ''),
	(2473, 'Q2203-3935', 'Q', '45445574', 'HORTENCIA MORALES BALDIRIS', '000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Masa en región dorsal" se recibe una formación nodular que mide 1 x 1 cms. de color pardo oscuro y consistencia friable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan estructura quística que contiene abundante queratina laminar.\r\n\r\n\r\n\r\n', '-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE, región dorsal\r\n\r\n', '', ''),
	(2474, 'Q2203-3936', 'Q', '45557126', 'OLIVIA DEL CARMEN TRESPALACIOS HERMOCILLA', '000', 'F', '38', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora IRINA SEQUEDA LUJAN', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Ovario izquierdo + trompa izquierda" cinco fragmentos de tejido de forma irregular, el mayor mide 5 x 3.5 cms. de aspecto sacular, multilocular, de color blanquecino y consistencia elástica. Se toman cortes y se rotulan A.\r\nAcompañado a esto, se recibe un segmento de trompa de Falopio con su fimbria que mide 5 cms. Se toman cortes y se rotulan A.\r\n2. "Trompa derecha" un segmento de trompa de Falopio con su fimbria que mide 5 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan estructura quística que muestra papilas tapizadas por epitelio seroso con un componente estromal prominente.\r\nLas trompas muestran su estructura usual.\r\n\r\n\r\n\r\n', '1.CISTADENOFIBROMA SEROSO, ovario izquierdo\r\n2.TROMPA DE FALOPIO IZQUIERDA\r\n3.TROMPA DE FALOPIO DERECHA\r\n\r\n', '', ''),
	(2475, 'Q2203-3937', 'Q', '1047477648', 'JORGE LUIS RAAD GARCIA', '3112880832', 'M', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-04-01', '2022-03-31', 'OLIVA MARRUGO GRICE', 'Rotulado "Epiplón" se reciben dos segmentos de tejido adiposo, el mayor de los cuales mide 30 cms. y el menor de 20 cms. de color amarillento y consistencia elástica. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido adiposo maduro que muestra áreas de hemorrágia y congestión.\r\n\r\n\r\n\r\n', '-FRAGMENTOS DE TEJIDO ADIPOSO MADURO CON CONGESTIÓN Y HEMORRÁGIA\r\n\r\n\r\n', '', ''),
	(2476, 'Q2204-3938', 'Q', '30649402', 'ANA MARCELA ARTEAGA VALDELAMAR', '000', 'F', '59', 'PARTICULAR', 'C.', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 0.7 cms., la superficie externa está cubierta por una serosa lisa y brillante y al corte se encuentra una luz ligeramente dilatada que contiene un material de color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal cuya morfología está preservada. No se encuentran cambios inflamatorios.\r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2477, 'Q2204-3939', 'Q', '45518201', 'LUZNEY JULIO PEÑA', '000', 'F', '49', 'PARTICULAR', '', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2478, 'Q2204-3940', 'Q', '17822411', 'KATHY GONZALEZ VELASQUEZ', '000', 'F', '36', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de endometrio" se reciben múltiples fragmentos de tejido de forma irregular, de color pardo claro con áreas de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran endometrio compuesto por glándulas tubulares, tortuosas, algunas con irregularidades de orientación, forma y tamaño. Están tapizadas por epitelio cilíndrico seudoestratificado con vacuolización subnuclear incipiente. Reposan en un estroma edematoso con áreas compactas y presencia de vasos agrupados.\r\nLos hallazgos son compatibles con PÓLIPOS HIPERPLÁSICOS con cambios incipientes de secreción.\r\n\r\n\r\n', ' Biopsia de endometrio:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2479, 'Q2204-3941', 'Q', '26139082', 'AMALIA BARRIOS MEDRANO', '000', 'F', '85', 'ECOPETROL S.A', '', '898201', '30215', 'Doctora MARTHA PATRICIA VIVES GARCIA', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran pared vaginal cuyo epitelio está reemplazado en su mayor parte por un tejido de granulación con densa infiltración por linfocitos y células plasmáticas. El epitelio escamoso es muy delgado sin cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vagina:\r\n-COLPITIS CRÓNICA ULCERADA\r\n\r\n', '', ''),
	(2480, 'Q2204-3942', 'Q', '42475137', 'ALBA NAVARRO SANTIAGO', '000', 'F', '62', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen presenta cambios avanzados de autólisis por defecto de fijación.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n\r\nNOTA: Si se repite la toma de la muestra, se practicará el estudio sin costa adicional.\r\n\r\n\r\n', '', ''),
	(2481, 'Q2204-3943', 'Q', '1047409269', 'SHIRLYS HERNANDEZ GUEVARTA', '000', 'F', '34', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe una masa de tejido de forma irregular que mide 3 x 2.5 x 2 cms. en sus mayores dimensiones, la superficie externa es irregular de color pardo claro con áreas amarillentas, la consistencia es firme y al corte se encuentra una superficie sólida de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los múltiples cortes muestran tejido mamario cuya morfología está alterada por la presencia de estructuras quísticas de pequeño y mediado calibre, algunos tapizados por epitelio apocrino, que reposan en un estroma fibroescleroso. No se encuentran papilomas que expliquen la telorragia.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en mama izquierda:\r\n-CONDICIÓN FIBROQUÍSTICA\r\n\r\n', '', ''),
	(2482, 'Q2204-3944', 'Q', '1043653719', 'JESUS DAVID ROMERO PEÑARANDA', '3166504085', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n', '', ''),
	(2483, 'Q2204-3945', 'Q', '1044002792', 'SANTIAGO PEREA BRICEÑO', '3245011366', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quíste tirogloso" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia firme que mide 2.8 x 2 x 2 cms. en sus mayores dimensiones, la superficie externa es irregular y en ella se identifica un fragmento de hueso y al corte se encuentra una cavidad que contiene un material grumoso de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura compuesta por una cavidad tapizada por un epitelio cilíndrico que en la periferia tiene fragmentos de tejido tiroideo sin alteraciones. hay, además, un fragmento de cartílago hialino.\r\n\r\n\r\n\r\n', ' Resección de masa en región anterior del cuello:\r\n-QUÍSTE DEL CONDUCTO TIROGLOSO\r\n\r\n', '', ''),
	(2484, 'Q2204-3946', 'Q', '1137536622', 'JULIAN DAVID TOVAR CARDALES', '3215353914', 'M', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 2 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2485, 'Q2204-3947', 'Q', '1001977294', 'JHONATAN DAVID PICON CASTELLON', '000', 'M', '18', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.5 x 1 cms. La superficie externa está cubierta por una serosa de color pardo oscuro con vasos prominentes. Al corte se encuentra una luz dilatada que contiene un material de color oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2486, 'Q2204-3948', 'Q', '7952077', 'JESUS CAMPOS CAMPOS', '000', 'M', '65', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral compuesta por glándulas irregulares que reposan en una lámina propia fibrosa. Hay un denso infiltrado inflamatorio superficial mediado por linfocitos, células plasmáticas y neutrófilos. No se encuentran H.pylori ni cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-CAMBIOS COMPATIBLES CON ULCERA PÉPTICA\r\n\r\n', '', ''),
	(2487, 'Q2204-3949', 'Q', '66821709', 'YASMIN GARCIA CASTRO', '000', 'F', '51', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2488, 'Q2204-3950', 'Q', '42204346', 'ADELA DEL CARMEN BENAVIDES CARDENAS', '3014346536', 'F', '62', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-04', '2022-04-02', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2489, 'Q2204-3951', 'Q', '41420364', 'ORIETTA DEL SOCORRO COVO TORRES', '000', 'F', '73', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-04-11', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos, plasmocitos en poca cantidad. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2490, 'Q2204-3952', 'Q', '24432479', 'MARIA ELENA ZULUAGA BOTERO', '3207887185', 'F', '63', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2491, 'Q2204-3953', 'Q', '92256222', 'NICOLAYS PATERNINA MENDOZA', '318', 'M', '56', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA', '', ''),
	(2492, 'Q2204-3954', 'Q', '41720254', 'MARGARITA DANIES DE VERGARA', '6795237', 'F', '67', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipo de colon" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-ADENOMAs TUBULARES, FRAGMENTOS\r\n\r\n', '', ''),
	(2493, 'Q2204-3955', 'Q', '33152651', 'LUZ CENIT SUAREZ GUTIERREZ', '00', 'F', '75', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2494, 'Q2204-3956', 'Q', '45754327', 'LUDIS DEL CARMEN TABORDA ZAPATA', '6632694', 'F', '51', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', '  Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2495, 'Q2204-3957', 'Q', '40991939', 'ZENITH ZABELETA VEGA', '00', 'F', '41', 'PARTICULAR', '', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-04-19', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Glándula tiroidea" se recibe tiroides bilobulado, el lóbulo derecho viene con un reparo que dice "1/3 superior de margen posterior" la superficie externa es gris, consistencia elástica, el lóbulo derecho mide 3.3 x 1.2 cms. El istmo mide 1.5 x 1 cms. y el lóbulo izquierdo mide 3.5 x 2.3 cms. en sus mayores dimensiones. Al corte del lóbulo derecho en su polo inferior se observa una formación nodular de color blanquecino que mide 1 x 0.5 x 0.5 cms. el resto del tiroides de color pardo oscuro y aspecto carnoso. Se toman cortes de dicha lesión y se rotulan A.\r\nEl lóbulo izquierdo mide 3.7 x 2 cms. Al corte y haciendo cuerpo con el istmo se observa una formación nodular de consistencia firme, blanquecina, que mide 1 x 1 cms. Se toman cortes y se rotulan B.\r\nEn la parte superior del lóbulo izquierdo se observa una formación nodular de color oscuro, brillante. Se toman cortes y se rotulan C.\r\n\r\n', 'Los múltiples cortes rotulados A, B y C muestran lesiones nodulares compuestas por foliculos en diferentes fases de su desarrollo, están parcialmente rodeados por una cápsula fibrosa. Esta conserva su integridad, es decir, en ningún de los cortes se observó infiltración de la misma, los nódulos descritos reposan en un trasfondo de tejido tiroideo con foliculos dilatados con abundante contenido de coloide.\r\n\r\n\r\n', ' Tiroidectomía total:\r\n-HIPERPLASIA NODULAR\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\nNOTA: Caso visto en conjunto con los doctores Oliva Marrugo y José Caraballo y hubo consenso.\r\n', '', ''),
	(2496, 'Q2204-3958', 'Q', '1142950741', 'YAHSHUA ANGULO CARMONA', '00', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color pardo rosado y consistencia elástica que mide el mayor 1.5 cms. y el menor de 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2497, 'Q2204-3959', 'Q', '1048610928', 'ENDER DAVID MARTINEZ MARRUGO', '3227366395', 'M', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" una masa de tejido de forma ovoidea que mide 2.5 x 1.8 x 1.2 cms. de color pardo rosado. Al corte una superficie de color rosado, multinodular. Se toman cortes y se rotulan A.\r\n2. "Amígdala derecha" una masa de tejido de forma ovoidea que mide 2.2 x 1.5 x 1 cms. de color pardo rosado. Al corte una superficie de color rosado, multinodular. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-AMIGDALITIS CRÓNICA\r\n\r\n', '', ''),
	(2498, 'Q2204-3960', 'Q', '1043998749', 'ASHLIE MICHELL OROZCO ZAMORA', '3004096285', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-11', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes A revelan epitelio escamoso sin alteraciones.\r\nLos cortes B revelan mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos que penetran el epitelio de algunas glándulas, hay presencia de foliculos linfoides H.pylori en la luz glandular. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes C revelan mucosa duodenal sin cambios.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE MUCOSA ESOFÁGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DUODENAL SIN CAMBIOS\r\n', '', ''),
	(2499, 'Q2204-3961', 'Q', '1142934029', 'MARIA JOSE PEREZ TORRES', '3145948503', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-04-19', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Piel de muslo derecho" un punch de piel de forma redondeada que mide 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Espalda" un punch de piel de forma redondeada que mide 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A y B revelan piel con leve hiperqueratosis, muy leve espongiosis con áreas focales de hipomelanosis de la capa basal y exocitosis de escasos linfocitos, el dermis papilar muestra un infiltrado perivascular superficial mediado por escasos linfocitos.\r\n\r\n\r\nCOMENTARIO: El cuadro arriba mencionado es compatible con una ptiriasis alba, se recomienda correlacionar con la clínica para una definición diagnóstica.\r\n\r\n', ' Biopsia de piel de muslo derecho y espalda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n', '', ''),
	(2500, 'Q2204-3962', 'Q', '1042595485', 'ANTHONY JOSE MERCADO MURILLO', '3043400428', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se recibe varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 2.5 cms. en su mayor dimensión. Se toma parte.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2501, 'Q2204-3963', 'Q', '1065007040', 'MARIA DEL CARMEN MEDRANO AVILEZ', '3207099892', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-11', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotula A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Duodeno" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A revelan mucosa esofágica sin alteraciones.\r\nLos cortes B revelan mucosa gástrica antral que muestra la estructura usual.\r\nLos cortes C revelan fragmento de mucosa duodenal con edema leve de la mucosa e infiltrada por linfocitos y plasmocitos.', '1.Biopsia endoscópica de esófago:\r\n-MUCOSA ESOFÁGICA SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago:\r\n-MUCOSA GÁSTRICA ANTRAL SIN ALTERACIONES\r\n3.Biopsia endoscópica de duodeno:\r\n-MUCOSA DE DUODENO CON INFLAMACIÓN CRÓNICA LEVE\r\n\r\n', '', ''),
	(2502, 'Q2204-3964', 'Q', '1142921027', 'BREYSON JOSE DIAZ CARABALLO', '000', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-04-11', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 x 1 cms. la serosa es de color gris. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n', '', ''),
	(2503, 'Q2204-3965', 'Q', '1104260553', 'IVAN DAVID ORTEGA VERGARA', '3126573623', 'M', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-11', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms.  Se toma todo y se rotulan A.\r\n2. "Estómago" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes A revelan fragmentos sueltos de epitelio escamoso hiperplásico.\r\nLos cortes B revelan antro gástrico cuya lámina propia  es edematosa y  está infiltrada por linfocitos y plasmocitos en cantidad moderada y neutrófilos en poca cantidad, hay presencia de H.pylori en la luz de algunas glándulas y acúmulos de linfocitos en la lámina propia. No se observa atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes C revelan fragmentos de mucosa duodenal sin alteraciones.\r\n\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO HIPERPLÁSICO\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n3.Biopsia endoscópica de duodeno:\r\n-FRAGMENTO DE MUCOSA DUODENAL SIN CAMBIOS\r\n', '', ''),
	(2504, 'Q2204-3966', 'Q', 'VEN3037', 'SEBASTIAN JOSE ANDARA ZAPATA', '3013393636', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Saco herniario, lado izquierdo" se recibe un fragmento de tejido fibroso, sacular, que mide 3  x 3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Fragmento de tejido fibroadiposo tapizado parcialmente por epitelio aplanado.\r\n\r\n\r\n\r\n', '-FRAGMENTO DE TEJIDO FIBROADIPOSO COMPATIBLE CON SACO HERNIARIO, lado izquierdo\r\n\r\n\r\n', '', ''),
	(2505, 'Q2204-3967', 'Q', '120122959', 'ESTIVEN DE JESUS GARCIA GARCIA', '3008515477', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa gástrica antral cuya lámina propia está infiltrada por linfocitos, plasmocitos y neutrófilos en abundante cantidad, hay acúmulos de linfocitos en la lámina propia y la presencia de H.pylori en poca cantidad en la luz de algunas glándulas. No se observa atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n', '', ''),
	(2506, 'Q2204-3968', 'Q', '1043645326', 'ALFONSO ELIAS TATIS BORJA', '3052237879', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-18', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Válvula ileocecal" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo y se rotulan A.\r\n2. "ileon terminal" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.4 cms. Se toma todo y se rotulan B.\r\n3. "Colon proximal" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo y se rotulan C.\r\n4. "Colon transverso" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que promedia 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan D.\r\n5. "Colon descendente" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedia 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan E.\r\n6. "Recto" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan F.', 'Rotulados "Válvula ileocecal" los cortes revelan fragmento de mucosa colónica con discreto aumento del componente mononuclear de la lámina propia, las glándulas conservan su aspecto tubular.\r\nLos rotulados B "ileon terminal" revelan mucosa de ileon que muestra acúmulos linfoides en la lámina propia ligera desorganización del componen glandular. No se observan granulomas ni otros cambios del epitelio glandular.\r\nLos cortes C revelan colon, en uno de los fragmentos se observa cambios con inflamación mononuclear pronunciado con alteración del componente glandular representado por infiltración linfocítica de las glándulas que muestran perdida del componente mucoso.\r\nCOMENTARIO: Los hallazgos sugieren una enfermedad inflamatoria intestinal, no es posible definir si se trata de una enfermedad de Cronh.\r\nLos cortes de D, E y F revelan mucosa de colon y recto con inflamación mononuclear leve.', '1.Biopsia endoscópica de válvula ileocecal:\r\n-FRAGMENTO DE MUCOSA COLÓNICA CON INFLAMACIÓN CRÓNICA LEVE\r\n2.Biopsia endoscópica de ileon terminal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n3.Biopsia endoscópica de colon proximal:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n4.Biopsia endoscópica de colon transverso:\r\n-FRAGMENTO DE MUCOSA COLÓNICA CON INFLAMACIÓN CRÓNICA\r\n5.Biopsia endoscópica de colon descendente:\r\n-FRAGMENTO DE MUCOSA COLONICA CON INFLAMACIÓN CRÓNICA LEVE\r\n6.Biopsia endoscópica de recto:\r\n-FRAGMENTO DE MUCOSA RECTAL CON INFLAMACIÓN CRÓNICA LEVE', '', ''),
	(2507, 'Q2204-3969', 'Q', '1067892649', 'MARIA MARGARITA SANPAYO TANDIOY', '000', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-04-06', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9 x 3 cms. la serosa es de color grisáceo. Al corte las paredes engrosadas y la mucosa conserva el aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar cuya mucosa está infiltrada por linfocitos, plasmocitos en cantidad moderada e histiocitos espumosos en abundante cantidad, hay hipertrofia de la capa muscular.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA\r\n-COLESTEROLOSIS\r\n\r\n', '', ''),
	(2508, 'Q2204-3970', 'Q', '1002250015', 'LUIS MIGUEL MORALES GALLEGO', '3002809308', 'M', '19', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-04-11', '2022-04-05', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 0.5 cms. la serosa es de color blanquecino. Al corte la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2509, 'Q2204-3971', 'Q', '30649402', 'ANA MARCELA ARTEAGA VALDELAMAR', '000', 'F', '59', 'PARTICULAR', 'C.', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Epiplón" se recibe un fragmento de epiplón de color pardo amarillento y consistencia elástica que mide 44 x 18 cms. en sus mayores dimensiones, la superficie externa es irregular y en ella se observa áreas de aspecto fibroso. Al corte se observa una superficie untuosa de color pardo amarillento, se observa una masa ovoide de color pardo claro y consistencia elástica que mide 0.6 cms. Se toma cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de epiplón en el que se observa un nódulo bien delimitado rodeado por una cápsula fibrosa que contiene estructuras que recuerdan fibras sobre un trasfondo de calcificación distrófica. En la periferia el tejido adiposo muestra una reacción inflamatoria mediada por linfocitos y células plasmáticas. No se encuentran cambios neoplásicos.\r\n\r\n\r\n ', ' Resección de segmento de epiplón:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2510, 'Q2204-3972', 'Q', '1016045986', 'LUZ ANGELA ORTIZ AMARIS', '000', 'F', '30', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-08', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2511, 'Q2204-3973', 'Q', '1002441742', 'OSCAR ALBERTO ROYET HERRERA', '000', 'M', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor WILMAR POLO VEGA', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Pilomatrixoma" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que mide 1.2 x 0.8 y 0.6 x 0.5 cms. en su mayor dimensión. Al corte se observa una superficie homogénea de color pardo claro. Se toman sendos cortes.\r\n\r\n\r\n\r\n', 'El espécimen presenta cambios de autolisis secundarios a defecto de fijación. El epitelio y los foliculos pilosos tienen una apariencia morfológicamente normal. El cuadro histológico es sugestivo pero por los cambios descritos, no concluyente de un PÓLIPO FIBROEPITELIAL.\r\n\r\n\r\n\r\n', ' Biopsia de lesión pediculada en región occipital:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2512, 'Q2204-3974', 'Q', '1201222674', 'GABRIELA IRIARTE FLOREZ', '3014209344', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-04-08', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Nevo melanocitico" se reciben dos diminutos fragmentos de tejido de forma irregular, color pardo claro y consistencia elástica que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se destaca una proliferación de células nevicas que se disponen en nidos sólidos y cordones. hay actividad de unión y compromiso de los márgenes profundos de resección en las 2 muestras.\r\n\r\n\r\n\r\n', ' Biopsia de piel de tercio proximal de brazo derecho:\r\n-NEVO MELANOCITICO COMPUESTO (2)\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2513, 'Q2204-3975', 'Q', 'VEN3969151', 'JEANMARIE NOEMY BRICEÑO ABREU', '30429020052', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-04-08', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.3 x 0.8 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2514, 'Q2204-3976', 'Q', 'VEN4078295', 'EZEQUIEL DAVID RUBIO PARRA', '3206641885', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Alopecia universal en cuero cabelludo" se recibe un punch de piel de color pardo claro y consistencia elástica que mide 0.4 cms. de diámetro. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran cuero cabelludo con atrófia marcada de la epidermis que reposa en un dermis de aspecto fibroso con un filtrado perivascular superficial mediado por linfocitos. Se identifican tres folículos pilosos con un denso infiltrado inflamatorio en la periferia y alteración severa de su estructura histológica. Hay atrófia de las unidades pilosebaceas y un denso infiltrado inflamatorio mediado por linfocitos en la periferia de las unidades pilosebaceas.\r\n\r\n\r\nCOMENTARIO: Los hallazgos descritos son compatibles con LUPUS ERITEMATOSO CUTÁNEO CRÓNICO, LIQUEN PLANO FOLICULAR Y ALOPECIA CICATRIZAL CENTRAL.\r\n\r\n\r\n', ' Biopsia de cuero cabelludo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIO\r\n\r\n', '', ''),
	(2515, 'Q2204-3977', 'Q', '1051891190', 'FRANKLIN MANUEL SANCHEZ BAZA', '3145114734', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-04-08', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se reciben dos segmentos de apéndice cecal que juntos miden 11.3 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2516, 'Q2204-3978', 'Q', '1137531198', 'YENDRY ALEJANDRA VARGAS GUERRERO', '3016527206', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Verruga vulvar" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que miden 0.6, 0.5 y 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con acantosis irregular, hiperqueratosis marcada e hipergranulosis. No se observan cambios de molusco.\r\n\r\n\r\n\r\n', ' Biopsia de piel de lesión en rodilla derecha:\r\n-VERRUGA VULGAR\r\n\r\n\r\n', '', ''),
	(2517, 'Q2204-3979', 'Q', '73212418', 'PRISCO GUZMAN CARMONA', '000', 'M', '37', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-04-08', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.2 x 1.2 cms., la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está engrosada y la luz dilatada y contiene abundante material de aspecto hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2518, 'Q2204-3980', 'Q', '45439564', 'ONIRIS ROSARIO VELASCO SANABRIA', '000', 'F', '61', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor HERNAN QUINTERO', NULL, '2022-04-08', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apendicectomía" se recibe un apéndice cecal que mide 6 x 0.7 cms., la superficie externa está cubierta por una serosa lisa y brillante en la trama vascular. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con marcada dilatación y congestión de los vasos de la subserosa. No se observan cabios inflamatorios.\r\n\r\n\r\n\r\n', '-APÉNDICE CECAL\r\n\r\n', '', ''),
	(2519, 'Q2204-3981', 'Q', '1047405330', 'NORILUZ GOMEZ BLANCO', '000', 'F', '19', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Placenta + restos placentarios" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n', 'El espécimen está constituido por fragmentos de decidua que alternan con fragmentos de endometrio hipersecretor con Reacción de Arias-Stella y de un tejido necrótico densamente infiltrado por PMN neutrófilos.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2520, 'Q2204-3982', 'Q', '22923184', 'AMALIA SOLANO DE ZEA', '000', 'F', '95', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'Rotulado "Epiplón" se recibe un fragmento de epiplón de color pardo amarillento y consistencia elástica que mide 6 x 5 cms. en la superficie externa se observa un área de aspecto fibroso. Al corte se observa una superficie amarillenta, untuosa de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de epiplón con áreas extensas de fibrosis y congestión vascular. No se observan cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Resección de fragmento de epiplón:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2521, 'Q2204-3983', 'Q', '1007360176', 'LEONARDO ANDRES MATA HERRERA', '000', 'M', '21', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mama derecha" un fragmento de tejido de forma irregular, color pardo amarillento y consistencia elástica que mide 10.5 x 8.5 x 5 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se observa una superficie amarillenta de aspecto adiposo que alternan con áreas de color pardo claro, homogénea. Se toman cortes y se rotulan A.\r\n2. "Mama izquierda" un fragmento de tejido de forma irregular, color pardo amarillento y consistencia elástica que mide 9.8 x 7.5 x 5 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se observa una superficie amarillenta que alternan con áreas de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejido mamario compuesto por canalículos que reposan en un estroma escleroso. No hay componente lobulillar.\r\n\r\n\r\n\r\n', '-GINECOMASTIA BILATERAL\r\n\r\n', '', ''),
	(2522, 'Q2204-3984', 'Q', '1042420334', 'YIDIS PAOLA PEREZ NAVARRO', '00', 'F', '35', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor ALBERTO JOSE ACUÑA ARICO', NULL, '2022-04-11', '2022-04-07', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Mioma" cinco masas de tejido de forma irregular de color paro rosado y consistencia firme que miden 9 x 8.5 x 7.5, 5.8 x 4 x 4, 3.8 x 3 x 2.5, 2.8 x 2 x 1.5 y 1.8 x 1.5 x 1.5 cms. La superficie externa de las masas es multilobulada y al corte se observa una superficie de color pardo claro de aspecto arremolinado. Se toman cortes.\r\n2. "Ovario y trompa derecha" masa de tejido de color pardo grisáceo y consistencia elástica que mide 8 x 5 cms. en sus mayores dimensiones, la superficie externa es irregular y se observa una cavidad previamente evacuada que contiene un material achocolatado, en uno de sus extremos se identifica una estructura tubular que parece corresponder a una trompa de Falopio que mide 2 cms. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran tumores mesenquimales benignos compuestos por células musculares lisas distribuidas irregularmente. Otros cortes muestran ovario comprimido por una cavidad parcialmente tapizada por tejido de granulación que contiene abundantes hemosiderofagos y trompa de Falopio que conserva la estructura usual.\r\n\r\n\r\n', '1.LEIOMIOMAS UTERINOS (5), miomectomía\r\n2.ENDOMETRIOMA, ovario derecho\r\n3.TROMPA UTERINO DERECHA (fragmento)\r\n\r\n', '', ''),
	(2523, 'L2204-146', 'L', '50900245', 'LEILA ISABEL ORTEGA DE LA ROSA', '000', 'F', '49', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-04-11', '2022-04-08', 'OLIVA MARRUGO GRICE', 'Rotulado "ACAF seno izquierdo" se reciben 6 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido constituido por gran número de células de citoplasma vacuolado núcleo central, algunos picnóticos, además células apocrinas y algunos núcleos irregulares.\r\n\r\n\r\n', ' Citología de líquido de mama izquierda:\r\n-COMPATIBLE CON CAMBIOS PROLIFERATIVOS\r\n\r\n', '', ''),
	(2524, 'Q2204-3985', 'Q', '73083769', 'FREDDY PUPO PEREZ', '3187727877', 'M', '66', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan A.\r\n2. "Pólipo de estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes de A revelan cuerpo gástrico cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B muestran una estructura compuesta por glándulas fúndicas irregulares, algunas dilatadas, que reposan desordenadamente en una lámina propia edematosa moderadamente infiltrada por células mononucleares. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n1.GASTRITIS CRÓNICA INACTIVA, cuerpo\r\n2.POLIPO DE GLÁNDULAS FÚNDICAS\r\n', '', ''),
	(2525, 'Q2204-3986', 'Q', '1143406435', 'YOVANA CAROLINA MARQUEZ  VALDEZ', '3007700518', 'F', '23', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de exocervix" se reciben dos fragmentos de tejido de color pardo claro y consistencia elástica que promedian 0.8 y 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan cérvix con una reacción inflamatoria crónica. No se observan cambios de LIE.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA\r\n\r\n', '', ''),
	(2526, 'Q2204-3987', 'Q', '49597465', 'MARY GUTIERREZ ACUÑA', '00', 'F', '37', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de endometrio" se reciben varios fragmentos de tejido de color pardo oscuro que juntos hacen un volumen de 2 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan endometrio constituido por glándulas proliferativas dispuestas de manera irregular, el estroma fusocelular con vasos de paredes gruesas.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-PÓLIPO ENDOMETRIAL DE TIPO hiperplásico\r\n\r\n\r\n', '', ''),
	(2527, 'Q2204-3988', 'Q', '49765267', 'TILCIA STELLA DURAN IBARRA', '00', 'F', '50', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor RAFAEL CARMONA VALLE', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Pólipo sigmoides" se reciben dos fragmentos de tejido de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Estructura compuesta por glándulas colónicas alargadas con aspecto aserrado de los bordes luminales, que reposan en una lámina propia con leve infiltración mononuclear.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de colon sigmoide:\r\n-PÓLIPO HIPERPLÁSICO \r\n\r\n\r\n', '', ''),
	(2528, 'Q2204-3989', 'Q', '1047436053', 'GARY RAFAEL ARGEL GOMEZ', '3014659616', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor JOSE RODRIGUEZ BLANCO', NULL, '2022-04-18', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Masa pulmonar lóbulo derecho" se recibe fragmento de tejido de forma irregular de color pardo claro que mide 2.5 x 1.5 x 0.5 cms. Al corte una formación nodular de color blanquecino y lisa. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan neoplasia linfoproliferativa representada por una proliferación mixta de linfocitos, células plasmáticas eosinófilos, algunas células de Hodgkin y de Reed-Sternberg. No se reconoce tejido pulmonar en el material enviado.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en pulmonar lóbulo derecho:\r\n-COMPATIBLE CON LINFOMA DE HODGKIN CLÁSICO\r\n\r\n', '', ''),
	(2529, 'Q2204-3990', 'Q', '73316031', 'ABEL ENRIQUE TEHERAN PUERTA', '000', 'M', '67', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia, se observan áreas de metaplasia intestinal. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA CON FOCOS DE METAPLASIA INTESTINAL\r\n\r\n', '', ''),
	(2530, 'Q2204-3991', 'Q', '1201224980', 'DAINNER DANIEL PADILLA DE LA CRUZ', '3004187216', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5  x 1.5 cms. tapizada por una serosa opaca bien vascularizada que trae adherido material fibrinopurulento. Al corte la luz se encuentra dilatada. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2531, 'Q2204-3992', 'Q', '32937752', 'MARY JOHANA BOLIVAR ARRIETA', '000', 'F', '37', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan antro sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de agregados linfoides, actividad severa, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD SEVERA\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2532, 'Q2204-3993', 'Q', '1143418703', 'JARED DAVID MARQUEZ GALVIS', '000', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RAFAEL VIVERO CONEO', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucocele" se recibe formación nodular que mide 0.5 cms. Al corte formación quística de 0.2 cms.  Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan mucosa oral en cuyo estroma se observa lesión quística tapizada por tejido de granulación conteniendo moco.\r\n\r\n\r\n\r\n', '-MUCOCELE DE EXTRAVASACIÓN\r\n\r\n', '', ''),
	(2533, 'Q2204-3994', 'Q', '1201224104', 'VALERIN SOFIA JIMENEZ CHAVERRA', '3218010454', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora CLAUDIA PATRICIA YAMAL MATTOS', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica el mayor mide 2 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2534, 'Q2204-3995', 'Q', '1044009155', 'ISABELLA SOFIA PORRAS BARRAZA', '00', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-04-13', '2022-04-12', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala derecha" una amígdala palatina de color blanquecino y consistencia elástica que mide 3 x 2 cms. Al corte multinodular de color blanquecino. Se toman cortes y se rotulan A.\r\n2.  "Amígdala izquierda" una amígdala palatina de color blanquecino y consistencia elástica que mide 3 x 2 cms. Al corte multinodular de color blanquecino. Se toman cortes y se rotulan B.\r\n3. "Adenoides" varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide el mayor 2 x 2 cms. y el menor de 2 x 0.1 cms. Al corte una superficie de color blanquecino. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B revelan amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide. \r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2535, 'Q2204-3996', 'Q', '26227046', 'HERVY ROSA DIAZ URANGO', '000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898241', '69000', 'Doctor EDGARDO DURAN GONZALEZ', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Útero, cuello y ovario izquierdo" se recibe el producto de una histerectomía más salpingooforectomía bilateral que pesa 1972 gms. y mide 18 x 16 x 10 cms. en sus mayores dimensiones. El cuello que se recibe por separado está tapizado por una mucosa de color pardo claro sin lesiones aparentes y mide 3 x 2.5 x 2 cms. en sus mayores dimensiones. El cuerpo está marcadamente deformado y aumentado de tamaño. Las trompas y los ovarios son externamente normales. Al corte el canal endocervical es permeable, la cavidad endometrial está rechazada periféricamente por una gran masa de tejido de forma ovoide que mide 16 x 9 x 14 cms. en sus mayores dimensiones. Las trompas son normales y los ovarios son sólidos. Se toman cortes.\r\n\r\n', 'El cérvix presenta una reacción inflamatoria crónica leve. El endometrio está autólisado. Los múltiples cortes de la masa descrita muestran un tumor mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzadas y ovillos. Hay una mitosis en múltiples campos de mayor aumento. No se encuentran atípias ni focos de necrosis.\r\nLas trompas y los ovarios son normales.\r\n\r\n\r\n', ' Útero y anexos (1972 gms.).\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTÓLISADO\r\n-LEIOMIOMAS*\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS\r\n\r\n\r\n*Ver descripción microscópica.', '', ''),
	(2536, 'Q2204-3997', 'Q', '1137538340', 'NEYMAR ROMERO ARELLANO', '000', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Boca de colostomía sigmoides" se recibe un fragmento de tejido que incluye dos aberturas rodeadas por un tejido con apariencia de mucosa, cada una de estas se continúa con un segmento de intestino, una de ellas incluido el segmento de intestino, mide 8 cms. de longitud, y la otra mide 5 cms. Al corte se encuentra una continuidad entre las bocas descritas y los segmentos de intestinos. Se toman cortes de cada una de las bocas descritas.\r\n\r\n\r\n\r\n', 'Los cortes muestran pared de intestino grueso que se continúa en uno de sus extremos con piel. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', '-BOCA DE COLOSTOMÍA DE SIGMOIDES (resección)\r\n\r\n\r\n\r\n', '', ''),
	(2537, 'Q2204-3998', 'Q', '33138200', 'ELINA AMIRA MENDOZA MARRUGO', '000', 'F', '74', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898241', '69000', 'Doctor DAVID BERMUDEZ SANGRE', NULL, '2022-04-20', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Hueso de peroné izquierdo" se reciben pequeñas espículas óseas de forma irregular que en conjunto hacen un volumen de 3 ml. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'El espécimen está compuesto por espículas óseas desvitalizadas que reposan en un trasfondo fibroso con leve infiltración por linfocitos, células plasmáticas y neutrófilos.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Curetaje de lesión en peroné izquierdo:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(2538, 'Q2204-3999', 'Q', 'VEN25662567', 'MARGARE YASMIN HERNANDEZ FIGUEROA', '000', 'F', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Cápsula de quiste de ovario derecho" se reciben tres fragmentos que miden 3, 1.8 y 2 cms. de un tejido de aspecto membranoso, muestran una superficie lisa, brillante de color pardo claro y una ligeramente rugosa. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tejido ovárico que rodea una cavidad tapizada pro epitelio cúbico simple. No hay cambios neoplásicos.\r\n\r\n\r\n\r\n', ' Cistectomía de ovario derecho:\r\n-QUÍSTE SIMPLE\r\n\r\n\r\n', '', ''),
	(2539, 'Q2204-4000', 'Q', '1143350443', 'MILAGROS DE JESUS MARTINEZ ZUÑIGA', '3116718019', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Ganglio cervical izquierdo" se recibe una masa ligeramente esférica de color pardo claro y consistencia firme que mide 1 cm. en su mayor dimensión. La superficie externa es irregular y al corte se observa una superficie de color pardo claro. Se toma todo en varios cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran ganglio linfático cuya morfología está alterada por la presencia de áreas extensas de necrosis de aspecto caseoso rodeadas por histiocitos epitelioides. No se encuentran células gigantes ni otro tipo de actividad.\r\n\r\n\r\n\r\n', ' Resección de ganglio cervical izquierdo:\r\n-LINFADENITIS CRÓNICA GRANULOMATOSA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.'),
	(2540, 'Q2204-4001', 'Q', '1010133127', 'LUZ TATIANA BLANQUICETH HERRERA', '3233377441', 'F', '37', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Restos ovulares" se reciben múltiples fragmentos de tejido de color rosado inmersos en múltiples coágulos sanguíneos que en conjunto hacen un volumen de 10 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por abundantes coágulos sanguíneos y fragmentos de decidua con necrosis y densa infiltración por neutrófilos. No se identifican elementos trofoblasticos.\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE TEJIDO DECIDUAL CON NECROSIS E INFLAMACIÓN AGUDA\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(2541, 'Q2204-4002', 'Q', '1052733415', 'IDALMIS YAKELIN VEGA ORTIZ', '3146594311', 'F', '19', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Embarazo ectópico - trompa izquierda" Se recibe un segmento de trompa de Falopio que mide 4.5 x 2.5 x 2 cms. en sus mayores dimensiones. En su extremo proximal se observa una zona dilatada de color violáceo y al corte muestra un área de color rojizo rodeada por lo que aparecen coágulos sanguíneos. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran trompa de Falopio cuya luz está ocupada por tejido placentario de aspecto normal, que en algunas áreas infiltra la pared.\r\n\r\n\r\n\r\n', ' Salpingectomía izquierda:\r\n-EMBARAZO ECTÓPICO TUBÁRICO\r\n\r\n', '', ''),
	(2542, 'Q2204-4003', 'Q', '1052991573', 'MARIA FERNANDA ATENCIO YEPES', '3104728357', 'F', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 0.7 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa de color pardo claro con vasos prominentes. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n', '', ''),
	(2543, 'Q2204-4004', 'Q', '1071434056', 'LEANYS MORELO ARTEGA', '3234594120', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color blanquecino y aspecto membranoso, que promedian un diámetro de 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Estómago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscòpica de esófago:\r\n-FRAGMENTOS DE EPITELIO ESCAMOSO MADURO\r\n2.Biopsia endoscòpica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n\r\n', '', ''),
	(2544, 'Q2204-4005', 'Q', '30765397', 'NUVIA ESTHER PADILLA CASTELLON', '3016287352', 'F', '50', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2545, 'Q2204-4006', 'Q', '45446589', 'MARELIS MARSIGLIA MEZA', '3015977309', 'F', '63', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2546, 'Q2204-4007', 'Q', '33148836', 'AMPARO HURTADO DE ARIZA', '3114034192', 'F', '69', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de mucosa gástrica antral cuya morfología está preservada. No hay cambios inflamatorios, displásicos ni presencia de H.pylori.\r\n\r\n\r\n\r\n ', ' Biopsia endoscópica de estómago:\r\n-FRAGMENTO DE MUCOSA GÁSTRICA ANTRAL\r\n\r\n\r\n', '', ''),
	(2547, 'Q2204-4008', 'Q', '60360193', 'GLORIA FERNANDEZ SAMACA NIÑO', '3103412535', 'F', '48', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-13', '2022-04-12', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2548, 'Q2204-4009', 'Q', '33148236', 'ANA JOAQUINA OLAYA DE MARRUGO', 'CE', 'F', '71', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un punch de piel de color pardo oscuro que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Piel tapizada por epitelio escamoso que muestra acantosis y presencia de quistes y seudoquistes córneos, el dermis muestra un infiltrado inflamatorio agudo y crónico leve.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en mejilla derecha:\r\n-QUERATOSIS SEBORREICA\r\n\r\n', '', ''),
	(2549, 'Q2204-4010', 'Q', '104354720', 'LEIDI LAURA CASTRO MOGUEA', '3207107665', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 cms. la serosa es opaca y despulida de color pardo grisáceo. Al corte la luz ocupada por material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2550, 'Q2204-4011', 'Q', '1052995149', 'DALEYSHA VASQUEZ GAMARRA', '3122922309', 'F', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS VELEZ DUCAN', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben tres fragmentos de tejido de forma irregular de color blanquecino que juntos miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(2551, 'Q2204-4012', 'Q', '1042580974', 'SEBASTIAN ANDRES FERREIRA PAJARO', '00', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 14 cms. la serosa opaca y despulida. Al corte salida de material fecal, la luz es permeable. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2552, 'Q2204-4013', 'Q', '1042607051', 'LISETH PAOLA VILLADIEGO CHAMORRO', '3003575947', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. la serosa es grisácea y despulida. Al corte la luz ocupada pro un material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2553, 'Q2204-4014', 'Q', '1041981383', 'DANA CAROLINA SANTAMARIA BERRIO', '3205872519', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal fragmentada que mide 6 y 2  cms. la serosa de color pardo claro. Al corte la luz ocupada por un material blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2554, 'Q2204-4015', 'Q', '1047407592', 'JOSUE MUÑOZ CHICO', '3004112712', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-21', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1.5 cms. la serosa es opaca y despulida de color pardo oscuro y tapizada por un material fibrinopurulento. Al corte la luz ocupada por un material de aspecto hemático. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APÉNDICITIS AGUDA\r\n\r\n\r\n\r\n', '', ''),
	(2555, 'Q2204-4016', 'Q', 'VEN05228924', 'JORGE DAVID JIMENEZ QUINTERO', '3154453485', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-21', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estómago" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Duodeno" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Ileon terminal" dos fragmentos de tejido de forma alargada de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n\r\n', 'Los cortes A muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes B revelan fragmento de mucosa duodenal infiltrada por linfocitos, plasmocitos y neutrófilos en abundante cantidad. En la muestra enviada no se observó ulceración, atrófia ni parásitos intestinales.\r\nLos cortes C revelan fragmento de mucosa de intestino delgado con infiltración por linfocitos y plasmocitos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica de duodeno:\r\n-DUODENITIS AGUDA Y CRÓNICA\r\n3.Biopsia endoscópica de Ileon terminal:\r\n-FRAGMENTO DE MUCOSA DE ILEON CON INFLAMACIÓN AGUDA Y CRÓNICA MODERADA \r\n', '', ''),
	(2556, 'Q2204-4017', 'Q', '1043641872', 'VALERIA ROSY MARIN CARCAMO', '3202942886', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-21', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste de mama derecha" se reciben dos fragmentos de tejido de forma redondeada, el mayor mide 2 x 1 .8 cms. y el menor de 1.2 x 1 cms. Al corte del mayor muestra una cavidad quística unilocular de 1 cm. el resto del tejido de color blanquecino. Al corte de la menor una superficie lisa y blanquecino. Se toman cortes así: A masa mayor y B menor.\r\n\r\n\r\n\r\n', 'Los cortes revela tejido mamario con canalículos dilatados, algunos quísticamente rodeados de un tejido colagenizado con focos de infiltración por linfocitos.\r\n\r\n\r\n', ' Extirpación de lesión en mama derecha:\r\n-CAMBIOS FIBROQUÍSTICOS\r\n\r\n', '', ''),
	(2557, 'Q2204-4018', 'Q', '1047454286', 'OLGA LUCIA RUIZ PEREIRA', '3022428027', 'F', '29', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2558, 'Q2204-4019', 'Q', '33146850', 'NILDA CABARCAS DE SAENZ', '6056418760', 'F', '70', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-21', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2559, 'Q2204-4020', 'Q', '52031017', 'SANDRA LILIANA BUSTOS BAUTISTA', '3213725280', 'F', '51', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2022-04-21', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori presente. No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n', '', ''),
	(2560, 'Q2204-4021', 'Q', '1050951194', 'YULIETH PAOLA REYES PAJARO', '3015563499', 'F', '33', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-05-02', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Trompa derecha" un segmento de tropa de Falopio que mide 2 cms. Al corte muestra la estructura usual. Se toman cortes y se rotulan A.\r\n2. "Ectópico izquierdo" segmento de trompa de Falopio que mide 2 cms. y en el extremo proximal muestra formación nodular de 1.3 cms. Al corte se encuentra dilatada y conteniendo un material hemático. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes A revelan trompa de Falopio que muestra la estructura usual.\r\nLos múltiples cortes B revelan trompa de Falopio que solo contiene material hemático. No se observan elementos trofoblasticos.\r\n\r\n\r\n', '1.HEMATOSALPINX\r\n-TROMPA DE FALOPIO IZQUIERDA\r\n2.SEGMENTO DE TROMPA DE FALOPIO DERECHA\r\n\r\n', '', ''),
	(2561, 'Q2204-4022', 'Q', '45478750', 'LUZ MAR MARTINEZ PADILLA', '00', 'F', '54', 'SEGUROS BOLIVAR S.A', '', '898201', '30215', 'Doctor ORLANDO BUSTILLO JR.', NULL, '2022-04-22', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de color pardo claro que mide 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de cuello con inflamación crónica y una LIE de bajo grado con cambios citopáticos secundarios a infección por HPV.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CERVICITIS CRÓNICA\r\n-LIE DE BAJO GRADO CON CAMBIOS COILOCITICOS SECUNDARIOS A INFECCIÓN POR HPV\r\n\r\n', '', ''),
	(2562, 'Q2204-4023', 'Q', '1095806758', 'LAURA MARCELA CRUZ RAVE', '3102802959', 'F', '31', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-04-21', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Mastitis granulomatosa" se reciben dos fragmentos de tejido fibroadiposo el mayor mide 3.5 x 1.5 cms. y el menor de 1 x 1 cms. Al corte del mayor de aspecto fibroadiposo. Se toman cortes y se rotulan A.\r\ny al corte del menor muestra una superficie lisa y blanquecina. Se toman cortes y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes revelan mama que muestra una proliferación de túbulos pequeños uniformes revestidos por una capa de células epiteliales y una capa atenuada de células mioepiteliales con escaso estroma interpuesto.\r\nEn otros cortes se observa tejido mamario densamente infiltrado por linfocitos, plasmocitos con presencia de células gigantes a cuerpo extraño.\r\n \r\n\r\n', ' Extirpación de lesión en mama derecha:\r\n-ADENOMA TUBULAR\r\n-MASTITIS CRÓNICA CON PRESENCIA DE CÉLULAS A CUERPO EXTRAÑO\r\n\r\n', '', ''),
	(2563, 'Q2204-4024', 'Q', '3790716', 'JERONIMO SUAREZ PARRA', '000', 'M', '84', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste sebáceo" se recibe un punch de piel de forma largada de color blanquecino que mide 2 x 1 x 1 cms. Al corte un área de aspecto quístico de 0.3 cms. conteniendo un área blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n', '-QUISTE QUERATINOSO DE TIPO EPIDERMOIDE, muslo derecho\r\n\r\n', '', ''),
	(2564, 'Q2204-4025', 'Q', '73073306', 'EUSEBIO MORENO CASTRO', '000', 'M', '67', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Granuloma pared abdominal" se recibe una masa de tejido tapizada parcialmente por piel de color oscuro que mide 4 x 1.8 x 2.5 cms. En el polo inferior trae adherido un nailon. Al corte una superficie amarillenta de aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Epitelio escamoso hiperplásico que descansa en un estroma en el que se observa una proliferación de capilares rodeados de un infiltrado inflamatorio agudo, crónico y áreas de fibrosis.\r\n\r\n\r\n\r\n', '-GRANULOMA, pared abdominal\r\n\r\n', '', ''),
	(2565, 'Q2204-4026', 'Q', '9081973', 'FELIX RAFAEL BUSTAMANTE CASTILLO', '00', 'M', '72', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quíste sebáceo en espalda" se recibe una masa de tejido que mide 2.5 x 2 x 1 cms. tapizada parcialmente por una elipse de piel de color blanquecino. Al corte cavidad quística que contienen material sebáceo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n', '-QUISTE QUERATINOSO DE TIPO EPIDERMOIDE, región dorsal\r\n\r\n', '', ''),
	(2566, 'Q2204-4027', 'Q', '45475436', 'MARTA LUZ CORRALES VILORIA', '000', 'F', '54', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Vesícula" se recibe una vesícula biliar fragmentada acompañada de múltiples cálculos de forma piramidal que mide 6 x 1 cms. sus paredes están revertidas y se observan una mucosa de color verdoso, las paredes están engrosadas.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2567, 'Q2204-4028', 'Q', '45465249', 'YELITZA YOUNG CASTRO', '00', 'F', '57', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa en cuero cabelludo" se recibe una formación nodular de color blanquecino que mide 1 x 1 cms. Al corte cavidad quística unilocular de bordes irregulares. Se toman en dos cortes.\r\n\r\n\r\n\r\n', 'Pared de quíste tapizada por epitelio plano estratificado conteniendo queratina compacta.\r\n\r\n\r\n\r\n', '-QUÍSTE TRIQUILEMAL, cuero cabelludo\r\n\r\n', '', ''),
	(2568, 'Q2204-4029', 'Q', '45368175', 'NEREIDA OSPINO FRIAS', '00', 'F', '48', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa en región dorsal derecha" se recibe una masa de tejido multinodular de color amarillento y aspecto adiposo encapsulada que mide 4 x 3.5 x 3 cms. Al corte una superficie de color amarillento y aspecto adiposo. Se toman cortes.\r\n\r\n\r\n', 'Tumor benigno mesenquimal constituido por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', '-LIPOMA, región dorsal derecha\r\n\r\n', '', ''),
	(2569, 'Q2204-4030', 'Q', '64738669', 'JENNY PATRICIA VERGARA GOMEZ', '00', 'F', '52', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-04-20', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Producto de resección de masa en región dorsal izquierda" se recibe una masa encapsulada de tejido de forma ovoide que mide 9 x 6 x 4 cms. de color amarillento y aspecto adiposo. Al corte una superficie de color amarillento y aspecto adiposo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal constituido por tejido adiposo maduro separado por septos finos de tejido fibroso.\r\n\r\n\r\n\r\n', '-LIPOMA, región dorsal izquierda\r\n\r\n', '', ''),
	(2570, 'Q2204-4031', 'Q', '9153070', 'RAFAEL ANTONIO RUIZ CERVANTES', '000', 'M', '71', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor JOSE RODRIGUEZ', NULL, '2022-04-22', '2022-04-13', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Fragmento de masa pulmonar" cuatro cilíndros de tejido, el mayor mide 1.3 cms. y el menor de 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Fragmento de pulmón (#2)" dos fragmentos de tejido de color oscuro y consistencia elástica que mide el mayor 2 x 1 cms. Se toman cortes y se rotulan B.\r\n3. "Fragmento de pulmón izquierdo" un fragmento de tejido de color oscuro y consistencia elástica que mide 1 x 1 cms. Al corte una superficie de color gris. Se toman cortes y se rotulan C.\r\n4. "Pleura parietal" fragmento de tejido de forma alargada que mide 2 x 1 cms. Se toman cortes y se rotulan D.\r\n\r\n', 'Los cortes de A (trucut) revelan tejido pulmonar infiltrado por un adenocarcinoma no mucinoso con patrón (lepídico) que compromete todos los cilíndros enviados.\r\nLos cortes rotulados B, C y D fragmentos de pulmón izquierdo y pleura parietal muestran el mismo tumor. No se observó invasión linfovascular.\r\n\r\n\r\n', '1.Trucut de masa pulmonar:\r\n-ADENOCARCINOMA INVASIVO NO MUCINOSO, (PATRÓN LEPÍDICO)\r\n2.Rotulado fragmento de pulmonar izquierdo (cortes B y C):\r\n-ADENOCARCINOMA INVASIVO NO MUCINOSO, (PATRÓN LEPÍDICO)\r\n3.Fragmento de pleura parietal con:\r\n-INFILTRACIÓN TUMORAL\r\n', '', ''),
	(2571, 'Q2204-4032', 'Q', '30760474', 'ANA CECILIA ZAMBRANO MORENO', '000', 'F', '63', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Trucut de seno izquierdo" se reciben seis cilíndros de tejido de color blanquecino que promedian un diámetro mayor de 1 cm. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan proporciones variables de mucina extracelular y células carcinomatosas, además, se observan pequeños túbulos y trabéculas de núcleos hipercromáticos irregulares. El tumor está presente en todos los cilindros.\r\n\r\n\r\n\r\n', ' Trucut de seno izquierdo:\r\n-CARCINOMA MUCINOSO\r\n\r\n\r\n', '', ''),
	(2572, 'Q2204-4033', 'Q', '45431502', 'ROSARIO DEL CARMEN ARAUJO DURAN', '000', 'F', '62', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-05-02', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Mastitis granulomatosa" se reciben dos fragmentos de tejido de forma irregular, que miden 2.5 x 0.5 y 1 x 1 cms. de color blanco amarillento y consistencia elástica. Al corte una formación nodular de 0.5 cms. de color pardo claro. Al corte del menor una superficie lisa y blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan tejido mamario que muestra un infiltrado mixto constituido por células plasmáticas, linfocitos, macrófagos y neutrófilos, se observan algunos granulomas no caseificante.\r\n\r\n\r\n\r\n', ' Biopsia de mama derecha:\r\n-MASTITIS CRÓNICA GRANULOMATOSA\r\n\r\n', '', ''),
	(2573, 'Q2204-4034', 'Q', '1041988661', 'DAYANYS ALCAZAR VELASQUEZ', '3143483020', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca bien vascularizada que trae adherido material fibrinopurulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2574, 'Q2204-4035', 'Q', '1235040628', 'ELEADIS FORERO PEREZ', '000', 'F', '24', 'LIGA CONTRA EL CANCER', '', '', '', 'Doctor CARLOS OSORIO', NULL, '2022-04-29', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Fibroadenoma" en un mismo recipiente, sin discriminar, se reciben dos masas de tejido, la mayor de 2 x 1.5 x 1 cms. y la menor de 1 x 1 cms. de consistencia firme, de color blanquecino, multilobular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n\r\n', '-FIBROADENOMA, mama izquierda\r\n\r\n', '', ''),
	(2575, 'Q2204-4036', 'Q', '1051891003', 'LUIS DANIEL CABALLERO CASTRO', '3135240506', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa opaca bien vascularizada de color pardo grisáceo. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2576, 'Q2204-4037', 'Q', '1050948643', 'KEINER DE JESUS QUINTANA MIRANDA', '3136806867', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1 cms. tapizada por una serosa opaca de color pardo oscuro. Al corte salida de material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2577, 'Q2204-4038', 'Q', '1201237812', 'YEILER ANTONIO MARIMON MORENO', '3116679003', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca despulida bien vascularizada. Al corte salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2578, 'Q2204-4039', 'Q', '1128062638', 'LUIS ANGEL PIANETA PEREZ', '3246550963', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. tapizada por una serosa opaca de color pardo claro despulida bien vascularizada. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2579, 'Q2204-4040', 'Q', '1044927651', 'ALLIZON ALLANA BOSSIO DIAZ', '3122990179', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. tapizada por una serosa opaca bien vascularizada. Al corte de material fibrinopurulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2580, 'Q2204-4041', 'Q', '45524682', 'ANDREINA DEL CARMEN DEL CAMPO MIRANDA', '6812790', 'F', '42', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 3.5 x 1.5 cms. tapizada parcialmente por una serosa de color pardo grisáceo. Al corte salida de gran cantidad de cálculos de color anacarado, la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS\r\n\r\n', '', ''),
	(2581, 'Q2204-4042', 'Q', '1007739918', 'ANGEL DE JESUS PASTRANA GUERRERO', '000', 'M', '30', 'CLIN. SAN JOSE DE TORICES SAS', 'Mutual SER', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-04-21', '2022-04-19', 'OLIVA MARRUGO GRICE', 'Rotulado "Intestino delgado" sin reparo, se recibe un segmento de intestino que mide 6 x 3 cms. tapizado por una serosa opaca de color pardo violáceo a 3 cms. de uno de los bordes de resección presenta una solución de continuidad de 2 cms. Se toman cortes y se rotulan así: A bordes de resección, B solución de continuidad y C resto de intestino.\r\n\r\n\r\n\r\n', 'Intestino delgado con necrosis hemorrágica, inflamación aguda y perforación.\r\nBordes de resección con edema y congestión.\r\n\r\n\r\n\r\n', ' Segmento de intestino delgado con:\r\n1.INFLAMACIÓN AGUDA, NECROSIS, HEMORRÁGIA Y PERFORACIÓN (ANTECEDENTES POR HERIDA CON ARMA DE FUEGO)\r\n2.BORDES DE RESECCIÓN VIABLES\r\n\r\n', '', ''),
	(2582, 'Q2204-4043', 'Q', '1007598012', 'LEONARDO FABIO AHUMADA ALFARO', '000', 'M', '22', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTEREO', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Resección de masa pectoral derecha" una masa de tejido de forma irregular, color amarillo y consistencia firme que mide 7.5 x 6 x 3 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se encuentra una zona de color blanquecino que mide 1.5 x 2 x 0.5 cms. El resto de la superficie es untuosa de color amarillo. Se toman cortes y se rotulan A.\r\n2. Un segundo recipiente, rotulado "Resección de masa pectoral izquierda" contiene un espécimen similar al descrito que mide 8 x 6 x 3.5 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejido mamario compuesto por canalículos de diferentes calibres, que reposan en un estroma fibroescleroso. No hay componente lobulillar. Este tejido está rodeado de abundante tejido adiposo.\r\n\r\n\r\n\r\n', '1.Resección de masa pectoral derecha:\r\n-GINECOMASTIA\r\n2.Resección de masa pectoral izquierda:\r\n-GINECOMASTIA\r\n\r\n', '', ''),
	(2583, 'Q2204-4044', 'Q', '22246413', 'MARIA ADELFA CHAVEZ ARIAS', '000', 'F', '63', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(2584, 'Q2204-4045', 'Q', '1047517230', 'LUIS MARIANO PUELLO ARRIETA', '000', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tejido óseo radio distal izquierdo" se recibe dos fragmentos de tejido óseo que miden respectivamente 0.2 y 0.4 cms. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'Los cortes muestran espículas óseas desvitalizadas que reposan en un trasfondo fibroso. No se encuentran cabios inflamatorios.\r\n\r\n\r\n\r\nOBSERVACIONES: Los hallazgos son compatibles con un SECUESTRO ÓSEO. Se recomienda correlacionar con lo encontrado clínica y radiológicamente.\r\n\r\n\r\n', ' Biopsia de lesión en radio distal izquierdo:\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y OBSERVACIONES\r\n\r\n', '', ''),
	(2585, 'Q2204-4046', 'Q', '8610160', 'MARIA MENDOZA NOGUERA', '000', 'F', '51', 'PARTICULAR', '', '898201', '30215', 'Dcotor FERNANDO JIMENEZ', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Recto" se reciben varios fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda. Acompañado de coágulos sanguíneos, promedian un diámetro mayor de 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa colónica con ulceración superficial. Hay presencia de microabscesos crípticos con destrucción del componente epitelial. Otros campos muestran glándulas que han perdido el componente mucoso del epitelio. La lámina propia está marcadamente infiltrada por linfocitos, células plasmáticas y neutrófilos. No se encuentran granulomas ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de recto:\r\n-COLITIS ULCERATIVA EN FASE ACTIVA\r\n\r\n', '', ''),
	(2586, 'Q2204-4047', 'Q', '33156630', 'MIRNA MARTINEZ SILGADO', '3168812820', 'F', '66', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA ', '', ''),
	(2587, 'Q2204-4048', 'Q', '32908466', 'EDELCY HERNANDEZ BLANCO', '000', 'F', '39', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Recto" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Sigmoides" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes rotulaos A y B muestran fragmentos de mucosa colónica focalmente ulcerada cuyas glándulas conservan su morfología habitual. No hay perdida del componente mucoso de las glándulas ni microabscesos crípticos. La lámina propia está infiltrada por linfocitos, células plasmáticas, neutrófilos y abundantes eosinófilos.\r\nNo hay granulomas, parásitos ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de recto:\r\n-PRÓCTITIS AGUDA Y CRÓNICA\r\n2.Biopsia endoscópica de colon sigmoides:\r\n-COLITIS AGUDA Y CRÓNICA\r\n\r\n', '', ''),
	(2588, 'Q2204-4049', 'Q', '45420251', 'ANA CONTRERAS RHENAL', '000', 'F', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Masa en región dorsal derecha" se recibe un fragmento de tejido de forma irregular de color amarillento y consistencia blanda que mide 4 x 3 x 1.8 cms. La superficie externa es irregular y al corte se encuentra una superficie untuosa de color amarillento con estrías de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Resección de masa en región dorsal derecha:\r\n-LIPOMA\r\n\r\n', '', ''),
	(2589, 'Q2204-4050', 'Q', '79951208', 'LUIS BLADIMIR NIÑO VELEZ', '6850787', 'M', '42', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2022-04-25', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Lesión en ciego" dos fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que miden 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Colon descendente" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran una lesión compuesta por estructuras vellosas tapizadas por epitelio adenomatoso con leves atípias. Estas alternan con estructuras tubulares con iguales características citológicas en una proporción de 50% cada una.\r\nLos cortes rotulados B muestran una estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n', '1.Biopsia endoscópica de lesión en ciego:\r\n-ADENOMA TUBULOVELLOSO\r\n2.Biopsia endoscópica de colon ascendente:\r\n-ADENOMA TUBULAR\r\n\r\n', '', ''),
	(2590, 'Q2204-4051', 'Q', '1131379013', 'DIANI LUZ LEON ZABALETA', '000', 'F', '17', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor GUSTAVO CARBALLO', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Restos ovulares" se reciben múltiples fragmentos de tejido de forma irregular, de color pardo claro y consistencia blanda, que en conjunto hacen un volumen de 5 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'El especímen está constituido por tejido decidual con focos de inflamación aguda y fragmentos de endometrio con reacción de Arias-Stella. No se identifican elementos trofoblasticos en la muestra.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-TEJIDO DECIDUAL CON INFLAMACIÓN AGUDA\r\n-ENDOMETRIO CON REACCIÓN DE ARIAS STELLA\r\n\r\n', '', ''),
	(2591, 'Q2204-4052', 'Q', '72174765', 'EDUIN JOSE DIAZ VIECCO', '000', 'M', '51', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2592, 'Q2204-4053', 'Q', '1052736508', 'WILSER ANDRES MENDOZA', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', '', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1.8 cms. en sus mayores dimensiones, externamente se observa una dilatación en el extremo distal, y una serosa despulida de color pardo claro con vasos prominentes. Al corte en el extremo distal se encuentra una luz dilatada que contiene material purulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2593, 'Q2204-4054', 'Q', '45517842', 'CARMEN JULIA DIAZ PATERNINA', '3185568662', 'F', '50', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2594, 'Q2204-4055', 'Q', '9070198', 'MARCOS MACTOREL MENDOZA', '000', 'M', '72', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se recibe un fragmento de piel de forma irregular, de color pardo oscuro, que mide 1.2 x 0.8 x 0.5 cms. La superficie externa es irregular, de aspecto verrucoso y al corte se observa una superficie granular de color pardo oscuro. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis está marcadamente engrosada a expensas de una proliferación de células pequeñas, basaloides, que rodean espacios que contienen queratina.\r\n\r\n\r\n\r\n', ' Resección de lesión en piel de región escapular derecha:\r\n-QUERATOSIS SEBORREICA\r\n\r\n', '', ''),
	(2595, 'Q2204-4056', 'Q', '1047440794', 'DELCY PAOLA MERCADO JAIMES', '000', 'F', '30', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-22', '2022-04-21', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA SEVERA\r\n\r\n', '', ''),
	(2596, 'Q2204-4057', 'Q', '32813475', 'LUZ MARINA SANCHEZ PAEZ', '000', 'F', '60', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2597, 'Q2204-4058', 'Q', '33138918', 'ELVIA FLOREZ DE DURAN', '000', 'F', '72', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-04-28', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de vulva" se recibe un punch de piel de color gris que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Epitelio escamoso con cambios coilociticos asociados que descansan en un estroma infiltrado por escasos linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n\r\n', '', ''),
	(2598, 'Q2204-4059', 'Q', '33117642', 'ROSA ERNESTINA MUÑOZ DE MOLINA', '000', 'F', '77', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-05-02', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe una elipse de piel que mide 1.2 x 0.5 cms. en su centro presenta un área ulcerada de 0.1 cm. Se toma todo\r\n\r\n\r\n\r\n\r\n', 'Piel infiltrada por una lesión epitelial tumoral maligna constituida en su mayoría por un patrón difuso y nidos de células escamosas que muestran pleomorfismo e hipercromatismo, la lesión toca los bordes de resección.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en pectoral derecha:\r\n-CARCINOMA ESCAMOCELULAR MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(2599, 'Q2204-4060', 'Q', '45491156', 'SANDRA MARIA AYALA AGRESSOT', '000', 'F', '53', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-04-28', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se reciben cuatro fragmentos de tejido de forma irregular de color amarillento y aspecto adiposo, el mayor mide 5  x 3 cms. el mayor mide 1.5 x 1 cms. Al corte superficie de color amarillento y aspecto adiposo. Se toman cortes.\r\n\r\n\r\n', 'Los cortes solo revelan tejido adiposo maduro y la presencia de un ganglio linfático que muestra hiperplasia mixta. No se observan elementos propios de la mama.\r\n\r\n\r\n\r\n', ' Resección de mama supernumeraria derecha:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2600, 'Q2204-4061', 'Q', '22805940', 'SUMAYA PALOMINO', '000', 'F', '41', 'PARTICULAR', 'C.', '898201', '30215', '', NULL, '2022-04-28', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cápsula mamaria derecha" un fragmento de tejido de color gris de forma alargada que mide 15 x 6 cms. La superficie externa es grisácea y la interna es de color café oscuro e irregular. Se toman cortes y se rotulan A.\r\n2. "Cápsula mamaria izquierda" cuatro fragmentos de tejido de color gris de forma alargados, el mayor mide 7 x 4 cms. y el menor de 3 x 2 cms. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A y B revelan tejido fibroadiposo que muestra estructuras papilares tapizadas pOR sinovia.\r\n\r\n\r\n\r\n', '1.Cápsula de prótesis mamaria derecha con:\r\n-METAPLASIA SINOVIAL\r\n2.Cápsula de prótesis mamaria izquierda con:\r\n-METAPLASIA SINOVIAL', '', ''),
	(2601, 'Q2204-4062', 'Q', '45766562', 'INGRID DEL CARMEN FRANCO ROMERO', '00', 'F', '45', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-05-02', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un punch de piel de color pardo oscuro que mide 0.1 cm. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel que muestra hiperqueratosis, hipergranulosis, acantosis psoriasiforme del epitelio escamoso, el dermis papilar muestra un infiltrado inflamatorio constituido principalmente por linfocitos y macrófagos a nivel de las papilas tocando la unión dermoepidermica, hay presencia de pigmento melánico.\r\n\r\n\r\n\r\n', ' Biopsia de piel de lesión de dorso de mano, lado anatómico no especificado.\r\n-DERMATITIS PSORIASIFORME\r\n\r\n\r\n', '', 'El cuadro histológico arriba mencionado no llena todos los criterios requeridos para diagnóstico de psoriasis, correlacionar con la clínica.\r\n\r\n'),
	(2602, 'Q2204-4063', 'Q', '30770019', 'ELIZABETH FAJARDO DE ZARATE', '000', 'F', '64', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-05-02', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe un fragmento de tejido de aspecto fibroadiposo de color amarillento y consistencia elástica que mide 4.5 x 4.3 cms. Al corte una lesión nodular de aspecto carnoso de color rosado que mide 1.2 x 1.3 x 1 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Cavidad que contiene una lesión compuesta por elementos papilares tapizados por epitelio cilíndrico estratificado que muestra núcleos irregulares, algunos hipercromáticos con ligero pleomórfismo, hay pequeñas áreas sólidas.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en masa seno derecho:\r\n-COMPATIBLE CON PAPILOMA INTRADUCTAL ATÍPICO\r\n\r\n\r\n\r\n', '', 'Sería recomendable practicar estudios de inmunohistoquímica para mejor precisión diagnóstica.\r\n\r\n'),
	(2603, 'Q2204-4064', 'Q', '1043972041', 'KEISY ANDREA CARABALLO CARREAZO', '00', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora ANA MARIA OTOYA', NULL, '2022-04-28', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Pólipo en conducto auditivo derecho" se recibe un fragmento de tejido de color oscuro que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Lesión polipoide tapizada por epitelio escamoso que descansan en un estroma fibroso, vascularizado con infiltración por linfocitos y plasmocitos en moderada cantidad.\r\n\r\n\r\n\r\n', '-PÓLIPO INFLAMATORIO, conducto auditivo externo derecho\r\n\r\n', '', ''),
	(2604, 'Q2204-4065', 'Q', '1201264558', 'YULIAN ANDRES CONTRERAS CASTELLAR', '000', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora ANA MARIA OTOYA', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Amígdala izquierda" masa de tejido de forma ovoidea que mide 2.3 x 1.8 x 1 cms. Al corte una superficie nodular de color blanquecino. Se toman cortes y se rotulan A.\r\n2.  "Amígdala derecha" masa de tejido de forma ovoidea que mide 2 x 2 x 1 cms. Al corte una superficie nodular de color blanquecino. Se toman cortes y se rotulan B.\r\n3. "Adenoides" fragmentos de tejido de color pardo claro y consistencia elástica juntos, promedian 3 ml. Se toman cortes y se rotulan C.\r\n\r\n\r\n', 'Los cortes de A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes C revelan amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2605, 'Q2204-4066', 'Q', '1042607460', 'ADRIANA ISABEL PADILLA', '000', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 cms. La serosa es opaca y congestiva. Al corte la luz ocupada por un material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2606, 'Q2204-4067', 'Q', '1128048708', 'JAVIER ENRIQUE PEREIRA DIAZ', '000', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', '', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Masa en dorso de mano izquierda" se recibe piel de color pardo oscuro de forma redondeada que mide 1 x 1 cms. que se continúa con un fragmento de tejido alargado de 1 cm. en su extremo distal deja ver una pequeña cavidad quística de 0.3 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Fragmentos de tejido fibroso denso con zonas de degeneración quística.\r\n\r\n\r\n\r\n', '-GANGLIÓN, Dorso de mano izquierda', '', ''),
	(2607, 'Q2204-4068', 'Q', '1041987543', 'ESNEIDER GONZALEZ RODRIGUEZ', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal el fragmento mayor mide 6 cms. y el menor de 3 x 1 cms. La serosa es opaca, de color oscuro y al corte la luz ocupada por material de aspecto fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2608, 'Q2204-4069', 'Q', '45528014', 'KATHERINE BUSTAMANTE GOMEZ', '3103765300', 'F', '40', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(2609, 'Q2204-4070', 'Q', '1104869946', 'ANGELICA MARCELA GALVIS ZUÑIGA', '000', 'F', '30', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n\r\n\r\n', '', ''),
	(2610, 'Q2204-4071', 'Q', '39020549', 'DEYSI MARIA MARTINEZ GONZALEZ', '3114191312', 'F', '43', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en abundante cantidad y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n\r\n', '', ''),
	(2611, 'Q2204-4072', 'Q', '530576465', 'JEANLY MICHELLE RAMOS DESCHAMPS', '000', 'F', '34', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se recibe una masa de tejido de forma ovoidea de color blanquecino que mide 1.4 x 1.2 x 0.8 cms. Al corte de color blanquecino, nodular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', ' Biopsia de masa en mama derecha:\r\n-FIBROADENOMA\r\n\r\n', '', ''),
	(2612, 'Q2204-4073', 'Q', '64515516', 'MARIA HERNANDEZ FLORASTERI', '3205172434', 'F', '95', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2613, 'Q2204-4074', 'Q', '22903751', 'YOLANDA DOLORES SIMANCAS DE ROMERO', '3008371175', 'F', '81', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2614, 'Q2204-4075', 'Q', '18775861', 'OSWALDO ENRIQUE MENDOZA MORENO', '3133868164', 'M', '46', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-25', '2022-04-23', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, plasmocitos en moderada cantidad y PMN neutrófilos en escasa cantidad. Hay formación ocasional de acúmulos linfoides. No se observa H.pylori, atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n', '', ''),
	(2615, 'L2204-147', 'L', '45765218', 'SANELIS BARRIOS FRANCO', '000', 'F', '46', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-04-25', '2022-04-25', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "ACAF de seno izquierdo" se reciben 1 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n', ' ACAF de seno izquierdo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(2616, 'Q2204-4076', 'Q', '1097194404', 'GISELL KAMILA PADILLA CAÑAS', '3218171640', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia elástica que en conjunto hacen un volumen de 3 ml. Al corte se observa una superficie homogénea de color pardo claro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA (ADENOIDITIS CRÓNICA)\r\n\r\n', '', ''),
	(2617, 'Q2204-4077', 'Q', '1041984524', 'MATEO ENRIQUE COGOLLO PADILLA', '3008702574', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antrocorporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2618, 'Q2204-4078', 'Q', '1143420388', 'AUSTIN JAVIER FUENTES', '000', 'M', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor TORRES', NULL, '2022-05-02', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Fémur derecho"  se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia firme que en conjunto hacen un volumen de 0.5 ml. Se toma todo y se pone a descalcificar.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por espículas óseas desvitalizadas rodeadas por un tejido fibroso densamente infiltrado por PMN neutrófilos y linfocitos.\r\n\r\n\r\n\r\n', ' Curetaje óseo de fémur derecho:\r\n-OSTEOMIELITIS CRÓNICA\r\n\r\n', '', ''),
	(2619, 'Q2204-4079', 'Q', '1051888085', 'STHEICY DANIELA REDONDO CORRALES', '3007614463', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa antral y antrocorporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2620, 'Q2204-4080', 'Q', '1142914675', 'MARVIN DE JESUS MUNIS', '000', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.4 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2621, 'Q2204-4081', 'Q', '1050719289', 'CAROLINA ZAMBRANO GARCIA', '3106384080', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de estómago" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2622, 'Q2204-4082', 'Q', '1143418004', 'EYDAN ALEXANDER TORRES MARCHENA', '00', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora MARGHI LIZET GUERRA PEREZ', NULL, '2022-05-03', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de piel de muslo izquierdo" se recibe un punch de piel que mide 0.4 cms. de diámetro de color pardo oscuro y consistencia elástica. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel con hiperpigmentación de la capa basal de la epidermis. El dermis papilar muestra numerosos mastocitos que compromete el tercio superior de la dermis.\r\n\r\n\r\n', ' Biopsia de piel de muslo izquierdo:\r\n-COMPATIBLE CON MASTOCITOSIS CUTÁNEA\r\n\r\n\r\n\r\n', '', 'Se sugiere realizar correlación clínico-patológica.\r\n'),
	(2623, 'Q2204-4083', 'Q', '1143382857', 'MARIA ESTEFANY LAGARES ESTREMOR', '000', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula que mide 7 x 2.2 cms. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de múltiples cálculos pequeños de color pardo amarillo. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular. En la mucosa se observan acúmulos de histiocitos cargados de colesterol.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS Y COLESTEROLOSIS\r\n\r\n', '', ''),
	(2624, 'Q2204-4084', 'Q', '45450010', 'MARTHA EDITH PEREZ GUERRA', '3215566722', 'F', '60', 'CLINICA GENERAL DEL CARIBE SA.', '', '898241', '69000', 'Doctor EDGAR GOMEZ RHENALS', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero, miomas, trompas y ovarios" se recibe un útero con sus anexos que pesa 742 gms. y mide 12 x 11 x 9.5 cms. La trompa izquierda mide 8.5 cms. uy la derecha 5.5 cms. El ovario izquierdo mide 2.5 x 1.5 cms. y el derecho mide 1.7 x 1.3 cms. El cérvix está tapizado por una mucosa homogénea de color pardo claro. El cuerpo está marcadamente aumentado de tamaño y deformad. Al corte el canal endocervical es permeable, la cavidad endometrial está tapizada pro una mucosa aplanada y el miometrio está ocupado por múltiples masas de color pardo claro y aspecto arremolinado, la mayor mide 9.5 cms. de diámetro y la menor de 2 cms. de localización submucosa, intramural y subserosa. Al corte de las trompas conservan la morfología usual y los ovarios son sólidos. Se toman cortes.\r\n\r\n\r\n', 'El cérvix muestra una reacción inflamatoria crónica. El endometrio es inactivo. Las masas miometriales descritas están compuestas por fibras musculares lisas distribuidas irregularmente. Las trompas y los ovarios conservan la morfología habitual.\r\n\r\n\r\n', ' Útero con sus anexos (742 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO INACTIVO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS\r\n-TROMPAS DE FALOPIO\r\n-OVARIOS', '', ''),
	(2625, 'Q2204-4085', 'Q', '13832308', 'ARELIS DEL CARMEN SALAS THERAN', '000', 'F', '44', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de exocervix" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células escamosas con núcleos pleomórficos, hipercromáticos que se disponen en nidos sólidos y cordones que infiltran el estroma.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CARCINOMA DE CÉLULAS ESCAMOSAS MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(2626, 'Q2204-4086', 'Q', '3399818', 'OSCAR EDUARDO VALENCIA VALENCIA', '3113899678', 'M', '41', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Cuerpo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo y se rotula B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados A muestran mucosa oxíntica cuya lámina propia está edematosa, congestiva e infiltrada por linfocitos. No se observa actividad inflamatoria, H.pylori, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2627, 'Q2204-4087', 'Q', '8851398', 'JAIME ROZO', '66139269', 'M', '41', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-09', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Esófago" se reciben cuatro diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa esofágica tapizada por epitelio escamoso, por debajo del cual se encuentran nidos de mucosa gástrica de tipo antral. Hay zona de ulceración cubierta por tejido necrótico densamente infiltrado por neutrófilos.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de lesión en tercio inferior de esófago:\r\n-COMPATIBLE CON HETEROTOPIA GÁSTRICA ULCERADA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n\r\n'),
	(2628, 'Q2204-4088', 'Q', '9098009', 'ELIAS ENRIQUE RICARDO LICONA', '6780378', 'M', '44', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-27', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2629, 'L2204-148', 'L', '1047412297', 'NONYS CATALINA ESTRADA VILLARREAL', '00', 'F', '32', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-05-03', '2022-04-26', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "ACAF de seno izquierdo" 2 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento, se rotula A.\r\n2. "ACAF de seno derecho" una placa con su extendido. Se rotula B.\r\n\r\n\r\n', 'Los extendidos rotulados A muestran células pequeñas con núcleos uniformes y citoplasma escaso que se disponen en sabanas.\r\nEl extendido rotulado B muestra numerosas células pequeñas con núcleos uniformes, redondeadas, que se disponen en sabanas y grupos pequeños.\r\n\r\n\r\n', '1.ACAF de mama izquierda:\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS\r\n2.ACAF de mama derecha:\r\n-CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS\r\n\r\n\r\n\r\n', '', 'Los extendidos son sugestivos de cambios proliferativos del epitelio glandular.\r\n\r\n'),
	(2630, 'Q2204-4089', 'Q', '1048436658', 'NICOLLE DIAZ BOLIVAR', '000', 'F', '17', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de color blanquecino que mide 0.7 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan estructuras compuestas por epitelio escamoso con acantosis, hiperqueratosis, paraqueratosis, atipias, coilociticas que descansan en un estroma infiltrado por linfocitos.\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA\r\n\r\n', '', ''),
	(2631, 'Q2204-4090', 'Q', '26256280', 'LUCINA CAICEDO DE GOMEZ', '3103666755', 'F', '73', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'LUISA VIANA SCHULTZ', NULL, '2022-05-09', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor palpebral a descartar malignidad" se reciben dos fragmentos de tejido de forma irregular de color blanquecino, el mayor de los cuales mide 0.5 cms. y el menor de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel tapizada por epitelio escamoso hiperplásico que muestra hipercelularidad, pleomórfismo nuclear, algunas figuras de mitosis; hay focos dudoso de infiltración. La lesión toca los bordes de resección.\r\n\r\n\r\n\r\n', ' Piel de parpado superior derecho:\r\n-CARCINOMA ESCAMOCELULAR MODERADAMENTE DIFERENCIADO\r\n (VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2632, 'Q2204-4091', 'Q', '9072529', 'ADOLFO ENRIQUE JIMENEZ ZAMBRANO', '000', 'M', '72', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-05-02', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de color pardo oscuro, el mayor mide 0.4 cms. y el menor de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel fragmentada tapizada parcialmente por epitelio escmoso que muestra desordenamiento de las células del epitelio escamoso y atípias celulares, el dermis muestra degeneración basofilica, fibrosis y un infiltrado inflamatorio severo predominantemente mononuclear.\r\n\r\n\r\n\r\n', ' Extirpación de lesión en región de punta nasal:\r\n-QUERATOSIS SOLAR (FRAGMENTOS)\r\n\r\n', '', ''),
	(2633, 'Q2204-4092', 'Q', '1022418401', 'ANABEL LAMBRAÑO GUTIÉRREZ', '000', 'F', '25', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ALEJANDRO GODOY CASTELLAR', NULL, '2022-05-02', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor benigno de glúteo" se recibe una elipse de piel que mide 3.5 cms. en su superficie externa presenta una lesión sobreelevada, sésil, aspecto polipoide que mide 1.5 cms. Al corte superficie lisa de color blanco amarillento. Se toman cortes y se rotulan A. Además, se recibe una elipse de piel que mide 2 cms. y presenta una lesión sobreelevada de 1 cm. Se toman cortes y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A y B revelan un tumor neural constituido por células elongadas, asociados con haces de colágeno y cantidades moderadas de material mucoide.\r\n\r\n\r\n\r\n', ' Resección de tumor en región glútea derecha:\r\n-NEUROFIBROMAS (2)\r\n\r\n', '', ''),
	(2634, 'Q2204-4093', 'Q', '71588034', 'JAIME ALBERTO ZALDIVAR MEDINA', '3174274936', 'M', '62', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA \r\n\r\n', '', ''),
	(2635, 'Q2204-4094', 'Q', '64894701', 'KAREN GARCIA OLIVERA', '000', 'F', '40', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-05-02', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia de endometrio" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 2 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan endometrio con glándulas que muestran atipias estructurales, yemas epiteliales tapizadas por epitelio proliferativo, el estroma abundante.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-HIPERPLASIA ENDOMETRIAL SIMPLE\r\n\r\n', '', ''),
	(2636, 'Q2204-4095', 'Q', '3828450', 'JAIRO PEREIRA HERRERA', '000', 'M', '40', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2637, 'Q2204-4096', 'Q', '717385107101993', 'GABRIELA STEPHANIE RIVERO CANCELADO', '3104417588', 'M', '28', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora LAURISELL GUTIERREZ BLANCHAR', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe fragmento de vesícula biliar que mide 5 x 2 cms. previamente abierta, se recibe pared gruesa, ha perdido su aspecto aterciopelado. Al corte se observan cálculos de color amarillento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA \r\n-COLELITIASIS', '', ''),
	(2638, 'Q2204-4097', 'Q', '45430041', 'JULIANA PINEDA NUÑEZ', '3012487301', 'F', '66', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antral sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(2639, 'Q2204-4098', 'Q', '33111224', 'ISMENIA GARCIA DE ROMERO', '000', 'F', '79', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor PEDRO LUIS IMBET', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado con formación de acúmulos linfoides, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE \r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2640, 'Q2204-4099', 'Q', '1047402197', 'SANDRA DEL CARMEN MARTINEZ VALDES', '3014809405', 'F', '34', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ORLANDO COGOLLO', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Epiplón" se recibe un fragmento de epiplón que mide 8 x 4 cms. de color amarillento, aspecto adiposo en una de sus caras presenta un área membranosa de color pardo claro bien vascularizada. Se toman cortes.\r\n\r\n\r\n\r\n', 'Fragmentos de tejido adiposo maduro bien vascularizado.\r\n\r\n\r\n\r\n', '-FRAGMENTOS DE TEJIDO ADIPOSO MADURO\r\n\r\n', '', ''),
	(2641, 'Q2204-4100', 'Q', '73271306', 'EDUARDO ENRIQUE VILLALBA ARRIETA', '000', 'M', '38', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-05-06', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "producto de resección de masa en muslo izquierdo" se recibe una masa de tejido de forma ovoidea que mide 2 x 2 cms. cubierto totalmente pro piel, de consistencia elástica. Al corte una superficie amarillenta de aspecto adiposo. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes revelan lesión polipoide tapizada por epidermis hiperplásica, el tallo de tejido conectivo y células adiposas.\r\n\r\n\r\n\r\n', ' Resección de masa en muslo izquierdo:\r\n-FIBROMA BLANDO\r\n\r\n', '', ''),
	(2642, 'Q2204-4101', 'Q', '73547861', 'JORGE ELIAS SALAS FUENTES', '000', 'M', '51', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', '', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Lipoma" se reciben varios fragmentos de tejido de forma irregular de aspecto adiposo de color amarillento que promedian un diámetro mayor de 2.5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Resección de lesión en región dorsal:\r\n-LIPOMA\r\n\r\n', '', ''),
	(2643, 'Q2204-4102', 'Q', '9174406', 'ADER MANUEL LEONES ALFARO', '1000', 'M', '54', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-04-29', '2022-04-28', 'OLIVA MARRUGO GRICE', 'Rotulado "Tumor en piel producto de región glútea derecha" se reciben múltiples fragmentos de tejido de forma irregular de aspecto adiposo y consistencia blanda que promedian un diámetro mayor de 5 cms. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan lóbulos de tejido adiposo maduro separados por finos septos de tejido fibroconectivo.\r\n\r\n\r\n\r\n', '-LIPOMA (fragmentos), glúteo derecho\r\n\r\n', '', ''),
	(2644, 'L2204-149', 'L', '1043999533', 'YEINER JOSE MORALES SIERRA', '000', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-04-29', '2022-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Liquido cefalorraquídeo" se reciben 8 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(2645, 'L2204-150', 'L', '1052097392', 'KATRIN ELIZABETH ARIAS ORTEGA', '000', 'F', '4', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '2020304', '23495', 'Doctora HEIDY MARSIGLIA ARMENIA', NULL, '2022-04-29', '2022-04-29', 'OLIVA MARRUGO GRICE', 'Rotulado "Liquido cefalorraquídeo" se reciben 8.5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Extendido acelular.\r\n\r\n\r\n\r\n', ' Citología de líquido cefalorraquídeo:\r\n-EXTENDIDO ACELULAR\r\n', '', ''),
	(2646, 'Q2204-4103', 'Q', '1201216732', 'LUDIS YOHANA OLIVO TEJEDOR', '000', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 0.6 cms. La superficie externa está cubierta por una serosa de color pardo claro con áreas de color pardo oscuro y vasos prominentes. Al corte se encuentra una luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2647, 'Q2204-4104', 'Q', '1142952644', 'ANTHONY LUIAN VILLALBA MARRUGO', '000', 'M', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se reciben varios fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que en conjunto hacen un volumen de 4 ml. en su mayor dimensión. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2648, 'Q2204-4105', 'Q', '1047426589', 'DARLING ALEMAN HERRERA', '000', 'F', '31', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-05-09', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia elástica que mide 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis muestra disminución del pigmento melánico en el estrato basal aunque conserva los melanocitos morfológicamente normales. Hay presencia de melanófagos en el dermis superior.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en piel de la vulva:\r\n-COMPATIBLE CON LEUCODERMA POSTINFLAMATORIA\r\n\r\n\r\n\r\n', '', 'Se sugiere correlacionar con los hallazgos clínicos.\r\n\r\n'),
	(2649, 'Q2204-4106', 'Q', '1137540400', 'KLEYTER DAVID LOPEZ GONZALEZ', '3024449710', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de sinovia de rodilla derecha" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 1.4 x 0.8 x 0.3 cms. en sus mayores dimensiones. Se toma todo en varios cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmento de tejido sinovial cuya superficie articular está recubierta por un material amorfo, eosinofílico, con aspecto de fibrina. Por debajo del mesotelio se encuentra un infiltrado inflamatorio mediado por linfocitos y células plasmáticas. No hay cambios que permitan un diagnóstico específico.\r\n\r\n\r\n', ' Biopsia de sinovia de rodilla derecha:\r\n-SINOVITIS CRÓNICA\r\n\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(2650, 'Q2204-4107', 'Q', '33226975', 'CARMEN YANETH TAPIA FERNANDEZ', '000', 'F', '39', 'ORG. CLINICA GENERAL DEL NORTE', '', '898241', '69000', 'Doctor ALBERTO JOSE ACUÑA ARICO', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado con su nombre, se reciben dos minúsculos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que promedian un diámetro de 1 cm.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de epitelio escamoso dispuesto en un patrón papilomatoso con marcada hiperqueratosis superficial. No se encuentran cambios coilociticos.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vulva:\r\n-PAPILOMA ESCAMOSO\r\n\r\n', '', ''),
	(2651, 'Q2204-4108', 'Q', '1201251277', 'LIAN DAVID BALDIRIS FONTALVO', '3183910086', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoidectomía" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 2 x 1.5 x 0.5 cms. La superficie externa es irregular y al corte se encuentra una superficie homogénea de color blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n\r\n', '', ''),
	(2652, 'Q2204-4109', 'Q', '1002358300', 'SANDRA MILENA OSPINA MEJIA', '000', 'F', '30', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de vulva" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo y consistencia blanda que mide 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel cuya epidermis se proyecta hacia el dermis en nidos que contienen múltiples campos de molusco. En el dermis papilar hay un infiltrado mononuclear intersticial.\r\n\r\n\r\n\r\n', ' Biopsia de lesión en vulva:\r\n-MOLUSCO CONTAGIOSO\r\n\r\n', '', ''),
	(2653, 'Q2204-4110', 'Q', '1201266433', 'HECTOR MIGUEL ESPINOZA ACEVEDO', '3234652220', 'M', '4', 'GASTROPACK SAS', 'AXA COLPATRIA', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" un diminuto fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.1 cms. Se toma todo y se rotulan A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n3. "Cuerpo" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan C.\r\n4. "Bulbo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotulan E.\r\n', 'Los cortes rotulados A muestran mucosa esofágica tapizada por epitelio escamoso sin alteraciones, que reposa en una lámina propia edematosa con moderado infiltrado mononuclear.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran fragmento de mucosa gástrica oxíntica sin alteraciones.\r\nLos cortes rotulados D y E muestran mucosa duodenal cuya lámina propia está edematosa y densamente infiltrada por linfocitos y células plasmáticas. No se encuentran granulomas ni parásitos.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-ESOFAGITIS CRÓNICA\r\n2.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTO DE MUCOSA OXÍNTICA\r\n4.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA SEVERA\r\n5.Biopsia endoscópica de segunda porción del duodeno:\r\n-DUODENITIS CRÓNICA SEVERA', '', ''),
	(2654, 'Q2204-4111', 'Q', '8668121', 'NICOLAS VILLA VELASQUEZ', '000', 'M', '64', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2655, 'Q2204-4112', 'Q', '73065308', 'JULIO ZAMBRANO JULIO', '000', 'M', '58', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Mucosa gástrica" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2656, 'Q2204-4113', 'Q', '101979839', 'NICOLAS PATERNINA HERNANDEZ', '3138300688', 'M', '18', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2657, 'Q2204-4114', 'Q', '9099847', 'JADIS CARMONA LEAL', '000', 'M', '44', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-05-02', '2022-04-30', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Mucosa gástrica" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2658, 'Q2205-4115', 'Q', '6883104', 'RUGERO ENRIQUEZ PEREZ VARGAS', '3158603598', 'M', '62', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se recibe: \r\n1. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.2 cms. Se toma todo y se rotulan A.\r\n2. "cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes A y B muestran mucosa gástrica cuya lámina propia está edematosa, congestiva, infiltrada por linfocitos,  plasmocitos en abundante cantidad y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en escasa cantidad (+/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2. Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n', '', ''),
	(2659, 'Q2205-4116', 'Q', '73072892', 'HERNANDO FRANCISCO ALVAREZ ALVAREZ', '000', 'M', '71', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898241', '69000', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-06', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos  fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.3 y 0.1 cms. Se toma todo y se rotula A.\r\n2. "Lesión elevada en recto" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que miden 0.2 y 0.1 cms. se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes de A revelan fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes B revelan lesión polipoide tapizada por epitelio escamoso que descansan en un tallo fibrovascular.\r\n\r\n\r\n', '1.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de colon:\r\n-POLIPO FIBROEPITELIAL, canal anal', '', ''),
	(2660, 'Q2205-4117', 'Q', '25785793', 'LESBIA GONZALEZ IZQUIERDO', '00', 'F', '36', 'ASEGURADORA DE VIDA SURAMERICANA S.A', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-05-06', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Biopsia de endometrio" se reciben varios fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que juntos promedian 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes revelan endometrio constituido por glándulas dispuestas de manera irregular tapizadas por epitelio proliferativo, el estroma fusocelular con vasos de paredes gruesas.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-POLIPO ENDOMETRIAL DE TIPO HIPERPLASICO\r\n\r\n', '', ''),
	(2661, 'Q2205-4118', 'Q', '73351251', 'LOBALDO MARRUGO BARRIOS ', '3057133873', 'M', '54', 'LIGA CONTRA EL CANCER', '', '898201', '30215', '', NULL, '2022-05-09', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado con su nombre, se reciben dos fragmentos de tejido de forma alargado tapizado en una de sus caras por una piel color pardo claro, el mayor mide 6 x 2.5 x 1.3 cms. y el menor 4.5 x 1.5 x 1 cms., la consistencia es firme. Al corte una superficie lisa, blanquecina. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan piel que muestra lesión quística tapizada por epitelio escamoso, en la luz contiene queratina y ejes de pelo velloso, rodeados de un estroma fibroso que muestra pelos y un infiltrado inflamatorio agudo y crónico con células gigante a cuerpo extraño.\r\n\r\n\r\n', '-QUÍSTE DEL PELO VELLOSO, nuca\r\n\r\n', '', ''),
	(2662, 'Q2205-4119', 'Q', '1052976352', 'MARIA ELOYSSA FIGUEROA ORTEGA', '3022128521', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 1.5 cms. la serosa opaca, despulida y cubierta por material fibrinoso. Al corte la luz ocupada por material oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2663, 'Q2205-4120', 'Q', '1148692016', 'CAMILA VILLERO VILLERO ', '00000', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Cápsula quiste de ovario derecho" se reciben 4 fragmentos de tejidos de forma alargada que promedian 1 cms. Se toman corte.\r\n\r\n\r\n\r\n', 'Los cortes revelan pared de un quíste tapizado por células luteinizadas conteniendo material hemático en su interior.\r\n\r\n\r\n\r\n', '-QUÍSTE LÚTEO HEMORRÁGICO, ovario derecho (Fragmentos)\r\n\r\n', '', ''),
	(2664, 'Q2205-4121', 'Q', '1043658232', 'JOSE EDUARDO VILLAR CARRILLO', '000', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2022-05-09', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Índice izquierdo" se recibe segundo dedo de mano izquierda, en su base rotulado con seda, la piel de color gris está seccionada en el tercer falange, la uña es de color oscuro, negruzco. Al corte se observan áreas de hemorragias. Se toman cortes.\r\n\r\n\r\n', 'El espécimen está representado por piel que rodea un núcleo de tejido fibroadiposo muy vascularizado y enervado, con áreas extensas de hemorrágia intersticial. No se encuentran cambios necrosis.\r\n\r\n\r\n\r\n', ' Resección de falange dedo índice derecho:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2665, 'Q2205-4122', 'Q', '1052973464', 'JHON DEIVIS MARTINEZ QUIROZ', '3233687948', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9 cms, la serosa es opaca y despulida. Al corte la luz ocupada por material blanquecino. Se toman cortes. \r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2666, 'Q2205-4123', 'Q', '1042589328', 'ELIANIS MICHEL HERRERA MARTINEZ', '3137132602', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Adenoides" se reciben varios fragmentos de tejidos de color pardo claro, consistencia blanda que juntas promedian 2 ml. se toma parte.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-ADENOIDITIS CRÓNICA\r\n\r\n', '', ''),
	(2667, 'Q2205-4124', 'Q', '1043644052', 'DAYANA PATRICIA GARCIA MENDOZA', '3003901140', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-09', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Quiste  branquial" Se recibe masa de aspecto quístico previamente evacuada que mide 3 x 3 x 2.2 cms. La superficie externa es de color gris y aspecto carnoso, y la superficie interna de color oscuro. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes revelan lesión quística con ulceración, abundante tejido de granulación y un infiltrado inflamatorio agudo y crónico, dicha lesión está parcialmente tapizada por epitelio escamoso. \r\n\r\n\r\n', '-COMPATIBLE CON QUISTE BRANQUIAL', '', ''),
	(2668, 'Q2205-4125', 'Q', 'VEN452171', 'EMMA LUCIA CHAVEZ RINCON ', '3043018956', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor JAIME VALIENTE DIAZ', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Punta del segundo artejo derecho necrótico" se reciben falange distal con presencia de uña color oscuro que mide 1.5 x 1 x 0.5 cms. Se toman cortes. \r\n\r\n\r\n\r\n', 'Tejidos blandos de dedo que muestra un denso infiltrado inflamatorio agudo y áreas de necrosis.\r\n\r\n\r\n\r\n', ' Extirpación de 2do. artejo derecho con:\r\n-INFLAMACIÓN AGUDA SEVERA Y ÁREAS DE NECROSIS', '', ''),
	(2669, 'Q2205-4126', 'Q', '1052734519', 'LEIDER JOSE CUADRO GARCIA', 'centro', 'M', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor WILLIAN URIBE LUNA', NULL, '2022-05-06', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Tejido óseo de radio distal izquierdo" se reciben dos diminutos fragmentos de tejidos que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Espículas óseas desvitalizadas rodeadas por fragmento de tejido fibroso muscular infiltrado por linfocitos y PMN neutrófilos.\r\n\r\n\r\n', '-OSTEOMIELITIS CRÓNICA, radio izquierdo\r\n\r\n', '', ''),
	(2670, 'Q2205-4127', 'Q', '73376455', 'JOSE DEL CARMEN PADILLA SOLAR ', '000', 'M', '50', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSVALDO BARRAZA LEONES', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" Se recibe un apéndice cecal que mide 6 x 1 cms, la serosa congestiva color pardo claro. Al corte la luz ocupada por material oscuro. Se toma cortes.  \r\n\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2671, 'Q2205-4128', 'Q', '1128044589', 'LEWIS JOSE MENA MIRANDA', '000', 'M', '37', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-05-04', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Apéndice" se recibe apéndice cecal que mide 11 x 1 cms. La serosa es de color pardo oscuro y congestiva. Al corte la luz ocupada por material oscuro. Se toman cortes. \r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n\r\n\r\n', '', ''),
	(2672, 'Q2205-4129', 'Q', '1142946318', 'YESSIA VANESSA CASTRO ZUÑIGA', 'centro', 'F', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-09', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esplenectomía parcial" segmento de bazo que pesa 115 gms. y mide 9 x 7 x 4 cms. cubierto por una fina cápsula color gris, en uno de sus extremos muestra un área cruenta con exposición pulpar. Al corte hay diferenciación de pulpa rosa y blanca. Se toman corte y se rotulan A.\r\n2. "Vesícula" una vesícula biliar de forma piriforme, su serosa es de color verdoso, mide 5 x 2 x 2 cms. Al corte salida de abundante líquido biliar y la presencia de varios cálculos de color oscuro de forma piramidal, el mayor de 0.6 cms. y el menor de 0.2 cms. Las paredes son delgadas y la mucosa conserva el aspecto de terciopelo. Se toman corte y se rotulan B.   \r\n\r\n', 'Los cortes revelan bazo cuya morfología está alterada por áreas extensas de fibrosis, estas áreas están rodeadas por abundantes macrófagos cargados de hemosiderina, en los sinusoides se encuentran abundantes glóbulos rojos falciformes.\r\n\r\nCOMENTARIOS: Los hallazgos son compatibles con lo encontrado en una anemia de células falciformes.\r\n\r\nLos cortes B revelan vesícula biliar que muestra la estructura usual.\r\n\r\n\r\n\r\n\r\n', '1.Esplenectomía parcial (115 gms.):\r\n-VER DESCRIPCIÓN MICROSCÓPICA Y COMENTARIOS\r\n2.COLELITIASIS\r\n', '', ''),
	(2673, 'Q2205-4130', 'Q', '1002203990', 'MARIA DEL CARMEN GUERRERO SAN MARTIN ', '000', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora JENNIFER TORRES GOMEZ', NULL, '2022-05-03', '2022-05-03', 'ANA MAGOLA MANGA CEDEÑO', 'Rotulado "Placenta" se rotula placenta que pesa 91 gms. Y mide 8 x 6 x 2.5 gms. Trae un adherido un segmento de cordón umbilical que mide 18 cms. Tiene tres vasos, la cara fetal está cubierta por una membrana de color pardo claro que mide 15 cms en su mayor dimensión, la cara materna está constituida por múltiples cotiledones de color pardo claro. Se toman cortes.', '', '', '', ''),
	(2674, 'Q2205-4131', 'Q', '45431283', 'LOURDES GONZALEZ MARIMON', '000', 'F', '65', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-09', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran dos fragmentos de mucosa gástrica de tipo antral cuya lámina propia está edematosa e infiltrada por linfocitos y células plasmáticas. No hay alteración del componente glandular, actividad inflamatoria ni presencia de H.pylori. No se encuentran cambios de pólipo.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n', '', ''),
	(2675, 'Q2205-4132', 'Q', '1051418708', 'MARIA FERNANDA DAZA CASTILLO', '000', 'F', '28', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Aborto incompleto" se reciben múltiples fragmentos de tejido de forma irregular de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 5 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por fragmentos de decidua que alternan con coágulos sanguíneos. No se observan elementos trofoblasticos.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-FRAGMENTOS DE DECIDUA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2676, 'Q2205-4133', 'Q', '45436382', 'EDITH DE LOS ANGELES NUÑEZ PATERNINA', '3012782011', 'F', '61', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Úlcera antro gástrico" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en abundante cantidad (+++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica con ulceración superficial. La lámina propia está edematosa, congestiva e infiltrada por PMN neutrófilos y linfocitos. No se observan H.pylori, atrófia, metaplasia intestinal ni cambios neoplásicos.\r\n\r\n', '1.Biopsia endoscópica de antro:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA\r\n2.Biopsia endoscópica de úlcera de antro gástrico:\r\n-GASTRITIS AGUDA Y CRÓNICA\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2677, 'Q2205-4134', 'Q', '1051824055', 'DIANA LUZ BARRIOS DIAZ', '000', 'F', '30', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-05-09', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Endometrio" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro con áreas de color pardo oscuro y consistencia friable que en conjunto hacen un volumen de 3 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran dos estructuras compuestas por gandulas endometriales con irregularidades de forma y tamaño que se disponen en un estroma denso, fusocelular en el que se observan grupos de vasos arteriales. En otros campos se encuentran fragmentos de endometrio proliferativo.\r\n\r\n\r\n\r\n', ' Legrado uterino.\r\n-PÓLIPOS ENDOMETRIALES HIPERPLÁSICOS\r\n-ENDOMETRIO PROLIFERATIVO\r\n\r\n', '', ''),
	(2678, 'Q2205-4135', 'Q', '19365588', 'JOSE EUSTACIO URREA UYABAN', '3004214121', 'M', '67', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-09', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro gástrico" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan A.\r\n2. "Úlcera angular" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo y se rotulan B.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. Hay formación ocasional de acúmulos linfoides. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya lámina propia edematosa, congestiva y densamente infiltrada por linfocitos, células plásticas y neutrófilos. Hay leves atipias del epitelio glándulas de probable origen reactivo. No se identifican H.pylori.\r\n\r\n\r\n', '1.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de lesión en incisura angularis:\r\n-GASTRITIS AGUDA Y CRÓNICA\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2679, 'Q2205-4136', 'Q', 'VEN30902988', 'FRANYELIS KARINA MONTILLA DELGADO', '31224766200', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 9.1 x 0.6 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n\r\n', '', ''),
	(2680, 'Q2205-4137', 'Q', 'VEN26466925', 'YOHULFRE JOSUE MORILLO BARRETO', '3016670935', 'M', '24', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor HERNANDO COBA BARRIOS', NULL, '2022-05-09', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Úlcera colónica" se reciben ocho diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa colónica ulcerada en cuya lámina propia se observan acúmulos de histiocitos, algunos multinucleados (células de Langhans) y otros epitelioides, algunos con necrosis central.\r\nNo hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de colon:\r\n-COLITIS CRÓNICA GRANULOMATOSA COMPATIBLE CON TBC\r\n\r\n', '', ''),
	(2681, 'Q2205-4138', 'Q', '1201245147', 'VALENTINA JULIO GONZALEZ', '3004406837', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2682, 'Q2205-4139', 'Q', '1201254070', 'MATHIAS JOSE LOZANO PALACIO', '3043824979', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Estómago" tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Duodeno" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro sin cambios.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa duodenal que conserva la morfología usual. No se observan parásitos,  granulomas, cambios metaplasicos ni displásicos.\r\n\r\n ', '1.Biopsia endoscòpica de esófago:\r\n-FRAGMENTO DE EPITELIO ESCAMOSO MADURO\r\n2.Biopsia endoscòpica de estómago:\r\n-GASTRITIS CRÒNICA INACTIVA \r\n3.Biopsia endoscòpica de duodenal:\r\n-MUCOSA DUODENAL SIN CAMBIOS\r\n', '', ''),
	(2683, 'Q2205-4140', 'Q', '45507474', 'EUNICE VILLAREAL ALVIS', '000', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Masa en cuello" se recibe un fragmento de tejido de forma irregular de color pardo oscuro y consistencia blanda que mide 0.8 x 0.4 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n\r\n', ' Resección de masa en cuello:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(2684, 'Q2205-4141', 'Q', '1143384864', 'LUIS MANUEL RAMOS MALDONADO', '3045449583', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor MARIO ALBERTO JAIMES GUTIÉRREZ', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Quíste dermoide umbilical" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo y consistencia elástica que mide 1.5 x 0.6 x 0.5 cms. en su mayor dimensión. Al corte se observa una superficie grumosa de color pardo oscuro. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n\r\n', ' Resección de lesión en región umbilical:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(2685, 'Q2205-4142', 'Q', '1238339724', 'FRANGER ANDRES MENDOZA ATENCIO', '3218158927', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 0.8 cms., la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared esta adelgazada y la luz dilatada y contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2686, 'Q2205-4143', 'Q', '1043978438', 'MELANIE PATRICIA PINTO SANTOYA', '3233980034', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS VELEZ DUCAN', NULL, '2022-05-09', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mucosa de oído medio" se reciben dos diminutos fragmentos de tejido de color pardo oscuro y consistencia blanda que promedian 0.1 cm. Se toma todo y se intenta procesar.\r\n\r\n\r\n\r\n', 'Los cortes muestran un fragmento de mucosa del oído medio tapizado en su mayoría por epitelio cilíndrico seudoestratificado ciliado. Hay una pequeña zona tapizada por epitelio escamoso estratificado. Reposan en un corion de tejido conectivo laxo moderadamente infiltrado por linfocitos.\r\n\r\n\r\n', ' Fragmento de mucosa de oído medio derecho:\r\n-INFLAMACIÓN CRÓNICA\r\n\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(2687, 'Q2205-4144', 'Q', '9086685', 'ARTURO ENRIQUE MARRUGO VALETA', '000', 'M', '69', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTEREO', NULL, '2022-05-09', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de masa en región dorsal" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo con áreas de aspecto adiposo que mide 2.2 x 1.7 x 1.5 cms. Al corte se observa una superficie de color pardo oscuro finamente granular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno, mesenquimal, compuesto por la proliferación combinada de elementos adiposos y fibrosos.\r\n\r\n\r\n\r\n', ' Resección de masa en región dorso lumbar:\r\n-FIBROLIPOMA\r\n\r\n', '', ''),
	(2688, 'Q2205-4145', 'Q', '1143392149', 'ESTHER MARINA SUAREZ SOLANO', '3045803176', 'F', '26', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Mioma uterino" se recibe una masa de tejido de forma irregular de color pardo rosado que mide 2 x 1.2 x 1.2 cms. La superficie externa es multilobulada y se observa una superficie de color pardo claro y aspecto arremolinado. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n', '-LEIOMIOMA UTERINO (miomectomía)\r\n\r\n', '', ''),
	(2689, 'Q2205-4146', 'Q', '45420717', 'SONIA ESTHER MARRUGO BANQUEZ', '3145110308', 'F', '65', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-06', '2022-05-05', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro gástrico" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa gástrica antral cuya lámina propia es edematosa y está infiltrada por linfocitos y neutrófilos. Hay presencia de H.pylori en pequeña cantidad.\r\nEn la muestra enviada no se observan cambios displásicos, atróficos ni metaplásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA LEVE\r\n\r\n', '', ''),
	(2690, 'L2205-151', 'L', '45545966', 'MARIA TERE BELEÑO GARCIA', '000', 'F', '40', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-05-06', '2022-05-06', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "ACAF seno izquierdo" 4 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento, se rotula A.\r\n2. "ACAF seno izquierdo" 25 ml. de un líquido de color pardo oscuro. Se centrifuga y se hace extendido del sedimento, se rotula B.\r\n\r\n\r\n', 'Los extendidos rotulados A y B son acelulares.\r\n\r\n\r\n\r\n', '1.ACAF de mama izquierda:\r\n-EXTENDIDO ACELULAR\r\n2.ACAF de mama izquierda:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(2691, 'L2205-152', 'L', '1080651281', 'ISABELLA PAVA ACUÑA', '000', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora AYSLIN GONZALEZ CABARCAS', NULL, '2022-05-06', '2022-05-06', 'VIRNA CARABALLO OSORIO', 'Rotulado "Líquido cefalorraquídeo" se reciben 6 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos son acelulares.\r\n\r\n\r\n\r\n', ' Citología de LCR:\r\n-EXTENDIDOS ACELULARES\r\n\r\n', '', ''),
	(2692, 'Q2205-4147', 'Q', '9056625', 'LUIS GAMARRA', '000', 'M', '78', 'ECOPETROL S.A', '', '898201', '30215', 'Doctor JAIME OLIVARES TAYLOR', NULL, '2022-05-09', '2022-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una elipse de piel que mide 0.8 x 0.5 cms. de color pardo grisáceo y consistencia elástica. Se toma todo.\r\n\r\n\r\n', 'Los cortes revelan piel con un tumor epitelial constituido por nidos de células basaloides que se disponen periféricamente en empalizada, la piel muestra áreas de ulceración. Los bordes se encuentran libres.\r\n\r\n\r\n\r\n', ' Biopsia de piel de ala nasal derecha:\r\n-CARCINOMA DE CÉLULAS BASALES PATRÓN SÓLIDO, ULCERADO\r\n-BORDES DE RESECCIÓN LIBRES DE RESECCIÓN\r\n\r\n', '', ''),
	(2693, 'Q2205-4148', 'Q', '1102585473', 'LIONAR JOSE MENDEZ RIVAS', '3117852754', 'M', '8', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-05-19', '2022-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado "Quíste de cordón espermático derecho"  se recibe una formación nodular que mide 2 x 2 x 1 cms. de color pardo grisáceo bien vascularizado. Al corte hay salida de un líquido claro y la presencia de una cavidad multilocular. Se toman cortes.\r\n\r\n', 'Los cortes revelan lesión quística tapizada por células columnares, la pared de fibroconectivo densamente infiltrada por eosinófilos.\r\nNo se observan cambios malignos.\r\n\r\n', '-QUISTE DEL CORDÓN ESPERMÁTICO DERECHO.\r\n ', '', ''),
	(2694, 'Q2205-4149', 'Q', '1048441437', 'JESUS DAVID LLAMAS DUEÑAS', '3013168833', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-09', '2022-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6 x 1 cms. tapizada pro una serosa opaca bien vascularizada, trae adherido material fibrinopurulento. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared, se extiende hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n\r\n', '', ''),
	(2695, 'Q2205-4150', 'Q', '1043330127', 'SEBASTIAN YESID ESCALONA YANEZ', '3226035074', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-05-09', '2022-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado "Adenoides" se recibe fragmento de tejido que mide 2.8 x 2 cms. de color blanquecino y consistencia elástica, la superficie multilobular. Se toman cortes.\r\n\r\n\r\n\r\n', 'Amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2696, 'Q2205-4151', 'Q', '73065308', 'JULIO ZAMBRANO JULIO', '000', 'M', '58', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora ADRIANA PAOLA LOPEZ', NULL, '2022-05-09', '2022-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado "Masa mediastinal" se reciben tres fragmentos de tejido de forma irregular que promedian un diámetro  de 1 cms. superficie lisa, consistencia elástica. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan un tumor epitelial maligno constituido por células grandes de núcleos pleomórficos, hipercromáticos, abundante citoplasma que se disponen en nidos, hay zonas extensas de necrosis.\r\n\r\n\r\n', ' Biopsia mediastinal:\r\n-CARCINOMA DE CÉLULAS ESCAMOSAS MODERADAMENTE DIFERENCIADO\r\n\r\n', '', ''),
	(2697, 'Q2205-4152', 'Q', 'VEN20442785', 'JOHANA ANDREINA TORRES PACHECO', '00', 'F', '33', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2022-05-09', '2022-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado "Mioma" se reciben dos formaciones nodulares que mide la mayor 1.5 x 1 cms. y la menor de 1 x 0.5 cms. de color blanquecino. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos.\r\n\r\n\r\n\r\n', ' Miomectomía:\r\n-LEIOMIOMAS (2)\r\n\r\n', '', ''),
	(2698, 'Q2205-4153', 'Q', '32733388', 'BETTY LUZ PEREZ RAMIREZ', '00', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2022-05-09', '2022-05-07', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero, trompas, cuello" se recibe un útero con anexos y cuello por separado, pesa 1843 gms. El cuello mide 5 x 3 x 2 cms. tapizado por una mucosa blanquecina con orificio puntiforme, el canal endocervical es permeable, el cuerpo uterino mide 18 x 14 x 14 cms. presenta múltiples masas a nivel subseroso y al corte la cavidad endometrial está rechazada por múltiples masas intramurales, la mayor de las cuales mide 10 x 10 x 5 cms. de color blanquecino y aspecto arremolinado, la menor mide 1 x 0.5 cms. El ovario izquierdo mide 3 x 2 cms. la trompa mide 5 cms. son macroscópicamente normales. El ovario derecho mide 3 x 2 cms. La trompa mide 4.5 cms. y muestran la estructura usual. Se toman cortes.\r\n\r\n', 'Cérvix con una reacción inflamatoria crónica. El endometrio se encuentra autolisado. Las múltiples masas intramurales, subserosas y submucosos corresponden a leiomiomas.\r\nLos ovarios y las trompas muestran su morfología usual.\r\n\r\n\r\n', ' Útero y anexos (1.843 gms.):\r\n-CERVICITIS CRÓNICA\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS\r\n-OVARIOS\r\n-TROMPAS', '', ''),
	(2699, 'L2205-153', 'L', '1103748655', 'YOFRAN STIVEN PADILLA TEHERAN', '321684365', 'M', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora AYSLIN GONZALEZ CABARCAS', NULL, '2022-05-11', '2022-05-09', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Líquido cefalorraquídeo" se reciben 4.5 ml. de un líquido transparente. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n\r\n', 'El extendido es acelular.\r\n\r\n\r\n\r\n', ' Citología de LCR:\r\n-EXTENDIDO ACELULAR\r\n\r\n', '', ''),
	(2700, 'L2205-154', 'L', '45556275', 'ALMA ELENA DURAN CORREA', '00', 'F', '39', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-05-11', '2022-05-09', 'JOSÉ CARABALLO GRACIA', 'Rotulado "ACAF de seno derecho" se recibe 17 ml. de un líquido de color pardo claro. Se centrifuga y se hace extendido del sedimento.\r\n\r\n\r\n\r\n', 'Los extendidos muestran únicamente sangre. No se observan elementos propios del tejido mamario.\r\n\r\n\r\n\r\n', ' ACAF de mama derecha:\r\n-EXTENDIDO HEMORRÁGICO\r\n\r\n\r\n\r\n', '', ''),
	(2701, 'Q2205-4154', 'Q', '45543778', 'LIANIS MARGARITA SIMANCA PARDO', '000', 'F', '40', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JOSE BLANCO RICARDO', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Embarazo ectópico" se recibe una trompa de Falopio que mide 6 x 1.2 cms. en su extremo proximal se encuentra una zona de dilatación de la que se proyecta hacia afuera un gran coágulo sanguíneo. Al corte de esta zona, se encuentra la luz marcadamente dilatada en continuidad con los coágulos descritos en el exterior y una pequeña estructura en forma de vesícula que mide 0.7 cms. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran trompa de Falopio en cuya luz se encuentra tejido placentario representado por vellosidades morfológicamente normales, que infiltran la pared.\r\n\r\n\r\n\r\n', ' Salpingectomía derecha:\r\n-EMBARAZO ECTÓPICO TUBÁRICO\r\n\r\n', '', ''),
	(2702, 'Q2205-4155', 'Q', '6397396', 'YENNI ESTHER OSPINO BELEÑO', '000', 'F', '27', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado"Mioma" se recibe una masa de tejido de forma ovoide que mide 7.5 x 5.5 x 5 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte es de color blanquecino y aspecto fasciculado. Se toman cortes. \r\n\r\n\r\n', 'Los cortes muestran Tumor benigno mesenquimal compuesto por fibras musculares lisas dispuestas irregularmente en haces entrecruzados y ovillos. El tumor presenta áreas extensas de hialinización y de calcificación distrófica.\r\n\r\n\r\n', '-LEIOMIOMA UTERINO, (miomectomía).', '', ''),
	(2703, 'Q2205-4156', 'Q', '64567799', 'DIANA CATALINA RAMIREZ', '1000', 'F', '48', 'SEGUROS BOLIVAR S.A', '', '898201', '30215', 'Doctora MANUELA BERROCAL', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Cápsula periprotesica mama derecha" una estructura membranosa de forma irregular que mide 14 x 14 cms. en sus mayores dimensiones por una de sus caras es lisa y por la otra es irregular con múltiples adherencias de tejido y aspecto graso. Se toman cortes y se rotulan A. \r\n2. "Cápsula periprotesica mama izquierda" una estructura membranosa de forma irregular, esencialmente similar ala descrita que mide 13 x 12 cms en sus mayores dimensiones.  Se toman cortes y se rotulan B. \r\n3. Rotulado "Masa en cuadrante superoexterno derecho" un fragmento de tejido d forma irregular que mide 2.5 x 1.8 x 1 cms. en sus mayores dimensiones la superficie externa es irregular y al corte se encuentra  color blanquecino. Se toman cortes. Se rotula C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran una pared fibrosa que por una de sus caras está tapizada por tejido sinovial. En la cara externa contiene fragmentos de tejido mamario con cambios de condición fibroquística. No hay cambios inflamatorios ni neoplásicos. \r\nLos cortes rotulados C muestran tejido mamario cuya morfología está alterada por la presencia de quistes de pequeño y mediano calibre, algunos tapizados por epitelio de tipo apocrino. Estos quistes alternan con focos de proliferación de estructura glandulares sin atipias (adenosis). Reposan en un estroma  fibroescleroso.\r\n\r\n\r\n\r\n   ', '1. CÁPSULA PERIPROTESICA DE MAMA DERECHA (Resección)\r\n2. CÁPSULA PERIPROTESICA DE MAMA  IZQUIERDA (Resección)\r\n3-Resección de nódulos en cuadrante supero externo de mama derecha:\r\n-CONDICIÓN FIBROQUÍSTICA CON FOCOS DE ADENOSIS.', '', ''),
	(2704, 'Q2205-4157', 'Q', '1143327717', 'SHEYLA PAOLA PEREZ CASSIANI', '00', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', ' Rotulado "Apéndice" se recibe un apéndice cecal que mide 11 x 2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa color pardo claro con áreas color pardo oscuro, aspecto necrótico. Al corte se encuentra una luz dilatada que  contiene un material grumoso de color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2705, 'Q2205-4158', 'Q', '6032922', 'GILLERMO DANIEL ROCA ZAPATA', '000', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-17', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tumor intraperitoneal" se recibe una masa de tejido de forma irregular de color pardo claro y consistencia pétrea que mide 3 x 2.7 x 2 cms. en sus mayores dimensiones, la superficie externa es irregular y al corte se encuentra una superficie de color amarillento. Se toman cortes.  \r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor maligno compuesto por células de tamaño mediano, con citoplasma acidofilico de límites imprecisos y núcleos irregulares, vacuolados, con la cromatina en grumos y con mitosis frecuentes, que se disponen en nidos sólidos que reposan en un estroma desmoplásico.\r\n\r\n\r\n\r\n', ' Biopsia de masa intraperitoneal:\r\n-TUMOR MALIGNO MAL DIFERENCIADO\r\n\r\n\r\n', '', 'Algunas características del tumor sugieren un linaje epitelial (¿urotelial?), sin embargo, es imprescindible practicar estudios de inmunohistoquímica para una definición diagnóstica precisa.\r\n\r\nEl caso fue estudiado en conjunto con la doctora Virna Caraballo.\r\n\r\nNOTA: Re retiran 4 bloques por el señor ISIDRO ROCA BERMUDEZ CC. 73.134.308 (17/myo/2022)'),
	(2706, 'Q2205-4159', 'Q', '45508566', 'CAROLINA DELGADO OLIER', '000', 'F', '48', 'PARTICULAR', '', '898201', '30215', 'Doctora MANUELA BERROCAL', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se recibe:\r\n1. "Cápsula periprotesica mama izquierda" una estructura membranosa sacular, que mide 8.5 x 8 cms. la superficie interna es lisa de color grisáceo y la exterior es irregular con múltiples adherencias de tejido aspecto graso. Se toman cortes y se rotulan A. \r\n2. "Cápsula periprotesica mama derecha" una estructura membranosa sacular que mide 8.5 x 8 cms. macroscópicamente, es esencialmente similar ala descrita. Se toman cortes y se rotulan B.\r\n3. Un tercer recipiente "Quiste mama izquierda" un fragmento de tejido de forma irregular de color pardo claro con áreas amarillentas y consistencia elástica que mide 1.8 x 1.5 x 1 cms. en sus mayores dimensiones. La superficie externa es irregular y al corte se encuentra una superficie de color blanquecino con una pequeña cavidad multilocular de 0.7 cms. de diámetro.  Se toman cortes y se rotula C.\r\n4. "Quiste mama izquierda" un fragmento de tejido de forma irregular, color blanquecino, inconsistencia elástica que mide 3.5 x 2 x 1.5 cms. La superficie externa es irregular, de color pardo claro, con áreas amarillentas. Al corte se encuentra una superficie irregular de color blanquecino. Se toman corte y se rotula D.  \r\n\r\n', 'Los cortes rotulados A y B muestran una pared fibrosa tapizada por en uno de sus lados por tejido sinovial y por el otro por tejido adiposo. En  el espécimen rotulado B se encuentra una zona de adelgazamiento que en la parte externa muestra un acúmulo de histiocitos.\r\nLos cortes rotulados C y D muestran tejido mamario en el que se encuentran quístes de diferentes calibres, que reposan en un estroma fibroescleroso. No se encuentran cambios proliferativos.\r\n\r\n\r\n', '1.CÁPSULA PERIPROTESICA DE MAMA IZQUIERDA (Resección)\r\n2.CÁPSULA PERIPROTESICA DE MAMA DERECHA (Resección)\r\n3.Biopsia de lesión en cuadrante infero-lateral de mama izquierda.\r\n-CONDICIÓN FIBROQUÍSTICA\r\n4.Biopsia de lesión en cuadrante inferolateral de mama derecha:\r\n-CONDICIÓN FIBROQUÍSTICA\r\n\r\n', '', 'Ver descripción microscópica.\r\n'),
	(2707, 'Q2205-4160', 'Q', '1045757548', 'FRANK JUNIOR BARRIOS ACERO', '000', 'M', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora ANA MARIA OTOYA', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'en recipientes separados y rotulados, se recibe:\r\n1. "Amígdala derecha" una amígdala palatina que mide 2.5 x 1.5 x 1.2 cms. la superficie externa está cubierta por una mucosa irregular, color pardo claro.  Al corte se encuentra una superficie de color pardo claro con un punteado pardo oscuro. Se toman cortes y se rotula A. \r\n2."Amígdala izquierda" una amígdala palatina esencialmente similar ala anterior.  Se toman cortes y se rotula B. \r\n3. "Adenoides" un fragmento de tejido irregular, de color pardo claro y consistencia blanda, que mide 3 x 1.5 x 1 cms. en sus mayores dimensiones la superficie externa es irregular y al corte se encuentra una superficie color pardo claro. Se toman corte y se rotulan C.\r\n\r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n\r\n', '1.AMIGDALITIS CRÓNICA\r\n2.HIPERPLASIA ADENOIDEA\r\n\r\n', '', ''),
	(2708, 'Q2205-4161', 'Q', '23002695', 'MARTA BEATRIZ LOPEZ MENDOZA', '000', 'F', '42', 'CLINICA GENERAL DEL CARIBE SA.', 'C.', '898201', '30215', 'Doctor ANGEL VASQUEZ PAJARO', NULL, '2022-05-18', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados se reciben: \r\n1. "Cono" se recibe el producto de una conización cervical que mide 3 x 3 x 1.2 cms en sus mayores dimensiones, trae un reparo que señala la hora 12:00 en punto. La superficie externa está rodeada por una mucosa irregular de color pardo claro, rodea un orifico exterior entre abierto. Se lamina en su totalidad y se rotula así: se toman seis cortes del labio anterior y se rotulan A, se toman seis cortes del labio posterior y se rotulan B. \r\n2. Un segundo recipiente rotulado "tejido endometrial" contiene minutos fragmentos de tejido color blanco, grisáceo y consistencia blanda. Se toma todo y se rotula C.\r\n\r\n\r\n', 'Los múltiples cortes rotulados A muestran cuello uterino con inflamación crónica, metaplasia escamosa y una LIE de bajo grado (NIC 1)  con cambios de coilociticos.\r\nLos cortes rotulados B muestran cuello uterino con inflamación crónica.\r\nLos cortes rotulados C muestran fragmentos de endometrio del segmento uterino inferior sin alteraciones.\r\n\r\n\r\n\r\n\r\n', '1.Conización cervical:\r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA Y LIE DE BAJO GRADO (NIC 1) CON CAMBIOS SECUNDARIOS A INFECCIÓN POR HPV (labio anterior) \r\n-CERVICITIS CRÓNICA CON METAPLASIA ESCAMOSA (labio posterior)\r\n\r\n2.Legrado endometrial:\r\n-ENDOMETRIO DEL SEGMENTO UTERINO INFERIOR.', '', ''),
	(2709, 'Q2205-4162', 'Q', '311137968', 'MARTHA DE LA CRUZ MORALES DE FLOREZ', '000', 'F', '70', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos  fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan A.\r\n2. "Pólipo de antro" dos  fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo y se rotulan B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B y C muestran fragmento de mucosa gástrica antral cuya lámina propia  está edematosa, congestiva y densamente infiltrada por linfocitos y células plasmáticas. No se encuentran cambios neoplásicos.\r\n\r\n', '1.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2.Biopsia endoscópica de lesión en antro gástrico:\r\n-FRAGMENTO DE MUCOSA ANTRAL CON INFLAMACIÓN CRÓNICA\r\n\r\n', '', ''),
	(2710, 'Q2205-4163', 'Q', '73113419', 'RAFAEL RODRIGUEZ CORTECERO', '000', 'M', '72', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JUAN GUEVARA SERNA', NULL, '2022-05-17', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Tumor en la T-11" un fragmento de tejido color pardo claro que mide 1.5 x 1 x 1 cms. consistencia elástica, la superficie externa es irregular y al corte se encuentra una superficie color blanquecina con áreas pardo oscura. Se toman cortes y se rotulan A. \r\n2. "Apófisis transversal derecha T-11" un fragmento de tejido óseo que mide 1.8 x 1 x 1 cms. en sus mayores dimensiones. Al corte se encuentra una superficie granular de color pardo claro. Se pone a descalcificar y se rotulan B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran un tumor maligno epitelial compuesto por células grandes, de citoplasma claro y nucleos pleomórficos con nucleolo prominente, que se disponen en un patrón sólido sobre un estroma fibroso.\r\nLos cortes rotualdos B muestran hueso esponjoso sin alteraciones.\r\n\r\n\r\n\r\n', '1.Biopsia de tumor en T-11:\r\n-CARCINOMA DE CÉLULAS CLARAS\r\n2.Biopsia de apófisis transversal derecha de T-11:\r\n-FRAGMENTO DE HUESO ESPONJOSO\r\n\r\n\r\n', '', 'Se sugiere la posibilidad de un primario en riñon.\r\nVer descripción microscópica.'),
	(2711, 'Q2205-4164', 'Q', '1143376359', 'FRANK DAVIS VARGAS MARIMON ', '3203557069', 'M', '9', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor IVAN DARIO JIMENEZ SANCHEZ', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8 x 0.8 cms., la superficie externa está cubierta por una serosa de color pardo oscuro con vasos prominentes. Al corte se encuentra una luz dilatada que contiene abundante material fecal. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', '-APENDICITIS AGUDA\r\n\r\n', '', ''),
	(2712, 'Q2205-4165', 'Q', '1043336747', 'YORELIS TORRES LEONES', '3118886735', 'F', '2', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia de lengua" se reciben tres fragmentos de tejido de forma irregular  de color blanquecino y consistencia blanda que promedian un diámetro de 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está constituido por tejido de granulación densamente infiltrado por linfocitos, macrófagos y neutrófilos. en la superficie se encuentra un tejido necrótico con abundantes colonias de bacterias. No hay cambios neoplásicos.\r\n\r\n\r\n', ' Biopsia de lesión en lengua:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n', '', ''),
	(2713, 'Q2205-4166', 'Q', '1043645588', 'GUILLERMO GUERRERO PEÑA', '3017442159', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Tejido muscular pierna izquierda" se reciben varios fragmentos de tejido de forma irregular de color pardo oscuro y consistencia blanda que conjunto hacen un volumen de 4 ml. Se toma todo.\r\n\r\n\r\n\r\n', 'El espécimen está compuesto por tejido conectivo laxo con áreas extensas de necrosis e infiltración por linfocitos y neutrófilos. Se observan, además, abundantes colonias de bacterias.\r\nNo hay elementos musculares en la muestra.\r\n\r\n\r\n', ' Biopsia de lesión en pierna izquierda:\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n ', '', ''),
	(2714, 'Q2205-4167', 'Q', '72314811', 'LUIS MANUEL VARELA FONTALVO', '000', 'M', '40', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2715, 'Q2205-4168', 'Q', '1260470', 'ELIZABETH ANDREINA JIMENEZ CASTILLO', '000', 'F', '30', 'PARTICULAR', '', '898201', '30215', 'Doctor ALVARO MONTERROSA CASTRO', NULL, '2022-05-11', '2022-05-10', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Material endometrial" se reciben múltiples fragmentos de tejido de forma irregular de color pardo claro que en conjunto hacen un volumen de 10 ml. Se toma parte.\r\n\r\n\r\n\r\n', 'Los cortes muestran fragmentos de endometrio cuyo estroma presenta cambios avanzados de transformación decidual. Hay infiltración por linfocitos y neutrófilos. Las glándulas están tapizadas por un epitelio bajo. No se identifican cambios hiperplásicos ni elementos trofoblásticos.\r\n\r\n\r\n\r\n', ' Legrado uterino:\r\n-ENDOMETRIO CON TRANSFORMACIÓN DECIDUAL E INFLAMACIÓN AGUDA\r\n\r\n\r\n\r\n', '', 'Aunque no se identifican elementos trofoblásticos, los hallazgos sugieren un embarazo previo.\r\n\r\n'),
	(2716, 'Q2205-4169', 'Q', '45758949', 'GLADIS ESTER PAJARO BARRIOS', '000', 'F', '80', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Exocervix" se reciben tres diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia friable que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran un tumor epitelial maligno compuesto por células escamosas con núcleos pleomórficos, hipercromáticos, que se disponen en un patrón sólido que infiltran el estroma. Hay queratinización individual ocasional.\r\n\r\n\r\n\r\n', ' Biopsia de cérvix:\r\n-CARCINOMA DE CÉLULAS ESCAMOSAS MODERADAMENTE DIFERENCIADO, INFILTRANTE\r\n\r\n', '', ''),
	(2717, 'Q2205-4170', 'Q', '45506898', 'ROSARIO VARGAS ORTEGA', '000', 'F', '64', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor HUMBERTO BLANCO', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n', ' Biopsia endsocópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n', '', ''),
	(2718, 'Q2205-4171', 'Q', '1048661373', 'JESUS DANIEL OCHOA BARROS', '00', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Nevo melanocitico" se recibe un fragmento discoide de piel de color pardo claro y consistencia elástica que mide 0.4  x 0.2 cms. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se destaca una proliferación de células nevicas que se disponen en nidos sólidos y cordones. El tumor compromete el margen profundo de resección.\r\n\r\n\r\n\r\n', ' Biopsia de lesión de piel en región occipital:\r\n-NEVO MELANOCITICO INTRADÉRMICO\r\n-VER DESCRIPCIÓN MICROSCÓPICA', '', ''),
	(2719, 'Q2205-4172', 'Q', '45507422', 'MARIA ARRIETA PITALUA', '000', 'F', '49', 'PARTICULAR', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vagina" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa vaginal tapizada por epitelio escamoso con hiperqueratosis, acantosis irregular y cambios citopáticos pro VPH.\r\n\r\n\r\n\r\n', ' Biopsia de vagina:\r\n-CONDILOMA PLANO\r\n\r\n', '', ''),
	(2720, 'Q2205-4173', 'Q', '1043307773', 'VALENTINA POLO CUETER', '000', 'F', '12', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-05-18', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan A.\r\n2. "Antro" dos diminutos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan B.\r\n3. "Cuerpo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotulan D.\r\n5. "Segunda porción" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. en su mayor dimensión. Se toma todo y se rotulan E.', 'Los cortes rotulados A muestran fragmentos sueltos de epitelio escamoso maduro. Sin cambios.\r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados C muestran mucosa oxíntica cuya lámina que conserva la morfología usual. La lámina propia está edematosa, congestiva e infiltrada por linfocitos. No se observa actividad inflamatoria, H.pylori, atrófia ni cambios displásicos.\r\nLos cortes rotulados D muestran mucosa duodenal que conserva la morfología usual. No se observan parásitos, granulomas ni cambios displásicos.\r\nLos cortes rotulados E muestran mucosa duodenal con edema, congestión e infiltración mononuclear de la lámina propia. No se observan parásitos, granulomas ni cambios displásicos.', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTOS SUELTOS DE EPITELIO ESCAMOSO SIN CAMBIOS\r\n2.Biopsia endoscópica de estómago (antro):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n3.Biopsia endoscópica de estómago (cuerpo):\r\n-GASTRITIS CRÓNICA INACTIVA\r\n4.Biopsia endoscópica de duodeno (bulbo):\r\nMUCOSA DUODENAL SIN CAMBIOS\r\n5.Biopsia endoscópica de duodeno (2da. porción):\r\n-DUODENITIS CRÓNICA', '', ''),
	(2721, 'Q2205-4174', 'Q', '1047406231', 'MARILIN ALVAREZ MITOLA', '3024155576', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados, se reciben:\r\n1. "Nódulo mamario derecho" masa de tejido de forma irregular, de color pardo claro y consistencia elástica, que mide 2.7 x 1.6 x 1.7 cms. La superficie externa es multilobulada y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan A.\r\n2.  "Nódulo mamario izquierda" dos masas de tejido de forma irregular, de color pardo claro y consistencia elástica, que miden 2.8 x 2.5 x 2.5 y 2 x 1.7 x 1.2 cms. La superficie externa es multilobulada y al corte se observa una superficie homogénea de color pardo claro. Se toman cortes y se rotulan B.\r\n\r\n', 'Los cortes rotulados A y B muestran tumores benignos compuestos por la proliferación combinada de elementos glandulares y estromales.\r\n\r\n\r\n', '1.Resección de nódulo mamario derecho:\r\n-FIBROADENOMA\r\n2.Resección de nódulo mamario izquierdo:\r\n-FIBROADENOMA (2)\r\n\r\n', '', ''),
	(2722, 'Q2205-4175', 'Q', '1235043986', 'LIANNA CAROLINA MARTINEZ FIGUEROA', '3204823434', 'F', '23', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos en moderada cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA MODERADA\r\n\r\n', '', ''),
	(2723, 'Q2205-4176', 'Q', '45423804', 'ANA JOSEFA BENITEZ SUAREZ', '000', 'F', '65', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Producto de masa en región dorsal" se recibe un fragmento de tejido de forma irregular de color pardo grisáceo y aspecto membranoso que mide 2.2 x 1.8 cms. en sus mayores dimensiones. Al corte se observa una cavidad que contiene material de aspecto grumoso. \r\n\r\n\r\n\r\n', 'Los cortes muestran una estructura quística tapizada por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n\r\n\r\n', ' Resección de masa en región dorsal:\r\n-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE\r\n\r\n', '', ''),
	(2724, 'Q2205-4177', 'Q', '3404846', 'HUMBERTO GOMEZ BUSTAMANTE', '3205667113', 'M', '81', 'GASTROPACK SAS', 'SEGUROS BOLIVAR S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-19', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Estómago" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.', 'Los cortes muestran mucosa gástrica antral en la que se observa una zona de proliferación de estructuras tubulares adosadas entre sí, tapizadas por epitelio cilíndrico simple con leves atipias nucleares.\r\nEn otro campo se observa un grupo de células sueltas con atipias nucleares moderadas y citoplasma acidofílico que justifican un seguimiento de cerca del paciente o la toma de una nueva biopsia.\r\n\r\n\r\n', 'Biopsia endoscópica de estómago:\r\n-ADENOMA TUBULAR \r\n-VÉASE DESCRIPCIÓN MICROSCÓPICA. \r\n\r\n', '', 'Este caso fue visto en junta de patólogos con la participación de los doctores Oliva Marrugo y José Caraballo.\r\n\r\n'),
	(2725, 'Q2205-4178', 'Q', '73088412', 'OSVALDO MUÑOZ VENECIA', '000', 'M', '63', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor CANTILLO - JAIME CABARCAS', NULL, '2022-05-25', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia hepática" se recibe un fragmento de tejido color pardo oscuro que mide 1.5 x 1.2 x 0.5 cms. Al corte se observan una superficie color pardo claro homogéneo. Se toma todo.\r\n\r\n\r\n\r\n ', 'Los cortes muestran hígado cuya morfología está alterada por la presencia de bandas fibrosas que se extienden entre los espacios porta formando nódulos. Estas bandas contienen abundantes células inflamatorias mononucleares y en algunas se encuentran cambios necróticos individuales en su interfase con el parénquima de los nódulos. Los hepatocitos de los nódulos han perdido su disposición cordonal y aproximadamente el 50% muestra metamorfosis grasa. No se encuentran cambios displásicos ni neoplásicos.\r\n\r\n\r\n ', 'Biopsia de hígado:\r\n-CIRROSIS MICRONODULAR CON ACTIVIDAD NECROINFLAMATORIA MODERADA.\r\n\r\n', '', 'VÉASE DESCRIPCIÓN MICROSCÓPICA'),
	(2726, 'Q2205-4179', 'Q', '10188417941', 'LAURA MALDONADO GARCIA', '000', 'F', '33', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-14', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Antro" se recibe cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda, que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran mucosa gástrica cuya lámina propia esta edematosa, congestiva, infiltrada por linfocitos, células plasmáticas y PMN neutrófilos, en abundante cantidad. Hay formación ocasional de acúmulos linfoides. En las luces glandulares se observan H.pylori en moderada cantidad (++/+++). No hay atrófia, metaplasia intestinal ni cambios displásicos.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n - GASTRITIS CRÓNICA POR H.PYLORI CON ACTIVIDAD INFLAMATORIA SEVERA.\r\n', '', ''),
	(2727, 'Q2205-4180', 'Q', '73572858', 'GONZALO VALENCIA GONZALEZ', '00', 'M', '46', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor HERNAN CALDERON MORON', NULL, '2022-05-18', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenopatía inguinal ascendida" se reciben dos fragmentos de tejido forma irregular color pardo grisáceo con áreas amarillentas y consistencia elástica que mide 3.5 x 2 x 2 cms. y 4 x 1.5 x 1.5 cms. Al corte uno de los fragmentos se observa una capa homogénea color pardo claro. Se toman corte. El otro fragmento muestra una superficie untuosa color pardo amarillento. Se toman cortes.  \r\n\r\n', 'El espécimen presenta defectos de fijación.\r\nLos cortes muestran ganglio linfático con un proceso inflamatorio agudo con formación de absceso que compromete la totalidad del espécimen. No se observan granulomas, cambios neoplásicos ni otros cambios que permitan un diagnóstico específico.\r\n\r\n\r\n', ' Resección de conglomerado ganglionar en región inguinal derecha:\r\n-LINFADENITIS AGUDA CON FORMACIÓN DE ABSCESO\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n', '', ''),
	(2728, 'Q2205-4181', 'Q', '45481000', 'NINFA ARROYO RODRIGUEZ', '00', 'F', '54', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula"  se recibe una vesícula  biliar que mide 7 x 2.5 cms. La superficie externa está parcialmente cubierta por una serosa despulida, la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de múltiples fragmentos cálculos color pardo amarillento. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(2729, 'Q2205-4182', 'Q', '64546858', 'DEXY GARCIA DURAN ', '0000', 'F', '62', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 6 x 2 cms. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte está completamente ocupada por cálculos de color pardo amarillento, la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2730, 'Q2205-4183', 'Q', '22796940', 'CARMEN DIAZ BAHORQUEZ', '000', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor CANTILLO - JAIME CABARCAS', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7.8 x 2.2 cms. La superficie externa está parcialmente cubierta por una serosa despulida y al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de numerosos cálculos pequeños fascetados. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2731, 'Q2205-4184', 'Q', '45495181', 'JANETH BLANQUICETH MARRUGO ', '000', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 9.2 x 3 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está marcadamente engrosada y la luz está ocupada por un material biliar espeso que contiene numerosos cálculos fascetados. Se toman cortes.  \r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS\r\n\r\n', '', ''),
	(2732, 'Q2205-4185', 'Q', '36528292', 'LUZ MIRIAM GOMEZ DE PALOMINO', '000', 'F', '70', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-14', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula"  se recibe una vesícula  biliar que mide 6.8 x 3.5 cms. La superficie externa está parcialmente cubierta por una serosa despulida, y al corte hay salida de fragmentos de cálculos. la pared está marcadamente engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes. \r\n\r\n\r\n', 'Los cortes muestran una vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.', '', ''),
	(2733, 'Q2205-4186', 'Q', '73008696', 'RICRARD ZAMBRANO BOSSIO', '000', 'M', '36', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-14', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7.5 x 1.5 cms. La superficie externa está parcialmente cubierta por una serosa despulida y al corte la pared está engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de numerosos cálculos pequeños fascetados color pardo amarillento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran una vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.', '', ''),
	(2734, 'Q2205-4187', 'Q', '5745090', 'ALVARO MORENO VEGA', '000', 'M', '70', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-14', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar  que mide 7.5 x 2.3 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la luz está ocupada por numerosos cálculos fascetados de color amarillento. Se toman cortes. \r\n\r\n\r\n', 'Los cortes muestran una vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular. En la mucosa hay focos de histiocitos cargados de colesterol.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS Y COLESTEROLOSIS.', '', ''),
	(2735, 'Q2205-4188', 'Q', '1051815006', 'ANGELICA CASTILLO APARICIO', '000', 'F', '35', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe previamente abierta una vesícula biliar  que mide 8 x 3 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida. Al corte la pared está engrosada y la mucosa ha perdido su color aterciopelado, y hay salida de numerosos cálculos diminutos color amarillento. Se toman cortes. \r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS', '', ''),
	(2736, 'Q2205-4189', 'Q', '30881858', 'MILENA PATRICIA BELTRAN QUINTANA', '000', 'F', '43', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor JOSE ACEVEDO', NULL, '2022-05-13', '2022-05-12', 'VIRNA CARABALLO OSORIO', 'Rotulado "Útero" se recibe un cuerpo uterino que pesa 272 gms y mide 8.5 x 9.5 x 8 cms. la superficie externa está parcialmente cubierta por una serosa despulida y brillante. Al corte la cavidad endometrial está tapizada por una mucosa engrosada y el miometrio está ocupado por múltiples masas de color blanquecino, aspecto arremolinado, la mayor mide 5.5 cms. y la menor unos pocos milímetros de localización.\r\n\r\n\r\n\r\n', 'El endometrio está autolisado. Las masas miometriales descritas están compuestas por fibras musculares lisas, distribuidas irregularmente.\r\n\r\n\r\n\r\n', ' Histerectomía subtotal (272 gms.):\r\n-ENDOMETRIO AUTOLISADO\r\n-LEIOMIOMAS SUBMUCOSOS, INTRAMURALES Y SUBSEROSOS', '', ''),
	(2737, 'Q2205-4190', 'Q', '4812149', 'WILLIAN RENTERIA PEREZ', '000', 'M', '83', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctor FERNANDO GARCIA DEL RISCO', NULL, '2022-05-18', '2022-05-14', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" tres fragmentos de tejido blanquecino que promedian 0.4 cms. Se toma todo, y se rotula A.\r\n2. "Antro" un fragmento de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.5 cms. Se toma todo, y se rotula B.\r\n\r\n\r\n', 'Los cortes rotulados A revelan tumor epitelial maligno constituido por células escamosas grandes de núcleos pleomórficos, hipercromáticos abundante citoplasma con formación de peerlas córneas que infiltran el estroma.\r\nLos cortes B muestran antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n', '1.Biopsia endoscópica de esófago:\r\n-CARCINOMA ESCAMOCELULAR BIEN DIFERENCIADO, INFILTRANTE\r\n2.Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE\r\n\r\n', '', ''),
	(2738, 'Q2205-4191', 'Q', '30662403', 'NORYS DEL CARMEN BARRAGAN JARABA', '000', 'F', '55', 'LIGA CONTRA EL CANCER', '', '898201', '30215', 'Doctor CARLOS OSORIO', NULL, '2022-05-18', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado con su nombre, se recibe una masa ovoide que mide 4 x 2 x 1 cms. consistencia elástica de color amarillento de aspecto adiposo. Al corte se observan vasos nodulares de color amarillento que el mayor mide 0.8 cms. Se toman cortes.  \r\n\r\n\r\n\r\n', 'Los cortes revelan mama que muestra conductos dilatados revertidos por epitelio aplanado que contiene un material proteinaceo, eosinofílico, hay fibrosis periductal y un infiltrado linfoplasmocitario.\r\n\r\n\r\n\r\n', ' Resección de lesión en mama izquierda:\r\n-ECTASIA DUCTAL\r\n\r\n', '', ''),
	(2739, 'Q2205-4192', 'Q', '73065001', 'HERNAN MERCADO FAJARDO', '000', 'M', '64', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico con muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado linfoplasmocitario moderado, actividad leve. No se identifica H.pylori, atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n\r\n', '', ''),
	(2740, 'Q2205-4193', 'Q', '6287204', 'AMAIRALY SOFIA LOPEZ ARIAS', '000', 'F', '5', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglio cervical izquierdo" se recibe masa ovoide que mide 2 x 2 x 1 cms. de color blanquecino, consistencia elástica. Al corte múltiples nódulos color amarillento que promedian un diámetro mayor 0.6 cms. Se toman cortes.  \r\n\r\n\r\n\r\n', 'Los cortes revelan ganglio linfático cuya arquitectura esta alterada por la presencia de múltiples granulomas necrotizante, algunos con necrosis caseosa, células gigantes multinucleadas.\r\n\r\n\r\n\r\n', ' Biopsia de ganglio cervical izquierdo:\r\n-LINFADENITIS CRÓNICA GRANULOMATOSA NECROTIZANTE\r\n\r\n\r\n', '', ''),
	(2741, 'Q2205-4194', 'Q', '1044929648', 'JUAN DAVID NAVARRO MARTINEZ', '000', 'M', '26', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se recibe dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa Antro corporal sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado linfoplasmocitario moderado, actividad leve. No se identifica H.pylori, atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE\r\n\r\n', '', ''),
	(2742, 'Q2205-4195', 'Q', '1050968031', 'JAVIER EDUERDO JULIO JULIO', '00', 'M', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Quiste sebáceo" se recibe una formación nodular que mide 1 x 0.5 cms. tapizado por piel. Al corte hay una formación quística que contiene un material grumoso color blanquecino que contiene pelo. Se toma cortes.\r\n\r\n\r\n\r\n', 'Piel en cuya dermis se encuentra una cavidad tapizada por epitelio escamoso y con contenido de queratina laminar.\r\n\r\n\r\n\r\n', '-QUÍSTE QUERATINOSO DE TIPO EPIDERMOIDE, hemiescroto derecho\r\n\r\n', '', ''),
	(2743, 'Q2205-4196', 'Q', '90800170', 'RUDI MANUEL NEGRETE COGOLLO', '000', 'M', '70', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se reciben dos  fragmentos de tejido de forma cilíndrico  de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear leve, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago.\r\n-GASTRITIS CRÓNICA LEVE CON ACTIVIDAD LEVE\r\n-H.PYLORI PRESENTE', '', ''),
	(2744, 'Q2205-4197', 'Q', '1049828901', 'NEIDER JESUS BETANCURT PUERTA', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice cecal" se recibe un apéndice cecal que mide 8 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa color pardo gris bien vascularizada. Al corte hay salida de material fecal. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', ' Apéndice cecal con:\r\n-HIPERPLASIA LINFOIDE REACTIVA\r\n', '', ''),
	(2745, 'Q2205-4198', 'Q', '22757152', 'JUDITH PAZ DE MELENDEZ', '000', 'F', '91', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n\r\n', '', ''),
	(2746, 'Q2205-4199', 'Q', '1143341116', 'LUIS GABRIEL BAUTISTA SERPA', '000', 'M', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '898201', '30215', 'Doctor CARLOS BALLESTAS ALMARIO', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Verruga vírica en genitales" se reciben fragmentos de tejido de color pardo grisáceo que miden 0.5 cms. la superficie externa es de aspecto papilar. Se toman corte.\r\n\r\n\r\n\r\n', 'Piel que muestra hiperqueratosis, hipergranulosis, papilomatosis, acantosis irregular, atipias coilociticas, el dermis infiltrado linfoplasmocitario.\r\n\r\n\r\n\r\n', '-CONDILOMAS ACUMINADOS, región suprapubica\r\n\r\n', '', ''),
	(2747, 'Q2205-4200', 'Q', '37924747', 'ANA MARIA DAZA CASTAÑEDA', '000', 'F', '60', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antro corporal cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRONICA INACTIVA\r\n\r\n', '', ''),
	(2748, 'Q2205-4201', 'Q', 'ven278187552', 'MARLEYDIS JOSELIN MIJARES AROCHA', '000', 'F', '21', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor LUIS ALCAZAR', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula biliar" se recibe  una vesícula biliar que mide 6 x 4 x 3 cms. en sus mayores dimensiones, la superficie se encuentra tapizada por una serosa de color pardo claro. Al corte la pared se encuentra notablemente engrosada y contiene algunos cálculos de color amarillentos. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar con inflamación aguda y crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS AGUDA Y CRÓNICA \r\n-COLELITIASIS\r\n\r\n', '', ''),
	(2749, 'Q2205-4202', 'Q', '70065920', 'JOSE FERNANDO OKE CADAVID', '000', 'M', '67', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Antro gástrico con muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear severo, actividad moderada, H.pylori presente. Hay formación ocasional de acúmulos linfoides. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA SEVERA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(2750, 'Q2205-4203', 'Q', '1048441234', 'JESSICA PAOLA LUNA VALDEZ', '000', 'F', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Quiste de brazo izquierdo"  se recibe elipse de piel que mide 1 cms. color pardo grisáceo. Al corte hay una formación nodular pigmentada de 0.5 cms. Se toman corte.\r\n\r\n\r\n\r\n', 'Los cortes revelan piel en cuyo dermis se observa tumor benigno constituido por islotes de células basofilicas y sombreadas, algunas células gigantes.\r\n\r\n\r\n\r\n', '-PILOMATRIXOMA, brazo izquierdo\r\n\r\n', '', ''),
	(2751, 'Q2205-4204', 'Q', '73093635', 'HECTOR URBINA MEZA', '000', 'M', '60', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-14', '2022-05-14', 'OLIVA MARRUGO GRICE', '1. Rotulado "Esófago" se recibe un fragmento de tejido blanquecino que promedian 0.5 cms. Se toma todo, y se rotula A.\r\n2. Rotulado "Antro" se reciben  tres fragmentos de tejido de forma irregular de color blanquecino y consistencia elástica que mide 0.4 cms. Se toma todo, y se rotula B.', '', '', '', ''),
	(2752, 'Q2205-4205', 'Q', '1047458974', 'FLORA MARIA PACHECO HERRERA ', '00', 'F', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice cecal" se recibe un apéndice cecal que mide 10 x 1 cms. en sus mayores dimensiones, tapizado por una serosa opaca bien vascularizada de color pardo oscuro que trae adherido un material fibrinopurulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared está infiltrada por abundantes PMN neutrófilos que se extienden hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', '| Apendicectomía.\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n\r\n', '', ''),
	(2753, 'Q2205-4206', 'Q', '45466733', 'NURIS ARTEAGA OROZCO', '000', 'F', '57', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo.\r\n\r\n\r\n\r\n', 'Mucosa antro corporal con muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad moderada, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\n\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA\r\n-H.PYLORI PRESENTE', '', ''),
	(2754, 'Q2205-4207', 'Q', '1043312221', 'WILFRAN DAVID MARTINEZ ALEAN', '000', 'M', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-05-16', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Apendicectomía" se recibe un apéndice cecal que mide 7 x 1 cms. en sus mayores dimensiones, tapizado por una serosa opaca bien vascularizada de color pardo oscuro que trae adherido un material fibrinopurulento. Al corte hay salida de material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared está infiltrada por abundantes PMN neutrófilos que se extienden hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n', '', ''),
	(2755, 'Q2205-4208', 'Q', '33142156', 'EVELIA ROSA AYAZO AGUILAR', '000', 'F', '69', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ISMAEL YEPES BARRETO', NULL, '2022-05-23', '2022-05-14', 'OLIVA MARRUGO GRICE', 'En recipientes rotulados y separados, se reciben:\r\n1. Rotulado "Antro gástrico" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo, se rotula A.\r\n2. Rotulado "Pólipo gástrico" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo, se rotula B.\r\n\r\n\r\n\r\n', 'Los cortes rotulados A revelan mucosa, antro corporal cuya lamina propia presenta infiltrado mononuclear leve, hay áreas de metaplasia intestinal incompleta, no se observa actividad, H.pylori ni displasia.\r\nLos cortes rotulados B revelan mucosa oxintica sin cambios.\r\n\r\n\r\n', 'Biopsia Endoscópica de Estómago:\r\n1. GASTRITIS CRÓNICA LEVE INACTIVA CON FOCOS DE METAPLASIA INTESTINAL INCOMPLETA, ANTRO.\r\n2. MUCOSA OXINTICA SIN CAMBIOS. ', '', ''),
	(2756, 'Q2205-4209', 'Q', '5901756', 'DAIGLIMAR BETANIA LUGO PEREZ', '000', 'F', '24', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDWARD RICARDO VARGAS', NULL, '2022-05-18', '2022-05-14', 'OLIVA MARRUGO GRICE', 'Rotulado "Quiste de ovario" se reciben dos fragmentos de tejido, el mayor mide 1 cms. y el menor mide 0.5 cms. El mayor es una formación quística con salida de un material hemorrágico. Se toman cortes.\r\n\r\n\r\n\r\n', 'La pared de un quiste que contiene coágulos sanguíneos y macrófagos cargados con hemosiderina.\r\n\r\n\r\n', '-COMPATIBLE CON ENDOMETRIOMA, ovario izquierdo', '', ''),
	(2757, 'Q2205-4210', 'Q', '1201233209', 'SAMUEL DAVID ROCHA ENRIQUEZ', '000', 'M', '9', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-05-18', '2022-05-14', 'OLIVA MARRUGO GRICE', 'En recipientes rotulados y separados, se reciben:\r\n1. "Esófago" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo, y se rotula A.\r\n2. "Antro" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo, y se rotula B.\r\n3. "Cuerpo gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo, y se rotula C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo, y se rotula D.\r\n5. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.4 cms. Se toma todo, y se rotula E.\r\n', 'Los cortes rotulados A mucosa esofágica tapizada por epitelio escamoso que  reposa en una lámina propia edematosa con infiltrado mononuclear.\r\nLos cortes B revelan antro gástrico sin muscular de la mucosa y conservación de su histoarquitectura, la lámina propia presenta un infiltrado mononuclear moderado, actividad leve, H.pylori presente. No se observa atrófia, metaplasia ni displasia.\r\nLos cortes C revelan fragmentos de mucosa de cuerpo gástrica cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes D y E revelan duodeno cuya lámina propia muestra un infiltrado mononuclear moderado.\r\n', '1.Biopsia endoscópica digestiva superior.\r\n1.ESOFAGITIS CRÓNICA, esófago\r\n2.GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD LEVE, antro gástrico\r\n-H.PYLORI PRESENTE\r\n3.GASTRITIS CRÓNICA INACTIVA, cuerpo gástrico\r\n4.DUODENITIS CRÓNICA, bulbo y 2da. porción del duodeno', '', ''),
	(2758, 'Q2205-4211', 'Q', '1047419984', 'LIZETH ARROYO VALIENTE', '000', 'F', '32', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor. EDUARDO QUINTERO', NULL, '2022-05-16', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Apendicectomía" se recibe un apéndice cecal que mide 6 x 0.5 cms. en sus mayores dimensiones, tapizado por una serosa opaca bien vascularizada de color pardo oscuro. Al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA\r\n\r\n\r\n', '', ''),
	(2759, 'Q2205-4212', 'Q', '25756948', 'ELISA MARIA AVILA DE VELEZ', '000', 'F', '84', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor. HERNANDO COBA.', NULL, '2022-05-19', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Mucosa gastrica" se recibe tres fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.6 cms. Se toma todo.', 'El espécimen presenta cambios avanzados de autólisis. En unos de los fragmentos hay perdida casi total de la arquitectura, con cambios sugestivos, pero no conclusivos, de un proceso neoclásico, es imperativo tomar nueva muestra para definir diagnóstico.\r\n\r\n\r\n ', 'Biopsia de estómago:\r\nVER DESCRIPCIÓN MICROSCÓPICA.', '', ''),
	(2760, 'Q2205-4213', 'Q', '33145956', 'ARGENIDA SANCHEZ CUADRADO', '000', 'M', '69', 'CLINICA GENERAL DEL CARIBE SA.', 'Mutual SER', '898201', '30215', 'Doctor. HERNAN CALDERON MORON', NULL, '2022-05-16', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5 x 0.5 cms. en sus mayores dimensiones, tiene adherida abundante grasa periapendicular, la serosa es opaca bien vascularizada de color pardo claro y trae adherido un material fibrinopurulento. Se toman cortes.\r\n\r\n\r\n\r\n', 'Apéndice cecal cuya mucosa se encuentra ulcerada, la pared está infiltrada por abundantes PMN neutrófilos que se extienden hasta la grasa periapendicular.\r\n\r\n\r\n\r\n', '  Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE\r\n\r\n', '', ''),
	(2761, 'Q2205-4214', 'Q', '11280626651', 'MAURO ANDRES ANGULO ESPRIELLA', '000', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor. CARLOS ARTURO VELEZ DUCAN', NULL, '2022-05-24', '2022-05-16', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Estribo oído izquierdo" un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms. Se toma todo, se rotula A.\r\n2. "Colesteatoma oído izquierdo" tres fragmentos de tejido de forma irregular de color blanquecino y consistencia friable que mide 0.5 cms. Se toma todo, se rotula B.\r\n3. "Mucosa de oido izquierdo" dos fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que el mayor mide 0.5 cms. y el menor 0.2 cms. Se toma todo, se rotula C.\r\n4. "Martillo oído izquierdo" un fragmento de tejido de forma irregular de color blanquecino y consistencia pétrea que mide 0.5 cms. Se toma todo, se rotula D.\r\n5. "Tejido oído medio izquierdo" un fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.5 cms. Se toma todo, se rotula E.\r\n6. "lesión oído medio izquierdo" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que promedian un diámetro mayor 0.6 cms. Se toman corte, se rotula F.\r\n\r\n', 'Los cortes rotulados A revelan hueso comprometido por un colesteatoma.\r\nLos cortes B revean estructura quística tapizada por epitelio escamoso que contiene queratina, el estroma infiltrado por células plasmáticas; linfocitos. \r\nLos cortes C muestran mucosa de oído medio comprometida por el colesteatoma.\r\nLos cortes D revelan espículas óseas. \r\nLos cortes E muestran mucosa de oído medio comprometido por el colesteatoma.\r\nLos cortes F revelan lesión de oído medio comprometido por el colesteatoma, además fragmentos de tejido de granulación \r\n\r\n\r\n', '1. COLESTEATOMA, oído izquierdo.\r\n2. ESTRIBO OÍDO MEDIO IZQUIERDO, COMPROMETIDO POR EL COLESTEATOMA.\r\n3. MUCOSA, OÍDO MEDIO IZQUIERDO COMPROMETIDA POR EL COLESTEATOMA.\r\n4. MARTILLO \r\n5. FRAGMENTO DE TEJIDO DE GRANULACIÓN, oído medio.\r\n\r\n', '', ''),
	(2762, 'Q2205-4215', 'Q', '45464667', 'MIRELIS BAENA ALVAREZ', '000', 'F', '56', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor. LUIS ALCAZAR GONZALEZ', NULL, '2022-05-16', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Omento y Apéndice" se recibe  apéndice cecal que mide 5 x 0.5 cms. tapizada por una serosa opaca color pardo claro, la luz puntiforme. Al corte está acompañado por dos fragmentos irregulares de aspecto fibroadiposo, el mayor de los cuales mide 12 cms. y el menor 5 cms. En el mayor encontramos una formación nodular que parece corresponder a un ganglio linfático. Se toman cortes. El fragmento menor presenta una formación sacular que mide 4 cms. de diámetro mayor de color blanquecina. Se toman cortes.\r\n\r\n\r\n', 'Los cortes revelan apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual, se observa, además, saco herniario y fragmentos de tejido adiposo maduro.\r\n\r\n\r\n\r\n', ' Apendicectomía:\r\n1.HIPERPLASIA LINFOIDE REACTIVA\r\n2.SACO HERNIARIO, región inguinal\r\n3.FRAGMENTOS DE TEJIDO ADIPOSO MADURO\r\n\r\n', '', ''),
	(2763, 'Q2205-4216', 'Q', '1043295922', 'ESTIVENSON VALENCIA VARGAS', '000', 'M', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor. HENRY LOUIS MONCRIEFF VEGA', NULL, '2022-05-19', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Segmento hepático 7"se recibe un segmento de hígado que mide 7 x 4 cms. de color verdoso, consistencia fiabre. Se toman cortes.\r\n\r\n\r\n', 'los cortes revelan hígado con áreas extensas de necrosis que borran la arquitectura normal.\r\n\r\n\r\n\r\n\r\n\r\n', '-SEGMENTO DE HÍGADO CON ÁREAS EXTENSAS DE NECROSIS.', '', ''),
	(2764, 'Q2205-4217', 'Q', '30765303', 'YENIS DEL ROSARIO BOSSIO VILLADIEGO', '00', 'F', '51', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor. LUIS ALCAZAR GONZALEZ', NULL, '2022-05-16', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe previamente abierta una vesícula que mide 8.2 x 3 cms. parcialmente tapizada por una serosa color pardo claro, al corte tiene pequeños cálculos color negruzco, la pared se encuentra engrosada, la mucosa ha perdido su aspecto aterciopelado. Se toman corte.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n\r\n', ' Colecistectomía:\r\n-COLECISTITIS CRÓNICA\r\n-COLELITIASIS\r\n\r\n', '', ''),
	(2765, 'Q2205-4218', 'Q', '30775151', 'MONSERRAT OTERO TORRES', '000', 'F', '50', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor. SAMUEL CANTILLO VILLAR.', NULL, '2022-05-19', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Mioma" se recibe una masa irregular que mide 9 x 6 x 4 cms. de consistencia firme, al corte una superficie blanquecina aspecto removinado. Se toman cortes.\r\n2. Se recibe cuerpo uterino con anexos que pesa 663, grm. y mide 14 x 11 x 9 cms. Al corte la cavidad mucosa endometrial en el miometrio observamos una masa que mide 5 x 5 cms. de color pardo oscuro se toma cortes y se rotula B, se observa además otras masas blanquecinas que promedian un diámetro mayor de 1 cms.\r\n3. Ovario izquierdo mide 3 x 2 cms. es macroscópicamente normal, la trompa mide 5 cms. se toman corte.\r\n  Ovario derecho mide 3 x 2 cms. es macroscópicamente normal, la trompa mide 4 cms. se toman corte, se rotula C.\r\n\r\n', '', '', '', ''),
	(2766, 'Q2205-4219', 'Q', '19590721', 'YOREIDA DEL CARMEN SARABIA SUAREZ', '000', 'F', '37', 'LIGA CONTRA EL CANCER', 'LIGA CONTRA EL CANCER', '898201', '30215', 'Doctor. CARLOS OSORIO', NULL, '2022-05-16', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Sin rotular se recibe una masa ovoide que mide 5 x 5 cms. color pardo clara consistencia firme. Al corte una superficie multinodular blanquecina. Se toman cortes.\r\n\r\n\r\n\r\n', 'Tumor benigno compuesto por la proliferación combinada de elementos estromales y glandulares.\r\n\r\n\r\n\r\n', '-FIBROADENOMA, mama derecha\r\n\r\n', '', ''),
	(2767, 'Q2205-4220', 'Q', '12714484', 'NEYDA LANDAETA', '000', 'F', '47', 'PARTICULAR', 'PARTICULAR', '898201', '30215', 'Doctor. ANGEL VASQUEZ PAJARO', NULL, '2022-05-16', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Segmento trompa izquierda" se recibe segmento de trompa que mide 2 cms. color pardo oscuro. Se toman cortes.\r\n\r\n\r\n\r\n', 'Trompa de Falopio ligeramente dilatada con contenido hemático, la pared edematosa, congestiva.\r\n\r\n\r\n\r\n', '-HEMATOSALPINX IZQUIERDO', '', ''),
	(2768, 'Q2205-4221', 'Q', '73113419', 'RAFAEL RODRIGUEZ CORTECERO', '000', 'F', '72', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctora. ADRIANA PAOLA LOPEZ CELEDON', NULL, '2022-05-20', '2022-05-16', 'OLIVA MARRUGO GRICE', 'Rotulado "Biopsia para citología en formol" se recibe en formol tres fragmentos de tejido que mide 0.2 cms. Se toma todo.\r\n\r\nNOTA: No se recibió líquido para estudio citológico.\r\n\r\n\r\n', 'Los cortes revelan tejido fibroconectivo y de parénquima pulmonar sin cambios neoplásicos.\r\n\r\n\r\n ', '-FRAGMENTOS DE PARÉNQUIMA PULMONAR (VER DESCRIPCIÓN MICROSCÓPICA)\r\n\r\n', '', ''),
	(2769, 'Q2205-4222', 'Q', '1041995208', 'LUISDIANIS DE LOS ANGELES MORNO GAVIRIA ', '00', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados se reciben:\r\n1. "Mama supernumeraria derecha" se reciben tres fragmentos de tejidos irregulares, color amarillento y aspecto graso que mide respectivamente 5.5 x 3.5 x 3 cms. en sus mayores dimensiones. El mayor de estos muestra una superficie de color amarillento, untuoso, con pequeñas áreas de color pardo claro. Se toman corte y se rotula A.\r\n2. "Mama supernumeraria izquierda" contiene dos fragmentos de tejido similares a los descritos que mide respectivamente 4 x 3 cms en sus mayores dimensiones. Al corte se encuentra una superficie untuosa de color amarillento con pequeños exteriores de color pardo claro. Se toman corte y se rotula B. \r\n\r\n\r\n', 'Los cortes rotulados A y B muestran tejido mamario que contiene estructuras quísticas de pequeño y mediano calibre, que reposan en un estroma fibroadiposo. No hay cambios neoplásicos. \r\n\r\n\r\n', '1. Resección de masa en axila derecha:\r\n- TEJIDO MAMARIO SUPERNUMERARIO CON CAMBIOS DE CONDICIÓN FIBROQUÍSTICA.\r\n\r\n2. Resección de masa en axila izquierda:\r\n- TEJIDO MAMARIO SUPERNUMERARIO CON CAMBIOS DE CONDICIÓN FIBROQUÍSTICA.', '', ''),
	(2770, 'Q2205-4223', 'Q', '1043986537', 'MANUEL EDUARDO PINTO PUERTA', '000', 'M', '30', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida de color rosado, al corte se encuentra una luz ligeramente dilatada que contiene un material grumoso color pardo claro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared.', '-APÉNDICITIS AGUDA.', '', ''),
	(2771, 'Q2205-4224', 'Q', '1201240937', 'ELSY CASTILLO GONZALEZ', '00', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un fragmento de tejido tubular que mide 3 x 0.5 cms. en sus mayores dimensiones, al corte se encuentra una luz que contiene un material grumoso color oscuro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APÉNDICITIS AGUDA.', '', ''),
	(2772, 'Q2205-4225', 'Q', '1201227731', 'ANGELIS MARGARITA BARRAGAN TEJEDOR', '000', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor LUIS RAMON MORENO BALLESTEROS', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 5.5 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa irregular de color pardo claro con una zona pardo oscura en el extremo distal. Se toman cortes.', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', '-APÉNDICITIS AGUDA.', '', ''),
	(2773, 'Q2205-4226', 'Q', '1030245390', 'ALEXIS ALEJANDRO RIOS HOYOS ', '000', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Vesícula" se recibe una vesícula que mide 7.5 x 2 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa despulida de color pardo grisáceo, Al corte las paredes son gruesas, de aspecto fibroso, la mucosa es aterciopelada y en la luz se encuentra un pequeño cálculo de color amarillento, forma irregular que está en el cuello. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran una vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.', '', ''),
	(2774, 'Q2205-4227', 'Q', '1041991207', 'CARLOS ANDRES AMARANTO CAUSIIL', '000', 'M', '22', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoide" se recibe varios fragmentos de tejido de forma irregular,  color pardo claro, inconsistencia blanda en conjunto, hacen un volumen 3 ml. Se toman todo.\r\n\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(2775, 'Q2205-4228', 'Q', '1238340755', 'LAURY VICTORIA QUINTERO MARTINEZ', 'C000', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor RODRIGO DE VIVERO', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Estómago" se reciben dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran Fragmentos de mucosa antro corporal  cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n', ' Biopsia endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA.', '', ''),
	(2776, 'Q2205-4229', 'Q', '1048603571', 'DANNA MARCELA SANCHEZ ARROYO', '000', 'F', '14', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados se reciben:\r\n1. "Pared quiste ovario izquierdo" un fragmento de tejido color blanquecino y forma irregular que mide 1.4 x 0.4 x 0.2 cms. Se toma todo y se rotula A.\r\n2. "Pared quiste ovario derecho"un fragmento de tejido color blanquecino y forma irregular que mide 0.8 x 0.8 x 0.5 cms. Se toma todo y se rotula B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran tejido ovárico que en una de sus caras está tapizado por elementos foliculares (tecas). No hay cambios neoplásicos. \r\nLos cortes rotulados B muestran la pared de una estructura quística tapizada por epitelio de tipo seroso con pequeñas proyecciones hacia la luz. En la pared se encuentran fibras de músculo liso.\r\n\r\n\r\n ', '1. Resección de lesión quística en ovario izquierdo:\r\n-QUISTE FOLICULAR (fragmento)\r\n\r\n2. Recepción de lesión quística en ovario derecho:\r\n-QUISTE PARAMESONÉFRICO (Hidátide de Morgagni)\r\n', '', ''),
	(2777, 'Q2205-4230', 'Q', '1041984786', 'CARMELI ROCHA BELLO', '000', 'F', '11', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Seno preauricular derecho" se recibe un fragmento de tejido inconsistente de forma irregular que mide 1.3 x 0.5 x 0.5 cms. Al corte se encuentra una zona irregular que parece corresponder a un conducto. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran una cavidad tapizada por epitelio que se continúa con el epitelio superficial. En la pared se encuentra, además, cartílago hialino.\r\n\r\n\r\n', 'Resección de lesión preauricular derecha: \r\n- SENO PREAURICULAR.', '', ''),
	(2778, 'Q2205-4231', 'Q', '6192407', 'ELVIRA FERIA', '000', 'F', '53', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'DOctor ALEJANDRO VARGAS GENES', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Biopsia peribronquial de lingula" se recibe minúsculos fragmentos de tejido de color blanquecino y consistencia blanda. Se intenta procesar.\r\n\r\n\r\n', 'Los cortes muestran pequeños fragmentos de mucosa bronquial tapizada por epitelio respiratorio que reposa en una lámina propia edematosa con leve infiltración mononuclear. No se encuentran cambios neoplásicos.\r\n\r\n\r\n', 'Biopsia peribronquial de língula:\r\n\r\n- VER DESCRIPCIÓN MICROSCÓPICA.', '', ''),
	(2779, 'Q2205-4232', 'Q', '1018517495', 'FRANCISCO ANTONIO PARRA MARTINEZ', '000', 'M', '3', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-05-24', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes rotulados y separados, se reciben:\r\n1. "Esófago" tres minúsculos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 cms. Se toma todo, y se rotula A.\r\n2. "Cuerpo gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo, y se rotula B.\r\n3. "Antro gástrico" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo y se rotula C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.1 cms. Se toma todo, y se rotula D.\r\n5. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.2 cms. Se toma todo, y se rotula E.\r\n6. "Ciego" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo, y se rotula F.\r\n7. "Recto" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo, y se rotula G.', 'Los cortes rotulados A muestran fragmentos de epitelio escamoso maduro. Los cortes rotulados B muestran fragmentos de mucosa gástrica oxintica sin alteraciones. Los cortes rotulados C muestran fragmentos de mucosa gástrica antral con discreto edema e infiltración mononuclear de la lámina propia. No hay cambios displásicos, metaplasicos, ni presencia de H. pylori. Los cortes rotulados D y E muestran fragmentos de mucosa duodenal cuya morfología está preservada. La lámina propia está edematosa, congestiva y densamente infiltrada por linfocitos y células plasmáticas. No hay aplanamiento de las vellosidades, granulomas ni parásitos. Los cortes rotulados F y G muestran fragmentos de mucosa colonica cuya lamina propia está edematosa, congestiva y densamente infiltrada por linfocitos y células plasmáticas. No hay granulomas, alteraciones glandulares ni presencia de parásitos.', '1.Biopsia endoscópica de esófago:\r\n-FRAGMENTO DE EPITELIO ESCAMOSO\r\n2.Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTOS DE MUCOSA GÁSTRICA OXÍNTICA\r\n3.Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE\r\n4.Biopsia endoscópica de bulbo duodenal:\r\n-DUODENITIS CRÓNICA\r\n5.Biopsia endoscópica de la segunda porción del duodeno:\r\n-DUODENITIS CRÓNICA\r\n6.Biopsia endoscópica de ciego:\r\n-COLITIS CRÓNICA INESPECÍFICA\r\n7.Biopsia endoscópica de recto:\r\n-PROCTITIS CRÓNICA INESPECÍFICA                                      JOSÉ CARABALLO GRACIA\r\n                                                                                        Médico Patólogo-Registro: 26368', '', ''),
	(2780, 'Q2205-4233', 'Q', '7918514', 'OSKARIVAN SANCHEZ CUADRO', '000', 'M', '44', 'GASTROPACK SAS', 'SEGUROS DE VIDA SURAMERICANA S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', 'En recipientes rotulados y separados, se reciben:\r\n1. "Antro gástrico" se recibe un fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que promedia 0.3 cms. Se toma todo, se rotula A.\r\n2. "Pólipo gástrico" se recibe una masa de tejido de color pardo claro y consistencia blanda que mide 0.3 cms. Se toma todo, se rotula B.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes rotulados B muestran estructura compuesta por glándulas de tipo colónico  con leves atipias citológicas, dispuestas irregularmente sobre una lámina propia con moderada infiltración mononuclear.\r\n\r\n\r\n', '1. Biopsia endoscópica de antro:\r\n -GASTRITIS CRONICA INACTIVA\r\n2. Biopsia endoscópica de colon:\r\n-ADENOMA TUBULAR DE CÓLON\r\n', '', ''),
	(2781, 'Q2205-4234', 'Q', '73205809', 'SEBASTIAN EMILIANI ESPINOSA', '000', 'M', '40', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-18', '2022-05-17', 'JOSÉ CARABALLO GRACIA', '3. "Antro gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n', ' Biopsia endoscópica de antro:\r\n-GASTRITIS CRÓNICA INACTIVA, LEVE', '', ''),
	(2782, 'Q2205-4235', 'Q', '45755630', 'MONICA ESPITIA ROMERO ', '000', 'F', '47', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor BELISARIO SOLANA', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "lipoma en espalda" se recibe múltiples fragmentos de tejido de forma irregular color pardo amarillento, aspecto adiposo que juntos miden 4.5 x 3 x 1 cms y hacen un volumen de 4 ml. Al corte se observan una superficie untuosa de color pardo amarillento, se toman corte.\r\n\r\n', 'Los fragmentos de un tumor mesenquimal benigno compuesto por lóbulos de tejido adiposo maduro.\r\n\r\n\r\n\r\n\r\n\r\n\r\n  ', 'Resección de masa en la región dorsal:\r\n -LIPOMA (fragmentos)', '', ''),
	(2783, 'L2205-155', 'L', '37842354', 'ELIZABETH RINCON PEREZ', '000', 'F', '41', 'LIGA CONTRA EL CANCER', '', '2020304', '23495', 'Doctor BELISARIO SOLANA', NULL, '2022-05-19', '2022-05-19', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Acaf de seno izquierdo" se recibe 4.3 ml de un líquido color pardo claro.\r\n\r\n\r\n', 'Los extendidos están compuestos por múltiples histiocitos de citoplasma claro y células apocrinas.\r\n\r\n\r\n', 'Extendido de líquido de aspiración de quiste en mama izquierda:\r\n- CITOLOGÍA NEGATIVA PARA CÉLULAS MALIGNAS', '', ''),
	(2784, 'Q2205-4236', 'Q', '32940452', 'CLAUDIA PUERTA CASTRO', '000', 'F', '51', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor CANTILLO - JAIME CABARCAS', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "quiste sebáceo" se recibe un fragmento de tejido de forma irregular, color pardo claro, consistencia elástica que mide 2.3 x 1.3 x 1 cms. La superficie externa está parcialmente cubierta por elipse de piel que mide 2.3 x 1 cms. Al corte se observa una cavidad que contiene un material grumoso de 0.5 de diámetro. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se destaca una cavidad tapizada por epitelio escamoso con contenido de queratina laminar.\r\n\r\n\r\n', ' Resección de masa en región dorsal:\r\n-QUISTE QUERATINOSO DE TIPO EPIDERMOIDE.', '', ''),
	(2785, 'Q2205-4237', 'Q', '1002344419', 'GABRIELA CAMPO RAMOS ', '000', 'F', '19', 'ORG. CLINICA GENERAL DEL NORTE', '', '898201', '30215', 'Doctor LUIS JAVIER ALZAMORA', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'En recipientes rotulados y separados se reciben: \r\n1. "Biopsia de exocervix" se recibe dos diminutos fragmentos de tejido de forma irregular de color pardo claro consistencia elástica que promedia 0.2 cms. se toma todo y se rotula A.\r\n2.  "Biopsia de Vulva" se recibe un diminuto fragmento de tejido de forma irregular de color pardo claro consistencia elástica que promedia 0.2 cms. en su mayor dimensión. Se toma todo y se rotula B.', 'Los cortes rotulados A muestran fragmentos de cuello uterino con una reacción inflamatoria crónica y cambios citopáticos por VPH.\r\nLos cortes rotulados B muestran piel tapizada por epitelio escamoso con hiperqueratosis y cambios citopáticos por VPH.\r\n\r\n\r\n', '1. Biopsia de Cérvix:\r\n-LIE DE BAJO GRADO (cambios asociados por VPH)\r\n2. Biopsia de Vulva:\r\n- VIN DE BAJO GRADO ', '', ''),
	(2786, 'Q2205-4238', 'Q', '1043659218', 'KARLA DEL CARMEN MONTERO CASTILLO', '000', 'F', '13', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-05-20', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Nevo Frontal" se recibe un fragmento elíptico de piel de color pardo claro y consistencia elástica que mide 0.7 x 0.5 cms. en la superficie externa se destaca una lesión sobre elevada e hiperpigmentada que mide 0.5 cms. de diámetro. Se toma todo.\r\n\r\n\r\n\r\n\r\n\r\n', 'Los cortes muestran piel en cuya dermis se destaca una proliferación de células nevicas que se disponen en nidos sólidos y cordones. No se observan actividad de unión. Las líneas de resección están libres de lesión.\r\n\r\n\r\n\r\n\r\n\r\n', 'Biopsia de piel de región frontal:\r\n-NEVO MELANOCITICO INTRADÉRMICO\r\n-VER DESCRIPCIÓN MICROSCÓPICA\r\n\r\n\r\n', '', ''),
	(2787, 'Q2205-4239', 'Q', '1047446959', 'MAIRA VANESA DE LEON DIAZ', '000', 'F', '30', 'PARTICULAR', '', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-05-20', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'En recipientes separados y rotulados se reciben: \r\n1. "Biopsia de exocérvix" se reciben tres fragmentos de tejido de forma irregular, color pardo claro y consistencia elástica que promedian 0.3 cms. en su mayor dimensión. Se toma todo y se rotula A.\r\n2. "Biopsia de Vulva" se reciben dos fragmentos de tejido de forma irregular, color pardo claro y consistencia elástica que promedian 0.2 cms. en su mayor dimensión. Se toma todo y se rotula B.\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de cuello uterino con una reacción inflamatoria aguda y crónica, parcialmente tapizado por epitelio escamoso con cambios citopáticos por VPH.\r\nLos cortes rotulados B muestran piel con hiperqueratosis, acantosis y cambios irregular con papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n', '1. Biopsia de Cérvix:\r\n-CERVICITIS AGUDA Y CRÓNICA Y LIE DE BAJO GRADO (cambios asociados infección por VPH)\r\n2. Biopsia de Vulva:\r\n-CONDILOMAS ACUMINADOS', '', ''),
	(2788, 'Q2205-4240', 'Q', '1044942153', 'EILYN SHARITH SANTANA CARAZO ', '000', 'F', '0', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 7.3 x 0.6 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está engrosada y la luz puntiforme. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran un apéndice cecal con una reacción inflamatoria mediada por PNM, neutrófilos y linfocitos que comprometen la subserosa. La mucosa está intacta.\r\n\r\n', '-PERIAPENDICITIS AGUDA', '', ''),
	(2789, 'Q2205-4241', 'Q', '1201243502', 'CAMILA ANDREA CANO VANENCIA', '000', 'F', '7', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se recibe múltiples fragmentos de tejido de forma irregular, color pardo claro y consistencia elástica que en conjunto hacen un volumen de 3 ml, se toman parte.  \r\n\r\n\r\n', 'Los cortes muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', ' -HIPERPLASIA ADENOIDEA\r\n   (Adenoiditis crónica)', '', ''),
	(2790, 'Q2205-4242', 'Q', '1142946954', 'ANTHONY DE JESUS OSORIO MARTINEZ', '000', 'M', '6', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctora PERLA VILLAMOR ROJAS', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Adenoides" se recibe dos fragmentos de tejido de forma irregular, color pardo claro y consistencia elástica que juntos miden 1.1 x 0.8 x 0.6 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', ' HIPERPLASIA ADENOIDEA\r\n (Adenoiditis crónica)', '', ''),
	(2791, 'Q2205-4243', 'Q', '33336788', 'KETIS DE LA CRUZ CASTILLO', '000', 'F', '48', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDGAR GOMEZ RHENALS', NULL, '2022-05-19', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'sin material de fijación se recibe múltiples fragmentos de tejidos de forma irregular, color violáceo y consistencia friable que en conjunto hace un volumen de 4 ml. Se toma todo.', '', '', '', ''),
	(2792, 'Q2205-4244', 'Q', '32936060', 'GINA SALINAS CANTILLO', '000', 'F', '37', 'PARTICULAR', '', '898201', '30215', 'Doctora SONIA LONDOÑO GIRALDO', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Biopsia de vulva" se reciben tres fragmentos de tejido de forma irregular, color pardo grisáceo y consistencia elástica que promedian 0.2 cms. en su mayor dimensión. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran piel con acantosis irregular, papilomatosis y cambios citopáticos por VPH.\r\n\r\n\r\n\r\n\r\n', ' Biopsia de vulva:\r\n-CONDILOMA ACUMINADO', '', ''),
	(2793, 'Q2205-4245', 'Q', 'ven33656615', 'JEAN ALEJANDRO ALVARADOS RUMBO', '000', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 8.7 x 1.2 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida con aumento de la trama vascular. Al corte la pared está adelgazada y la luz dilatada y contiene abundante material fecaloide. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', 'APÉNDICITIS AGUDA', '', ''),
	(2794, 'Q2205-4246', 'Q', '1137531562', 'JORGE ALBERTO ESCANDON MEZA', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 14.5 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana fibrinopurulenta. Al corte la pared está adelgazada y la luz dilatada y contiene abundante material fecaloide. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n\r\n\r\n\r\n', 'APENDICITIS AGUDA', '', ''),
	(2795, 'Q2205-4247', 'Q', '23135672', 'LUCIA MARIA CANTILLO CASTILLO ', '000', 'F', '70', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor SAUL HERNANDEZ ALVAREZ', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 11.5 x 4 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una serosa lisa y brillante. Al corte la pared está ligeramente engrosada y la mucosa ha perdido su aspecto aterciopelado, y hay salida de  numerosos cálculos pequeños de color negruzco. Se toman cortes.\r\n\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS. ', '', ''),
	(2796, 'Q2205-4248', 'Q', '45685767', 'RUTH TORRES MELENDEZ', '000', 'F', '56', 'CLIN. SAN JOSE DE TORICES SAS', 'Puertos', '898201', '30215', 'Doctor JAVIER ACUÑA BARRIOS', NULL, '2022-05-21', '2022-05-19', 'VIRNA CARABALLO OSORIO', 'Rotulado "Vesícula" se recibe una vesícula biliar que mide 7.5 x 3 cms. en sus mayores dimensiones. La superficie externa está parcialmente cubierta por una despulida. Al corte la pared está marcadamente engrosada y la mucosa ha perdido su aspecto aterciopelado y hay salida de fragmentos de cálculo de color pardo amarillento. Se toman cortes.\r\n\r\n\r\n', 'Los cortes muestran vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', '-COLECISTITIS CRÓNICA CON COLELITIASIS.  ', '', ''),
	(2797, 'Q2205-4249', 'Q', '73105518', 'OMAR ALBERTO CONTRERAS MIRANDA', '000', 'M', '59', 'ORG. CLINICA GENERAL DEL NORTE', 'Org. Magisterio', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-05-24', '2022-05-20', 'OLIVA MARRUGO GRICE', 'rotulado "Fibroma blando" se recibe una lesión poliode que mide 1 x 0.5 cms. cubierto totalmente de por piel. Al corte una superficie lisa blanquecina. Se toma todo en dos cortes.\r\n\r\n\r\n\r\n', 'Los cortes revelan estructuras compuesta por epitelio escamoso maduro que descansa en el tallo de tejido fibroadiposo.\r\n\r\n\r\n', 'Rección de lesión glúteo derecho:\r\n-FIBROMA BLANDO.', '', ''),
	(2798, 'Q2205-4250', 'Q', '1043311277', 'SIARETH ARIANYS CARABALLO SILVA', '000', 'M', '10', 'ORG. CLINICA GENERAL DEL NORTE', 'Org. Magisterio', '898201', '30215', 'Doctor ERICK ALVAREZ PEREIRA', NULL, '2022-05-20', '2022-05-20', 'OLIVA MARRUGO GRICE', 'Rotulado "nevo verrugoso" se recibe tres punch de piel que mide 0.5 cms. color pardo oscuro, consistencia elástica. Se toma en dos casete. ', '', '', '', ''),
	(2799, 'Q2205-4251', 'Q', '1043645574', 'KATTY JULIETH MORENO DORIA', '000', 'F', '17', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-23', '2022-05-20', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice cecal" se recibe un apéndice cecal que mide 8 x 1 cms. en sus mayores dimensiones, la superficie externa está tapizada por una  serosa opaca bien vascularizada, al corte la luz es puntiforme. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. \r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA', '', ''),
	(2800, 'Q2205-4252', 'Q', 'ven1716184', 'ROXANA ANGELICA SUAREZ MORA', '000', 'F', '16', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-24', '2022-05-20', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice cecal" se recibe un apéndice cecal que mide 8 x 0.5 cms.  la superficie externa está tapizada por una serosa pardo grisáceo bien vascularizada. Al corte hay salida de material fecaloide. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal que muestra folículo hiperplásicos  en la sub mucosa, la serosa muestra congestión, edema e infiltración por PMN neutrófilos.\r\n\r\n\r\n ', ' Apendicectomía:\r\n-PERIAPENDICITIS AGUDA.', '', ''),
	(2801, 'Q2205-4253', 'Q', '1048455038', 'KLEIMER JESUS MAZA BLANQUICET', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-23', '2022-05-20', 'OLIVA MARRUGO GRICE', 'Rotulado "Apéndice cecal" se recibe un apéndice cecal que mide 9.5 x 1 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa opaca bien vascularizada con áreas pardo oscuro. Al corte hay salida de material hemorrágico. Se toman cortes.\r\n\r\n', 'Apendice cecal cuya mucosa se encuentra ulcerada, la pared infiltrada por PMN neutrófilos que se extienden hasta la grasa perIapendicular.\r\n\r\n\r\n', ' Apendicectomía:\r\n-APENDICITIS AGUDA NECROTIZANTE', '', ''),
	(2802, 'Q2205-4254', 'Q', '73075386', 'RODRIGO RODRIGUEZ OSORIO', '000', 'M', '63', 'CLIN. SAN JOSE DE TORICES SAS', 'Org. Magisterio', '898201', '30215', 'Doctor EDUARDO QUINTERO MARTINEZ', NULL, '2022-05-24', '2022-05-20', 'OLIVA MARRUGO GRICE', 'Rotulado "masa en colon descendentemente" se recibe sin marcar, segmento de colon que mide 5 x 4 x 3.5 cms. que trae adherido tejido adiposo, su serosa es pardo oscuro. Al corte se observa una lesión anular que infiltra toda la pared,\r\nSe diseca grasa pericolonica, se obtiene un ganglio, se toman cortes que se rotulan:  \r\nA- Bordes de resección. \r\nB- Bordes de resección. \r\nC- Lesión anular. \r\nD- Ganglio linfático. \r\n\r\n', 'los cortes revelan colon con un carcinoma bien diferenciado que se extiende hasta la grasa pericolonica. Uno de los bordes está comprometido. \r\nEl ganglio linfático aislado, está comprometido.\r\n\r\n\r\n ', 'Segmento de colon descendente:\r\n1. ADENOCARCINOMA BIEN DIFERENCIADO QUE INFILTRA HASTA LA GRASA PERICOLONICA.\r\n2. UNO DE LOS BORDES DE RESECCIÓN COMPROMETIDO POR EL TUMOR\r\n- GANGLIO LINFÁTICO POSITIVO PARA TUMOR (uno).', '', ''),
	(2803, 'Q2205-4255', 'Q', 'ven13347771', 'LUIS GREGORIO GUERRA GARCIA', '000', 'M', '48', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'HENRY LOUIS MONCRIEFF  VEGA', NULL, '2022-05-23', '2022-05-21', 'OLIVA MARRUGO GRICE', 'Sin fijar se recibe apéndice cecal que mide 6 x 0.5 cms. tapizada por una serosa pardo claro bien vascularizada. Al corte hay salida de material fecaloide. Se toman cortes.\r\n\r\n\r\n', 'Apéndice cecal con una mucosa intacta. Los folículos linfoides son hiperplásicos y la pared muscular y la serosa muestra la estructura usual.\r\n\r\n\r\n\r\n', 'Apéndice cecal:\r\n-HIPERPLASIA LINFOIDE REACTIVA', '', ''),
	(2804, 'Q2205-4256', 'Q', '45537362', 'CARMEN VILLADIEGO BARRAZA', '000', 'M', '43', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor JERONIMO CUESTA CASTRO', NULL, '2022-05-21', '2022-05-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero cuello y trompas" sin material de fijación se recibe útero y cuello uterino que pesa 357 grm. y mide 14 x 10 x 7 cms. El cuello tapizado por una mucosa blanquecina con orificio alagado en forma transversal, el cuerpo tapizado por una serosa color pardo claro. Al corte la cavidad endometrial está tapizada por una mucosa color violáceo, en el endometrio se observan dos masas, la mayor mide 7 x 6 x 5 cms. la menor mide 3 x 2 x 2 cms. a nivel subcutáneo encontramos una masa ovoide blanquecina que mide 2 x 1 cms. Se toman cortes por separado.\r\nSin rotular se recibe dos segmentos de trompa que miden 2 cms. una de ellas muestra una hidátide de morgagni.  \r\n\r\n', '', '', '', ''),
	(2805, 'Q2205-4257', 'Q', '30767709', 'ELAINE BAENA CANTILLO', '000', 'F', '44', 'CLIN. SAN JOSE DE TORICES SAS', 'NUEVA EPS', '898201', '30215', 'Doctor EDGARDO DURAN GONZALEZ', NULL, '2022-05-25', '2022-05-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Útero, cuello y trompas de Falopio" se recibe Útero, cuello y trompas de Falopio que pesa 960 grm. El útero está tapizado por una serosa pardo grisácea, el cuello por una mucosa blanquecina, en el fondo del útero se observan una masa subserosa blanquecina que mide 17 x 14 x 7 cms. La cavidad endometrial está tapizada por una mucosa pardo claro, la masa descrita es blanquecina, aspecto arremolinado. se toman cortes.\r\n\r\n\r\n', 'los cortes revelan cérvix con una reacción inflamatoria  cronica, el endometrio se encuentra autolizado, la masa descrita corresponde a un leiomioma con degeneración hialina. Las trompas de Falopio no muestran cambios \r\n\r\n\r\n\r\n\r\n\r\n', 'Útero (960 grm):\r\n1- CERVICITIS CRÓNICA\r\n2-ENDOMETRIO AUTOLIZADO\r\n3- LEIOMIOMA CON DEGENERACIÓN HIALINA \r\n4-TROMPAS DE FALOPIO\r\n\r\n\r\n', '', ''),
	(2806, 'Q2205-4258', 'Q', '1201219719', 'CAMILO ANDRES BARRIOS ALTAHONA', '000', 'M', '12', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor FLAVIO RICAURTE ARMESTO', NULL, '2022-05-23', '2022-05-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Ganglión" se recibe un fragmento irregular de tejido que mide 1.5 x 1 cms. blanquecino y elástico. Al corte una formación quística de 1.5 cms. Se toman cortes.   \r\n\r\n\r\n', 'Fragmentos de tejido fibroso denso con zonas de degeneración quística.\r\n\r\n\r\n', '-GANGLIÓN, muñeca derecha.', '', ''),
	(2807, 'Q2205-4259', 'Q', '1043971512', 'SAMUEL ROJAS CAMARGO', '000', 'M', '15', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor PASTOR THOMAS OLIVARES', NULL, '2022-05-23', '2022-05-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Vesícula" se recibe vesícula biliar que mide 9 x 2 cms tapizada parcialmente por una cerosa color pardo grisáceo. Al corte hay salida de múltiples cálculos color amarillento, la pared se encuentra engrosada y la mucosa ha perdido su aspecto aterciopelado. Se toman cortes.\r\n\r\n\r\n', 'Vesícula biliar con inflamación crónica, fibrosis e hipertrofia del estrato muscular.\r\n\r\n\r\n', 'Colecistectomia:\r\n-COLECISTITIS CRONICA\r\n-COLELITIASIS', '', ''),
	(2808, 'Q2205-4260', 'Q', '1137184103', 'JEISON JARABA MEJIA', '000', 'M', '32', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor. EDWIN ZUÑIGA', NULL, '2022-05-21', '2022-05-21', 'OLIVA MARRUGO GRICE', 'En recipientes rotulados y separados se reciben:\r\n1. "Punch de piel" punch de piel que mide 0.4 cms. Se toma todo y se rotula A. \r\n2."Muestra de hombro" punch que mide 0.5 cms. Se toma todo y se rotula B.', '', '', '', ''),
	(2809, 'Q2205-4261', 'Q', '122403098', 'LUIS DANIEL DAZA FUENTES', '000', 'M', '32', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-23', '2022-05-21', 'OLIVA MARRUGO GRICE', 'Rotulado "Antro gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n\r\n\r\n', 'Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\n\r\n\r\n\r\n\r\n\r\n', 'Biopsia de endoscópica de estómago:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(2810, 'Q2205-4262', 'Q', '91225414', 'PABLO ANTONIO MOTTA CANDELA ', '000', 'M', '59', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-24', '2022-05-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados se reciben:\r\n1."Antro gástrico" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.\r\n2."Cuerpo gástrico" tres fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms. Se toma todo.', 'Antro gástrico cuya la lámina propia presenta edema infiltrado mononuclear moderado, con agregados linfoides, actividad  moderada H.pylori presente.\r\nLos cortes B mucosa antrocorporal, infiltrado mononuclear moderada actividad moderada, áreas de metaplasia intestinal, H.pylori presente.\r\n\r\n\r\n\r\n\r\n', 'Biopsia endoscópica de estómago:\r\n1. GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA \r\n-H.PYLORI PRESENTE, antro.\r\n2. GASTRITIS CRÓNICA MODERADA CON ACTIVIDAD MODERADA,\r\n- METAPLASIA INTESTINAL H.PYLORI PRESENTE, antro corporal.\r\n\r\n\r\n\r\n\r\n', '', ''),
	(2811, 'Q2205-4263', 'Q', '1201225933', 'ELI DAVID FUENTES SILVERA', '000', 'M', '11', 'GASTROPACK SAS', 'ECOPETROL S.A', '898201', '30215', 'Doctor ELKIN TORRES RODRIGUEZ', NULL, '2022-05-24', '2022-05-21', 'OLIVA MARRUGO GRICE', 'En recipientes separados y rotulados, se reciben:\r\n1. "Esófago" dos diminutos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan A.\r\n2. "Antro" un  fragmento de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.5 cms.  Se toma todo y se rotulan B.\r\n3. "Cuerpo" cuatro fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms.  Se toma todo y se rotulan C.\r\n4. "Bulbo" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.4 cms. en su mayor dimensión. Se toma todo y se rotulan D.\r\n5. "Segunda porción" dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que mide 0.5 cms.  Se toma todo y se rotulan E.\r\n\r\n', 'Los cortes A revelan epitelio escamoso maduro que reposa en una lámina propia con infiltración mononuclear.\r\nLos cortes B revelan Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes C revelan mucosa corporal, Fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos.\r\nLos cortes D Y E revelan duodeno que cuya lamina propia presenta infiltrado mononuclear moderado.\r\n\r\n\r\n', 'Biopsia endoscópica superior:\r\n1. ESOFAGITIS CRÓNICA.\r\n2. GASTRITIS CRÓNICA INACTIVA, antro.\r\n3. GASTRITIS CRÓNICA INACTIVA, cuerpo.\r\n4. DUODENITIS CRÓNICA.', '', ''),
	(2812, 'Q2205-4264', 'Q', '1002192765', 'YOMAIRA LEMOS BARRIOS', '000', 'F', '31', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2022-05-24', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Restos placentarios" se recibe una placenta que pesa 132 grm. y mide 10 x 10 x 3 cms. en sus mayores dimensiones, la cara materna es marcadamente irregular, con los cotiledones aparentemente completos, la cara fetal es lisa, brillante y muestra un segmento de cordón umbilical de implantación central, de 15 cms de longitud, las membranas están completas y al corte del cordón se identifican dos vasos. Al corte se encuentra una superficie de aspecto esponjoso de color pardo claro. Se toman cortes.', '', '', '', ''),
	(2813, 'Q2205-4265', 'Q', '1143400449', 'WENDY LORAINE HECHENIQUE PRADA', '000', 'F', '25', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor RAUL MOGOLLON SAKER', NULL, '2022-05-24', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Placenta" se recibe una placenta que pesa 425 grm. y mide 15 x 15 x 3 cms. trae un segmento de cordón de 25 cms de longitud, la cara fetal es lisa, brillante y el cordón es implante central. La cara materna muestra los cotiledones aparentemente completos. Al corte se encuentra una superficie de aspecto esponjoso. Se toman cortes.', '', '', '', ''),
	(2814, 'Q2205-4266', 'Q', '228027602', 'DEYANIRA ACOSTA REVOLLO', '000', 'F', '44', 'CLIN. SAN JOSE DE TORICES SAS', '', '898201', '30215', 'Doctor SAMUEL CANTILLO VILLAR', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados se reciben:\r\nun "Útero" que pesa 493 grm. \r\nEl cuello, se recibe por separado, mide 4.5 x 3 x 2 cms. El cuerpo ha perdido su morfología habitual por la presencia de múltiples masas. En uno de sus lados se distingue una estructura que recuerda uno delos anexos. El cuello está tapizado por una mucosa color pardo claro sin lesiones aparentes, el cuerpo está completamente deformado.\r\nAl corte el canal endocervical es permeable,la cavidad endometrial está obliterada en su mayor parte por múltiples masas en la pared de color blanquecino, de forma esférica y de consistencia muy firme, cuyos diámetro, oscilan entre pocos milímetros y 8 cms. La estructura descrita previamente muestra un área de aspecto quístico de 2 cms. de diámetro y contenido de aspecto gelatinoso de color cetrino. Se toman cortes.\r\nSeparadamente, rotulado "Parte de trompa" se recibe un segmento tubular de tejido que mide 2 x 0.7 cms. Se toman cortes.', 'EL cervix presenta leve infiltracion mononuclear del estroma. El endometrio es proliferativo.\r\nLas masas descritas estan compuestas ´por fibras musculares lisas dispuestas irregularmente. Las trompas son morfologicamente normales. El ovario tiene una cavidad tapizada por elementos foliculares.\r\n\r\n\r\n', 'Útero y anexo derecho(493 grm):\r\n-CERVICITIS CRÓNICA.\r\n-ENDOMETRIO PROLIFERATIVO.\r\n-LEIOMIOMAS\r\n-TROMPAS DE FALOPIO\r\n-OVARIO DERECHO CON QUISTE FOLICULAR\r\n', '', ''),
	(2815, 'Q2205-4267', 'Q', '33025889', 'ANA ELVIRA LICONA ESCOBAR', '000', 'F', '45', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor EDGAR GOMEZ RHENALS', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "anexo izquierdo y derecho" en un mismo recipiente se reciben tres fragmentos de forma irregular de color pardo claro y consistencia elástica que miden respectivamente 5.5 y 2.5 cms. La superficie exterior es irregular, en uno de ellos al corte se encuentra una cavidad vacía. \r\nEl segundo contiene varias cavidades irregulares y el tercero muestra una cavidad que contiene un material que recuerda sangre. Se toman cortes que se rotulan A, B, y C.', 'Los cortes de las estructuras descritas muestran cavidades tapizadas por mucosa endometrial. En unos de ellos se identifica parénquima ovárico y la cavidad está parcialmente tapizada por tejido de granulación que contiene abundantes macrófagos cargados de hemosiderina.\r\n\r\n\r\n', '1. Resección de masa en anexo izquierdo:\r\n-ENDOMETRIOMA\r\n2. Resección de lesiones en peritoneo pélvico:\r\n-ENDOMETRIOSIS', '', ''),
	(2816, 'Q2205-4268', 'Q', '1082473337', 'JUAN DAVID CABRALES ORTIZ', '000', 'M', '14', 'CLINICA GENERAL DEL CARIBE SA.', '', '898201', '30215', 'Doctor OSCAR ENRIQUE ROMERO ORTIZ', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Apéndice" se recibe un apéndice cecal que mide 6.5 x 1.5 cms. en sus mayores dimensiones, la superficie externa está cubierta por una serosa despulida y parcialmente cubierta por una membrana aspecto purulento. Al corte se encuentra una luz dilatada que contiene un material grumoso de color pardo claro. Se toman cortes.\r\n\r\n', 'Los cortes muestran apéndice cecal con un proceso inflamatorio agudo que compromete todo el espesor de la pared. ', '-APÉNDICITIS AGUDA', '', ''),
	(2817, 'Q2205-4269', 'Q', '1041997148', 'BRAYAN MANUEL MARRUGO NIÑO', '000', 'F', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'Doctor STEVEN OSORIO ANAYA', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n"Amígdala derecha" una amígdala palatina que mide 2.5 x 5 x 1 cms. en sus mayores dimensiones. Al corte se encuentra una superficie homogénea color pardo claro. Se toman corte y se rotula A. \r\n"Amígdala izquierda" una amígdala palatina esencialmente similar ala antes mencionada. Se toman cortes y se rotula B.\r\n"Adenoides" se reciben varios fragmentos de tejido de forma irregular, color pardo claro y consistencia blanda que en conjunto hacen un volumen de 3 ml. Se toman partes. \r\n\r\n', 'Los cortes rotulados A y B muestran amígdalas palatinas con inflamación crónica, fibrosis e hiperplasia del tejido linfoide.\r\nLos cortes rotulados C muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', '1-AMíGDALITIS CRÓNICA\r\n2-HIPERPLASIA ADENOIDEA', '', ''),
	(2818, 'Q2205-4270', 'Q', '1047063529', 'MATHIAS GOMEZ GUZMAN', '000', 'M', '3', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Adenoides" se recibe varios fragmento de tejido de forma irregular y consistencia blanda, color pardo claro que mide 0.2 ml. Se toma corte.\r\n\r\n\r\n', 'Los cortes muestran amígdalas faríngeas con inflamación crónica e hiperplasia del tejido linfoide.\r\n\r\n\r\n', '-HIPERPLASIA ADENOIDEA', '', ''),
	(2819, 'Q2205-4271', 'Q', '1041986874', 'SARA HEREDIA MOYAR', '000', 'F', '10', 'HOSP. INF. NAPOLEON FRANCO PAREJA', '', '898201', '30215', 'doctora NELLYS MARINA RODRIGUEZ ZULETA', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Quiste tirogloso" se recibe un fragmento de tejido de forma irregular, color amarillento, aspecto graso y consistencia blanda que mide 3 x 1.5 x 1 cms. está parcialmente cubierto por una elipse de piel que al corte se continúa con una cavidad que contiene un color azul verdoso. Se toman cortes.\r\n\r\n', 'Los cortes muestran piel por debajo de la cual se encuentra un conducto tapizado por tejido de granulación densamente infiltrada por linfocitos, neutrófilos y macrófagos. No se identifica revestimiento epitelial, ni otros elementos propios del conducto tirogloso.\r\n\r\n\r\n', 'Resección de lesión en cara anterior de cuello:\r\n-VER DESCRIPCIÓN MICROSCÓPICA.', '', ''),
	(2820, 'Q2205-4272', 'Q', '45493740', 'MELT FARIDE TREJO GIL', '000', 'F', '52', 'LIGA CONTRA EL CANCER', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos. \r\n\r\n', 'Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA', '', ''),
	(2821, 'Q2205-4273', 'Q', '13838304', 'GONZALO TALERA VEGA', '000', 'M', '65', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Lesión de colon sigmoideo" se reciben seis minúsculos fragmentos de tejido de forma irregular de color blanco grisáceo y consistencia blanda que promedian un diámetro de 0.1 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran una lesión compuesta por glándulas de tipo colónico de diferentes formas y tamaños, algunas quisticamente dilatadas, tapizadas por epitelio glandular con leves atipias. Reposan en una lámina propia edematosa, congestiva y densamente infiltrada por linfocitos y células plasmáticas.\r\n\r\n', 'Biopsias endoscópicas de lesión en colon sigmoide:\r\n-ADENOMA TUBULAR (fragmentos)', '', ''),
	(2822, 'Q2205-4274', 'Q', '73574518', 'JUAN MAURICIO CASTAÑO MARIN', '000', 'M', '47', 'GASTROPACK SAS', 'PARTICULAR', '898201', '30215', 'Doctora PAOLA ZUÑIGA ALARCON', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'En recipientes separados y rotulados, se reciben:\r\n1. "Antro" dos fragmentos de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.4 cms. Se toma todo y se rotulan A.\r\n2."Cuerpo"se recibe un fragmento de tejido de forma irregular de color blanquecino y consistencia blanda que mide 0.3 cms. Se toma todo.', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos. \r\nLos cortes rotulados B muestran fragmentos de mucosa gástrica oxíntica sin alteraciones.\r\n\r\n\r\n', '1-Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA\r\n2-Biopsia endoscópica de cuerpo gástrico:\r\n-FRAGMENTO DE MUCOSA OXíNTICA ', '', ''),
	(2823, 'Q2205-4275', 'Q', '331761', 'ALVARO ESCOBAR ESPINOSA', '000', 'M', '42', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.3 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes muestran fragmentos de mucosa gástrica antral cuya lamina propia está edematosa, congestiva y densamente infiltrada por linfocitos, células plasmáticas y neutrófilos. Hay presencia de acúmulos linfoides. No se encuentran cambios atróficos, displásicos ni presencia de H. pylori.\r\n\r\n\r\n', 'Biopsia endoscópica de estómago:\r\nGASTRITIS CRÓNICA CON ACTIVIDAD INFLAMATORIA MODERADA.\r\n\r\n\r\n\r\n', '', 'NOTA: Debido al test de ureasa positivo y ala actividad inflamatoria, se buscó cuidadosamente la presencia del H. pylori y no se encontró.'),
	(2824, 'Q2205-4276', 'Q', '1047396947', 'YINA PAOLA ROMERO BALLESTAS', '000', 'F', '34', 'GASTROPACK SAS', 'ALLIANZ SEGUROS DE VIDA SA.', '898201', '30215', 'Doctora BEATRIZ  HELENA LINCE VIDES', NULL, '2022-05-25', '2022-05-24', 'JOSÉ CARABALLO GRACIA', 'Rotulado "Antro" se recibe dos fragmentos de tejido de forma irregular de color pardo claro y consistencia blanda que promedian 0.2 cms. Se toma todo.\r\n\r\n\r\n', 'Los cortes rotulados A muestran fragmentos de mucosa gástrica antral cuya morfología está preservada. Hay discreto edema e infiltración por linfocitos y células plasmáticas de la lámina propia. No se encuentra H. pylori, actividad inflamatoria ni cambios atróficos, metaplásicos ni displásicos. \r\n\r\n\r\n\r\n', 'Biopsia endoscópica de antro gástrico:\r\n-GASTRITIS CRÓNICA INACTIVA', '', '');
